INSERT INTO `t_log` VALUES (1653405329203474433, 2, 'update', 'MenuController', 'icu.xiaohu.diet_recommend.controller', '2023-05-02 22:25:24', '[420, MenuDto(name=多吃这4样天然强心剂，养心护心，越吃越年轻, description=食物中有一种微量元素，被医学专家称为“心脏的守护神”，它就是硒。硒是人体必需的微量元素，是多种酶的活性中心，缺硒会使酶的活性下降，从而导致心血管病的高发。补硒即能清垃圾、调血脂、抗老化、调免疫来减少多种心脑血管疾病的发生，又能提高免疫力和对抗疾病的能力。所以，建议中老年人，别舍不得花钱，多吃这4样富硒食物，养心护心，越吃越年轻。\r\n推荐食材：花生米、松茸、芦笋、三文鱼。, tag=null, price=12, url=null, nutrition=null, createUserId=null, mealIds=null)]', '成功', NULL, NULL, '2023-05-02 14:25:23', '2023-05-02 14:25:23', NULL, NULL, NULL);
