INSERT INTO `t_material` VALUES (5869, '猪肉', 25.00, '肉禽类', '猪肉又名豚肉，是主要家畜之一。属猪科动物。其性味甘咸平，含有丰富的蛋白质及脂肪、碳水化合物、钙、磷、铁等成分。 猪肉是日常生活的主要副食品，具有补虚强身，滋阴润燥、丰肌泽肤的作用。凡病后体弱、产后血虚、面黄赢瘦者，皆可用之作营养滋补之品。', '1,15,16,25', NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5870, '里脊', 7.00, '肉禽类', '猪肉又名豚肉，是主要家畜之一。属猪科动物。其性味甘咸平，含有丰富的蛋白质及脂肪、碳水化合物、钙、磷、铁等成分。 猪肉是日常生活的主要副食品，具有补虚强身，滋阴润燥、丰肌泽肤的作用。凡病后体弱、产后血虚、面黄赢瘦者，皆可用之作营养滋补之品。', '2,15,16,17,25', NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5871, '猪小排', 2.00, '肉禽类', '小排是指猪腹腔靠近肚腩部分的排骨，它的上边是肋排和子排。小排的肉层比较厚，并带有白色软骨。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5872, '猪大排', NULL, '肉禽类', '大排是里脊肉与背脊肉连接的部位，又称为肉排，多用于油炸。以肉片为主，但带着排骨。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5873, '排骨', NULL, '肉禽类', '排骨，指猪、牛、羊等动物剔肉后剩下的肋骨和脊椎骨，上面还附有少量肉类，可以食用，如：红烧排骨，是一道中国家常菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5874, '猪蹄', NULL, '肉禽类', '猪蹄又叫猪脚、猪手，含有丰富的胶原蛋白质，脂肪含量也比肥肉低，并且不含胆固醇，近年在对老年人衰老原因的研究中发现，人体中胶原蛋白质缺乏，是人衰老的一个重要因素。它能防治皮肤干瘪起皱、增强皮肤弹性和韧性，对延缓衰老和促进儿童生长发育都具有特殊意义。为此，人们把猪蹄称为“美容食品”和“类似于熊掌的美味佳肴”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5875, '猪肚', NULL, '肉禽类', '猪肚为猪科动物猪的胃，具有治虚劳羸弱，泄泻，下痢，消渴，小便频数，小儿疳积的功效，同时能用猪肚烹调出各种美食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5876, '五花肉', NULL, '肉禽类', '五花肉（又称肋条肉、三层肉）位于猪的腹部，猪腹部脂肪组织很多，其中又夹带着肌肉组织，肥瘦间隔，故称“五花肉”。这部分的瘦肉也最嫩且最多汁。五花肉一直是一些代表性中菜的最佳主角，如梅菜扣肉、南乳扣肉、东坡肉、回锅肉、鲁肉饭、瓜仔肉、粉蒸肉等等。它的肥肉遇热容易化，瘦肉久煮也不柴。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5877, '猪血', NULL, '肉禽类', '又名液体肉、血豆腐、血花。\r\n猪血：味甘、苦，性温，有解毒清肠、补血美容的功效。猪血富含维生素B2、维生素C、蛋白质、铁、磷、钙、尼克酸等营养成分。猪血中的血浆蛋白被人体内的胃酸分解後，产生一种解毒、清肠分解物，能够与侵入人体内的粉尘、有害金属微粒发生化合反应，易於毒素排出体外。长期接触有毒有害粉尘的人，特别是每日驾驶车辆的司机，应多吃猪血。另外，猪血富含铁，对贫血而面色苍白者有改善作用，是排毒养颜的理想食物。\r\n猪血性平、味咸、是最理想的补血佳品。猪血一年四季都有售，以色正新鲜、无夹杂猪毛和杂质、质地柔', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5878, '猪排', NULL, '肉禽类', '猪排骨提供人体生理活动必需的优质蛋白质、脂肪，尤其是丰富的钙质可维护骨骼健康。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5879, '猪脚', NULL, '肉禽类', '猪蹄又叫猪脚、猪手，含有丰富的胶原蛋白质，脂肪含量也比肥肉低，并且不含胆固醇，近年在对老年人衰老原因的研究中发现，人体中胶原蛋白质缺乏，是人衰老的一个重要因素。它能防治皮肤干瘪起皱、增强皮肤弹性和韧性，对延缓衰老和促进儿童生长发育都具有物殊意义。为此，人们把猪蹄称为“美容食品”和“类似于熊掌的美味佳肴”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5880, '猪肝', NULL, '肉禽类', '肝脏是动物体内储存养料和解毒的重要器官，含有丰富的营养物质，具有营养保健功能，是最理想的补血佳品之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5881, '猪腰', NULL, '肉禽类', '猪腰，别名是猪肾，香港人称为猪腰，因器形如古代的银锭而得名“银锭盒”。猪腰营养丰富，适宜肾虚之人、腰酸腰痛、遗精、盗汗者食用，老年人肾虚耳聋、耳鸣者也适宜食用，但是血脂偏高者和高胆固醇者忌食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5882, '子排', NULL, '肉禽类', '猪排骨提供人体生理活动必需的优质蛋白质、脂肪，尤其是丰富的钙质可维护骨骼健康。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5883, '猪肘', NULL, '肉禽类', '又名猪肘、蹄膀。\r\n猪肉是目前人们餐桌上重要的动物性食品之一。因为猪肉纤维较为细软，结缔组织较少，肌肉组织中含有较多的肌间脂肪，因此，经过烹调加工后肉味物别鲜美。\r\n猪肘分为前肘、后肘，其皮厚、筋多、胶质重。适宜凉拌、烧、制汤、炖、卤、煨等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5884, '猪心', NULL, '肉禽类', '猪心是一种营养十分丰富的食品．它含有蛋白质、脂肪、钙、磷、铁、维生素B1、维生素B2、维生素c以及烟酸等，这对加强心肌营养，增强心肌收缩力有很大的作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5885, '猪小肠', NULL, '肉禽类', '猪小肠是猪的内脏器官。是用于输送和消化食物的,有很强的韧性,并不象猪肚那样厚,还有适量的脂肪。猪小肠也叫肥肠,是一种常见的猪内脏副食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5886, '猪尾巴', NULL, '肉禽类', '又名皮打皮、节节香。猪尾由皮质和骨节组成,皮多胶质重,多用于烧、卤、酱、凉拌等烹调方法。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5887, '猪耳', NULL, '肉禽类', '猪耳朵含有蛋白质、脂肪、碳水化合物、维生素及钙、磷、铁等，具有补虚损、健脾胃的功效，适用于气血虚损、身体瘦弱者食用。 \r\n猪耳朵很有营养，并且口感非常好，尤其是当凉菜吃的“卤猪耳”，吃到嘴里是又柔韧又脆，味道鲜香不腻，且富含胶质。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5888, '猪皮', 0.00, '肉禽类', '猪科动物猪的脾脏器官。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5889, '猪舌', NULL, '肉禽类', '又名口条、猪舌头。猪舌肉质坚实，无骨，无筋膜、韧带，熟后无纤维质感。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5890, '猪骨头', NULL, '肉禽类', '猪骨即猪科动物猪的骨头。我们经常食用的是排骨和腿骨。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5891, '猪胰', NULL, '肉禽类', '为猪科动物猪的胰。我国大部分地区有饲养。宰杀后，取猪胰鲜用，或捣碎干燥制成粉剂备用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5892, '猪腿', NULL, '肉禽类', '从猪的腿部到后腿部分的肉称为腿肉，由于此部位整块都是瘦肉，脂肪含量极少，因此属于高蛋白、低脂肪且是高维生素的猪肉。一般人都可食用；湿热痰滞内蕴者慎服；肥胖、血脂较高者不宜多食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5893, '龙骨', NULL, '肉禽类', '猪龙骨是猪的脊背，肉瘦，脂肪少，含有大量骨髓，烹煮时柔软多脂的骨髓释出，骨髓可以用在调味汁、汤或煨菜里，并加入意大利炖菜中，另外也可以趁热作为开胃小点的涂酱。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5894, '肋排', NULL, '肉禽类', '肋排又名猪小排。猪小排是指猪腹腔靠近肚腩部分的排骨，它的上边是肋排和子排。小排的肉层比较厚，并带有白色软骨。味甘咸、性平，入脾、胃、肾经。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5895, '后腿肉', NULL, '肉禽类', '后腿肉称后腱,筋肉相同呈花形。适于炖、焖、酱等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5896, '棒骨', NULL, '肉禽类', '猪的腿骨，用来熬汤是极好的营养补充。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5897, '腔骨', NULL, '肉禽类', '腔骨富含蛋白质，提高人体的新陈代谢率。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5898, '猪头肉', NULL, '肉禽类', '猪头肉是北京小吃中佐酒的品种，它用猪头劈开洗净，用红烧的烹调方法煮熟后，用烟熏。色泽红润，香糯浓醇，咸甜适度，肥而不腻。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5899, '猪肺', NULL, '肉禽类', '猪肺质嫩，色红白，适于炖、卤、拌。猪肺有补虚、止咳、止血之功效。可用于治疗肺虚咳嗽、久咳咯血等症。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5900, '猪大骨', NULL, '肉禽类', '猪骨即猪科动物猪的骨头。我们经常食用的是排骨和腿骨。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5901, '猪蹄筋', NULL, '肉禽类', '猪蹄筋即连接关节的腱子，人工抽出后干制而成。蹄筋是由胶原蛋白与弹性蛋白构成。胶原蛋白，可以被消化，但其营养价值远不如肌肉组织的蛋白质，营养价值不高，但因其富含胶质，质地柔软，所以在烹调中常用作筵席菜肴的原料。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5902, '猪腱', NULL, '肉禽类', '猪腱肉是 猪大腿上的肌肉，有肉膜包裹的，内藏筋，硬度适中，纹路规则，最适合卤味。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5903, '猪后腿肉', NULL, '肉禽类', '猪肉是目前人们餐桌上重要的动物性食品之一。因为猪肉纤维较为细软，结缔组织较少，肌肉组织中含有较多的肌间脂肪，因此，经过烹调加工后肉味物别鲜美。\r\n从猪的腿部到后腿部分的肉称为腿肉，由于此部位整块都是瘦肉，脂肪含量极少，因此属于高蛋白、低脂肪且是高维生素的猪肉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5904, '猪大肠', NULL, '肉禽类', '猪肠是用于输送和消化食物的，有很强的韧性，并不象猪肚那样厚，还有适量的脂肪。猪大肠有润燥、补虚、止渴止血之功效。可用于治疗虚弱口渴、脱肛、痔疮、便血、便秘等症。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5905, '肉末', NULL, '肉禽类', '将动物肉切成的细末。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5906, '猪里脊', NULL, '肉禽类', '猪肉又名豚肉，是主要家畜之一。属猪科动物。其性味甘咸平，含有丰富的蛋白质及脂肪、碳水化合物、钙、磷、铁等成分。 猪肉是日常生活的主要副食品，具有补虚强身，滋阴润燥、丰肌泽肤的作用。凡病后体弱、产后血虚、面黄赢瘦者，皆可用之作营养滋补之品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5907, '猪颈肉', NULL, '肉禽类', '颈肉。也称槽头肉、血脖。猪颈部的肉，在前腿的前部与猪头相连处，此外是宰猪时的刀口部位，多有污血，肉色发红，肉质绵老，肥瘦不分。宜做包子、蒸饺、面臊或用于红烧、粉蒸等烹调方法。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5908, '猪肥肠', NULL, '肉禽类', '肥肠又名猪大肠、猪肠。猪肠是用于输送和消化食物的，有很强的韧性，并不象猪肚那样厚，还有适量的脂肪。根据猪肠的功能可分为大肠、小肠和肠头，它们的脂肪含量是不同的，小肠最瘦，肠头最肥。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5909, '前臀尖', NULL, '肉禽类', '又称夹心肉，位于前腿上部，半肥半瘦，肉老筋多，吸收水分能力较强，适于做馅和肉丸子。在这一部位有一排肋骨，叫小排骨，适宜作糖醋排骨或煮汤。猪肉的营养非常全面，除了蛋白质、脂肪等主要营养成分外，还含有碳水化合物、钙、磷、铁、硫胺素、核黄素和尼克酸等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5910, '后臀尖', NULL, '肉禽类', '臀尖为紧贴坐臀上的肉，浅红色，肉质细嫩，吃水性强，是猪身上食用价值很高的部分。适于做肉丁、肉段及切肉丝、肉片等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5911, '猪脑', NULL, '肉禽类', '猪的脑髓。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5912, '小里脊肉', NULL, '肉禽类', '猪和牛和羊脊椎骨内侧的条状嫩肉,做肉食时称里脊肉。小里脊是脊椎骨内侧一条肌肉，比较少，很嫩，适合做汤。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5913, '猪五花腩', NULL, '肉禽类', '猪五花腩为三层瘦肉，二层肥膘互夹，皮较薄，易烧烂。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5914, '猪龙骨', NULL, '肉禽类', '龙骨中含有大量骨髓，烹煮时柔软多脂的骨髓就会释出。骨髓可以用在调味汁、汤或煨菜里，并加入意大利炖菜中，另外也可以趁热作为开胃小点的涂酱。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5915, '猪胛心肉', NULL, '肉禽类', '猪夹心肉是靠后腿无肋骨部分称软肋，称软五花、下五花肉，质较松软。其特点是三层瘦肉，二层肥膘互夹，俗称五花三层，皮较薄，易烧烂。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5916, '猪颊肉', NULL, '肉禽类', '猪颊肉是猪脸颊上的肉，较为肥腻', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5917, '猪天梯', NULL, '肉禽类', '猪天梯即猪的下颚，猪肉是目前人们餐桌上重要的动物性食品之一。因为猪肉纤维较为细软，结缔组织较少，肌肉组织中含有较多的肌间脂肪，因此，经过烹调加工后肉味物别鲜美。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5918, '猪嘴边肉', NULL, '肉禽类', '此处的肉质细嫩、微带脆、瘦中夹肥。适宜做丁、片、碎肉末等。可用于炒、溜，或做汤等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5919, '肥膘肉', NULL, '肉禽类', '猪的脂肪层', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5920, '肥肉', NULL, '肉禽类', '中国人说的食用肥肉主要指的是肥猪肉，比如五花肉、肘子肉上的一些部分。一般也可指人身上的脂肪。肥肉的主要成分是脂肪（其中主要是饱和脂肪酸），它好像“压缩饼干”那样，与瘦肉同样多的肥肉中，肥肉能够供给人体更高的热量。脂肪还含有人体需要的卵磷脂和胆固醇。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5921, '瘦肉', NULL, '肉禽类', '猪肉是目前人们餐桌上重要的动物性食品之一。因为猪肉纤维较为细软，结缔组织较少，肌肉组织中含有较多的肌间脂肪。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5922, '肉馅', NULL, '肉禽类', '猪肉馅是指把猪肉去除皮肉和骨头，取净猪肉，再剁成肉蓉而成。根据选取猪肉部位的不同，猪肉末可分为纯瘦肉末、肥瘦肉末和肥肉末3种。纯瘦肉末系选用猪腿肉或臀尖肉加工制作而成；肥瘦肉末是选用五花肉加工而成；肥肉末是用肥膘肉配以少许瘦肉加工制作而成。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5923, '猪夹心肉', NULL, '肉禽类', '猪夹心肉是靠后腿无肋骨部分称软肋，称软五花、下五花肉，质较松软。其特点是三层瘦肉，二层肥膘互夹，俗称五花三层，皮较薄，易烧烂。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5924, '猪筒骨', NULL, '肉禽类', '猪筒骨一般是指猪后腿的腿骨，骨头比较粗大，中间有洞，可以容纳骨髓。猪筒骨两头大，中间小，骨中的骨髓含有很多骨胶原。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5925, '猪前夹肉', NULL, '肉禽类', '前夹肉，也就是猪前腿部位的肉。一般是指血脖之后，第三根肋排之前的部位的猪肉。这个部位的猪肉有个特点：嫩，韧。肌间脂肪含量高，瘦肉中间有细细的肥肉，大理石纹清晰。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5926, '前腿肉', NULL, '肉禽类', '前腿肉也称夹心肉或前臀尖。在猪颈肉下方和前肘的上方。此肉半肥半瘦，肉老筋多，吸水性强。 适合做馅料和肉丸子。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5927, '猪扇骨', NULL, '肉禽类', '猪扇骨，是猪的一个部位，即是猪的后背上肩膀下面后背上那块骨头。猪扇骨的前端有月牙状的脆骨，称为月亮骨。猪扇骨是猪肩胛骨。骨头的营养成分比植物f生食物更容易被吸收，儿童和中老年人尤为适宜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5928, '猪脾', NULL, '肉禽类', '猪科动物猪的脾脏器官。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5929, '梅花肉', NULL, '肉禽类', '梅花肉即猪的上肩肉，据说每只猪猪身上的这块肉只有5、6斤，有20cm长，横切面瘦肉占90％，期间有数条细细的肥肉丝纵横交错，所以吃的时候特别嫩而且香，更是一点也不油腻，其肉质鲜美可口，久煮不老。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5930, '猪鼻', NULL, '肉禽类', '猪鼻唇（《本草纲目》）、拱鼻（广东）、拱嘴、猪嘴。一般指猪嘴上半部带鼻孔的部分，上及于眼部。主要由皮层构成，有的多横形深皱褶。又名猪拱嘴，冲嘴。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5931, '牛肉', NULL, '肉禽类', '牛肉是全世界人都爱吃的食品，中国人消费的肉类食品之一，仅次于猪肉，牛肉蛋白质含量高，而脂肪含量低，所以味道鲜美，受人喜爱，享有“肉中骄子”的美称。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5932, '牛腩', NULL, '肉禽类', '牛腩即牛腹部及靠近牛肋处的松软肌肉，以新鲜黄牛的牛腩为好。是指带有筋、肉、油花的肉块，这只是一种统称。若依部位来分，牛身上许多地方的肉都可以叫做牛腩。国外进口的部分是以切成条状的牛肋条为主（又称条肉），是取自肋骨间的去骨条状肉，瘦肉较多，脂肪较少，筋也较少，适合红烧或炖汤。另外，在里脊肉上层有一片筋少、油少、肉多，但形状不大规则的里脊边，也可以称作牛腩，是上等的红烧部位。牛腱也可以算是牛腩的一种，筋肉多，油少，甚至全是瘦肉。因此一般用来卤，不适合炖汤，更不适合红烧。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5933, '牛排', NULL, '肉禽类', '英文STEAK一词是牛排的统称，其种类非常多，常见的有以下四种：\r\nTENDERLOIN（嫩牛柳，牛里脊），又叫FILLET（菲力），是牛脊上最嫩的肉，几乎不含肥膘，因此很受爱吃瘦肉朋友的青睐。由于肉质嫩，煎成3成熟、5成熟和7成熟皆宜。\r\nRIB－EYE（肉眼牛排），瘦肉和肥肉兼而有之，由于含一定肥膘，这种肉煎烤味道比较香。食用时不要煎得过熟，3成熟最好。\r\nSIRLOIN（西冷牛排，牛外脊），含一定肥油，由于是牛外脊，在肉的外延带一圈呈白色的肉筋，总体口感韧度强、肉质硬、有嚼头，适合年轻人和牙口好的人', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5934, '牛杂', NULL, '肉禽类', '牛杂碎包括牛肚、牛心、牛肝、百叶、牛肠等。由于其蛋白质较高，营养丰富。且很容易被胃肠吸收，是有益于健康的绝佳食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5935, '牛心', NULL, '肉禽类', '牛的心脏。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5936, '牛尾', NULL, '肉禽类', '牛尾为黄牛或水牛的尾部，营养价值极高，宜炖食。含有蛋白质、脂肪、维生素等成分。具有有补气、养血、强筋骨的功效.', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5937, '牛腿肉', NULL, '肉禽类', '牛肉是中国人的第二大肉类食品，仅次于猪肉，牛肉蛋白质含量高，而脂肪含量低，所以味道鲜美，受人喜爱，享有“肉中骄子”的美称。\r\n牛腿肉脂肪的含量极少，如果将其周围的脂肪削除掉，脂肪的含量便比腓力肉还少。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5938, '牛蹄筋', NULL, '肉禽类', '牛蹄筋就是附在牛蹄骨上的韧带。含丰富的胶原蛋白质，脂肪含量也比肥肉低，并且不含胆固醇。能增强细胞生理代谢，使皮肤更富有弹性和韧性，延缓皮肤的衰老。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5939, '牛蹄', NULL, '肉禽类', '牛科动物黄牛或水牛的蹄。清热止血、利水消肿。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5940, '牛舌', NULL, '肉禽类', '牛舌，即牛的舌头，属于肉类。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5941, '牛脑', NULL, '肉禽类', '牛科动物黄牛或水牛的脑。牛脑味甘，性温、微毒，入肝、脾、胃经，具有养血息风，生津止渴，消食化积之功效，治眩晕，消渴，痞气。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5942, '牛里脊', NULL, '肉禽类', '牛里脊肉是脊骨里面的一条瘦肉。肉质细嫩，适于滑炒、滑熘、软炸。牛肉有补中益气，滋养脾胃，强健筋骨，化痰息风，止渴止涎之功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5943, '牛筋', NULL, '肉禽类', '牛筋含丰富的胶原蛋白质，脂肪含量也比肥肉低，并且不含胆固醇。能增强细胞生理代谢，使皮肤更富有弹性和韧性，延缓皮肤的衰老。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5944, '牛腱子', NULL, '肉禽类', '牛腱子肉即前后腿肉。有补中益气，滋养脾胃，强健筋骨，化痰息风，止渴止涎之功效，适宜于中气下隐、气短体虚、筋骨酸软、贫血久病及面黄目眩之人食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5945, '牛骨髓', NULL, '肉禽类', '牛骨髓为牛科动物黄牛或水牛的骨髓。每100克牛骨髓含蛋白质36.8克、钙304毫克，是高蛋白、低脂肪及含优质有机钙的富营养原料，很多壮骨粉、补钙产品所用原料就是来自牛骨髓。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5946, '牛骨', NULL, '肉禽类', '牛骨是牛科动物黄牛或水牛的骨骼。味甘，性温，无毒。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5947, '牛肝', NULL, '肉禽类', '牛科动物黄牛或水牛的肝。能保护眼睛，维持正常视力，防止眼睛干涩、疲劳；维持健康的肤色，对皮肤的健美具有重要意义。一般人群均可食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5948, '牛肚', NULL, '肉禽类', '牛肚即牛胃。别名：百叶、肚尖、牛胃、毛肚。牛肚含蛋白质、脂肪、钙、磷、铁、硫胺素、核黄素、尼克酸等，具有补益脾胃，补气养血，补虚益精、消渴、风眩之功效，适宜于病后虚羸、气血不足、营养不良、脾胃薄弱之人。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5949, '牛鞭', NULL, '肉禽类', '牛鞭即公牛的生殖器。牛鞭含有雄激素、蛋白质、脂肪等，可补肾扶阳,主治肾虚阳痿、遗精、腰膝酸软。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5950, '牛百叶', NULL, '肉禽类', '牛肚即牛胃。别名：百叶、肚尖、牛胃、毛肚。牛肚即牛胃。牛肚含蛋白质、脂肪、钙、磷、铁、硫胺素、核黄素、尼克酸等，具有补益脾胃，补气养血，补虚益精、消渴、风眩之功效，适宜于病后虚羸、气血不足、营养不良、脾胃薄弱之人。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5951, '牦牛肉', NULL, '肉禽类', '牦牛是生长在地球之巅的高寒、无任何污染环境、独特的半野生半原始珍稀动物，与北极熊、南极企鹅共称为“世界三大高寒动物”。牦牛终身无劳役，逐水草而居的半野生放牧方式、原始自然的生长过程，一生中摄入大量的虫草、贝母等名贵中草药，使牦牛肉质细嫩，味道鲜美。牦牛肉被誉为“牛肉之冠”，属半野生天然绿色食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5952, '牛仔骨', NULL, '肉禽类', '牛肋骨为牛科动物黄牛或水牛腹部的骨骼，据《本朝纲目》记载，“甘，温，无毒。”', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5953, '肥牛', NULL, '肉禽类', '肥牛是一种高密度食品，美味而且营养丰富，不但提供丰富的蛋白质、铁、锌、钙还是每天需要的维生素B群，包括叶酸、维生素B和核黄素等的最佳来源。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5954, '牛上脑', NULL, '肉禽类', '位于肩颈部靠后，脊骨两侧，肉质细嫩多汁，脂肪杂交均匀，有好看的大理石花纹。口感绵软，入口即化，脂肪低而蛋白质含量高，是涮火锅的首选，可煎炸，炸和烧烤。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5955, '牛腱子肉', NULL, '肉禽类', '即牛大腿上的肉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5956, '牛肋骨', NULL, '肉禽类', '牛肋骨为牛科动物黄牛或水牛腹部的骨骼，据《本朝纲目》记载，“甘，温，无毒。”', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5957, '牛头皮', NULL, '肉禽类', '牛头皮是脊椎动物牛科黄牛或水牛被宰杀后而得到的包围牛头骨外的一层皮，烹饪后可供食用，营养丰富。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5958, '牛膝盖骨', NULL, '肉禽类', '牛膝盖骨为牛科动物黄牛或水牛的膝盖的骨骼，主要是软骨组织。据《本朝纲目》记载，“甘，温，无毒。”', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5959, '牛肺', NULL, '肉禽类', '牛科动物黄牛或水牛的肺。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5960, '牛五花肉', NULL, '肉禽类', '牛五花肉(又称肋条肉、三层肉)位于牛的腹部，牛腹部脂肪组织很多，其中又夹带着肌肉组织，肥瘦间隔，故称“牛五花肉”。这部分的瘦肉也最嫩且最多汁。五花肉一直是一些代表性中菜的最佳主角，如梅菜扣肉、南乳扣肉、东坡肉、回锅肉、鲁肉饭、瓜仔肉、粉蒸肉等等。它的肥肉遇热容易化，瘦肉久煮也不柴。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5961, '牛肾', NULL, '肉禽类', '牛科动物黄牛或水牛肾脏。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5962, '牛髓', NULL, '肉禽类', '牛髓就是指牛科动物黄牛或水牛的骨髓。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5963, '牛大肠', NULL, '肉禽类', '牛大肠，包括牛结肠和直肠，是对食物残渣中的水液进行吸收，形成粪便并有度排出的脏器。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5964, '牛血', NULL, '肉禽类', '牛血是指牛科动物黄牛或水牛的血液。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5965, '牛外脊', NULL, '肉禽类', '牛外脊，在中文中一般音译为西冷、西冷牛肉。一般把西冷牛排(SIRLOIN STEAK)，也简称为西冷。也有音译为萨朗或莎朗的。SIRLOIN指的的是牛腰椎棘突两侧的长条状肉，外连皮下脂肪(皮下脂肪再往外即皮肤)，内连腰椎。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5966, '牛小排', NULL, '肉禽类', '牛小排：牛的胸腔左右两侧，含肋骨部分。肉质鲜美，有大理石纹。适合用以烤、煎、炸、红烧。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5967, '黄牛肉', NULL, '肉禽类', '黄牛肉为牛科动物黄牛的肉。黄牛肉属于温热性质的肉食，擅长补气，是气虚之人进行食养食疗的首选肉食，就好象气虚之人进行药疗常常首选黄芪那样，所以《韩氏医通》说“黄牛肉补气，与绵黄芪同功。”就补养的脏腑来说，黄牛肉重在补养脾胃，从而滋养其他脏腑。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5968, '牛板筋', NULL, '肉禽类', '牛板筋，是指牛背部两块连接全身运动肌肉的主大筋。自从市场上有了新疆羊肉串，牛板筋才大量出现在餐桌上。板筋特有的纤维组织，令其口感异常美妙入口耐嚼而化渣，很快风靡东三省。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:28:59', '2023-04-03 14:28:59', NULL);
INSERT INTO `t_material` VALUES (5969, '毛肚', NULL, '肉禽类', '毛肚也称百叶肚，俗称牛百叶，其实就是牛的瓣胃。牛是反刍动物，与其他的家畜不同，最大的特点是有四个胃，分别是瘤胃、网胃（蜂巢胃）、瓣胃（百叶胃，俗称牛百叶）和皱胃。前3个胃里面没有胃腺，不分泌胃液，统称为前胃。第四个胃有胃腺，能分泌消化液，与猪和人的胃类似，所以也叫真胃。 牛百叶还分两种，吃饲料长大的牛百叶发黑，吃粮食庄稼长大的牛百叶发黄。毛肚不是植物，是指新鲜的牛百叶，表面是黑色的；白色的牛百叶是漂过的，是冷冻食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5970, '牛霖', NULL, '肉禽类', '牛霖，学名“膝圆”。即牛的膝盖的位置，又因为这块肉的自然形状是圆的，又被厨师们称为“和尚头”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5971, '牛肉丸', NULL, '肉禽类', '牛肉丸，又称手捶牛肉丸，是广东省汕头市有名的传统小吃之一，起源于潮菜。牛肉丸作为汕头市乃至整个广东潮汕地区最知名、最大众化的特色传统小吃，其既可作点心，又可作为一道筵席汤菜，牛肉丸制作细致，色泽红润，柔脆有弹性，鲜美馨香，口感嫩滑。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5972, '鸡肉', NULL, '肉禽类', '顾名思义，鸡肉就是鸡身上的肉，鸡的肉质细嫩，滋味鲜美，适合多种烹调方法，并富有营养，有滋补养身的作用。鸡肉不但适于热炒、炖汤，而且是比较适合冷食凉拌的肉类。但切忌吃过多的鸡翅等鸡肉类食品，以免引起肥胖。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5973, '鸡翅', NULL, '肉禽类', '又名鸡翼、大转弯。\n\r\n鸡翅也称“鸡翼”“大转弯”。鸡的翅膀。肉少，皮富胶质。又分“鸡膀”“膀尖”两种。鸡膀，连接鸡体至鸡翅的第一关节处，肉质较多；膀尖，鸡翅第一关节处至膀尖，骨多肉少。\n\r\n看起来虽然没有多少肉，而且没多大价值，但是在软骨或骨头中，可摄取动物胶的结合组织，是含有大量的成胶原及弹性蛋白的，对于血管、皮肤及内脏颇具效果。翅膀内所含大量的维生素A，远超过青椒。烹调翅膀肉时，应以慢火烧煮，才能发出香浓的味道，而成胶原等有效的成分，也必须以长时间烧煮才可溶化。其表面所产生疙瘩般的小颗粒，有许多', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5974, '鸡腿', NULL, '肉禽类', '鸡腿是是从脚到腿的部位，及腿根一带的肉，其肉质颇坚硬，连皮一起摄取时，脂肪的含量较多，也是在整只鸡中铁分含量最多的一部分。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5975, '鸡爪', NULL, '肉禽类', '鸡爪 也称“鸡掌”“凤爪”“凤足”。多皮、筋，胶质大。常用于煮汤，也宜于卤、酱。如：卤鸡爪、酱鸡爪。质地肥厚的还可煮熟后脱骨拌食，如：椒麻鸡掌、拆骨掌翅，皆脆嫩可口。\r\n鸡爪在美食家的菜谱上不叫鸡爪，而称做凤爪，在南方，凤爪可是一道上档次的名菜，其烹饪方法也较复杂。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5976, '乌鸡', NULL, '肉禽类', '又名乌骨鸡、药鸡、武山鸡、羊毛鸡、绒毛鸡、松毛鸡、黑脚鸡、丛冠鸡、穿裤鸡、竹丝鸡。乌骨鸡为雉科动物，因皮、肉、骨嘴均为黑色，故而得名，但人工饲养的乌骨鸡有毛白骨乌，也有斑毛乌骨及向白骨乌几中。乌骨鸡含有丰富的蛋白质，其蛋白质含量比鸭肉、鹅肉多；乌骨鸡还含有丰富的黑色素，入药后能起到使人体内的红血球和血色素增生的作用。因此，乌鸡自古以来，一直被认为是滋补上品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5977, '鸡骨架', NULL, '肉禽类', '鸡骨架俗称“鸡壳”“鸡车子”。指剔去鸡肉后剩下的骨骼。多用于煮汤。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5978, '翅根', NULL, '肉禽类', '鸡翅即鸡翼，俗称鸡翅膀，是整个鸡身最为鲜嫩可口的部位之一，常见于多种菜肴或小吃中。常见如可乐鸡翅等。根据需求，还可以分为翅尖，翅中，翅根3部分。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5979, '鸡脖', NULL, '肉禽类', '鸡的脖子', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5980, '老母鸡', NULL, '肉禽类', '从中医上来说，母鸡的鸡肉属阴，比较适合年老体弱及久病体虚者食用。而老母鸡由于生长期长，鸡肉中所含的鲜味物质要比仔鸡多，这是使鸡汤味道更鲜美的主要原因。不过，从营养上来说，老母鸡肉中蛋白质含量较少。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5981, '鸡中翅', NULL, '肉禽类', '就是鸡翅膀中间的那一截', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5982, '鸡胗', NULL, '肉禽类', '鸡胗也称“鸡胃”。俗称“鸡肫”。鸡杂之一。形扁圆，外有筋膜，内有肫皮，两侧为肫肉。其肉为紫红色，质韧，熟后脆嫩。宜制冷、热菜肴。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5983, '鸡胸肉', NULL, '肉禽类', '鸡胸肉，是鸡身上最大的两块肉。常见鸡肉，鸡胸肉是在胸部里侧的肉，形状像斗笠，胸脯肉。肉质细嫩，滋味鲜美，营养丰富，能滋补养身。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5984, '山鸡', NULL, '肉禽类', '山鸡又名野鸡，稚鸡。其肉质细嫩鲜美，清香可口，高蛋白（达31.30％），底脂肪（仅为0.98％），几乎不含胆固醇。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5985, '翅尖', NULL, '肉禽类', '鸡翅尖即鸡翅膀的外端，鸡翅含有多量可强健血管及皮肤的成胶原及弹性蛋白等，对于血管、皮肤及内脏颇具效果。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5986, '柴鸡', NULL, '肉禽类', '柴鸡又叫笨鸡，具有耐粗饲、就巢性强和抗病力强等特性，肉质鲜美。鸡肉对营养不良、畏寒怕冷、乏力疲劳、月经不调、贫血、虚弱等有很好的食疗作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5987, '鸡肾', NULL, '肉禽类', '鸡肾是鸡的一种器官，属于泌尿系统的一部分，负责过滤血液中的杂质、维持体液和电解质的平衡，最后产生尿液经由后续管道排出体外；同时也具备内分泌的功能以调节血压。并不是俗称的“鸡腰子”，一般老百姓俗称的“鸡腰子”实为鸡的生殖器官“睾丸”，应注意与鸡肾区别。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5988, '三黄鸡', NULL, '肉禽类', '三黄鸡其原义是指黄羽、黄喙、黄脚的鸡，此外还要求皮肤也是黄的，这种鸡肉质嫩滑，皮脆骨软，脂肪丰满和味道鲜美。而现在所称的三黄鸡，不是特指某一个品种，而是指黄羽优质肉鸡的统称。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5989, '琵琶腿', NULL, '肉禽类', '鸡腿上鸡爪与大腿之间的部分，大概形状像琵琶，因此叫琵琶腿。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5990, '鸡脆骨', NULL, '肉禽类', '鸡脆骨，是指鸡关节处一块鸡脆骨，其色泽浅黄、略带一点肉，如同指甲大小，口感爽脆。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5991, '鸡杂', NULL, '肉禽类', '鸡杂，即包括鸡心、鸡肝、鸡肾、鸡肠等，鲜美可口，且有多样营养素。中医认为它们皆有助消化、和脾胃之功效。合而为汤，能健胃消食、润肤养肌。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5992, '鸡心', NULL, '肉禽类', '鸡心鸡杂之一。色紫红，形呈锥形、质韧，外表附有油脂和筋络，内含污血、须漂洗后才可使用。一般人群均可食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5993, '鸡肝', NULL, '肉禽类', '鸡肝为雉科动物家鸡的肝脏。鸡杂之一。呈大小双叶，叶面有苦胆和筋络(加工时须摘去)。其色紫红，质细嫩。鸡肝含有丰富的蛋白质、钙、磷、铁、锌、维生素A、B族维生素。肝中铁质丰富，是补血食品中最常用的食物。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5994, '火鸡', NULL, '肉禽类', '火鸡，又名七面鸟或吐绶鸡，是一种原产于北美洲的家禽。在营养价值上有“一高二低”的优点。一高是蛋白质含量高，二低是脂肪低，胆固醇低，并含有丰富的铁，锌，磷，钾及维生素B。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5995, '整鸡', NULL, '肉禽类', '鸡的肉质细嫩，滋味鲜美，适合多种烹调方法，并富有营养，有滋补养身的作用。鸡肉不但适于热炒、炖汤，而且是比较适合冷食凉拌的肉类。但切忌吃过多的鸡翅等鸡肉类食品，以免引起肥胖。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5996, '仔鸡', NULL, '肉禽类', '体重约一磅重的宴席上用的小鸡', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5997, '鸡肫', NULL, '肉禽类', '鸡肫也称“鸡胃”。俗称“鸡肫”。鸡杂之一。形扁圆，外有筋膜，内有肫皮，两侧为肫肉。其肉为紫红色，质韧，熟后脆嫩。宜制冷、热菜肴。韧脆适中，口感好。常用于炸、爆、卤等。如：炸肫仁、火靠菊花肫、爆肫花、卤鸡肫。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5998, '肉鸡', NULL, '肉禽类', '肉鸡具有冠羽(凤头)和胫羽，少数有趾羽，有的有冉须，常称三羽(凤头、毛脚和胡须)，并具有“S”型冠。羽毛蓬松，尾羽高翘，十分惹人喜爱。平均活重12周龄959.7克，20周龄公鸡1500克，母鸡1200克。肉质细嫩，肉味鲜美，适合多种传统烹调方法。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (5999, '鸡皮', NULL, '肉禽类', '动物“鸡”的皮。烹饪后可食用，含有大量的胶原蛋白，能使皮肤光滑，有一定祛皱作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6000, '土鸡', NULL, '肉禽类', '土鸡也叫草鸡、笨鸡，是指放养在山野林间、果园的肉鸡。具有耐粗饲、就巢性强和抗病力强等特性，肉质鲜美。鸡蛋在城乡市场上非常畅销，且蛋价也高于普通鸡蛋。鸡肉、蛋品质优良、营养丰富，市场需求前景广阔.对于具备一定条件的农户来说，饲养柴鸡的成本又比较低廉，适合家庭养殖。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6001, '春鸡', NULL, '肉禽类', '所谓春鸡当年的本地土鸡,鸡龄半年左右,郊区农村放养不喂饲料', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6002, '文昌鸡', NULL, '肉禽类', '文昌鸡是中国最佳食用型鸡种之一，在海南素有“没有文昌鸡不成席”之说。鸡食榕树籽而肥，放养8-9个月再用笼圈于安静避光之处，饲以花生饼、椰肉丝、蕃茨、热米饭等催肥。 文昌鸡列为海南“四大名菜”之一，而且是驰名中外的一道名菜。其肉质滑嫩，皮薄骨酥，香味甚浓，肥而不腻。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6003, '宫廷鸡', NULL, '肉禽类', '宫廷鸡原产地在北京城北侧安定门和德胜门外的近郊一带，以朝阳区所属的大屯和洼里两个乡最为集中，其邻近地区，如海淀、清河等也有一定数量的分布。据民间相沿传说，宫廷鸡这一品种在清朝中期即已出现，距今已有近300余年的历史。 七十年代，北京兴办工厂化养鸡，大量引进外国专门化鸡种，地方鸡种受到严重的冲击。生产性能较低的宫廷鸡数量锐减，面临杂化和濒于灭绝的境地。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6004, '童子鸡', NULL, '肉禽类', '童子鸡就是还未打鸣的小公鸡，相较于较老的鸡来说，其肉质更加的鲜嫩，而且还含有一定的生长激素，对小孩和老人是很不错的滋养品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6005, '羊肉', NULL, '肉禽类', '羊肉有山羊肉、绵羊肉、野羊肉之分。古时称羊肉为羖肉、羝肉、羯肉。它既能御风寒，又可补身体，对一般风寒咳嗽、慢性气管炎、虚寒哮喘、肾亏阳痿、腹部冷痛、体虚怕冷、腰膝酸软、面黄肌瘦、气血两亏、病后或产后身体虚亏等一切虚状均有治疗和补益效果，最适宜于冬季食用，故被称为冬令补品，深受人们欢迎。由于羊肉有一股令人讨厌的羊膻怪味，故被一部分人所冷落。其实，一公斤羊肉若能放入10克甘草和适量料酒、生姜一起烹调，即能够去其膻气而又可保持其羊肉风味。\r\n羊肉是指从羊身上得出的肉，古时称为羖肉、羝肉、羯肉，为全世界普遍的肉品', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6006, '羊排', NULL, '肉禽类', '肋条即连着肋骨的肉，外覆一层层薄膜，肥瘦结合，质地松软。适于扒、烧、焖和制馅等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6007, '羊蝎子', NULL, '肉禽类', '羊蝎子就是羊大梁，因其形状酷似蝎子，故而俗称羊蝎子。羊蝎子常可用来做清汤火锅，味道鲜美。羊蝎子低脂肪；低胆固醇；低血糖；高蛋白；富含钙质。易于吸收，有滋阴补肾，养颜壮阳功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6008, '羊血', NULL, '肉禽类', '为羊科动物山羊、绵羊的血、黑褐色或深紫色。\n', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6009, '羊心', NULL, '肉禽类', '来源为牛科动物山羊或绵羊的心脏，动物形态详羊肉条。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6010, '羊下水', NULL, '肉禽类', '羊杂即羊下水，把羊头、蹄、心肝、肠肺以及羊血洗净、煮熟、切碎。加上葱、蒜、辣椒等调料，装入锅内，放一块羊尾油，还可另加细粉条，煮好后，捞到碗里红白相间，热气腾腾，油而不腻，令人垂涎欲滴.', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6011, '羊蹄', NULL, '肉禽类', '羊蹄，即羊的四足。羊蹄含有丰富的胶原蛋白质，脂肪含量也比肥肉低，并且不含胆固醇，能增强人体细胞生理代谢，使皮肤更富有弹性和韧性，延缓皮肤的衰老，羊蹄还具有强筋壮骨之功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6012, '羊脑', NULL, '肉禽类', '羊脑是淡粉红色且质地细嫩。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6013, '羊肺', NULL, '肉禽类', '羊肺为牛科动物山羊或绵羊的肺。羊肺含有丰富蛋白质、铁、硒等营养元素，有补益肺气,利尿行水的作用。羊肺含有丰富蛋白质、铁、硒等营养元素，有补益肺气,利尿行水的作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6014, '羊腿肉', NULL, '肉禽类', '羊前腿肉：羊肉肉质细嫩，容易消化，高蛋白、低脂肪、含磷脂多，较猪肉和牛肉的脂肪含量都要少，胆固醇含量少，是冬季防寒温补的美味之一；羊肉性温味甘，既可食补，又可食疗，为优良的强壮祛疾食品，有益气补虚，温中暖下，补肾壮阳，生肌健力，抵御风寒之功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6015, '羊头', NULL, '肉禽类', '羊头营养丰富，兼有治多种疾病的效用，历来为人喜食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6016, '羊羔肉', NULL, '肉禽类', '羊羔肉多选择当年羯羊或周岁以内的羊来制成。做法以爆炒、清蒸、黄焖为主。流行于宁夏、甘肃、青海、新疆四省区的回族聚居区，都是各地的特色清真美食。具有高蛋白、低脂肪的特点。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6017, '羊肚', NULL, '肉禽类', '羊肚为牛科动物山羊或绵羊的胃。一般人群均可食用，尤适宜体质赢瘦，虚劳衰弱之人食用；适宜胃气虚弱，反胃，不食，以及盗汗，尿频之人食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6018, '羊腩', NULL, '肉禽类', '羊腩是贴着羊排骨的肉。就是奶脯，牛腩、羊腩基本上对应的是猪的五花肉那位置。\r\n羊肉是我国人民食用的主要肉类之一，羊肉较猪肉的肉质要细嫩，较猪肉和牛肉的脂肪、胆固醇含量都要少。冬季食用，可收到进补和防寒的双重效果。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6019, '羊头肉', NULL, '肉禽类', '羊头肉是北京小吃中的精品，以羊头为主要原料，具有食补价值，且制作方法多样，深受欢迎。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6020, '羊前腿肉', NULL, '肉禽类', '羊前腿肉称前锤子，肉中夹筋 ，筋肉相连，适于酱制。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6021, '羊后腿肉', NULL, '肉禽类', '羊是纯食草动物，所以羊肉较牛肉的肉质要细嫩，容易消化，高蛋白、低脂肪、含磷脂多，较猪肉和牛肉的脂肪含量都要少，胆固醇含量少，是冬季防寒温补的美味之一，可收到进补和防寒的双重效果。羊后腿肉，肉中夹筋 ，筋肉相连，较适于酱制。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6022, '羊里脊', NULL, '肉禽类', '羊里脊是紧靠脊骨后侧的小长条肉，纤维细长，质地软嫩。适于熘、炒、炸、 煎等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6023, '羊腰子', NULL, '肉禽类', '羊腰子又名羊肾，为牛科动物山羊或绵羊的内脏的肾脏器官。羊腰子从中医药学建立以来，就是用做人类抗衰老延年益寿进补的主要药食品。由羊腰子配制的名酒、名肴、名膳，多不胜举。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6024, '羊眼', NULL, '肉禽类', '羊眼睛是羊的视觉器官，由眼球和眼的附属器官组成，主要部分是眼球。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6025, '羊肝', NULL, '肉禽类', '羊的肝脏', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6026, '羊骨', NULL, '肉禽类', '羊骨中含有磷酸钙、碳酸钙、骨胶原的等成分。其性味肝温，有补肾、强筋的作用。可用于血小板减少性子癜、再生不良性贫血、筋骨疼痛、要软乏力、白浊、淋痛、久泻、久痢等病症。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6027, '羊髓', NULL, '肉禽类', '羊髓，即山羊或绵羊的骨髓或脊髓。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6028, '羊肩排', NULL, '肉禽类', '羊肩排即连着肩胛骨的肉，外覆一层层薄膜，肥瘦结合，质地松软。适于扒、烧、焖和制馅等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6029, '羊大肠', NULL, '肉禽类', '羊大肠肠是用于输送和消化食物的，有很强的韧性，还有适量的脂肪，肠头最肥。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6030, '羊舌', NULL, '肉禽类', '羊舌肉质坚实，无骨，无筋膜、韧带，熟后无纤维质感。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6031, '羊蹄筋', NULL, '肉禽类', '羊筋是羊蹄的韧带。在宰杀季节，经过剔取、拉直、阴干后，扎成小把，可长期保存，久藏不坏。羊筋分前筋(前小腿的筋)、后筋(后小腿的筋)。后筋比前筋长，质量较高。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6032, '羊臀', NULL, '肉禽类', '羊臀，取自后腿近臀部的肉，外形呈圆滑状，俗称打棒肉，又称为和尚头。肉质细而有嚼劲，吃后满口生香，脂肪含量少，口感略涩，堪称美味一绝。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6033, '羊尾', NULL, '肉禽类', '羊的尾巴，尾巴富含胶质、风味十足。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6034, '羊杂', NULL, '肉禽类', '羊杂即羊下水，把羊头、蹄、心肝、肠肺以及羊血洗净、煮熟、切碎。羊杂大西北地区常见的传统风味汤类小吃，羊杂的做法有很多种可以做汤可以菜。\r\n羊杂加上葱、蒜、辣椒等调料，装入锅内，放一块羊尾油，还可另加细粉条，煮好后，捞到碗里红白相间，热气腾腾，油而不腻，令人垂涎欲滴。是一道暖胃、驱寒的保健佳肴。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6035, '鸡蛋', NULL, '肉禽类', '鸡蛋是一种营养非常丰富、价格相对低廉的常用食品。它的食用对象A相当广泛，从4～5个月的婴儿一直到老人，都适宜食用鸡蛋。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6036, '鸭蛋', NULL, '肉禽类', '鸭蛋，又名鸭子、鸭卵、太平、鸭春、青皮等，为鸭科动物家鸭的卵，可孵化成小鸭。主要含蛋白质、脂肪、钙、磷、铁、钾、钠、氯等营养成分。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6037, '鹌鹑蛋', NULL, '肉禽类', '又名鹑鸟蛋、鹌鹑卵。\r\n鹌鹑蛋被认为是 “动物中的人参”。宜常食为滋补食疗品。俗话说：“要吃飞禽，鸽子鹌鹑。”鹌鹑肉、蛋，味道鲜美，营养丰富。鹌鹑蛋是一种很好的滋补品，在营养上有独特之处，故有\"卵中佳品\"之称。近圆形，个体很小，一般只有５g左右，表面有棕褐色斑点。鹌鹑蛋的营养价值不亚于鸡蛋，有较好护肤、美肤作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6038, '皮蛋', NULL, '肉禽类', '又名松花蛋、变蛋、彩蛋、碱蛋、泥蛋。\r\n是用石灰等原料腌制后的蛋类食品，因蛋白中常有松针状的结晶或花纹而得名。它是我国传统的风味蛋制品，不仅为国内广大消费者所喜爱，在国际市场上也享有盛名。\r\n将生鸭蛋腌人石灰和谷壳中约50～100天，就变成了半透明的蓝绿色，看起来会老许多，因此英文名为“一千岁”。它的质地坚实，味道浓郁而略带腥味，是中国的美食，通常去壳切片后蒸煮，并放凉供食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6039, '鹅蛋', NULL, '肉禽类', '鹅蛋成椭圆形，个体很大，一般可达80-100g，表面较光滑，呈白色，其蛋白质含量低于鸡蛋；脂肪含量高于其他蛋类，鹅蛋中还含有多种维生素及矿物质，但质地较粗糙，草腥味较重，食味不及鸡鸭蛋。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6040, '鸽子蛋', NULL, '肉禽类', '鸽子蛋是为鸠鸽科动物原鸽或家鸽等的蛋。鸽蛋含有大量优质蛋白质及少量脂肪、并含少量糖分,磷脂、铁、钙、维生素A、维生素B1、维生素D等营养成分，易于消化吸收。鸽蛋乃孕妇、儿童、病人等人群的高级营养品，也是宴席上的一道时尚菜，但是食积胃热者不宜食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6041, '蛋清', NULL, '肉禽类', '鸡蛋清不但可以使皮肤变白，而且能使皮肤细嫩。这是因为它含有丰富的蛋白质和少量醋酸，蛋白质可以增强皮肤的润滑作用，醋酸可以保护皮肤的微酸性，以防细菌感染。此外，鸡蛋清还具有清热解毒作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6042, '蛋黄', NULL, '肉禽类', '蛋黄即鸡蛋内部发黄的部分。鸡蛋的蛋白质集中在蛋清和蛋膜，其余营养物质集中在蛋黄。蛋黄富含脂溶性维生素,单不饱和脂肪酸，磷，铁等微量元素。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6043, '全蛋液', NULL, '肉禽类', '是以新鲜鸡蛋为原料，经蛋壳清洗消毒、自动打蛋并分离出蛋黄或蛋白，再经过巴氏杀菌而制成的液体蛋产品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6044, '咸鸡蛋', NULL, '肉禽类', '咸鸡蛋又叫腌鸡蛋，是城乡民众爱吃的食物，但其腌制方法大有讲究，腌制得法，风味更好。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6045, '咸鸭蛋', NULL, '肉禽类', '咸鸭蛋是佐餐佳品，色、香、味均十分诱人。\r\n咸蛋是一种风味特殊、食用方便的再制蛋。咸蛋主要包括腌制的咸鸡蛋和咸鸭蛋，也包括少量的咸鸽蛋、咸鹅蛋和咸鹌鹑蛋等。\r\n咸蛋的生产极为普遍，全国各地均有生产，其中尢以江苏高邮咸蛋最为著名，个头大且具有鲜、细、嫩、松、沙、油六大特点。用双黄蛋加工的咸蛋，色彩列美，风味别具一格。因此，高邮咸蛋除供应国内各大城市外，还远销港澳地区和东南亚各国，驰名中外。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6046, '咸鹅蛋', NULL, '肉禽类', '咸蛋又称盐蛋、腌蛋、味蛋等，是一种风味特殊、食用方便的再制蛋。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6047, '松花蛋', NULL, '肉禽类', '松花蛋也叫皮蛋、变蛋、彩蛋、碱蛋或泥蛋等，是用石灰等原料腌制后的蛋类食品，因蛋白中常有松针状的结晶或花纹而得名。它是我国传统的风味蛋制品，不仅为国内广大消费者所喜爱，在国际市场上也享有盛名。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6048, '卤蛋', NULL, '肉禽类', '卤蛋（MarinatedEgg），又名卤水蛋。是用各种调料或肉汁加工成的熟制蛋。卤蛋是熟食店经营禽蛋品中的一个大众化食品，普遍受到人民的欢迎。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6049, '乌鸡蛋', NULL, '肉禽类', '乌鸡蛋，富含多种微量元素，有机钙含量是普通鸡蛋的6倍，胆固醇极低，是普通鸡蛋的三分之一。乌鸡蛋对促进儿童生长发育，增强记忆力，对儿童缺锌引起的厌食、弃食、免疫力低下，不长个子和孕产妇的营养滋补以及中老年心血管疾病和甲状腺肿瘤具有食疗保健作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6050, '麻雀蛋', NULL, '肉禽类', '麻雀蛋，又名雀蛋，为文鸟科动物麻雀的蛋。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6051, '鸽蛋', NULL, '肉禽类', '鸽子蛋为鸠鸽科动物原鸽或家鸽等的蛋，被人称为“动物人参”。据中国医学科学院卫生研究所资料表明，鸽蛋含有几种氨基酸和人体必需的8种各类维生素，是高蛋白低脂肪的珍品。鸽蛋能够增强人体的免疫和造血功能，对手术后的伤口愈合，产妇产后的恢复和调理，儿童的发育成长更具功效。是老少皆宜的药膳。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6052, '蛋白', NULL, '肉禽类', '为雉科动物家鸡的蛋白，鸡蛋的蛋白可用来制作蛋泡糊或上浆；鸡蛋清富含蛋白质和人体必需的8种氨基酸和少量醋酸。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6053, '蛋液', NULL, '肉禽类', '全蛋液指的是整个蛋。是以新鲜鸡蛋为原料，经蛋壳清洗消毒、自动打蛋，再经过巴氏杀菌而制成的液体蛋产品。主要用于中西餐烹饪，蛋白质的氨基酸比例很适合人体生理需要、易为机体吸收，利用率高达98%以上，营养价值很高，是人类常食用的食物之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6054, '咸蛋黄', NULL, '肉禽类', '咸蛋黄是一种美食，主要原料有鸭蛋、禽蛋等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6055, '鸡蛋干', NULL, '肉禽类', '鸡蛋干是将鸡蛋全蛋或蛋清或蛋粉浓缩加工而成，其质地和色泽类似传统豆腐干，口感细腻，具有鸡蛋香味，开袋即食，食用方便的食品。该产品营养价值高，含有丰富的优质蛋白，口感好，还可加工多种口味的佐酒佳肴。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6056, '草鱼', NULL, '水产品类', '又名鲩鱼、混子、草鲩、草包鱼、草根鱼、草青、白鲩。草鱼，鱼纲，鲤科，它与青鱼是比较相近的鱼种，体色则近于鲫鱼的体色，有灰白，草黄和金黄等色。草鱼与青鱼，鳙鱼，鲢鱼并称中国四大淡水鱼。草鱼以草为食，故北方饲养草鱼也较多。草鱼背部的颜色为黑褐色、鳞片边缘为深褐色，胸、腹鳍为灰黄色，侧线平直，肉白嫩，骨刺少，适合切花刀作菊花鱼等造型菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6057, '鲤鱼', NULL, '水产品类', '又名龙门鱼、鲤拐子、赤鲤、黄鲤、白鲤、赖鲤。\r\n鲤鱼因鱼鳞上有十字纹理而得名。体态肥肚，肉质细嫩。\r\n产于我国各地淡水河湖、池塘。一年四季均产，但以2-3月产的最肥。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6058, '鲫鱼', NULL, '水产品类', '又名河鲫、鲋鱼、喜头、鲫瓜子、喜头鱼、海附鱼、童子鲫、鲭。\r\n鲫鱼又名鲋鱼，别称喜头，为鲤科动物，产于全国各地。鲫鱼俗称鲫瓜子，肉味鲜美，肉质细嫩，它营养全面，含蛋白质多，脂肪少，食之鲜而不腻，略感甜味；它是一种适应性很强的鱼类，栖于江河，湖泊、池沼、河渠中，尤以水草丛生的浅水湖和池塘较多，鲫鱼四季均产，但以2～4月和8～12月产的最肥。鲫鱼体侧扁而高，体较小，背部发暗，腹部色浅，体色因产地而异，多为黑色带金属光泽，嘴上无须，鳞较小，鳍的形状同鲤鱼。鲫鱼肉嫩味美，营养价值较高，但刺细小且多。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6059, '鲈鱼', NULL, '水产品类', '鲈鱼又称花鲈、寨花、鲈板、四肋鱼等，俗称鲈鲛，与长江鲥鱼、太湖银鱼并称为“四大名鱼”之一。\r\n鲈鱼主产于辽宁大东沟、旅大、营口，河北秦皇岛，天津北塘，山东羊角沟、烟台、石岛、青岛，但以北塘产的品质最好，产期在3～8月间，立秋前后产的品质最好。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6060, '鲢鱼', NULL, '水产品类', '鲢鱼(Chub)又叫白鲢、水鲢、跳鲢、鲢子，属于鲤形目，鲤科，是著名的四大家鱼之一。体形侧扁、稍高，呈纺锤形，背部青灰色，两侧及腹部白色。头较大。眼睛位置很低。鳞片细小。腹部正中角质棱自胸鳍下方直延达肛门。胸鳍不超过腹鳍基部。各鳍色灰白。形态和鳙鱼相似，鲢鱼性急躁，善跳跃。鲢鱼是人工饲养的大型淡水鱼，生长快、疾病少、产量高，多与草鱼、鲤鱼混养。其肉质鲜嫩，营养丰富，是较宜养殖的优良鱼种之一。为我国主要的淡水养殖鱼类之一。分布在全国各大水系', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6061, '青鱼', NULL, '水产品类', '青鱼主要分布于我国长江以南的平原地区，长江以北较稀少；它是长江中、下游和沿江湖泊里的重要渔业资源和各湖泊、池塘中的主要养殖对象，为我国淡水养殖的“四大家鱼”之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6062, '鲶鱼', NULL, '水产品类', '鲶鱼，又称作胡子鲶、黏鱼、塘虱鱼，生仔鱼。此鱼的显著特征是周身无鳞，身体表面多黏液，头扁口阔，上下颌有四根胡须。鲇鱼的最佳食用季节在仲春和仲夏之间。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6063, '鳗鱼', NULL, '水产品类', '鳗鱼，别名：白鳝、白鳗、河鳗、鳗鲡、青鳝、风馒、日本鳗。鳗鱼是指属于鳗鲡目分类下的物种总称。又称鳝，是一种外观类似长条蛇形的鱼类，具有鱼的基本特征。此外鳗鱼与鲑鱼类似具有洄游特性。鳗鱼属鱼类，似蛇，但无鳞，一般产于咸淡水交界海域。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6064, '三文鱼', NULL, '水产品类', '三文鱼(salmon)也叫撒蒙鱼或萨门鱼，是一种生长在加拿大、挪威、日本和俄罗斯等高纬度地区的冷水鱼类。 三文鱼（salmon）是一个统称，三文鱼是英语Salmon的音译，其英语词义为“鲑科鱼”三文鱼分为鲑科鲑属与鲑科鳟属，所以准确的说Salmon是鲑鳟鱼。鲑科鱼中的鳟属鱼有两种：海鳟（Salmo Trutta）和虹鳟（Oncorhynchus mykiss）。\r\n加拿大的新不伦瑞克省，与大海有着天然的联系，在该省被称为“三文鱼故乡”的坎普贝尔顿村，我们看到了一座别具一格的三文鱼雕像。据介绍，加拿大渔民于', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6065, '鱼头', NULL, '水产品类', '多年生块茎植物，常作一年生作物栽培。叶片盾形，叶柄长而肥大，绿色或紫红色；植株基部形成短缩茎，逐渐累积养分肥大成肉质球茎，称为“芋头”或“母芋”，球形、卵形、椭圆形或块状等。母芋每节都有一个脑芽，但以中下部节位的腋芽活动力最强，发生第一次分蘖，形成小的球茎称为“子芋”，再从子芋发生“孙芋”，在适宜条件下，可形成曾孙或玄孙芋等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6066, '针鱼', NULL, '水产品类', '属颌针鱼目，飞鱼亚目，鱵科，鱵属。俗称：针鱼，穿针鱼，针杆子，针公。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6067, '橡皮鱼', NULL, '水产品类', '橡皮鱼鱼学名叫绿鳍马面鲀，潮汕俗名：迪仔；在上海和闽浙一带称橡皮鱼、剥皮鱼，在北方称猪油、皮匠鱼、面包鱼、烧烧角。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6068, '鲮鱼', NULL, '水产品类', '鲮鱼生长在水温较高的水域，不耐低温，一般水温低于7℃时即不能生存，所以天然鲮鱼主要产于广东、福建两省各水系。其它地区可在保温条件下进行人工养殖。鲮鱼四季均产，以4～6月为捕捞旺季。\r\n鲮鱼体扁侧，背部在背鳍前方略隆起，一般体长15～25厘米。有须两对，鳞片较大，体为青白色，腹部圆而无棱，刺细小且多，肉嫩，略有土腥味。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6069, '黄鳝', NULL, '水产品类', '鳝鱼，也叫黄鳝，体细长呈蛇形，体前圆后部侧扁，尾尖细。头长而圆。口大，端位，上颌稍突出，唇颇发达。上下颌及口盖骨上都有细齿。眼小，为一薄皮所覆盖。左右鳃孔于腹面合而为一，呈“V”字形。鳃膜连于鳃峡。体表一般有润滑液体，方便逃逸，无鳞。无胸鳍和腹鳍；背鳍和臀鳍退化仅留皮褶，无软刺，都与尾鳍相联合。生活时体呈大多是黄褐色、微黄或橙黄，有深灰色斑点，也有少许鳝鱼是白色，俗称\"白鳝\".', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6070, '鲨鱼', NULL, '水产品类', '鲨鱼是可以食用的海洋鱼类之一，现在国内市场上出售的多是专供食用的养殖鲨。鲨鱼是餐桌上不多见的水产，但鱼翅、鱼唇却早已闻名遐尔。鱼翅做菜柔嫩腴滑，软糯爽口，是与燕窝、熊掌等齐名的珍贵食品。鱼翅因其难得而身价不菲，但它并非特别有营养，或许和其他饮食相比较，它更是奢华和财富的象征。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6071, '三道鳞', NULL, '水产品类', '又名三道鲤。三道鳞是鲤鱼的一种，身上有三条比较粗大的鱼鳞，故得名三道鳞。这种鲤鱼个大体肥，而且肉质非常鲜美，只有靠近鳍的两侧和中间靠近尾部的地方有鳞，而且中间的磷也只有三片', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6072, '黑鱼', NULL, '水产品类', '体延长，呈圆筒形，长可达50厘米以上。青褐色，具三纵行黑色斑块，眼后至腮孔有两条黑色纵带。口大，牙尖，背鳍和臀鳍均延长如岭峰。咽头上方有一宽大鳃上腔，能呼吸空气。性凶猛，幼鱼以桡足类和枝角类为食，栖息淡水底层。小鱼以水生昆虫和小虾及其他小鱼为食。待长到8厘米以上则捕食其他鱼类，故为淡水养殖业的害鱼之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6073, '柴鱼', NULL, '水产品类', '柴鱼是冷水性鱼类(主产于寒带海域)，由于长得像柴而被广东人称之为“柴鱼”。柴鱼在日本又称鲣节、木鱼，是金枪鱼科的鲣鱼的烟熏制品。另外，湖南岳阳地区因口口相传的误导，别名财鱼被也误读为柴鱼，这里的财鱼是指黑鱼，和第一个柴鱼是不同的鱼类。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6074, '鳊鱼', NULL, '水产品类', '鳊鱼为三角鲂、团头鲂（武昌鱼）的统称。主要分布于中国长江中、下游附属中型湖泊。肉质嫩滑，味道鲜美，是中国主要淡水养殖鱼类之一。武昌鱼主产于长江中下游，以湖北为最多，多产在5～8月。武昌鱼体扁侧，呈长棱形，背隆起明显，头小、口小，体侧灰尘色并有浅棕色光泽，背色深，腹色浅，腹色浅，鳞片中等大小，臀鳍较长，尾柄短，尾鳍分叉深。鲂鱼肉细嫩肥美，小鱼刺多，大鱼刺少。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6075, '比目鱼', NULL, '水产品类', '比目鱼主要产于黄海北部和渤海，如辽宁的庄河，河北的秦皇岛，山东的蓬莱、石岛，以秦皇岛产的为好。4～6月是产牙鲆的旺季。其体长侧扁，一般体长20厘米左右、体重200克左右、眼大而突出，两眼均在头部右侧，上眼位高，位于头背缘中线上。两侧口裂稍不等长，两额均有尖细牙齿，前鳃盖边缘游离、侧线完全，在胸鳍上方无弯曲、有眼一侧被弱栉鳞，体呈黄褐色或深褐色、无斑纹。无眼一侧白色，被圆鳞，头部及两眼间鳞片均细小而密、背鳍由眼部直至尾柄前端；胸鳍一对、较小；腹鳍由胸鳍后部起至尾部前端；尾鳍双截形、尾柄长。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6076, '胖头鱼', NULL, '水产品类', '胖头鱼又叫大头鱼，学名鳙鱼，中国著名四大家鱼之一。此鱼鱼头大而肥，肉质雪白细嫩，是鱼头火锅的首选。产地、产期与鲢鱼相同。鳙鱼的外形与鲢鱼相似，但也有区别，如胖头鱼头大，占体长的三分之一，体侧发黑且有花斑，眼位较低。\r\n鱼脑营养丰富，其中含有一种人体所需的鱼油，而鱼油中富含多不饱和脂肪酸，它的主要成分就是我们所说的“脑黄金”，这是一种人类必需的营养素，主要存在于大脑的磷脂中，可以起到维持、提高、改善大脑机能的作用。因此，有多吃鱼头能使人更加聪明的说法。另外，鱼鳃下边的肉呈透明的胶状，里面富含胶原蛋白，能够对', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6077, '泥鳅', NULL, '水产品类', '泥鳅有沙鳅、真鳅、黄鳅之分，在我国各地的淡水中都有分布，常生活在水田、池塘、沟渠的静水底层淤泥中，喜食浮游生物、小型甲壳类等，也食植物碎屑、藻类等；泥鳅每年4～8月进入繁殖季节，二龄后的泥鳅性成熟开始产卵，个体越大，产卵量越多。\r\n泥鳅肉质鲜美，营养丰富，富含蛋白质，还有多种维生素，并具有药用价值，是人们所喜爱的水产佳品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6078, '银鱼', NULL, '水产品类', '银鱼，即海蜒，白色稍透明，长不过3厘米左右，通体无鳞，一向作为整体性食物应用即(内脏、头、翅等均不去掉，整体食用)，而整体性食物目前作为一种天然的\"长寿食品\"为国际营养学所确认。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6079, '乌头鱼', NULL, '水产品类', '乌头鱼又名马鱼、白眼梭鱼、鲻鱼。鲻鱼富含蛋白质、脂肪酸、B族维生素、维生素E、钙、镁、硒等营养元素，肉质细嫩，味道鲜美，特别是冬至前的鲻鱼，鱼体最为丰满，腹背皆腴，特别肥美，常被作为宾馆酒楼的海鲜佳肴。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6080, '黄骨鱼', NULL, '水产品类', '黄颡鱼，俗称黄骨鱼，也叫黄辣丁或者黄腊丁。利小便，消水肿，祛风、醒酒。因黄骨鱼为发物食品，故有痼疾宿病者，乳支气管哮喘、淋巴结核、癌肿、红斑狼疮以及顽固瘙痒性皮肤病患者忌食或谨慎食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6081, '白条鱼', NULL, '水产品类', '白条鱼(裸鱼)的介绍体延长而侧扁，背缘较平直，腹缘稍凸，腹棱自胸鳍下方至肛门。 头稍尖，侧扁。 吻短，吻长大于眼径。 口端位，斜裂。 眼中大，眼间宽而微凸，其间距大于眼径。 咽头齿3列，齿式5.4.2-2.4.4。 体被中小圆鳞；侧线完全，在胸鳍上方急遽向下倾斜，有一显著角度，行至体之下半部，在尾柄处又折而向上至中央部位。 背鳍硬棘III，分枝软条7；臀鳍3（不分枝软条）+11-12（分枝软条）。 体背青灰色，侧面及腹面为银白色，全身反光强，无其它任何花纹。 尾鳍灰黑色，雄性在繁殖季节身体变成红蓝相间的彩', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6082, '罗非鱼', NULL, '水产品类', '罗非鱼俗称：非洲鲫鱼，属种：鲈形目、鲈形亚目、鲡鱼科、罗非鱼属。罗非鱼是一群中小型鱼类，它的外形、个体大小有点类似鲫鱼，鳍条多棘似鳜鱼。罗非鱼属广盐性鱼类，海、淡水中均中生存；罗非鱼对低氧环境具有较强的适应能力，一般栖息在水的底层，通常随水温变化或鱼体大小改变栖息水层。目前我国养殖的主要有尼罗罗非鱼、莫桑比克罗非鱼、奥利亚罗非鱼。罗非鱼的肉味鲜美,肉质细嫩,无论是红烧还是清烹,味道俱佳。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6083, '鮰鱼', NULL, '水产品类', '鮰鱼又名回鱼、鮠鱼、肥沦、江团、白吉、肥头鱼。肉质鲜美，色香味具全，有很高的营养价值，为配席之佳选。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6084, '丁香鱼', NULL, '水产品类', '闻之似丁香花味，体形似渔家女耳垂的金丁香，故雅名丁香鱼。其肉质鲜美，营养丰富，整条可食；又是海产的调味品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6085, '乌江鱼', NULL, '水产品类', '又名大口鲶。\"乌江鱼\"是遵义乌江镇的一个历史悠久、独具特色的饮食品牌，四秀皆宜，闻名遐迩。 \"乌江鱼\"是用真正的野生鱼（即江中之鲢鱼）精心配料，加以遵义“朝天辣椒”，以火锅方式烹制而成，鲜辣味美，吸引了无数的游客。乌江镇大街上那整片的火锅店、站在路边向过往车辆招徕的女服务员和她们软糯的口音，也成了进入遵义城区必经的一道景观。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6086, '三文鱼头', NULL, '水产品类', '三文鱼的头', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6087, '鱼皮', NULL, '水产品类', '鱼皮含有丰富的蛋白质和多种微量元素，其蛋白质主要是大分子的胶原蛋白及粘多糖的成分，是女士养颜护肤美容保健佳品，近年医学研究发现，“鱼皮”中的白细胞素—亮氨酸有抗癌作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6088, '鲟鱼', NULL, '水产品类', '鲟鱼是世界上唯一生活在水中的活化石，是所有鱼类中营养价值最高的一种鱼类。鲟龙鱼还有美容的功效，长期食用可消斑去皱、平衡油脂，使面色红润、肌肤富有弹性，消除“痘痘”，亦是研制美容化妆品最好的生物原料。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6089, '多春鱼', NULL, '水产品类', '多春鱼，属胡瓜鱼目胡瓜鱼科，原产自日本的深海鱼，因其鱼肚中一年都有鱼子，因此得名[多春鱼]，又名毛鳞鱼、胡瓜鱼。\r\n　　', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6090, '鲮鲫鱼', NULL, '水产品类', '鲮鱼，鲤形目、鲤科。身体延长，腹部圆，头短小，吻圆钝。口下位，上下颌的前方具角质化边缘，适于刮取水底附着物。在天然水体中，鲮鱼会舐刮水底岩石等物体上的附着生物（如着生绿藻、硅藻、丝状藻类等），还摄食淤泥中的有机物质。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6091, '多宝鱼', NULL, '水产品类', '多宝鱼属于鲽形目鲆科，俗称欧洲比目鱼，在中国称“多宝鱼”。身体扁平近似圆型，双眼位于左侧，有眼侧呈青褐色，具少量皮刺；无眼侧光滑白色，背鳍与臀无硬体且较长。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6092, '银鳕鱼', NULL, '水产品类', '又名裸盖鱼、裸头鱼。银鳕鱼身体内含有大量脂肪，食用起来肉质白细鲜嫩。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6093, '鱼籽', NULL, '水产品类', '鱼籽，是鱼卵腌制或干制品的统称。鱼籽有很高的营养价值，含有卵清蛋白、球蛋白、卵类粘蛋白和鱼卵鳞蛋白等人体所需的营养成分，而且味道鲜美。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6094, '梭鱼', NULL, '水产品类', '梭鱼体型较大，是近海鱼，我国产于南海、东海、黄海和渤海。春天吃梭鱼最好，民间有“食用开凌梭，鲜得没法说”的说法。\r\n梭鱼身体细长，最大的梭鱼可以长到1.8米长。梭鱼的头短而宽，鳞片很大。梭鱼的背侧呈青灰色，腹面浅灰色，两侧鳞片有黑色的竖纹。梭鱼生活在沿海、江河的入海口或者咸水中。梭鱼喜爱群集生活，以水底泥土中的有机物为食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6095, '鱼尾', NULL, '水产品类', '鱼类的鱼尾.', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6096, '扒皮鱼', NULL, '水产品类', '“扒皮鱼”正式名字是绿鳍马面鲀 (革鲀科)。它还有马面鱼、象皮鱼、孜孜鱼、皮匠刀、面包鱼、羊鱼、烧烧鱼、老鼠鱼等别名。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6097, '鲥鱼', NULL, '水产品类', '鲥鱼的特点：又名鳃鱼、瘟鱼、时鱼、三来鱼、三黎鱼。体呈长椭圆形，较侧扁，一般体长25~40厘米。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6098, '武昌鱼', NULL, '水产品类', '武昌鱼是我国主要淡水养殖鱼类之一。原产于长江中游一带通江的湖泊现已推广到全国各地养殖。武昌鱼产于鄂城和武昌县境内的梁子湖。该湖湖面辽阔，直通长江，江水可倒灌。由此使湖水水质好、饵料丰富，便于武昌鱼的生长繁殖。\r\n武昌鱼属鳊鱼的一种，又名团头鲂。体形呈扁平状，重一市斤左右或二、三市斤，肉质嫩白，含丰富的蛋白质和脂肪。属名贵淡水鱼菜。又因为现代有毛泽东“才饮长江水，又食武昌鱼”的词句，使武昌鱼更为闻名遐迩。\n', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6099, '鳙鱼', NULL, '水产品类', '鳙鱼(Aristichthysnobilis)又叫花鲢、胖头鱼、包头鱼，大头鱼、黑鲢（还有的地方叫麻鲢）。外形似鲢。侧扁。是淡水鱼的一种。头部大而宽，头长约为体长的1/3。口亦宽大，稍上翘。眼位低。鳙鱼属高蛋白、低脂肪、低胆固醇鱼类，对心血管系统有保护作用。同时鳙鱼富含磷脂及改善记忆力的脑垂体后叶素，特别是脑髓含量很高，常食能暖胃、祛头眩、益智商、助记忆、延缓衰老，还可润泽皮肤。\r\n季节：5-6月', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6100, '虹鳟鱼', NULL, '水产品类', '虹鳟鱼栖于湖泊和急流，体色鲜艳。体上布有小黑斑，体侧有一红色带，如同彩虹，因此得名“虹鳟”。虹鳟鱼属冷水性鱼类，肉质细嫩，味道鲜爽，富含人体所需的氨基酸和微量元素，并具有化栓去血垢的碳烯酸。比较适合三高人群食用。食用虹鳟鱼，已经成为北京郊区旅游区的一大靓点。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6101, '鮸鱼', NULL, '水产品类', '中文学名大米鱼，简称米鱼，鳘鱼、敏子、敏鱼、鮸鱼、毛常鱼。肉质略粗糙，体色发暗，灰褐并带有紫绿色，腹部灰白。背鳍鳍棘上缘黑色，鳍条部中央有一纵行黑色条纹。胸鳍腋部上方有一晴斑。其余各鳍灰黑色。米鱼体形为两侧扁平向后延长状，背、腹部浅弧形。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6102, '鲷鱼', NULL, '水产品类', '别称：加吉鱼、班加吉、加真鲷、铜盆鱼。加吉鱼属于鱼纲，鲷（SeaBream）科。体高侧扁，长五十厘米以上，体呈银红色，有淡蓝色的斑点，尾鳍后绿黑色，头大、口小，上下颌牙前部圆锥形，后部臼齿状，体被栉鳞，背鳍和臀鳍具硬棘。中国沿海均产，但以辽宁大东沟，河北秦皇岛、山海关，山东烟台、龙口、青岛为主要产区，山海关产的品质最好。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6103, '龙利鱼', NULL, '水产品类', '别称：牛舌头，龙利鱼属鲽形目、舌鳎科、舌鳎属，俗称牛舌头、鳎目、鳎米，是一种暖温性近海大型底层鱼类，终年生活栖息在我国近海海区，具广温、广盐和适应多变的环境条件的特点，适温范围3.5—32℃，最适水温14—24℃，适盐范围14-33‰。半滑舌鳎自然资源量少，味鲜鲜美，出肉率高，口感爽滑，鱼肉久煮而不老，无腥味和异味，属于高蛋白，营养丰富，历来为我国沿海广大消费者待客的上等佳品，深受广大消费者青睐，目前活鱼价格很高。加之，半滑舌鳎生长速度快，食物层次低，能耐低氧，病害少，适合在目前养殖大菱鲆、牙鲆的大棚内养', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6104, '鱼干', NULL, '水产品类', '鱼干是指将新鲜海鱼经充分晒干而成。脱脂鱼干是以优质海鱼为原料，经过高温蒸煮、烘干等程序精制而成，各项指标均达到国家规定的标准。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6105, '鱼松', NULL, '水产品类', '鱼松是用鱼类肌肉制成的金黄色绒毛状调味干制品。其加工设备主要有煮制锅、炒松机，可连续性生产，日产量可高达10吨以上；小型的零星加工，以手工烹炒较为常见。鱼松含有人体所需的多种必需氨基酸和维生素B1、维生素B2、尼克酸以及钙、磷、铁等无机盐，可溶性蛋白多，脂肪熔点低。鱼松制品易被人体消化吸收，对儿童和病人的营养摄取很有帮助。鱼松是营养健康食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6106, '蟹柳', NULL, '水产品类', '蟹柳是一种用鱼肉糜做的加工食品，虽然名称叫“蟹柳”，其实成份是鱼肉，源自日本，正式名称叫鱼肉糕，鱼肉糕的红白两种颜色是日本人用于喜庆之事非常吉利的组合。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6107, '鱼子酱', NULL, '水产品类', '鱼子酱（Caviar），又称鱼籽酱，在波斯语中意为鱼卵，严格来说，只有鲟鱼卵才可称为鱼子酱，其中以产于接壤伊朗和俄罗斯的里海的鱼子酱质量最佳。并非所有鲟鱼卵都可制成鱼子酱，世界范围内共有超过20种的不同鲟鱼，其中只有Beluga、oscietra及Sevruga三品种的鱼卵制成鱼子酱，最高级的Beluga，一年产量不到一百尾，而且要超过六十岁的Beluga才可制作鱼子酱。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6108, '木鱼花', NULL, '水产品类', '乌贼去头，经过清洗、切刀，然后放开水中烫一下，使其卷起来就是目鱼花。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6109, '肉魽鱼', NULL, '水产品类', '肉魽鱼俗称：鱼，芝麻，梅花，鲶鱼,魽鱼、芝麻魽、白须魽 。分布于中国钱塘江、九龙江、韩江、珠江、元江等水系。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6110, '软丝', NULL, '水产品类', '软丝别名软翅仔，也是乌贼之一种，但外观没有花纹，有十足有硬鞘，水里的软丝，犹如透明的浮游物，生长於浅礁处，身形椭圆。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6111, '白姑鱼', NULL, '水产品类', '白姑鱼，石首鱼科白姑鱼属的鱼类。俗名：白米鱼、鰃仔鱼、白梅、白姑子、沙卫口。白姑鱼口前位，斜形。上颌外行与下颌内行牙较大。无须。颏部有3对小孔。鳃孔大。头体蒙栉鳞，背，臀鳍有一行鳞鞘。二背鳍间有一深凹。第二臀鳍棘约等于眼径。胸鳍侧位。腹鳍胸位。尾鳍短楔状。背侧淡灰，下侧银白。第一背鳍黄灰。后背鳍有一白纵纹，偶鳍淡黄，尾鳍灰黄。为中下层海鱼。生殖期聚群向近岸洄游。是无毒，经济型食用鱼。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6112, '狮头鱼', NULL, '水产品类', '狮头鱼生活在海水与淡水交汇处的区域，是广东海鲜的特产鱼。狮头鱼体型细小，头大身小，呈金黄色，香滑细嫩，十分美味。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6113, '蛇鲻', NULL, '水产品类', '长条蛇鲻(Saurida filamentosa) 分布于南海和东海，也见于澳大利亚沿海。为暖水性底栖鱼类，栖于泥沙和沙泥底质的海区。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6114, '沙钻鱼', NULL, '水产品类', '沙钻鱼,也叫鳃鱼 [sand borer]。几种鱚属鱼的泛称,体长六寸到七寸,圆筒形,银灰色,嘴尖,眼大。生活在近海沙底。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6115, '四破鱼', NULL, '水产品类', '吴郭鱼(Tilapia‎)为一种中小形鱼。现在它是世界水产业的重点科研培养的淡水养殖鱼类，且被誉为未来动物性蛋白质之主要来源之一。吴郭鱼是由吴振辉、郭启彰两位先生从印尼引进的。为了纪念他们，就取两人的姓相连做鱼的名字。当初引进时只有十三条，因为在高雄长得很好，后来台湾各地都养这种鱼。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6116, '水晶鱼', NULL, '水产品类', '水晶鱼来源于银鱼科动物太湖短吻银鱼的全体。它是小型小层鱼类，生活于近海，性喜集群，以浮游小动物为主食。三、四月于长江口区产卵。具有海洋至江河回游的习性。它是小型小层鱼类，习性与前种相似。只唯在南海冬季11-12月产卵。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6117, '白鱼', NULL, '水产品类', '白鱼为塞外鱼鲜上品，与江南名鱼相比也绝不逊色。产于松花江的异常肥美，大者可三二十斤，脊背有油。长江产的不肥。北方各地产的不大，至多二三斤。清蒸、红烧，或熏或腌均无不可。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6118, '鳝鱼', NULL, '水产品类', '鳝鱼(Monopterus albus)属合鳃鱼目，合鳃鱼科，黄鳝属。亦称黄鳝、鱓鱼、罗鳝、蛇鱼、长鱼。 合鳃鱼目(Synbranchiformes)约15种细长鳗形鱼类的统称。我国分布两种，一种即为常见的黄鳝，还有一种为山黄鳝(Monopterus cucha (Hamilton))目前只在云南陇川县有分布。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6119, '板鱼', NULL, '水产品类', '即比目鱼。比目鱼又叫鲽鱼，栖息在浅海的沙质海底，捕食小鱼虾。它们特别适于在海床上的底栖生活。由于它们的身体扁平。双眼同在身体朝上的一侧，这一侧的颜色与周围环境配合得很好；它们身体的朝下一侧为白色。比目鱼的身体表面有极细密的鳞片。比目鱼只有一条背鳍，从头部几乎延伸到尾鳍。它们主要生活在温带水域，是温带海域重要的经济鱼类。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6120, '包公鱼', NULL, '水产品类', '又叫假包公鱼，学名花尾胡椒鲷(Plectorhynchus cinctus)，英文名Grunt，俗称：打铁母、假包公、斑加吉;隶属于鲈形目，石鲈科，胡椒鲷属，主要分布于印度洋和北太平洋西部，我国黄海、东海和南海均产，以南海产量为最多.。 包公鱼又称斑加吉，国内分布于南海，东海和黄海，是中型海产鱼类。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6121, '土虱鱼', NULL, '水产品类', '土虱俗称胡子鲶，塘虱，土虱，塘角鱼；土虱鱼的显著特征是周身无鳞，身体表面多黏液，头扁口阔，上下颌有四根胡须。不仅像其他鱼一样含有丰富的营养，而且肉质细嫩、美味浓郁、刺少、开胃、易消化，特别适合老人和儿童。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6122, '白鲳鱼', NULL, '水产品类', '鲳鱼属于鲈形目，鲳科。体短而高，极侧扁，略呈菱形。头较小，吻圆，口小，牙细。成鱼腹鳍消失。尾鳍分叉颇深，下叶较长。体银白色，上部微呈青灰色。以甲壳类等为食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6123, '草鱼尾', NULL, '水产品类', '草鱼尾为草鱼尾巴部分，草鱼又称鲩鱼，与青鱼，鳙鱼，鲢鱼并称中国四大淡水鱼。草鱼以草为食，故北方饲养草鱼也较多。草鱼背部的颜色为黑褐色、鳞片边缘为深褐色，胸、腹鳍为灰黄色，侧线平直，肉白嫩，骨刺少，适合切花刀作菊花鱼等造型菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6124, '军曹鱼', NULL, '水产品类', '军曹鱼，亦称海鲡，分布于大西洋、印度洋和太平洋(东太平洋除外)等热带水域。巴基斯坦、菲律宾、墨西哥等为主要捕捞生产国，我国沿海亦有分布，但产量较低。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6125, '鯷鱼', NULL, '水产品类', '鲥鱼的特点：又名鳃鱼、瘟鱼、时鱼、三来鱼、三黎鱼。体呈长椭圆形，较侧扁，一般体长25~40厘米。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6126, '鳓鱼', NULL, '水产品类', '鳓鱼，别名：鲙鱼、白鳞鱼、克鳓鱼、火鳞鱼、曹白鱼。暖水近海中鱼类。味鲜肉细，营养价值极高，其含蛋白质、脂肪、钙、钾、硒均十分丰富；鳓鱼富含不饱和脂肪酸，具有降低胆固醇的作用，对防止血管硬化、高血压和冠心病等有益处。鳓鱼在中国渔业史上是最早的捕捞对象之一，已有5000多年的历史。据山东省胶县三里河“新石器时代”的遗址中，多次在墓葬中发现鳓鱼骨头，在废坑中还有成堆的鳓鱼鳞。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6127, '塘鲺', NULL, '水产品类', '塘鲺是一种鱼类，可食用，学名胡子鲶，在分类上属鲤形目、胡子鲶科。属于热带、亚热带鱼类，广布于我国南方各地，既是营养丰富的消费品，又是具药用价值的滋补品。既能在国内畅销，又能出口创汇。因而市场潜力大，是农(渔)民致富的有效养殖对象。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6128, '柳叶鱼', NULL, '水产品类', '柳叶鱼是胡瓜鱼科，油胡瓜鱼属的鱼类。主要分布于北极洋、北大西洋及北太平洋之温寒带海域。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6129, '太阳鱼', NULL, '水产品类', '太阳鱼学名Lepomis gibbosus ，属鲈形目-太阳鱼科的淡水鱼类，原产于美国南部及墨西哥北部的淡水水域中，美洲中、南部。一般成鱼体长24-40公分。大多数太阳鱼都拥有格外出众的色彩，而美丽的太阳鱼种类中最为夺目的种类就是这一款被称为“嫦娥”的种类，其闪烁着耀眼的金属蓝色调的鱼身上布满了桔色的斑点，眩目而美丽...', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6130, '鲦鱼', NULL, '水产品类', '鲦鱼是一种营养丰富的海鱼，并且具有脂肪及各种人体所需很高的药性价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6131, '乌鱼子', NULL, '水产品类', '乌鱼子是用雌性乌鱼产的卵做成的食物。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6132, '马哈鱼', NULL, '水产品类', '大麻哈鱼是鲑科、大马哈鱼属动物。为冷水性溯河产卵洄游鱼类。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6133, '吻仔鱼', NULL, '水产品类', '吻仔鱼为鲤科动物，产于全国各地。吻仔鱼身长1～3公分、呈透明状，由各种鱼类的稚仔鱼组成，其中以日本鯷、刺公鯷、异叶公鯷为主，成长至4公分、体色变黑、侧线有银带出现时，就称为「鱙仔鱼」。但吻仔鱼长到两岁大、体长3～4公分时，就会结束生命。主要指的是鯷鱼类和沙丁鱼类鱼苗的总称，是多种鱼类赖以生存的重要食物，但绝不是我们人类赖以生存的重要食物。总结各方的说法，捕捞吻仔鱼，是会对渔业产量、生态环境有所影响。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6134, '乌仔鱼', NULL, '水产品类', '乌仔鱼属鲻形目 Mugiliformes、鲻科 Mugilidae、鲻属 Mugil 广盐性和洄游性鱼类。是温热带浅海中上层优质经济鱼类，广泛分布于大西洋、印度洋和太平洋。生命力较强，适温范围为3～35℃，对盐度的适应范围很广，在海水、咸淡水中均能正常生活，并能完全适应纯淡水生活，是沿海咸淡水鱼塘养殖的主要鱼类。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6135, '吴郭鱼', NULL, '水产品类', '吴郭鱼俗称：非洲鲫鱼，属种：鲈形目、鲈形亚目、鲡鱼科、罗非鱼属。罗非鱼是一群中小型鱼类，它的外形、个体大小有点类似鲫鱼，鳍条多棘似鳜鱼。罗非鱼属广盐性鱼类，海、淡水中均中生存;罗非鱼对低氧环境具有较强的适应能力，一般栖息在水的底层，通常随水温变化或鱼体大小改变栖息水层。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6136, '香鱼', NULL, '水产品类', '香芋原产于东南亚，后来由波利尼西亚人把品种带至夏威夷，并逐渐在19世纪成为夏威夷的主要农产品之一。香芋有一种独特的香草味，肉心呈紫色，似薯类，但味道既非山芋、芋艿，又非马铃薯，好似板栗，甘而芳香，食后余味不尽，故取名香芋。烧、炒、炖皆可，与鸡肉、猪肉一起烹其味香而不腻，酥而不烂。将香芋放置于干燥阴凉的地方且要通风，在购买后尽可能快点将它食用完，因为芋头容易变软。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6137, '象鱼', NULL, '水产品类', '香芋原产于东南亚，后来由波利尼西亚人把品种带至夏威夷，并逐渐在19世纪成为夏威夷的主要农产品之一。香芋有一种独特的香草味，肉心呈紫色，似薯类，但味道既非山芋、芋艿，又非马铃薯，好似板栗，甘而芳香，食后余味不尽，故取名香芋。烧、炒、炖皆可，与鸡肉、猪肉一起烹其味香而不腻，酥而不烂。将香芋放置于干燥阴凉的地方且要通风，在购买后尽可能快点将它食用完，因为芋头容易变软。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6138, '尼罗红鱼', NULL, '水产品类', '尼罗红鱼，学名叫红鳍笛鲷，又名红鱼曹鱼，在分类学上属笛鲷科笛鲷属。这种鱼体呈椭圆形，稍侧扁，一般体长20厘米～40厘米以上，体重2公斤～3公斤左右。头较大，体披中大栉鳞，侧线完全与背缘平行，眼间隔宽而突起，全身鲜红色，故得红鱼之俗名。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6139, '雪斑鱼', NULL, '水产品类', '雪斑鱼脂肪含量极低，少于0.5%，几乎等于鲨鱼肉。肉质白鲜细嫩，是最佳白肉鱼之选择。 雪斑鱼排无刺肉厚﹐肉质鲜美细嫩﹐适合清蒸﹑炖煮或红烧﹐用大葱、姜丝﹑豆瓣酱和香醋來红烧鳕斑鱼﹐酸辣开胃﹐又好下饭﹗', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6140, '旗鱼', NULL, '水产品类', '旗鱼，又称芭蕉鱼 。一般体长2000～3000毫米 。为太平洋热带及亚热带大洋性鱼类 。分布于印度尼西亚至太平洋中部诸岛，北至日本南部。中国产于南海诸岛、台湾海域、广东、福建、浙江、江苏、山东等沿海。旗鱼呈圆筒形,稍侧扁 ；背、腹缘钝圆，较平直 。吻尖长，呈枪状。眼小，侧位。眼间隔宽平。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6141, '青鱼肝', NULL, '水产品类', '青鱼肝，行业称秃肺，又肥又嫩，又大，用油稍煎之后红烧，出锅略加醋和胡椒，便是著名的上海菜红烧秃肺。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6142, '青甘鱼', NULL, '水产品类', '鰤鱼或五条鰤（学名：Seriola quinqueradiata），又名青甘鱼、平安鱼、油甘鱼，广东又叫蕃薯仔.分布于台湾、日本附近海域还有我国南海海域. 鰤鱼在日本有100种以上的名字。在台湾则是被称为青甘鰺或青甘。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6143, '鲐鱼', NULL, '水产品类', '鲐鱼(Pneumatophorus japonicus)，鲈形目，鲭科，鲐属。体粗壮，呈纺锤形，尾柄结实;尾鳍基部每侧有纵隆起嵴两个。头大，前端尖细，呈圆锥形。眼大，位高，有发达的脂眼睑。上下颌等长;牙细小，上下颌齿各一行。侧线明显。背鳍两个。体背呈青蓝色。有不规则深蓝色横纹或斑纹。斑纹延伸到侧线下方。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6144, '鱼下巴', NULL, '水产品类', '所谓鱼下巴，是指鱼下颚，包括脸颊部分和眼瞠，有一块大骨的部位，这些地方的肉都很肥美', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6145, '竹荚鱼', NULL, '水产品类', '竹荚鱼(mackerel)，日语称：あ じ (アジ)也称马鲭鱼。广泛分布于我国沿海及朝鲜、日本沿海等水域。这种鱼为中上层洄游性鱼类，游泳迅速，喜欢结群聚集，有趋光特性。 鲭鱼，亦即鲐鱼(Pneumatophorus japonicus)，鲈形目，鲭科，鲐属。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6146, '珍珠石斑', NULL, '水产品类', '珍珠石斑属鲈形目，体长椭圆形稍侧扁。口大，具辅上颌骨，牙细尖，有的扩大成犬牙。体被小栉鳞，有时常埋于皮下。背鳍和臀鳍棘发达。尾鳍圆形或凹形。体色变异甚多，常呈褐色或红色，并具条纹和斑点，为暖水性的大中型海产鱼类。石斑鱼营养丰富，肉质细嫩洁白，类似鸡肉，素有“海鸡肉”之称。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6147, '刁子鱼', NULL, '水产品类', '刁子鱼，实为“鲦子鱼”（“鲦”在南方普遍读音为“diao”），是指以白鲦鱼为代表的，鱼身修长、肉内细刺极多、行动迅捷的一类鱼的统称。主要有白鲦鱼（翘嘴红鲌，俗谓翘鲌刁子）、赤眼鳟（红眼刁子）、麦穗鱼（麦楞子、麦刁子）、餐鱼（游刁子）、激浪鱼（激浪刁子、鸡卵刁子）等。除翘嘴红鮊体型稍大外，其它刁子鱼普遍个头偏小，不超过两指长。刁子鱼生长对水质要求很高，一般难以饲养，肉味鲜美细嫩，价格相对较贵。刁子鱼因刺较多，食用时以煎炸为宜，饭店菜名，如果是“香煎刁子鱼”，则指翘嘴红鮊；如果是“油炸刁子鱼”，则指其它小型刁', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6148, '鳡鱼', NULL, '水产品类', '鳡鱼，属鲤形目，鲤科，雅罗鱼亚科，鳡属。俗称黄鱄、黄钻、黄颊鱼、竿鱼、水老虎、大口鳡、鳏。英文名为Yellowcheek carp 。其体细长，亚圆筒形，头尖长。吻尖，呈喙状。口大，端位，下颌前端正中有一坚硬突起与上颌凹陷处相嵌合。无须，眼小，稍突出。下咽齿3行，齿末端呈钩状。鳞细小。背鳍较小，其起点位于腹鳍之后；尾鳍分叉很深。体背灰褐色，腹部银白色，背鳍、尾鳍深灰色，颊部及其它各鳍淡黄色。喜食比它小的鱼类。（一般饲养鱼塘有几条鳡鱼整个鱼塘其他鱼类基本就绝迹，为一般鱼类养殖户天敌）部分地区把它与青鱼类混淆', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6149, '狗母鱼', NULL, '水产品类', '即龙头鱼，灯笼鱼目，龙头鱼科，分布于太平洋、印度北部的河口，为沿海中、下层鱼类，是中国沿海常见食用鱼类。体长达41公分(16吋)，色暗，淡灰色或褐色，具黑色细点。口大、前位，尾鳍叉形，胸鳍及腹鳍大。本属有几个近缘种分布于从非洲到澳大利亚和新几内亚。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6150, '鲔鱼', NULL, '水产品类', '鲔鱼即金枪鱼，金枪鱼是一种大型远洋性重要商品食用鱼。生活于世界暖水海域，与鲭、鲐、马鲛等近缘，通常同隶鲭科。科金枪鱼，香港人起初用近似其英语的发音读做吞拿鱼而一直沿用至今。澳门以葡萄牙语旧译为亚冬鱼），是一种鲭科的海洋生物，大部分皆于于鲔属。鲔鱼的肉色为红色，这是因为鲔鱼的肌肉中含有了大量的肌红蛋白所致。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6151, '黄颡鱼', NULL, '水产品类', '黄颡鱼，鲇形目，鲿科，黄颡鱼属。又名黄公灵、黄牯头、黄骨聪、昂公鱼、葛格燕、黄骨鱼、黄丫头、黄鸭叫、黄沙古、翁公鱼、钢针、戈艾、吱戈艾、黄刺公、疙阿、疙阿丁、嘎牙子、昂刺鱼、黄鳍鱼、三枪鱼、黄刺骨、黄牙鲠、王牙、黄嘎牙、刺疙疤鱼、刺黄股、黄蛟、汪丫鱼、毛泥鳅、黄骨鱼、弯丫、昂刺、锥子等，广布于中国东部各太平洋水系。在静水或缓流的浅滩生活，昼伏夜出。体长123-143mm，杂食，主食底栖小动物、小虾、水生小昆虫等。4-5月产卵，亲鱼有掘坑筑巢和保护后代的习性。在生殖时期，雄鱼有筑巢习性。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6152, '黄鲂', NULL, '水产品类', '鳍下部有2游离鳍条；上下颌无齿，或上颌有齿，下颌无齿；体被骨板；下颌有长须。我国产轮头鲂鮄属Gargariscus、黄鲂鮄属Peristedion和红鲂鮄属Satyrichthys，共3属8种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6153, '红甘鱼', NULL, '水产品类', '章红鱼，俗名红甘鱼、杜氏鰤、红甘鲹、红魽, 在日本亦称为カンパチ（kanpachi，勘八鱼），学名高体鰤，为鲹科鰤属的鱼类。最大体长150cm，一般在35-50cm左右；体型呈长圆形，稍侧扁，腹面圆；成鱼体色变化大，鱼背蓝灰或橄榄色，有时带粉红色光泽。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6154, '鸦片鱼', NULL, '水产品类', '鸦片鱼是鲆鱼的别名之一。为硬骨鱼纲，鲆科，是比目鱼的一类。体侧扁，不对称，两眼都在左侧。口前位，下颌有突出。前鳃盖骨边缘游离。有眼的一侧皮肤呈暗灰色或有斑块纹，无眼的一侧皮肤为白色。鲆鱼种类繁多，广泛分布于热带或温带的海洋中。 我国沿海各地也多有生产。主要可供作鲜食或制成罐头及咸干制品。鱼肝可提制鱼肝油。特别是牙鲆品种是我国黄海及渤海的名贵鱼类，和比目鱼的其他品种一样是季节迎时风味名菜佳肴。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6155, '鳜鱼', NULL, '水产品类', '鳜鱼是一种家常的可以食用的鱼类，又名鳜花鱼、桂花鱼、桂鱼、鳜花鱼、鳌鱼、脊花鱼、胖鳜、花鲫鱼、母猪壳等。鳜鱼属凶猛肉食性鱼类，性凶猛，常以其它鱼类为食，幼鱼喜食鱼虾，成鱼以吃鱼类为主，冬季停止摄食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6156, '中华鲟（养殖）', NULL, '水产品类', '中华鲟：体长平均约40厘米，最长达130厘米，体重最高达600千克。体呈纺锤形，头尖吻长，口前有4条吻须，口位在腹面，有伸缩性，并能伸成筒状，体被覆五行大而硬的骨鳞，背面一行，体侧和腹侧各两行。鲟是一亿五千万年前中生代留下的稀有古代鱼类，它介于软骨与硬骨之间，骨骼的骨化程度普遍地减退，中轴为未骨化的弹性脊索，无椎体，随颅的软骨壳大部分不骨化。尾鳍为歪尾型，偶鳍具宽阔基部，背鳍与臀鳍相对。腹鳍位于背鳍前方，鳍及尾鳍的基部具棘状鳞，肠内具螺旋瓣，肛门和泄殖孔位于腹鳍基部附近，输卵管的开口与卵巢远离。\r\n夏秋两', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6157, '带鱼', NULL, '水产品类', '又名刀鱼、裙带鱼、牙带、白带鱼、柳鞭鱼、带柳、晦刀鱼。\r\n带鱼体长扁侧呈带状，头窄长，口大、且尖，牙锋利，眼大位高，尾部细鞭状。体表银灰度色，无鳞，但表面有一层银粉，侧浅在胸鳍上方向后显著弯下沿腹线直达尾端，背鳍极长，无腹鳍。带鱼肉多且细，脂肪较多且集中于体外层，味鲜美，刺较少，但腹部有游离的小刺。我国沿海均产，以东海产量最大，南海产量较少，浙江、山东沿海是产量较多的二个海区。11-12月是盛产带鱼的季节。\r\n带鱼因身体扁长似带而得名，以舟山所产为最佳。带鱼肉肥刺少，味道鲜美，营养丰富，鲜食、腌制、冷冻均', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6158, '黄鱼', NULL, '水产品类', '黄花鱼分为大黄鱼（Pseudosciaena crocea）和小黄鱼（Psendosciaena polyactis）,分别为我国四大海洋业品种之一。大黄鱼也叫大先、金龙、黄瓜鱼、红瓜、黄金龙、桂花黄鱼、大王鱼、大黄鲞；小黄鱼也叫梅子、梅鱼、小王鱼、小先、小春鱼、小黄瓜鱼、厚鳞仔、花鱼。都隶属鱼纲，石首鱼科。其形态相近，习性相似。这类鱼，体侧扁延长，呈金黄色。大黄鱼尾柄细长，鳞片较小，体长40～50厘米，椎骨25～27枚；小黄鱼尾柄较短，鳞片较大，体长20厘米左右，椎骨28～30枚。大黄鱼分布于黄海南部、', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6159, '鳕鱼', NULL, '水产品类', '鳕鱼（学名：Gadus），又名鳘鱼，是主要食用鱼类之一。鳕鱼原产于从北欧至加拿大及美国东部的北大西洋寒冷水域。目前鳕鱼主要出产国是加拿大、冰岛、挪威及俄罗斯，日本产地主要在北海道。鳕鱼是全世界年捕捞量最大的鱼类之一，具有重要的经济价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6160, '鲅鱼', NULL, '水产品类', '鲅鱼体长呈纺锤形，头长大于体高，口大而斜袭，背部蓝黑色，腹部银灰色，体侧有大小不等的黑色斑点，侧线呈不规则斑纹状，有两个背鳍相距甚小，背、臀鳍后各有8-9个小鳍，尾鳍分叉深。鲅鱼肉厚坚实，呈蒜瓣状，肉色发红，味美，刺少。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6161, '鲃鱼', NULL, '水产品类', '鲅鱼体长呈纺锤形，头长大于体高，口大而斜袭，背部蓝黑色，腹部银灰色，体侧有大小不等的黑色斑点，侧线呈不规则斑纹状，有两个背鳍相距甚小，背、臀鳍后各有8-9个小鳍，尾鳍分叉深。鲅鱼肉厚坚实，呈蒜瓣状，肉色发红，味美，刺少。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6162, '金枪鱼', NULL, '水产品类', '鱼体呈纺锤形，酷似鱼雷，尾鳍呈新月形。鱼鳞已退化为小圆鳞，适于快速游泳，最高游速达每秒20米。由于金枪鱼必须时常保持快速游动才能维持身体的供给，加上只在海域深处活动，因此肉质柔嫩鲜美，没有污染，是不可多得的健康美食。新鲜的金枪鱼向来是海鲜料理之中的极品。金枪鱼是一种生活在海洋深处的鱼类，分布在太平洋、大西洋和印度洋的热带、亚热带和温带广阔水域，是一种大洋性鱼类。我国南海金枪鱼的资源很丰富，台湾省的金枪鱼渔业比较发达。中国金枪鱼产量名列世界第四位，仅次于日本、美国和菲律宾。金枪鱼属大洋洄游性候鱼，旅行范围远', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6163, '鲳鱼', NULL, '水产品类', '平鱼，学名鲳，是一种身体扁平的海鱼，因其刺少肉嫩，故很受人们喜爱，主妇们也很乐意收拾，它同样具有海洋鱼的营养特点：富含高蛋白、不饱和脂肪酸和多种微量元素。平鱼体近菱形，扁侧，口小，背部青灰色，体两侧银白色，体背小圆鳞，背鳍和臀鳍较长，且对称，胸鳍大，无腹鳍，尾鳍深叉形，下叶长于上叶，产地大体与比目鱼相同，质量以河口和秦皇岛产的为好，上市在5～10月间，其中以6～7月产的品质最好，数量最多。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6164, '黄花鱼', NULL, '水产品类', '黄鱼，有大小黄鱼之分。二者和带鱼一起被称为中国三大海产。主要产于东海和南海，以舟山群岛和广东南澳岛产量最多。大黄鱼在广东沿海的盛产期为10月、福建为12～3月、江苏、浙江为5月。大黄鱼的外观及肉质与小黄鱼很相似。大黄鱼体大鳞片小，嘴大且圆；大黄鱼尾柄较长窄，刺少，肉厚坚实，易离刺。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6165, '沙丁鱼', NULL, '水产品类', '沙丁鱼，香港人称沙甸鱼，又称萨丁鱼、鳁和鰯。小者长二寸，大者尺许，下颚较上颚略长，齿不显，背苍腹白，肉美，多用来制为罐头食品。最初在意大利萨丁尼亚捕获而得名，古希腊文称其“sardonios”意即“来自萨丁尼亚岛”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6166, '鲻鱼', NULL, '水产品类', '鲻鱼介绍鲻鱼属鲻形目鲻科鱼类，全世界鲻科鱼类有70多种，我国沿海已发现20多种，鲻科鱼类是常见的海产鱼类，分布极广，遍及热带、亚热带、温带水域，鲻鱼虽产于海中，但对盐度的适应范围很广，在海水、咸淡水中均能正常生活，有些种类能完全适应淡水生活，是沿海海水养殖和咸淡水池塘养殖的主要鱼类，养殖的主要品种有鲻(俗称乌头鲻、青鲻)、梭鱼(俗称赤眼鲻、黄鲻)、棱梭(俗称棱鲻)等。鲻鱼体型细长，呈棒棰型，沿海群众又称其为＂棰鱼＂。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6167, '鳎目鱼', NULL, '水产品类', '鳎目鱼是鲽形目的一科，约有3属103种，中国已知约32种，舌鳎体侧扁，呈长舌状，眼常位头左侧，尾舌骨纵窄板状，有伪间髓棘，奇鳍完全相连，无胸鳍，腹鳍1个且连臀鳍，生殖突常连臀鳍左侧，肾脉棘短横板状，卵有小油球50～100个。主要为热带底层海鱼。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6168, '米鱼', NULL, '水产品类', '米鱼，一作鮸鱼（音 miǎn），形似鲈鱼，但肉质略粗糙，体色发暗，灰褐并带有紫绿色，腹部灰白。背鳍鳍棘上缘黑色，鳍条部中央有一纵行黑色条纹。胸鳍腋部上方有一晴斑。其余各鳍灰黑色。米鱼体形为两侧扁平向后延长状，背、腹部浅弧形。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6169, '安康鱼', NULL, '水产品类', '安康鱼，又名蛤蟆鱼、老头鱼、丑婆等。安康鱼全身都可以食用，而且所含脂肪低、热量少，更富含丰富的维他命A、D和E，尤其是鱼肝有保持视力、预防肝脏疾病等功效。据说安康鱼可治咳嗽，故又称“老头鱼”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6170, '鲭鱼', NULL, '水产品类', '青鱼主要分布于我国长江以南的平原地区，长江以北较稀少；它是长江中、下游和沿江湖泊里的重要渔业资源和各湖泊、池塘中的主要养殖对象，为我国淡水养殖的“四大家鱼”之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6171, '凤尾鱼', NULL, '水产品类', '学名凤鲚，又称拷子鱼、黄鲚。为洄游性鱼类。体长侧扁，长10～19厘米，吻短圆，口下位。体被圆鳞，腹缘有棱鳞。臀鳍与尾鳍下叶相连，尾鳍尖小，体银白色，体脊淡绿色。生活于近海，每年春夏间洄游入河口产卵。此时雌鱼满腹怀卵，又称子鲚，肉质很鲜美。中国沿海均有分布，为沿海河口区主要经济鱼种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6172, '秋刀鱼', NULL, '水产品类', '秋刀鱼体内含有丰富的蛋白质、脂肪酸，据分析，秋刀鱼含有人体不可缺少的廿碳五烯酸（EPA）、廿二碳六烯酸（DHA）等不饱和脂肪酸，EPA、DHA有抑制高血压、心肌梗塞、动脉硬化的作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6173, '沙尖鱼', NULL, '水产品类', '沙尖鱼是一种海鱼，通常潜入沙中生活，故俗称沙钻仔。肉质鲜美，脂肪含量高。沙尖鱼含有一种具有5个双键的长链脂肪酸，可防止血栓形成，对治疗心脏病有特效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6174, '石斑鱼', NULL, '水产品类', '石斑鱼别称：石斑、鲙鱼。石斑鱼体长椭圆形稍侧扁，口大，具辅上颌骨，牙细尖，有的扩大成犬牙。体色变异甚多，常呈褐色或红色，并具条纹和斑点，为暖水性的大中型海产鱼类。石斑鱼营养丰富，肉质细嫩洁白，类似鸡肉，素有“海鸡肉”之称。石斑鱼又是一种低脂肪、高蛋白的上等食用鱼，被港澳地区推为我国四大名鱼之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6175, '虱目鱼', NULL, '水产品类', '别称：麻遮目仔、麻虱目、海港鱼、细鳞仔鱼。东南亚一带的重要鱼获物，温水性鱼类，分布在亚热带或热带的海域。产品鱼适合加工成罐头，七十年代我国台湾省从印尼引进，1998年广东省汕头等地区试养成功，适合我国南部沿海地区推广养殖。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6176, '平鱼', NULL, '水产品类', '平鱼，是我们常说的鲳鱼中的一种，属鱼产形目，鲳亚目鲳科鱼类。体形侧偏，头胸相连明显，口、眼都很小，两颌各有一行细牙。常见的鲳鱼多为银鲳、江浙一带渔民也叫鲳片鱼、平鱼等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6177, '金枪鱼罐头', NULL, '水产品类', '金枪鱼罐头是水产类罐头的一个重要品种，加工罐头的金枪鱼品种主要是长鳍金枪鱼和黄鳍金枪鱼，品种有原汁金枪鱼、五香金枪鱼、油浸金枪鱼、茄汁金枪鱼等品种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6178, '白带鱼', NULL, '水产品类', '体甚延长，侧扁，呈带状；尾略长，向后渐变细，末端成细长鞭状，尾柄与肛前长的比例达40%左右。头窄长，头背面斜直或略突起，前端尖锐，吻尖长；左右额骨分开。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6179, '明太鱼', NULL, '水产品类', '明太鱼是鳕形目鳕亚目鳕科狭鳕属的1种。是朝鲜族人民喜欢食用的传统食品，在吉林很多人都食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6180, '木鱼干', NULL, '水产品类', '属鲈形总目、金枪鱼亚目、金枪鱼科、舵鲣亚科、鲣属，我国只产一种。在西太平洋，有一大片极为温暖而荒芜的水域，被称为暖池。那里有最大的鲣鱼种群之一，这些鲣鱼在暖池西部边缘觅食最为活跃，那里有两股水质完全不同的洋流系统交汇，造成一个汇聚带，在其周围，营养、浮游生物和小鱼都很集中。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6181, '海鲫鱼', NULL, '水产品类', '鱼类，分布于北太平洋西部。中国见于黄海北部和渤海。属于海鲫科（九九鱼、海鱮）。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6182, '黄脚笠', NULL, '水产品类', '黄鳍鲷，又名黄脚立、赤翅。适应力强，生长快，为中国南方网箱养殖的重要对象。黄鳍鲷体长椭圆形，侧扁，背面狭窄，腹面钝圆。体高，头部尖。背鳍鳍棘部与鳍条相连。尾叉形。体色青灰带黄，体侧有若干条灰色纵走线，沿鳞片而行。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6183, '红鲷鱼', NULL, '水产品类', '红鲷鱼：别名红鲷鱼 一般分布在中国的渤海、黄海、东海、南海等地，红鲷鱼肉味鲜美醇正，营养丰富，是迎宾待客的名贵海味佳肴。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6184, '红衫鱼', NULL, '水产品类', '金线鱼，俗名金线鲢、黄线、红三、红衫，为辐鳍鱼纲鲈形目金线鱼科的其中一个种。红衫鱼鱼肉丰厚，食用价值甚高，每百克肉含蛋白质 18.1克、脂肪 1.5克，可供鲜食或加工成咸干品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6185, '虾潺', NULL, '水产品类', '虾潺一般指龙头鱼。龙头鱼，灯笼鱼目，龙头鱼科，学名Harpadon nehereus；分布于太平洋、印度北部的河口，为沿海中、下层鱼类，是中国沿海常见食用鱼类。体长达41公分(16吋)，色暗，淡灰色或褐色，具黑色细点。口大、前位，尾鳍叉形，胸鳍及腹鳍大。本属有几个近缘种分布于从非洲到澳大利亚和新几内亚。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6186, '金鲳鱼', NULL, '水产品类', '金鲳鱼，学名卵形鲳鯵，地方名称黄腊鲳，金鲳，属硬骨鱼纲，鲈形目，鲹科，鲳鲹属。 该鱼体侧扁，卵圆形，臀鳍与第二背鳍略相等，都显著比腹部为长。头侧扁，尾柄细，体披小圆鳞，不易剥落。鱼肉为白色，细嫩，鲜美可口，为南方沿海名贵海产经济鱼类之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6187, '马鲛鱼', NULL, '水产品类', '鲅鱼也叫马鲛，鲅科，鲅鱼体长而侧扁，体色银亮，背具暗色条纹或黑蓝斑点，口大，吻尖突，牙齿锋利，游泳迅速，性情凶猛，一般体长260—520毫米，大者可达1米以上、重20千克以上，分布于北太平洋西部，中国东海、黄海、渤海均产之。属暖水性中上层鱼类，常结群作远程洄游。以中上层小鱼为食，夏秋季结群洄游，部分进入渤海产卵，秋汛常成群索饵于沿岸岛屿及岩礁附近，为北方经济鱼之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6188, '海鱼', NULL, '水产品类', '海鱼是指海水鱼，常见的海鱼有带鱼、三文鱼、黄花鱼、鱿鱼、鳕鱼、金枪鱼等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6189, '虾', NULL, '水产品类', '虾介绍      虾，甲壳亚门(Crustacea)十足目(Decapoda)游泳亚目(Natantia)动物。近2,000种。与蟹、螯虾、蝲蛄、海螯虾、蝉虾和龙虾近缘。我国海域宽广、江河湖泊众多，盛产海虾和淡水虾。海虾是口味鲜美、营养丰富、可制多种佳肴的海味，有菜中之\"甘草\"的美称。海虾有对虾、明虾、基围虾、琵琶虾、龙虾等；淡水虾有青虾、河虾、草虾、小龙虾等；还有半咸水虾如白虾等。不管何种虾，都含有丰富的蛋白质，营养价值很高，其肉质和鱼一样松软，易消化，但又无腥味和骨刺，同时含有丰富的矿物质（如钙、磷、', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6190, '虾肉', NULL, '水产品类', '虾仁，一种食品。选用活虾为原料，用清水洗净虾体，去掉虾头、虾尾和虾壳。剥壳后的纯虾肉即为虾仁。虾仁菜肴因为清淡爽口，易于消化，老幼皆宜，而深受食客欢迎。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6191, '虾米', NULL, '水产品类', '海米也称虾米或虾仁，为海产白虾、红虾、青虾加盐水焯后晒干，纳入袋中，扑打揉搓，风扬筛簸，去皮去杂而成，即经加盐蒸煮、干燥、晾晒、脱壳等工序制成的产品。因如舂谷成米，故称海米。以白虾米为上品，色味俱佳，鲜食成美。白虾须长，身、肉皆为白色，故前人有“曲身小子玉腰肢，二寸银须一寸肌”之咏。海米食用前加水浸透，肉质软嫩、味道鲜醇，煎、炒、蒸、煮均宜，味道鲜美，为“三鲜”之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6192, '龙虾', NULL, '水产品类', '龙虾一般体长30厘米，体重500克左右（最重的可达5千克），体粗壮，圆柱形，略扁平，身体呈橄榄色并密布白色小点；整个身体分为头胸部和腹部两部分：头胸部发达，头胸甲坚硬多棘刺，两对触角较长，尤其是第二对触角更长，头胸部的五对步足也较发达，触角和步足展开很角神话里的龙，故得名；腹部较短，五对游泳足已基本退化，尾部有尾肢。\r\n龙虾属于节肢动物门甲壳纲十足目龙虾科属动物，龙虾体大肉多，营养丰富，滋味鲜美，是名贵的水产品。民间吃龙虾，多蒸或煮熟后剥壳取肉，蘸姜醋等调味料食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6193, '虾仁', NULL, '水产品类', '虾仁，一种食品。选用活虾为原料，用清水洗净虾体，去掉虾头、虾尾和虾壳。剥壳后的纯虾肉即为虾仁。虾仁菜肴因为清淡爽口，易于消化，老幼皆宜，而深受食客欢迎。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6194, '虾皮', NULL, '水产品类', '毛虾是我国海产虾类中产量最大的虾类资源，常见的有中国毛虾和日本毛虾。前者主要分布在黄、渤海，后者多见于东海。两者极为相似，如不仔细观察，还以为是同种虾了。毛虾个体小，一般只有3厘米，因此不为人注意。然而，用它加工的虾皮却是我国出口创汇的重要海产品之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6195, '白虾', NULL, '水产品类', '白虾属淡水虾类，生长在太湖开阔的水域。体色透明，胸部有爪。据《太湖备考》记载：“太湖白虾甲天下，熟时色仍洁白。”太湖白虾多生活在水草丰盛、风平浪静的浅滩处，以植物碎片、有机残渣和弱小无脊椎浮游生物为主要食物。每年五月到七月中下旬是白虾产卵旺季。春季孵化出的幼虾至六月中下旬长成大虾，八月底即可成熟产卵。通常农历六、七月间是吃虾的时令。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6196, '基围虾', NULL, '水产品类', '基围虾属浅海海水虾，原产于广东、福建沿海，壳薄肉嫩味美，颜色好看，是餐桌上的佳肴。\r\n虾的肉质肥嫩鲜美，食之既无鱼腥味，又没有骨刺，老幼皆宜，备受青睐；虾的吃法多样，可制成多种美味佳肴，虾肉历来被认为既是美味，又是滋补壮阳之妙品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6197, '河虾', NULL, '水产品类', '河虾广泛分布于我国江河、湖泊、水库和池塘中的河虾（又称青虾，学名叫日本沼虾（Macrobranchium nipponense）），是优质的淡水虾类。它肉质细嫩，味道鲜美，营养丰富，是高蛋白低脂肪的水产食品，颇得消费者青睐。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6198, '对虾', NULL, '水产品类', '对虾属甲壳尖动物,虾体小者称为虾钱。主要分布于山东、辽宁、河北、天津沿海，以天津河口尾红、爪红的对虾为最好。捕捞旺季为4～5月和9～10月。对虾体长而侧扁，整个身体分头胸部和腹部两部分。头胸部外面衩有坚韧的头胸甲，腹侧有五对细长的步足。腹部被有甲壳，各自分离成节，前面一节压住后面一节，雌虾甲壳为青蓝色，雄虾棕黄色且体型小于雌虾，腹部腹侧有五对片状游泳足，尾部有扇状尾肢。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6199, '北极虾', NULL, '水产品类', '北极甜虾(Pandalus borealis)，又称北极虾。因产自北极附近海域虾有淡淡甜味而得名。北极甜虾捕捞于北大西洋海域，海上冷冻，保证新鲜。不过，因为甜虾需要进口，所以不一定每天都有供应。日本料理店或是粤菜餐馆的刺身档北极虾都是首推菜品。北极虾与其他虾类相比，在营养上更加丰富，特别是它生长于深海，完全属于自然野生虾，打捞上来用海水即刻煮熟，包装，冷冻，据说整个过程不超过半个小时，这就充分保持了虾的新鲜程度。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6200, '海虾', NULL, '水产品类', '海虾体长两侧扁，雌性长约18～24厘米，雄者稍短。体躯透明，雌者棕蓝色，雄者稍显黄色；全体被有甲壳。头胸甲较坚硬而宽大，前端中央延伸成长而尖的剑颧，上缘具7～9齿；下缘具3～5齿。剑额下两侧具有柄的眼1对，头部有附肢5对，第1、2对成为两对鞭状触角，其第2对很长。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6201, '皮皮虾', NULL, '水产品类', '口虾蛄亦称东方虾蛄。头部与腹部的前四节愈合，背面头胸甲与胸节明显。腹部七节，分界亦明显，而较头胸两部大而宽，头部前端有大形的具柄的复眼一对，触角两对。第一对内肢顶端分为三个鞭状肢，第二对的外肢为鳞片状。胸部有五；对附肢，其末端为锐钩状，以捕挟食物。胸部六节，前五节的附肢具鳃，第六对腹肢发达，与尾节组成尾扇。虾姑雌雄异体，雄者胸部末节生有交接器。是营养丰富、汁鲜肉嫩的海珍品，其肉质含水分较多，肉味鲜甜嫩滑，淡而柔软，并且有一种特殊诱人的鲜味；每年的春季是其产卵的季节，此时食用为最佳，肥壮的虾蛄脑部满是膏脂，', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6202, '干虾仁', NULL, '水产品类', '虾仁，一种食品。选用活虾为原料，用清水洗净虾体，去掉虾头、虾尾和虾壳。剥壳后的纯虾肉即为虾仁。虾仁菜肴因为清淡爽口，易于消化，老幼皆宜，而深受食客欢迎。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6203, '干虾', NULL, '水产品类', '虾干，即虾晒成的干制品。虾干营养价值很高。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6204, '小虾', NULL, '水产品类', '产于水中的一种动物,可食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6205, '小龙虾', NULL, '水产品类', '小龙虾学名克氏原螯虾，也叫红螯虾或者淡水小龙虾。虾营养丰富，且其肉质松软，易消化，对身体虚弱以及病后需要调养的人是极好的食物；虾中含有丰富的镁，镁对心脏活动具有重要的调节作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6206, '海米', NULL, '水产品类', '海米也称虾米或虾仁，为海产白虾、红虾、青虾加盐水焯后晒干，纳入袋中，扑打揉搓，风扬筛簸，去皮去杂而成，即经加盐蒸煮、干燥、晾晒、脱壳等工序制成的产品。因如舂谷成米，故称海米。以白虾米为上品，色味俱佳，鲜食成美。白虾须长，身、肉皆为白色，故前人有“曲身小子玉腰肢，二寸银须一寸肌”之咏。海米食用前加水浸透，肉质软嫩、味道鲜醇，煎、炒、蒸、煮均宜，味道鲜美，为“三鲜”之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6207, '青虾', NULL, '水产品类', '青虾是经济价值很高的淡水虾类之一。它生长快，个体大，繁殖快，生命力强，广泛分布于我国淡水湖泊中。青虾肉质细嫩鲜美，营养丰富，每百克食用部分含蛋白质16.40克，营养学家认为它有一定的补脑功能。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6208, '明虾', NULL, '水产品类', '明虾是海水虾，肉质肥厚，味道鲜美，富含蛋白质。中医认为，其味甘碱性温，可补肾壮阳，滋阴健胃。适于多种烹调法制菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6209, '草虾', NULL, '水产品类', '别名：黑壳虾。生命力强，肉味鲜美，个体大，是对虾属中最大的一种，最大的雌虾长达33cm，体重超过500g。杂食性。草虾性温味甘，入肝、肾经；草虾虾肉有补肾壮阳，通乳抗毒、养血固精、化瘀解毒、益气滋阳、通 草虾络止痛、开胃化痰等功效；适宜于肾虚阳痿、遗精早泄、乳汁不通、筋骨疼痛、手足抽搐、全身瘙痒、皮肤溃疡、身体虚弱和神经衰弱等病人食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6210, '白虾米', NULL, '水产品类', '白虾米，即干虾仁，又名海米、金钩、开洋。是用鹰爪虾、脊尾白虾、羊毛虾和周氏新对虾等加工的熟干品。虾米是著名的海味品，有较高的营养价值据测定每一百克虾米含蛋白质58.1克，脂肪2.1克，糖类4.6克。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6211, '斑节对虾', NULL, '水产品类', '斑节对虾俗称鬼虾、草虾、花虾、竹节虾、斑节虾、牛形对虾，联合国粮农组织通称大虎虾。分类学上隶属于节肢动物门、甲壳纲、十足目、游泳亚目、对虾科、对虾属、Litopenaeus亚属，是对虾属中最大型种。广盐性，能耐高温和低氧，对低温的适应力较弱。抗病能力较强。个体大，壳较厚，可食比例低于中国对虾，肉质鲜美，营养丰富。体壳较坚实，经得起用手捉拿。离水后干露于空气的耐力很强，可以销售活虾。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6212, '白刺虾', NULL, '水产品类', '白刺虾，十足目(Decapoda)长臂虾科(Palaemonidae)白虾属(Exopalaemon)甲壳动物的统称。因甲壳较薄、色素细胞少，平时身体透明，死后肌肉呈白色，故名。生物学特性白虾属已知共有6种,都分布在印度洋-西太平洋地区温暖海域或淡水中。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6213, '长毛对虾', NULL, '水产品类', '体淡棕黄色，额角上缘 7～8齿，下缘4～6齿。额角基部侧视比中国对虾高，比墨吉对虾低。额角后脊伸至头胸甲后缘附近，无中央沟。原产中国东海，南海和台湾海峡、日本、菲律宾等地。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6214, '喇蛄', NULL, '水产品类', '刺蛄即喇蛄，又称“大头虾”，在动物分类学中，它属于节肢动物门、甲壳纲、喇蛄科。它的模样与生活在海洋里的龙虾十分相似，所以有“淡水龙虾”之称。现在，中国共有4种喇蛄，有3种生活在东北地区的山地溪流或山地附近的河川、湖泊里，肉质细腻，味道鲜美，因为对生存水质和环境要求很高现在已基本灭绝，仅在深山中还有少数；还有一种叫克氏原喇蛄，也就是我们平时常见的小龙虾，简称为喇蛄，为日本欧美引入品质，分布在江南地区的淡水水域，肉可以食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6215, '虾籽', NULL, '水产品类', '虾籽又叫虾蛋，是虾子的卵加工而成。凡产虾的地区都能加工虾籽。以辽宁的营口、盘山、江苏的东台、大平、射阳、高邮、洪泽等地区生产较多。每年夏秋季节为虾籽加工时期。虾籽及其制品均可做调味品，味道鲜美。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6216, '小河虾', NULL, '水产品类', '小河虾广泛分布于我国江河、湖泊、水库和池塘中的河虾，是优质的淡水虾类。它肉质细嫩，味道鲜美，营养丰富，是高蛋白低脂肪的水产食品，颇得消费者青睐。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6217, '东方对虾', NULL, '水产品类', '对虾，学名东方对虾，又称中国对虾、斑节虾。节肢动物门，甲壳纲，十足目，对虾科，对虾属。对虾属个体大，通称大虾。雌性成长个体体长一般16～22厘米，重约50～80克，最大的可达30厘米，重250克；雄性较小，体长13～18厘米，重30～50克。对虾为广温广盐性海产动物。体呈长筒形，左右侧扁，身体分为头、胸和腹部，由20个体节组成。腹部较长，肌肉发达，分节明显。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6218, '南美虾', NULL, '水产品类', '南美虾是虾中的一个品种，南美虾壳薄体肥，肉质鲜嫩，味道鲜美，营养丰富。中国、越南、泰国、厄瓜多尔等国是南美虾养殖最主要的种植来源。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6219, '虾虎', NULL, '水产品类', '虾虎也称虾蛄，全世界约有400种，大部份分布于热带和亚热带的海岸，底栖性。被抓时腹部会射出无色液体，所以又被称为攋尿虾(常误写为濑尿虾或赖尿虾)。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6220, '樱花虾', NULL, '水产品类', '樱花虾又叫樱桃虾、玫瑰虾、火焰虾等，分布于中国台湾地区，以及其他一些东南亚国家。因为体形小，没有带攻击性与破坏性的螯足，食性上属于混合食性，因此，养在草缸里，不会伤害其他生物，还可以清除食物残渣，对水草上附着的藻类做细致的清洁工作。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6221, '青龙虾', NULL, '水产品类', '青龙虾(学名：Palinuridae)是节肢动物门甲壳纲十足目龙虾科4个属19种龙虾的通称。又名大虾、龙头虾、虾魁、海虾等。它头胸部较粗大，外壳坚硬，色彩斑斓，腹部短小，体长一般在20厘米～40厘米之间，重0.5公斤上下，是虾类中最大的一类。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6222, '虾滑', NULL, '水产品类', '虾滑是一种虾泥制品，主要材料有虾，辅料有肉、鱼类等。虾滑的做法是把虾去壳，通过上千次的摔打，使肉具有粘性，让其保持原有的营养成分，又具有了爽脆的口感。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6223, '螃蟹', NULL, '水产品类', '蟹，动物界，节肢动物门，甲壳纲、十足目、爬行亚目。螃蟹是甲壳类动物(crustacean)，它们的身体被硬壳保护着。螃蟹靠鳃呼吸。在生物分类学上，螃蟹与虾子、龙虾、寄居蟹算是同类的动物。绝大多数种类的螃蟹生活在海里或靠近海洋，当然也有一些的螃蟹栖于淡水或住在陆地。它们靠母蟹来生小螃蟹，每次母蟹都会产很多的卵，数量可达数百万粒以上。螃蟹是依靠地磁场来判断方向的。中国食蟹的历史悠久，《逸周书.五会解》、《周礼.天官.疱人》中均有记载。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6224, '蟹肉', NULL, '水产品类', '蟹肉介绍蟹乃食中珍味，素有“一盘蟹，顶桌菜”的民谚。它不但味美，且营养丰富，是一种高蛋白的补品。蟹肉是用海蟹剥制而成，外型为长短不等的条状或块状，呈淡黄色。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6225, '大闸蟹', NULL, '水产品类', '蟹乃食中珍味，素有“一盘蟹，顶桌菜”的民谚。它不但味美，且营养丰富，是一种高蛋白的补品。蟹肉是用海蟹剥制而成，外型为长短不等的条状或块状，呈淡黄色。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6226, '海蟹', NULL, '水产品类', '海蟹一般指三疣梭子蟹，俗名梭子蟹、枪蟹、海螃蟹、海蟹、海虫、水蟹、门蟹、小门子、蝎子、盖鱼、三点蟹、童蟹、飞蟹、烟蟀，英文名Swimming crab。分布于中国辽宁、河北、天津、山东、江苏、浙江、福建等海域。一般从南到北，3～5月和9～10月为生产旺季，渤海湾辽东半岛4～5月产量较多。三疣梭子蟹是中国重要的出口畅销品之一，主要输往日本，香港、澳门等国家和地区。\r\n值得注意的是，梭子蟹身处海洋，离开高盐分高氧环境后存活率大大降低。与河蟹最大的不同是，海蟹虽然存活率较低，但是短时间内死亡且未发出异味的梭子蟹', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6227, '肉蟹', NULL, '水产品类', '肉蟹（又名青蟹）是一种著名的食用蟹。青蟹含有丰富的蛋白质及微量元素，对身体有很好的滋补作用。一般人群均可食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6228, '梭子蟹', NULL, '水产品类', '梭子蟹是中国沿海的重要经济蟹类，学名“蝤蛑”，有些地方俗称“白蟹”。因头胸甲呈梭子形，故名。甲壳的中央有三个突起，所以又称“三疣梭子蟹”。雄性脐尖而光滑，螯长大，壳面带青色；雌性脐圆有绒毛，壳面呈赭色，或有斑点。梭子蟹肉肥味美，味鲜美，有较高的营养价值和经济价值，且适宜于海水暂养增肥，所以梭子蟹是海蟹。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6229, '膏蟹', NULL, '水产品类', '膏蟹膏满肉肥，素与鲍鱼、海参相媲美，享有“水产三珍”之誉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6230, '河蟹', NULL, '水产品类', '河蟹隶属甲壳纲，绒螯蟹属，是一种大型的甲壳动物，身体分21节，由于头部和胸部各节相互愈合，因此全身分为头胸部和腹部二部分。成蟹背面墨绿色，腹面灰白色，头胸甲平均长6-7cm，宽7.5cm。\r\n河蟹常穴居于江、河、湖沼的泥岸，夜间活动，以鱼、虾、动物尸体和谷物为食，每年秋季常洄游到出海的河口产卵，第二年3～5月孵化，发育成幼蟹后，再溯江河而上，在淡水中继续发育长大。河蟹的肉质鲜嫩，是深受人们喜爱的一味食品。\r\n河蟹学名中华绒螯蟹，属名贵淡水产品，味道鲜美，营养丰富，具有很高的经济价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6231, '青蟹', NULL, '水产品类', '别名青蟹、闸蟹、黄甲蟹、蝤蛑、和乐蟹。蟹甲壳呈椭圆形，体扁平、无毛，头胸部发达，双螯强有力，后足，形如棹，故有据棹子之称。头胸甲宽约为长的1.5倍，背面隆起，光滑；头胸甲表面有明显的“H”形凹痕；前额具4个突出的三角形齿，齿的大小及间距大致相等。前侧缘具9个大小相若突出的三角形齿。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6232, '帝王蟹', NULL, '水产品类', '别名：阿拉斯加帝王蟹，越前蟹，鳕场蟹、堪察加拟石蟹。帝王蟹又名皇帝蟹、石蟹或岩蟹，即石蟹科的甲壳类，它们主要分布在寒冷的海域。因其体型巨大而得名，素有“蟹中之王”的美誉。由于它们的体型巨大及肉质美味，很多物种都被广泛捕捉来作为食物，当中最为普遍的是堪察加拟石蟹。2011年9月，在位于南极洲近海大陆架下850米的一处泥床盆地，科学家发现超过100万只巨型帝王蟹。科学家称，这种外来的大型食肉动物的出现，可能是南极海域一场生态浩劫的最初迹象。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6233, '锯缘青蟹', NULL, '水产品类', '蟹乃食中珍味，素有“一盘蟹，顶桌菜”的民谚，它不但味美，且营养丰富，是一种高蛋白的补品。红鲟，学名锯缘青蟹，届福州特有的海洋经济蟹类，甲壳纲，梭子蟹科。喜穴居近岸浅海和河口处的泥沙底内，性凶猛，肉食性，主食鱼虾贝类。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6234, '石蟹', NULL, '水产品类', '石蟹头胸甲隆起，表面密布绒毛，前侧齿基部附近的头胸甲表面具颗粒；胸甲后部有长短不等的颗粒隆脊；额具6齿，居中4齿大小相近，前缘钝；前侧缘具6齿，第一齿末端平钝，第二至四齿大小相近，末端尖锐，末齿刺形；后缘与后侧缘均具颗粒隆脊。螯脚粗壮，不等称。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6235, '霸王蟹', NULL, '水产品类', '又名皇帝蟹、石蟹或岩蟹，即石蟹科的甲壳类，它们主要分布在寒冷的海域。因其体型巨大而得名，素有“蟹中之王”的美誉。由于它们的体型巨大及肉质美味，很多物种都被广泛捕捉来作为食物，当中最为普遍的是堪察加拟石蟹。帝王蟹属于深海蟹类，生存深度达850米之深，生存水温在2-5℃。帝王蟹能够生存的最低水温是1.4摄氏度。2011年9月，在位于南极洲近海大陆架下850米的一处泥床盆地，科学家发现超过100万只巨型帝王蟹。科学家称，这种外来的大型食肉动物的出现，可能是南极海域一场生态浩劫的最初迹象。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6236, '大花蟹', NULL, '水产品类', '蟹是十足目短尾次目的甲壳动物，尤指短尾族的种类(真蟹)，亦包括其他一些类型，如歪尾族的种类(外形及习性可与短尾族相似)。大花蟹则为蟹中一类并具有营养食用价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6237, '红鲟', NULL, '水产品类', '锯缘青蟹属甲壳纲，梭子蟹科。喜穴居近岸浅海和河口处的泥沙底内，性凶猛，肉食性，主食鱼虾贝类。肉质鲜美，营养丰富，兼有滋补强身之功效。尤其是将要怀孕的雌蟹，体内会产生红色或者黄色的膏，这种在中国南方叫做“膏蟹”，有“海上人参”之称。盛产于温暖的浅海中，主要分布在中国浙江、广东、广西、福建和台湾的沿海等地，江浙一带尤多。营养分析青蟹含有丰富的蛋白质及微量元素，对身体有很好的滋补作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6238, '和乐蟹', NULL, '水产品类', '产于万宁市一带海中的和乐蟹，膏满肉肥，为其它青蟹罕见，特别是其脂膏，金黄油亮，犹如咸鸭蛋黄，香味扑鼻。是海南四大名菜之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6239, '三点蟹', NULL, '水产品类', '红星梭子蟹又称三点蟹、三眼蟹、梭子蟹、枪蟹、海虫、水蟹、门蟹、盖鱼、童蟹，红星梭子蟹头胸甲呈梭形，稍隆起，表面有3个显著的疣状隆起。螯足发达，长节呈棱柱形，内缘具钝齿。第四对步足指节扁平宽薄如桨，适于游泳，红星梭子蟹属于暖水性底层蟹类。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6240, '面包蟹', NULL, '水产品类', '面包蟹多指黄道蟹属或馒头蟹属的品种。面包蟹头胸甲为浅褐色；眼区具一半环状的赤褐色斑纹；螯脚腕节和长节外侧面具一赤褐色斑点；步脚尖端为褐色。雄性头胸甲长62毫米，甲宽83毫米；雌性头胸甲长70.0毫米，甲宽93.0毫米。面包蟹主要地理分布与太平洋海域，在香港水域亦可发现。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6241, '墨鱼', NULL, '水产品类', '墨鱼是贝类，属软体动物门。墨鱼亦称乌贼鱼、墨斗鱼、目鱼等。干者叫明鱼。属软体动物中的头足类，产地分布很广，中国、朝鲜、日本及欧洲各沿海均有出产，中国舟山群岛出产最多。墨鱼肉、蛋、脊骨（中药名为海螵蛸）均可入药。李时珍称墨鱼为“血分药”，是妇女贫血、血虚经闭的佳珍。在浩瀚的东海，生长着这样一种生物，它象鱼类一样遨游，但并不属于鱼类，人们习惯称它为“墨鱼”，也叫它为“乌贼”或“乌鱼则”。它是我国著名的海产品之一，在浙江，和大黄鱼、小黄鱼、带鱼统称为“四大经济鱼类”，深受广大消费者喜爱。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6242, '蛤蜊', NULL, '水产品类', '蛤又叫蛤蜊，有花蛤、文蛤、西施舌等诸多品种。其肉质鲜美无比，被称为“天下第一鲜”、“百味之冠”，江苏民间还有“吃了蛤蜊肉，百味都失灵”之说。蛤蜊的营养特点是高蛋白、高微量元素、高铁、高钙、少脂肪。许多贝类也具上述特点。蛤蜊不仅味道鲜美，而且它的营养也比较全面，实属物美价廉的海产品。它含有蛋白质、脂肪、碳水化合物、铁、钙、磷、碘、维生素、氨基酸和牛磺酸等多种成分，是一种低热能、高蛋白，能防治中老年人慢性病的理想食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6243, '牡蛎', NULL, '水产品类', '木梨为落叶小乔木。幼枝有绒毛。叶卵形或长圆形，表面暗绿色，背面密被绒毛。花单生枝顶，白色或粉红色。果梨形，黄色，有香味。花期4-5月。 喜光而能耐半阴。适应性强，耐寒。对土壤要求不严，一般排水良好之地均可栽培。 用播种、扦插或压条法繁殖均可。移植宜在落叶后或萌芽前进行，一般小苗需留宿土，大苗需带土球。萌芽力尚强，可以整枝。主要害虫有大蓑蛾、刺蛾和蚜虫。 榅桲枝叶扶疏，花粉红色，宛如朝霞，果黄色，具芳香。适于孤植院前庭后观赏。实生苗可作梨、木瓜、苹果的矮化砧木，嫁接枇杷可增强期抗寒性。果可药用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6244, '鲍鱼', NULL, '水产品类', '鲍鱼是一种原始的海洋贝类，单壳软体动物，只有半面外壳，壳坚厚，扁而宽。鲍鱼是中国传统的名贵食材，四大海味之首。鲍鱼（Abalone），同鱼类毫无关系，倒跟田螺之类沾亲带故，据考证：盾鱼，因鲍叔牙爱吃，而被称为鲍鱼,形状有的像人的耳朵。螺旋部只留有痕迹，占全壳的极小部分。壳的边缘有9个孔，海水从这里流进，排出，连鲍的呼吸、排泄和生育也得依靠它。所以它又叫\"9孔螺\"。壳表面粗糙，有黑褐色斑块，内面呈现青、绿、红、蓝等色交相辉映的珍珠光泽。鲜鲍经过去壳、盐渍一段时间，然后煮熟，除去内脏，晒干成干品。它肉质鲜美，', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6245, '鱿鱼', NULL, '水产品类', '鱿鱼（Squid）属软体动物，是生活在海洋中的软体动物。在分类学上，鱿鱼是属于软体动物门——头足纲——二鳃亚纲——十腕目的动物。鱿鱼体内具有二片鳃作为呼吸器官；身体分为头部、很短的颈部和躯干部是乌贼的一种，体圆锥形，体色苍白，有淡褐色斑，头大，前方生有触足10条，尾端的肉鳍呈三角形，常成群游弋于深约20米的海洋中。在分类学上，鱿鱼是属于软体动物门-头足纲-二鳃亚纲-十腕目的动物。鱿鱼体内具有两片鳃作为呼吸器官；身体分为头部、很短的颈部和躯干部。其营养价值很高，是名贵的海产品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6246, '章鱼', NULL, '水产品类', '章鱼介绍章鱼，又称石居、八爪鱼、坐蛸、石吸、望潮、死牛，属于软体动物门头足纲八腕目（Octopoda）。章鱼有8个腕足，腕足上有许多吸盘；有时会喷出      黑色的墨汁，帮助逃跑。有些章鱼有相当发达的大脑，可以分辨镜中的自己；也可以走出科学家设计的迷宫，吃到迷宫中的螃蟹。也作艺人文章的执迷者。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6247, '扇贝', NULL, '水产品类', '扇贝为双壳纲翼形亚纲珍珠贝目中的一科。广泛分布于世界各海域，以热带海的种类最为丰富。中国已发现约45种,其中北方的栉孔扇贝和南方的华贵栉孔扇贝及长肋日月贝是重要的经济种。扇贝又名海扇，其肉质鲜美，营养丰富，它的闭壳肌干制后即是“干贝”，被列入八珍之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6248, '香螺', NULL, '水产品类', '海螺的一种，香螺又称黄镶玉螺，壳质较薄、坚实，呈梨状，壳面黄褐色，壳顶部呈清灰色。栖息潮间带泥或沙滩上，爬过的涂面留有踪迹，岁迹可采到。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6249, '干贝', NULL, '水产品类', '干贝是以江珧扉贝、日月贝等几种贝类的闭壳肌干制而成，呈短圆柱状，浅黄色，体侧有柱筋，是我国著名的海产“八珍”之一，是名贵的水产食品。古人曰：“食后三日，犹觉鸡虾乏味。”可见干贝之鲜美非同一般。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6250, '海螺', NULL, '水产品类', '海螺属软体动物腹足类。产于沿海浅海海底，以山东、辽宁、河北居多，产期在5～8月。海螺贝壳边缘轮廓略呈四方形，大而坚厚，壳高达10厘米左右，螺层6级，壳口内为杏红色，有珍珠光泽。螺肉丰腴细腻，味道鲜美，素有“盘中明珠”的美誉。它富含蛋白蛋、维生素和人体必需的氨基酸和微量元素，是典型的高蛋白、低脂肪、高钙质的天然动物性保健食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6251, '干鱿鱼', NULL, '水产品类', '干鱿鱼是将枪足贼自腹部剖开，挖去内脏，放入淡水中洗净，再以清水冲洗后晒干的产品。体扁长，头腕似佛手状，肉鳍紧附在尾部两侧，形似双髻，全身均为浅粉色，表面有白霜。主要产于广东、福建、浙江，产期为7～8月。日本、越南、朝鲜也产。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6252, '干墨鱼', NULL, '水产品类', '墨鱼，又称墨斗鱼、乌贼。墨鱼干味道鲜美，营养丰富，药用价值高。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6253, '瑶柱', NULL, '水产品类', '干贝是以江珧扉贝、日月贝等几种贝类的闭壳肌干制而成，呈短圆柱状，浅黄色，体侧有柱筋，是我国著名的海产“八珍”之一，是名贵的水产食品。古人曰：“食后三日，犹觉鸡虾乏味。”可见干贝之鲜美非同一般。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6254, '海虹', NULL, '水产品类', '北方称海虹，南方称淡菜。淡菜是海蚌的一种，又名贻贝，煮熟去壳晒干而成，因煮制时没有加盐，故称淡菜。淡菜味道极鲜，营养也很丰富，它所含蛋白质、碘、钙和铁都比较多，但所含脂肪很少。产于浙江、福建、山东、辽宁等省沿海。以身干、色鲜，肉肥者为佳。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6255, '黄蚬子', NULL, '水产品类', '黄蚬子学名青柳蛤，产于黄海浅海处，外壳呈黄色，其肉也呈黄色，斧型的贝壳，暗黄色的斑纹。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6256, '蚬子肉', NULL, '水产品类', '蚬子是一种软体动物，介壳形状像心脏，有环状纹，生在淡水软泥里，肉可吃，壳可入药。蚬含有蛋白质、多种维生素和钙、磷、铁、硒等人体所需的营养物质。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6257, '毛蚶', NULL, '水产品类', '毛蚶又叫麻蛤。麻蛤不只肉质鲜美异常，还有补血的功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6258, '螺蛳', NULL, '水产品类', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6259, '鲜鲍', NULL, '水产品类', '素称“海味之冠”的鲍鱼，自古以来就是海产“八珍”之一。鲍鱼营养价值极高，富含丰富的球蛋白；鲍鱼的肉中还含有一种被称为“鲍素”的成分，能够破坏癌细胞必需的代谢物质。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6260, '蛏子', NULL, '水产品类', '蛏子，学名缢蛏，属软体动物系，真瓣鳃纲，真瓣鳃目、竹蛏科。贝壳脆而薄，呈长扁方型，自壳顶腹缘，有一道斜行的凹沟，故名缢蛏。\r\n蛏生活在浅海泥沙中,有左右相等的两个贝壳,壳质脆薄,呈长方形,表面常生长一层浅绿色的薄皮。蛏肉味道鲜美,是比较普通的海产食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6261, '海瓜子', NULL, '水产品类', '贝类动物，软体动物门，双壳钢，帘蛤目、樱蛤科.海瓜子是慈溪市著名海水特产，多产于潮汐频繁的泥滩中。海瓜子因其形状大小似瓜子而得名，学名梅蛤，也称“虹彩明樱蛤”、“扁蛤”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6262, '鲜贝', NULL, '水产品类', '鲜贝是指新鲜大型贝壳内一块圆形肌肉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6263, '螺肉', NULL, '水产品类', '螺肉丰腴细腻，味道鲜美，素有“盘中明珠”的美誉；它富含蛋白蛋、维生素和人体必需的氨基酸和微量元素，是典型的高蛋白、低脂肪、高钙质的天然动物性保健食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6264, '田螺', NULL, '水产品类', '田螺含蛋白质、脂肪、碳水化合物、钙、磷、铁、硫胺素、核黄素、尼克酸、维生素A，具有利水消肿作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6265, '生蚝', NULL, '水产品类', '生蚝又称牡蛎，属牡蛎科（Ostreidae真牡蛎）或燕蛤科（Aviculidae珍珠牡蛎），双壳类软体动物，分布于温带和热带各大洋沿岸水域。海菊蛤属（Spondylus）与不等蛤属（Anomia）动物有时亦分别称为棘牡蛎和鞍牡蛎。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6266, '文蛤', NULL, '水产品类', '别名花蛤，黄蛤，圆蛤，白利壳，车螺。文蛤，科属软体动物门，瓣鳃纲，帘蛤目，帘蛤科，文蛤属。俗称“花蛤”，贝类中的珍品，因贝壳表面光滑并布有美丽的红、褐、黑等色花纹而得名。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6267, '花蛤', NULL, '水产品类', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6268, '海蚌', NULL, '水产品类', '西施舌（Coelomactraantiquata），海产双壳贝类，福建江苏浙江俗称＂海蚌＂，广东香港称＂贵妃蚌＂。营养丰富，富含优质蛋白和氨基酸，滋味鲜美，甘脆嫩滑，为人民大会堂国宴膳品，是早负盛名的筵席珍品佳肴。“鸡汤汆(cuan)海蚌”是与“佛跳墙”齐名的闽菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6269, '青口贝', NULL, '水产品类', '青口贝，即翡翠贻贝，又名海虹。干制后即为“淡菜”。分布于东海南部和南海沿岸。贝壳较大，壳长达13～14厘米。壳长，壳长是壳高的2倍。壳顶位于贝壳的最前端，喙。背缘弧形，腹缘直或略凹。壳较薄，壳面光滑，翠绿色，前半部常呈绿褐色，生长纹细密，前端具有隆起肋。壳内面呈瓷白色，或带青蓝色，有珍珠光泽。铰合齿左壳2个，右壳1个。足丝细软，淡黄色。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6270, '红螺', NULL, '水产品类', '又称皱红螺、海螺。红螺属软体动物门，腹足纲，分布广，海螺壳大而坚厚，呈灰黄色或褐色，壳面粗糙，具有排列整齐而平的螺肋和细沟，壳口宽大，壳内面光滑呈红色或灰黄色。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6271, '贻贝', NULL, '水产品类', '贻贝是一种海洋软体动物，也是属于双壳类的一种贝类，它的身体构造跟蚶子和牡蛎、蚌等基本上是一样的。但是它的左右两个外套膜除了在背面连接以外，在后端还有一点愈合，所以在后面背方形成一个明显的排水孔。在外套膜的后腹面的边缘生有很多分枝状的小触手。通过贻贝身体的水流，就是从这些生有触手的外套膜之间流入外套腔内，然后经过鳃到身体背部由排水孔排出来。贻贝便利用流经身体的海水进行呼吸和循环，它也利用水流带进体内的微小生物做食物。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6272, '河蚬', NULL, '水产品类', '河蚬贝壳中等大小，呈圆底三角形，壳高与壳长近似，两壳膨胀，壳顶高，稍偏向前方。壳面有光泽，颜色因环境而异，常呈棕黄色、黄绿色或黑褐色。壳面有粗糙的环肋。韧带短，突出于壳外。绞合部发达，闭壳肌痕明显，外套痕深而显著。河蚬栖息于淡水的湖泊、沟渠、池塘及咸淡水交汇的江河中，广泛分布于我国内陆水域。在俄罗斯、日本、朝鲜、东南亚各国均有分布。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6273, '河蚌', NULL, '水产品类', '河蚌别名：河歪、河蛤蜊、鸟贝、嘎拉（东北方言）、骚嘎啦（山东方言）等。软体动物门，瓣鳃纲（Lamellibranchia）蚌目。 珠蚌科。 无齿蚌亚科。 无齿蚌属 .贝类的通称。分布于亚洲、欧洲、北美和北非。大部分能在体内自然形成珍珠。外形呈椭圆形或卵圆形。壳质薄。易碎。两壳膨胀，后背部有时有后翼。壳顶宽大，略隆起，位于背缘中部或前端。壳面光滑，具同心圆的生长线或从壳顶到腹缘的绿色放射线。胶合部窄，无齿。斧足发达。雌雄异体。肉可食，亦为鱼类、禽类的天然饵料和饲料。有的种类可用做淡水育珠。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6274, '赤贝', NULL, '水产品类', '赤贝又名魁蚶，属瓣鳃纲，蚶科。贝壳大而坚厚，左右两壳相等，呈斜卵圆形，极膨胀。壳顶膨胀突出，放射肋宽，平滑无明显结节．约42—48条，以43条者为多。壳面白色，被少量棕色绒毛；壳内面白色，铰合部直，铰合齿约70枚。主要分布在中国、日本及朝鲜沿海，生活在20～35m水深的软泥或泥沙质海底。足丝强韧，多附着在石砾或死贝壳上。无水管，潜居后仅后端部分露出海底。魁蚶为冷水性贝类，生活水温为5～15℃，肉味鲜美，富含营养，宜鲜食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6275, '海兔', NULL, '水产品类', '海兔不是兔。海兔耸起两只耳朵（实为触角），外形像兔子，头上一前一后，只是没有毛而已。它长有二对触角，后触角较长，当它不动时，活像一只蹲在地上竖着一对大耳朵的小白兔，因而最早被罗马人称为海兔。后被世人所公认，海兔因而得名。海兔是一种海生螺类软体动物，居于珊瑚内，背部有透明的薄薄的壳皮，一般呈白色，有“海底宝石”美称，以海葵、海绵、水螅为食物。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6276, '鱿鱼板', NULL, '水产品类', '鱿鱼板，原料选自深海鱿鱼，污染少，营养丰富，最重要的是不含脂肪，吃多了也没有发胖的烦恼，在健康饮食的今天，越来越受到大家的青睐。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6277, '鱿鱼圈', NULL, '水产品类', '别名：枪乌贼、柔鱼、竹快子、小管仔。鱿鱼属软体动物类，是乌贼的一种。目前市场看到的鱿鱼有两种：一种是躯干部较肥大的鱿鱼，它的名称叫“枪乌贼”；一种是躯干部细长的鱿鱼，它的名称叫“柔鱼”，小的柔鱼俗名叫“小管仔”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6278, '石螺', NULL, '水产品类', '石螺雌雄异体。区别石螺雌、雄的方法主要是依据其右触角形态。雄石螺的右触角向右内弯曲(弯曲部分即雄性生殖器)，此外，雌螺个体大而圆，雄螺小而长。 石螺是一种卵胎生动物，其生殖方式独特，石螺的胚胎发育和仔螺发育均在母体内完成。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6279, '孔雀蛤', NULL, '水产品类', '孔雀蛤属于贝类，体形较大，壳长达13～14厘米。壳长是壳高的2倍。壳顶位于贝壳的最前端，喙状。背缘弧形，腹缘直或略凹。壳较薄，壳面光滑，翠绿色，前半部常呈绿褐色，生长纹细密，前端具有隆起肋。壳内面呈瓷白色，或带青蓝色，有珍珠光泽。铰合齿左壳2个，右壳1个。足丝细软，淡黄色。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6280, '兰花蚌', NULL, '水产品类', '兰花蚌是种双壳贝类，原产于加拿大纽芬兰以北的冰冷海域，台南联鸿贸易于1993年引进台湾，当时由于台湾未曾有这项产品，也就没有中文名称。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6281, '蚌壳', NULL, '水产品类', '蚌的外壳。古代常用来占卜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6282, '乌贼', NULL, '水产品类', '乌贼属软体动物，体圆锥形，体色苍白，有淡褐色斑，头大，前方生有触足10条，尾端的肉鳍呈三角形，常成群游弋于深约20米的海洋中。在分类学上，鱿鱼是属于软体动物门-头足纲-二鳃亚纲-十腕目的动物。乌贼体内具有两片鳃作为呼吸器官；身体分为头部、很短的颈部和躯干部。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6283, '香海螺', NULL, '水产品类', '海螺的一种，香螺又称黄镶玉螺，壳质较薄、坚实，呈梨状，壳面黄褐色，壳顶部呈清灰色。栖息潮间带泥或沙滩上，爬过的涂面留有踪迹，岁迹可采到。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6284, '象拔蚌', NULL, '水产品类', '象拔蚌又名皇帝蚌、女神蛤，是远东包括华人及日本人崇尚食用的高级海鲜。是蛤属的大型贝类。象拔蚌又称海笋，属于软体动物门，是一种海产贝类，个体有大有小，栖息地因种类而异原产地在美国和加拿大北太平洋沿海。因其又大又多肉的红管，被人们称为“象拔蚌”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6285, '墨鱼蛋', NULL, '水产品类', '墨鱼蛋为日照独有的海珍品，历史悠久，驰名海内外，相传为封建帝王御膳佳品。系由日照特产金乌贼的卵巢加工而成，其色乳白，状如卵，经厨师之手，可加工成状若花瓣、薄如纸片的高级食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6286, '南美螺', NULL, '水产品类', '南美螺又名苹果螺、大瓶螺，原产南美亚马逊河流域。由于它生命力强，繁殖率高，生长快，个体大，可进行人工大量养殖，又因其营养丰富，肉质脆嫩，味道鲜美，故成为人们喜食的上等佳肴。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6287, '西施舌', NULL, '水产品类', '西施舌(Coelomactra antiquata)，海产双壳贝类，福建江苏浙江俗称\"海蚌\"，广东香港称\"贵妃蚌\"。营养丰富，富含优质蛋白和氨基酸，滋味鲜美，甘脆嫩滑，为人民大会堂国宴膳品，是早负盛名的筵席珍品佳肴。“鸡汤汆(cuan)海蚌”是与“佛跳墙”齐名的闽菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6288, '鱿鱼头', NULL, '水产品类', '鱿鱼头大，前方生有触足10条，尾端的肉鳍呈三角形，鱿鱼常成群游弋于深约20米的海洋中。在分类学上，鱿鱼是属于软体动物门-头足纲-二鳃亚纲-十腕目的动物。鱿鱼体内具有两片鳃作为呼吸器官;身体分为头部、很短的颈部和躯干部。其营养价值很高，是名贵的海产品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6289, '秋蛤蜊', NULL, '水产品类', '秋蛤蜊不仅味道鲜美，而且它的营养也比较全面，实属物美价廉的海产品。其肉质鲜美无比，被称为“天下第一鲜”、“百味之冠”，江苏民间还有“吃了蛤蜊肉，百味都失灵”之说。是一种双壳类软体动物的总称，其色有红有白有紫，肉均可食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6290, '淡菜', NULL, '水产品类', '淡菜是贻贝科动物的贝肉，也叫青口，雅号“东海夫人”。蛋白质含量高达59%。贻贝是双壳类软体动物，外壳呈青黑褐色，生活在海滨岩石上。淡菜在中国北方俗称海虹，是驰名中外的海产食品之一。贻贝是贝类养殖事业中的重要种类，世界许多地区都有养殖，特别是北欧、北美以及澳大利亚等地区养殖贻贝很盛行，生产数量也很大。淡菜的经济价值很高，也有一定的药食价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6291, '杂色蛤蜊', NULL, '水产品类', '杂色蛤蜊不仅味道鲜美，而且它的营养也比较全面，实属物美价廉的海产品。其肉质鲜美无比，被称为“天下第一鲜”、“百味之冠”，江苏民间还有“吃了蛤蜊肉，百味都失灵”之说。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6292, '带子', NULL, '水产品类', '带子，北方称鲜贝，常见的有两类：一是所谓长带子，属江瑶科贝类的团壳肌；另一种是圆带子，属扇贝科贝类的闭壳肌。其干制品即为江瑶柱，北方称干贝。带子在广东、海南沿海盛产，是名贵海产品之一。其质爽软，滋味鲜美，蒸、炒、油泡皆宜；此品为潮汕、东江一带名菜，将鲜笋条和熟火腿条穿在带子中间，再用油泡法烹制而成，常作名贵热荤而登大席。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6293, '鳆鱼', NULL, '水产品类', '鳆鱼肉质细腻，味道鲜美，营养丰富，鲜品中含蛋白质24%，干品则高达40%以上，是一种高蛋白低脂肪的保健食品。近年来研究发现，鳆鱼肉中含有“鲍鱼素I”和“鲍鱼素Ⅱ”，两者有较强的抑制癌细胞作用。在食用鳆鱼时，一般须先用60%左右的热水浸泡4小时，换水后再用文火煮软，才可烹调食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6294, '凤螺', NULL, '水产品类', '贝类动物，软体动物门，腹足纲，新腹足目，峨螺科，贝壳纺缍形，壳长1-25公分。前水管沟打开，轴唇襞或有或无。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6295, '海蛎子', NULL, '水产品类', '学名牡蛎，是海洋中常见的贝类，南粤称\"蚝\"，闽南称\"蛎房\"，北方渔民称之为海蛎、石蛎。牡蛎属贝类，肉肥美爽滑，营养丰富，素有“海底牛奶”之美称。属牡蛎科或燕蛤科，双壳类软体动物，分布于温带和热带各大洋沿岸水域。海菊蛤属与不等蛤属动物有时亦分别称为棘牡蛎和鞍牡蛎。牡蛎于公元前即已养殖可以食用；珍珠可在珍珠牡蛎的外套膜中产生。牡蛎的两壳形状不同，表面粗糙，暗灰色；上壳中部隆起；下壳附著于其他物体上，较大，颇扁，边缘较光滑；两壳的内面均白色光滑。两壳于较窄的一端以一条有弹性的韧带相连。壳的中部有强大的闭壳肌，用', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6296, '黄螺', NULL, '水产品类', '黄螺是波部东风螺的俗称,其又叫凤螺、风螺等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6297, '鸟贝', NULL, '水产品类', '鸟贝也叫石垣贝，因其形状像鸟头而得名，学名鸟蛤，属维纳斯贝目。鸟贝是一种海洋贝类生物，通常生活在海滩边的泥沙下。鲜活鸟贝的外观艳丽，椭圆形的壳点缀有被凹槽分开的平滑的螺旋状罗纹。铰链骨板很小并且弯曲得很厉害。左瓣的铰链中央有两颗很小的扩散状齿，并与右瓣的一个窄小的齿相吻合。铰链前端延伸成1或2颗侧齿。另一侧有微升起的骨板，与其相连接的是韧带。两瓣的内缘有突出的槽。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6298, '笔管鱼', NULL, '水产品类', '笔管鱼形状奇特，它是一种体型细长的墨斗鱼，有的写为比管鱼。大连、青岛等地也有叫它海兔子的。笔管鱼也称日本枪乌贼，又名笔管蛸、小鱿鱼、乌蛸，从外观上说就是一种胴部细长的墨斗鱼。笔管鱼属于头足纲，枪乌贼科，胴长最大可达15厘米，形状类似鱿鱼，但相比鱿鱼短而小，体短而宽。有的大连人、青岛人还叫它“海兔”。因为这种笔管鱼逃生速度快，正可谓静如处子动如脱兔。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6299, '圆蛤', NULL, '水产品类', '圆蛤即厚蛤。蛤(clam)的可食种。软体动物门双壳纲(Bivalvia)无脊椎动物。典型种类有北圆蛤(Mercenaria mercenaria,又称樱桃核蛤、小颈蛤、硬壳蛤)和南圆蛤(M. campechiensis)。北圆蛤长约7.5∼12.5公分(3∼5吋)；壳白色，无光泽，厚实，圆形，具明显的同心圆纹；分布于圣罗伦斯湾至墨西哥湾一带的潮间带，是大西洋沿岸最重要的食用蛤。南圆蛤长约7.5∼15公分；壳白色，重而厚实，分布于乞沙比克湾至西印度群岛一带的潮间带。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6300, '墨鱼丸', NULL, '水产品类', '墨鱼丸色泽洁白，富有弹性，入口爽脆，味道鲜美，宴席菜和家常菜均可适用。墨鱼丸是海南和潮汕地区传统名菜。潮汕人常称为墨斗丸。用新鲜墨鱼和猪肥肉配制而成。曾在海南及全国烹饪大赛中获奖。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6301, '鱿鱼卷', NULL, '水产品类', '鱿鱼（Squid）属软体动物，是生活在海洋中的软体动物。在分类学上，鱿鱼是属于软体动物门——头足纲——二鳃亚纲——十腕目的动物。鱿鱼体内具有二片鳃作为呼吸器官；身体分为头部、很短的颈部和躯干部是乌贼的一种，体圆锥形，体色苍白，有淡褐色斑，头大，前方生有触足10条，尾端的肉鳍呈三角形，常成群游弋于深约20米的海洋中。在分类学上，鱿鱼是属于软体动物门-头足纲-二鳃亚纲-十腕目的动物。鱿鱼体内具有两片鳃作为呼吸器官；身体分为头部、很短的颈部和躯干部。其营养价值很高，是名贵的海产品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6302, '白菜', NULL, '蔬菜类', '白菜原产于我国北方，是十字花科芸薹属叶用蔬菜，通常指大白菜；也包括小白菜以及由甘蓝的栽培变种结球甘蓝，即“圆白菜”或“洋白菜”。引种南方，南北各地均有栽培。十九世纪传入日本、欧美各国。白菜种类很多，北方的大白菜有山东胶州大白菜、北京青白、天津青麻叶大白菜、东北大矮白菜、山西阳城的大毛边等。同时白菜作为相关网络用语使用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6303, '油菜', NULL, '蔬菜类', '油菜，又叫油白菜，苦菜，是十字花科植物油菜的嫩茎叶，原产我国，颜色深绿，帮如白菜，属十字花科白菜变种。南北广为栽培，四季均有供产。油菜中含多种营养素，所含的维生素C丰富。在网络上也作为“有才”的同义词。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6304, '芹菜', NULL, '蔬菜类', '芹菜，属伞形科植物。有水芹、旱芹两种，功能相近，药用以旱芹为佳。旱芹香气较浓，又名“香芹\"，亦称\"药芹\"。芹菜是高纤维食物,它经肠内消化作用产生一种木质素或肠内脂的物质，这类物质是一种抗氧化剂，常吃芹菜，尤其是吃芹菜叶，对预防高血压、动脉硬化等都十分有益，并有辅助治疗作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6305, '菠菜', NULL, '蔬菜类', '菠菜，藜科菠菜属一年生或二年生草本 。又称菠薐 、波斯草。以叶片及嫩茎供食用。原产波斯，2000年前已有栽培。后传到北非，由摩尔人传到西欧西班牙等国。菠菜647年传入唐朝。菠菜主根发达，肉质根红色，味甜可食。菠菜属耐寒性蔬菜，长日照植物。中国北方也有冬季播种 、来春收获的 ，俗称埋头菠菜。条播或撒播均可。菠菜的主要病害有霜霉病、病毒病、炭疽病，主要虫害有蚜虫、潜叶蝇等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6306, '蒜苗', NULL, '蔬菜类', '蒜苗，又叫青蒜（不见光时为蒜黄）。品质好的蒜苗应该鲜嫩，株高在35厘米左右，叶色鲜绿，不黄不烂，毛根白色不枯萎，而且辣味较浓。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6307, '圆白菜', NULL, '蔬菜类', '结球甘蓝（Brassica oleracea L.var.capitata L.）是十字花科、芸苔属的植物，为甘蓝（Brassica oleracea L.）的变种。又名卷心菜、洋白菜、疙瘩白、包菜、圆白菜、包心菜、莲花白等。二年生草本，被粉霜。矮且粗壮一年生茎肉质，不分枝，绿色或灰绿色。基生叶多数，质厚，层层包裹成球状体，扁球形，直径10-30厘米或更大，乳白色或淡绿色；起源于地中海沿岸，16世纪开始传入中国。甘蓝具的耐寒、抗病、适应性强、易贮耐运、产量高、品质好等特点，在中国各地普遍栽培，是中国东北、', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6308, '小白菜', NULL, '蔬菜类', '小白菜又名不结球白菜、青菜、油菜。原产于我国，南北各地均有分布，在我国栽培十分广泛。十字花科芸薹属。小白菜是芥属栽培植物，茎叶可食，一、二年生草本植物，常作一年生栽培。植株较矮小，浅根系，须根发达。叶色淡绿至墨绿，叶片倒卵形或椭圆形，叶片光滑或褶缩，少数有绒毛。叶柄肥厚，白色或绿色。不结球。花黄色种子近圆形。据测定，小白菜是蔬菜中含矿物质和维生素最丰富的菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6309, '韭菜', NULL, '蔬菜类', '韭菜，属百合科多年生草本植物，以种子和叶等入药。具健胃、提神、止汗固涩、补肾助阳、固精等功效。在中医里，韭菜有一个很响亮的名字叫“壮阳草”，还有人把韭菜称为“洗肠草”，不但如此，韭菜还有很多名字。韭菜还叫草钟乳、起阳草、长生草，又称扁菜。韭菜入药的历史可以追溯到春秋战国时期。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6310, '生菜', NULL, '蔬菜类', '生菜是叶用莴苣的俗称，属菊科莴苣属。为一年生或二年生草本作物，也是欧、美国家的大众蔬菜，深受人们喜爱。生菜原产欧洲地中海沿岸，由野生种驯化而来。古希腊人、罗马人最早食用。生菜传入我国的历史较悠久，东南沿海，特别是大城市近郊、两广地区栽培较多，特别是台湾种植尤为普遍。近年来，栽培面积迅速扩大，生菜也由宾馆、饭店进入寻常百姓的餐桌。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6311, '茼蒿', NULL, '蔬菜类', '茼蒿 tónghāo即蓬蒿。一年生或二年生草本植物，叶互生，长形羽状分裂，花黄色或白色，瘦果棱，高二三尺，茎叶嫩时可食，亦可入药。亦称“蓬蒿”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6312, '香菜', NULL, '蔬菜类', '香菜又名芫荽、盐荽、胡荽、香荽、延荽、漫天星等。为伞形科芫荽属一年生草本植物。最初称为胡荽，英文名Coriander Herb，原产于中亚和南欧，或近东和地中海一带。据唐代《博物志》记载，公元前119年西汉张骞从西域引进香菜，故初名胡荽。，8～12世纪传入日本。后来在南北朝后赵时，赵皇帝石勒认为自己是胡人，胡荽听起来不顺耳，下令改名为原荽，后来演变为芫荽。在《齐民要术》中已有栽培技术和腌制方法的记载。它的嫩茎和鲜叶有种特殊的香味，常被用作菜肴的点缀、提味之品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6313, '豆苗', NULL, '蔬菜类', '豆苗俗称豌豆苗。豌豆苗为豆科植物豌豆的嫩苗。豌豆苗的供食部位是嫩梢和嫩叶，营养丰富，含有多种人体必须的氨基酸。其叶清香、质柔嫩、华润爽口，色、香、味俱佳。营养丰富且是绿色无公害，吃起来清香脆爽，味道鲜美独特。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6314, '芦笋', NULL, '蔬菜类', '芦笋是世界十大名菜之一，又名石刁柏。在国际市场上享有“蔬菜之王”的美称，芦笋富含多种氨基酸、蛋白质和维生素，其含量均高于一般水果和蔬菜，特别是芦笋中的天冬酰胺和微量元素硒、钼、铬、锰等，具有调节机体代谢，提高身体免疫力的功效，在对高血压、心脏病、白血病、血癌、水肿、膀胱炎等的预防和治疗中，具有很强的抑制作用和药理效应。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6315, '苋菜', NULL, '蔬菜类', '苋菜的叶呈卵形或棱形，菜叶有绿色或紫红色，茎部纤维一般较粗，咀嚼时会有渣。苋菜菜身软滑而菜味浓，入口甘香，有润肠胃清热功效。亦称为“凫葵”、“荇菜”、“莕菜”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6316, '芥菜', NULL, '蔬菜类', '芥菜（学名：Brassica juncea），是芸苔属一年生或二年生草本。是中国著名的特产蔬菜。芥菜的主侧根分布在约30厘米的土层内，茎为短缩茎。叶片着生短缩茎上，有椭圆、卵圆、倒卵圆、披针等形状。叶色绿、深绿、浅绿 、黄绿、绿色间紫色或紫红。叶面平滑或皱缩。叶缘锯齿或波状，全缘或有深浅不同、大小不等的裂片。花冠十字形，黄色，四强雄蕊，异花传粉，但自交也能结实。种子圆形或椭圆形，色泽红褐或红色。中国有极其丰富的子用、叶用、茎用、芽用和根用芥菜的变种和品种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6317, '莴笋', NULL, '蔬菜类', '莴笋为菊科，属一年生或两年生草本植物，原产地中海沿岸，约在七世纪初，经西亚传入我国，各地普遍栽培。莴苣分茎用和叶用两种，前者各地都有栽培，后者南方栽培较多，是春季及秋、冬季重要的蔬菜之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6318, '雪里蕻', NULL, '蔬菜类', '雪里红，一年生草本植物，芥菜的变种，将芥叶连茎腌制，便是雪里红（又称雪里翁）。叶子深裂，边缘皱缩，花鲜黄色。茎和叶子是普通蔬菜，通常腌着吃。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6319, '荠菜', NULL, '蔬菜类', '芥菜（学名：Brassica juncea），是芸苔属一年生或二年生草本。是中国著名的特产蔬菜。芥菜的主侧根分布在约30厘米的土层内，茎为短缩茎。叶片着生短缩茎上，有椭圆、卵圆、倒卵圆、披针等形状。叶色绿、深绿、浅绿 、黄绿、绿色间紫色或紫红。叶面平滑或皱缩。叶缘锯齿或波状，全缘或有深浅不同、大小不等的裂片。花冠十字形，黄色，四强雄蕊，异花传粉，但自交也能结实。种子圆形或椭圆形，色泽红褐或红色。中国有极其丰富的子用、叶用、茎用、芽用和根用芥菜的变种和品种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6320, '黄心菜', NULL, '蔬菜类', '黄心菜，又名卷窝菜，在信阳栽培历史悠久，属豫南特色蔬菜。黄心菜叶片圆形呈麻窝状，外叶绿色塌地，心叶蛋黄色，叶尖向外翻卷，叶肥厚细嫩。纤维少，营养丰富，富含多种人体必需的微量元素。保鲜时间长，耐贮运。病虫害少，适合生产无公害蔬菜和有机蔬菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6321, '蕨菜', NULL, '蔬菜类', '蕨菜为蕨类植物蕨还处于卷曲未展时的嫩叶，蕨菜是野菜的一种。它所烹制的菜肴色泽红润、质地软嫩、清香味浓，而且富含氨基酸、多种维生素、微量元素，还包括蕨素、蕨甙、甾醇等特有的营养素，被称为“山菜之王”，而且是不可多得的野菜美味。蕨菜可鲜食，但较难以保鲜，所以市场上常见其腌制品或干品，现在我国蕨菜大量用于出口', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6322, '萝卜缨', NULL, '蔬菜类', '萝卜叶介绍萝卜，大部分人吃的是它的根，认为根的效用无穷，其实，它的叶片营养更为惊人。研究表明， 萝卜叶片含有很多的胡萝卜素，每一百克维他命A含量是1400 IU，是同量青花菜400 IU的三倍以上;而钙的含量是每一百克含有238毫克，是菠菜55毫克的四倍多;铁质含量是鳗鱼的五倍，尤其是东北雌性红萝卜的叶片铁质含量是鳗鱼的22倍;维生素B1比豆豉多六成;维生素B2则是牛肉的四倍。从以上可以看出萝卜叶的营养价值惊人，可惜一般很少有人利用，都把它作为垃圾再让大地回收，辜负了造物主的美意。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6323, '芽菜', NULL, '蔬菜类', '芽菜是用芥菜的嫩茎划成丝腌制而成，分咸、甜两种。咸芽菜产于四川的南溪、泸州、永川，创始于1841年；甜芽菜产于四川的宜宾，古称“叙府芽菜”，创始于1921年，现畅销于四川及京、津、沪等地。宜宾芽菜要求色褐黄，润泽发亮，根条均匀，气味甜香，咸淡适口，质嫩脆。无菜叶、老梗、怪味、霉变。咸芽菜色青黄，润泽，根条均匀，质嫩脆，味香，咸淡适口，无老梗、怪味、霉变。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6324, '马蹄粉', NULL, '蔬菜类', '荸荠粉又叫马蹄粉，纯正的是用生马蹄直接加工而成的，含丰富的维生素B和C、植物蛋白、磷质，有清热去湿解毒的功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6325, '橄榄菜', NULL, '蔬菜类', '橄榄菜是潮汕地区所特有的风味小菜，取橄榄甘醇之味，芥菜丰腴之叶煎制而成。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6326, '冬菜', NULL, '蔬菜类', '冬菜是一种半干态非发酵性咸菜，因加工制作多在冬季，故得此名。主要品种有京冬菜、津冬菜、川冬菜等。多用作汤料或炒食，风味鲜美。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6327, '马兰头', NULL, '蔬菜类', '马兰头，又名马兰、红梗菜、鸡儿肠、田边菊、紫菊、螃蜞头草等，属菊科马兰属多年生草本植物。马兰头原是野生种，生于路边、田野、山坡上，全国大部分地区均有分布。\r\n马兰头有红梗和青梗两种，均可食用，药用以红梗马兰头为佳。由于寒食节与清明节合二为一的关系，一些地方还保留着清明节吃冷食的习惯。在浙江吃马兰头等时鲜蔬菜，是取其“青”字，以合“清明”之“青”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6328, '苦苣', NULL, '蔬菜类', '苦菊进入初夏后会开蓝色小花，是清晨绽放、晚上闭合的一日型香草，但能够连续不断的开展。叶有苦味，软化后苦味减少而柔软，性喜冷凉气候，初夏抽花茎，花和嫩叶可加入色拉，或炒熟食用，有抗菌、解热、消炎、明目等作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6329, '大白菜', NULL, '蔬菜类', '白菜原产于我国北方，是十字花科芸薹属叶用蔬菜，通常指大白菜；也包括小白菜以及由甘蓝的栽培变种结球甘蓝，即“圆白菜”或“洋白菜”。引种南方，南北各地均有栽培。十九世纪传入日本、欧美各国。白菜种类很多，北方的大白菜有山东胶州大白菜、北京青白、天津青麻叶大白菜、东北大矮白菜、山西阳城的大毛边等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6330, '莴苣叶', NULL, '蔬菜类', '莴笋为菊科，属一年生或两年生草本植物，原产地中海沿岸，约在七世纪初，经西亚传入我国，各地普遍栽培。莴苣分茎用和叶用两种，前者各地都有栽培，后者南方栽培较多，是春季及秋、冬季重要的蔬菜之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6331, '紫椰菜', NULL, '蔬菜类', '又称紫甘蓝、红甘蓝、赤甘蓝，俗称紫包菜，十字花科、芸苔属甘蓝种中的一个变种。是结球甘蓝中的一个类型，由于它的外叶和叶球都呈紫红色，故名。紫甘蓝也叫紫圆白菜，叶片紫红，叶面有蜡粉，叶球近圆形。营养丰富，尤其含有丰富的维生素C、V和较多的维生素E和B族。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6332, '娃娃菜', NULL, '蔬菜类', '娃娃菜娃娃菜乍一看还以为是年幼的大白菜，其实不然。娃娃菜的营养价值和大白菜的完全相同，.娃娃菜是韩国人主要进口我国的蔬菜品种，娃娃菜国内种植水平最高的是“不老泉娃娃菜”，每一盒均有单一编码，实行统一无公害管理，口感特别好，可惜就像“不老泉鱼”一样，国内没有现售，全部出口或供应政府。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6333, '紫甘蓝', NULL, '蔬菜类', '紫甘蓝又称红甘蓝、赤甘蓝，俗称紫包菜，十字花科、芸苔属甘蓝种中的一个变种。是结球甘蓝中的一个类型，由于它的外叶和叶球都呈紫红色，故名。紫甘蓝也叫紫圆白菜，叶片紫红，叶面有蜡粉，叶球近圆形。营养丰富，尤其含有丰富的维生素C、V和较多的维生素E和B族。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6334, '蒜薹', NULL, '蔬菜类', '蒜薹是大蒜的花茎。色绿叶美，耐贮藏，秋、冬、春三季都有供应。\r\n品质好的蒜薹应新鲜、脆嫩，无粗老纤维，条长，上部浓绿，基部嫩白，尾端不黄，不烂、不蔫、苔顶帽不开花。\r\n蒜薹的辛辣味比大蒜要轻，加之它所具有的蒜香能增加菜肴的香味，因此更易被人们所接受。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6335, '紫甘蓝菜', NULL, '蔬菜类', '又称紫甘蓝、红甘蓝、赤甘蓝，俗称紫包菜，十字花科、芸苔属甘蓝种中的一个变种。是结球甘蓝中的一个类型，由于它的外叶和叶球都呈紫红色，故名。紫甘蓝也叫紫圆白菜，叶片紫红，叶面有蜡粉，叶球近圆形。营养丰富，尤其含有丰富的维生素C、V和较多的维生素E和B族。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6336, '乌塌菜', NULL, '蔬菜类', '乌塌菜又名塌菜、塌棵菜、塌地松、黑菜等，为十字花科芸苔属芸苔种白菜亚种的一个变种，以墨绿色叶片供食，原产中国，主要分布在长江流域。乌塌菜的叶片肥嫩，可炒食、作汤、凉拌，色美味鲜，营养丰富', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6337, '西芹', NULL, '蔬菜类', '西芹又名西洋芹菜，其营养丰富，富含蛋白质、碳水化合物、矿物质及多种维生素等营养物质，还含有芹菜油，具有降血压、镇静、健胃、利尿等疗效，是一种保健蔬菜， 西芹是这些年从国外引入，已广泛栽培并深受百姓喜爱的，叶柄宽厚，单株叶片数多，重量大，可达1Kg以上。西芹和本芹（中国芹菜）具有相同的营养和食疗价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6338, '西生菜', NULL, '蔬菜类', '生菜从西方引进，故名西生菜。生菜即叶用莴笋，因适宜生食而得名，质地脆嫩，口感鲜嫩清香。在肉食量明显增加的现代人中，生菜给人带来清爽利口的美好感受，颇受人们喜爱。现在市场上一般会有两种：球形的包心生菜和叶片皱褶的奶油生菜(花叶生菜)。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6339, '艾草', NULL, '蔬菜类', '艾草，是一种多年生草本植物，分布于亚洲及欧洲地区。一般用于针灸术的「灸」。所谓针灸其实分成两个部份。「针」就是拿针刺穴道，而「灸」就是拿艾草点燃之后去熏、烫穴道，穴道受热固然有刺激，但并不是任何纸或草点燃了都能做为「灸」使用。艾草的气味肯定也同时发挥了一定的作用。中国民间用拔火罐的方法治疗风湿病时，以艾草作为燃料效果更佳。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6340, '紫包菜', NULL, '蔬菜类', '紫甘蓝又称红甘蓝、赤甘蓝，俗称紫包菜，十字花科、芸苔属甘蓝种中的一个变种。是结球甘蓝中的一个类型，由于它的外叶和叶球都呈紫红色，故名。紫甘蓝也叫紫圆白菜，叶片紫红，叶面有蜡粉，叶球近圆形。营养丰富，尤其含有丰富的维生素C、V和较多的维生素E和B族。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6341, '蒜黄', NULL, '蔬菜类', '蒜黄也是大蒜的幼苗，但因冬季栽培在温室中，避免阳光照射，故蒜叶呈嫩黄钯，质地也比较柔嫩。品质好的蒜黄应柔软细嫩，植株肥壮，叶蜡黄色，叶尖稍带线紫色，基部嫩白，叶尖不烂、不干，富有清香味，辣味不浓。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6342, '白菜梗', NULL, '蔬菜类', '白菜外层叶子较厚的部分，白菜种类很多，北方的大白菜有山东胶州大白菜、北京青白、天津青麻叶大白菜、东北大矮白菜、山西阳城的大毛边等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6343, '芦蒿', NULL, '蔬菜类', '湿中生耐阴性的多年生草本植物，植株具清香气味，以鲜嫩茎杆供食用，清香、鲜美，脆嫩爽口，营养丰富。芦蒿可凉拌或炒食，嫩茎及叶作菜蔬或腌制酱菜。芦蒿抗逆性强，很少发生病虫害，是一种无污染的绿色食品，是中国江南一些市场供应的主要野菜品种之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6344, '苦菊', NULL, '蔬菜类', '苦菊进入初夏后会开蓝色小花，是清晨绽放、晚上闭合的一日型香草，但能够连续不断的开展。叶有苦味，软化后苦味减少而柔软，性喜冷凉气候，初夏抽花茎，花和嫩叶可加入色拉，或炒熟食用，有抗菌、解热、消炎、明目等作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6345, '空心菜', NULL, '蔬菜类', '空心菜，原名雍菜，又名，藤藤菜、蕹菜、蓊菜、通心菜、无心菜、瓮菜、空筒菜、竹叶菜开白色喇叭状花其梗中心是空的，故称“空心菜”。中国南方农村普遍栽培作蔬菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6346, '韭黄', NULL, '蔬菜类', '韭黄也称“韭芽”、“黄韭芽”、“黄韭”，俗称“韭菜白”，为韭菜经软化栽培变黄的产品。韭菜隔绝光线，完全在黑暗中生长，因无阳光供给，不能产生光合作用，合成叶绿素，就会变成黄色，称之为“韭黄”。因不见阳光而呈黄白色，其营养价值要逊于韭菜。属百合科多年生草本植物，以种子和叶等入药。具健胃、提神、止汗固涩、补肾助阳、固精等功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6347, '芥兰', NULL, '蔬菜类', '芥蓝属十字花科，一年生草本。原产我国，以广东福建等省栽培较多。产于秋末至春季。\r\n芥蓝叶柄较长，叶呈长倒卵型，色泽深绿、茎叶多白粉，气味清香、质地柔嫩，味道鲜美，是叶菜类中含维生素较多的青菜。\r\n芥蓝的食用部分为带叶的菜薹，因为芥蓝含淀粉多，的以口感不如菜心柔软，但十分爽脆，别有风味。由于叶色翠绿，芥蓝已比成为宴度上一道很受欢迎的菜色。\r\n芥蓝的品质要求：以叶茎鲜嫩，味道清香，无烂叶、泥土者质佳。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6348, '上海青', NULL, '蔬菜类', '上海青是一种小白菜，叶少茎多，菜茎白白的像葫芦瓢，因此，上海青也有叫做瓢儿白的。 上海青的特点就在于长的“光明磊落”，每一片叶都是碧绿，每一片叶在生长期都完成了叶绿素的光合作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6349, '青蒜', NULL, '蔬菜类', '又名蒜苗。青蒜是大蒜青绿色的幼苗，以其柔嫩的蒜叶和叶鞘供食用。品质好的青蒜应该鲜嫩，株高在35厘米以上，叶色鲜绿，不黄不烂，毛根白色不枯萎，而且辣味较浓。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6350, '梅干菜', NULL, '蔬菜类', '梅干菜是一种中国传统烹饪原料。使用雪里蕻或其他芥菜种类的茎叶，用盐腌制风干而成。是一种客家乡土菜。秋末冬初，菜园里的芥菜抽了苔，姆指粗细，顶带花蕾，形如秋萄，脆嫩味甘。这时，摘下菜心，晾挂几天。待叶子变软时，放进盆里，撒上盐，用手揉搓，等渗出一些菜汁时，便装入陶瓮，码放一层撒一层盐，装满后用芥菜叶或竹笋壳把瓮口封严。过了十天半个月，取出晒干，便成职色泽金黄，咸酸味甘的梅干菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6351, '莴苣', NULL, '蔬菜类', '莴苣，菊科，莴苣属，1.二年生草本植物。莴苣可分为叶用和茎用两类。莴苣的名称很多，在本草书上称作“千金菜”，“莴苣”和“石苣”。叶用莴苣又称春菜、生菜，茎用莴苣又称莴笋、香笋。我国各地栽培面积莴笋比生菜多。莴笋的肉质嫩，茎可生食、凉拌、炒食、干制或腌渍。生菜主要食叶片或叶球，近年来在各大城市尤其是南方沿海各省的大城市有所发展，成为当前增加花式品种的主要蔬菜。莴苣茎叶中含有莴苣素，味苦，高温干旱苦味浓，能增强胃液，刺激消化，增进食欲，并具有镇痛和催眠的作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6352, '芥蓝', NULL, '蔬菜类', '芥蓝属十字花科，一年生草本。原产我国，以广东福建等省栽培较多。产于秋末至春季。\r\n芥蓝叶柄较长，叶呈长倒卵型，色泽深绿、茎叶多白粉，气味清香、质地柔嫩，味道鲜美，是叶菜类中含维生素较多的青菜。\r\n芥蓝的食用部分为带叶的菜薹，因为芥蓝含淀粉多，的以口感不如菜心柔软，但十分爽脆，别有风味。由于叶色翠绿，芥蓝已比成为宴度上一道很受欢迎的菜色。\r\n芥蓝的品质要求：以叶茎鲜嫩，味道清香，无烂叶、泥土者质佳。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6353, '莴笋叶', NULL, '蔬菜类', '莴笋叶营养丰富，还具有清热安神、清肝利胆、养胃的功效。适宜胃病、维生素C缺乏、肥胖、高胆固醇、神经衰弱、肝胆病患者食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6354, '油麦菜', NULL, '蔬菜类', '油麦菜，油麦菜属菊科，是以嫩梢、嫩叶为产品的尖叶型叶用莴苣，叶片呈长披针形它的长相有点像莴笋的“头”，叶细长平展，笋又细又短。从血缘关系看，油麦菜属于叶用莴苣的一个变种——长叶莴苣，与人们熟悉的生菜相近，所以又名牛俐生菜。它的色泽淡绿、长势强健.抗病性、适应性强、质地脆嫩，口感极为鲜嫩、清香、有“凤尾”之称。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6355, '蒲公英', NULL, '蔬菜类', '整株植物匍匐于地上，叶如荠菜，只是稍大，无挺立茎，花从植株中心冒出。蒲公英植物体中含有蒲公英醇、蒲公英素、胆碱、有机酸、菊糖等多种健康营养成分。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6356, '马齿菜', NULL, '蔬菜类', '又名马齿苋、马齿草、马苋、长命菜、马齿龙芽、酱瓣豆草、瓜子菜、五行草、灰苋、马踏草、安乐菜、酸苋、耐旱菜。可作菜蔬食用。药用对急性肠炎、菌痢、肺病、肠痈、乳疮及产后子宫出血、痔疮出血、肾炎水肿等均有效。抗菌试验表明，马齿苋对痢疾杆菌、伤寒杆菌、金黄色葡萄球菌有抑制作用。民间以马齿苋与肉末作馅，包馄饨、饺子食用，能清利肠热，止泻止痢。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6357, '马齿苋', NULL, '蔬菜类', '又名马齿菜、马齿草、马苋、长命菜、马齿龙芽、酱瓣豆草、瓜子菜、五行草、灰苋、马踏草、安乐菜、酸苋、耐旱菜。可作菜蔬食用。药用对急性肠炎、菌痢、肺病、肠痈、乳疮及产后子宫出血、痔疮出血、肾炎水肿等均有效。抗菌试验表明，马齿苋对痢疾杆菌、伤寒杆菌、金黄色葡萄球菌有抑制作用。民间以马齿苋与肉末作馅，包馄饨、饺子食用，能清利肠热，止泻止痢。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6358, '穿心莲', NULL, '蔬菜类', '别名：一见喜、斩蛇剑、苦草、榄核莲。在中医药的五行学说中认为苦入心，而穿心莲只要你含入一小片它的叶子，马上可以感受到，那种刻骨铭心的苦，像是直入你的心中，故名“穿心莲”。有清热解毒、消炎、消肿止痛作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6359, '蒿子杆', NULL, '蔬菜类', '蒿子秆，在中国的南北各地都能够见到，由于它的花很像野菊，所以又叫菊花菜，在中国台湾叫打某菜。常吃这个蒿子秆能通便排毒，消食开胃。除此之外，研究发现，每100克蒿子秆里含有的矿物质钾高达450毫克。钾，可以利尿，使人的血管内容量不至过高，同时还能通过高血钾对离子的平衡，使血管壁保持松弛状态。再结合蒿子秆安心气的作用，格外能促使人身心达到平衡，有效平稳血。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6360, '青菜', NULL, '蔬菜类', '泛指绿色蔬菜，统称青菜。云南人也将苦菜称为青菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6361, '紫苏', NULL, '蔬菜类', '紫苏在我国种植应用约有近2000年的历史，主要用于药用、油用、香料、食用等方面，其叶(苏叶)、梗(苏梗)、果(苏子)均可入药，嫩叶可生食、作汤，茎叶可淹渍。近些年来，紫苏因其特有的活性物质及营养成分，成为一种倍受世界关注的多用途植物，经济价值很高。俄罗斯、日本、韩国、美国、加拿大等国对紫苏属植物进行了大量的商业性栽种，开发出了食用油、药品、淹渍品、化妆品等几十种紫苏产品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6362, '西洋菜', NULL, '蔬菜类', '又称豆瓣菜，属十字花科，是一二年生水生草本植物。西洋菜以质地脆嫩、多汁，色泽青绿的嫩茎叶供食用，清香爽口，营养丰富。中国广东、广西、福建、台湾、上海、四川、云南等地都有栽培，其中广东的栽培历史最久，栽培面积最大。 豆瓣菜的营养物质比较全面，其中超氧化物岐化酶(即SOD)的含量很高，还含有丰富的维生素及矿物质。豆瓣菜有通经的作用，并能干扰卵子着床，阻止妊娠。豆瓣菜味甘微苦，性寒。具有清燥润肺、化痰止咳、利尿等功效。是一种益脑健身的保健蔬菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6363, '芝麻菜', NULL, '蔬菜类', '芝麻菜又叫火箭生菜，此植株具有很浓的芝麻香味，故名芝麻菜。原生地于东亚与地中海，属十字花科，芝麻属。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6364, '水芹菜', NULL, '蔬菜类', '水芹为伞形科植物水芹的嫩茎及叶，属伞形产二年生草本。芹菜原产地中海沿岸，在我国栽培历史悠久，分布广泛，产于全国大部分地区。河北宣化，山东潍县、河南商丘都是芹菜的名产地。四季均有供应。水芹，根小，棵高，实心，柄呈绿色，纤维较粗，香味淡，菜质脆嫩，可食部分多。芹菜的品质要求：以大小整齐，不带老梗、黄叶和泥土，叶柄无锈斑，虫伤、色泽鲜绿或洁白，叶柄充实肥嫩者为佳。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6365, '抱子甘蓝', NULL, '蔬菜类', '抱子甘蓝，是甘蓝的一个变种，中片杓子形，表面有皱纹，叶柄长。茎高35-100厘米。茎顶端不生叶球，叶腋间能抽芽形成小叶球，叶腑间能抽芽形成小叶球，叶球直径1-4厘米，黄绿或紫红色。英国、法国、比利时等国栽培较多，我国有少量栽培，订要供西餐使用。抱子甘蓝的品质要求是：外形整齐，大小均匀，新鲜洁净，无病虫害者为佳。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6366, '菊花菜', NULL, '蔬菜类', '中国江苏南京地区做夏季蔬菜食用，以嫩茎叶供食用，具有特殊的浓郁菊花芳香味，风味独特，稍甜，凉爽清口，食之清凉。现我国南北各地均有少量栽培。以南京市人工栽培历史较久，已成为南京具有地方特色的新型蔬菜。与枸杞头、马兰头并成为南京三宝。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6367, '观音菜', NULL, '蔬菜类', '俗名紫背天葵的植物有多种。一种学名天葵秋海棠，拉丁名Begonia fimbristipula，是秋海棠科秋海棠属的多年生无茎草本植物，为中国的特有物种。生长于长江以南海拔700米至1,120米的地区。常见的作为特菜的紫背天葵学名叫紫背菜，为菊科三七草属多年生草本植物，拉丁名Gynura bicolor DC.，因嫩茎叶富含钙、铁等，营养价值较高，又有止血抗病毒等药用价值，故有较长的作为蔬菜栽培的历史。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6368, '紫背天葵', NULL, '蔬菜类', '紫背天葵是一种很好的集营养保健价值与特殊风味为一体的高档蔬菜，鲜嫩茎叶和嫩梢中的维生素C含量较高，还含有黄酮苷等。因嫩茎叶富含钙、铁等，营养价值较高，又有止血抗病毒等药用价值，故有较长的作为蔬菜栽培的历史。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6369, '儿菜', NULL, '蔬菜类', '别名：孩儿菜、棒菜、娃娃菜、芥菜。是属于芥菜的一个新品种，其特点是茎部膨大呈肥胖状，肉质叶柄及叶脉浅绿色，肉白质嫩，味甜多汁。这种菜既好吃又清火，食法多样，可以炒食，凉拌，煮汤等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6370, '紫叶生菜', NULL, '蔬菜类', '这种生菜是西式沙拉中常见的蔬菜，近年才在市场上普遍出现。生菜根茎部分较粗，似短小的莴笋。叶片褶皱丛生，上半部呈深紫色，颜色非常诱人。紫叶生菜口感味苦，因含有较多花青素而倍受欢迎。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6371, '贡菜', NULL, '蔬菜类', '贡菜是一种绿色脱水蔬菜，莴苣属。色泽鲜绿、质地爽口、味若海蜇，食用价值极高。清乾隆年间曾进贡朝廷，后年年进贡朝廷，故称之为“贡菜”。因其食之有声音，清脆爽口，六十年代被周恩来总理形象地称之为“响菜”，亦称之为“山蜇菜”。吃法多样，它既可单独成菜，又可以拼盘成菜，既可以凉拌，又可以热炒；既可以制作中餐，又可以调西餐。咸甜麻辣均可，晕素煎煮皆宜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6372, '茴香', NULL, '蔬菜类', '茴香为夏季蔬菜，一般多做馅食用。是集医药、调味、食用、化妆于一身的多用植物。有独特香味，香气主要来自茴香脑、茴香醛等香味物质。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6373, '红菜苔', NULL, '蔬菜类', '红菜苔，又名“芸菜苔”。色紫红、花金黄，是武汉地区的特产。据史籍记载，红菜苔在唐代是著名的蔬菜，历来是湖北地方向皇帝进贡的土特产，曾被封为“金殿玉菜”，与武昌鱼齐名。可清炒、醋炒，亦可麻辣炒。其色碧中带紫，其味鲜嫩爽口，武汉人无不喜食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6374, '芦荟', NULL, '蔬菜类', '芦荟属（学名：Aloe）通称芦荟，原产于地中海、非洲，为独尾草科多年生草本植物，据考证的野生芦荟品种300多种，主要分布于非洲等地。这种植物颇受大众喜爱，主要因其易于栽种，为花叶兼备的观赏植物。可食用的品种只有六种，而当中具有药有价值的芦荟品种主要有：洋芦荟 (又名巴巴多斯芦荟或翠叶芦荟 Aloe Barbadensis/Aloe Vera)库拉索芦荟（分布于非洲北部、西印度群岛），好望角芦荟（分布于非洲南部），元江芦荟等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6375, '苦细叶生菜', NULL, '蔬菜类', '苦细叶生菜叶簇直立，叶片呈细叶形，叶缘为齿轮状，叶色浅绿色至黄绿色。即可生食，亦可炒食或涮食。口感脆嫩，清香可口，具有清热解毒的功效。据研究表明，生菜含有较高的膳食纤维和维生素C，有利于清除体内多余脂肪，其茎叶中的莴苣素和甘露醇，可以镇痛催眠、降低胆固醇、辅助治疗神经衰弱以及清肝利胆、利尿、促进血液循环。此外，生菜中还有一种“干扰素诱生剂”，可刺激人体正常细胞产生干扰素，从而产生一种“抗病毒蛋白”抑制病毒。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6376, '刺老芽', NULL, '蔬菜类', '刺老芽又名辽东楤木、刺老鸦、刺龙牙、刺嫩芽、树头芽，为五加科楤木。刺老芽含有蛋白质、脂肪、碳水化合物、矿物质、维生素等。嫩芽可做菜、做汤，也可腌渍加工灌头，营养丰富，味道鲜美，风味独特被誉为 \" 山菜之王\" 。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6377, '马郁兰', NULL, '蔬菜类', '马郁兰原产地是在地中海，后来希腊人和罗马人将这种植物视为幸福的象征。在烹饪方面，马郁兰是一种调味料，常被用来调配混合型调味剂，如普罗旺斯香草（HerbesdeProvence）和Zaatar中。虽然马郁兰对寒冷较敏感，不过仍可以在耐寒性第5类的地区生长。马郁兰含具有芳香气味的百里香酚和香荆芥酚，可促进消化、消胀和环节痉挛。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6378, '车前草', NULL, '蔬菜类', '车前草自古即被当做药物使用，在“神农本草经”、“名医别录”、“滇南本草”、“本草汇言”等著名的中医药书籍中，对车前草都有详细的记载。车前草具有利尿、镇咳、驱痰、止泻、明目等功效。幼嫩的车前草，是经常食用的野菜之一，也是青草茶的最佳原料之一，车前草富含胶质，食入后吸水膨胀，可促进肠道蠕动，治疗便秘，吃了会有饱足感。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6379, '荷叶', NULL, '蔬菜类', '荷叶为睡莲科植物莲的叶。莲多年生水生草本，生于水泽、池塘、湖沼或水田内，野生或栽培。广布于南北各地。6至7月花未开放时采收，除去叶柄，晒至七八成干，对折成半圆形，晒干。夏季亦用鲜叶或初生嫩叶。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6380, '鞭笋', NULL, '蔬菜类', '又称鞭梢、笋鞭、边笋。竹鞭的先端部分。外包坚硬的鞭箨(笋壳)，形状尖削，穿透力甚强。鞭梢生长与发笋长竹交替进行。生长活动期5~6个月， 以后在新竹抽枝发叶后，夏、秋季行鞭生长，大量孕笋后逐渐停止生长。冬季萎缩脱落，以后在断处发出岔鞭。在疏松肥润的土壤中鞭梢生长非常快，一年可达4~5米。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6381, '苦苣菜', NULL, '蔬菜类', '苦苣菜属一二年生草本，有纺锤状根。茎中空，直立高50—100厘米，下部无毛，中上部及顶端有稀疏腺毛。叶片柔软无毛，长椭圆状广倒披针形，长15—20厘米，宽3—8厘米，深羽裂或提琴状羽裂，裂片边缘有不整齐的短刺状齿至小尖齿；茎生叶片基部常为尖耳廓状抱茎，基生叶片基部下延成翼柄。头状花序直径约2厘米，花序梗常有...', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6382, '苦竹叶', NULL, '蔬菜类', '苦竹叶为禾本科植物苦竹的嫩叶。生于向阳山坡或平原，分布浙江、江苏、江西等长江流域及西南各地。夏、秋采摘，晒干。本植物的根茎(苦竹根)、苗(苦竹笋)、秆皮(苦竹茹)、茎秆用火烤灼后流出的液汁(苦竹沥)、枯死的幼竹茎秆(仙人杖)亦供药用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6383, '包心菜', NULL, '蔬菜类', '卷心菜即圆白菜(英文名：cabbage的原意是head,在希腊神话中卷心菜被说成是主神宙斯头上的汗珠变的。是最古老的蔬菜之一 。)，学名结球甘蓝，一种常见蔬菜。约90%的成份为水，富含维生素C，在世界卫生组织推荐的最佳食物中排名第三。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6384, '山苏', NULL, '蔬菜类', '夏季产量较丰，目前于各地传统市场中，常可见山苏踪影。山苏为山间野菜，主要以採其嫩叶食用，早期以原住民食用居多，但后因野菜掀起一阵风潮，所以山苏也变成相当普遍常见的食材。山苏之烹调方式，主要以热炒居多，只要加些简单的姜丝、小鱼干后，快速清炒即可起锅，可谓美味又简单。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6385, '巴西利', NULL, '蔬菜类', '巴西利一般指欧芹，欧芹原产地中海沿岸，欧美及日本栽培较为普遍。欧芹含有大量的铁、维生素A和维生素C，是一种香辛叶菜类，西餐中用应较多，多座冷盘或菜肴上的装饰，也可作香辛调料，还可供生食，特别是吃葱蒜后嚼一点香芹叶，可消除口齿中的异味。欧芹又叫法香，产于地中海地区多岩石的海边，是从希腊语来的，意为石头。很早以前即被记载干希腊植物志上。公元前3世纪在罗马人的厨房里，也可以找到欧芹的踪影。其新鲜的叶子常用来做西餐沙拉配菜、水果以及果菜沙拉的装饰，有时也可以生着食用。如果将其切碎脱水处理的话用途更加广泛，香味也会', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6386, '柴钱', NULL, '蔬菜类', '柴钱辛香可食，生长于弘农川谷及冤句，二月、八月采根暴干，今出近道，状如前胡。博物志云：芸蒿叶八月、十月采根暴干。近道处处有之。叶极似槐叶，花黄色，子作荚，根味至苦恶。其根黄色，长五七寸许，两指粗细。三五茎并生，苗高三四尺以来。叶碎青色，极似槐叶，春生冬凋。其花黄白色，七月结实如小豆子。河北生者无花子。五月、六月、十月采根暴干。 七八月结角如萝卜子，角内有子二三粒，如小豆而坚。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6387, '露葵', NULL, '蔬菜类', '露葵，又名莼菜，属睡莲科的一种水草，国家Ⅰ级重点保护野生植物(国务院1999年8月4日批准)。中国黄河以南、湖北西部利川所有沼泽池塘都有生长，在江苏的太湖，苏北的高宝湖，尤其以杭州的西湖和雷波县的马湖，湖北省利川、重庆市石柱县黄水镇等地生产的莼菜闻名于世。采其尚未透露出水面的嫩叶食用，是一种地方名菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6388, '仙草', NULL, '蔬菜类', '仙草又名仙人草、凉粉草，属一年生草本宿根植物，一年种植可多年受益，高可达100厘米，茎初被疏柔毛和细刚毛，稍老脱净。叶对生，具长2～15毫米的叶柄;叶片阔卵形至狭卵形，有时近圆形，长2～5.5厘米或过之，两面被柔毛或仅下面脉上被毛，有时近无毛。秋末开花。轮伞花序排成顶生、长2～8厘米的总状花序式，苞片圆形.', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6389, '甜菜叶', NULL, '蔬菜类', '叶用甜菜或称牛皮菜、光菜，与根用甜菜、饲用甜菜、糖用甜菜为同种藜科植物。欧洲南部，现地中海沿岸尚有野生的。我国栽培已久。叶部发达，叶片肥厚，叶柄粗长，一般生食嫩叶，有叶柄特别发达的，则以食叶柄为主，可煮食炒食或盐渍。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6390, '乌菜', NULL, '蔬菜类', '安徽著名特产--乌菜，故有“雪下乌菜赛羊肉”的农谚。主产于本省江淮北部，北起淮河两岸，南至六安，舒城和滁州的南北约宽150公里的狭长地区，已有千年以上的栽培历史。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6391, '木耳菜', NULL, '蔬菜类', '木耳菜属落葵科一年生蔓生草本植物。木耳菜以幼苗、嫩梢或嫩叶供食，质地柔嫩软滑，营养价值高。可作汤菜、爆炒、烫食、凉拌等，其味清香，咀嚼时如吃木耳一般清脆爽口，故名木耳菜。木耳菜在南北方普遍栽培，在南方热带地区可多年生栽培，在北方多采用一年生栽培。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6392, '麦瓶草', NULL, '蔬菜类', '一年生草本植物。全株有腺毛，节部膨大，株高约30-60㎝。叶对生，披针形，基部联合。聚伞花序顶生，一般有花5-10朵。花两性，萼片合生，花瓣5，有爪。雄蕊5，下位着生；花柱3。蒴果，3-5室，内有种子多数；萼筒在结果时基部膨大，呈卵形，上部狭缩如瓶状。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6393, '苜蓿', NULL, '蔬菜类', '苜蓿为多年生草本；主根长，多分枝。茎通常直立，近无毛，高30-100厘米 。复叶有3小叶，小叶倒卵形或倒披针形，长1-2厘米，宽约0.5厘米，顶端圆，中肋稍凸出，上半部叶有锯齿，基部狭楔形；托叶狭披针形，全缘。总状花序腋生，花8-25，紫色。荚果螺旋形，无刺，顶端有尖曝咀；种子1-8颗。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6394, '南瓜藤', NULL, '蔬菜类', '南瓜藤是南瓜的藤叶，一般选择比较嫩的尖端部位的叶子食用，南瓜藤营养价值丰富，有较高的药用价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6395, '牛蒡叶', NULL, '蔬菜类', '牛蒡叶为菊科植物牛蒡的嫩叶。这是一种很像蓟的野生植物，在北半球非常普遍，青嫩的叶茎可做成沙拉。整棵植物都拿来利用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6396, '奶白菜', NULL, '蔬菜类', '奶白菜为浅根作物，须根发达，再生力强，适于育苗移栽。株型矮，株高约20～22厘米，开展度大，约25～27厘米。茎在营养生长期为短缩茎，遇高温或过分密植时也会伸长。基生叶莲座状，叶片近圆形；绿或深绿色，有光泽，叶面皱，全缘，叶柄肥厚而短，匙羹形，奶白色。花茎叶无柄，抱茎或半抱茎。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6397, '瓢儿白', NULL, '蔬菜类', '十字花科芸薹属芸薹种白菜亚种的一个变种，以墨绿色叶为产品的二年生草本植物。由芸薹进化而来，原产我国，主要分布在我国长江流域。以经霜雪后味甜鲜美而著称于我国江南地区；被视为白菜中的珍品，可以炒食，做汤。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6398, '蒲菜', NULL, '蔬菜类', '蒲菜，俗称草芽，为香蒲的嫩茎，蒲菜入宴在我国已有两千多年历史，《周礼》上即有“蒲菹”的记载。明朝顾过诗曰：“一箸脆思蒲菜嫩，满盘鲜忆鲤鱼香”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6399, '蒲公草', NULL, '蔬菜类', '蒲公英为菊科植物蒲公英、碱地蒲公英、东北蒲公英、民苞蒲公英等同属多种植物的全草。蒲公英叶是当今多国新兴的野菜热的一种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6400, '青江菜', NULL, '蔬菜类', '青江菜青江菜小棠菜上海青、江门白菜都是青江菜的别名，依梗色可再分为青梗白菜及白梗白菜两种。由于青江菜的外形跟汤匙有些相似，也有人喊它汤匙菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6401, '野荞', NULL, '蔬菜类', '野荞Fagopyrum densovillosum J. L. Liu),本种与细柄野荞麦(F. gracilipes (Hemsl.) Damm. et Diels)相近似，不同在于植株全体密被白色直立长毛，茎枝较粗壮,节较密集,节间较短， 叶较大,长(0.9～)1.7～6 cm，宽(0.7～)1.2～5.1 cm，阔卵形，心形，阔心形，阔卵状心形，卵形，长卵形，三角状卵形或卵状三角形。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6402, '七叶胆', NULL, '蔬菜类', '七叶胆，又名七叶参，绞股蓝，素称南方人参，在日本称之为“甘蔓茶”、“福音草”，新加坡、马来西亚称为“美女神”、“百病克星”，属多年生草质藤本植物。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6403, '清明菜', NULL, '蔬菜类', '清明菜为菊科植物鼠耳草的嫩苗。清明菜又名佛耳草，亦名鼠耳草，江苏苏南地区叫“寒食菜”，福建称白芒草、黄花曲草。民间草药名“追骨风”。江浙闽地区常于清明前后采摘嫩苗煮熟，揉入米粉中做团，香糯可口。它能扩张局部血管，可利用以治非传染性溃疡及刨伤。内服能降血压，治疗消化性溃疡，以及祛痰、镇咳、镇痛。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6404, '青蓼', NULL, '蔬菜类', '青蓼，其茎、叶均为浅绿色，开白色小花，穗状，花朵一簇簇缀着。花盛季节，花开如荼，映水而放，远远望去，如星河密布，玄远而飘逸，发幽思之想。若是一单棵青蓼立于水泱，则有一种轻盈、俊逸之态，极易让人想到那正临水照面的清雅、娟秀的女子。很少有大片的青蓼存在。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6405, '球茎茴香', NULL, '蔬菜类', '球茎茴香学名Foeniculum dulce D.C.，英文名Florence Fennel，别名意大利茴香、甜茴香，为伞形花科茴香属茴香种的一个变种，原产意大利南部，现主要分布在地中海沿岸地区。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6406, '羊尾笋', NULL, '蔬菜类', '尾笋是峙岭的特产，当地人又叫银黄笋干。它是用当地出产的一种龙须笋精心烤制而成，成品呈蟹黄色，表面有一层白霜(盐渍)。食用时先用清水浸淡，烧肉、炒菜、泡汤均可，有一种特殊的鲜味，又因其通体略扁，尾部呈流苏状酷似山羊尾巴而得名。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6407, '芹菜叶', NULL, '蔬菜类', '芹菜叶中营养成分远远高于芹菜茎，营养学家曾对芹菜的茎和叶片进行过13项营养成分的测试，发现芹菜叶片中有10项指标超过了茎。其中，叶中胡萝卜素含量是茎的88倍;维生素C的含量是茎的1 3倍;维生素B1是茎的17倍;蛋白质是茎的11倍;钙超过茎2倍。可见，芹菜叶片的营养价值的确不容忽视。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6408, '豆腐柴', NULL, '蔬菜类', '这种土名叫做“豆腐柴”的植物，学名称为“观音草”，系多年生的小乔木；经多次实验证明，含有大量对人体健康有益的天然食用果胶成分。叶可制豆腐，俗称豆腐柴；根、茎、叶入药，清热解毒、消肿止血，治疟疾，泻痢，痈肿，疔疮，创伤出血。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6409, '月桂叶', NULL, '蔬菜类', '月桂叶原产于南欧地中海沿岸的绿灌木或小乔木，两种月桂叶都是绿色，呈长椭圆披针形，约长三英寸，叶面光滑，带有辛辣及强烈苦味。月桂叶是欧洲人常用的调味料和餐点装饰，如用在汤、肉、蔬菜、炖食等，可说是一种健胃剂。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6410, '豆瓣菜', NULL, '蔬菜类', '豆瓣菜，别名西洋菜、水田芥、凉菜、耐生菜、水芥、水蔊菜等，多年生水生草本植物。原产欧洲，我国、印度和东南亚很多地区都有·。中国以广州、汕头一带和广西栽培较多，北方地区又从欧洲引进大叶优质品种，利用旱地种植或无土栽培，已较大面积开发利用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6411, '冬寒菜', NULL, '蔬菜类', '冬寒菜又名：冬苋菜、马蹄莱等，属锦葵目，锦葵科植物。作汤或炒食，营养丰富，具有一定药用价值。原分布于美国中部及南部各州。分布于北温带，中国也有分布。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6412, '地肤', NULL, '蔬菜类', '地肤别名：地麦、落帚、扫帚苗、扫帚菜、孔雀松。株丛紧密，株形呈卵圆至圆球形、倒卵形或椭圆形，分枝多而细，具短柔毛，茎基部半木质化。茎分支很多，叶子线状披针形，单叶互生，叶线性，线形或条形。穗状花序，开红褐色小花，花极小，无观赏价值，胞果扁球形。植株为嫩绿，秋季叶色变红。果实扁球形，可入药，叫地肤子。嫩茎叶可以吃，老株可用来作扫帚。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6413, '大玻璃草叶', NULL, '蔬菜类', '大玻璃草叶为野生类蔬菜，生长于野外。大玻璃草叶为多年生草本植物，连花茎可高大50cm，具有根须。大玻璃草叶对于生长环境不挑剔，可以生长在路边、花圃、或山野、河边出。大玻璃草叶根茎短缩肥厚，密生须状根。叶全部根生并平滑。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6414, '分葱', NULL, '蔬菜类', '分葱百合科(Liliaceae)葱属中葱的一个变种，多年生草本植物。分葱性喜冷凉，忌高温多湿。原产於亚洲西部叙利亚一带，台湾由早期先民从中国大陆引入。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6415, '桂竹笋', NULL, '蔬菜类', '株高约6～16米，直径3～10厘米，节间长20～40厘米，叶披针形，长6～15厘米，宽1～2厘米，先端尖，基部钝圆，横走茎侧散生，3～5月发笋，直立生长于地面，外皮光滑无毛，外皮具黑褐色斑点。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6416, '过猫', NULL, '蔬菜类', '俗称过猫的过沟菜蕨，是一种蕨类植物，又名过沟菜、水过猫、蕨菜、蕨猫、山凤尾等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6417, '黑油菜', NULL, '蔬菜类', '黑油菜是油菜的的一类，其籽粒颜色黑。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6418, '冰草', NULL, '蔬菜类', '冰草，（Agropyron cristatum）别名野麦子、扁穗冰草、羽状小麦草。冰草为禾本科多年生旱生禾草，是温带干旱地区最重要的牧草之一。能生长在干燥草地、山坡、丘陵以及沙地。由于品质好，营养丰富，适口性好，各种家畜均喜食；又因返青早，能较早地为放牧家畜提供青饲料。它特别具备抗旱、耐寒、耐牧以及产子较多等特性，在放牧地补播和建立旱地人工草地中具有重要的作用。由于冰草的根为须状，密生，聚沙套和入土较深特性，因此，它还是一种良好的水土保持植物和固沙植物。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6419, '酸模', NULL, '蔬菜类', '酸模，俗名野菠菜，蓼科多年生草本植物，欧洲和西亚大多数的草原均可见到其踪迹。酸模含有丰富的维他命A、维他命C及草酸，草酸导致此植物尝起来有酸溜口感，常被作为料理调味用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6420, '塔菜', NULL, '蔬菜类', '塔菜（ BrassicanarinosaL. H. Bariley），又称菊花菜，十字花科芸薹属多年生宿根草本植物，在贵州、江苏、湖南等地有野生种，现我国南北各地均有少量栽培。以嫩茎叶供食用，具有特殊的浓郁菊花芳香味，风味独特，稍甜，凉爽清口，食之清凉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6421, '甘蓝', NULL, '蔬菜类', '甘蓝（Brassica oleracea L.）为十字花科芸苔属的一年生或两年生草本植物，是我国重要蔬菜之一。除芥蓝原产中国外，甘蓝的各个变种都起源于地中海至北海沿岸。早在4000～4500年前古罗马和古希腊人就有所栽培。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6422, '梨山甘蓝', NULL, '蔬菜类', '1960年贯通台湾东西部的中横公路完工后，许多参与兴建工程的荣民配合政府安置政策在梨山落地生根。1973年至1981年台湾政府在当地设立梨山建设管理局，引进温带果蔬，开设福寿山农场与武陵农场进行垦植，成功发展起优质农业与观光业。\r\n梨山甘蓝正是在此时期由日本引进的结球甘蓝，原本在日本平原地区种植的结球甘蓝受梨山独特的山地土壤气候影响，果实叶片纤维细密，口感脆甜美味，是目前唯一最适合生吃和涮菜的甘蓝的品种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6423, '盖菜', NULL, '蔬菜类', '从我国广东引入。茎叶脆嫩，口味清香。含丰富的蛋白质、维生素和矿物质。叶梗加入鸡汤一起煮，味道十分鲜美，还可清炒、凉拌、涮火锅。盖菜盛产于八闽首邑闽侯县城甘蔗镇。这里依山傍水，福建母亲河——闽江沿境而过，历史悠久，人杰地灵。早在五千多年前就有先民在此生息繁衍，境内高出江面20余米的长形土岗上———昙石山遗址博物馆，揭示奴隶主的残暴，展示劳动的人民智慧，教育意义深远。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6424, '紫叶油菜', NULL, '蔬菜类', '油菜是十字花科植物油菜的嫩茎叶，原产我国，颜色深绿，帮如白菜，属十字花科白菜变种。南北广为栽培，四季均有供产。\r\n油菜按其叶柄颜色不同有白梗菜和青梗菜两种。白梗菜，叶绿色，叶柄白色，直立，质地脆嫩，苦味小而略带甜味。青梗菜，叶绿色，叶柄淡绿色，扁平微凹，肥壮直立，植侏矮小，叶片肥厚。质地脆嫩，略有苦味。\r\n油菜的招牌营养素含量及其食疗价值可称得上诸种蔬菜中的佼佼者。据专家测定，油菜中含多种营养素，所含的维生素C比大白菜高1倍多。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6425, '香葱', NULL, '蔬菜类', '香葱，又称：葱，细香葱,北葱、火葱。拉丁文名：Allium ascalonicum.百合科、葱属植物，鳞茎聚生，矩圆状卵形、狭卵形或卵状圆柱形；鳞茎外皮红褐色、紫红色至黄白色，膜质或薄革质，不破裂。叶为中空的圆筒状，向顶端渐尖，深绿色，常略带白粉。植株小，叶极细，质地柔嫩，味清香，微辣，主要用于调味和去腥。原产于亚洲西部。在我国南方较为广泛地栽培。欧洲和亚洲的一些地区也有栽培。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6426, '酸菜', NULL, '蔬菜类', '酸菜是选用大白菜或圆白菜及其他调料等，经过渍泡，在乳酸杆菌的作用下进行发酵而成的。神奇的是白菜经渍浸酸化成酸白菜以后，一改原有的一经煮制便成稀烂的特性，不仅变得耐煮，而且由其烹成的菜肴也变得脆嫩可口，其特有的酸香味，更能勾引人的食欲。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6427, '菜薹', NULL, '蔬菜类', '菜薹(flowering chinese cabbage):十字花科(Cruciferae)芸薹属芸薹种白菜亚种中以花誉为产品的变种，一二年生草本植物。学名Brassica ．又称菜心，菜尖。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6428, '辣白菜', NULL, '蔬菜类', '辣白菜是朝鲜族世代相传的一种佐餐食品,是地道的朝鲜风味,在当地很受欢迎。辣白菜的特点是辣,脆、酸、甜,色白带红,四季皆宜。通常和米饭一起食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6429, '米米蒿', NULL, '蔬菜类', '学名播娘蒿，种拉丁名: Descuminia sophia(L.)webb.Ex Prantl ，属十字花科植物一年生草本。茎直立，多分枝，花淡黄色，长角审窄条形，种子卵形褐色，有细网纹。中国华北、西北、华东、四川都有分布。种子含油达40%，可食用，亦作药用，为葶苈子的一种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6430, '黄瓜', NULL, '蔬菜类', '黄瓜，也称胡瓜、青瓜，属葫芦科植物。广泛分布于中国各地，并且为主要的温室产品之一。黄瓜是由西汉时期张骞出使西域带回中原的，称为胡瓜，五胡十六国时后赵皇帝石勒忌讳“胡”字，汉臣襄国郡守樊坦将其改为“黄瓜”。黄瓜的茎上覆有毛，富含汁液，叶片的外观有3-5枚裂片，覆有绒毛。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6431, '冬瓜', NULL, '蔬菜类', '冬瓜（fatmelon; white fuzzy vegetable)。植物学分类：被子植物门、双子叶植物纲、葫芦目、葫芦科、冬瓜属 Benincasa Savi 一年生草本植物。瓜形状如枕，又叫枕瓜，生产于夏季。为什么夏季所产的瓜，却取名为冬瓜呢？这是因为瓜熟之际，表面上有一层白粉状的东西，就好像是冬天所结的白霜，也是这个原因，冬瓜又称白瓜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6432, '苦瓜', NULL, '蔬菜类', '苦瓜又名凉瓜，是葫芦科植物，为一年生攀缘草本。茎、枝、叶柄及花梗披有柔毛，腋生卷须。叶子的直径达3至12厘米，有5至7道掌状深裂，裂片呈椭圆形，外沿有锯齿。春夏之交开花，雌雄同株，黄色。果实长椭圆形，表面具有多数不整齐瘤状突起。种子藏于肉质果实之中，成熟时有红色的囊裹着。苦瓜是人们喜爱的一种蔬菜，原产地不清楚，但一般认为是原产于热带地区。在南亚、东南亚、中国、和加勒比海群岛均有广泛的种植。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6433, '南瓜', NULL, '蔬菜类', '又名麦瓜、番瓜、倭瓜、金瓜、伏瓜、饭瓜、窝瓜、中国南瓜。南瓜属于葫芦科一年生蔓生草本植物的一种，其野生祖先原产于墨西哥、危地马拉一带，很早就传入我国，广泛栽种、食用，因而有“中国南瓜”之说。南瓜的果肉和种子均可食用，花也可以食用。在我国，南瓜既当菜又代粮，在农村很有人缘。近年来，人们发现南瓜不但可以充饥，而且还有一定的食疗价值，于是土味十足的南瓜得以登大雅之堂。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6434, '丝瓜', NULL, '蔬菜类', '又名天丝瓜、天罗、蜜瓜、布瓜、天吊瓜、纯阳瓜、倒阳菜、水瓜、絮瓜、缣瓜、蛮瓜、绵瓜。丝瓜为葫芦得植物丝瓜或粤丝瓜的鲜嫩果实，又称吊瓜，原产于南洋，明代引种到我国，成为人们常吃的蔬菜。丝瓜的药用价值最高，全身都可入药。丝瓜所含各类营养在瓜类食物中较高，所含皂甙类物质、丝瓜苦味质、黏液质、木胶、瓜氨酸、木聚糖和干扰素等特殊物质具有一定的特殊作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6435, '佛手', NULL, '蔬菜类', '佛手瓜又名隼人瓜、安南瓜、肴梨、寿瓜、合掌瓜、万年瓜等，属葫芦科冬季稀特蔬菜品种，原产于墨西哥和印尼群岛，19世纪初由日本传入我国。佛手瓜形如两掌合十，有佛教祝福之意，因此称之为“佛手”、“福寿”，深受人们喜爱。佛手瓜清脆多汁，味美可口，营养价值较高，既可做菜，又能当水果生吃。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6436, '西葫芦', NULL, '蔬菜类', '又名搅瓜、白南瓜、角瓜、美洲南瓜、茭瓜。西葫芦是南瓜的变种,葫芦科南瓜属的一种，果实呈圆筒形，果形较小，果面平滑，以采摘嫩果供菜用。西葫芦以皮薄、肉厚、汁多、可荤可素、可菜可馅而深受人们喜爱，过去西葫芦一般要在５、６月份才能上市，近年来郊区不少地方采用地膜加天膜栽培，因而目前就已上市了。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6437, '节瓜', NULL, '蔬菜类', '节瓜又名毛瓜。属葫芦科一年生攀援草本植物，是冬瓜的一个变种。节瓜原产我国南部，是我国的特产蔬菜之一，在岭南各地栽培历史悠久，栽培面积较大。在海南，节瓜栽培已有多年历史。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6438, '佛手瓜', NULL, '蔬菜类', '佛手瓜属胡芦科冬季稀特蔬果品种，是枸橼的果实，原产于墨西哥和印尼群岛，19世纪初由日本传入我国。\r\n90年代引入长江流域生长，现主产福建、山东、云南和台湾。\r\n佛手瓜形如两掌合十，有佛教祝福之意，因此称之为“佛手”、“福寿”、深受人们喜爱。\r\n佛手瓜清脆多汁，味美可口，营养价值较高，既可做菜，又能当水果生吃。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6439, '瓠子', NULL, '蔬菜类', '瓠子，一年生攀援草本，具软毛；卷须有分枝。叶互生，叶片心状卵圆形至肾状卵圆形，长10～40厘米，宽与长略相等，稍有角裂或3浅裂，先端短尖或钝圆，边缘具短齿，基部心形；叶柄长5～30厘米，顶端具腺齿2枚。花单生，夕开早萎；雄花具长柄，较叶柄为长；雌花柄较短。花萼长2～3厘米，萼漏斗状，5裂，裂齿狭三角形，被柔毛；花瓣5，白色，广卵形或倒卵形，长3～4厘米，宽2～3厘米，边缘皱曲。花期6月。果期7月。全国大部分地区均有栽培。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6440, '生瓜', NULL, '蔬菜类', '果实棒状，浅绿色，表面光滑，常弯曲，长30-100cm，果肉致密，绿白。以嫩瓜加工腌制为主，也可炒食，不宜生食。明王世懋撰《学圃杂疏》（1587）记载：“瓜之不堪生dan 而堪酱食者，曰菜瓜”。如华南的蛇形甜瓜、新疆的毛菜瓜、杭州青菜瓜。植物学特征、生物特性及栽培技术等均与薄皮甜瓜相近。\r\n菜瓜为葫芦科植物越瓜的果实，为一年生攀援或匍匐状草本。茎有棱角，被有多数刺毛，叶互生，叶片为卵圆形或肾形，宽与长略相等。果肉质，长圆筒形，外皮光滑，有纵长线条，绿白色或淡绿色。果肉白色或淡绿色，汁多、质脆。生于温热带，', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6441, '日本南瓜', NULL, '蔬菜类', '日本南瓜果型较小，粉质度高，品质好，深受广大消费者欢迎。近几年在江浙一带栽培甚广，但主要集中在春季，秋季栽培甚少。这主要是由于秋季栽培的技术要求相对较高，播期太 早，南瓜幼苗容易遭遇高温，病害严重；播种太迟，则秋季以后气温逐渐降低，南瓜不能完成其生长发育过程，从而影响产量和品质。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6442, '瓠瓜', NULL, '蔬菜类', '属葫芦科，一年生攀缘草本植物瓠瓜的变种，茎蔓生，叶心脏形，互生，夏秋开白花，果实的形状因种类而异，具体的说又分为瓠子、葫芦、匏瓜(瓢葫芦)和扁葫芦几种。原产非洲南部。我国自古有栽培，现在是民间夏令常吃的佳肴。葫芦瓜是可消肿结、润肌肤的瓜菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6443, '葫芦', NULL, '蔬菜类', '葫芦属葫芦科一年生攀缘草本植物瓠瓜的变种，茎蔓生，叶心脏形，互生，夏秋开白花，果实的形状因种类而异，具体的说又分为瓠子、葫芦、匏瓜(瓢葫芦)和扁葫芦几种。原产非洲南部。我国自古有栽培，现在是民间夏令常吃的佳肴。葫芦瓜是可消肿结、润肌肤的瓜菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6444, '海底椰', NULL, '蔬菜类', '海椰子（Lodoiceamaldivica）亦称复椰子(doublecoconut)、海底椰。是塞舌尔普拉兰岛及库瑞岛的一种特有棕榈，树高20~30米；树叶呈扇形，宽2米，长可达7米，最大的叶子面积可达27平方面，活像大象的两只大耳。由于整座树庞大无比，所以也被称为“树中之象”。花著生于巨大的肉质穗状花序上，雌雄异株。果实被一肉质而多纤维的外皮，里面坚果状的部分通常2瓣，似两个椰子，可食但商业价值不大。是已知最大的果，约需10年才成熟。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6445, '金丝瓜', NULL, '蔬菜类', '金丝瓜又名金瓜、搅丝瓜、金丝角瓜、四季美角瓜，鱼翅瓜，是葫芦科一年生草本植物，是中国稀有特产的耐贮运菜用优质瓜。其食用部分为嫩瓜、老瓜。金丝瓜皮质较硬，并有一层蜡质层，因此既耐长途运输，又可从夏秋采后一直贮藏到春节出售，还可在瓜皮上写字画花，以增喜庆吉祥，提高销售率。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6446, '金瓜', NULL, '蔬菜类', '金瓜鲜嫩清香，松脆爽口，是家庭、饭店、宾馆中色香味俱佳的上等菜肴，享有“植物海蜇”之美誉。金瓜不仅味美可口，而且营养丰富，除了有人体所需要的多种维生素外，还含有易被人体吸收的磷、铁、钙等多种营养成分，又有补中益气、消炎止痛、解毒杀虫的作用，对老年人高血压、冠心病、肥胖症等，亦有较好的疗效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6447, '乳黄瓜', NULL, '蔬菜类', '乳黄瓜别名是嫩黄瓜，是瓜类，也是蔬菜黄瓜。乳黄瓜是江苏扬州地区的品种，乳黄瓜的颜色是深绿色，果面光滑、黑刺，并且吃起来品质比较脆、细、嫩，而且适合生吃，还适合加工腌制之后吃。很多人喜欢脆脆嫩嫩的乳黄瓜，这是因为乳黄瓜可以解腻、开胃，既可以单独吃，也可以作为调料。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6448, '白瓜', NULL, '蔬菜类', '白瓜又叫稍瓜、生瓜、越瓜、酥瓜等，属葫芦科。白瓜外皮光滑，有纵长线条，汁多、质脆。可以生吃，亦可做菜、汤等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6449, '菜瓜', NULL, '蔬菜类', '葫芦科，甜瓜属甜瓜种中适于酱渍的变种。别名蛇甜瓜。分布中近东、南亚及中国。果实棒状，浅绿色，表面光滑，常弯曲，长30-100cm，果肉致密，绿白。以嫩瓜加工腌制为主，也可炒食，也可凉拌及生食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6450, '蜜蛇瓜', NULL, '蔬菜类', '蜜蛇瓜原产于印度、马来西亚，广泛分布于东南亚各国和澳大利亚，在西非、美洲热带和加勒比海等地也有栽培，中国只有零星栽培，近年来山东省青岛地区种植较多。蜜蛇瓜以嫩果实为蔬，但嫩叶和嫩茎也可食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6451, '小黄瓜', NULL, '蔬菜类', '小黄瓜属葫芦科一年生蔓生植物，英文“mini”即“小”，故人们予荷兰小黄瓜以一个动听的名字“迷你黄瓜”。该类型瓜长度14一18cm，直径约3cm，重100g左右，表皮柔嫩、光滑、色泽均匀、口感脆嫩、瓜味浓郁，经济效益颇高。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6452, '冬南瓜', NULL, '蔬菜类', '一年生双子叶草本植物，能爬蔓，茎的横断面呈五角形。叶子心脏形。花黄色，果实一般扁圆形或梨形，嫩时绿色，成熟时赤褐色。果实可做蔬菜，种子可以吃。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6453, '喷瓜', NULL, '蔬菜类', '喷瓜，最有力气的果实—喷瓜，原产欧洲南部的喷瓜，它的果实像个大黄瓜。成熟后，生长着种子的多浆质的组织变成粘性液体，挤满果实内部，强烈地膨压着果皮。这时果实如果受到触动，就会“砰”的一声破裂，好象一个鼓足了气的皮球被刺破后的情景一样。喷瓜的这股气很猛，可把种子及粘液喷射出40-50尺远。因为它力气大得象放炮，所以人们又叫它“铁炮瓜”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6454, '秋黄瓜', NULL, '蔬菜类', '旱黄瓜瓜条短棒型，色泽嫩绿，口感甜脆适口，清香味浓。是黑龙江出产的一种黄瓜。旱黄瓜是不少家庭夏季爱吃的食品，价格也略高于其他品种的黄瓜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6455, '越瓜', NULL, '蔬菜类', '越瓜的果实为棒状，浅绿色，表面光滑，常弯曲，长30-100cm，果肉致密，绿白。以嫩瓜加工腌制为主，也可炒食，不宜生食。明王世懋撰《学圃杂疏》(1587)记载：“瓜之不堪生dan 而堪酱食者，曰菜瓜”。如华南的蛇形甜瓜、新疆的毛菜瓜、杭州青菜瓜。植物学特征、生物特性及栽培技术等均与薄皮甜瓜相近。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6456, '飞碟瓜', NULL, '蔬菜类', '飞碟瓜又名碟瓜、碟形瓜、齿缘瓜、扁圆西葫芦，为葫芦科南瓜属美洲南瓜的一个变种。其果实既可以观赏，又可以食用，是一种难得的现食兼用园艺植物。飞碟瓜在我国栽培的历史很短。最初它是作为一种名特蔬菜于20世纪90年代从俄罗斯、韩国、美国等地相继引入进行栽培的。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6457, '金童玉女瓜', NULL, '蔬菜类', '“金童”、“玉女”超小水果型黄瓜均为椭圆形，光滑无刺有光泽，脆甜、清爽。强雌性，极早熟，瓜膨大速度快，连续坐瓜能力强，每节1-2瓜，商品瓜长4-5 cm，无把。平均单瓜重30g，节间长度8～10 cm。较耐低温、弱光，适合保护地秋冬或冬春栽培。\r\n其区别仅是“金童”瓜色亮绿，“玉女”瓜色淡白。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6458, '香蕉西葫芦', NULL, '蔬菜类', '香蕉西葫芦是一种外形似香蕉，果皮为黄色的西葫芦，是美洲南瓜中的一个黄色果皮新品种，以食用嫩果为主，嫩果肉质细嫩，味微甜清香，适于生食，也可炒食或作馅，其嫩茎稍也可作菜食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6459, '夜开花', NULL, '蔬菜类', '又称瓠瓜，为葫芦科葫芦属一年生蔓性草本。瓠瓜幼果味清淡，品质柔嫩，适于煮食。 在河北一带的某些地区，“瓠瓜”专指西葫芦，“瓠子”则用来专指瓠瓜。 中国古时以其老熟干燥果壳作容器，也作药用。《诗经》中已有记载。瓠瓜是可消肿结、润肌肤的药用瓜菜。中国自古就有栽培，嫩果可供食用，老后不能食用，是民间夏令常吃的佳肴。相对其他果蔬，营养价值较低。其食用部分为嫩果。瓠瓜品质细嫩柔软，稍有甜味，去皮后全可食用。可炒食或煨汤。瓠瓜在中国南北各地均有栽培，南方栽培普遍，近几年北方也开始引种栽培。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6460, '荷兰瓜', NULL, '蔬菜类', '小黄瓜属葫芦科一年生蔓生植物，英文“mini”即“小”，故人们予荷兰小黄瓜以一个动听的名字“迷你黄瓜”。该类型瓜长度14一18cm，直径约3cm，重100g左右，表皮柔嫩、光滑、色泽均匀、口感脆嫩、瓜味浓郁。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6461, '小冬瓜', NULL, '蔬菜类', '小冬瓜是冬瓜中小果型品种的统称。\r\n与大果型品种相比，小冬瓜雌花着生节位低，生育期短，早熟，非常适宜在日光温室内进行早熟栽培。小冬瓜对温度的要求比较高，尤其是开始坐果期温度低，不利于受粉和坐果。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6462, '蒲瓜', NULL, '蔬菜类', '蒲瓜是一种植物，属于葫芦科，原产於热带亚洲、北非，瓜体密生软毛，具卷须，匍匐地面或攀附他物生长，叶互生，心形，细锯齿缘，通常分为大葫芦与小葫芦，前者可做鲜食用，后者纯为观赏。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6463, '棱角丝瓜', NULL, '蔬菜类', '广东丝瓜为葫芦科一年生草质攀援藤本植物；其形态基本与丝瓜相同，但其茎有明显的棱角，卷须下部也具棱。我国广东、广西有栽培，北部少见。嫩果可蔬用，成熟时里面的网状纤维称丝瓜络，可代替海绵用作洗刷灶具及家具；还可供药用，有清凉、利尿、活血、通经、解毒之效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6464, '贝贝南瓜', NULL, '蔬菜类', '南瓜果实营养价值很高，而小南瓜的营养成分较中国南瓜更高，主要是食部的含水量较低，干物质含量提高，非还原糖和淀粉含量高，淀粉与全糖比率大于1,蛋白质高，纤维较少，维生素A、C含量高，是很好的保健食品。南瓜果肉内有一种特殊物质，可促进胰岛素分泌，降低血糖水平，对防治糖尿病有特效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6465, '金桔瓜', NULL, '蔬菜类', '金桔瓜，为葫芦科植物南瓜的果实。别名倭瓜、番瓜、麦瓜、饭瓜、金瓜、金冬瓜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6466, '窝瓜', NULL, '蔬菜类', '南瓜别称，山东地区称作吊瓜，东北地区称作倭瓜。可食用，有橘黄色和青色两种，外形呈扁圆或不规则葫芦形状，未成熟果实皮脆肉质致密，可配菜、做馅，成熟果实甜面，可熬粥。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6467, '飞碟西葫芦', NULL, '蔬菜类', '北美洲南部　营养价值：飞碟西葫芦外形类似淡黄色飞碟，果实中含有多种营养元素，包括蛋白质、维生素和矿物质。是及观赏和食用于一身的蔬菜品种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6468, '白玉苦瓜', NULL, '蔬菜类', '白玉苦瓜祖籍台湾，白玉苦瓜的“父母”是民国87年分别自花莲县新城乡与吉安乡收集之山苦瓜地方种。\r\n白玉苦瓜的果实色白、肉厚、汁多，组织幼嫩比绿色苦瓜更脆，所以口感清爽，苦味比绿色苦瓜更淡，所以味道温润，不用浸泡去苦即可直接食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6469, '吊瓜', NULL, '蔬菜类', '吊瓜，又名栝楼，因其成熟后为黄色内部为稀浆故别名屎冬瓜，为葫芦科多年生草质藤本植物，生长在海拔100—1800米气候温润的山谷密林和坡地灌丛中，博采山水之“灵气”。是一种名贵的中药材，吊瓜根粗壮肥厚，外灰白色内白色，长圆柱形，稍扭曲，脆嫩易断，富含淀粉。花期长，从6月中旬一直延续到10月上旬，盛花期在6月下旬至8月上旬。糖汁较稠，种子较小面狭，饱满，其味脆香特异、润绵爽口。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6470, '豆角', NULL, '蔬菜类', '豆角，又叫豇豆，是夏天盛产的蔬菜。含有各种维生素和矿物质等。嫩豆荚肉质肥厚，炒食脆嫩，也可烫后凉拌或腌泡。豆荚长而像管状，质脆而身软，常见有白豆角和青豆角两种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6471, '茄子', NULL, '蔬菜类', '茄子，江浙人称为六蔬，广东人称为矮瓜，是茄科茄属一年生草本植物，热带为多年生。其结出的果实可食用，颜色多为紫色或紫黑色，也有淡绿色或白色品种，形状上也有圆形，椭圆，梨形等各种。茄子是一种典型的蔬菜，根据品种的不同，用法多样。根据营养专家黎黍匀分析，茄子的预防疾病指数为26.29，生命力指数为9.7142，证明对疾病的康复具有相当高的价值，而对生命力的提高属于有效范围。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6472, '青椒', NULL, '蔬菜类', '青椒为植物界，双子叶植物纲，菊亚纲，茄科。果实为浆果。别名很多，大椒、灯笼椒、柿子椒、都是它的名字，因能结甜味浆果，又叫甜椒、菜椒。一年生或多年生草本植物，特点是果实较大，辣味较淡甚至根本不辣，作蔬菜食用而不作为调味料。由于它翠绿鲜艳，新培育出来的品种还有红、黄、紫等多种颜色，因此不但能自成一菜，还被广泛用于配菜。青椒由原产中南美洲热带地区的辣椒在北美演化而来，经长期栽培驯化和人工选择，使果实发生体积增大，果肉变厚，辣味消失和心皮及子房腔数增多等性状变化。中国于100多年前引入，现全国各地普遍栽培。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6473, '西红柿', NULL, '蔬菜类', '番茄(tomato)别名西红柿、洋柿子，古名六月柿、喜报三元。果实营养丰富，具特殊风味。可以生食、煮食、加工制成番茄酱、汁或整果罐藏。番茄是全世界栽培最为普遍的果菜之一。 美国、苏联、意大利和中国为主要生产国。在欧、美洲的国家、中国和日本有大面积温室、塑料大棚及其他保护地设施栽培。中国各地普遍种植。栽培面积仍在继续扩大。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6474, '豌豆', NULL, '蔬菜类', '豌豆既可作蔬菜炒食，子实成熟后又可磨成豌豆面粉食用。因豌豆豆粒圆润鲜绿，十分好看，也常被用来作为配菜，以增加菜肴的色彩，促进食欲', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6475, '荷兰豆', NULL, '蔬菜类', '荷兰豆又称荷仁豆、剪豆，属豆科(Leguminosae)豌豆属。以食用嫩荚为主，原产地中海沿岸及亚洲西部，荷兰豆嫩荚质脆清香，营养价值很高。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6476, '豇豆', NULL, '蔬菜类', '豇豆(Cowpea)一年生缠绕草本，无毛，学名：Vigna unguiculata (Linn.)Walp,俗称角豆、姜豆、带豆。豇豆分为长豇豆和饭豇两种小叶3，顶生小叶菱状卵形，长5—13厘米，宽4—7厘米，顶端急尖，基部近圆形或宽楔形，两面无毛，侧生小叶斜卵形；托叶卵形，长约1厘米，着生处下延成一短距。总状花序腋生；萼钟状，无毛；花冠淡紫色，长约2厘米，花柱上部里面有淡黄色须毛。荚果线形，下垂，长可达40厘米。花果期6—9月。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6477, '扁豆', NULL, '蔬菜类', '扁豆，又叫菜豆、四季豆、架豆、云豆，是餐桌上的常见蔬菜之一。无论单独清炒，还是和肉类同炖，亦或是焯熟凉拌都符合人们的口味。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6478, '菜椒', NULL, '蔬菜类', '柿子椒，又叫大椒、甜椒、灯笼椒、柿子椒、菜椒都是它的名字。其特有的味道和所含的辣椒素有刺激唾液和胃液分泌的作用，能增进食欲，帮助消化，促进肠蠕动，防止便秘。它还可以防治坏血病，对牙龈出血、贫血、血管脆弱有辅助治疗作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6479, '四季豆', NULL, '蔬菜类', '四季豆是为豆科一年生缠绕草本植物扁豆的种子。是老百姓餐桌上十分常见的蔬菜之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6480, '秋葵', NULL, '蔬菜类', '秋葵又名羊角豆、咖啡黄葵、毛茄，原产于非洲，20世纪初由印度引入我国。目前黄秋葵已成为人们所热追高档营养保健蔬菜，风靡全球。它的可食用部分是果荚，又分绿色和红色两种，其脆嫩多汁，滑润不腻，香味独特，深受百姓青睐。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6481, '豌豆荚', NULL, '蔬菜类', '豌豆属豆科植物，起源亚洲西部、地中海地区和埃寒俄比亚、小亚细亚西部，因其适应性很强，在全世界的地理分布很广。豌豆在我国已有两千多年的栽培历史，现在各地均有栽培，主要产区有四川、河南、湖北、江苏、青海等十多个省区。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6482, '毛豆', NULL, '蔬菜类', '毛豆是大豆作物中专门鲜食嫩荚的蔬菜用大豆。毛豆就是新鲜连荚的黄豆，晒乾之后又称大豆。\r\n毛豆是一年生的农作物，茎粗硬而有，它的荚作扁平形，荚上也有细毛，所以人称为毛豆，新鲜时，豆荚嫩绿色，青翠可爱。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6483, '蚕豆', NULL, '蔬菜类', '蚕豆是豆类蔬菜中重要的食用豆之一， 它既可以炒菜、凉拌，又可以制成各种小食品，是一种大众食物。 　　 \r\n蚕豆中含有大量蛋白质，在日常食用的豆类中仅次于大豆，还含有大量钙、钾、镁、维生素C等，并且氨基酸种类较为齐全，特别是赖氨酸含量丰富。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6484, '紫茄子', NULL, '蔬菜类', '茄子是为数不多的紫色蔬菜之一，也是餐桌上十分常见的家常蔬菜。在它的紫皮中含有丰富的维生素E和维生素P，这是其他蔬菜所不能比的。\r\n茄子属茄科，一年生蔬菜。原产印度。中国种植茄子已有1000余年历史，我国普遍栽培，是夏季主要蔬菜之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6485, '南瓜子', NULL, '蔬菜类', '白瓜子，即南瓜子，生吃、熟吃都可以，它有杀虫的治疗前列腺疾病的食疗作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6486, '五彩椒', NULL, '蔬菜类', '五彩椒又名朝天椒、五彩辣椒，是辣椒的变种，为茄科多年生半木质性植物，但常作一年生栽培。株高30-60厘米，茎直立，常呈半木质化，分枝多，单叶互生。花单生叶腋或簇生枝梢顶端，花白色，形小不显眼。花期5月初到7月底。果实簇生于枝端。同一株果实可有红、黄、紫、白等各种颜色，有光泽，盆栽观赏很逗人喜爱。也可以食用，风味同青椒一样。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6487, '辣椒', NULL, '蔬菜类', '辣椒属茄科，一年生或多年生蔬菜。原产南美洲热带，明代传入我国。我国各地均有生产，以四川、湖南、湖北产量最多。四季均有供应。辣椒老熟后可晒制辣椒干。\r\n辣椒的品质要求：作为鲜食的辣椒应以大小均匀，果皮坚实，肉厚质细而脆嫩新鲜，无虫咬、黑点和腐烂现象者为上品。干红辣椒是辣椒经晾干后的制品。印度人称辣椒为“红色牛排”；墨西哥人将辣椒视为国食。在我国许多地区辣椒都是非常重要的调味品，甚至没有它就无法下饭，可见人们对它的钟爱。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6488, '长茄子', NULL, '蔬菜类', '茄子是为数不多的紫色蔬菜之一，也是餐桌上十分常见的家常蔬菜。在它的紫皮中含有丰富的维生素E和维生素P，这是其他蔬菜所不能比的。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6489, '干豌豆', NULL, '蔬菜类', '豌豆属豆科植物，起源亚洲西部、地中海地区和埃寒俄比亚、小亚细亚西部，因其适应性很强，在全世界的地理分布很广。\r\n豌豆在我国已有两千多年的栽培历史，现在各地均有栽培，主要产区有四川、河南、湖北、江苏、青海等十多个省区。\r\n豌豆种子的形状因品种不同而有所不同，大多为圆球形，还有椭圆、扁圆、凹圆、皱缩等形状。颜色有黄白、绿、红、玫瑰、褐、黑等颜色。\r\n豌豆可按株形分为软荚、谷实、矮生豌豆3个变种，或按豆荚壳内层革质膜的有无和厚薄分为软荚和硬荚豌豆，也可按花色分为白色和紫(红)色豌豆。\r\n豌豆既可作蔬菜炒食，子实', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6490, '杭椒', NULL, '蔬菜类', '杭椒，果羊角形，长13厘米左右，横径约1.4厘米，平均单果重10克。青熟果淡绿色，果实微辣，老熟果红色。果面略皱，果顶渐尖，稍弯。它既是美味佳肴的好佐料，又是一种温中散寒、可用于食欲不振等症的食疗佳品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6491, '榆钱', NULL, '蔬菜类', '榆钱，榆实、榆钱子、榆仁、榆荚仁、榆菜等。榆钱果实中含有烟酸、抗坏血酸等酸性物质。同时，还含有大量的无机盐。榆钱为榆树科植物榆，春榆(白榆)、黑榆(山毛榆)的嫩果。香味甜绵厚实，自古就有食用它的习惯。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6492, '油豆角', NULL, '蔬菜类', '油豆角是蔓生菜豆在中国东北的优质软荚变种，是我国东北地区（黑龙江、吉林为主）特有的一种优质菜豆品种。以荚内油份多得名，有500年的栽培历史。油豆角主要是以食荚为主, 烹煮后豆荚软面, 纤维少, 豆香味浓, 蛋白质含量较高。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6493, '刀豆', NULL, '蔬菜类', '刀豆，别名挟剑豆，野刀板藤，葛豆，刀豆角。刀豆属于豆科，因豆荚形似刀而得名“刀豆”。又因荚形似人挟剑横斜，故又名“挟剑豆”。主要品种有蔓性、矮性两种。蔓性刀豆，亦称“大刀豆”、“中国刀豆”、“关刀豆”、“马刀豆”、“刀鞘豆”、“刀巴豆”。一年生草本，茎蔓生，复叶，小叶3片，自叶腋抽生花轴，其上开较大的蝶形花数朵，花紫红色。结大而扁的荚果，长25～30厘米，宽约3．5厘米。种子大有10～14粒，肾脏形，红色或褐色。原产东半球热带地区。矮性刀豆，亦称“矮刀豆”、“立刀豆”、“洋刀豆”。茎矮生或半蔓生，花紫色，', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6494, '柿子椒', NULL, '蔬菜类', '青椒为植物界，双子叶植物纲，菊亚纲，茄科。果实为浆果。青椒的别名很多，大椒、灯笼椒、柿子椒、都是它的名字,因能结甜味浆果，又叫甜椒、菜椒。青椒是一年生或多年生草本植物，其特点是果实较大，辣味较淡甚至根本不辣，作蔬菜食用而不作为调味料。由于它翠绿鲜艳，新培育出来的品种还有红、黄、紫等多种颜色，因此不但能自成一菜，还被广泛用于配菜。\r\n青椒由原产中南美洲热带地区的辣椒在北美演化而来，经长期栽培驯化和人工选择，使果实发生体积增大，果肉变厚，辣味消失和心皮及子房腔数增多等性状变化。中国于100多年前引入，现全国各', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6495, '茄瓜', NULL, '蔬菜类', '茄瓜果实形状多似心脏形和椭圆形，成熟时果皮呈金黄色，有的带有紫色条纹，有淡雅的清香，果肉清爽多汁，风味独特。除具有高蛋白、低糖、低脂外，还富含维生素C，以及多种人体所必需的微量元素，尤其是硒、钙的含量大大地高于其他的果实和蔬菜。可加工成果汁、饮料、口服液、罐头等产品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6496, '四棱豆', NULL, '蔬菜类', '一年或多年生草本植物。根系发达，有较多的根瘤，固氮能力强。茎蔓生高达3～4 cm，分枝性强，枝叶繁茂;茎光滑无毛，绿色或绿紫色，横断面近圆形;叶为三出复叶，互生，小叶呈阔卵圆形，全缘，顶端急尖;花为腋生总状花序，花较大，花冠紫蓝色;豆荚呈带棱的长条方形四面体，棱缘翼状，有疏锯齿，豆荚有绿色或紫色几种类型', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6497, '笋瓜', NULL, '蔬菜类', '笋瓜(Cucurbita maxima)又名印度南瓜、玉瓜、北瓜。葫芦科，南瓜属。一年生蔓性草本植物，以嫩瓜或种子为栽培目的。嫩瓜适于炒食、作馅或作饲料，干种子可炒食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6498, '朝天椒', NULL, '蔬菜类', '朝天椒，属茄科多年生半木质性植物，常作一年生栽培；其株高30厘米—60厘米，分枝多、茎直立，单叶互生；花白色，开花期5月初—7月底，果实簇生于枝端，风味同青椒。全草入药，根茎性温、味甘，能祛风散寒，舒筋活络并有杀虫、止痒功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6499, '龙牙豆', NULL, '蔬菜类', '龙牙豆的营养成分包括蛋白质、脂肪、碳水化合物、粗纤维、维生素B1、维生素B2、维生素C和胡萝卜素等，还含钙、铁、钾等矿物质元素。龙牙豆含有皂甘、尿毒酶和多种球蛋白等独特成分，具有提高人体自身的免疫力，增加抗病能力。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6500, '甜豆', NULL, '蔬菜类', '甜豆为豆科植物，起源亚洲西部、地中海地区和埃寒俄比亚、小亚细亚西部，因其适应性很强，在全世界的地理分布很广。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6501, '歪头菜', NULL, '蔬菜类', '豆科。多年生草本。茎直立；偶数羽状复叶，具有小叶2枚，总状花序预生或腋生，蝶形花，蓝紫色或紫红色，花期6～7月份；荚果扁平，果期8～9月份。可以做饲料、药用及观赏。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6502, '墨西哥辣椒', NULL, '蔬菜类', '墨西哥辣椒(学名Capsicum annuum)是一种由细到中体积的辣椒，以其辣味及刺激闻名。1999年美国有5500亩土地种这种辣椒的，但大多都是在新墨西哥州南部和德克萨斯州西部种植。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6503, '仙人掌果', NULL, '蔬菜类', '仙人掌果实需要经过四年才能成熟采收。研究表明，仙人掌果实萃取物具有加速伤口愈合、使肌肤柔软细腻、防止皮肤干燥、减少皱纹等神奇的功效，因为仙人掌果实富含抗氧化剂、核黄素和硫胺(维生素B1)，是滋润保养肌肤极佳的营养成分。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6504, '小扁豆', NULL, '蔬菜类', '科小扁豆属一年生或越年生草本。又名滨豆、鸡眼豆。一种粮食和绿肥兼用作物。染色体数 2n=14。起源于亚洲西南部和地中海东部地区。新石器时代就有栽培。约在青铜器时代传布到地中海、亚洲和欧洲。世界约有40个国家栽培小扁豆，亚洲生产最多。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6505, '小豆蔻', NULL, '蔬菜类', '小豆蔻，多年生草本。根茎粗壮，棕红色。叶两列，叶片狭长披针状，叶鞘具棕黄色柔毛。穗状花序由茎基部抽出。花序显著伸长，花排列稀疏，花冠白色。果实长卯圆形，果皮质韧，不易开裂。种子团分3瓣，每瓣种子5～9枚，种子气味芳香而峻烈。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6506, '木豆', NULL, '蔬菜类', '豆科木豆属栽培种，学名Cajanus cajan (L.) Mill sp.，一年生或多年生木本植物。别名树豆、柳豆、黄豆树、鸽豆。具有粮食、蔬菜、饲料、绿肥和放养紫胶虫等用途。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6507, '茄冬叶', NULL, '蔬菜类', '茄冬叶为玉蕊科植物玉蕊的叶。全年均可采，洗净，鲜用或晒干。主治皮肤瘙痒；水痦。生于滨海地区林中，主要分布于台湾、广东、海南等地。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6508, '白茄子', NULL, '蔬菜类', '茄子（白皮，长）属茄科，一年生蔬菜。原产印度，我国普遍栽培，茄子（白皮，长）是夏季主要蔬菜之一。热带为多年生。其结出的果实可食用，茄子（白皮，长）为白色品种，形状上有圆形，椭圆，梨形等各种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6509, '灯笼椒', NULL, '蔬菜类', '灯笼椒，辣椒属植物，肉质厚而柔软的辣椒。果形较大，蓬松，颜色各异，一般钟状，有沟纹，可做沙拉或菜肴。可观赏也可食用，观赏期达半年之久。适应性强，栽培容易与一般椒类相同，但在生长期要注意枯萎病的防治。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6510, '黑柿蕃茄', NULL, '蔬菜类', '黑柿蕃茄，蕃茄的一种，外表呈翠绿色，果实大，外皮薄，蕃茄顶部中心有红点出现后即可食用，所以黑柿蕃茄又称一点红。台湾传统上將它当成蔬菜使用，可以煮汤或炒蛋，也可以做成蕃茄切盘。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6511, '红番茄', NULL, '蔬菜类', '红番茄别名西红柿、洋柿子，古名六月柿、喜报三元。果实营养丰富，具特殊风味。可以生食、煮食、加工制成番茄酱、汁或整果罐藏。番茄是全世界栽培最为普遍的果菜之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6512, '黄秋葵', NULL, '蔬菜类', '黄秋葵，别名秋葵、黄葵、洋茄、羊角菜、羊角豆、羊角椒，洋辣椒。是锦葵科一年生的草本植物，以采收嫩荚供食用，花和嫩叶也可食用。原产于非洲，之后进入美洲和其他地区，中国也有种植。美国人叫它“植物黄金金秋葵”，是降血糖的良药。黄秋葵可以深加工成花茶、饮料、胶囊、干蔬、油等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6513, '树番茄', NULL, '蔬菜类', '树番茄原产于秘鲁、智利、厄瓜多尔、哥伦比亚和玻利维亚的安第斯山脉山区，现在当地果园仍有种植，并且是最受欢迎的植物之一。世界其他各地，诸如南非、印度、中国、美国、澳大利亚和新几内亚也已开始种植树番茄。在台湾阿里山山区也有分布。新西兰是出口树番茄最多的国家之一，出口地包括美国、日本和欧洲，为此甚至占用了猕猴桃的销售渠道。\r\n其果实大约4～10厘米（1.6～3.9英寸）长，色泽由黄到红深浅不等。有时会有深色的纵向条纹。其中红果实较酸，而橙黄色的则更甜。树番茄比一般的番茄籽更多。[2] 果实富含维他命和铁元素，每', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6514, '小西红柿', NULL, '蔬菜类', '圣女果，常被称为小西红柿，但它并不是我们如今常见的小西红柿，它是94年台湾常规育成的一个番茄品种，并不属于转基因品种，曾在大陆销售过一段时间，早在04-05年就已停止销售。如今的小西红柿，学名叫做樱桃番茄，是一年生草本植物，属茄科番茄属，植株最高时能长到2米。在我国一年四季均可栽培。只不过在北方每年只生长一季，其余时间大棚种植，与露地栽培比起来，在口味上有很大差别。到了华南地区，由于气候适宜樱桃番茄的生长， 从每年的七、八月份开始，一直到来年的2月份，都可以吃到口味纯正的露地栽培樱桃番茄。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6515, '紫长茄', NULL, '蔬菜类', '紫红长茄，属于长茄品种，早春保护地，夏、秋露地均可栽培。各地可按当地实际情况适时播种育苗，苗龄不宜过长，以四片真叶为宜，亩植2800-3200株。开沟施足磷钾底肥。早春保护地栽培须用番茄灵等座果激素处理花。采收盛期注意去侧枝及老黄叶片，适时补追水肥及病虫害的防治', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6516, '线茄', NULL, '蔬菜类', '别名：落苏、茄瓜。茄子是为数不多的紫色蔬菜之一，也是餐桌上十分常见的家常蔬菜。在它的紫皮中含有丰富的维生素E和维生素P，这是其他蔬菜所不能比的。茄子属茄科，一年生蔬菜。原产印度。中国种植茄子已有1000余年历史，我国普遍栽培，是夏季主要蔬菜之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6517, '绿长茄', NULL, '蔬菜类', '绿长茄是大绿公司从台湾引进的杂交一代优良茄子品种，具有早熟、耐热、抗病、优质、高产、耐贮运、适应广等特点。定植后约70天达商品成熟。平均单果重约200克，果皮紫红明艳，长直条顶端圆锥型。果长39厘米左右，横径约3.5厘米，肉质柔软、风味最佳，商品性好。坐果性强，着果多，采收期长，极丰产。特适宜初秋栽培。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6518, '绿圆茄', NULL, '蔬菜类', '绿茄为直立型品种，株高71．6厘米，开展度70．2厘米。茎秆、叶片和叶脉均为绿色，叶片肥大，叶缘波状；花紫色。果实长椭圆形，纵径18厘米，横径7厘米，果皮鲜绿色而且有光泽。果肉白色，松软细嫩，味甜质优，商品性状好，单果重350克。在辽沈地区从播种到商品果始收期仅需109天左右，属于中早熟品种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6519, '花茄子', NULL, '蔬菜类', '常绿大灌木或小乔木，别名，原产南美洲的玻利维亚、巴西，株高3至5米，茎直立，小枝及叶柄具刚毛与皮刺，叶互生，叶片大、通常羽状半裂，叶面具刚毛状单毛。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6520, '紫圆茄', NULL, '蔬菜类', '茄子是为数不多的紫色蔬菜之一，也是餐桌上十分常见的家常蔬菜。在它的紫皮中含有丰富的维生素E和维生素P，这是其他蔬菜所不能比的。茄子属茄科，一年生蔬菜。原产印度，我国普遍栽培，是夏季主要蔬菜之一。茄子食用的部位是它的嫩果，按其形状不同可分为圆茄、灯泡茄和线茄三种。圆茄，果为圆球形，皮黑紫色，有光泽，果柄深紫色，果肉浅绿白色，肉质致密而细嫩；灯泡茄，果形似灯泡，皮黑紫色，有光泽，果柄深紫色，果肉浅绿白色，含子较多，肉质略松；线茄，果为细长条形或略弯曲，皮较薄，深紫色或黑紫色，果肉浅绿白色，含子少，肉质细嫩松软', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6521, '尖椒', NULL, '蔬菜类', '属辣椒的一个大类。在我国，在许多地区都是非常重要的调味品，甚至没有它就无法下饭，可见人们对它的钟爱。由于南方多雨，空气潮湿，辣椒有祛湿功能，所以南方人均喜辣椒。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6522, '紫尖椒', NULL, '蔬菜类', '紫尖椒富含维生素C，可以控制心脏病及冠状动脉硬化，降低胆固醇。含有较多抗氧化物质，可预防癌症及其他慢性疾病。可以使呼吸道畅通，用以治疗咳嗽、感冒。有机紫尖椒还能杀抑胃腹内的寄生虫。含有丰富的维生素等，食用辣椒，能增加饭量，增强体力，改善怕冷、冻伤、血管性头痛等症状。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6523, '红尖椒', NULL, '蔬菜类', '红尖椒原产于中南美洲热带地区，明代的时候传入我国。如今全国各地均有栽培，并且一年四季都有。墨西哥人将它视为国食，而在我国很多地方红尖椒也是非常重要的调味品。红尖椒晒干以后就是我们超市里所见的干辣椒。挑选鲜的红尖椒时应选果皮坚实，肉厚质细而脆嫩，无虫咬、黑点和腐烂的。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6524, '架豆', NULL, '蔬菜类', '架豆,一种豆类，蔓生植物,长势旺盛，株高2.1米-2.4米上下。种子长肾形，亮黄褐色，豆荚浅绿泛白色，荚肉厚、嫩无纤维，荚长20厘米左右。结荚部位较低，密度大，产量高，属中早熟品种，单荚重约15克，每序花3-5荚，亩产可达2000公斤左右。适宜南北方春秋露地及保护地栽培。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6525, '甜玉米', NULL, '蔬菜类', '甜玉米（Sweet corn）是玉米的一个种，又称蔬菜玉米，禾本科，玉米属。甜玉米是欧美、韩国和日本等发达国家的主要蔬菜之一。因其具有丰富的营养、甜、鲜、脆、嫩的特色而深受各阶层消费者青睐。超甜玉米由于含糖量高、适宜采收期长而得到广泛种植。中国是糯玉米的世界起源中心，栽培历史悠久。糯玉米营养丰富，食用价值高，被当今世界广泛用作营养食物。\r\n它是由于一个或几个基因的存在而不同于其他玉米的一种类型。甜玉米是菜用玉米的一个类型。\r\n甜玉米被消费的植株部分是未成熟的籽粒，主要由胚乳和子房壁（未成熟的颖果皮）组成。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6526, '黏玉米', NULL, '蔬菜类', '糯玉米起源于中国。玉米被引入中国后，在西南地区种植的硬质玉米发生突变，经人工选择而逐渐出现了糯质类型。从学名 Zea mays L.sinensis Kulesh看，即有“中国种”之意。\r\n糯玉米（Waxy corn），也称蜡质玉米。籽粒中有较粗的蜡质状胚乳，较像硬质玉米和马齿型玉米有光泽的玻璃质（透明）籽粒。其化学性状和物理性状受单个隐性基因（wx）控制，这个基因位于第9染色体上。 胚乳中 100%的淀粉是支链淀粉（Amylopectin或 Branched chain starch）。此类玉米除作为菜', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6527, '红秋葵', NULL, '蔬菜类', '红秋葵，学名：Hibiscus coccineus (Medicus) Walt，是黄秋葵种中的一个果实外皮红色的品种，为锦葵科秋葵属一年生草本植物。以采食嫩果为主，红秋葵的花、种子均可以入药，对胃炎、胃溃疡等多种疾病有较好疗效。还有保护肝脏的功能。蒴果长角形，先端尖，横切面五角或六角形，也有圆形。表皮上有茸毛，在较低温时茸毛变硬。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6528, '线椒', NULL, '蔬菜类', '中早熟，长势强，株型紧凑，果实长线形，果色由深绿色转鲜红色，光泽度好，果长21厘米左右，果径1.4厘米，单果重20g左右。鲜椒产量可达3500kg每亩。果实光滑顺直，首尾匀称，辣味浓，带有香味，品质佳。果实硬度好，耐长途贩运，货架期长。适合于做鲜食和加工栽培。适应性广，抗病毒病和疫病，抗衰老能力强。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6529, '美人椒', NULL, '蔬菜类', '美人椒有红与绿两种颜色，肉质紧密厚实，外形细长，长约20cm，外表颜色鲜艳而又光泽。美人椒味道辛辣，一般不能当做普通蔬菜食用。适合，腌渍呈泡辣椒，或入菜用于调味。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6530, '番茄', NULL, '蔬菜类', '番茄(tomato)别名西红柿、洋柿子，古名六月柿、喜报三元。果实营养丰富，具特殊风味。可以生食、煮食、加工制成番茄酱、汁或整果罐藏。番茄是全世界栽培最为普遍的果菜之一。 美国、苏联、意大利和中国为主要生产国。在欧、美洲的国家、中国和日本有大面积温室、塑料大棚及其他保护地设施栽培。中国各地普遍种植。栽培面积仍在继续扩大。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6531, '圆茄子', NULL, '蔬菜类', '圆茄子是为数不多的紫色蔬菜之一，也是餐桌上十分常见的家常蔬菜。在它的紫皮中含有丰富的维生素E和维生素P，这是其他蔬菜所不能比的。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6532, '二荆条', NULL, '蔬菜类', '二荆条是成都的特产辣椒，每年7月中旬收成，有名的郫县豆瓣每年都会在简阳收集二荆条来加工成豆瓣。煎油色泽红亮，红油能自动向盘边溅射上爬，口感辣度适中，味香。椒角细长。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6533, '梅豆角', NULL, '蔬菜类', '梅豆角又称扁豆，北方也有地区称之为气豆。一年生草本植物，茎蔓生，小叶披针形，花白色或紫色，荚果长椭圆形，扁平，微弯。种子白色或紫黑色。嫩荚是普通蔬菜，种子可入药。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6534, '酸豆角', NULL, '蔬菜类', '酸豆角，就是腌制过的豆角。豆角含有丰富的优质蛋白质、碳水化合物及多种维生素、微量元素等，可补充机体的招牌营养素。其中所含B族维生素能维持正常的消化腺分泌和胃肠道蠕动的功能，抑制胆碱酶活性，可帮助消化，增进食欲。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6535, '宽豆角', NULL, '蔬菜类', '宽豆角为豆科、扁豆属的一个栽培种，多年生或一年生缠绕藤本植物，食用嫩荚或成熟豆粒。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6536, '绿豆芽', NULL, '蔬菜类', '绿豆芽，即绿豆的芽。绿豆在发芽过程中，维生素C会增加很多，而且部分蛋白质也会分解为各种人所需的氨基酸，可达到绿豆原含量的七倍，所以绿豆芽的营养价值比绿豆更大。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6537, '豆芽', NULL, '蔬菜类', '豆芽，也称芽苗菜，又名巧芽、豆芽菜、如意菜、掐菜、银芽、银针、银苗、芽心、大豆芽、清水豆芽，是各种谷类、豆类、树类的种子培育出可以食用的“芽菜”，也称“活体蔬菜”。品种丰富，营养全面，是常见的蔬菜。食用的主要部分为下胚轴。常见的芽苗菜有：香椿芽苗菜、荞麦芽苗菜、苜蓿芽苗菜、花椒芽苗菜、绿色黑豆芽苗菜、相思豆芽苗菜、葵花籽芽苗菜、萝卜芽苗菜、龙须豆芽苗菜、花生芽苗菜、蚕豆芽苗菜等30多个品种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6538, '土豆', NULL, '蔬菜类', '马铃薯（学名：Solanum tuberosum L.），属茄科一年生草本植物，块茎可供食用，是全球第四大重要的粮食作物，仅次于小麦、稻谷和玉米。马铃薯又称地蛋、土豆 、洋山芋等，茄科植物的块茎。与小麦、稻谷、玉米、高粱并成为世界五大作物。马铃薯原产于南美洲安第斯山区，人工栽培历史最早可追溯到大约公元前8000年到5000年的秘鲁南部地区。马铃薯主要生产国有中国、俄罗斯、印度、乌克兰、美国等。中国是世界马铃薯总产最多的国家。2015年，中国将启动马铃薯主粮化战略，推进把马铃薯加工成馒头、面条、米粉等主食，', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6539, '红薯', NULL, '蔬菜类', '红薯（学名：Ipomoea batatas），又名番薯、甘薯、山芋、地瓜、红苕、线苕、白薯、金薯、甜薯、朱薯、枕薯等。常见的多年生双子叶植物，草本，其蔓细长，茎匍匐地面。块根，无氧呼吸产生乳酸，皮色发白或发红，肉大多为黄白色，但也有紫色，除供食用外，还可以制糖和酿酒、制酒精。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6540, '芋头', NULL, '蔬菜类', '多年生块茎植物，常作一年生作物栽培。叶片盾形，叶柄长而肥大，绿色或紫红色；植株基部形成短缩茎，逐渐累积养分肥大成肉质球茎，称为“芋头”或“母芋”，球形、卵形、椭圆形或块状等。母芋每节都有一个脑芽，但以中下部节位的腋芽活动力最强，发生第一次分蘖，形成小的球茎称为“子芋”，再从子芋发生“孙芋”，在适宜条件下，可形成曾孙或玄孙芋等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6541, '洋葱', NULL, '蔬菜类', '洋葱又名球葱、圆葱、玉葱、葱头，荷兰葱，属百合科蒜属，为2年生草本植物。有关洋葱的原产地说法很多，但多数认为洋葱产于亚洲西南部中亚西亚、小亚西亚的伊朗、阿富汗的高原地区。洋葱的起源已有5000多年历史，公元前1000年传到埃及，后传到地中海地区，16世纪传入美国，17世纪传到日本，20世纪初传入我国。 洋葱在我国分布很广，南北各地均有栽培，而且种植面积还在不断扩大，是目前我国主栽蔬菜之一。我国已成为洋葱生产量较大的4个国家(中国、印度、美国、日本)之一。 我国的种植区域主要是山东、甘肃、内蒙古、新疆等地。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6542, '胡萝卜', NULL, '蔬菜类', '胡萝卜（Daucus carrot），又称甘荀，是伞形科胡萝卜属二年生草本植物。以肉质根作蔬菜食用。原产亚洲西南部，阿富汗为最早演化中心，栽培历史在2000年以上。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6543, '白萝卜', NULL, '蔬菜类', '白萝卜，根茎类蔬菜，十字花科萝卜属植物。根据营养学家分析，白萝卜生命力指数为5.5555，防病指数为2.7903。至今种植有千年历史，在饮食和中医食疗领域有广泛应用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6544, '竹笋', NULL, '蔬菜类', '竹笋，是竹的幼芽，也称为笋。竹为多年生常绿草本植物，食用部分为初生、嫩肥、短壮的芽或鞭。竹原产中国，类型众多，适应性强，分布极广。全世界共计有30个属550种，盛产于热带、亚热带和温带地区。中国是世界上产竹最多的国家之一，共有22个属、200多种，分布全国各地，以珠江流域和长江流域最多，秦岭以北雨量少、气温低，仅有少数矮小竹类生长。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6545, '魔芋', NULL, '蔬菜类', '墨鱼是贝类，属软体动物门。墨鱼亦称乌贼鱼、墨斗鱼、目鱼等。干者叫明鱼。属软体动物中的头足类，产地分布很广，中国、朝鲜、日本及欧洲各沿海均有出产，中国舟山群岛出产最多。墨鱼肉、蛋、脊骨（中药名为海螵蛸）均可入药。李时珍称墨鱼为“血分药”，是妇女贫血、血虚经闭的佳珍。在浩瀚的东海，生长着这样一种生物，它象鱼类一样遨游，但并不属于鱼类，人们习惯称它为“墨鱼”，也叫它为“乌贼”或“乌鱼则”。它是我国著名的海产品之一，在浙江，和大黄鱼、小黄鱼、带鱼统称为“四大经济鱼类”，深受广大消费者喜爱。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6546, '山药', NULL, '蔬菜类', '薯蓣，通称山药。多年生草本植物，茎蔓生，常带紫色，块根圆柱形，叶子对生，卵形或椭圆形，花乳白色，雌雄异株。块根含淀粉和蛋白质，可以吃。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6547, '茭白', NULL, '蔬菜类', '茭白，是我国特有的水生蔬菜。世界上把茭白作为蔬菜栽培的只有我国和越南。古人称茭白为“菰”。在唐代以前，茭白被当作粮食作物栽培，它的种子叫菰米或雕胡，是“六谷”（稌、黍、稷、粱、麦、菰）之一。后来人们发现，有些菰因感染上黑粉菌而不抽穗，且植株毫无病象，茎部不断膨大，逐渐形成纺锤形的肉质茎，这就是现在食用的茭白。这样，人们就利用黑粉菌阻止茭白开花结果，繁殖这种有病在身的畸型植株作为蔬菜。可入药。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6548, '藕', NULL, '蔬菜类', '藕，又称莲藕，属睡莲科植物，莲的根茎。肥大，有节，中间有一些管状小孔，折断后有丝相连。藕微甜而脆，可生食也可做菜，而且药用价值相当高，它的根根叶叶，花须果实，无不为宝，都可滋补入药。用藕制成粉，能消食止泻，开胃清热，滋补养性，预防内出血，是妇孺童妪、体弱多病者上好的流质食品和滋补佳珍，在清咸丰年间，就被钦定为御膳贡品了。藕原产于印度，后来引入中国。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6549, '牛蒡', NULL, '蔬菜类', '牛蒡（niúbàng）原产于中国，以野生为主，公元940年前后传入日本，并被培育成优良品种，现日本人把牛蒡奉为营养和保健价值极佳的高档蔬菜。牛蒡凭借其独特的香气和纯正的口味，风靡日本和韩国，走俏东南亚，并引起西欧和美国有识之士的关注，可与人参媲美，有“东洋参”的美誉。另在动漫中牛蒡的意思，是说人软弱就可以使用牛蒡来形容他人。某死亡重金属漫画的经典语录词典“珍妮的男朋友是一个牛蒡男”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6550, '榨菜', NULL, '蔬菜类', '榨菜，被子植物门，双子叶植物纲的一科。多为草本植物。榨菜是芥菜中的一类，一般都是指叶用芥菜一类，如九头芥、雪里蕻、猪血芥、豆腐皮芥等。榨菜是一种半干态非发酵性咸菜，以茎用芥菜为原料腌制而成，是中国名特产品之一与欧洲酸菜、日本酱菜并称世界三大名腌菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6551, '荸荠', NULL, '蔬菜类', '莎草科荸荠属浅水性宿根草本，以球茎作蔬菜食用。古称凫茈（凫茈），俗称马蹄，又称地栗，因它形如马蹄，又像栗子而得名。称它马蹄，仅指其外表；说它像栗子，不仅是形状，连性味、成分、功用都与栗子相似，又因它是在泥中结果，所以有地栗之称。荸荠皮色紫黑，肉质洁白，味甜多汁，清脆可口，自古有地下雪梨之美誉，北方人视之为江南人参。荸荠既可作为水果，又可算作蔬菜，是大众喜爱的时令之品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6552, '紫薯', NULL, '蔬菜类', '紫薯，又叫黑薯，薯肉呈紫色至深紫色。它除了具有普通红薯的营养成分外，还富含硒元素和花青素。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6553, '折耳根', NULL, '蔬菜类', '鱼腥草为三白草科多年生草本植物蕺菜的干燥水上部分。产于我国长江流域以南各省。名见《名医别录》。唐苏颂说：\"生湿地，山谷阴处亦能蔓生，叶如荞麦而肥，茎紫赤色，江左人好生食，关中谓之菹菜，叶有腥气，故俗称：鱼腥草。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6554, '地瓜', NULL, '蔬菜类', '又名番薯、甘薯、山芋、地瓜、红苕、线苕、白薯、金薯、甜薯、朱薯、枕薯等。常见的多年生双子叶植物，草本，其蔓细长，茎匍匐地面。块根，无氧呼吸产生乳酸，皮色发白或发红，肉大多为黄白色，但也有紫色，除供食用外，还可以制糖和酿酒、制酒精。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6555, '莲藕', NULL, '蔬菜类', '藕是莲藕的地下茎的膨大部分，莲藕属睡莲科。莲藕主要分布于长江流域和南方各省、秋、冬及春初均可采挖。\r\n藕呈短圆柱形，外皮粗厚，光滑为灰白色或银灰色，内部白色；节部中央膨大，内有大小不同的孔道若干条，排列左右对称；体较重，质脆嫩，在我国食用栽培的莲藕，可分为两大类：第一类为藕用种。其根茎较肥大，外皮白色，肉质脆嫩，味甜，产量高，结莲子不多；第二类为莲用种，莲较小，肉质稍带灰色，品质较差，但结果多，主要采收莲子。\r\n作为蔬菜食用以藕用种为主。莲藕，微甜而脆，十分爽口，可生食也可做菜，而且药用价值相当高，是老幼', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6556, '萝卜', NULL, '蔬菜类', '白萝卜是萝卜的一种，为十字花科萝卜属莱菔的新鲜根。萝卜的品种多，有白、红、青，但以白萝卜最为普遍。萝卜一、二年生草本。根肉质，长圆形、球形或圆锥形，根皮绿色、白色、粉红色或紫色。茎直立，粗壮，圆柱形，中空，自基部分枝。基生叶及茎下部叶有长柄，通常大头羽状分裂，被粗毛，侧裂片1～3对，边缘有锯齿或缺刻；茎中、上部叶长圆形至披针形，向上渐变小，不裂或稍分裂，不抱茎。总状花序，顶生及腋生。花淡粉红色或白色。长角果，不开裂，近圆锥形，直或稍弯，种子间缢缩成串珠状，先端具长喙，喙长2、5～5厘米，果壁海绵质。种子1', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6557, '水萝卜', NULL, '蔬菜类', '水萝卜为十字花科植物莱菔的新鲜根。萝卜又名莱菔、罗服。我国是萝卜的故乡，栽培食用历史悠久，早在《诗经》中就有关于萝卜的记载。它既可用于制作菜肴，炒、煮、凉拌等俱佳；又可当作水果生吃，味道鲜美；还可腌制泡菜、酱菜。萝卜营养丰富，有很好的食用、医疗价值。有“冬吃萝卜夏吃姜，一年四季保安康”的说法。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6558, '铁棍山药', NULL, '蔬菜类', '山药属薯蓣科多年蔓生草本植物薯蓣的干燥块茎。\r\n栽种者称家山药，野生者称野山药；中药材称淮山，淮山药，怀山药等。\r\n因其营养丰富，自古以来就被视为物美价廉的补虚佳品，既可作主粮，又可作蔬菜，还可以制成糖葫芦之类的小吃。\r\n我国主产于河南省博爱、沁阳、武陟、温县等地，河北、山西、山东及中南、西南等地区也有栽培。冬季茎叶枯萎后采挖，切去根头，洗净，干燥。\r\n中国栽培的山药主要有普通的山药和田薯两大类。普通的山药块茎较小，其中以四川等地的“脚板薯”，山西怀县的怀山药，江汉南城淮山药最为有名。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6559, '红萝卜', NULL, '蔬菜类', '红萝卜是萝卜的一种，为“十字花科萝卜属” ，又名“大红萝卜”、“东北红萝卜”，一、二年生草本，根肉质，球形、根皮红色、根肉白色。原产于我国，各地均有栽培，东北是我国大红萝卜主要产区，因气候及品种等因素形成了其极高的营养价值和药用价值。红萝卜性微温，入肺、胃二经，具有清热、解毒、利湿、散瘀、健胃消食、化痰止咳、顺气、利便、生津止渴、补中、安五脏等功能。萝卜种类繁多，生吃以辣味少者为好。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6560, '冬笋', NULL, '蔬菜类', '冬笋是竹笋的一种，是竹的嫩芽，质量好的冬笋呈枣核形即两头小中间大，驼背鳞片，略带茸毛，皮黄白色，肉淡白色。冬笋素有“金衣白玉，蔬中一绝”之美誉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6561, '紫甘薯', NULL, '蔬菜类', '紫甘薯又称紫薯，薯肉呈紫至深紫色，除具有普通甘薯的营养成分外，富含花青素，有较高的药用价值，是一种栽培容易、药食兼用的理想作物。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6562, '沙葛', NULL, '蔬菜类', '沙葛即常说的地瓜，原产热带美洲，后来传入中国，目前中国华北，西南、华南和台湾地区的栽培数量较多。其本身价格低廉而且味道不错，清吃爽口清脆，熟吃甜美细腻。从而受到广大人民的欢迎，是中国最常见的食物之一。而且其用药还有解酒毒，降血压，止渴生津的功能。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6563, '笋尖', NULL, '蔬菜类', '竹笋，别名笋或闽笋，为多年生常绿草本植物，食用部分为初生、嫩肥、短壮的芽或鞭。竹原产中国，类型众多，适应性强，分布极广。全世界共计有30个属550种，盛产于热带、亚热带和温带地区。中国是世界上产竹最多的国家之一，共有22个属、200多种，分布全国各地，以珠江流域和长江流域最多，秦岭以北雨量少、气温低，仅有少数矮小竹类生长。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6564, '心里美萝卜', NULL, '蔬菜类', '萝卜为十字花科植物莱菔的新鲜根，萝卜属。一、二年生草本。根肉质，长圆形、球形或圆锥形，根皮绿色、白色、粉红色或紫色。水果型萝卜，肉脆，味甜多汁。心里美萝卜所含热量较少，纤维素较多，对防癌、抗癌有重要作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6565, '紫菜头', NULL, '蔬菜类', '紫菜头又称红菜头、红根甜菜，为藜科甜菜属甜菜种的一个变种，以肥大的肉质根供作蔬菜食用，可生食、熟食，也可加工成罐头，肉质脆嫩，略带甜味，营养价值较高，富含糖分和多种矿物质，并有治吐泻和驱腹内寄生虫的功能，是一种经济效益高、创汇能力强、很有发展前途的蔬菜。食用 根菾菜生食时，口味微甜，爽脆利口。西餐中多用作生食，用各种颜色的根菾菜或单一色的根菾菜制作彩色沙拉。传统的食用方法是把肉质根煮烂，做成菜泥，加上调料拌匀食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6566, '罗汉笋', NULL, '蔬菜类', '又名笋、毛笋、竹芽、竹萌。\r\n竹笋为禾本科植物毛竹等多种竹的幼苗，去竹箨可食部分。主要生长于湖南、湖北、江西、浙江等省。\r\n竹的种类很多，毛竹是其中之一。它的地下茎称为“竹鞭”，粗壮横行于土中，鞭有节，节侧生芽即为竹笋。\r\n笋体肥壮，呈圆筒状宝塔形，上尖下圆，中间有节；笋外壳的脉线和壳毛为黄色；笋肉色白或淡黄，质细嫩，味清鲜，\r\n鲜笋有冬笋和春笋之分，冬笋是在冬天笋尚未出土时挖掘的，质量最好；春笋则是在春天笋已出土时挖掘的，质量较次。\r\n竹笋的品质要求：以新鲜质嫩，肉厚节间短，肉质呈乳白色或淡黄色，无霉烂', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6567, '黑豆芽', NULL, '蔬菜类', '黑豆芽（小豆芽）是一种口感鲜嫩营养丰富的芽菜。含有丰富的钙、磷、铁、钾等矿物质及多种维生素，含量比绿豆芽还高。一般在芽高3－10厘米时食用。此时两片真叶尚未展开，可炒、作汤或凉拌及作火锅蔬菜，味道清香脆嫩，风味独特，口感极佳。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6568, '木薯', NULL, '蔬菜类', '木薯，是灌木状多年生作物。茎直立，木质，高2-5m，单叶互生掌状深裂，纸质，披针形。单性花，圆锥花序，顶生，雌雄同序。木薯于十九世纪二十年代引入我国，首先在广东省高州一带栽培，随后引入海南岛，现已广泛分布于华南地区，以广西、广东和海南栽培最多，福建、云南、江西、四川和贵州等省的南部地区亦有引种试种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6569, '青萝卜', NULL, '蔬菜类', '萝卜的品种十分繁多，可按形状、色泽、种植季节不同等来进行分类，也可按用途分为生食、熟食和加工品种。青萝卜属生食绿色品种，细长圆筒形，皮翠绿色，尾端玉白色。整个萝卜上部甘甜少辣味，至尾部辣味渐增，是地方优良品种，极耐贮藏。除生食外，还可做汤，干腌、盐渍和制做泡菜等。青萝卜还具有药用价值，有消积、祛谈、利尿、止泻等效用，被人们所喜爱。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6570, '苤蓝', NULL, '蔬菜类', '十字花科草本植物甘蓝的茎叶，形状如球，是甘蓝的一种，学名叫球茎甘蓝。苤蓝是介于大头菜和包心菜之间的蔬菜，可以拿来清蒸当做小菜，或切丝做成凉拌沙拉。它的维生素C含量极高，还含有大量的钾，而维生素E的含量非常丰富。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6571, '干笋', NULL, '蔬菜类', '生产工艺：以春笋为原料，通过去壳切根修整---高温蒸煮---清水浸漂---榨压成形处理---烘干---整形包装等传统工艺，纯手工制作。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6572, '黄豆芽', NULL, '蔬菜类', '豆芽是大豆经加工处理发出的嫩芽，是一种营养丰富的蔬菜。当今世界“天然”、“健康”食物引领风骚者之一，乃是源自我国的豆芽菜，特别是金灿灿的“如意菜”----黄豆芽。明人陈嶷曾有过赞美黄豆芽的诗句：“有彼物兮，冰肌玉质，子不入污泥，根不资于扶植。”黄豆在发芽过程中更多的营养元素被释放出来，更利于人体吸收，营养更胜黄豆一筹。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6573, '鱼腥草', NULL, '蔬菜类', '鱼腥草为三白草科蕺菜的嫩茎叶，多年生草本植物。全株具鱼腥气，可炒食、凉拌或作汤。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6574, '樱桃萝卜', NULL, '蔬菜类', '樱桃萝卜是一种小型萝卜，为中国的四季萝卜中的一种，十字花科萝卜属，一二年生草本。樱桃萝卜具有品质细嫩，生长迅速，外形、色泽美观等特点，适于生吃。目前的栽培品种大多从日本、德国等国引进，我国栽培的樱桃萝卜以扬州水萝卜较著名。\r\n樱桃萝卜根、缨均可食用。根最好生食或蘸甜面酱吃，还可烧、炒或腌渍酸（泡）菜，做中西餐配菜也是别具风味。吃多了油腻的食物，不妨吃上几个樱桃小萝卜，有不错的解油腻的效果。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6575, '心里美', NULL, '蔬菜类', '心里美萝卜是萝卜的一种，心里美萝卜汁液中存在一种色素，称为花青素，是一类水溶性色素，在酸性溶液中颜色偏红，而在碱性环境中则呈紫蓝色。因此，含有这种色素的蔬菜，经酸渍后可使其颜色更加鲜红，而得名。心里美是一种家常菜，主料为萝卜丝。有的心里美萝卜是辣的，因为本身的生物成分如此。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6576, '首乌', NULL, '蔬菜类', '有赤白之分，药用为赤首乌的块根。茎长可达3米以上，多缠绕在其它植物上，状如人形，可促进毛发生长的功效，故称何首乌。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6577, '春笋', NULL, '蔬菜类', '别名笋，为多年生常绿草本植物，食用部分为初生、嫩肥、短壮的芽或鞭。竹原产中国，类型众多，适应性强，分布极广。毛竹、早竹等散生型竹种的地下茎入土较深，竹鞭和笋芽借土层保护，冬季不易受冻害，出笋期主要在春季。竹笋一年四季皆有，但惟有春笋、冬笋味道最佳。烹调时无论是凉拌、煎炒还是熬汤，均鲜嫩清香，是人们喜欢的佳肴之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6578, '藕带', NULL, '蔬菜类', '藕带就是莲的幼嫩根状茎，由根状茎顶端的一个节间和顶芽组成。藕带与莲藕为同源器官，条件适宜时，藕带膨大后就成为了藕（所以，准确地讲，藕是膨大的根状茎）。湖北人最喜欢食用藕带。其实，古代就有采食藕带的习惯，如《本草纲目》记载的“藕丝菜”就是现今所谓的藕带。目前，市场上销售食用的藕带，主要有两个来源，即子莲和藕莲，以子莲为主。湖北等地栽培子莲时，一般一次定植，连续种植三年。从第二年开始，由于田间植株过密，采收藕带，实际上起到疏苗的作用。所以，子莲藕带是子莲栽培中的副产品。另外，也有部分农户利用莲藕（藕莲）采收藕', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6579, '香芋', NULL, '蔬菜类', '香芋原产于东南亚，后来由波利尼西亚人把品种带至夏威夷，并逐渐在19世纪成为夏威夷的主要农产品之一。香芋有一种独特的香草味，肉心呈紫色，似薯类，但味道既非山芋、芋艿，又非马铃薯，好似板栗，甘而芳香，食后余味不尽，故取名香芋。烧、炒、炖皆可，与鸡肉、猪肉一起烹其味香而不腻，酥而不烂。将香芋放置于干燥阴凉的地方且要通风，在购买后尽可能快点将它食用完，因为芋头容易变软。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6580, '槟榔芋', NULL, '蔬菜类', '槟榔芋是薯蓣科作物，也叫荔浦芋，主产于广西、福建等沿海地区，已有上千年历史。目前的广西荔浦县、平乐、恭城和福建的闽南地区为主产区。 槟榔芋形似椭圆，该品种外皮粗糙，剖而观之，内呈槟榔纹，故又名“槟榔芋”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6581, '笋', NULL, '蔬菜类', '笋为禾本科植物毛竹等多种竹的幼苗，去竹箨可食部分。主要生长于湖南、湖北、江西、浙江等省。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6582, '白姜薯', NULL, '蔬菜类', '从植物形态来看，姜薯与山药极为相似，均为缠绕藤本植物，叶心形互生，以块茎供食用或药用，块茎富含粘液质。姜薯虽属薯类，身价却并不低贱。有些前来探亲的华侨、港澳同胞回归居住地，千里迢迢，也要带上几条姜薯，好让海外乡亲尝尝。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6583, '辣根', NULL, '蔬菜类', '辣根为一种深根性蔬菜，原产欧洲，其肥大的肉质根含有特殊辣味的黑介甙，还含有人体需要的多种营养成分，并能抑制胃癌细胞繁殖，在国外已作为保健蔬菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6584, '慈姑', NULL, '蔬菜类', '慈姑属淡水植物，约20种，广布全球。多年生，草本，生长于浅湖、池塘和溪流。叶似箭头，有肉质球茎，可食。花有3枚圆形花瓣。北美最常见种是宽叶慈姑，叶箭形至禾草状，被广泛引种以扩大禽类食源。慈姑分布于欧洲大部分地区，在中国则栽培以食用其球茎。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6585, '甜菜根', NULL, '蔬菜类', '甜菜根又称为根甜菜、红菜头、紫菜头等，原产欧洲地中海沿岸，是一种二年生草本块根生植物，肉质根呈球形、卵形、扁圆形、纺锤形等。因含甜菜红素，根皮及根肉均呈紫红色，横切面可见数层美丽的紫色环纹。甜菜根喜欢生长在冷凉气温环境中，因此我国东北及内蒙古多有种植，是用来榨 制砂糖的主要原料。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6586, '芜菁', NULL, '蔬菜类', '芜菁，大头菜，又称大头芥，根如圆萝卜，盐腌晒干作咸菜名梳菜。华东一带通称香大头。十字花科芸薹属芸薹种芜菁亚种能形成肉质根的二年生草本植物。别名蔓菁、圆根、盘菜等。染色体数2n=2x=20。肥大肉质根供食用。肉质根柔嫩、致密，供炒食、煮食或腌渍。欧洲、亚洲和美洲均有栽培。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6587, '大薯', NULL, '蔬菜类', '缠绕藤本；块茎野生的多为圆柱形或棒状，栽培的形状变化较大，掌状、棒状或圆锥形，表面棕色或黑色，断面白色、黄色或紫色。茎基部四棱形，有翅；叶腋内常生有形状大小不一的零余子', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6588, '黑土豆', NULL, '蔬菜类', '黑土豆薯形呈长椭圆形，芽眼较小。果皮呈黑紫色，乌黑发亮，富有光泽。果肉为深紫色，外观好看，颜色诱惑力强。果肉淀粉含量高达13-15%，口感较好，品质极佳。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6589, '仙人掌', NULL, '蔬菜类', '本品为仙人掌科植物仙人掌的根及茎。仙人掌灌木，高1～3米。 茎下部稍木质，近圆柱形，上部肉质，扁平，绿色，具节，每节卵形至矩圆形，长15～30厘米，光亮，散生多数瘤体，每一小瘤体上密生黄褐色卷曲的柔毛，并有利刺。叶肉质细小，披针形，先端尖细，紫红色，基部绿色，生于每个小瘤体的刺束之下，早落。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6590, '襄荷', NULL, '蔬菜类', '襄荷为姜科植物襄荷的根茎。襄荷多年生草本，生长喜温暖荫湿环境，适宜在长江中下游及其以南地区生长。姜科姜属，以嫩芽、嫩茎和花轴供食用的多年生草本植物，具有食、药两用价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6591, '小水萝卜', NULL, '蔬菜类', '小水萝卜可以炒、煮、凉拌、当作水果生吃;还可用作泡菜，酱菜腌制。营养丰富，有“冬吃萝卜夏吃姜，一年四季保安康”的说法', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6592, '魔芋丝', NULL, '蔬菜类', '魔芋丝就是魔芋的丝。魔芋是有益的碱性食品，对食用动物性酸性食品过多的人，搭配吃魔芋，可以达到食品酸、碱平衡，对人体健康有利。丰富多彩的魔芋食品，必将有广阔的前景。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6593, '牛尾笋', NULL, '蔬菜类', '牛尾笋是竹笋的一种，从竹子的根状茎上发出的幼嫩的发育芽,一经长出地面就砍下作为一种蔬菜，尤其被中国人和日本人所食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6594, '婆罗门参', NULL, '蔬菜类', '菊科(compositae)婆罗门参属中能形成肥大肉质根的二年生草本植物。学名TragopogonporrifoliusL.，别名西洋牛。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6595, '荞头', NULL, '蔬菜类', '荞头为石蒜科，多年生宿根作物，作两年生栽培，分蘖力强，鳞茎簇生于短缩茎上，呈卵状短圆形，鳞衣及肉均为白色。叶丛生，中空，细长，有不明显的棱角，浓绿色，微带蜡粉。鳞茎繁殖，可熟食，但多以腌渍加工食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6596, '野蒜', NULL, '蔬菜类', '野蒜学名Allium macrostemon Bunge，属百合科多年生草本植物。又名薤白、野小蒜、小根蒜、山蒜、菜芝、小根菜。植株高可达70cm。鳞茎近球形，粗1-2cm;外被膜质鳞皮。叶基生;叶片线形，长20-40cm，宽3-4mm，先端渐尖，基部鞘状、抱茎。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6597, '豆薯', NULL, '蔬菜类', '豆薯即凉薯，是豆科豆薯属的草质藤本植物。粗壮、缠绕、稍被毛，有时基部稍木质。总状花序长15-30厘米，每节有花3-5朵；小苞片刚毛状，早落；萼长9-11毫米，被紧贴的长硬毛；花冠浅紫色或淡红色，旗瓣近圆形；种子每荚8-10颗，近方形；根块状，纺锤形或扁球形，一般直径在20-30厘米左右，肉质。取其地下块根供生食或蔬食，种子有剧毒，忌食，但可作防治蚜虫的杀虫剂。原产热带美洲，现广布于东半球热带地区，中国西南部各省常见栽培。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6598, '洋姜', NULL, '蔬菜类', '洋姜，是一种菊科向日葵属宿根性草本植物。秋季开花，长有黄色的小盘花，形如菊，生产上一般用块茎繁殖，其地下块茎富含淀粉、菊糖等果糖多聚物，可以食用，煮食或熬粥，腌制咸菜，晒制菊芋干，或作制取淀粉和酒精原料。其块茎或茎叶入药具有利水除湿，清热凉血，益胃和中之功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6599, '大甲芋头', NULL, '蔬菜类', '大甲芋头种植地位于台湾的大甲，气候温暖，有大甲溪和大安溪两条河流的滋润，水源丰富，成为农作物生长的好地方，非常适合种植芋头，大甲种植芋头总面积约有400公顷左右，是芋头栽种面积最大乡镇。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6600, '甘薯', NULL, '蔬菜类', '又名山芋、红芋、番薯、红薯、白薯、地瓜、红苕等，因地区不同而有不同的名称。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6601, '葛根', NULL, '蔬菜类', '葛根为《中国药典》收载的草药，药用来源为豆科植物野葛或甘葛藤的干燥根。葛根供药用，有解表退热、生津止渴、止泻的功能，并能改善高血压病人的项强、头晕、头痛、耳鸣等症状。葛粉用于解酒。也是一种良好的水土保持植物。产我国南北各地，除新疆、青海及西藏外，分布几遍全国。生于山地疏或密林中。东南亚至澳大利亚亦有分布。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6602, '红心萝卜', NULL, '蔬菜类', '红心萝卜俗称冰糖萝卜，也叫“心里美萝卜”，因其外皮为浅绿色，内里为紫红色，且口感脆、口 味甜而得名。萝卜直根系，主根深60厘米--180厘米，主要根群分布在20厘米--45厘米的土层中。萝卜的肉质根是同化产物的贮藏器官，皮色有白、粉红、紫红、青绿等色；前苏联和法国还有黑皮萝卜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6603, '红菜头', NULL, '蔬菜类', '是根甜菜，是甜菜种的一个变种，能形成肥大肉质根的二年生草本植物。学名根甜菜，别名红菜头。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6604, '红葱头', NULL, '蔬菜类', '红葱头，原产地在巴勒斯坦，在十字军东征时传入欧洲，因此荷兰、法国、英国均为红葱头重要产地，红葱在亚洲也有栽培，红葱头也是中菜烹调中不可或缺的增加香气的食材之一，将红葱头切碎爆香后，即为「红葱头酥」，用以猪肉类的爆炒及羹汤中增加香气之用，也为煎蛋、包粽必备爆香食材。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6605, '白芦笋', NULL, '蔬菜类', '芦笋（Asparagus），别名石刁柏、龙须莱，属百合科。为多年生草本植物，具有特殊的营养和食疗功效。其含丰富的蛋白质、碳水化合物、多种维生素、多种氨基酸，比一般蔬菜高达五倍以上，被誉为“蔬菜之王”，成为“世界十大名菜”之一。且具有较高的药用价值。医学巨著《本草纲目》就对芦笋的药用价值作了详细阐述，并称之为“龙须草”，被列为上品之上，位置仅次于人参。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6606, '薤白', NULL, '蔬菜类', '薤白，别名小根蒜、山蒜、苦蒜、小么蒜、小根菜、小根菜、大脑瓜儿、野蒜、野葱、野蕌。拉丁文名Allium macrostemon Bunge.属百合科、葱属植物。李时珍说：\"其根煮食、糟藏、醋浸皆宜\"。根色白，作药用，名薤白。鳞茎近球状，鳞茎外皮带黑色，纸质或膜质，不破裂，但在标本上多因脱落而仅存白色的内皮。叶3-5枚，半圆柱状，或因背部纵棱发达而为三棱状半圆柱形，中空，上面具沟槽，子房近球状，腹缝线基部具有帘的凹陷蜜穴；花柱伸出花被外。花果期5-7月。除新疆、青海外，全国各省区均产。生于海拔1500米以下', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6607, '块根芹', NULL, '蔬菜类', '所谓根芹，即食用根部的芹菜。根芹别名根洋芹、球根塘蒿等，它有着膨大的根部。目前，主要分布在欧洲地区，我国近年来也有种植，但相对产量较少。根芹怎么看也不像芹菜，倒像一颗萝卜或者粉葛之类的东西。普通芹菜其叶柄部分，也就是我们通常食用的部分里是实心的，叶柄比较肥嫩，而根芹主要培育以及食用的是根部，它的叶柄是空心的，味道较苦，不太适合食用。因此，根芹在挑选时，根部越肥大的越好。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6608, '甜菜', NULL, '蔬菜类', '甜菜表面光滑，肉质通常呈深红色，也有白色的。甜菜的叶子可食用。较早食用甜菜的是古罗马人，他们食用的是红色和白色甜菜的根部。16世纪，英国人和德国人开始食用所谓的花园甜菜，而白色甜菜根则是给牲畜食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6609, '荔浦芋', NULL, '蔬菜类', '荔浦芋产于桂林地区的荔浦县。它个头大，营养丰富。把它切成薄片，油炸后夹在猪肉里做成“红烧扣肉”，风味特殊，肉不腻口，是宴会上的一道美肴。将它煮熟剥皮，放在热锅中，加上猪油、白糖、少量奶粉，压成奶芋，味道甘香软甜；掺和鱼、肉、鸡、冬笋、香菇等，用油轻炸，香酥爽口。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6610, '雷笋', NULL, '蔬菜类', '雷笋，学名雷竹笋，又名雷公笋、早园笋、雷笋，因早春打雷即出笋而得名，是春笋市场上最早上市的笋种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6611, '沙窝萝卜', NULL, '蔬菜类', '沙窝萝卜， 又称天津卫青萝卜，俗称\"赛鸭梨\"，是天津农业名牌产品。因原产于天津西青区辛口镇沙窝村及辛口镇其他村庄一带而得名，已有600多年种植历史。沙窝萝卜色翠绿，味甘甜，脆嫩多汁，一拍即裂，被民间形容为\"一摔掉八瓣\"，并且耐冬贮，素有“沙窝萝卜就热茶，气的大夫满街爬”之说，深得人们青睐。还是天津口岸独有的传统出口商品，远销日本、东南亚和港澳地区。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6612, '紫洋葱', NULL, '蔬菜类', '洋葱本身含有的微量元素硒，是很强的抗氧化剂，能够增强细胞的活力，延缓衰老。而紫色洋葱的表皮中还含有花青素，具有很好的抗衰老功能。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6613, '脆山药', NULL, '蔬菜类', '山药又称薯蓣、土薯、山薯蓣、怀山药、淮山、白山药，是《中华本草》收载的草药，药用来源为薯蓣科植物山药干燥根茎。冬季茎叶枯萎后采挖，切去根头，洗净，除去外皮及须根，用硫黄熏后干燥，也有选择肥大顺直的干燥山药，置清水中，浸至无干心，闷透，用硫黄熏后，切齐两端，用木板搓成圆柱状，晒干，打光，称“光山药”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6614, '大芋头', NULL, '蔬菜类', '荔浦芋产于桂林地区的荔浦县。它个头大，营养丰富。把它切成薄片，油炸后夹在猪肉里做成“红烧扣肉”，风味特殊，肉不腻口，是宴会上的一道美肴。\r\n芋头具有健脾、利湿、解毒、消痒的功效。能够合理运送营养物质，使皮肤润泽，同时提高机体的免疫力。荔浦芋又名槟榔芋作为广西的首选贡品在岁末进贡皇家大典。尤其是在清朝乾隆年间达到了极盛。又为2008年北京奥运会制定专用芋头。随着电视剧《宰相刘罗锅》的播出，荔浦芋头更是在全国家喻户晓。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6615, '小芋头', NULL, '蔬菜类', '芋头又称芋、芋艿，天南星科植物的地下球茎，形状、肉质因品种而异，通常食用的为小芋头。多年生块茎植物，常作一年生作物栽培。叶片盾形，叶柄长而肥大，绿色或紫红色；植株基部形成短缩茎，逐渐累积养分肥大成肉质球茎，称为“芋头”或“母芋”，球形、卵形、椭圆形或块状等。母芋每节都有一个脑芽，但以中下部节位的腋芽活动力最强，发生第一次分蘖，形成小的球茎称为“子芋”，再从子芋发生“孙芋”，在适宜条件下，可形成曾孙或玄孙芋等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6616, '蒟蒻', NULL, '蔬菜类', '蒟蒻（学名：Amorphophalms konjac），又称蒟蒻芋，俗称魔芋、雷公枪、菎蒟，中国古代又称妖芋，自古以来蒟蒻就有“去肠砂”之称， 日本又称菎蒻，又名蒻头（开宝本草）、鬼芋（图经本草）、花梗莲（江西新建）、虎掌（江西万年）、花伞把（江西定南）、蛇头根草（江西丰城）、花杆莲、麻芋子（陕西）、野磨芋、花杆南星、土南星（江西）、南星、天南星（广西河池）、花麻蛇（云南思茅），多年生宿根性块茎草本植物。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6617, '淮山', NULL, '蔬菜类', '淮山又名淮山药，是山药(学名：Dioscorea opposita)的成品名。为薯蓣科多年生草本植物薯蓣的块根，冬季采挖。生长于海拔350米至1,100米的地区，多生在山坡、山谷林下、路旁的灌丛中、溪边及杂草中。山药易栽培，最适宜在黄沙土生长，中国已有几百年的栽培山药历史。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6618, '萝卜干', NULL, '蔬菜类', '萝卜干，是指晒干的萝卜，是国内大众喜爱一种独具风味的易保存干蔬菜。富含维生素B，铁质含量除金针菜外高过其他食物。萝卜干在潮汕称菜脯，咸香脆口，消食开胃，与潮汕咸菜、鱼露并称潮汕三宝。上杭萝卜干色泽金黄，皮嫩肉脆，甘香味美，明初即享有盛名。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6619, '萝卜皮', NULL, '蔬菜类', '萝卜，一种常见蔬菜。萝卜又叫作莱菔、水萝卜，根肉质，长圆形、球形或圆锥形，原产于我国，品种繁多，有绿皮、红皮和白皮的。具有多种菜用和药用价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6620, '白洋葱', NULL, '蔬菜类', '一般按葱头外皮颜色，可分为紫洋葱和白洋葱，白洋葱即外皮为白色的洋葱。白洋葱肉质为白色，圆球形或扁圆球形，含水量大，肉质较粗，口感较脆，辛味较明显。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6621, '扁尖', NULL, '蔬菜类', '扁尖，又名扁尖笋、天目笋干，苏州话叫扁节，也有人叫他焙熄。上海、杭州、绍兴传统家常菜。是以竹的芽或嫩鞭为原料， 经盐水煮笋、炭火烘焙后制成的烹饪原料。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6622, '毛笋', NULL, '蔬菜类', '毛笋为禾本科植物毛竹等多种竹的幼苗，去竹箨可食部分。主要生长于湖南、湖北、江西、浙江等省。 竹的种类很多，毛竹是其中之一。它的地下茎称为“竹鞭”，粗壮横行于土中，鞭有节，节侧生芽即为竹笋。 笋体肥壮，呈圆筒状宝塔形，上尖下圆，中间有节；笋外壳的脉线和壳毛为黄色；笋肉色白或淡黄，质细嫩，味清鲜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6623, '山药片', NULL, '蔬菜类', '山药片是以新鲜山药为主要原料，经过晾晒加工后得到的干品是一种白色的片状物，它能当保健食材供人们食用也能入药，是一种能补脾健胃温补肾阳的中药材。山药片平时煲汤喝还能让人体吸收丰富营养，能提高身体素质也能提高人体健康水平。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6624, '蘑菇', NULL, '蔬菜类', '蘑菇（学名：Agaricus campestris）是由菌丝体和子实体两部分组成，菌丝体是营养器官，子实体是繁殖器官。由成熟的孢子萌发成菌丝。菌丝为多细胞有横隔，借顶端生长而伸长，白色、细长，绵毛状，逐渐成丝状。菌丝互相缀合形成密集的群体，称为菌丝体。菌丝体腐生后，浓褐色的培养料变成淡褐色。蘑菇的子实体在成熟时很象一把撑开的小伞。由菌盖、菌柄、菌褶、菌环、假菌根等部分组成。蘑菇有药食作用。也被用于各种人物代称和卡通形象。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6625, '草菇', NULL, '蔬菜类', '草菇为真菌植物门真菌草菇的子实体，属担子菌纲伞菌科。最早栽培于我国，已有二百多年的历史，草菇具有肉质脆嫩，味道鲜美，香味浓郁等特点，素有“放一片，香一锅”之美誉。草菇问世不久，就开始进贡皇家，充作御膳。据说慈禧太后对它“十二分的喜欢”。我国草菇的出口量较大，故国际上称之为“中国蘑菇”。草菇幼嫩时，形如鸟雀的卵，顶端略带黑褐色，向下颜色渐淡，基部白钯，这时菌盖、菌柄被外面一层薄膜包裹着，随着生长发育，顶端的薄膜被突破，露出菌柄，菌托。菌盖初期为伞形，完全展开后呈圆形，菌托肉质，淡褐色，没有菌环。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6626, '香菇', NULL, '蔬菜类', '香菇为真菌植物门真菌香蕈的子实体，属担子菌纲伞菌科，是世界上著名的食用菌之一。它含有一种特有的香味物质~香菇精，形成独特的菇香，所以称为“香菇”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6627, '平菇', NULL, '蔬菜类', '平菇是日常食用菌中最普通的一种，平菇菌盖为贝壳状或扇状，直径4～12厘米，幼时为青灰色或暗类色，后变成浅灰色或黄褐色，老时黄色；菌柄侧生或偏生，长1-3厘米，菌面平而薄，边缘不内卷，平展，菌褶粗疏。肉质较不老，嫩滑可口，有类似牡蛎的香味。平菇无论食素炒还是制成荤菜，都十分鲜嫩诱人，加之价钱便宜，是百姓餐桌上的佳品。平菇食用以鲜品为主，罐头和干制品很少食用。平菇以色白、白厚质嫩，味道鲜美者为佳。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6628, '金针菇', NULL, '蔬菜类', '金针菇为真菌植物门真菌冬菇的子实体，营养丰富，清香扑鼻。其菌盖小巧细腻，黄褐色或淡黄色，干部形似金针，故名金针菇。还有一种色泽白嫩的，叫银针菇。金针菇不仅味道鲜美，而且营养丰富，是拌凉菜和火锅食品的原粮之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6629, '口蘑', NULL, '蔬菜类', '口蘑是一种真菌类食用菜，它伞盖肥厚，清香适口，独具风味，被人们誉为“素中之肉”。口蘑的品种有白蘑、青腿子、马莲杆、杏香等，其中以白蘑最为名贵。新鲜的白蘑，菌盖洁白，褶细、盖大、肉厚、柄短，气味极清香。夏秋产蘑时节，一场细雨过后，十里之外就可以闻到蘑香。\r\n口蘑味道鲜美，口感细腻软滑，十分适口，既可炒食，又可焯水凉拌，且形状规整好看，是人们最喜爱的蘑菇之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6630, '黑木耳', NULL, '蔬菜类', '木耳是木耳科真菌状如耳朵，系寄生于枯木上的一种菌类，富含铁、钙、磷和维生素B1等。新鲜的木耳呈胶质片状，半透明，侧生在树木上，耳片直径5-10厘米，有弹性，腹面平滑下凹，边缘略上卷，背面凸起，并有极细的绒毛，呈黑褐色或茶褐色。干燥后收缩为角质状，硬而脆性，背面暗灰色或灰白色；入水后膨胀，可恢复原状，柔软而半透明，表面附有滑润的粘液。木耳质地柔软，味道鲜美，营养丰富，可素可荤，不但为菜肴大添风采，而且能养血驻颜，祛病延年。现代营养学家盛赞黑木耳为“素中之荤”，其营养价值可与动物性食物相媲美。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6631, '姬菇', NULL, '蔬菜类', '猪脊骨指猪的脊椎部位的骨头。脊骨中含有大量骨髓，烹煮时柔软多脂的骨髓就会释出。用于肾虚耳鸣、腰膝酸软、阳痿、遗精、烦热、贫血等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6632, '银耳', NULL, '蔬菜类', '银耳为真菌植物门真菌银耳的子实体，银耳是由许多薄而多皱褶的扁平形瓣片组成，一般呈菊花状或鸡冠状，直径5～10厘米，柔软洁白，半透明，富有弹性。银耳含有较多的胶质，能吸收大量水分，干燥后强烈收呈角质状，硬而脆，呈白色或米黄色，当它吸水后又能恢复原状。\r\n银耳同其他“山珍”一样，不仅是席上的珍品，而且在医学宝库中也是久负盛名的良药。质量上乘者称作雪耳。银耳中含丰富的胶质、多种维生素和17种氨基酸及肝糖。银耳中含有一种重要的有机磷，具有消除肌肉疲劳的功能。它被人们誉为“菌中之冠”，既是名贵的营养滋补佳品，又是扶', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6633, '猴头菇', NULL, '蔬菜类', '猴头菇与熊掌、海参、鱼翅同列“四大名菜”。菌肉鲜嫩，香醇可口，有“素中荤”之称。\r\n猴头菇的形状很特殊，它的子实体圆而厚，菌盖生有须刺，须刺向上，新鲜时白色，干后由浅黄至浅褐色，基部狭窄或略有短柄，上部膨大，直径3.5~10厘米，远远望去似金丝猴头，故称“猴头蘑”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6634, '竹荪', NULL, '蔬菜类', '竹笋，是竹的幼芽，也称为笋。竹为多年生常绿草本植物，食用部分为初生、嫩肥、短壮的芽或鞭。竹原产中国，类型众多，适应性强，分布极广。全世界共计有30个属550种，盛产于热带、亚热带和温带地区。中国是世界上产竹最多的国家之一，共有22个属、200多种，分布全国各地，以珠江流域和长江流域最多，秦岭以北雨量少、气温低，仅有少数矮小竹类生长。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6635, '白灵菇', NULL, '蔬菜类', '灵菇是一种食用和药用价值都很高的珍稀食用菌。其菇体色泽洁白、肉质细腻、味道鲜美。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6636, '白玉菇', NULL, '蔬菜类', '白玉菇属于伞菌目、口蘑科、白蘑属，是一种珍稀食用菌，被誉为食用菌中的“金枝玉叶”。通体洁白，晶莹剔透；在口感表现上更为优越，菇体脆嫩鲜滑，清甜可口，是极具品味的美味佳肴。时令：2-4月、10-12月，存储时间：1-2周。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6637, '金钱菇', NULL, '蔬菜类', '金钱菇是我国传统的山珍、香味独特、口味鲜美、口感细嫩，且营养丰富。是山珍之冠，被誉为“菜中之王”，“当代植物食品的顶峰”', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6638, '榛蘑', NULL, '蔬菜类', '榛蘑为真菌植物门真菌蜜环菌的子实体。是迄今为止为数不多的被人们所认知但仍然无法人工培育的野生菌类，堪称名副其实的“山珍”，被人们称为“东北第四宝”。榛蘑滑嫩爽口、味道鲜美、营养丰富，被一些发达国家列为一类食品。榛蘑呈伞形，淡土黄色，老后棕褐色。榛蘑7～8月生长在针阔叶树的干基部、代根、倒木及埋在土中的枝条上。一般多生在浅山区的榛柴岗上，故而得名“榛蘑”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6639, '灵芝', NULL, '蔬菜类', '多孔菌科植物赤芝或紫芝的全株。根据我国第一部药物专著《神农本草经》记载：灵芝有紫、赤、青、黄、白、黑六种，性味甘平。灵芝原产于亚洲东部，中国古代认为灵芝具有长生不老、起死回生的功效，视为仙草。灵芝主要分布在中国、朝鲜半岛和日本。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6640, '木耳', NULL, '蔬菜类', '黑木耳，色泽黑褐，质地柔软，味道鲜美，营养丰富，可素可荤，不但为中国菜肴大添风彩，而且有养血驻颜，祛病延年。现代营养学家盛赞黑木耳为“素中之荤”，其营养价值可与动物性食物相媲美。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6641, '滑子菇', NULL, '蔬菜类', '滑子菇又名珍珠菇、滑菇、光帽鳞伞，日本叫纳美菇。学名pholiota nameko。在植物学分类上属真菌门、担子菌亚门、担子菌纲、伞菌目、丝膜菌科、鳞伞属。属于珍稀品种，原产于日本，因它的表面附有一层粘液食用时滑润可口而得名，自七十年代中叶，始于辽宁省南部地区，现主产区为河北北部、辽宁、黑龙江等地。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6642, '蟹味菇', NULL, '蔬菜类', '蟹味菇味比平菇鲜，肉比滑菇厚，质比香菇韧，口感极佳，还具有独特的蟹香味，在日本有“香在松茸、味在玉蕈”之说。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6643, '杏鲍菇', NULL, '蔬菜类', '杏鲍菇，又名刺芹侧耳，是近年来开发栽培成功的集食用、药用、食疗于一体的珍稀食用菌新品种。\r\n杏鲍菇菌肉肥厚，质地脆嫩，特别是菌柄组织致密、结实、乳白，可全部食用，且菌柄比菌盖更脆滑、爽口，被称为“平菇王”、“干贝菇”，具有杏仁香味和如鲍鱼的口感，适合保鲜、加工，深得人们的喜爱。菌肉肥厚似鲍鱼，因而得名杏鲍菇。日本称为\"雪茸\"。杏鲍菇营养丰富，质地脆嫩，口感绝佳，风味独特，故有\"草原上的美味牛肝菌\"之美称。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6644, '竹笙', NULL, '蔬菜类', '竹笋菌，又名“竹笙”、“竹菌”、“竹松”、“竹萼”、“竹笋菌“等，是中国名贵山珍，形态怡丽，清香袭人。竹荪又称“真菌之花”、“植物鸡”等，名列“四珍”（竹荪、猴头、香菇、银耳）之首。竹荪以其身形俊美动人而闻名，其鲜品形态犹如一个穿纱裙的姑娘，堪称“雪裙仙子”。它具有延长汤羹等食品存放时间、保持菜肴鲜味不腐不馊的奇特功能，一向被帝王列为御膳，现在则是国宴中不可缺少的一味山珍。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6645, '元蘑', NULL, '蔬菜类', '元蘑是蘑菇中仅次于猴头蘑的上品蘑，营养成份是一般蔬菜的十几倍。较之野生元蘑，养植元蘑的营养价值当然是逊色的。而野生元蘑通常会有少量虫蛀的痕迹，中秋过后从野外采摘的元蘑相对而言虫蛀较少，营养价值很高。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6646, '红蘑', NULL, '蔬菜类', '红蘑，松树伞，学名血红铆钉菇，别名红蘑、松树钉。生于松树林中地上，与松树形成外生菌根，群生、散生或单生。此菌风味好、有“素肉” 之称，深受人们喜爱。因为是野生的，产量极少，价格相对贵。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6647, '鸡腿菇', NULL, '蔬菜类', '鸡腿蘑是毛头鬼伞的俗称，其形如鸡腿，口感滋味似鸡肉，被誉为“菌中新秀”。鸡腿蘑为真菌植物门真菌毛头鬼伞，子实体。鸡腿蘑菌柄粗壮色白，形象似鸡腿，肉质肥嫩，清香昧美又似鸡丝。在欧洲德、捷、荷等国大量栽培。鸡腿蘑含有丰富的蛋白质，碳水化合物，多种维生素，多种矿物质。由于鸡腿菇集营养、保健、食疗于一身，且色、香、味、形俱佳，炒食、炖食、煲汤均久煮不烂，滑嫩清香，因而备受人们青睐。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6648, '花菇', NULL, '蔬菜类', '花菇是菌中之星。花菇的顶面呈现淡黑色，菇纹开暴花，白色，菇底呈淡黄色。花菇因顶面有花纹而得名。天气越冷，花菇的产量越高，质量也越好，肉厚、细嫩、鲜美，食之有爽口感。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6649, '冬菇', NULL, '蔬菜类', '又名龙船香菇，盖因龙泉两字在龙泉土话里叫龙船，而庆元本来隶属龙泉管辖，后分县。景宁也未立县！唐末宋初在浙江已形成一定规模。龙泉、庆元、景宁等3个山区县是人工栽培冬菇的发祥地，至今每年仍有数万人在浙江或出省栽培冬菇，“龙”“庆”“景”三县素有“香菇之乡”的称号。冬菇规格严整，等级分明。分为花菇、厚菇、薄菇3等11级。冬菇含有丰富的蛋  冬菇\r\n白质和多种人体必需的微量元素。冬菇嫩滑香甜，干菇美味可口，香气横溢，烹、煮、炸、炒皆宜，荤素佐配均能成为佳肴。冬菇还是防治感冒、降低胆固醇、防治肝硬化和具有抗癌作用的', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6650, '干茶树菇', NULL, '蔬菜类', '柳松茸又名茶树菇、茶菇、油菜菇、茶树菇，隶属真菌门，担子菌亚门，层菌纲，伞菌目，粪绣伞科，田蘑属。春秋季野生于杨树、油茶等阔叶树的枯死或枯干部分。茶树菇营养价值极高，干菇的蛋白质含量为27.5%，总糖为54.4%，含人体所需的十七种氨基酸和十多种矿物质、微量元素与抗癌多糖，其外观诱人、肉质脆嫩、味道鲜美、香浓、口感佳。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6651, '干松茸', NULL, '蔬菜类', '松茸菌为真菌植物门真菌松茸菌，是名贵食用菌之一，享有盛名，被视为“食用菌之王”。松蘑的菌肉为白色，质细嫩，菌香郁浓，口感滑嫩，富有强性，是宴会上稀有佳肴。松茸菌营养丰富，还具有较高的药用价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6652, '茶树菇', NULL, '蔬菜类', '柳松茸又名茶树菇、茶菇、油菜菇、茶树菇，隶属真菌门，担子菌亚门，层菌纲，伞菌目，粪绣伞科，田蘑属。春秋季野生于杨树、油茶等阔叶树的枯死或枯干部分。茶树菇营养价值极高，干菇的蛋白质含量为27.5%，总糖为54.4%，含人体所需的十七种氨基酸和十多种矿物质、微量元素与抗癌多糖，其外观诱人、肉质脆嫩、味道鲜美、香浓、口感佳。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6653, '干香菇', NULL, '蔬菜类', '香菇为真菌植物门真菌香蕈的子实体，属担子菌纲伞菌科，是世界上著名的食用菌之一。它含有一种特有的香味物质-香菇精，形成独特的菇香，所以称为“香菇”。香菇菌盖伞形，直径3～6厘米，表现呈黄褐色或黑褐色，菌褶白色，菌柄黄色，并生有棉毛状的白色鳞片，干燥后不明显。香菇生长在冬季（立冬后至来年清明前）。主要产地在浙江、福建、江西、安徽等省的山林地带。由于营养丰富，香气沁脾，味道鲜美，素有“菇中之王”、“蘑菇皇后”、“蔬菜之冠”的美称。不但位列草菇、平菇之上，而且素有“植物皇后”之誉，为“山珍”之一。香菇味鲜而香，为', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6654, '牛肝菌', NULL, '蔬菜类', '牛肝菌类是牛肝菌科和松塔牛肝菌科等真菌的统称，其中除少数品种有毒或味苦而不能食用外，大部分品种均可食用。主要有白、黄、黑牛肝菌。白牛肝菌味道鲜美，营养丰富。该菌菌体较大，肉肥厚，柄粗壮，食味香甜可口，营养丰富，是一种世界性著名食用菌。云南省各族群众喜爱采集鲜菌烹调食用。西欧各国也有广泛食用白牛肝菌的习惯，除新鲜的作菜外，大部分切片干燥，加工成各种小包装，用来配制汤料或做成酱油浸膏，也有制成盐腌品食用。云南省从一九七三年起出口白牛肝菌，销往西欧，极受欢迎，供不应求。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6655, '海鲜菇', NULL, '蔬菜类', '海鲜菇又名玉蕈、斑玉蕈，真姬菇，质地脆嫩，味道鲜美，具有海蟹味，在日本称之为“蟹味菇”、“海鲜菇”。隶属于白蘑科、玉蕈属，子实体中等至较大。如今栽培的有浅灰色和纯白色两个品系，白色品系又称“白玉菇”、“玉龙菇”，多为工厂化栽培。菌盖直径3~15cm。夏末至秋季生阔叶树枯木及倒腐木上，丛生。是北温带一种优良的食用菌。是一种低热量、低脂肪的保健食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6656, '双孢菇', NULL, '蔬菜类', '别名：圆蘑菇，洋蘑菇、双孢蘑菇、白蘑菇。    存储时间：4-5天。    双孢菇属于担子菌亚门，伞菌目、伞菌科，蘑菇属。很多国家都有栽培，其中我国总产占第二位，蘑菇罐头在国际贸易量中占首位。有“植物肉”之称。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6657, '鸡枞', NULL, '蔬菜类', '鸡枞是一种美味山珍，称之为菌中之王，其肉肥硕壮实，质细丝白，味鲜甜脆嫩，清香可口，可与鸡肉媲美，故名鸡枞。它含有钙、磷、铁、蛋白质等多种营养成份。鸡枞吃法很多，生熟炒煮作煲汤皆宜，滋味均极鲜美。用鸡枞可以制作多种名菜，成为鸡枞宴席。鸡枞经过晾晒、盐渍或用植物油煎制而成为干鸡枞、腌鸡枞或油鸡枞，可以贮存较长时间，以备常年食用。鸡枞产季为每年的六至九月，多半生长在未受污染的红壤山林的半山坡上。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6658, '石耳', NULL, '蔬菜类', '石耳为地衣植物门植物，因其形似耳，并生长在悬崖峭壁阴湿石缝中而得名，体扁平，呈不规则圆形，上面褐色，背面被黑色绒毛。石耳含有高蛋白和多种微量元素，是营养价值较高的滋补食品，是一种稀有的名贵山珍。黄山的石耳被称“黄山三石”之一。我国南方、西南及陕南山区均产，为著名的“庐山三石”之一（另二石为石鸡、石鱼）。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6659, '羊肚菌', NULL, '蔬菜类', '羊肚菌是一种野生珍贵菌，由于它的菌盖表面凹凸不平，状如羊肚，故名羊肚菌。羊肚菌为马鞍菌科羊肚菌属珍稀的食、药两用真菌，早已被收录在李时珍的《本草纲目》书中。羊肚菌是一种很珍贵的天然补品，含丰富的蛋白质、多种维生素及20多种氨基酸，味道鲜美，营养丰富。它与冬虫夏草功能相同，是一种不含任何激素，无任何副作用的天然滋补品。羊肚菌春末至秋初生长于海拔2000～3000米左右的针叶阔叶林混交林中，在云南、四川、西藏、贵州有分布。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6660, '干巴菌', NULL, '蔬菜类', '干巴菌是云南省特有的珍稀野生食用菌。干巴菌是云南省特有的珍稀野生食用菌，中国其他省份及国外都无法生长。学名:绣球菌,也叫对花菌、马牙菌等。它生长在滇中及滇西的山林松树间。产于七八月雨季，至今仍未实现人工养殖。其貌不扬，黑黑的带有一层白色。但味道却鲜香无比，是野生食用菌中的上品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6661, '鸡土从', NULL, '蔬菜类', '由于绝大多数输入法无法打出“鸡土从”，所以多写为鸡枞。鸡土从，鸡肉丝菇、白蚁菇是一种由白蚂蚁栽培的食用菌，为我国著名的野生菌。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6662, '白牛肝菌', NULL, '蔬菜类', '白牛肝菌，学名美味牛肝菌（Boletus edulis）。主要别名有大脚菇、白牛头、黄乔巴、炒菌，也称大腿蘑、网纹牛肝菌，属于真菌类。美味牛肝菌的子实体为肉质，伞盖褐色，直径最大可达25厘米，1千克重，菌盖厚，下面有许多小孔，类似牛肝，可生食，也可制成干制品。白牛肝生长于云南松、高山松、麻栎、金皮栎、青风栎等针叶林和混交林地带，单生至群生。常与栎和松树的根形成菌根。产于6～10月，温暖地区稍出得早些，温凉、高寒地区出得晚一些。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6663, '双孢蘑菇', NULL, '蔬菜类', '双孢蘑菇又称白蘑菇、蘑菇、洋蘑菇，是世界性栽培和消费的菇类，可鲜销、罐藏、盐渍。双孢蘑菇的菌丝还作为制药的原料。中国双孢蘑菇栽培最多的有福建、山东、河南、浙江等省。栽培方式有菇房栽培、大棚架式栽培和大棚畦栽等。不同地区，不同气候条件和不同季节可采取适合自己的栽培方式。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6664, '松蘑', NULL, '蔬菜类', '松茸菌为真菌植物门真菌松茸菌，是名贵食用菌之一，享有盛名，被视为“食用菌之王”。松蘑的菌肉为白色，质细嫩，菌香郁浓，口感滑嫩，富有强性，是宴会上稀有佳肴。松茸菌营养丰富，还具有较高的药用价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6665, '鲍鱼菇', NULL, '蔬菜类', '鲍鱼菇又名“台湾平菇”，是一种在夏季高温季节生长的珍稀食用菌品种，该菌种肉质肥厚，脆嫩爽口，鲍鱼菇具有较高的食用价值和营养价值。由于传统的食用菌品种大部分不能夏季出菇，而鲍鱼菇却可有效改变夏季鲜菇淡季的状况。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6666, '珊瑚菇', NULL, '蔬菜类', '珊瑚菇，有名扫把菌、扫帚菌、扫帚蘑，是真菌门多孔菌目(Aphyllophorales)、珊瑚菌科(Clavariaceae )一种野生名贵食用菌、药用菌。 子实体呈珊瑚状、扫帚状，以形似扫把得名扫把菇、珊瑚菌，颜色艳丽，有红、黄、白等色，被称为野生菌之花、红扫把、金扫把。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6667, '草菇心', NULL, '蔬菜类', '草菇心为真菌植物门真菌草菇的子实体心，属担子菌纲伞菌科。最早栽培于我国，已有二百多年的历史，草菇具有肉质脆嫩，味道鲜美，香味浓郁等特点，素有“放一片，香一锅”之美誉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6668, '柳松菇', NULL, '蔬菜类', '柳松菇，味鲜美、质地脆嫩，含有丰富的蛋白质和氨基酸，是欧洲和东南亚地区最受欢迎的食用菇一 。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6669, '舞菇', NULL, '蔬菜类', '舞菇又称为舞茸，在我国因较早以“灰树花”之名收录于《中国的真菌》，所以国内习惯叫“灰树花”。原产于日本北部山区，味道佳口感好且有传承药效，自古以来备受推崇，其名也因为在深山找到它的人会兴奋得手舞足蹈而得名。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6670, '血红菇', NULL, '蔬菜类', '血红菇蕈为真菌植物门真菌大红菇(草质红菇)、真红菇(朱菰)的子实体。大红菇菌盖宽6到16厘米，扁半球形，后平展而中部下凹，湿时粘，干燥后深苋菜红色、鲜或暗紫红色。菌肉白色，味道柔和。真红菇菌盖宽5到12厘米，初扁球形后平展中部下凹，不粘，大红带紫。菌肉白色，味道柔和，无特殊气味。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6671, '地衣', NULL, '蔬菜类', '地衣是真菌和光合生物（绿藻或蓝细菌）之间稳定而又互利的共生联合体，真菌是主要成员，其形态及后代的繁殖均依靠真菌。也就是说地衣是一类专化性的特殊真菌。传统定义曾把地衣看作是真菌与藻类共生的特殊低等植物。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6672, '小草菇', NULL, '蔬菜类', '小草菇为真菌植物门真菌草菇的子实体，属担子菌纲伞菌科。最早栽培于我国，已有二百多年的历史，具有肉质脆嫩，味道鲜美，香味浓郁等特点，素有“放一片，香一锅”之美誉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6673, '大红菇', NULL, '蔬菜类', '大红菇亦有许多的同种异名，又有一称为鲜血红菇。它是属于红菇属的一种真菌，亦是一种色彩鲜艳的蕈类。其颜色多半呈现为亮血红色。广泛分布于北半球的温带地区，菌丝生长于软树木上。经常生长于松树属的树木构成的针叶林地，亦有可能生长于沙质土壤上。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6674, '牛眼睛菌', NULL, '蔬菜类', '真菌类生物，学名叫马勃，成熟的马勃一般比成人的拳头略小。另有一种巨型“蘑菇”状属灰孢，做中药，用于治疗咽痛、失音等症，外敷可止血，是一种珍贵的自然资源，具有极高的药用价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6675, '秀珍菇', NULL, '蔬菜类', '秀珍菇 （Pleurotus geesteranus ）又名袖珍菇、环柄侧耳、黄白侧耳、环柄斗菇、姬平菇和小平菇。它不同于普通的凤尾菇是因为其较小，柄有5～6厘米，盖直径小于3厘米。秀珍菇其实是凤尾菇的一个商业味比较浓厚的名称，是凤尾菇的未成熟子实体。\r\n秀珍菇不仅肉质脆嫩，纤维含量少，口感特佳，味道鲜美，而且营养丰富，其所含有的多醣体被验证具有抗肿瘤的功能，其子实体内又富含优质菌体蛋白和人体所需的17种氨基酸及多种微量元素，是一种营养价值极高的珍稀食用菌，有“菇中极品”的美誉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6676, '青头菌', NULL, '蔬菜类', '青头菌是群众喜爱的一种食用菌。青头菌主产于云南滇西＂三江并流＂区原始森林地带，生长环境极其纯净，主要生长在树林中的草丛里，每年六至九月出菇。菌内含有丰富的蛋白质、氨基酸、植物纤维等成份，入口细嫩，香味悠长，有浓郁的大自然清香气息。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6677, '珍珠菇', NULL, '蔬菜类', '珍珠菇多丛生球盖菇。大球盖菇叫又名皱环盖菇、皱球盖菇、酒红球盖菇，其子实体色泽艳丽、清香柔滑、脆嫩爽口，富含有益于人体健康的蛋白质及糖类、矿物元素、维生素等营养保健物质。它是国际菇类交易市场上的十大菇类之一。也是联合粮农组织(FAO)向发展中国家推荐栽培的食用菌之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6678, '黄蘑', NULL, '蔬菜类', '黄蘑又名：金顶侧耳、金顶蘑、金黄侧耳、榆黄蘑、玉皇蘑；属真菌界、真菌门、担子菌亚门，层菌纲，伞菌目，口蘑科，侧耳属下的菌类。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6679, '鸿喜菇', NULL, '蔬菜类', '鸿禧菇子实体单生、丛生或群生，子实体中等大至稍大。菌盖直径5-12cm，有时可达20cm，幼时半球形，后呈扁平至稍扁平，表面菱色、浅褐色、深褐色至深肉桂色，中部往往有深色鳞片，而边缘常有污白色毛状或絮状鳞片。菌肉白色，稍厚或厚，细密，具香味。幼时边缘内卷，有白色或黄白色的绒毛，随着生长而消失。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6680, '黑菌', NULL, '蔬菜类', '黑菌又名“块菌”、黑松露。是法餐中的又一经典美食代表。天然黑菌在烹饪界中有“黑钻石”之美称。法国天然黑菌的珍贵程度可是与黄金等价，即法国人常说的“一克黑菌一克金”，可见其珍贵和稀有。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6681, '灰树花', NULL, '蔬菜类', '是食、药兼用蕈菌，夏秋间常野生于栗树周围。子实体肉质，柄短呈珊瑚状分枝，重叠成丛，其外观，婀娜多姿、层叠似菊；其气味、清香四溢，沁人心脾；其肉质脆嫩爽口，百吃不厌；其营养具有很好的保健作用和很高的药用价值。近年来作为一种高级保健食品，风行日本、新加坡等市场。由于我国较早的权威专著《中国的真菌》的采用，灰树花便成为比较通用的汉语名称。灰树花具有松蕈样芳香，肉质柔嫩，味如鸡丝，脆似玉兰。据农业部质量检测中心分析河北省迁西人工栽培的灰树花，其营养和口味都胜过号称菇中之王的香菇，能烹调成多种美味佳肴。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6682, '地皮菜', NULL, '蔬菜类', '地皮菜： 又名地耳、地衣、地木耳、地皮菌、雷公菌、地软儿、地瓜皮等，是真菌和藻类的结合体，一般生长在阴暗潮湿的地方，暗黑色，有点象泡软的黑木耳。地皮菜富含蛋白质、多种维生素和磷、锌、钙等矿物质，以色列魏茨曼研究的科学家研究发现，地皮菜所含的一种成分可以抑制人大脑中的乙酰胆碱酯酶的活性，从而能对老年痴呆症产生疗效。地皮菜是一种美食，最适于做汤，别有风味，也可凉拌或炖烧，也是寒性食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6683, '荷仙菇', NULL, '蔬菜类', '荷仙菇，日文名ハナビラタケ，世界上最名贵的食药用菌之一，属于担子菌门、伞菌纲、多孔菌目、绣球菌科下的一种特殊物种（有严格的独立物种编号）。因其具有卓越抗癌、免疫调节、提高造血功能等功效，在日本具有“梦幻神奇之菇”之称。\r\n荷仙菇喜欢的是比阔叶树更远古的树种——落叶松。此树种分泌出的松脂比其他针叶树具有更强烈的松脂味，这味道对其他菌类来说有着致命的杀伤力，根本不敢靠近，而荷仙菇却对此甘之如殆。除此之外，荷仙菇选择扎根的落叶松，还必须是处于成长期活着的树木。劈开在根部生长有荷仙菇的针叶树中部树干，我们能清楚地', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6684, '荔枝菌', NULL, '蔬菜类', '荔枝菌，素有岭南菌王之称，每年农历五月初一开始到夏至时节、荔枝成熟结果之时段，但每年都是昙花一现，时间不长，最多一个月左右。荔枝菌在荔枝林潮湿的白蚁窝上，经过高温多雨、骤出太阳骤降大雨的催谷，迅速生长起来。这趟摘完了，只要不毁坏白蚁窝，没过几天又长了出来。荔枝菌一般在午夜生长，略呈纺纱缍形状，长达10-20厘米，菌尖似一把收紧的小雨伞，味道极之清鲜、爽口。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6685, '姬松茸', NULL, '蔬菜类', '姬松茸别名小松菇、柏氏蘑菇、巴西蘑菇、松茹、松口蘑、老鹰菌、松伞菌等。主要野生于吉林和黑龙江赤松林地中。另外，云南、贵州、广西、四川、西藏、安徽等地的山区松林、阔叶树混交林地亦有少量分布。它是一种夏秋生长的腐生菌，生活在高温、多湿、通风的环境中，具杏仁香味，口感脆嫩。姬松茸菌盖嫩，菌柄脆，口感极好，味纯鲜香，食用价值颇高。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6686, '虫草花', NULL, '蔬菜类', '“虫草花”并非花，实质上是蛹虫草子实体，而不是虫草子实体，也不是冬虫夏草子实体。培养基是仿造天然虫子所含的各种养分，包括谷物类、豆类、蛋奶类等，属于一种真菌类。与常见的香菇、平菇等食用菌很相似，只是菌种、生长环境和生长条件不同。 为了跟冬虫草区别开来，商家起了一个美丽的名字，把它叫做“虫草花”，虫草花外观上最大的特点是没有了“虫体”，而只有橙色或者黄色的“草”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6687, '榆黄菇', NULL, '蔬菜类', '榆黄菇（拉丁名Pleurotus citrinopileatus）又名金顶侧耳、玉皇蘑、金顶蘑；为伞菌目、侧耳科、金顶侧耳属。是木腐性食用菌。分布于黑龙江、吉林、辽宁、河北、广东等地。野生金顶侧耳以东北地区较多。秋季生于榆、栎等阔叶树的倒木、枯立木上。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6688, '松茸', NULL, '蔬菜类', '松茸，学名松口蘑，别名松蕈、合菌、台菌，是世界上珍稀名贵的天然药用菌、我国二级濒危保护物种。我国主要产茸区有香格里拉产茸区、楚雄产茸区和延边产茸区等地区，其中香格里拉产茸区占全国总产量的70%，是连续30年的松茸出口冠军。松茸含有18种氨基酸、14种人体必需微量元素、49种活性营养物质、5种不饱和脂肪酸、8种维生素、2种糖蛋白、丰富的膳食纤维和多种活性酶，另含有3种珍贵的活性物质，分别是双链松茸多糖、松茸多肽和全世界独一无二的抗癌物质——松茸醇，是世界上最珍贵的天然药用菌类。松茸不仅营养均衡、充足，而且还', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6689, '真姬菇', NULL, '蔬菜类', '真姬菇（Hypsizygus marmoreus (Peck) H.E.Bigelow）又名玉蕈、斑玉蕈，属担子菌亚门、层菌纲、伞菌目、白蘑科、玉蕈属，外形美观，质地脆嫩，味道鲜鲜，具有海蟹味，在日本称之为“蟹味菇”、“海鲜菇”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6690, '干滑子菇', NULL, '蔬菜类', '滑子菇又名珍珠菇、滑菇、光帽鳞伞，日本叫纳美菇。干滑子菇为滑子菇的晒干制品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6691, '菜花', NULL, '蔬菜类', '花椰菜（学名：Brassica oleracea L. var. botrytis L.），又称花菜、菜花、椰菜花，是一种蔬菜。花椰菜，西兰花（青花菜）和结球甘蓝同为甘蓝的变种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6692, '西兰花', NULL, '蔬菜类', '花椰菜（学名：Brassica oleracea L. var. botrytis L.），又称花菜、菜花、椰菜花，是一种蔬菜。花椰菜，西兰花（青花菜）和结球甘蓝同为甘蓝的变种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6693, '黄花菜', NULL, '蔬菜类', '又名金针花、金针菜、忘忧、宜男、金菜、南菜、萱草。黄花菜是人们喜吃的一种传统蔬菜。因其花瓣肥厚，色泽金黄，香味浓郁，食之清香、鲜嫩，爽滑同木耳、草菇，营养价值高，被视作“席上珍品”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6694, '百合', NULL, '蔬菜类', '百合的主要应用价值在于观赏，其球根含丰富淀粉质，部分品种可作为蔬菜食用，中医认为百合性微寒平，具有清火、润肺、安神的功效，其花、鳞状茎均可入药，是一种药食兼用的花卉。另外，百合还可制作成百合干、百合粉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6695, '香椿', NULL, '蔬菜类', '香椿被称为“树上蔬菜”，是香椿树的嫩芽。每年春季谷雨前后，香椿发的嫩芽可做成各种菜肴。它不仅营养丰富，且具有较高的药用价值。\r\n香椿叶厚芽嫩，绿叶红边，犹如玛瑙、翡翠，香味浓郁，营养之丰富远高于其他蔬菜，为宴宾之名贵佳肴。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6696, '菊花', NULL, '蔬菜类', '菊花茶是指我国十大名花之一菊花，全国各地几乎随处可见。菊花的品种多姿。有时也在白菊花中加些茶叶，起到调味的作用。 产地湖北大别山麻城福田河的福白菊，浙江桐乡的杭白菊和黄山脚下的黄山贡菊(徽州贡菊)比较有名。 产于安徽亳州的亳菊、滁州的滁菊、四川中江的川菊、浙江德清的德菊、河南济源的怀菊花（四大怀药之一）都有很高的药效。特别是黄山贡菊，它生长在高山云雾之中，采黄山之灵气，汲皖南山水之精华，它的无污染性对现代人来说，具有更高的饮用价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6697, '玫瑰花', NULL, '蔬菜类', '玫瑰属于蔷薇科，原名徘徊花，它有甜美的香气，是食品、化妆品中香气的主要添加剂，也是红茶窨花的主要原料。玫瑰窨制花茶，早在明代《茶道》中就有详细的记载。而且饮食中使用玫瑰花的记载，则早在宋代时期，那时中国民间就有用糖腌渍玫瑰花瓣而制成的“玫瑰花酱”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6698, '桂花', NULL, '蔬菜类', '桂花是一种具有观赀陛和药用价值的花，以桂花做原料制作的桂花茶是中国特产茶，370它香气柔和、味道可口，为大众所喜爱。桂花茶同时是一种名贵的中成药，以芳香著称于世。在武夷山地区以北的浦县，浦城百姓总会以清香四溢的桂花茶款待客人。如果是在农历正月，桂花茶就更有祈祝新春吉利的意义了。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6699, '花菜', NULL, '蔬菜类', '菜花，又叫花椰菜，它们是由十字花科甘蓝演化而来，菜花原产于地中海东部海岸，约在19世纪初清光绪年间引进中国。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6700, '萝卜苗', NULL, '蔬菜类', '萝卜苗所含热量较少，纤维素较多，吃后易产生饱胀感，这些都有助于减肥。萝卜苗能诱导人体自身产生干扰素，增加机体免疫力，并能抑制癌细胞的生长，对防癌、抗癌有重要作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6701, '豌豆尖', NULL, '蔬菜类', '豌豆尖，豌豆尖是豌豆枝蔓的尖端而得名，是有土栽培，是即可采摘豆尖也可收获豆荚的植物。播种30天后可采摘豆尖。在我国四川、云南、湖北、广东、上海等地栽培最多。豌豆尖茎叶柔嫩，味美可口，是一种质优、营养丰富、食用安全、速生无污染的高档绿色蔬菜，深受消费者和宾馆酒家的青睐。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6702, '莼菜', NULL, '蔬菜类', '莼菜为睡莲科植物药菜的嫩茎叶，多年生宿根水生草本植物，鲜美滑嫩，为珍贵蔬菜之一。\r\n莼菜原产于中国，现分布于亚洲东部、南部、非洲、大洋洲及北美洲各国。\r\n我国主产于浙江、江苏两省太湖流域，4月下旬至10月下旬采摘带有卷叶的嫩稍，以西湖莼菜最为著名。\r\n莼菜自古被视为珍贵蔬菜，口感肥美滑嫩，富含氨基酸、阿拉伯糖、甘露糖、维生素等招牌营养素，深得人们喜爱。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6703, '菜心', NULL, '蔬菜类', '菜心起源于中国南部，是由白菜易抽薹材料经长期选择和栽培驯化而来，并形成了不同的类型和品种。主要分布在广东、广西、台湾、香港、澳门等地。20世纪后叶日本引种成功。 菜心是中国广东的特产蔬菜，品质柔嫩、风味可口，并能周年栽培，故而在广东、广西等地为大路性蔬菜，周年运销香港、澳门等地，成为出口的主要蔬菜。还有少量的远销欧美，视为名贵蔬菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6704, '韭菜花', NULL, '蔬菜类', '韭花又名韭菜花，是秋天里韭白上生出的白色花簇，多在欲开未开时采摘，磨碎后腌制成酱食用，农家多称之为“韭菜花”。韭菜花是中国南北城乡普遍食用的一种佐料。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6705, '槐花', NULL, '蔬菜类', '广义的槐花指豆科植物槐的花及花蕾，但一般将开放的花朵称为“槐花”，也称“槐蕊”，花蕾则称为“槐米”。槐落叶乔木，常植于屋边、路边，全国各地普遍栽培。一般在每年4-5月开花，花期一般为10-15天左右。槐花具有良好的观赏价值，每到盛夏花期来临时，一串串洁白的槐花缀满树枝，空气中弥漫着淡淡的素雅的清香，沁人心脾。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6706, '金银花', NULL, '蔬菜类', '金银花，别名忍冬、金银藤、银藤、二色花藤、二宝藤、右转藤、子风藤、鸳鸯藤。由于花初开为白色，后转为黄色，因此得名金银花。金银花自古被誉为清热解毒的良药。它性甘寒气芳香，甘寒清热而不伤胃，芳香透达又可祛邪。金银花既能宣散风热，还善清解血毒，用于各种热性病，如身热、发疹、发斑、热毒疮痈、咽喉肿痛等证，均效果显著。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6707, '茉莉花', NULL, '蔬菜类', '茉莉花，别名茉莉，香魂，莫利花，没丽，没利。茉莉，为木樨科素馨属常绿灌木或藤本植物的统称，原产于印度、巴基斯坦，中国早已引种，并广泛地种植。茉莉喜温暖湿润和阳光充足环境，其叶色翠绿，花朵颜色洁白，香气浓郁，是最常见的芳香性盆栽花木。在素馨属中，最著名的一种是双瓣茉莉，也就是人们平常俗称的茉莉花。茉莉有着良好的保健和美容功效，可以用来饮食，可用于茉莉花茶的制作。行气开部。茉莉花所含的挥发油性物质，具有行气止痛，解郁散结的作用，可缓解胸腹胀痛，下痢里急后重等病状，为止痛之食疗佳品。抗菌消炎。茉莉花对多种细菌有', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6708, '洋甘菊', NULL, '蔬菜类', '洋甘菊是菊科植物，原产欧洲。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6709, '剑花', NULL, '蔬菜类', '剑花异名量天尺花、霸王花、昙花、七星剑花、龙骨花、霸王鞭。世界上单朵最大的花，每朵花开5瓣，直径1.5米，重9公斤左右。花期从6月到11月，每年可开7—8期。剑花属于药食两用食物。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6710, '韭苔', NULL, '蔬菜类', '韭为多年生草本植物，叶细长而扁，丛生。在全国广泛栽培，亦有野生植株。此外，韭还是浙江省宁波市鄞州区章水镇蜜岩村古应国建筑风格建筑“韭房”的简称。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6711, '白沙蒿', NULL, '蔬菜类', '白沙蒿是我国西北、华北、东北荒漠半荒漠地区的特有植物，分布面积达3.75亿亩。白沙蒿大面积种植用于防风固沙治理沙漠已历时30多年。此外白沙蒿还可以作为食用蔬菜，有药用价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6712, '碱蓬', NULL, '蔬菜类', '碱蓬(Suaeda heteroptera Kitog)是一年生藜科植物，营养丰富，是一种优质蔬菜和油料作物。碱蓬的嫩茎叶既可鲜食，又可制干，便于贮藏和运输，因此碱蓬的菜用开发具有较好的前景', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6713, '白花菜', NULL, '蔬菜类', '别名：羊角菜（江苏、福建），五梅草（福建），臭花菜（河南、广东），猪屎草（山东），五梅草、白花仔草，一年生草本，有恶臭。全球热带与亚热带都有分布，是低海拔村边、道旁、荒地或田野间常见杂草及药用植物，有杀头虱、家畜及植物寄生虫之效。临床应用广泛，能疗头痛，有抗痉挛作用，并为产科临床用药。广泛分布于中国大部地区，但分布于湖北安陆一带白花菜最为有名。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6714, '白凤菜', NULL, '蔬菜类', '白凤菜是一种特产台湾的菊科，多年生草本植物，近葶状，高25—50厘米，茎圆柱形下部平卧，上部直立，干时有条棱，被短糙毛。具有药用和食用价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6715, '山菜', NULL, '蔬菜类', '东风菜又名山蛤芦、钻山狗、白云草、疙瘩药、草三七，多年生草本，茎直立，圆形，基部光滑，上部渐有毛，嫩枝顶端毛较密，。叶互生；基部叶心脏形，先端尖，边缘具锯齿或复锯齿，叶柄较短。头状花序集成疏松的伞房状；总苞半圆形，苞片数列，中央管状花，黄色，两性，瘦果长椭圆形，冠毛棕黄色，长短不等。花期秋季。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6716, '水葫芦', NULL, '蔬菜类', '水葫芦，中药材名。本品为雨久花科植物凤眼蓝的全草或根。夏、秋采，晒干或鲜用。功能主治为：清凉解毒，除湿，祛风热。外敷热疮。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6717, '水田芹', NULL, '蔬菜类', '田芥(Watercress)，学名Nasturtium officinale，又名水瓮菜，属十字花科类常绿植物，是中空茎的水生植物，生长在寒冷的水中，可发现于流水、河流及池塘中，呈蔓藤式延伸成长，在蔓上的叶子为圆形，羽状复叶为绿褐色，较小的嫩叶呈卵形或椭圆形，嫩叶及茎可供食用，茎顶会开白色的花。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6718, '白菜薹', NULL, '蔬菜类', '白菜苔是大白菜在春季时节从菜芯里抽出的苔，掐苔的尖部食用。菜薹的色泽翠绿，鲜嫩可口，功效和大白菜相同，春季养生必吃多吃各种绿色蔬菜。是秋冬期间的重要蔬菜品种之一，全国各地均有栽培，尤其湖南、湖北、安徽、江苏、浙江、江西等地面积较大。白菜苔属十字花科，一般秋季播种，初冬上市，以嫩苔供食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6719, '康乃馨', NULL, '蔬菜类', '形态 一年或多年生丛生草本。茎质坚硬，灰绿色，节膨大。叶厚线形，对生。花大，具芳香，单生或成聚伞花序；萼下有菱状卵形小苞片四枚，先端短尖，长约萼筒四分之一萼筒绿色，五裂；花瓣不规则，边缘有齿，单瓣或重瓣，有红色、粉色、黄色、白色等色。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6720, '碧玉笋', NULL, '蔬菜类', '碧玉笋为金针母株割取后经遮光处理长出幼嫩茎叶部分之园产品。 由于生产方式类似韭黄，因此有人将其称为萱黄，有些农民因其经遮光处理长出颜色白嫩之茎叶而称其为白玉笋，另外一种未经遮光处理颜色翠绿者则称为碧玉笋。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6721, '芭蕉花', NULL, '蔬菜类', '芭蕉花为芭蕉科植物芭蕉的花蕾或花。分布我国台湾，味甘淡、微辛，性凉;具有化痰软坚，平肝，和瘀，通经的功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6722, '桑叶', NULL, '蔬菜类', '桑叶是桑科植物桑的干燥叶，又名家桑、荆桑、桑椹树、黄桑等，全国大部分地区多有生产，具有降血压、血脂、抗炎等作用', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6723, '罗勒', NULL, '蔬菜类', '罗勒又名兰香，是一个庞大的家族。目前已上市的品种有甜罗勒、圣罗勒、紫罗勒、绿罗勒、密生罗勒、矮生紫罗勒、柠檬罗勒等。 罗勒高度60-70厘米，平滑或基本上平滑的直立一年生草本植物。全草有强烈的香味，茎呈纯四棱形，植株绿色，有时紫色。叶对生卵形，长2.5-7.5厘米，全缘或略有锯齿，叶柄长，下面灰绿色，暗色的...', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6724, '败酱草', NULL, '蔬菜类', '败酱草，地方上称苦益菜，草本植物，多生长于山坡草地等地方，味辛、苦，有清热解毒，祛瘀排脓等功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6725, '食用大黄', NULL, '蔬菜类', '食用大黄(R. rhaponticum,一种耐寒的多年生植物，栽培食用其肥硕肉质叶柄)。食用大黄最适应生长于寒温带地区。叶柄味酸，常和草莓一起用来做馅，或用在水果羹和蜜饯中，也用制甜酒和开胃酒。根耐寒力强，而地上部分秋霜後即冻死。叶含有毒物质，仅在喜马拉雅某些地区，人们烹食野生种的叶。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6726, '苏子叶', NULL, '蔬菜类', '苏子叶为一年生直立草本，高常1米余;茎绿色或紫色，方柱形，有4钝棱，被长柔毛。叶对生，草质.阔卵形或近圆形.长7～13厘米，宽4.5～10厘米，顶端短尖或骤尖，基部阔楔尖至圆，边缘有撕裂状粗锯齿，两面紫色.或仅下面紫色，上面紫绿色，被疏柔毛，下面被伏贴柔毛;叶柄长3～5厘米。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6727, '柳兰', NULL, '蔬菜类', '柳兰(学名：Epilobium angustifolium Linn.)是桃金娘目柳叶菜科多年生草本植物，高约1—1.3厘米。茎直立，通常不分枝。叶互生，披针形，总状花序顶生，伸长，花序轴被短柔毛，苞片线形，长1—2厘米，花大，两性，红紫色。根、茎、叶、花、果均含鞣质，可作栲胶原料。根状茎或全草入药，有小毒，能调经活血、消肿止痛...越优。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6728, '白花椰菜', NULL, '蔬菜类', '白花椰菜又称花菜、菜花或椰菜花，是一种十字花科的蔬菜，为甘蓝的变种。花椰菜的头部为白色花序，与西兰花的头部类似。花椰菜富含维生素B群、C群。这些成分属于水溶性，易受热溶出而流失，所以煮花椰菜不宜高温烹调，也不适合水煮。原地中海沿岸，其产品器官为洁白、短缩、肥嫩的花蕾、花枝、花轴等聚合而成的花球，是一种粗纤维含量少，品质鲜嫩，营养丰富，风味鲜美，人们喜食的蔬菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6729, '刺儿菜', NULL, '蔬菜类', '刺儿菜是小蓟草的别称。是一种优质野菜。多年生草本，地下部分常大于地上部分，有长根茎。茎直立，幼茎被白色蛛丝状毛，有棱，高30-80(100-120)厘米，基部直径3-5毫米。有时可达1厘米，上部有分枝，花序分枝无毛或有薄绒毛。叶互生，基生叶花时凋落，下部和中部叶椭圆形或椭圆状披针形，长7—10厘米，宽1.5—2.2厘米，表面绿色，背面淡绿色，两面有疏密不等的白色蛛丝状毛，顶端短尖或钝，基部窄狭或钝圆，近全缘或有疏锯齿，无叶柄。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6730, '兰花', NULL, '蔬菜类', '兰花为多年生草本，单子叶植物。根长筒状。叶自茎部簇生，线状披针形，稍具革质，2至3片成一束。兰花是中国传统名花，是一种以香著称的花卉。兰花以它特有的叶、花、香独具四清(气清、色清、神清、韵清)，具高洁、清雅的特点。古今名人对它品价极高，被喻为花中君子。在古代文人中常把诗文之美喻为“兰章”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6731, '洛神花', NULL, '蔬菜类', '洛神花又名玫瑰茄、洛神葵、山茄等，是锦葵科木槿属的一年生草本植物，广布于热带和亚热带地区，原产于西非、印度，目前在我国的广东、广西、福建、云南、台湾等地均有栽培。植株高1.5～2米，茎淡紫色，直立，主干多分枝。叶互生。花在夏秋间开放，花期长，花萼杯状，紫红色，花冠黄色。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6732, '莲蕉', NULL, '蔬菜类', '莲蕉为多年生草本，高约一至二公尺左右，茎圆柱形，节上生叶，叶互生，长椭圆形，总状花序，顶生各种颜色花，以花色分为红花昙华、黄花昙华、白花昙华等三种，蒴果白绿色，成熟后变为黑褐色，整株可以入药。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6733, '豌豆苗', NULL, '蔬菜类', '豌豆苗为豆科植物豌豆的嫩苗。豌豆苗的供食部位是嫩梢和嫩叶，营养丰富，含有多种人体必需的氨基酸。其味清香、质柔嫩、滑润适口，色、香、味俱佳。营养价值高和绿色无公害，而且吃起来清香滑嫩，味道鲜美独特。用来热炒、做汤、涮锅都不失为餐桌上的上乘蔬菜，倍受广大消费者的青睐。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6734, '独行菜', NULL, '蔬菜类', '一年生或二年生草本，高5～30厘米：茎直立或斜升，多分枝，被微小头状毛。基生叶莲座状，平铺地面，羽状浅裂或深裂，叶片狭匙形；茎生叶狭披针形至条形，有疏齿或全缘：总状花序顶生；花小，不明显；花梗丝状，被棒状毛；萼片舟状，呈椭圆形，无毛或被柔毛，具膜质边缘；花瓣极小，匙形，白色。短角果近圆形，种子椭圆形，棕红色，平滑。主产河北、辽宁、内蒙古等地。嫩叶作野菜食用；全草及种子供药用，有利尿、止咳、化痰功效；种子作葶苈子用，可作药用，亦称事苗子；亦可榨油。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6735, '小葱', NULL, '蔬菜类', '小葱别名：香葱、绵葱、火葱、四季葱、细米葱.葱属百合科，是多年生草本植物葱的茎与叶，上部为青色葱叶，下部为白色葱白。原产于西伯利亚，我国栽培历史悠久，分布广泛，而以山东、河北、河南等省为重要产地', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6736, '梅花', NULL, '蔬菜类', '梅花，多义词。本意指梅树的花，寒冬先叶开放，花瓣五片，有粉红、白、红等颜色。梅花花色洁白，香味极浓，有“花中君子”的美称。梅花不仅具有观赏性，而且还有很高的药用价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6737, '苜蓿芽', NULL, '蔬菜类', '苜蓿芽是一种低热量且营养丰富的天然碱性食物，碱性度高达61.5，可帮助荤食者中和体内血液之酸性。苜蓿芽所含蛋白质是小麦的1.5倍。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6738, '香蜂草', NULL, '蔬菜类', '香蜂草，这是一种十分耐寒的植物，即使在零度以下的低温，依然绿油油的一片。它很受蜜蜂喜欢，浅绿色的叶子十分漂亮，揉一揉会闻到一股柠檬的香味。如柠檬般清香，可去除头痛、腹痛、牙痛。并有助于治疗支气管炎以及消化系统疾病。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6739, '香蒲', NULL, '蔬菜类', '香蒲为为多年生落叶、宿根性挺水型的单子叶植物。又名蒲草、蒲菜。因其穗状花序呈蜡烛状，故又称水烛。茎极短且不明显。走茎发达，不分歧或偶尔分歧，不呈肥大状，外皮殆为淡黄褐色，前端可以不断地分化出不定芽株。喜温暖、光照充足的环境，生于池塘、河滩、渠旁、潮湿多水处。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6740, '雪菜', NULL, '蔬菜类', '雪菜，又叫雪里蕻，是我国长江流域普遍栽培的冬春两季重要蔬菜，以叶柄和叶片食用，营养价值很高。有新鲜和腌制品之分，新鲜雪菜是翠绿色的，口感略涩微辣，常用来炒肉末;经盐腌渍的雪菜质脆味鲜，口感爽脆，略带酸味。雪菜具有利尿止泻，祛风散血，消肿止痛的作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6741, '油菜薹', NULL, '蔬菜类', '油菜薹滑嫩、清香，口感可与红菜薹媲美，且因油菜不长虫无需打农药，堪称健康食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6742, '油菜花', NULL, '蔬菜类', '十字花科属双子叶植物纲。一年或多年生草本。基生叶旋叠状，茎生叶，一般是互生，没有托叶。花两性，辐射对称，花瓣4枚，呈十字形排列，雄蕊通常6枚，4长2短，通常称为“四强雄蕊”，雌蕊由二心皮构成，子房位置靠上。茎圆柱形，多分枝;叶互生，叶大，浓绿色，无叶柄及托叶。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6743, '青金针花', NULL, '蔬菜类', '属百合科，多年生草本植物，又名金针花、黄花草、七星菜、安神菜。主要分布于湖南祁东县、河南、陕西、山西、浙江等地以及东北东部地区，喜生于干燥的山坡、荒地、干草甸子、田边路旁。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6744, '野韭菜', NULL, '蔬菜类', '野韭菜为百合科植物野韭菜AlliumjaponicurnRegel 的嫩叶，又名山韭。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6745, '野葱', NULL, '蔬菜类', '野葱为百合科植物野葱的全株，我国栽培历史悠久，分布广泛，而以山东、河北、河南等省为重要产地。 根据葱白的长短又分为两个类型。大葱植株高大，葱白洁白而味甜，在北方栽培较多。葱是日常厨房里的必备之物，北方以大葱为主，它不仅可作调味之品，而且能防治疫病，可谓佳蔬良药。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6746, '栀子花', NULL, '蔬菜类', '栀子花又名栀子，黄栀子，原产中国。喜温暖湿润和阳光充足环境，较耐寒，耐半阴，怕积水，要求疏松、肥沃和酸性的沙壤土。属茜草科、栀子属。常绿灌木。小枝绿色，叶对生，革质呈长椭圆形，有光泽。花腋生，有短梗，肉质。果实卵状至长椭圆状，有5-9条翅状直棱，1室;种子很多，嵌生于肉质胎座上。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6747, '珍珠花菜', NULL, '蔬菜类', '珍珠花菜(鸭脚艾) 为菊科植物白花嵩的全草。生于路边，山坡草地较潮湿地方或人工栽种，分布于我国南方大部分省区。 性味 味辛、苦、甘、淡，性寒', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6748, '紫萼香茶菜', NULL, '蔬菜类', '多年生草本，别名：山苏子、香茶菜、回花菜、铁棱角。高0.6—1（1.8）米；根木质，粗大，疙瘩状。茎多数，自根茎生出，粗壮，钝四棱形，被疏柔毛。花期7—8月，果期8—9月。主要分布于我国的西南、华南及华东地区。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6749, '大巢菜', NULL, '蔬菜类', '大巢菜，正名为：大野豌豆。根长20～40厘米，根幅20～25厘米，有根瘤。茎柔嫩有条棱，向上或半攀缘状，长60～200厘米。偶数羽状复叶，小叶6～10对，呈矩形匍匐或倒卵圆形；叶轴顶端有分枝的卷须，缠于他物上。托叶半箭形或戟形。蝶形花1～2朵，紫红、粉红或白色，花梗极短或无。花柱背面顶端有茸毛。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6750, '有机菜花', NULL, '蔬菜类', '所谓有机菜花并不是菜花品种，而是对蔬菜种植环境的要求，不是说长得蓬松的就是有机菜花，紧凑的就不是，而是只要种植环境能达到有机标准，都可以称为有机菜花。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6751, '宝塔菜花', NULL, '蔬菜类', '宝塔菜花起源于地中海北部，适宜于温和湿润气候，植株营养生长的适宜温度为20-28℃，转入生殖生长而结球的温度以18-22℃为宜；株形开展，叶片宽大肥厚有腊粉，耐寒性好，抗病性强，适应性广，易栽培。食用部分的结构为分形体（一个粗糙或零碎的几何形状，可以分成数个部分，且每一部分都（至少近似地）是整体缩小后的形状），具有自相似性质。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6752, '紫菜花', NULL, '蔬菜类', '紫菜花形态特征、生长习性和普通的白花菜（甘蓝）基本相似，属十字花科芸苔属甘蓝种，1-2年生草本植物。长势强健，耐热性和抗寒性都较强。植株高大，根据不同品种叶片生长20片左右抽出花茎，顶端群生花蕾。紧密群集成花球状，形状为半球型，花蕾青绿色，故称青花菜。叶色蓝绿互生，逐渐转为深蓝绿，蜡脂层增厚。叶柄狭长。叶形有阔叶和长叶两种。根茎粗大表皮薄，中间髓腔含水量大、鲜嫩，根系发达。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6753, '快菜', NULL, '蔬菜类', '快菜形像小白菜但比小白菜稍大，尤其像小一号的大白菜。其实，快菜我们完全可以归纳为——早熟的大白菜。其具有生育期60天，白帮、直筒合抱、叶色浅绿的特征与特性。高36厘米，球径12厘米左右，外叶8～9片，最大叶片40×30厘米左右。我国南北各地均可种植。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6754, '绿叶生菜', NULL, '蔬菜类', '生菜按叶片的色泽区分有绿生菜、紫生菜两种。如按叶的生长状态区分，则有散叶生菜、结球生菜两种。日前生菜已成为我国发展较快的绿叶生菜。生菜的主要食用方法是生食，为西餐蔬菜色拉的当家菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6755, '散叶生菜', NULL, '蔬菜类', '散叶生菜是由中国农科院蔬菜花卉研究所选育的一个优良生菜品种。散叶生菜特征特性 株高20～22厘米、开展度30～35厘米，叶卵圆形、散生、嫩绿色。叶面褶皱，叶缘波状，美观。单株重300～450克，口感脆嫩，品质好。耐寒、抗病、生长速度快，不耐高温干旱。适宜春秋露地及冬保护地栽培。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6756, '球生菜', NULL, '蔬菜类', '球生菜为菊科莴苣属，1 或 2 年生草本植物半结球莴苣 Lactuca sativa Linn 或结球莴苣 Lactuca sativa var. capitata L.。可长到 0.25 至 0.8 米高，茎中空，有乳汁，叶子的形状多数扁长形，从较典型的长椭圆型、披针型到线型。花期 7 至 8 月，种子成熟期 8 至 9 月。\r\n莴苣属菊科，叶用莴苣以新鲜嫩叶供食，外销以结球为主。西生菜为直根系，分布浅，吸水肥能力弱，结球莴苣的球形有圆形、扁圆形、圆锥形、圆筒形，质地柔嫩，为主要食用部分。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6757, '奶油生菜', NULL, '蔬菜类', '奶油生菜属菊科莴苣属，为一年生草本作物。叶子呈卵圆形，嫩绿色，叶面较平，中下部横皱，商品性好，叶质软。植株早生，全生育期60天，适宜春秋播种，春茬在2-4月播种育苗，5-6月收获，秋茬在7月下旬至8月下旬播种育苗，10-11月收获。春季定植到收获35-40天，秋季定植后50-60天收获。叶球小而松散，叶片宽阔，微皱缩，嫩绿色，有光泽，叶平滑，肉厚，质地柔软。适应性强，发芽温度18-25度，发芽天数7-15天，生长适宜温度15=38度，株间距20*30厘米。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6758, '大叶茼蒿', NULL, '蔬菜类', '大叶茼蒿是茼蒿的一种，是一种可食用的蔬菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6759, '香芹', NULL, '蔬菜类', '香芹（学名：Petroselinum crispum）为伞形科欧芹属的二年生草本植物。原产地中海沿岸。高15~20cm，具有清爽的香味和鲜绿色。古罗马时代起用于烹调，其食用部分为嫩叶和嫩茎，可生食或用肉类煮食，也可作为菜肴的干香调料或做羹汤及其他蔬菜食品的调味品，深受人们欢迎。也是世界上用的最广的一种草药。香芹对地质和气候的适应性高，栽培也很容易，世界各地都有栽培，但对干燥的适应性差。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6760, '鸡毛菜', NULL, '蔬菜类', '鸡毛菜是绿叶蔬菜，十字花科植物小白菜（Brassica chinensis）的幼苗的俗称，此叫法以上海一带比较普遍。绿叶蔬菜鸡毛菜。可治疗肺热咳嗽、便秘、丹毒、漆疮等疾病。小儿缺钙，骨软、发秃，可用小白菜煮汤加盐或糖令其饮服，经常食用颇有益。小白菜含维生素B1、维生素B6、泛酸等，具有缓解精神紧张的功能。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6761, '京水菜', NULL, '蔬菜类', '京水菜是日本最新育成的一种外型新颖、含矿质营养丰富的蔬菜新品种，全称白茎千筋京水菜。我国特菜产区称之为“水晶菜”。为十字花科芸薹属白菜亚种的一个新育成品种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6762, '叶菾菜', NULL, '蔬菜类', '叶菾菜又名君达菜、牛皮菜、厚皮菜、是藜科甜菜属以嫩叶供食用栽培种的一个变种，为2年生蔬菜。原产于欧洲地中海沿岸，从阿拉伯通过丝绸之路传入我国。叶菾菜是藜科(Chenopodiaceae)甜菜属中以嫩叶作菜用的栽培种，二年生草本植物。学名Beta vulgaris L.var.cicla Koch.,别名菾菜(《别录》)，甜菜(《日华子本草》)，牛皮菜(《滇南本草》)，石菜(《本草求原》)，杓菜、猪牳菜(《广州植物志》)，莙荙菜，光菜(《中国蔬菜栽培学》)。染色体数2n=2x=18。主根为肉质块根，含糖质，', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6763, '红叶苋菜', NULL, '蔬菜类', '苋菜 ，原名：苋，别名：雁来红、老少年、老来少、三色苋，拉丁文名：Amaranthus tricolor ， 苋科、苋属一年生草本，茎粗壮，绿色或红色，常分枝，幼时有毛或无毛。苋菜菜身软滑而菜味浓，入口甘香，有润肠胃清热功效。亦称为“凫葵”、“蟹菜”、“荇菜”、“莕菜”。有些地方又名“红蘑虎”、云香菜、云天菜、寒菜等。红苋叶片紫红色，耐热性中等，质地较软。品种有重庆的大红袍、广州的红苋及昆明的红苋菜等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6764, '绿叶苋菜', NULL, '蔬菜类', '苋菜 ，原名：苋，别名：雁来红、老少年、老来少、三色苋，拉丁文名：Amaranthus tricolor ， 苋科、苋属一年生草本，茎粗壮，绿色或红色，常分枝，幼时有毛或无毛。苋菜菜身软滑而菜味浓，入口甘香，有润肠胃清热功效。亦称为“凫葵”、“蟹菜”、“荇菜”、“莕菜”。有些地方又名“红蘑虎”、云香菜、云天菜、寒菜等。绿苋叶片绿色，耐热性强，质地较硬。品种有上海的白米苋，广州的柳叶苋及南京的木耳苋等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6765, '养心菜', NULL, '蔬菜类', '养心菜，根据《植物学》中文名费菜，拉丁文名Sedum.k.F；现代国内中草药书刊介绍学名景天三七、土三七，拉丁文名Sedum aizoon L.实质也指养心菜。原产东亚，中国东北、华北、华东各地区有分布，生于山坡林缘、山谷林下、灌丛、河岸阴湿地方。性耐寒，喜阳光及干燥通风处，忌水湿，对土壤性质要求不严，是古老珍贵而濒临绝迹的植物。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6766, '面条菜', NULL, '蔬菜类', '面条菜，是草本植物石竹科麦瓶草属麦瓶草（Silene conoidea L.）的幼苗的俗称，是黄河中下游地区（特别是河南）老百姓爱吃的一种野菜。别名净瓶、香炉草、米瓦罐、梅花瓶、面条菜、广皮菜、瓢咀、甜甜菜、麦石榴、油瓶菜、羊蹄棵、红不英菜、胡炳菜、麦黄菜、灯笼草；灯笼泡；瓶罐花；野菠菜（鲁东南地区）；兔子头（鲁东南地区）。\r\n这种菜有些涩，最好是在初期交细嫩时候食用口感会更加。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6767, '丝瓜尖', NULL, '蔬菜类', '丝瓜为葫芦得植物丝瓜或粤丝瓜的鲜嫩果实，又称吊瓜，原产于南洋，明代引种到我国，成为人们常吃的蔬菜。丝瓜的药用价值最高，全身都可入药。丝瓜所含各类营养在瓜类食物中较高，所含皂甙类物质、丝瓜苦味质、黏液质、木胶、瓜氨酸、木聚糖和干扰素等特殊物质具有一定的特殊作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6768, '红薯叶', NULL, '蔬菜类', '又称地瓜叶，红薯叶即指秋天红薯成熟后地上秧茎顶端的嫩叶。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6769, '南瓜花', NULL, '蔬菜类', '南瓜花亦蔬亦药。杏黄色，雌雄同株，单生。雄花花冠裂片大，先端长而尖;雌花花萼裂片叶状;柱头三枚，膨大，两裂。花柄长约30厘米。花托绿色，五角钟形。花柄去皮，花托去表，花朵去蕊，其余都能吃。研究发现，其所含大量胡萝卜素，具有防癌之辅助功效，患肺癌、胃癌和恶性淋巴肿瘤与血中胡萝卜素的多少有密切关系。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6770, '南瓜叶', NULL, '蔬菜类', '南瓜叶为葫芦科植物南瓜的叶，一年生蔓生草本，茎条达2-5m。常节部生根，密被白色刚毛。主要在夏、秋采收，可以晒干或鲜用，全国各地均有分布。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6771, '胎菊', NULL, '蔬菜类', '菊又称甘菊，亦名小胎皇、小白菊，古时曾作贡品。胎菊，性微寒；味辛甘苦，能疏散风热、平肝明目、清热解毒。用胎菊泡的菊花茶，味纯正，浓冽，色泽金黄，含有花蜜的清香，而且泡久了也不会散开。胎菊是杭白菊中最上品的一种。是在杭白菊花朵未完全张开的时候摘收下来的为胎菊，经干燥加工制成。特级花选用的是头序花蕾初开的嫩芽，精心的蒸制，烘焙而成．具有独特的味道．以它的稀少而颇为珍贵。另外，比胎菊再小一些，完全没有开放的菊花花蕾加工后称为菊米。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6772, '蝶豆花', NULL, '蔬菜类', '蓝蝴蝶也称蝶豆花，蓝眼晶蝶豆花酵素原液来自东南亚新加坡、马来西亚、泰国地区的蝶豆花是典型的热带蔓藤植物，蓝眼晶蝶豆花酵素原液以蝶豆花为主要原材料，并结合酵素领域先进微生物发酵技术与植物活性保护技术，发酵超365天而成，富含丰富的花青素、维他命A、C和E的天然植物酵素原液。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6773, '香椿苗', NULL, '蔬菜类', '香椿苗是香椿树种子所发的苗芽。由于季节限制，在夏秋冬三季人们不易吃到新鲜的香椿，因此人们将香椿树种子放在温暖潮湿的环境里，使其自然发芽，从而成为香椿苗。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6774, '苹果', NULL, '果品类', '苹果，落叶乔木，叶子椭圆形，花白色带有红晕。果实圆形，味甜或略酸，是常见水果，具有丰富营养成分，有食疗、辅助治疗功能。苹果原产于欧洲、中亚、西亚和土耳其一带，于十九世纪传入中国。中国是世界最大的苹果生产国，在东北、华北、华东、西北和四川、云南等地均有栽培。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6775, '香蕉', NULL, '果品类', '芭蕉科(Musaceae)芭蕉属(Musa)植物，又指其果实，热带地区广泛栽培食用。香蕉味香、富于营养，终年可收获，在温带地区也很受重视。植株为大型草本，从根状茎发出，由叶鞘下部形成高3～6公尺(10～20尺)的假杆；叶长圆形至椭圆形，有的长达3～3.5公尺(10～11.5尺)，宽65公分(26寸)，10～20枚簇生茎顶。穗状花序大，由假杆顶端抽出，花多数，淡黄色；果序弯垂，结果10～20串，约50～150个。植株结果后枯死，由根状茎长出的吸根继续繁殖，每一根株可活多年。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6776, '柠檬', NULL, '果品类', '柠檬（Citrus limon）是芸香科柑桔属的常绿小乔木，原产东南亚，现主要产地为美国、意大利、西班牙和希腊。主要为榨汁用，有时也用做烹饪调料，但基本不用作鲜食。柠檬由阿拉伯人带往欧洲，古希腊、古罗马的文献中均无记载，15世纪时才在意大利热那亚开始种植，1494年在亚速尔群岛出现，富含维生素C。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6777, '菠萝', NULL, '果品类', '菠萝原名凤梨，原产巴西, 16世纪时传入中国, 有70多个品种, 岭南四大名果之一。菠萝含用大量的果糖，葡萄糖，维生素A、B、C，磷，柠檬酸和蛋白酶等物。味甘性温，具有解暑止渴、消食止泻之功，为夏令医食兼优的时令佳果。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6778, '草莓', NULL, '果品类', '草莓又叫红莓、洋莓、地莓等，是一种红色的水果。草莓是对蔷薇科草莓属植物的通称，属多年生草本植物。草莓的外观呈心形，鲜美红嫩，果肉多汁，含有特殊的浓郁水果芳香。草莓营养价值高，含丰富维生素C ，有帮助消化的功效，与此同时，草莓还可以巩固齿龈，清新口气，润泽喉部。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6779, '山楂', NULL, '果品类', '山楂，可食用植物，质硬，果肉薄，味微酸涩。 落叶灌木。枝密生，有细刺，幼枝有柔毛。小枝紫褐色，老枝灰褐色。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6780, '梨', NULL, '果品类', '一种水果的名称，我国是梨属植物中心发源地之一，亚洲梨属的梨大都源于亚洲东部，日本和朝鲜也是亚洲梨的原始产地；国内栽培的白梨、砂梨、秋子梨都原产我国。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6781, '杏', NULL, '果品类', '杏（学名：Prunus armeniaca），又称杏子，是李属李亚属植物，其果肉、果仁均可食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6782, '李子', NULL, '果品类', '栗子是中国栽培最早的果树之一，已约有2000～3000年的栽培历史。叶披针形或长圆形，叶缘有锯齿。花单性，雌雄同株；雄花为葇荑花序，成熟后总苞裂开，栗果脱落。坚果紫褐色，被黄褐色茸毛，或近光滑，果肉淡黄。果实含糖、淀粉、蛋白质、脂肪及多种维生素、矿物质。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6783, '猕猴桃', NULL, '果品类', '猕猴桃（学名：Actinidia chinensis），是中华猕猴桃栽培种水果的称谓。也称猕猴梨、藤梨、羊桃、阳桃、木子与毛木果等，原产于中国湖北宜昌市夷陵区雾渡河镇。一般是椭圆形的。深褐色并带毛的表皮一般不食用，而其内则是呈亮绿色的果肉和一排黑色的种子。猕猴桃的质地柔软，味道有时被描述为草莓、香蕉、凤梨三者的混合。因猕猴喜食，故名猕猴桃；亦有说法是因为果皮覆毛，貌似猕猴而得名。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6784, '柚子', NULL, '果品类', '柚子是芸香科植物柚的成熟果实，产于我国福建、江西、广东、广西等南方地区。柚子清香、酸甜、凉润，营养丰富，药用价值很高，是人们喜食的名贵水果之一，也是医学界公认的最具食疗效益的水果。柚子茶和柚子皮也都具实用价值；另外还有网络红人柚子、漫画柚子和小说集《柚子》等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6785, '芒果', NULL, '果品类', '一种原产印度的常绿乔木，叶革质，互生；性温，花小，黄色或淡红色，成顶生的圆锥花序，产杧果和劣质淡灰色木材。也作为有游戏名，和一些别称使用。芒果果实含有糖、蛋白质、粗纤维，芒果所含有的维生素A的前体胡萝卜素成分特别高，是所有水果中少见的。其次维生素C含量也不低。矿物质、蛋白质、脂肪、糖类等，也是其主要营养成分。芒果为著名热带水果之一，因其果肉细腻，风味独特，深受人们喜爱，所以素有“热带果王”之誉称 。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6786, '柿子', NULL, '果品类', '柿子，果实扁圆，不同的品种颜色从浅桔黄色到深桔红色不等，大小从2厘米到10厘米，重量从100克到350克。柿子，原植物：柿科(Ebenaceae)，高大落叶乔木。原产地在中国，在各地分布较广，栽培已有一千多年的历史。中国、日本、韩国和巴西是主要产地。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6787, '荔枝', NULL, '果品类', '荔枝与香蕉、菠萝、龙眼一同号称“南国四大果品”。荔枝原产于中国南部，是亚热带果树，常绿乔木，高约10米。果皮肯多数鳞斑状突起，鲜红，紫红。果肉产鲜时半透明凝脂状，味香美。但不耐储藏。杨贵妃因喜食荔枝而闻名，使得杜牧写下“一骑红尘妃子笑，无人知是荔枝来”的千古名句。此外，各代文人墨客也写下了大量关于荔枝的诗词。荔枝性热，多食易上火，并可引起“荔枝病”。荔枝果实除食用外，核入药为收敛止痛剂，治心气痛和小肠气痛。木材坚实，深红褐色，纹理雅致、耐腐，历来为上等名材。花多，富含蜜腺，是重要的蜜源植物。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6788, '石榴', NULL, '果品类', '（学名：Punica granatum），别名安石榴、海榴，石榴科石榴属。落叶灌木或小乔木。针状枝，叶呈倒卵形或椭圆形，无毛。花期5-6月，多为朱红色，亦有黄色和白色。浆果近球形，果熟期9-10月。外种皮肉质半透明，多汁；内种皮革质。原产于伊朗及其周边地区。怀远县的石榴品种白花玉石籽因核软，甜度高，花朵洁白，果实淡绿，籽粒明如翠玉而著名。性味甘、酸涩、温，具有杀虫、收敛、涩肠、止痢等功效。石榴果实营养丰富，维生素C含量比苹果、梨要高出一二倍。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6789, '葡萄', NULL, '果品类', '葡萄（学名：Vitis vinifera L.）为葡萄科葡萄属木质藤本植物，小枝圆柱形，有纵棱纹，无毛或被稀疏柔毛，叶卵圆形，圆锥花序密集或疏散，基部分枝发达，果实球形或椭圆形，花期4-5月，果期8-9月。\r\n葡萄是世界最古老的果树树种之一，葡萄的植物化石发现于第三纪地层中，说明当时已遍布于欧、亚及格陵兰。葡萄原产亚洲西部，世界各地均有栽培，世界各地的葡萄约95%集中分布在北半球。\r\n葡萄为著名水果，生食或制葡萄干，并酿酒，酿酒后的酒脚可提酒食酸，根和藤药用能止呕、安胎。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6790, '樱桃', NULL, '果品类', '樱桃属于蔷薇科落叶乔木果树，樱桃成熟时颜色鲜红，玲珑剔透，味美形娇，营养丰富，医疗保健价值颇高，又有“含桃”的别称。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6791, '西瓜', NULL, '果品类', '西瓜为葫芦科植物西瓜的果实。我国南北皆有西瓜栽培。瓜呈圆形或椭圆形，皮色有浓绿、绿、白或绿色夹蛇纹等。瓤多汁而甜，呈浓红、淡红、黄或白色。\r\n西瓜堪称“瓜中之王”，因是在汉代从西域引入，故称“西瓜”。西瓜味道甘味多汁，清爽解渴，是盛夏佳果，西瓜除不含脂肪和胆固醇外，含有大量葡萄糖、苹果酸、果糖、蛋白氨基酸、番茄素及丰富的维生素C等物质，是一种富有营养、纯净、食用安全的食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6792, '木瓜', NULL, '果品类', '木瓜素有“百益果王”之称。我们所说的木瓜有两大类，蔷薇科木瓜属植物木瓜与热带水果番木瓜科木瓜（番木瓜）。木瓜从用途上也分为食用和药用木瓜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6793, '圣女果', NULL, '果品类', '圣女果，又称小西红柿，珍珠小番茄，樱桃小番茄，既可蔬又可果。也可以做成蜜饯，果实直径约1～3厘米，鲜红碧透（另有中黄、橙黄、翡翠绿等颜色的新品种），味清甜，无核，口感好，营养价值高且风味独特，食用与观赏两全其美，深受广大消费者青睐。该品种植株生长迅速，种苗种下70天后果实可成熟，可连续采摘3个月，亩产4000多公斤，效益好。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6794, '枣', NULL, '果品类', '枣（学名：Ziziphus zizyphus）是鼠李科落叶灌木或小乔木植物枣树，也是枣树的成熟果实。原产于中国，在中国南北各地都有分布。花小多蜜，是一种蜜源植物。果实枣，长圆形，未成熟时黄色，成熟后褐红色。可鲜食也可制成干果或蜜饯果脯等。营养丰富，富含铁元素和维生素。枣的品种繁多，大小不一，果皮和种仁药用，果皮能健脾，种仁能镇静安神；果肉可提取维生素C及酿酒；核壳可制活性炭。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6795, '火龙果', NULL, '果品类', '火龙果，英文Pitaya，本名青龙果、红龙果。原产于中美洲热带。火龙果营养丰富、功能独特，它含有一般植物少有的植物性白蛋白及花青素，丰富的维生素和水溶性膳纤维。火龙果树为仙人掌科的三角柱属植物，原产于巴西、墨西哥等中美洲热带沙漠地区，属典型的热带植物。火龙果是一种由南洋引入台湾，再由台湾改良引进海南省及大陆南部广西、广东等地栽培的植物。火龙果因其外表肉质鳞片似蛟龙外鳞而得名。她光洁而巨大的花朵绽放时，飘香四溢，盆栽观赏使人有吉祥之感，所以也称“吉祥果”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6796, '椰子', NULL, '果品类', '椰子，是椰子树的果实，是由外层为纤维的壳组成的，提供椰子皮纤维和内含可食厚肉质的大坚果。果新鲜时，有清澈的液体，叫做椰汁。产于热带地区。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6797, '无花果', NULL, '果品类', '无花果，学名Ficus carica Linn。落叶灌木或乔木，高达12m，有乳汁。维吾尔语称无花果为“安居尔”，意为“树上结的糖包子”。无花果是一种稀有水果，国内江苏、四川等地有种植，但在新疆阿图什地区栽培品质最优。无花果是无公害绿色食品，被誉为“21世纪人类健康的守护神”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6798, '沙梨', NULL, '果品类', '沙梨因其黄中透亮，形似芒果，又象腰鼓，故称金珠果。加之独特的保健功能，被人们誉为梨中珍品。其肉质酥脆细腻，汁液丰富，酸甜浓郁，蕴含山欧李、山楂、山樱桃等多种野生山果之独特清香，令人百食不厌。并具有显著的润肺止咳、养颜排毒、软化血管、健脑益智、延缓衰老等保健功效。沙梨极耐贮藏和运输，采收后在0～15℃条件下可贮藏5个月，保持质不变，果皮有较强的韧性，容易长途运输。是一种抗病晚熟、品质优、丰产性高、风味独特的高营养保健型新品种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6799, '牛油果', NULL, '果品类', '鳄梨也叫油梨，属樟科鳄梨属常绿乔木，是一种著名的热带水果,也是木本油料树种之一。果仁含油量8%～29%，它的提炼油是一种不干性油，没有刺激性，酸度小，乳化后可以长久保存，除食用外，它也是高级护肤品以及spa的原料之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6800, '罗汉果', NULL, '果品类', '罗汉果被人们誉为“神仙果”。 主要产于桂林市临桂县和永福县的山区，是桂林名贵的土特产。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6801, '橘子', NULL, '果品类', '桔子，即橘子。桔子为芸香科植物福橘或朱橘等多种橘类的成熟果实。桔子常与柑子一起被统称为柑橘，颜色鲜艳，酸甜可口，是日常生活中最常见的水果之一。\r\n桔子有特殊的构造，外果皮相当坚硬，生时绿色，成熟时有黄、橙、红等色；中果皮乳白或浅黄色；果肉皮成薄膜状，分成八～十数室，每室皆含有多量汁液，为可食用部分。桔子常被称为懒人水果，其不必洗、不需削皮的特性，吃来确实方便，加上外皮金黄色泽，一直是华人眼中讨喜的水果。桔子是柑桔类的代表之一，维他命C含量当然不在话下，只要吃三个桔子，就可以满足一天人体所需的维他命C。桔子', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6802, '菱角', NULL, '果品类', '菱角又名水栗、菱实，是一年生草本水生植物菱的果实，菱角皮脆肉美，蒸煮后食用，亦熬粥食。菱角含有丰富的蛋白质、不饱和脂肪酸及多种维生素和微量元素。味甘、平、无毒。具有利尿通乳，止消渴，解酒毒的功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6803, '青木瓜', NULL, '果品类', '番木瓜科番木瓜属热带常绿小乔木。主产地中国海南、广东、广西云南、福建、台湾等省（区）。因熟到快要掉地时外皮才黄，故名青木瓜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6804, '果酱', NULL, '果品类', '果酱是把水果、糖及酸度调节剂混合后，用超过100℃温度熬制而成的凝胶物质，也叫果子酱。制作果酱是长时间保存水果的一种方法。主要用来涂抹于面包或吐司上食用。不论草莓、蓝莓、葡萄、玫瑰果实等小型果实，或李、橙、苹果、桃等大型果实切小后，同样可制成果酱，唯制作时同一时间通常只使用一种果实。无糖果酱、平价果酱或特别果酱（如：榴莲、菠萝），便会使用胶体。果酱常使用的胶体包括：果胶、豆胶及三仙胶。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6805, '桔子', NULL, '果品类', '桔子，即橘子。桔子为芸香科植物福橘或朱橘等多种橘类的成熟果实。桔子常与柑子一起被统称为柑橘，颜色鲜艳，酸甜可口，是日常生活中最常见的水果之一。\r\n桔子有特殊的构造，外果皮相当坚硬，生时绿色，成熟时有黄、橙、红等色；中果皮乳白或浅黄色；果肉皮成薄膜状，分成八～十数室，每室皆含有多量汁液，为可食用部分。桔子常被称为懒人水果，其不必洗、不需削皮的特性，吃来确实方便，加上外皮金黄色泽，一直是华人眼中讨喜的水果。桔子是柑桔类的代表之一，维他命C含量当然不在话下，只要吃三个桔子，就可以满足一天人体所需的维他命C。桔子', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6806, '橙子', NULL, '果品类', '蛏子，学名缢蛏，属软体动物系，真瓣鳃纲，真瓣鳃目、竹蛏科。贝壳脆而薄，呈长扁方型，自壳顶腹缘，有一道斜行的凹沟，故名缢蛏。\r\n蛏生活在浅海泥沙中,有左右相等的两个贝壳,壳质脆薄,呈长方形,表面常生长一层浅绿色的薄皮。蛏肉味道鲜美,是比较普通的海产食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6807, '杨梅', NULL, '果品类', '杨梅属于杨梅科乔木植物。又称圣生梅、白蒂梅、树梅。因其形似水杨子、味道似梅子，因而取名杨梅。杨梅是我国特产水果之一，素有“初疑一颗值千金”之美誉，在江浙一带，又有“杨梅赛荔枝”之说。杨梅果实色泽鲜艳，汁液多，甜酸适口，营养价值高。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6808, '黄桃', NULL, '果品类', '黄桃，即黄肉桃。属于桃类的一种，隶属于蔷薇科桃属，因肉为黄色而得名。黄桃的营养十分丰富，黄桃食时软中带硬，甜多酸少，有香气、水分中等，成熟糖度14~15度。常吃可起到通便、降血糖血脂、抗自由基、祛除黑斑、延缓衰老、提高免疫力等作用，也能促进食欲，堪称保健水果、养生之桃。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6809, '桃', NULL, '果品类', '桃为蔷薇科植物或山桃的成熟果实。原产我国陕西、甘肃一带。目前分布很广，主要产区是河北、山东、北京、陕西、山西、河南、甘肃、浙江等省市。根据分布地区和性状特征，可分为北方品种群、南方品种群、黄肉桃品种群、蟠桃品种群和油桃品种群。北方品种群果实尖端有突尖，果肉脆或柔软多汁；南方品种群果实顶端圆，果肉柔软多汁；黄肉桃品种群的果肉为黄色；蟠桃品种群的果实扁平形；油桃品种群果面光滑。人们总是把桃作为福寿祥瑞的象征，在民间素有“寿桃”和“仙桃”的美称。在果品资源中，桃以其果形美观，肉质甜美被称为“天下第一果”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6810, '蔓越莓', NULL, '果品类', '蔓越莓，又称蔓越橘、小红莓，英文名Cranberry，是杜鹃花科越橘属红莓苔子亚属（学名：Oxycoccos，又名毛蒿豆亚属）的俗称', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6811, '榴莲', NULL, '果品类', '榴莲，别名韶子、麝香猫果。常绿乔木。叶子长椭圆形，表面光滑，背面生鳞片。果实球形，表面有很多硬刺，果肉味美，为热带著名果品之一。原产马来西亚，我国广东﹑海南也有。一般人对榴莲有着两种极端的情感——不是极爱、便是极恨。被誉为“空姐杀手”的榴莲气味浓烈、爱之者赞其香，厌之者怨其臭，甚至部分国家的地铁、酒店内等都禁止携带榴莲。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6812, '黑加仑', NULL, '果品类', '黑加仑学名黑穗醋栗（Ribes nigrum L.）又名黑醋栗，黑豆果，紫梅，虎耳草目茶藨子科茶藨子属', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6813, '金桔', NULL, '果品类', '金桔，又名金柑，属芸香科，是著名的观果植物。金桔皮色金黄、皮薄肉嫩、汁多香甜。它皮肉难分，洗净后可连皮带肉一起吃下。金桔含有特殊的挥发油、金桔甙等特殊物质，具有令人愉悦的香气，是颇具特色的水果。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6814, '树莓', NULL, '果品类', '又名三月泡、四月泡、山抛子、刺葫芦、悬钩子、馒头菠、高脚菠、龙船泡、牛奶泡、树莓、泡儿刺', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6815, '百香果', NULL, '果品类', '百香果原产南美州，学名西番莲，因其果肉可散发出香蕉、菠萝、草莓、荔枝、柠檬、芒果、酸梅等十几种水果的浓郁香味。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6816, '蓝莓酱', NULL, '果品类', '蓝莓的名称来源于英文blueberry，意为蓝色的浆果之意，多产自美国和加拿大。超市里销售的，大多是进口的新鲜蓝莓，不甜不酸，口感比较淡。产自我国大兴安岭的纯野生蓝莓，口感偏酸，但是在加入白糖煮开后，酸甜味道却刚刚好。蓝莓酱熬好后，舀一勺放在芝士蛋糕里，酸甜清香。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6817, '甘蔗', NULL, '果品类', '甘蔗，别名薯蔗、糖蔗，黄皮果蔗。甘蔗是禾本科甘蔗属植物，原产于热带、亚热带地区。甘蔗是一种高光效的植物，光饱和点高，二氧化碳补偿点低，光呼吸率低，光合强度大，因此甘蔗生物产量高，收益大。甘蔗是我国制糖的主要原料。 \r\n新植甘蔗采用栽种甘蔗苗繁殖，栽种后不久即生根，长出许多嫩芽，形成丛状。收割时仅收割甘蔗茎，将根仍留在土壤内，即宿根，来年，宿根重新分枝生茎；因此，甘蔗为多年生植物，它的收获多的可达7～8次，在中国一般为3次，即三年后挖去宿根，重新种植。\r\n竹蔗有两种，皮色深紫近黑的甘蔗，俗称黑皮蔗，性质较温', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6818, '草莓酱', NULL, '果品类', '草莓酱主要由草莓等材料制作而成。草莓因营养丰富，含有果糖、蔗糖、柠檬酸、苹果酸、水杨酸、氨基酸以及钙、磷、铁等矿物质，所以有“水果皇后”的美誉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6819, '酸枣', NULL, '果品类', '酸枣又名棘、棘子、野枣、山枣、葛针等，自古野生于我国。酸枣为鼠李科落叶灌木的果实。本属仅1种，产于印度及中国南部。秋季采收成熟的红软果实，除去果肉，晒干，碾破枣核，取出种子，生用或炒用。用时打碎。以种子入药,含酸枣仁皂甙A和B、有机酸、蛋白质、β-谷甾醇、脂肪油等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6820, '哈密瓜', NULL, '果品类', '哈密瓜，别名甜瓜，甘瓜，甜瓜、网纹瓜。哈密瓜属葫芦科植物，是甜瓜的一个变种。 源于突厥语“卡波”，意思即“甜瓜”。我国只有新疆和甘肃敦煌一带出产哈密瓜。新疆除少数高寒地带之外，大部分地区都产哈密瓜，最优质的哈密瓜产于南疆的伽师县、哈密和吐鲁番盆地。新疆哈密瓜有180多个品种及类型，又有早熟夏瓜和晚熟冬瓜之分。冬瓜耐贮存，新疆本地人家藏的冬瓜可以放到来年春天，味道仍然新鲜。 \r\n哈密瓜有“瓜中之王”的美称，含糖量在15%左右，形态各异，风味独特，有的带奶油味，有的含柠檬香，但都味甘如蜜，奇香袭人，饮誉国内外', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6821, '桑葚', NULL, '果品类', '桑椹为桑科落叶乔木植物桑树的果穗，又名桑果，有黑、白两种，鲜食以紫黑色为补益上品。我国大部分地区均产，主要在江苏、浙江、湖南等地，每年4～6月果穗呈红紫色时采收。\r\n早在两千多年前，桑椹已是中国皇帝御用的补品。因桑椹特殊的生长环境使桑果具有天然生长，无任何污染的特点，所以桑椹又被称为“民间圣果”。\r\n它含有丰富的活性蛋白、维生素、氨基酸、胡萝卜素、矿物素等成分，具有多种功效，被医学界誉为“二十一世纪的最佳保健果品”。常吃桑椹能显著提高人体免疫力，具有延缓衰老，美容养颜的功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6822, '香瓜', NULL, '果品类', '香瓜又称甘瓜或甜瓜。甜瓜因味甜而得名，由于清香袭人故又名香瓜。甜瓜是夏令消暑瓜果，其营养价值可与西瓜媲美。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6823, '杨桃', NULL, '果品类', '杨桃，别名五敛子，阳桃，洋桃，三廉子。杨桃是酢浆草科植物杨桃的果实。分布我国东南部及云南。果皮呈蜡质，光滑鲜艳，果肉黄亮，细致脆嫩，爽甜多汁。杨桃含有多种招牌营养素，并含有大量的挥发性成分，带有一股清香。在茶余酒后吃几片杨桃，会感到口爽神怡，另有一番风味。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6824, '蓝莓', NULL, '果品类', '蓝莓，别名蓝梅、笃斯、笃柿、嘟嗜、都柿、甸果、笃斯越桔。蓝莓果实一开始呈浅绿色，然后转为红紫色，最后成为蓝色或深紫色，此时成熟可以采收。蓝莓带有甜甜的风味，而酸度各异，被用在果冻、果酱、冰激凌与派等甜点上，也会加入玛芬中烘培，是许多点心与佳肴的成分之一。蓝莓的产季从每年五月到十月，在七月达最高峰。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6825, '西梅', NULL, '果品类', '西梅，来自美国加州，也称为加州梅。西梅含有丰富的维生素A及纤维素，同时兼含铁和钾等矿物质，却不含脂肪和胆固醇。西梅可帮助老年人补充铁、锌、钾，强身健骨，可使小孩增加各种维生素。西梅芳香甜美，口感润滑。当作为配料时，具有甘草的芳香，是现代人健康饮食的佳品。西梅不只是一种零食，它和各种原料相配，可做成各种美味食品。西梅不单能当零食吃，还可入菜。无论用来做沙拉、糕点，还是主食、配料，都非常合适。西梅的加工产品也很多，如西梅干、西梅汁、西梅糕等，随身携带，既可以饱口福，又对健康有利。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6826, '苹果酱', NULL, '果品类', '苹果酱，除含有大量的果糖、蔗糖以及果胶、水分外，还含有一定数量的果酸、维生素、蛋白质、脂肪和铁、磷、钙等人体不可缺少的营养成分。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6827, '甘蔗汁', NULL, '果品类', '顾名思义，甘蔗汁即为甘蔗压榨之后产生的汁液。食疗作用：治肺虚热咳嗽', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6828, '山楂酱', NULL, '果品类', '山楂，可食用植物，核果类水果，质硬，果肉薄，味微酸涩。 落叶灌木。枝密生，有细刺，幼枝有柔毛。小枝紫褐色，老枝灰褐色。能防治心血管疾病。山楂是我国特有的药果兼用树种。山楂酱就是用山楂熬制成的果酱。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6829, '黄桃酱', NULL, '果品类', '黄肉桃，俗称黄桃，属于桃类的一种，隶属于蔷薇科桃属，因肉为黄色而得名。黄桃的营养十分丰富，含有丰富的抗氧化剂(α-胡萝卜素、β-胡萝卜素、番茄黄素、番茄红素及维生素C,抗自由基等)、膳食纤维（果肉中的大量果胶是人体所需的纤维素，极易吸收等）、铁钙及多种微量元素（硒、锌等含量明显，高于其他水果，是果中之王）。黄桃食时软中带硬，甜多酸少，有香气、水分中等，成熟糖度14~15度。常吃可起到通便、降血糖血脂、抗自由基、祛除黑斑、延缓衰老、提高免疫力等作用，也能促进食欲，堪称保健水果、养生之桃。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6830, '巨峰葡萄', NULL, '果品类', '巨峰葡萄，属中熟类、四倍体品种，欧美杂交种，原产日本。巨峰葡萄是生产中的主栽品种之一，适应性强，抗病、抗寒性能好，喜肥水。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6831, '酒枣', NULL, '果品类', '酒枣：也称醉枣，是我国北方一种传统食品，在华中地区，俗称蹦枣。有些地区等到大枣成熟时便会使用白酒做出大坛小罐的酒枣，酒枣从制作到能够食用大约需要经过一个礼拜左右。一定要放置到阴凉没有阳光的地方密封严实。枣香酒纯、口味独特、个大皮薄、核小肉厚、色泽靓丽、香甜爽口、营养丰富。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6832, '布朗', NULL, '果品类', '布朗李子果实扁圆形，平均单果重145克左右，果皮底色绿，着暗紫红色，果点灰白色，果粉较厚，灰白色，果肉黄色，肉质致密，汁多，味酸甜，微香。极耐运输，常温下果实可存放10-20天，在0-5摄氏度条件下能储藏2-3个月。成熟期在8月上中旬左右。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6833, '菠萝蜜', NULL, '果品类', '又名：波罗蜜，别名苞萝、木菠萝、树菠萝、大树菠萝、蜜冬瓜、牛肚子果， 是世界上最重的水果，一般重达5-20kg，最重超过50kg，加之果实肥厚柔软，清甜可口，香味浓郁，故被誉为“热带水果皇后”。在广州、香港、澳门及其他粤语地区，波萝蜜一般被称为大树菠萝，在广西等地称为木菠萝，是桑科波罗蜜属常绿乔木。隋唐时从印度传入中国，称为“频那挲”（梵文Panasa 对音），宋代改称菠萝蜜，沿用至今。是世界著名的热带水果，属桑科桂木属常绿乔木。多生长于赤道附近地区。有淡淡臭味，成熟果肉为黄色，香甜可口。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6834, '人心果', NULL, '果品类', '人心果属山榄科(Sapotaceae)人心果属(Achras)，因人心果外形长得像人的心脏，故因而得名;由于它的果形有点像柿子，所以又称吴凤柿。另外根据它的英文名称Sapodiia之音译，也有人以台语称为”查某籽仔”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6835, '锦丰梨', NULL, '果品类', '锦丰梨是中国农科院果树所以苹果梨×茌梨杂交培育而成。果实近圆形，平均单果重280克，大者可达451克，果皮黄绿色，贮后转为黄色；果点大而明显；果心小，质细嫩，松脆，汁特多，风味浓郁，酸甜适口；含可溶性固形物12%～15.7%；品质极上。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6836, '人参果', NULL, '果品类', '人参果（Ginsengfruit）原名为香瓜茄，亦可称作仙果、香艳梨、艳果。人参果属于茄科的多年生草本植物，果实成熟时果皮呈金黄色，外形似人类的心脏。其果肉味道独特，吃起来脆爽多汁，而且不酸不涩，是一种较受欢迎的水果。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6837, '酸枣仁', NULL, '果品类', '酸枣核，别名枣仁、山枣、酸枣仁。酸枣核始载于《神农本草经》，列为上品。《名医别录》三人三云：“生河东叫泽，八月采实，阴干。”《新修本草》曰：“此即樲枣实也，树大如大枣，实无常形，但大枣中味酸者是。”《开宝本草》记载：“此乃棘实，更非他物。若谓是大枣味酸者，全非也。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6838, '白金瓜', NULL, '果品类', '白金瓜是一种从美国引进种植的香瓜，它外形与普通香瓜差不多，细腻的表皮散发着丝丝香气，切开后入口，口感鲜、甜、香、嫩、脆，是一种品质很不错的新品种香瓜，该品种瓜香诱人，风味独特，营养丰富，口感鲜、甜、香、嫩、脆，品质超过了市场上常见的香瓜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6839, '金塔寺瓜', NULL, '果品类', '金塔寺瓜不仅味美可口，而且营养丰富，除了有人体所需要的多种维生素外，还含有易被人体吸收的磷、铁、钙等多种营养成分，又有补中益气、消炎止痛、解毒杀虫的作用，对老年人高血压、冠心病、肥胖症等，亦有较好的疗效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6840, '久保桃', NULL, '果品类', '久保桃的果实近圆形，果皮鲜红色，果面光滑美观，味甜、香味浓，含可溶性固形物16.48%，品质上等。七月底成熟。因树势强健，抗寒力强，连年丰产，果实品质优良，是一个很有发展前途的中熟桃品种。特产地为昌黎县两山乡，生产基地3000亩，年生产6000万吨。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6841, '京白梨', NULL, '果品类', '京白梨为蔷薇科植物白梨的果实。原产于北京附近，为秋子梨系统中品质最优良的品种之一；是北京的名特优果品。 原产于门头沟军庄孟悟村，清代曾作为上等果品进贡朝廷，解放后，多次被选为国宴用品，享誉海内外。京白梨每年立春开花，处暑摘果。果肉中含大量葡萄糖，维生素，和氨基酸等营养物质，具有消暑，解渴，润肺.', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6842, '金丝小枣', NULL, '果品类', '金丝小枣色泽美观，核小肉丰、金丝绵绵、甘露可口，营养丰富，素有天然“维生素丸”之称，是很好的滋补食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6843, '白粉桃', NULL, '果品类', '兰州白粉桃果实肥大，平均重150克，果皮稍厚，向阳面呈紫红色，肉质细腻，柔软、甘甜，密汁丰富，芳香飘溢，味道醇美。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6844, '芭蕉', NULL, '果品类', '八角是八角树的果实，学名叫八角茴香，为常用调料。八角能除肉中臭气，使之重新添香，故又名茴香。八角是我国的特产，盛产于广东、广西等地。颜色紫褐，呈八角，形状似星，有甜味和强烈的芳香气味，香气来自其中的挥发性的茴香醛。\r\n八角是制作冷菜及炖、焖菜肴中不可少的调味品，其作用为其他香料所不及，也是加工五香粉的主要原料。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6845, '芭乐', NULL, '果品类', '芭乐即番石榴，别名花念、芭乐、鸡屎果、拔子、喇叭番石榴，是桃金娘科、番石榴属常绿小乔木或灌木，俗称芭乐、拔番石榴子、那拔。为热带、亚热带水果，原产美洲，现在华南地区及四川盆地均有栽培，香甜可口。成熟的番石榴为浅绿色，果皮脆薄，食用时一般不用削皮，果肉厚，清甜脆爽。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6846, '库尔勒梨', NULL, '果品类', '一座有名的城市叫库尔勒， 孔雀河流贯， 形成肥美的绿洲， 这里所产的香梨全国闻名。这种梨上市时间最长，个小色黄， 脆甜爽口，有雌雄之分，雌梨脐部深凹，雄梨脐部平实或凸出。雌梨比雄梨好吃。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6847, '山竹', NULL, '果品类', '山竹，既可以指植物山竹也可以指这种植物的果实山竹。山竹原名莽吉柿，原产于东南亚，一般种植10年才开始结果，对环境要求非常严格，因此是名副其实的绿色水果，与榴莲齐名，号称“果中皇后”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6848, '水蜜桃', NULL, '果品类', '水蜜桃，在植物分类学上属于蔷薇科，梅属，桃亚属，为落叶小乔木。一般树高3-4米。干性弱，树冠开张。幼树生长旺盛，1年生长枝达1米以上。芽具有早熟性，树冠形成快。开始结果早，定植2～3年开始结果，6～7年达盛果期，15～20年后渐入衰老，寿命较短，一般管理较好的25～30年还能保持较高产量。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6849, '神秘果', NULL, '果品类', '神秘果是一种小乔木，高约3—4米，它一年四季结果不断。它的果实并不大，长约2厘米，直径约8毫米。剥去红皮，露出白瓤，中间只有—颗大种子。神秘果树生长在西非热带地区，当地居民常常用它来调节食物的味道，它能使酸面包变得甜而可口，使酸味的棕榈酒和啤酒变甜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6850, '李子杏', NULL, '果品类', '李子杏是我国北方的主要栽培果树品种之一，以果实早熟、色泽鲜艳、果肉多汁、风味甜美、酸甜适口为特色，在春夏之交的果品市场上占有重要位置，深受人们的喜爱。杏果实营养丰富，含有多种有机成份和人体所必须的维生素及无机盐类，是一种营养价值较高的水果。杏仁的营养更丰富，含蛋白质23～27%、粗脂肪50～60%、糖类10...', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6851, '沙果', NULL, '果品类', '花红（学名：Malus asiatica），又名沙果（河北）、文林郎果（本草纲目）、林檎（河北习见树木图说），是蔷薇科苹果属的植物，落叶小乔木，叶卵形或椭圆形，顶端骤尖，边缘有极细锯齿。春夏之交开花，在枝顶伞形排列，花梗、花萼均有茸毛，花蕾时红色，开后色褪而带红晕。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6852, '沙棘', NULL, '果品类', '沙棘是植物和其果实的统称。植物沙棘为胡颓子科沙棘属，是一种落叶性灌木，其特性是耐旱，抗风沙，可以在盐碱化土地上生存，因此被广泛用于水土保持。国内分布于华北、西北、西南等地。沙棘为药食同源植物。沙棘的根、茎、叶、花、果，特别是沙棘果实含有丰富的营养物质和生物活性物质。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6853, '蛇果', NULL, '果品类', '蛇果原产美国，又名红元帅，为红香蕉（元帅）的浓条红型芽变，是世界主要栽培品种之一。果实大，果实圆锥形，平均单果重200g，大者可达500g以上。果肉黄白色，肉质脆，质中粗，较脆，果汁多，味甜，可溶性固形物14%，有浓郁芳香，品质上等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6854, '释迦', NULL, '果品类', '释迦又名番荔枝，因外形类似佛像头部而得名，主要产自台东等地，每年秋季至次年开春都有出产。释迦果肉乳白色，富含维生素A、B、C及蛋白质、铁、钙、磷等，促进消化。释迦在台湾深受喜爱，每年都要举行释迦节，选出的冠军释迦售价折算人民币上万元一颗。 释迦长在树上的样子释迦果实风味佳，甜度高。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6855, '北蕉', NULL, '果品类', '北蕉是台湾最重要的香蕉品种，分布于南部(高雄-屏东)和中部(台中)地区。适应性强，生产周期11个月～12个月，平均果穗重25公斤，良好管理下可达30公斤。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6856, '槟榔', NULL, '果品类', '槟榔果略小于鸡蛋，果皮纤维质，内含一粒种子，即槟榔子。胚乳坚硬，具灰褐色斑点。于8～11月果实完全成熟之前即予采收，去皮，煮沸，切成薄片晒干，干后呈深褐色或黑色。咀嚼时可以蒟（ju）叶包覆。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6857, '莲雾', NULL, '果品类', '莲雾，新加坡和马来西亚一带叫做水蓊(Eugenia javanica Lam)，又名天桃、水蒲桃或洋蒲桃，是桃金娘科的常绿小乔木。原产于马来半岛，在马来西亚、印尼、菲律宾和台湾普遍栽培，是一种主要生长于热带的水果。台湾的莲雾是17世纪由荷兰人引进台湾，台湾屏东是最有名的产地。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6858, '绿橙', NULL, '果品类', '绿橙(Green Orange )以皮绿橙甜汁多皮薄而称著全国，是海南热带水果的一大品牌。“琼中绿橙”是一种纯天然无公害水果，产自五指山下，万泉河畔的琼中黎族苗族自治县。“海南绿橙”，果实饱圆，色光碧润，皮薄多汁，内质柔软，化渣率高，酸甜适度，鲜美可口，风味独特，为清热消暑，解渴之佳果。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6859, '醋栗', NULL, '果品类', '醋栗为虎耳草科植物山麻子的果实，浆果球形，径7～9毫米，红色，果期7～8月，采取成熟果实，晒干。生于杂木林或针阔混交林中。分布我国东北、华北、山西、陕西、甘肃等地。欧洲人自中世纪起来就拿来享用的夏季浆果，采收季节非常短。又名灯笼果，近圆形或椭圆形，成熟时果皮黄绿色，光亮而透明，几条纵行维管束清晰可见，比较小，花萼宿存，很像灯笼，故名灯笼果。我国各地野生醋栗很多，栽培的种类和品种是从外国引入的。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6860, '刺梨', NULL, '果品类', '刺梨为蔷薇科植物缫丝花的果实，又名茨梨、木梨子，别名送春归、刺酸梨子、九头鸟、文先果，是滋补健身的营养珍果，是一种稀有的果实。生于海拔500米-2500米的向阳山坡、沟谷、路旁及灌丛中，是贵州、鄂西山区、凉山、冕宁山区等地的天然野果。 刺梨的收获期不足30天。刺梨为野生小灌木，4月至6月开粉红色、红色或深红色的花，夏花秋实。果实多为扁圆球形，横径一般为2厘米至4厘米，8月至9月果实成熟，黄色，有时带红晕。果肉脆，成熟后有浓芳香味。果皮上密生小肉刺，俗称之为“刺梨”。果实内含有丰富的维生素C，被称为“维C之', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6861, '长把梨', NULL, '果品类', '长把梨是源自山东省龙口市（原称“黄县”）一种梨的品种。据传最早种植于东江镇崔家村，已有270多年的历史，酸甜可口，口感非常好。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6862, '芦柑', NULL, '果品类', '橘子常与柑子一起被统称为柑橘，颜色鲜艳，酸甜可口，是日常生活中最常见的水果之一。 柑果实一般较大，但比柚小，圆形而稍扁，皮较厚，凸凹粗糙，果皮较易剥离，其种子大部分为白色。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6863, '莱阳梨', NULL, '果品类', '莱阳梨产于莱阳，以其独特的清香甜脆著称于世，清朝曾被列为皇家贡品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6864, '酪梨', NULL, '果品类', '酪梨也叫油梨，属樟科鳄梨属常绿乔木，是一种著名的热带水果，也是木本油料树种之一。果仁含油量8%～29%，它的提炼油是一种不干性油，没有刺激性，酸度小，乳化后可以长久保存，除食用外，它也是高级护肤品以及spa的原料之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6865, '李林蕉', NULL, '果品类', '李林蕉 又称\"牛角蕉\"或\"树蕉\"。本品种大约于20世纪80年代以前从马来西亚引进。株高约250~300厘米，株型较细小，叶片直立而窄长。果穗倾斜，呈不对称，果指细长而尖，呈S型，每串约6~9把果手，果重约10~12公斤。果皮薄、淡黄色、果肉细、味甜带酸、风味中等。生育期较短，约10~11个月可采收，宿根种植更短。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6866, '甜瓜', NULL, '果品类', '甜瓜属葫芦科，一年蔓生草本植物，原产于非洲热带沙漠地区，大约在北魏时期随着西瓜一同传到中国，明朝开始广泛种植。现在我国各地普遍栽培，果肉生食，止渴清燥，可消除口臭，但瓜蒂有毒，生食过量，即会中毒。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6867, '提子', NULL, '果品类', '提子又称“美国葡萄”、“美国提子”，是葡萄的一类品种。以其果脆个大、甜酸适口、极耐贮运、品质佳等优点,被称为“葡萄之王”。虽然价格不菲，但在市场上以其“贵族身份”而备受青睐。 提子所含热量较高，半碗提子已相等於一份水果分量;但提子皮和提子籽内含抗氧化物质，对於心脑血管疾病具预防作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6868, '马奶子葡萄', NULL, '果品类', '又名马乳葡萄，因其状如马奶子头而得名。主产于新疆吐鲁番盆地和南疆的墨玉、皮值山县。果穗圆柱形，歧肩大，有分枝，果粒圆柱状，平均粒重6克，最大重8克；白绿色，甘甜多汁，质较脆，味爽口。因有小核，宜鲜食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6869, '木梨', NULL, '果品类', '木梨为落叶小乔木。幼枝有绒毛。叶卵形或长圆形，表面暗绿色，背面密被绒毛。花单生枝顶，白色或粉红色。果梨形，黄色，有香味。花期4-5月。 喜光而能耐半阴。适应性强，耐寒。对土壤要求不严，一般排水良好之地均可栽培。 用播种、扦插或压条法繁殖均可。移植宜在落叶后或萌芽前进行，一般小苗需留宿土，大苗需带土球。萌芽力尚强，可以整枝。主要害虫有大蓑蛾、刺蛾和蚜虫。 榅桲枝叶扶疏，花粉红色，宛如朝霞，果黄色，具芳香。适于孤植院前庭后观赏。实生苗可作梨、木瓜、苹果的矮化砧木，嫁接枇杷可增强期抗寒性。果可药用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6870, '磨盘柿', NULL, '果品类', '“磨盘柿”历史悠久，相传，明代洪武年间(公元1368-1399年)房山就有柿树栽培。明万历年间(公元1573-1620年)编修的《房山县志》记载“柿为本镜出产之大宗，西北河套沟，西南张坊沟，无村不有，售出北京者，房山最居多数，其大如拳，其甘如蜜”。被朱棣皇帝封为御用贡品。“磨盘柿”，以果实个头大，形状似“磨盘”而得名...', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6871, '玫瑰蕉', NULL, '果品类', '玫瑰蕉，1995年从比利时国际香蕉种原交换中心引进，原产亚洲东南部，我国台湾、广东、广西、福建、四川、云南、贵州等也均有栽培，以台湾、广东最多。营养高、热量低，有丰富的蛋白质、糖、钾、维生素A和C，同时膳食纤维也多，是相当好的营养食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6872, '倭锦苹果', NULL, '果品类', '倭锦苹果为蔷薇科植物苹果的果实。主要产于华北、东北一带，夏、秋季果实成熟时采摘，洗净鲜用或切片晒干用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6873, '西番莲', NULL, '果品类', '据测定，目前已知西番莲果实含有超过132种以上的芳香物质，是世界上已知最芳香的水果之一，有“果汁之王”的美誉。它最适于加工成果汁，或与其它水果(如芒果、菠萝、番石榴、柑橙和苹果等)加工混配成混合果汁，可以显著地提高这些水果汁的口感与香味；也可以做雪糕的果汁添加物质，或作为其它食品的添加剂以增进香味', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6874, '西贡蕉', NULL, '果品类', '西贡蕉又名象牙蕉。原产越南。是我国广西南宁、龙州，四川南部长江沿岸的主栽品种。假茎高2.9～4.3米，茎粗，果穗长，果指长，果实形态与粉蕉同，仅是青果皮较青绿，果实品质与粉蕉同。一般株产12.5～25公斤。 西贡蕉属粉蕉类型，又名粉沙蕉、米蕉、糯米蕉、蛋蕉，约在1932年从越南引入，为广西南宁、龙州一带的主栽品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6875, '祝光苹果', NULL, '果品类', '祝光苹果，别名美夏、白糖、伏香蕉、伏祝、祝。原产美国，为一古老品种。在上世纪20年代引进中国。在近年，各地栽植已逐渐减少。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6876, '香椽', NULL, '果品类', '香椽既可观赏，果实皮肉又可入药，具有理气化痰、止痛消炎的功效。香椽是云南大理弥渡县人家喜种的果树。它属芸香科常绿灌木或小乔木，其枝干间有刺，叶大形似桔圳，春季开花，呈白色，果实为椭圆形，大的一个有三公斤左右,最大的可达8公斤以上。成熟的果实可以经霜不落，在树上长数年之久，每年秋冬季节果实渐渐变黄。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6877, '面包果', NULL, '果品类', '面包果属桑科，果实按种子有无分为有核和无核2个类型：有核品种通称面包坚果树或称硬面树，果实含有大而多的圆形白色种子，种子与果肉煮熟后可吃。用种子或插根繁殖。无核品种，无核，树形较矮，通称面包果。用插根面包果(Artocarpus communis)繁殖。 面包果用途广，果实可食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6878, '密云小枣', NULL, '果品类', '密云小枣属于鼠李科，是由野生酸枣演化而来。据考证，中国栽培枣始于七千年前，到二千年前的汉代，枣的栽培已遍及中国南北各地，具有丰富营养价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6879, '小米蕉', NULL, '果品类', '小米椒是辣椒的一种，一般指朝天椒，个体小，未成熟时为淡绿色，成熟为橙黄色，干小米椒为红带橙黄色，大红色的则不是该品种。辣椒草本。单叶互生，灭托叶。花两性，辐射对称，花冠合瓣，属茄科植物，原产南美洲，现我国广大地区均有栽培。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6880, '明月梨', NULL, '果品类', '明月梨又名日本白海明月梨,属砂梨系。果实为广长圆形,平均果重450～750g,最大可达1550g。果皮为褐色(正阳人俗称麻梨)。成熟的果实色稍转深,果面平滑,果梗粗长,基部肥大。果肉特白,质致密、细脆,味极甜,汁多,品质上等。较耐贮藏,可溶性固形物含量为13.7%。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6881, '青梅', NULL, '果品类', '梅子为蔷薇科植物梅的果实。果实将成熟时采摘，其色青绿，称为青梅。青梅经烟熏烤或置笼内蒸后，其色乌黑，称为乌梅。 梅属绿色水果，含有枸橼酸、单宁酸、酒石酸等多种酸。生食能生津止渴，开胃解郁，也适宜加工成多种果脯和蜜饯。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6882, '马蹄黄梨', NULL, '果品类', '马蹄黄梨为山东特产，素有“梨中之王”的美称。晚秋黄梨果形扁圆硕大，不但醇香宜人、甜酸适口、汁多爽脆，而且含有丰富的蛋白质和脂肪。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6883, '小西瓜', NULL, '果品类', '小西瓜属葫芦科，原产于非洲。西瓜是一种双子叶开花植物，形状像藤蔓，叶子呈羽毛状。它所结出的果实是假果，且属于植物学家称为假浆果的一类。果实外皮光滑，呈绿色或黄色有花纹，果瓤多汁为红色或黄色(罕见白色)。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6884, '玛瑙石榴', NULL, '果品类', '石榴，石榴科石榴属。落叶灌木或小乔木。针状枝，叶呈倒卵形或椭圆形，无毛。花期5-6月，多为朱红色，亦有黄色和白色。浆果近球形，果熟期9-10月。外种皮肉质半透明，多汁;内种皮革质。原产于伊朗及其周边地区。怀远县的石榴品种白花玉石籽因核软，甜度高，花朵洁白，果实淡绿，籽粒明如翠玉而著名。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6885, '蜜桔', NULL, '果品类', '蜜桔，属于芸香科，和釉子、橙子、花椒、枳同属一科。柑桔果实内含有多种营养成分，如糖，柠檬酸，维生素 C，蛋白质，以及胡萝卜素，维生素 P 等多种维生素。其中维生素 C 含量是苹果的 6 一 20 倍。柑桔不仅营养丰富，而且色相艳丽，香气浓烈，甜酸适度，令人闻则思念，望则垂涎，食则甘美。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6886, '玫瑰香葡萄', NULL, '果品类', '玫瑰香葡萄，也叫麝香葡萄(Muscat)，欧亚种，也有译为莫斯佳、汉堡麝香、穆斯卡特、慕斯卡、麝香马斯卡特等。Muscat是一个古老的品种，是世界上著名的鲜食、酿酒、制汁的兼用品种。世界上种植面积分布很广，特别是欧洲各国种植很多。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6887, '梅子', NULL, '果品类', '梅子营养丰富，含有多种有机酸、维生素、黄酮和碱性矿物质等人体所必需的保健物质。其中含的苏氨酸等8种氨基酸和黄酮等极有利于人体蛋白质构成与代谢功能的正常进行，可防止心血管等疾病的产生，因此被誉为保健食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6888, '奶柿子', NULL, '果品类', '奶柿子果实营养丰富，具特殊风味。可以生食、煮食、加工制成酱、汁或整果罐藏。是全世界栽培最为普遍的果菜之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6889, '枇杷', NULL, '果品类', '枇杷为蔷薇科植物枇杷的果实。我国陕西、甘肃、江苏、安徽、福建等省区均有产。因果实形似琵琶而得名。枇杷清香鲜甜，略带酸味，产自我国淮河以南地区，以安徽“三潭”最为著名。在徽州民间有“天上王母蟠桃，地上三潭枇杷”之说，与樱桃、梅子并称为“三友”。4～5月采收，剥去外皮，取果肉鲜用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6890, '葡萄柚', NULL, '果品类', '又叫西柚。葡萄柚起源于亚洲，它是人工种植的树种，早期欧洲人拿来当装饰﹑布置庭院用，后被沙达克船长带到加勒比周围各岛屿，约于1750年首先在拉丁美洲巴巴多斯群岛的加勒比海岛上被发现，1823年被引种到美国佛罗里达州作为商业栽培。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6891, '蒲桃', NULL, '果品类', '葡萄（学名：Vitis vinifera L.）为葡萄科葡萄属木质藤本植物，小枝圆柱形，有纵棱纹，无毛或被稀疏柔毛，叶卵圆形，圆锥花序密集或疏散，基部分枝发达，果实球形或椭圆形，花期4-5月，果期8-9月。\r\n葡萄是世界最古老的果树树种之一，葡萄的植物化石发现于第三纪地层中，说明当时已遍布于欧、亚及格陵兰。葡萄原产亚洲西部，世界各地均有栽培，世界各地的葡萄约95%集中分布在北半球。\r\n葡萄为著名水果，生食或制葡萄干，并酿酒，酿酒后的酒脚可提酒食酸，根和藤药用能止呕、安胎。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6892, '苹果梨', NULL, '果品类', '苹果梨系北方寒温带地区名贵果品之一，因其外形丑陋又称“中华丑梨”。果形扁圆，果面带有点状红晕，酷似苹果，故名苹果梨。苹果梨树喜冷凉湿润的气候，耐高寒。延边苹果梨属于白梨系统，是中国优良品种梨之一，主产于吉林省延边朝鲜族自治州。果形扁圆，果面带有点状红晕，酷似苹果，故名苹果梨。苹果梨树喜冷凉湿润的气候，耐高寒。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6893, '雪花梨', NULL, '果品类', '雪花梨是河北省土特名产之一，主要分布在河北省中南部，赵县是著名的集中产区，故称“赵州雪花梨”，当地人也称“相梨”。早在北魏时就有是向宫廷进贡的土特产品，至今已有2000多年的栽培历史。雪花梨也是河北省传统的大宗出口水果，在国内外久负盛誉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6894, '红富士苹果', NULL, '果品类', '红富士是从普通富士的芽(枝)变中选育出的着色系富士的统称。富士苹果是日本农林水产省果树试验场盛冈分场于1939年以国光为母本，元帅为父本进行杂交，历经20余年,选育出的苹果优良品种，具有晚熟、质优、味美、耐贮等优点,于1962年正式命名，是世界上最著名的晚熟苹果品种。富士果实虽有风味好、晚熟、耐贮等优点。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6895, '青芒果', NULL, '果品类', '未成熟的青芒果被称为情人果。是集“色”、“香”、“味”和“营养”为一身的果中佳品，含有大量的营养元素。那酸酸甜甜的味道，犹如恋爱中的感觉，使人怦然心动，又别具浪漫的热带风情。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6896, '庆丰桃', NULL, '果品类', '庆丰桃为蔷薇科植物或山桃的成熟果实。原产我国陕西、甘肃一带。目前分布很广，主要产区是河北、山东、北京、陕西、山西、河南、甘肃、浙江等省市。根据分布地区和性状特征，可分为北方品种群、南方品种群、黄肉桃品种群、蟠桃品种群和油桃品种群。北方品种群果实尖端有突尖，果肉脆或柔软多汁；', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6897, '血橙', NULL, '果品类', '血橙(blood orange) 是一个混种的植物，第一次出现在1850的欧洲，新鲜的血橙是红或橙色，有明亮的红色条纹，并且香甜多汁有一种芬芳的香气，有几个品种是略呈椭圆形的，血橙大都无核，主要被种植在西班牙、意大利和北美。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6898, '西洋梨', NULL, '果品类', '西洋梨是英国、意大利、澳大利亚、美国等国家梨树栽培品种.其果面青红，新鲜，果体硬度好，果体葫芦状，个中较均匀，皮薄，口感香甜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6899, '秋里蒙苹果', NULL, '果品类', '秋里蒙苹果为蔷薇科植物苹果的果实。主要产于华北、东北一带，夏、秋季果实成熟时采摘，洗净鲜用或切片晒干用。苹果的形态略呈圆形，果皮的颜色多为青、黄、红色。不同的地区、不同品种的苹果，其成熟季节是有差别的。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6900, '印度苹果', NULL, '果品类', '印度苹果为蔷薇科植物苹果的果实，苹果酸甜可口,营养丰富,是老幼皆宜的水果之一。它的营养价值和医疗价值都很高，被越来越多的人称为“大夫第一药”。许多美国人把苹果作为瘦身必备，每周节食一天，这一天只吃苹果，号称“苹果日”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6901, '椰子肉', NULL, '果品类', '椰子果实越成熟，所含蛋白质和脂肪也越多，这是其他一般南方水果所不能比拟的，椰肉含有丰富的营养素，芳香滑脆，柔若奶油，可以直接食用，也可制作菜肴、蜜饯或做成椰丝、椰蓉食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6902, '椰汁', NULL, '果品类', '椰子汁为棕榈科植物椰树的果实椰果的抽取汁液。汁清如水，且相当清甜、晶莹透亮，清凉解渴。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6903, '椰枣', NULL, '果品类', '椰枣(英文名称：Date)：又名波斯枣、番枣、伊拉克枣，是枣椰树(学名：Phoenix dactylifera )的果实，《本草纲目》称无漏子。原植物属棕榈科刺葵属。分布于西亚、北非以及中国的福建、广西、云南、广东等地，目前已由人工引种栽培。生长在热带、亚热带地区，是一种在西亚和北非沙漠绿洲中常见的绿色乔木。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6904, '青苹果', NULL, '果品类', '青苹果就是颜色是青的苹果，青的果酸含量高，有利于美容，苹果都一样，不管是红的青的黄的都是一样的，它的颜色不同是因为它们的品种不同，不同的品种有不同的口味和特点，像是：“果实色泽鲜艳，全面浓红；果肉黄白色，果肉硬度9.6kg/cm2，肉质细脆、多汁，风味甜酸浓郁。”这说的是红将军。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6905, '鸭广梨', NULL, '果品类', '鸭广梨是廊坊市名特果品，栽培历史悠久，该品种适应性强，具有抗旱、抗涝、耐瘠薄、耐盐碱、易管理、产量高、寿命长等特点。近百年生老树尚能大量结果，目 前全区已发展鸭广梨5万亩，涉及全区十二个乡镇，集中于万庄镇、尖塔乡、旧洲乡、杨税务乡，年产量3000万公斤，产值5000万元。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6906, '鸭梨', NULL, '果品类', '鸭梨又名鸭嘴梨、古安梨。集中产于河北南部、山东西北部、辽宁西部，是我国最古老的优良品种之一，约有200年栽培历史，属白梨系统品种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6907, '油皮（水果）', NULL, '果品类', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6908, '余柑子', NULL, '果品类', '余柑子(Amla)，原产于印度北部喜马拉雅山区，其果鲜食酸甜酥脆而微涩，回味甘甜，具有独特的药用价值，被当地居民自豪地誉为“圣果”。早在我国明代，李时珍《本草纲目》中就记载余柑子有“久服轻身、延年长生”作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6909, '芝麻蕉', NULL, '果品类', '芝麻蕉是香蕉中的佳品。其果形略小，弯曲，肥满。成熟后果皮呈杏黄色，皮表有褐色的芝麻点。果肉黄白色，比一般香蕉更香甜润滑。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6910, '早桔', NULL, '果品类', '早桔属于芸香科,和釉子、橙子、花椒、枳同属一科。柑桔果实内含有多种营养成分，如糖，柠檬酸，维生素 C，蛋白质，以及胡萝卜素，维生素 P 等多种维生素。其中维生素 C 含量是苹果的 6- 20 倍。柑桔不仅营养丰富，而且色相艳丽，香气浓烈，甜酸适度，令人闻则思念，望则垂涎，食则甘美。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6911, '冬枣', NULL, '果品类', '冬枣（亦称庙上福、苹果枣、冰糖枣、山西冬枣、庙上冬枣、）是华北地区的一个优质晚熟鲜食品种。冬枣属于鼠李科，枣属。是无刺枣树的一个晚熟鲜食优良品种。分布于 山东、山西、河北,等地。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6912, '冬果梨', NULL, '果品类', '冬果梨，当地俗称大果子，属白梨种，原产黄河流域，是靖远县果类产品中的名优品牌。据地方志载，明代境内黄河两岸已有“园圃为业者”，并形成规模。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6913, '蛋黄果', NULL, '果品类', '蛋黄果又名仙桃，山榄科，多年生常绿小乔木植物。树高7—9米，树冠圆锥形。花于5—6月间开放，花期很长。果实于12月开始成熟，椭圆形或卵形，果顶长尖，成熟果外皮橙黄色、光滑，果肉橙黄色，带粉状组织，柔软而缺乏水分，极似煮熟卵黄，微带甘味，内藏一粒种子，种子椭圆形，两端尖锐。原产美洲热带地区。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6914, '伏苹果', NULL, '果品类', '苹果按收获季节的不同可分为伏苹果、秋苹果，伏苹果多为7～8月采摘，其成熟期正值气候炎热的季节，大多数品种的果实肉质发酥，口味淡薄，易腐烂，不宜久贮。伏苹果的主要品种有黄魁、红魁、祝光等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6915, '粉蕉', NULL, '果品类', '粉蕉一般指小米蕉，小米蕉是海南的热带水果之一。主要分于陵水、三亚、乐东、文昌、琼海、万宁、澄迈、临高等。\r\n小米蕉果肉芳香，蕉皮有青绿色和鹅黄色的， 剥掉蕉皮，肉质呈鹅黄色，香甜可口，芬芳扑鼻。著名的品种有高把蕉、矮把蕉、油蕉、西贡蕉、粉蕉、芽蕉、蛋蕉等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6916, '凤眼果', NULL, '果品类', '凤眼果，为梧桐科植物苹婆的种子。属梧桐科的一种植物。又称“苹婆”。 凤眼果结于苹婆树，菜市场现在有外表棕黑色，泛油光，有皱纹的凤眼果，亦有剥去数层皮，见黄白色种仁的凤眼果肉出售，这些剥了种皮的凤眼果的功效表现能与莲子、银耳加冰糖共煮，其味香甜，更有温胃健脾之效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6917, '福橘', NULL, '果品类', '福橘是福建产的橘子，汉族民间有过年吃福橘的民俗。福橘为我国橘类中上品，呈扁圆形，鲜红美观，皮薄汁多，甜酸适口，久有盛誉。福橘上市期在农历春节前后，由于色泽艳红、果香汁甜，又与“福、吉”谐音，寓纳福招吉、福寿吉祥之意，备受群众喜爱，成为春节活动的重要角色。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6918, '国光苹果', NULL, '果品类', '国光苹果适应性强、座果率高、丰产、晚熟耐贮、无采前落果、更新易、寿命长等优点， 深受果农欢迎， 曾一度是日本、朝鲜、中国等亚洲国家的主栽品种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6919, '红香蕉', NULL, '果品类', '红香蕉是广西科技厅2001年从马来西亚引进的香蕉新品种，具有抗寒性强、生长旺盛、果实大、外观美、颜色粉红、含糖高、香气浓、口感好等特点。广西科学技术厅名优农产品示范基地生产的南洋红香蕉施用生物有机肥，不使用人工化学物质，达到绿色食品的要求。红美观,皮较厚;果肉淡黄色,肉质细腻、皮香蕉在未成熟时果皮为紫红色,略发黑，熟后呈红色，具有很强的耐储存性，蕉皮不易受伤，而且果脂饱满、整齐,外形滑润,味清香,口感佳,糖分含量稍低,有特殊的兰花香味,营养也十分丰富，维生素的含量极高。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6920, '黄河蜜瓜', NULL, '果品类', '黄河蜜瓜是甘肃省农业大学瓜类研究所用白兰瓜单株变异后代与墨西哥甜瓜品种甘露杂交选育而成的新品种，属中早熟品种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6921, '红玉苹果', NULL, '果品类', '肉质致密而脆美国品种，果实近圆形或扁圆形，单果重165~210克。果面底色黄绿，着色良好者全面呈浓红色，颇美观。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6922, '红提', NULL, '果品类', '红提，又名晚红、红地球、红提子，商品名称红提，属欧亚种，是由美国加利福尼亚州立大学于70年代用(皇帝×L12-80)×S45-48杂交育成。果穗大，整齐度好，平均单粒重10 克，最大单粒重13克，红色或紫红色，果皮中厚，易剥离，肉质坚实而脆，细嫩多汁，硬度大，刀切而不流汁。香甜可口，风味独特。7月下旬开始着色，9月下旬成熟。红地球葡萄不易掉粒，耐贮运，冷藏可至2－3月，货架期长。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6923, '黄皮果', NULL, '果品类', '黄皮果，又名：黄弹、黄皮、黄枇、黄弹子、王坛子。芸香科、黄皮属植物，果色泽金黄、光洁耀目，根据性味，可分甜、酸两个系统，有些品种甜酸适口、汁液丰富而具香味，是色、香、味俱佳的水果，可与荔枝并称。叶、根皮及果核均供药用。民间谚语云：“饥食荔枝，饱食黄皮”，说明黄皮可帮助消化。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6924, '红果', NULL, '果品类', '红果，又名山楂、酸楂、山里红。盛产于山东泰沂山区。内含丰富的维生素、山楂酸、柠檬酸、黄酮类等，有消食化积，降低血脂和减轻动脉硬化的疗效，常食可预防心血管疾病。“红果”用红果与白糖制而成，色泽红润，甜酸适中，味美可口，营养丰富，是醒胃助餐红果，是中国特有的珍贵资源。营养丰富，富含维生素、蛋白质、氨基酸、胡萝卜素等多种营养物质。山楂中维生素C的含量是橙的三倍，而其所含的微量元素中钙、镁含量更是居各种水果之首。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6925, '黑橄榄', NULL, '果品类', '黑橄榄（又名油橄榄）。含钙质和维生素C，营养丰富，其中维生素C的含量是苹果的10倍，梨、桃的5倍。其含钙量也很高，且易被人体吸收。作为食材，它能散发出沁人心脾的香味，点缀整盘美食如黑金异彩。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6926, '山莓', NULL, '果品类', '山莓（学名：Rubus corchorifolius L. f.），又名树莓、山抛子、牛奶泡、撒秧泡，三月泡、四月 泡、龙船泡，大麦泡、泡儿刺，刺葫芦、馒头菠、高脚波，直立灌木，高1-3米；枝具皮刺，幼时为柔毛。单叶，卵形至卵状披针形，多生在向阳山坡、山谷、荒地、溪边和疏密灌丛中潮湿处，目前尚未由人工引种栽培。花期2-3月，果期4-6月。具有涩精益肾助阳明目、醒酒止渴、化痰解毒之功效，主治肾虚、遗精、醉酒、丹毒等症。叶性微苦，解毒、消肿、敛疮等、咽喉肿痛、多发性脓肿、乳腺炎等症。除东北、甘肃、青海、新疆、', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6927, '柠檬汁', NULL, '果品类', '柠檬汁是新鲜柠檬经榨挤后得到的汁液,酸味极浓,伴有淡淡的苦涩和清香味道。柠檬汁含有糖类、维生素c、维生素B1、B2,烟酸、钙、磷、铁等营养成分。柠檬汁为常用饮品,亦是上等调味品,常用于西式菜肴和面点的制作中。柠檬果汁具有止咳、化痰、生津健脾等功效,能增强免疫力、延缓衰老', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6928, '西瓜皮', NULL, '果品类', '西瓜皮，别名西瓜翠衣。来源为葫芦科植物西瓜的外层果皮。采制 7～8月收集西瓜皮，削去内层柔软部分，晒干；也有将外面青皮剥去仅取其中间部分者。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6929, '车厘子', NULL, '果品类', '厘子的别名其实又叫做樱桃、含桃、荆桃，车厘子含铁量极高，几乎居于水果的首位。不同的是它主要产于美国，是外国引进的水果。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6930, '红啤梨', NULL, '果品类', '红啤梨是一种水果，果面青红，形状很可爱，像一个小葫芦一样，果体硬度好，肉细嫩、口感甜、果汁多，清甜的味道非常适合大众口味。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6931, '西柚', NULL, '果品类', '又叫葡萄柚。西柚起源于亚洲，它是人工种植的树种，早期欧洲人拿来当装饰﹑布置庭院用，后被沙达克船长带到加勒比周围各岛屿，约于1750年首先在拉丁美洲巴巴多斯群岛的加勒比海岛上被发现，1823年被引种到美国佛罗里达州作为商业栽培。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6932, '龙眼', NULL, '果品类', '龙眼俗称“桂圆”，是我国南亚热带名贵特产，历史上南方“桂圆”北“人参”之称。龙眼果实富含营养，自古受人们喜爱，更视为珍贵补品，其滋补功能显而易见。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6933, '乌梅', NULL, '果品类', '乌梅，中药名。为蔷薇科植物梅的干燥近成熟果实。我国各地均有栽培，以长江流域以南各省最多。具有敛肺，涩肠，生津，安蛔之功效。常用于肺虚久咳，久泻久痢，虚热消渴，蛔厥呕吐腹痛。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6934, '苹果醋', NULL, '果品类', '苹果醋并不是厨房里的调味品，而是指以苹果汁经发酵而成的苹果醋、再兑以苹果汁等原料而成的饮品。 苹果原醋兑以苹果汁使得口味酸中有甜，甜中带酸，既消解了原醋的生醋味，还带有果汁的甜香，喝起来非常爽口。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6935, '沙棘汁', NULL, '果品类', '沙棘汁由沙棘俗名醋柳、酸溜溜榨汁所得。起源于地质运动的冰期和间冰期，经过亿万年严酷的自然选择，沙棘以其超凡的生命力傲立于世，被誉为植物中的“生命之王”、“21世纪人类健康的保护神”。经世界许多国家的科研机构和医疗机构对沙棘的大量研究，沙棘具有独特的营养保健作用。现代医学研究，沙棘可降低胆固醇，缓解心绞痛发作，还有防治冠状动脉粥样硬化性心脏病的作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6936, '奇异果', NULL, '果品类', '猕猴桃，也称奇异果（奇异果是猕猴桃的一个人工选育品种，因使用广泛而成为了猕猴桃的代称）[1]  。果形一般为椭圆状，早期外观呈绿褐色，成熟后呈红褐色，表皮覆盖浓密绒毛，可食用，其内是呈亮绿色的果肉和一排黑色或者红色的种子。因猕猴喜食，故名猕猴桃；亦有说法是因为果皮覆毛，貌似猕猴而得名，是一种品质鲜嫩，营养丰富，风味鲜美的水果。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6937, '凤梨', NULL, '果品类', '凤梨原名菠萝，菠萝属于凤梨科凤梨属多年生草本果树植物，有70多个品种，岭南四大名果之一。凤梨原产南美洲，至今巴西尚有野生种，16世纪中期由葡萄牙的传教士带到澳门，然后引进到广东各地，后在广西、福建、台湾等省栽种，经过长期的选育，陆续产生了许多品种。\r\n菠萝是凤梨科多年生常绿草本植物，每株只在中心结一个果实。其果实呈圆筒形，由许多子房和花轴聚合而长成，是一种复合果。菠萝果皮有众多的花器（俗称果眼或菠萝钉），坚硬棘手，食用前必须削皮后挖去。菠萝一年有三次结果期，品质以6至8月成熟为最佳。鲜食以果色新鲜，果形端', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6938, '柚子皮', NULL, '果品类', '柚子 ，外皮很厚，大多在10～11月采摘。柚子多见于南方，以福建漳州平和县所产柚子最为著名。其果实鲜食甘酸可口，沁人心脾，令人赞不绝口，其果皮、柚花皆可入药，有“天然水果罐头”之称。其中柚子皮具有食用、驱除异味、防蚊虫等功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6939, '丰水梨', NULL, '果品类', '丰水梨是一种原产于日本的梨，该品种树冠中大，幼树期生长旺，结果后树势中庸，萌芽力高，成枝力弱，成花容易，结果早，以短果枝结果为主，座果率极高。其果实多汁，口感极佳。是日本三水梨之一，其品质优于幸水和新水。品质上等，平均单果重240克，最大单果重750克。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6940, '栗子', NULL, '果品类', '栗子是中国栽培最早的果树之一，已约有2000～3000年的栽培历史。叶披针形或长圆形，叶缘有锯齿。花单性，雌雄同株；雄花为葇荑花序，成熟后总苞裂开，栗果脱落。坚果紫褐色，被黄褐色茸毛，或近光滑，果肉淡黄。果实含糖、淀粉、蛋白质、脂肪及多种维生素、矿物质。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6941, '花生', NULL, '果品类', '花生又名落花生，原产于南美洲一带，世界上栽培花生的国家有100多个，亚洲最为普遍，次为非洲，据中国有关花生的文献记载栽培史约早于欧洲100多年。花生被人们誉为“植物肉”，含油量高达50%，品质优良，气味清香。除供食用外，还用于印染、造纸工业，花生也是一味中药，适用营养不良、脾胃失调、咳嗽痰喘、乳汁缺少等症。花生的栽培管理技术性也相对较强。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6942, '腰果', NULL, '果品类', '常绿乔木，树干直立，高达10m。单叶革质、互生，椭圆型或倒卵形。圆锥花序，花枝总状排序。果实由膨大的肉质花托（果梨，即假果）和着生在花托上的坚果（种籽，即真果）组成。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6943, '白果', NULL, '果品类', '白果又称银杏、公孙树子。个如杏核大小色洁白如玉，其味甘、苦、涩，过食易引起腹泄。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6944, '松子', NULL, '果品类', '松子是松树的种子，又称海松子。松子含脂肪、蛋白质、碳水化合物等。松子既是重要的中药，久食健身心，滋润皮肤，延年益寿，也有很高的食疗价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6945, '核桃', NULL, '果品类', '核桃，原产于近东地区，又称胡桃、羌桃，与扁桃、腰果、榛子并称为世界著名的“四大干果”。既可以生食、炒食，也可以榨油、配制糕点、糖果等，不仅味美，而且营养价值很高，被誉为“万岁子”、“长寿果”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6946, '芝麻', NULL, '果品类', '芝麻又叫胡麻、脂麻、乌麻等，属脂麻科一年生草本植物。味甘性平，具有补血明目，益肝养发，生津通乳，润肠通便，美容养颜，延年益寿等功能，被人们誉为“抗衰果”。 现代研究表明，芝麻中含有丰富的营养，芝麻的脂肪油含量达61.7％左右，是我国四大食用油料作物的佼佼者，芝麻油中以油酸、亚油酸、棕榈酸、甘油脂为主要成分；含蛋白质21.9％，氨基酸种类与瘦肉相似；还含有芝麻素、脂麻油酚、卵磷脂、蔗糖、多缩戊糖及钙、磷、铁等物质和维生素A、D、E等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6947, '杏仁', NULL, '果品类', '杏果和杏仁都含有丰富的营养物质，杏仁有苦甜之分，甜杏仁可以作为休闲小吃，也可做凉菜用；苦杏仁一般用来入药，并有小毒，不能多吃。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6948, '莲子', NULL, '果品类', '莲子，是睡莲科水生草本植物莲的种子。又称莲实、莲米、莲肉。莲，又称荷芙蓉、水芝。我国大部分地区均有出产，而以江西广昌福建建宁产者最佳。1985年中国科学院武汉植物研究所对四大莲子进行营养成分进行了对比测试，湘潭的寸三莲在氨基酸、蛋白质等17项主要指标全部优于其它莲子，被誉为“中国第一莲”。秋、冬季果实成熟时，割取莲房（莲蓬），取出果实；或取坠入水中，沉于泥内的果实，除去果壳，鲜用或晒干用，或剥去莲子的外皮和心（青色的胚芽）用，特称为莲肉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6949, '枸杞', NULL, '果品类', '枸杞是茄科枸杞属的多分枝灌木植物，高0.5-1米，栽培时可达2米多。国内外均有分布。枸杞全身是宝，明李时珍《本草纲目》记载：“春采枸杞叶，名天精草；夏采花，名长生草；秋采子，名枸杞子；冬采根，名地骨皮”。枸杞嫩叶亦称枸杞头，可食用或作枸杞茶。现代研究，枸杞子有降低血糖、 抗脂肪肝作用，并能抗动脉粥样硬化。此外，枸杞还可用园林作绿篱栽植、树桩盆栽以及用作水土保持的灌木等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6950, '桂圆', NULL, '果品类', '龙眼俗称“桂圆”，是我国南亚热带名贵特产，历史上南方“桂圆”北“人参”之称。龙眼果实富含营养，自古受人们喜爱，更视为珍贵补品，其滋补功能显而易见。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6951, '麦芽', NULL, '果品类', '又名大麦蘖、麦蘖、大麦毛、大麦芽。麦芽为禾本科植物大麦的发芽颖果。大麦一年生草本，全国各地均有栽培。于4至8月果实成熟时收获。麦芽生长全年皆可进行，但以冬、夏二季为好。取拣净的大麦，用水浸泡至六、七成透，装缸或箩内盖好，每天洒水保持湿润，至须根长约0、3至0、5厘米时取出，晒干。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6952, '酸枣仁', NULL, '果品类', '酸枣核，别名枣仁、山枣、酸枣仁。酸枣核始载于《神农本草经》，列为上品。《名医别录》三人三云：“生河东叫泽，八月采实，阴干。”《新修本草》曰：“此即樲枣实也，树大如大枣，实无常形，但大枣中味酸者是。”《开宝本草》记载：“此乃棘实，更非他物。若谓是大枣味酸者，全非也。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6953, '黑芝麻', NULL, '果品类', '黑芝麻呈扁卵圆形，长约3毫米，宽约2毫米。表面黑色，平滑或有网状纹。尖端有棕色点状种脐。种皮薄，子叶2，白色，富油性。气微，味甘，有油香气。别名：胡麻，油麻，巨胜，脂麻。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6954, '葡萄干', NULL, '果品类', '葡萄干（英文名称：raisin）是在日光下晒干或在阴影下晾干的葡萄的果实。葡萄又名草龙珠、蒲桃。主产新疆、甘肃，陕西、河北、山东等地。夏末秋初采收，鲜用或干燥备用。\r\n葡萄干肉软清甜，营养丰富。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6955, '瓜子仁', NULL, '果品类', '瓜子仁在人们生活中是不可缺少的零食，其不但可以作为零食，而且还可以作为制作糕点的原料。由于瓜子仁是植物的种子，含有大量的油脂，故葵花子还是重要的榨油原料。葵花子油是近几年来深受营养学界推崇的高档健康油脂。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6956, '榛子', NULL, '果品类', '榛树，属桦木科榛属植物，又称山板栗、尖栗、棰子等。在世界范围内榛属有约20个品种，分布于亚洲、欧洲及北美洲；在中国境内有8个种类2个变种，分布于东北、华东、华北、西北及西南地区。榛树是果材兼用的优良树种。榛子，榛树的果实，形似栗子，外壳坚硬，果仁肥白而圆，有香气，含油脂量很大，吃起来特别香美，余味绵绵，因此成为最受人们欢迎的坚果类食品之一，有“坚果之王”的称呼，与扁桃、核桃、腰果并称为“四大坚果”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6957, '板栗', NULL, '果品类', '栗子分布于我国辽宁、北京、河北、山东、河南等地，壳斗大，球形，外生刺，坚果2-3个，生于壳斗中。著名品种有良乡板栗，产于北京郊房山良乡，果小，约5克，味甜，十月中旬成熟；迁西明栗，又名“红皮”、“红毛”，产于河北迁西、兴隆，果中大，7-9.5克，皮红褐，鲜亮，味甜，九月中旬成熟；莱阳红光栗，产于山东莱阳庄头一带，果中大，皮深褐色，有亮光，品质好，味甜面，九月上旬成熟；另有锥栗，亦称珍珠栗，分布于长江流域和江南各地，壳头内包藏一卵形的坚果，味同板栗。栗子不仅含有大量淀粉，而且含有蛋白质，维生素等多种招牌营养', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6958, '柠檬片', NULL, '果品类', '柠檬片富含维生素、美白养颜、提神醒脑、防止骨质疏松，还可加入食物中提味。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6959, '开心果', NULL, '果品类', '开心果是一种干果，俗称阿月浑子（Pistachio），又名“无名子”，类似白果', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6960, '小胡桃', NULL, '果品类', '又名山核桃', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6961, '山楂干', NULL, '果品类', '是将山楂果切片后晾干而成的。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6962, '红枣', NULL, '果品类', '红枣又名枣、干枣、枣子，起源于中国，在中国已有八千多年的种植历史，自古以来就被列为“五果”（栗、桃、李、杏、枣）之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6963, '话梅', NULL, '果品类', '制作话梅用芒种后采摘的黄熟梅子，俗称黄梅。黄梅从树上采下来洗净后，放在大缸里用盐水泡浸月余，取出晒干；晒干后再用清水漂洗，再晒干；然后用糖料泡腌，再晒干―――如此多次反复，可谓是“十蒸九晒，数月一梅”，最后成为肉厚干脆、甜酸适度的话梅。这种话梅如果贮藏得好，防潮防蛀，可保存数年而不变质。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6964, '黑枣', NULL, '果品类', '黑枣，学名君迁子，又称野柿子，属于柿树科、柿属，黑枣的别名较多，如软枣、丁香枣、牛奶柿、野柿子等，广泛分布于我国北方地区，主要分为有核和无核两种，主要的品种有大核黑枣、牛奶枣和葡萄黑枣等。材质优良，可作一般用材；果实去涩生食或酿酒、制醋，含维生素丙，可提取供医用；种子入药，能消渴去热。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6965, '果脯', NULL, '果品类', '果脯是用新鲜水果经过去皮、取核、糖水煮制、浸泡、烘干和整理包装等主要工序制成的食品，鲜亮透明，表面干燥，稍有粘性，含水量在20%以下。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6966, '菠萝蜜子', NULL, '果品类', '菠萝蜜子为桑科植物木波罗的种仁。菠萝蜜原产印度，引入中国栽培已有九百多年历史，分布在海南、云南、台湾等热带地区。菠萝蜜一般食用的是果肉，清甜可口，菠萝蜜子一般都会丢弃，非常可惜，这个也是非常好的食物，也有很好的营养价值，是可以食用的', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6967, '山核桃', NULL, '果品类', '山核桃是一种落叶乔木，属胡桃科山核桃属，约有20个种，中国为原产地之一。山核桃的果实由于具有极高的营养价值和独特的口感风味，得到了消费者的认可，逐渐成为一种广受欢迎的高档坚果。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6968, '桃仁', NULL, '果品类', '桃仁呈扁长卵形，长1.2～1.8cm，宽0.8～1.2cm，厚0.2～0.4cm，表面黄棕色至红棕色，密布颗粒状突起，一端尖，中部膨大，另端钝圆稍扁斜，边缘较薄，尖端一侧有短线形种脐，圆端有颜色略深不甚明显的合点，自合点处散出多数纵向维管束，种皮薄，子叶白色，富油性，气微，味微苦。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6969, '毛核桃', NULL, '果品类', '毛核桃果在国外，人称\"大力士食品\"、\"营养丰富的坚果\"、\"益智果\"；在国内享有\"万岁子\"、\"长寿果\"、\"养人之 宝\"的美称。其卓著的健脑效果和丰富的营养价值，已经为越来越多的人所推崇。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6970, '西瓜子', NULL, '果品类', '西瓜子也是深受人们欢迎的休闲食品之一，是日常零食的代表。西瓜子经过加工可制成五香瓜子、奶油瓜子、多味瓜子等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6971, '香榧', NULL, '果品类', '香榧(Torreya grandis)，又称为“中国榧”，又名榧树、玉榧、野杉子，为红豆杉科，榧属常绿乔木，中国原产树种，是世界上稀有的经济树种。常绿乔木，高可达25m，树干端直，树冠卵形，干皮褐色光滑，老时浅纵裂，冬芽褐绿色常3个集生于枝端，雌雄异株，雄球花单生于叶腋，雌球花对生于叶腋，种子大形，核果状，长2-4cm.', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6972, '橡实', NULL, '果品类', '橡实是栎树的果实，形似蚕茧，故又称栗茧。橡子外表硬壳，棕红色，内仁如花生仁，含有丰富的淀粉，含量达百分之六十左右。既可食，又可作纺织工业浆纱用的原料。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6973, '美国大杏仁', NULL, '果品类', '美国大杏仁一般指巴旦木。\r\n巴旦木（Almonds）是出产自世界各地、广受欢迎的一种坚果。“Badam”从学术上解释，表示“内核”的意思。汉语“巴旦木”是“Baadaam”一词的音译而非意译。 \r\n“Baadaam”是Almonds（扁桃仁）在世界众多国家的名称，全球80%的巴旦木产于美国加州，此外，如印度、巴基斯坦和伊朗以及中国新疆均有种植巴旦木，该名称因历史悠久的文化传统而被当地人熟知。\r\n巴旦木营养丰富，一盎司（约30克/23颗）巴旦木含有约6克蛋白质、4克膳食纤维、75毫克钙、7.4毫克维生素E、', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6974, '大枣', NULL, '果品类', '大枣，又名红枣、干枣、枣子，起源于中国，在中国已有八千多年的种植历史，自古以来就被列为“五果”（栗、桃、李、杏、枣）之一。红枣富含蛋白质、脂肪、糖类、胡萝卜素、B族维生素、维生素C、维生素P以及钙、磷、铁和环磷酸腺苷等营养成分。其中维生素C的含量在果品中名列前茅，有维生素王之美称，具有补血养颜之功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6975, '白芝麻', NULL, '果品类', '白芝麻为胡麻科胡麻属植物脂麻的种子。白芝麻具有含油量高、色泽洁白、籽粒饱满、种皮薄、口感好、后味香醇等优良品质。白芝麻及其制品具有丰富的营养性和抗衰老性。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6976, '蜜枣', NULL, '果品类', '蜜枣属于干果类，用割枣机，把大青枣周身割一次，使得容易吸糖，然后放入锅中用白糖煮，晒干，就成了平时吃的蜜枣。也可用于泡茶，有一股枣的清香。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6977, '杏仁片', NULL, '果品类', '烘焙用杏仁片通常为大杏仁片，适合装饰或者添加在饼干、蛋糕中食用。通常的苦杏仁，因味道较重，不太适宜烘焙使用。若有特殊配方需求，也可以使用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6978, '巴旦木', NULL, '果品类', '巴旦木属桃类植物，古时称偏桃、偏核桃、婆淡树。新疆巴旦木是从古波斯（现今伊朗）传入，在《酉阳杂阻》、《岭表录异》有记载，“偏桃出波斯国，波斯呼为婆淡树。长五六文，周四五尺，叶似桃而阔大，三月开花，白色。花落结实，状如桃子，而形偏，故为之偏桃。其肉涩不可唆，核中仁甘甜，西域诸国并珍之。”可见，巴丹木从古时就被人们做为一种珍果来食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6979, '莲蓉', NULL, '果品类', '莲蓉是将莲子捣碎后与适量白糖、植物油混合加工而成，莲蓉又有红莲蓉、白莲蓉等之分，白莲蓉添加的是白糖，红莲蓉添加的是红糖。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6980, '南杏仁', NULL, '果品类', '南杏仁又名甜杏仁、南杏，专供食用，含丰富蛋白质、植物脂肪，有润燥补肺滋养肌肤的作用。若用於止咳，以北杏入药。南杏仁为杏树科的不同品种的种子。外形似苦杏仁而稍大。南杏仁性味甘平无毒，可润肺止咳，多用于燥咳，虚劳咳嗽。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6981, '北杏仁', NULL, '果品类', '北杏仁又名苦杏仁，为蔷薇科植物山杏，夏季采收成熟果实，除去果肉及核壳，取出种子，晒干。能祛痰宁咳、润肠。北杏仁中起着关键药理作用的是一种叫氢氰酸的物质，它可以对呼吸神经中枢起到一定的镇静作用，具有止咳、平喘的功效，但具有一定的毒性，只食二三十粒已可令人中毒，甚至致命。平时我们使用的北杏仁，经温火炒制后，去掉了外皮，减轻了苦味，但在用量上要加以控制，用量要控制在10克之内，以免过量食用伤及身体。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6982, '花生米', NULL, '果品类', '花生米是指去掉花生壳的花生仁，事实上是花生的种子，整个的花生叫做果实，荚果。但一般还是叫做花生米。花生本身是高能、高蛋白和高脂类的植物性食物。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6983, '桂圆干', NULL, '果品类', '桂圆干又名益智、龙眼肉，为龙眼晒干了的成熟果实。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6984, '和田玉枣', NULL, '果品类', '和田玉枣，新疆维吾尔自治区和田地区特产，全国农产品地理标志。\r\n和田地区属于典型的大陆性气候，种植区内降水稀少、干旱多风，气温变化较大，昼夜温差大、年温差悬殊，适宜种植枣树。和田玉枣，鲜枣果实大，大小不匀，果皮光滑，果形端正丰满、果皮薄，深红色，果肉厚，肉质细而松脆，汁液中多，味甜，可食率96.3%，其果实呈圆柱形或长倒卵形，果实品质上乘，适宜制干、加工酒枣和蜜枣，果实在产地于9月中旬成熟。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6985, '黑加仑葡萄干', NULL, '果品类', '黑加仑，黑葡萄干，原产地在俄罗斯，由于俄罗斯天气寒冷，此葡萄干生长在新疆阿勒泰山脉以北地区，受冷气候影响，生长时间长，天生是黑色的外表，无籽肉厚，香醇怡人，有葡萄酒的天然芳香，嚼劲十足。\r\n产自新疆黑加仑，富含多种营养物质，对人体健康具有很大益处，因此在欧洲和其他一些地方非常受欢迎。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6986, '灰枣', NULL, '果品类', '灰枣也称为新郑灰枣，果实呈长倒卵形，果皮为橙红色，核小肉厚，吃起来比一般的红枣要甜，原产地为河南新郑，后引种于全国各地，现新疆且末等地区均有分布。\r\n现在市场上广受消费者喜爱的灰枣就是若羌枣在成熟变红之前，颜色发灰而得名，所以也被称为若羌灰枣。灰枣果实呈长倒卵形，果皮是鲜红色，果核小果肉厚，而且干枣的果肉致密，非常富有弹性，跟一般的红枣比起来，吃起来要甜。灰枣具有丰富的营养成分，富含较多的蛋白质、糖类，还有人体生长所需要的20种氨基酸，被人们美赞为“维生素丸”和“矿物质元素库”，具有很高的营养价值和药用价', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6987, '玫瑰红葡萄干', NULL, '果品类', '玫瑰红葡萄干，选用新疆新疆吐鲁番地区优质玫瑰香葡萄，经本地特有凉房纯自然风干，产品色泽红润，有籽甘甜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6988, '熟芝麻', NULL, '果品类', '熟芝麻即炒熟的芝麻。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6989, '乌梅干', NULL, '果品类', '乌梅，中药名。为蔷薇科植物梅的干燥近成熟果实。我国各地均有栽培，以长江流域以南各省最多。具有敛肺，涩肠，生津，安蛔之功效。常用于肺虚久咳，久泻久痢，虚热消渴，蛔厥呕吐腹痛。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6990, '大米', NULL, '米面豆乳', '大厦米是中国人的主食之一，由稻子的子实脱壳而成。稻米中氨基酸的组成比较完全，蛋白质主要是米精蛋白，易于消化吸收，无论是家庭用餐还是去餐馆，米饭都是必不可少的。\r\n大米按照品种类型分为籼米、粳米和糯米三类', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6991, '糯米', NULL, '米面豆乳', '糯米又叫江米，是家常经常食用的粮食之一。因其香糯粘滑，常被用以制成风味小吃，深受大家喜爱。逢年过节很多地方都有吃年糕的习俗。正月十五的元宵也是由糯米粉制成的。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6992, '黑米', NULL, '米面豆乳', '黑米——稻米中的珍品，素有“贡米”、“药米”、“长寿米”之美誉。黑米营养成分丰富，每百克黑米含蛋白质10.73g，比白米高37.0％；人体“必需氨基酸”3280mg，比白米高25.4％；同时微量元素含量也非常丰富，如每百克黑米含铁52.46mg；钙为310.7mg；锌为42.02mg；锰为4.975mg；铜为34.43mg；比白米分别高138.4％，107.9％，34.8％，41.2％，38.7％。 黑米是一种药、食兼用的大米，具有较高的药用价值，在《本草纲目》中记载：有滋阴补肾、健脾暖肝、明目活血的功效', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6993, '小麦', NULL, '米面豆乳', '小麦是我国北方人民的主食，自古就是滋养人体的重要食用。《本草拾遗》中提到“小麦面，补虚，实人肤体，厚肠胃，强气力”小麦营养价值很高，所含有B族维生素和矿物质对人体健康很有益处。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6994, '小米', NULL, '米面豆乳', '小米中国古称稷或粟。脱壳制成的粮食，因其粒小，直径2毫米左右，故名。原产于中国北方黄河流域，中国古代的主要粮食作物，所以夏代和商代属于“粟文化”。粟生长耐旱，品种繁多，俗称“粟有五彩”，有白、红、黄、黑、橙、紫各种颜色的小米，也有粘性小米。中国最早的酒也是用小米酿造的。粟适合在干旱而缺乏灌溉的地区生长。其茎、叶较坚硬，可以作饲料，一般只有牛能消化。粟在中国北方俗称谷子。\r\n      粟以耐干旱和瘠薄著称，这与其叶片表皮细胞壁厚，内含大量硅素,叶脉密集,气孔多，根系致密，吸收力强等有关。蒸腾系数平均为25', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6995, '荞麦米', NULL, '米面豆乳', '荞麦，又名三角麦、乌麦、花荞，我国栽培的主要普通荞麦和鞑靼荞麦两种，前者称甜荞，后者称苦荞，由于苦荞的种实含有芦丁，所以也称芦西苦荞。荞麦为蓼科植物养麦的种子，全国各地均有分布和栽培，尤以北方为多。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6996, '玉米', NULL, '米面豆乳', '玉米，又名苞谷、棒子、玉蜀黍，有些地区以它作主食。玉米是粗粮中的保健佳品，对人体的健康颇为有利。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6997, '西米', NULL, '米面豆乳', '又叫西谷米、西国米、莎木面、沙孤米。\r\n最为传统的是从西谷椰树的木髓部提取的淀粉，经过手工加工制成，在广东等沿海地区，也叫做沙谷米、沙弧米。西谷米产于南洋群岛一带，是取棕榈科植物莎木的木髓部，用普通制淀粉法，经过粉碎、筛浆过滤、反复漂洗、沉淀、干燥等过程制取的淀粉。淀粉晒至半干燥时，摇成细粒，再行晒干，即为西谷米，质净色白者名真珠西谷，白净滑糯，营养颇丰。\r\n这些干燥、多淀粉质的小粒，是用远东生产的西谷椰子（Me-troxylousagu）所制成，西谷米加在牛奶布丁中是供病人食用的食物，也可作为烹调材料，', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6998, '薏米', NULL, '米面豆乳', '又名薏仁、薏苡仁、六谷米、苡米、薏米、苡仁。\r\n薏米为禾本科植物薏苡的成熟种仁，为一年或多年生草本。秋季果实成熟时采割植株，晒干，打下果实，再晒干，除去外壳、黄褐色种皮及杂质，收集种仁。薏米具有容易消化吸收的特点，不论用于滋补还是用于医疗，作用都很缓和。\r\n薏米在我国栽培历史悠久，是我国古老的药食皆佳的粮种之一。全国大部分地区均产，以福建、河北等省为主，由于薏米的营养价值很高，被誉为“世界禾本科植物之王”和“生命健康之禾”，在日本最近又被列为防癌食品，因此身价倍增。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (6999, '燕麦', NULL, '米面豆乳', '有名雀麦米、杜姥草、牛星草、野小麦、野大麦。\r\n燕麦就是我国的莜麦，俗称油麦、玉麦，是一种低糖、高营养、高能食品。其招牌营养素不但含量高，而且质量优，是较受现代人欢迎的食物之一。在《时代》杂志评出的十大健康食品中，燕麦名列第五。燕麦经过精细加工制成麦片，使其食用更加方便，口感也得到改善，成为深受欢迎的保健食品。\r\n燕麦一般分为带稃型和裸粒型两大类。世界各国栽培的燕麦以带稃型的为主，常称为皮燕麦。我国栽培的燕麦以裸粒型的为主，常称裸燕麦。裸燕麦的别名颇多，在我国华北地区称为莜麦；西北地区称为玉麦；西南地区称', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7000, '高粱', NULL, '米面豆乳', '又名蜀黍、高粱米、芦粟、桃粟、蜀秫、木稷、芦粟、番黍、荻粱。\r\n高粱（Sorghumvulgare，spp、），脱壳后即为高梁米，子粒呈椭圆形、倒卵形或圆形，大小不一，呈白、黄、红、褐、黑等颜色，一般随种皮中单宁含量的增加，粒钯由浅变深。胚乳按结构分为粉质、角质、蜡质、爆粒等类形，按颜色又有红、白之分；红者又称为酒高粱，主要用于酿酒，白者用于食用，性温味甘涩。高粱按性状及用途可分为食用高粱、糖用高粱、帚用高粱。高粱是酿酒、制醋、提取淀粉、加工饴糖的原料。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7001, '芡实', NULL, '米面豆乳', '芡实，又名鸡头米、水鸡头、鸡头苞等，古药书中说它是“婴儿食之不老，老人食之延年”的粮菜佳品。它具有“补而不峻”、“防燥不腻”的特点，是秋季进补的首选食物。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7002, '糙米', NULL, '米面豆乳', '糙米是稻米经过加工后所产的一种米。比起白米更富有许多维他命、矿物质与膳食纤维，所以糙米向来被视为是一种健康食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7003, '紫米', NULL, '米面豆乳', '水稻(oryza sativa L.)的一个品种。全国仅有陕西汉中、四川、贵州、云南有少量栽培，是较珍贵的水稻品种。\r\n紫米颗粒均匀，颜色紫黑，食味香甜，甜而不腻。紫米煮饭，味极香，而且又糯，民间作为补品，有紫糯米或“药谷”之称。紫米熬制的米粥清香油亮、软糯适口，因其含有丰富的营养，具有很好的滋补作用，因此被人们称为“补血米”、“长寿米”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7004, '黑糯米', NULL, '米面豆乳', '紫米是稻米中的珍贵品种，属于糯米类，紫米熬制的米粥清香油亮、软糯适口，因其含有丰富的营养，具有很好的滋补作用，因此被人们称为“补血米”、“长寿米”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7005, '红米', NULL, '米面豆乳', '红米，红曲是以籼米为原料，采用现代生物工程技术分离出优质的红曲霉菌（monascuspurpureus）经液体深层发酵精致而成，是一种纯天然、安全性高、有意于人体健康的食品添加剂。而且本品色泽鲜艳、色调纯正、饱满、光热稳定性好，是天然绿色食品理想的着色剂。它应用范围广泛，包括食品类（肉制品、果汁、色酒、果酱、饮料、糖果、糕点、酱油、保健醋等）；药品类（药品着色剂、功能性保健品）；化妆品类。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7006, '黄米', NULL, '米面豆乳', '黄米本是北方一种粮食，照字典的解释，是去了壳的黍子的果实，比小米稍大，颜色淡黄，煮熟后很黏，是20世纪50年代以前的重要粮食作物之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7007, '粳米', NULL, '米面豆乳', '粳米为人所常食米，为五谷之长。为禾本科粳稻的种仁，一般呈椭圆形颗粒状，较圆胖，半透明，表面光亮，腹白度较小。粳米在我国各地均有栽培，种植历史已有6900多年，粳米饮食文化是我国饮食文化的特产之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7008, '玉米糁', NULL, '米面豆乳', '北方农村早期的一种早晚吃食，发音是玉米糁（shēn)子，也叫棒子糁。玉米成熟后去皮也可不去，上磨子粉碎成小颗粒，大约是放在手里有沙粒感的大小，也可磨成很细的面粉状，吃的时候烧开了水，一手拿勺子，一手把粉碎的玉米小颗粒均匀的撒入锅内，撒完后继续搅匀，然后再烧开两三次，熟后的或稀或稠的糊状就叫糁子白粥，其实就是玉米粥。现在城里人叫的玉米糊糊即是玉米糁子的一种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7009, '泰国香米', NULL, '米面豆乳', '泰国香米是原产于泰国的长粒型大米，是籼米的一种。因其香糯的口感和独特的露兜树香味享誉世界。是仅次于印度香米的世界上最大宗的出口大米品种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7010, '寿司米', NULL, '米面豆乳', '寿司是日本人最喜爱的传统食物之一，主要材料是用醋调味过的冷饭（简称醋饭），再加上鱼肉，海鲜，蔬菜或鸡蛋等作配料，其味道鲜美，很受日本民众的喜爱。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7011, '血糯米', NULL, '米面豆乳', '血糯米是带有紫红色的种皮的大米，因为米质有糯性，所以称为血糯，天然的血糯米经过温水浸泡后，由于种皮的红色素被水溶液慢慢溶解，会逐渐出现紫红色水溶液，随时间延长，红色越来越浓。并在煮熟后，红色种皮会与胚（米粒）分离。假冒的血糯米是以劣质大米，通过紫红色的颜料染色而成。最明显的区别是浸泡在水里后，水质变红的速度明显快于血糯米真品，多洗几次就会露出白米的原形，而且烧煮后没有红色种皮出现', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7012, '大麦', NULL, '米面豆乳', '大麦，具坚果香味，可做不发酵食物，在北非及亚洲部分地区尤喜用大麦粉做麦片粥，大麦是这些地区的主要食物之一。珍珠麦(圆形大麦米)是经研磨除去外壳和麸皮层的大麦粒，加入汤内煮食，见於世界各地。可制作麦芽糖。啤酒主要用大麦芽制造，总产量的10％以上用於制造啤酒。大麦芽也用制蒸馏饮料。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7013, '高粱米', NULL, '米面豆乳', '高粱起源于非洲，是古老的谷类作物之一。公元前2000年传到埃及、印度、后入中国栽培。现主产于美国、阿根廷、墨西哥、苏丹、尼日利亚、印度和中国。我国以东北各地为最多。高粱蒸饭、煮粥、磨面可以蒸食，贴饼子。但因其为粗粮，口感不太好。脱壳后的高梁米，呈倒卵形或圆形，大小不一，有白、黄、红、褐、黑等颜色。高粱有40余种，按性状及用途可分为食用高粱、糖用高粱、帚用高粱等类。谷粒供食用、酿高粱酒或制饴糖。糖用高粱的秆可制糖浆或生食；帚用高粱的穗可制笤帚或炊帚；感有常规的、甜的、黏的。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7014, '籼米', NULL, '米面豆乳', '籼（xian）米是大米的一种，米的一种特殊种类。根据稻谷收获季节，还可分为早籼米和晚籼米。是我中国出产最多的一种稻米，以广东、湖南、四川等省为主要产区。其米粒为长圆形或细长型，米色较白，透明度比其他米较差。因其吸水性强，胀性较大，所以出饭率较高。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7015, '荞麦', NULL, '米面豆乳', '荞麦为蓼科植物养麦的种子，全国各地均有分布和栽培，尤以北方为多，是重要的粮食作物和救荒作物之一，荞麦食味清香，在我国东北、华北、西北、西南以及日本、朝鲜、前苏联都是很受欢迎的食品。我国栽培的主要普通荞麦和鞑靼荞麦两种，前者称甜荞，后者称苦荞。荞麦食品是直接利用荞米和荞麦面粉加工的。荞米常用来做荞米饭、荞米粥和荞麦片。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7016, '香米', NULL, '米面豆乳', '香米是一种具有诱人特殊芳香的优质稻种，其类型包括香籼、香粳和香糯，均具有特殊的香味，米粒晶莹，富含人体多种必须的营养成分，具某种滋补和药用效果。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7017, '米饭', NULL, '米面豆乳', '米是五谷之首，米饭更是人们日常饮食中的主角之一；一味米饭，与五味调配，几乎可以供给全身所需营养。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7018, '粟米', NULL, '米面豆乳', '粟米为禾本科植物粟加工去皮后的成品。起源于我国黄河流域，在我国已有悠久的栽培历史，现主分布于我国华北、西北和东北各地区。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7019, '江米', NULL, '米面豆乳', '江米属于圆糯米，属粳糯，形状圆短，白色不透明，口感甜腻，黏度稍逊于长糯米。适合做粽子、酒酿、汤圆、米饭等等。因其香糯黏滑，常被用以制成风味小吃。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7020, '丝苗米', NULL, '米面豆乳', '丝苗米是具有明显的地方特色的籼稻优质稻米，外观品质美观靓丽，长粒形、细丝苗米长苗条、晶莹洁白、米泛丝光、玻璃质;直链淀粉含量中等，质地软硬适中，煮饭爽滑可口，具有清新香味，口感佳，饭粒条状而不烂。素有米中碧玉，饭中佳品的美誉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7021, '山兰米', NULL, '米面豆乳', '山兰米是一种黎家独有的旱生山兰糯稻谷，种植时不施任何化肥，是正宗的“绿色食品”，具有独特的米脂芳香。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7022, '长米', NULL, '米面豆乳', '长米即水果玉米，水果玉米是适合生吃的一种超甜玉米，青棒阶段皮薄、汁多、质脆而甜，可直接生吃，薄薄的表皮一咬就破，清香的汁液溢满齿颊，生吃熟吃都特别甜、特别脆，像水果一样，因此被称为“水果玉米”。 水果玉米有很多品种，都具有非常高的营养价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7023, '长糯米', NULL, '米面豆乳', '长糯米即是籼糯，米粒细长，颜色呈粉白、不透明状，黏性强。适合做粽子、酒酿、汤圆、米饭等等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7024, '皂角米', NULL, '米面豆乳', '皂角米俗称雪莲子、皂角米、皂角仁、皂角精，是皂荚的果实。属高能量、高碳水化合物、低蛋白，低脂肪食物。具有养心通脉、清肝明目、美容养颜等功效。具有放水加热膨胀，胶质半透明，香糯润口，是调和人体脏腑功能的珍贵纯天然绿色滋补食品。皂角米分单荚和双荚，单荚产区主要是云南梁河，双荚产区主要是贵州毕节。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7025, '糜（糜子）', NULL, '米面豆乳', '带皮糜子(Panicum miliaceum L.)属禾本科黍属(Panicum miliaceum)，又称黍、稷、禾祭 和糜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7026, '胚芽米', NULL, '米面豆乳', '胚芽米是保留米的胚芽部分，其他部分则与白米完全相同的一种米。其实米最重要的中心部分为胚芽。顾名思义，所谓的“芽”，乃是生出新的生命的部分。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7027, '蓬莱米', NULL, '米面豆乳', '蓬莱米，是一种在台湾广为使用的稻米，属于粳米亚种，由日本稻作专家矶永吉以日本种稻米所改良成功。1921年第一次试种植于台北阳明山上的竹子湖，原名为“台中65号”，后来曾计划改名为“新台米”或“新高米”，以有别于台湾本土品种的“在来米”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7028, '青稞', NULL, '米面豆乳', '是禾本科大麦属的一种禾谷类作物，因其内外颖壳分离，籽粒裸露，故又称裸大麦、元麦、米大麦。主要产自中国西藏、青海、四川、云南等地，是藏族人民的主要粮食。青稞在青藏高原上种植约有400万年的历史，从物质文化之中延伸到精神文化领域，在青藏高原上形成了内涵丰富、极富民族特色的青稞文化。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7029, '芡实米', NULL, '米面豆乳', '芡实米别名鸡头米、鸡头莲、刺莲等。是我国较常用中药材。应用历史悠久，在国内外久负盛名，本品为睡莲科植物芡的干燥成熟种仁。主要分布于黑龙江、吉林、辽宁、河北、河南、山东、江苏等地。芡实米是一种常用中药材。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7030, '稻米', NULL, '米面豆乳', '稻米也叫稻或水稻是一种可食用的谷物，一年生草本植物，性喜温湿， 中国南方俗称其为“稻谷”或“谷子”，脱壳的粮食是大米。煮熟后称米饭（中国北方讲法）或白饭（中国南方讲法）。全世界有一半的人口食用它。主要在亚洲、欧洲南部和热带美洲及非洲部分地区。总产量占世界粮食作物产量第三位，低于玉米和小麦，但能维持较多人口的生活', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7031, '越光米', NULL, '米面豆乳', '越光米在日本家喻户晓，被称作“白雪米”，其味道非常好，价格也相对昂贵。据了解，新潟的土质不同于中国大部分地区的弱碱性，它呈弱酸性;同时新潟位于日本最长的 河流信浓川的入海口，信浓川高清度的深雪融水滋养了越光米;新潟县昼夜温差大、日照充足使大米颗粒饱满。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7032, '野米', NULL, '米面豆乳', '野米是中国进口美洲菰米的翻译叫法。野米与稻米是两种不同的东西。野米是一种禾本科菰（菰gu第一声）的种子，外壳不用打磨，呈灰黑颜色，含有极高的营养成分。野米中的蛋白质、多种微量元素、膳食纤维比大米高得多，是难得的保健食物，可称之为“米”中之王。在中国，野米也叫菰米。野米的叫法是美洲菰米中国翻译叫法。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7033, '岩米', NULL, '米面豆乳', '十六世纪以前碳石岩米又称石草，作为一种药用植物在本草纲目里面有详细记载，现代作为营养康复的良品代表，被世界医学界广泛应用于临床应用作为精华提炼而成的。岩米因为生长位置特殊，产量极其稀少，故不被世人所知。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7034, '阴米', NULL, '米面豆乳', '阴米是加工过的一种米。用糯米蒸熟后阴干而成，阴干过程中要把黏在一起的熟糯米团掰散，让米粒颗颗分离。可以单用煮粥或与绿豆混合煮粥。还可炸米泡或炒熟碾粉用开水泡食，具有暖脾、补中益气等效用。阴米已经是熟的，因此煮粥需要的时间较短，是一种健康的快餐。阴米是具有地域特征的食物，通常在川渝、湖南、湖北等地可以见到。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7035, '鸡头米', NULL, '米面豆乳', '芡实米别名鸡头米、鸡头莲、刺莲等。是我国较常用中药材。应用历史悠久，在国内外久负盛名，本品为睡莲科植物芡的干燥成熟种仁。主要分布于黑龙江、吉林、辽宁、河北、河南、山东、江苏等地。芡实米是一种常用中药材。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7036, '菰米', NULL, '米面豆乳', '菰米就是茭白。生于湖泊中，结的果实像米，很稀有。九月抽出茎，开的花像苇。果实长一寸多，秋霜过后采摘，皮呈黑褐色。菰米为中国古代“六谷”之一，至今已有3000多年的历史。菰亦作“雕胡”、“苽”、“茭籽”或“黑米”等。在唐代，雕胡饭是招待贵客的上品，据传用菰米煮饭，又软又糯，香气扑鼻。很多诗人都钟情于它，并留下了千古佳句。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7037, '红曲米', NULL, '米面豆乳', '红曲米又叫红曲、赤曲、红米、福米、丹曲、红大米、红槽、红曲米、红曲。为棕红色至紫红色的米粒，以籼稻、粳稻、糯米等稻米为原料，用红曲霉菌发酵而成，早在一千多年前就已经有了。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7038, '红薏米', NULL, '米面豆乳', '红薏米也称为红薏仁，是从古代就有的一种谷类，原产于越南。富含薏仁脂、淀粉、蛋白质以及、维生素等，有丰富的营养，又是普遍、常吃的食物，性味甘淡微寒，有利水消肿、健脾去湿、舒筋除痹、清热排脓等功效，为常用的利水渗湿药。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7039, '爆米花玉米粒', NULL, '米面豆乳', '爆米花玉米粒即爆裂玉米，爆裂玉米是一种用于爆制玉米花的玉米类型。爆裂玉米育种起源于美国，第一个用于工厂化生产的爆裂玉米品种是一种叫做“西班牙”的爆裂玉米，第一个用于商业生产的爆裂玉米杂交种是在1934年明尼苏达农业试验站发放的叫做“Minhybrid250”的姊妹交单交种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7040, '蝴蝶面', NULL, '米面豆乳', '属于意大利面。原料相同，但形状不同。蝴蝶面在上海、江苏及沿江一带享有较高声誉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7041, '白面', NULL, '米面豆乳', '又名小麦面粉、小麦粉。\r\n小麦经磨制加工后，即成为面粉，也称小麦粉。\r\n按面粉中蛋白质含量的多少，我们可以把面粉分为高筋粉HighGlutenFlour、中筋粉MiddleGlutenFlour、低筋粉LowGlutenFlour\r\n1、高筋粉10.5-13.5面包\r\n2、中筋粉8.0-10.5面条点心\r\n3、低筋粉6.5-8.5点心菜肴\r\n从等级上看，我们又可以把面粉分为特等粉，一等粉，二等粉等各个等级。\r\n1、特等粉7.20.32低筋粉点心用\r\n2、一等粉12.70.43高筋粉面包用\r\n3、一等粉10', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7042, '粘米粉', NULL, '米面豆乳', '禾本科植物稻的种子（大米）磨成的粉，又叫大米粉或籼米粉，是多食品的原料。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7043, '荞麦面粉', NULL, '米面豆乳', '又名三角麦、乌麦、花荞，我国栽培的主要有普通荞麦和鞑靼荞麦两种，前者称甜荞，后者称苦荞，由于苦荞的种实含芦丁，所以也被称为芦丁苦荞。荞麦在我国种植的历史十分悠久，公元前5世纪的《神农书》中就有关于荞麦是当时栽培的八谷之一的记载。除我国外，前苏联、尼泊尔、朝鲜、日本及美洲和欧洲的部分地区的人们也喜欢食用荞麦，尤其是日本，至今仍把荞麦食品列为保健食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7044, '藕粉', NULL, '米面豆乳', '藕粉是久负盛誉的传统滋养食品，特别适于病人、产妇及老幼体弱者食用。莲藕粉营养价值高，药疗作用也好，而且制成方便食品后食用简易，用开水一冲就可食用，且味道鲜美，老少皆宜，难怪一上市，便受到广泛好评。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7045, '玉米面', NULL, '米面豆乳', '玉米又名苞谷、棒子、玉蜀黍、有些地区以它作主食。玉米是粗糙中的保健佳品，多食玉米对人体的健康颇为有利。玉米面没有等级之分，只有粗细之别。玉米面可制作窝头、丝糕等。玉米面中的蛋白质不具有形成面筋弹性的能力，持气性能差，需与面粉掺和后方可制作各种发酵点心。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7046, '糯米粉', NULL, '米面豆乳', '糯米粉别名：糯米面。水磨糯米粉是以柔软、韧滑、香糯而著称，它可以制作汤团、元宵之类食品和家庭小吃。含有维生素B1、维生索B2、蛋白质、脂肪、糖类、钙、磷、铁、烟酸及淀粉等，营养丰富，为温补强壮食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7047, '面条', NULL, '米面豆乳', '又名面、水面、面条子。\r\n面条古称“汤饼”、“奢面”、“素饼”、“煮饼”、“水引饼”、“不托”等；面条一词是后来才有的；据考证，我国面条起源于汉代，至今已有2000多年的历史，因面条要在“汤”中煮熟，所以又叫“汤饼”。早期的面条有片状的、条状的。片状的是将面团托在手上，拉扯成面片下锅而成。到了魏、晋、南北朝，面条的种类增多。著名的有《齐民要术》中收录的“水引”、“水引”是将筷子般粗的面条压成“韭叶”形状。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7048, '莜麦面', NULL, '米面豆乳', '莜麦是一年生草本植物。生长期短，成熟后子实容易和外壳脱离，磨成粉后可食用，就叫莜麦面，也叫裸燕麦面，又叫油麦面，这种植物的子实也叫莜麦。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7049, '黄豆面', NULL, '米面豆乳', '黄豆面和黄豆粉是一样的，指黄豆炒过后磨制而成的面，含大量食物纤维。性平、味甘；健脾、补血、利水。一般人群均可食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7050, '荞麦面', NULL, '米面豆乳', '荞麦面是一种日式食物，类似中国的饸饹，是用荞麦面粉和水，和成面团压平后切制的细面条，煮熟食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7051, '高筋面粉', NULL, '米面豆乳', '高筋面粉的蛋白质含量平均为13.5%，通常蛋白质含量在11.5%以上就可叫做高筋面粉。蛋白质含量高，因此筋度强，常用来制作具有弹性与嚼感的面包、面条等。在西饼中多用于在松饼（千层酥）和奶油空心饼（泡芙）中。在蛋糕方面仅限于高成分的水果蛋糕中使用', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7052, '中筋面粉', NULL, '米面豆乳', '中筋面粉即普通面粉。蛋白质含量平均在11%左右，中筋粉多用在中式点心制作上，如包子、馒头、饺子等。大部分中式点心都是以中筋粉来制作的。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7053, '低筋面粉', NULL, '米面豆乳', '低筋面粉(cakeflour)蛋白质含量平均在8.5%左右，因此筋度弱，常用来制作口感柔软、组织疏松的蛋糕、饼干、花卷等。在烘培中，低筋面粉一般适用于饼干和蛋糕的制作。如果找不到低筋面粉，可以用中筋面粉(all-purpose)（千万不要用那种叫\"饺子粉\"的,那种面粉面筋很多的）和玉米淀粉4：1的比例调和而成。如果想更低筋再加点玉米淀粉也可以。如果你家只有高筋面粉可以以1：1的比例用高筋面粉和玉米淀粉调配，也可以把高筋面粉放到微波炉里加热2~3分钟减少筋度再与淀粉调配成低筋面粉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7054, '小米面', NULL, '米面豆乳', '小米宜与大豆或肉类食物混合食用，这是由于小米的氨基酸中缺乏赖氨酸，而大豆的氨基酸中富含赖氨酸，可以补充小米的不足。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7055, '全麦面粉', NULL, '米面豆乳', '全麦粉是整粒小麦在磨粉时，仅仅经过碾碎，而不需经过除去麸皮程序，是整粒小麦包含了麸皮与胚芽全部磨成的粉。小麦中的麸皮含有营养价值极高的纤维素。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7056, '黄米面', NULL, '米面豆乳', '黍子去皮俗称黄米，磨成的面粉俗称黄米面，常用来做糕，有素糕和油炸糕之分。用黄米面做出来的糕，一般人是不会做的。有的地方作为结婚，庆典的必备糕点。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7057, '粟粉', NULL, '米面豆乳', '粟粉是用玉米制成的淀粉。与水或牛奶混合后有独特的外观和质感，常被用来掺在白糖粉作为抗粘结剂。常被用作布丁等食品的凝固剂。市面一般的现成布丁预拌材料（pudding mixes）都含有玉米粉。利用双层蒸锅（double boiler），以牛奶、砂糖、玉米粉和增香剂等配料就可轻易制作出简单的玉米粉布丁。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7058, '苏打粉', NULL, '米面豆乳', '碳酸氢钠(Sodium Bicarbonate)，俗称“小苏打”、“苏打粉”、“重曹”，白色细小晶体，在水中的溶解度小于碳酸钠。固体50℃以上开始逐渐分解生成碳酸钠、二氧化碳和水，270℃时完全分解。碳酸氢钠是强碱与弱酸中和后生成的酸式盐，溶于水时呈现弱碱性。常利用此特性作为食品制作过程中的膨松剂。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7059, '小麦粉', NULL, '米面豆乳', '小麦经磨制加工后，即成为面粉，也称小麦粉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7060, '藜麦', NULL, '米面豆乳', '藜麦（学名：Chenopodium quinoa willd）原产于南美洲安第斯山区，是印加土著居民的主要传统食物，有5000-7000多年的种植历史，由于其具有独特的丰富、全面的营养价值，养育了印加民族，古代印加人称之为“粮食之母”。藜麦种子颜色主要有黑、红、白几种颜色，其中黑、红色的籽粒较小，白色口感较好。藜麦在1980年代被美国宇航局用于宇航员的太空食品。联合国粮农组织认为藜麦是唯一一种单体植物即可基本满足人体基本营养需求的食物，正式推荐藜麦为最适宜人类的完美的全营养食品。联合国将2013年宣布为国', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7061, '麦仁', NULL, '米面豆乳', '麦仁为全麦谷物颗粒，含有麦类谷物的全部营养成分。 麦仁的坚果风味较重，这种淡棕色的颗粒成为谷制品或面包、烤制品的添加剂。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7062, '米形面', NULL, '米面豆乳', '米形面是用杜兰小麦制成稻米形状的面食，是意大利的特色面食之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7063, '南瓜粉', NULL, '米面豆乳', '南瓜粉就是南瓜的粉末。南瓜粉含有丰富的碳水化合物、蛋白质、膳食纤维、维生素、胡萝卜素、果胶，及钾、铁、镁等丰富的微量元素，此外还有瓜氨酸、精氨酸等及一些酶类对人体十分有益，脂肪含量却非常低。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7064, '杏仁粉', NULL, '米面豆乳', '杏仁粉是杏制品的一种，由杏仁研磨加工而来。 具有丰富营养价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7065, '澄粉', NULL, '米面豆乳', '澄粉又称澄面、澄粉、汀粉、小麦淀粉。是一种无筋的面粉，成份为小麦。可用来制作各种点心如虾饺、粉果、肠粉等。是加工过的面粉，用水漂洗过后，把面粉里的粉筋与其他物质分离出来，粉筋成面筋，剩下的就是澄面。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7066, '高粱面', NULL, '米面豆乳', '高粱面是用高粱磨成的粉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7067, '裹粉', NULL, '米面豆乳', '裹粉主要是用来针对油炸产品进行处理的外裹层。使用裹粉或炸粉将肉类或蔬菜类裹上然后油炸，可以赋予油炸品不同的风味，保持其原有风味不流失，保持其水份，避免直接将肉或蔬菜炸焦。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7068, '葛根粉', NULL, '米面豆乳', '葛根粉，也称葛粉是《中华本草》收载的草药，药用来源为为豆科植物野葛、甘葛藤的块根经水磨而澄取的淀粉。可以分为葛根淀粉和葛根全粉，两者区别在于加工艺不同。葛根内含12%的黄酮类化合物，如葛根素、大豆黄酮苷、花生素等营养成分，还有蛋白质、氨基酸、糖、和人体必需的铁、钙、铜、硒等矿物质，是老少皆宜的名贵滋补品，有“千年人参”之美誉。既有药用价值，又有营养保健之功效。主要产于湖北、贵州、广西、江苏、江西、湖南等地。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7069, '黑麦粉', NULL, '米面豆乳', '黑麦粉是由黑麦磨成粉而成的，黑麦是一种谷类作物，穗状花序，小穗2至多个，果含一粒种子。学名为Secale cereale。黑麦栽培可能在西方。 黑麦元前6500年源于西南亚，以後向西经巴尔干半岛遍及欧洲。现广泛种植於欧洲、亚洲和北美。黑麦适应於其他谷类不适宜的气候和土壤条件，在高海拔地区生长良好。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7070, '油酥', NULL, '米面豆乳', '面粉中和以食油，烙熟后发稣的（食品）。如：油酥饼。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7071, '饺子粉', NULL, '米面豆乳', '饺子粉是面粉中的一种，普通面粉是中筋粉，饺子粉是高筋粉，包出的饺子皮比较筋道，耐煮，不易破皮。我们平常包饺子用的面粉大多是中筋粉包出的饺子不易久煮，而且容易炖烂。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7072, '麦芯粉', NULL, '米面豆乳', '麦芯粉又称为麦心粉。是由小麦中心部分的胚乳磨制而成的小麦面粉。粉质洁白，面筋质量好，是比特制精粉加工精度更高的优质面粉，适合制作各种高档面点。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7073, '面包粉', NULL, '米面豆乳', '面包粉，硬麦制作而成，面筋含量高，一般控制在32.5~34.0%之间。面筋质量好、韧性大、弹性好，吹泡体积大。国外已发展到白面包专用粉、汉堡包专用粉、油炸面包专用粉等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7074, '黑米面', NULL, '米面豆乳', '黑米是一种药、食兼用的大米，属于糯米类。黑米是由禾本科植物稻经长期培育形成的一类特色品种。粒型有籼、粳两种，粒质分糯性和非糯性两类。糙米呈黑色或黑褐色。黑米外表墨黑，营养丰富，有“黑珍珠”和“世界米中之王”的美誉。由黑米研磨而成的粉即为黑米面。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7075, '鲜切面', NULL, '米面豆乳', '鲜切面即以前的家庭手工面条， 由于加水较多， 面筋形成充分， 因而面条耐煮、筋性较强、不易混汤、口感比挂面要好许多。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7076, '莜面', NULL, '米面豆乳', '莜面是由莜麦加工而成的面粉，在山西、内蒙古，河北坝上地区也是莜麦面食品的统称。莜面中含有钙、磷、铁、核黄素等多种人体需要的营养元素和药物成份，可以治疗和预防糖尿病、冠心病、动脉硬化、高血压等多种疾病。同时莜面中含有一种特殊物质——亚油酸，它对于人体新陈代谢具有明显的功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7077, '黑豆', NULL, '米面豆乳', '又名黑大豆、乌豆、橹豆、马料豆、料豆、枝仔豆、冬豆子、零乌豆。\r\n黑豆BlackBean，有豆中之王的美称，为豆科植物大豆的黑色种子，与黄大豆间种，种皮黑色。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7078, '小豆', NULL, '米面豆乳', '又名赤豆、赤小豆、红豆。红小豆富含淀粉，因此又被人们称为“饭豆”。它具有“律律液、利小便、消胀、除肿、止吐”的功能，被李时珍称为“心之谷”。红小豆是人们生活中不可缺少的高营养，多功能的小杂粮。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7079, '红豆', NULL, '米面豆乳', '又名赤豆、赤小豆。红小豆富含淀粉，因此又被人们称为“饭豆”。它具有“律律液、利小便、消胀、除肿、止吐”的功能，被李时珍称为“心之谷”。红小豆是人们生活中不可缺少的高营养，多功能的小杂粮。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7080, '绿豆', NULL, '米面豆乳', '绿豆又叫青小豆，是我国人民的传统豆类食物。绿豆中的多种维生素、钙、磷、铁等无机盐都比粳米多。因此，它不但具有良好的价值，还具有非常好的药用价值。有“济世之良谷”的说法。在炎炎夏日，绿豆汤更是老百姓最喜欢的消暑饮料。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7081, '青豆', NULL, '米面豆乳', '又名青大豆。\r\n按其子叶的颜色，又分为两种：青皮青仁大豆，青皮黄仁大豆。青豆含丰富的蛋白质，其中含人体必需的多种氨基酸，尤其以赖氨酸含量高。\r\n大豆为豆科大豆属一年生草本植物，原产我国。我国自古栽培，至今已有5000年的种植史。现在全国普遍种植，在东北、华北、陕、川及长江下游地区均有出产，以长江流域及西南栽培较多，以东北大豆质量最优。世界各国栽培的大豆都是直接或间接由我国传播出去的。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7082, '黄豆', NULL, '米面豆乳', '又名大豆、黄大豆、枝豆、菜用大豆。\n\r\n大豆，为豆科大豆属一年生草本植物，原产我国。根据大豆的种皮颜色和粒形分为五类：黄大豆、青大豆、黑大豆、其他大豆（种皮为褐色、棕色、赤色等单一颜色的大豆）、饲料豆（一般籽粒较小，呈扁长椭圆形，两片子叶上有凹陷圆点，种皮略有光泽或无光泽）。我国自古栽培，至今已有5000年的种植史。现在全国普遍种植，在东北、华北、陕、川及长江下游地区均有出产，以长江流域及西南栽培较多，以东北大豆质量最优。世界各国栽培的大豆都是直接或间接由我国传播出去的。由于它的营养价值很高，被称为“豆', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7083, '红芸豆', NULL, '米面豆乳', '红芸豆为山西特产，颗粒硕大、色泽鲜艳，兼有营养药用价值，历来是国际贸易市场上的畅销货；岢\r\n红芸豆(2张)岚县地处晋西北高寒山区，农田面积广阔，土层深厚，无霜期短，夏季持续高温，降水量又相对集中，是红芸豆种植的理想场所。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7084, '红腰豆', NULL, '米面豆乳', '红腰豆原产于南美洲，是乾豆中营养最丰富的一种，含丰富的维他命A、B、C及E，也含丰富的铁质和钾等矿物质。红腰豆有补血、增强免疫力、帮助细胞修补及防衰老等功效。红腰豆煲稔后可以加在沙律中或饭菜内，也可用它煮有味饭、炆咖喱或做蔬菜浓汤，为家人（特别是成长中的儿童）多添营养。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7085, '白豆', NULL, '米面豆乳', '白豆，学名眉豆，又名饭豇豆、米豆、饭豆、甘豆等。白豆是豆科植物菜豆种子，球形或扁圆，比黄豆略大，也有状如腰果的，又名饭豆。分布中国河北、江苏、四川、云南等省，越南亦有产品。眉豆是粤人所习称。《陆川本草》名白饭豆。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7086, '白扁豆', NULL, '米面豆乳', '白扁豆为豆科一年生缠绕草本植物扁豆的成熟种子。扁豆原产印度、印度尼西亚等热带地区，约在汉晋间引入我国。秋、冬二季采收成熟果实，晒干，取出种子，再晒干。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7087, '赤小豆', NULL, '米面豆乳', '赤小豆，又名赤豆、红饭豆、饭豆、蛋白豆、赤山豆，是豆科植物，外形与红豆相似而稍微细长。一年生草本植物，赤小豆主要用于中药材，常与红豆混用，具备利水消肿，解毒排脓等功效。全国各地普遍栽培。赤小豆可整粒食用，或用于煮饭、煮粥、做赤豆汤。常用来做成豆沙作为馅料，美味可口。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7088, '马牙大豆', NULL, '米面豆乳', '马牙大豆，是豆类中营养价值最高的品种，在百种天然的食品中，它名列榜首，含有大量的不饱和脂肪酸，多种微量元素、维生素及优质蛋白质。大豆经加工可制作出很多种豆制品，是高血压、动脉硬化、心脏病等心血管病人的有益食品。大豆富含蛋白质，且所含氨基酸较全，尤其富含赖氨酸，正好补充了谷类赖氨酸的不足的缺陷.', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7089, '小圆豆', NULL, '米面豆乳', '小圆豆为豆科菜豆属中的一种一年生草本植物。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7090, '旭松纳豆', NULL, '米面豆乳', '旭松纳豆是大豆经纳豆菌发酵而成，是盛产于日本的一种保健食品。目前，全世界，尤其是整个东南亚的人们对纳豆的作用高度认可，食用者众多。而纳豆制成的保健产品、生物制剂被人们广泛接受。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7091, '白芸豆', NULL, '米面豆乳', '芸豆(白)，其生物学名叫多花菜豆，因花色多样而得名。属豆科，蝶形花亚科，菜豆族菜豆属，白芸豆原产美洲的墨西哥和阿根廷，后经人工栽培驯化已适应冷凉潮湿的高原地带。种植面积较大的国家是美洲的阿根廷、美国、墨西哥，欧洲的英国，亚洲的中国、日本等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7092, '大豆', NULL, '米面豆乳', '黄豆又叫青仁乌豆、大豆、泥豆、马料豆、秣食豆，品种有，冬豆，秋豆，四季豆，我国主产于东北地区。中国古称菽，是一种其种子含有丰富蛋白质的作物。豆科植大豆呈椭圆形、球形，颜色有黄色、淡绿色、黑色等。大豆最常用来做各种豆制品、榨取豆油、酿造酱油和提取蛋白质。豆渣或磨成粗粉的大豆也常用于禽畜饲料。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7093, '鹰嘴豆', NULL, '米面豆乳', '鹰嘴豆，为豆科草本植物，又名桃尔豆、鸡豆、鸡心豆等，是印度和巴基斯坦的重要的蔬菜之一，在欧洲食用鹰嘴豆也十分普遍，也是维吾尔医常用药材。因其面形奇特，尖如鹰嘴，故称此名。鹰嘴豆为豆科草本植物，起源于亚洲西部和近东地区。鹰嘴豆的淀粉具有板栗香味。 鹰嘴豆粉加上奶粉制成豆乳粉，易于吸收消化，是婴儿和老年人的营养食品。鹰嘴豆还可以做成各种点心和油炸豆。籽粒可做利尿剂、催奶剂、可治疗失眠，预防皮肤病和防治胆病。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7094, '蜜豆', NULL, '米面豆乳', '蜜豆是由红豆制作而成，原料：红豆、红糖（或白糖或蜂蜜，随个人喜好）制作而成。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7095, '眉豆', NULL, '米面豆乳', '眉豆，是豆科植物菜豆种子，球形或扁圆，比黄豆略大，也有状如腰果的，又名饭豇豆、米豆、饭豆、甘豆、白豆等。属于干豆类及制品，一年生缠绕草本，是豆科植物扁豆种子，球形或扁圆，比黄豆略大，也有状如腰果的。分布中国河北、江苏、四川、云南等省，越南亦有产品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7096, '干蚕豆', NULL, '米面豆乳', '干蚕豆，也就是收获后晒干保存的蚕豆种子。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7097, '金丝豆', NULL, '米面豆乳', '金丝豆是中国云南的特产食材，在市场上并不常见，它外表多为红色，带有淡淡的金丝，它的名字也是依此得来的。金丝豆煮熟以后口感细嫩软糯香气诱人，而用易于主消化与吸收。金色的我不但口感好，营养价值也特别高，人们食用以后能保健身体也能预防疾病。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7098, '小黑豆', NULL, '米面豆乳', '黑豆有多种，在日常生活中我们常见的一种就是大黑豆，然而还有一种就是小黑豆，如果我们不仔细的去看根本就分辨出来哪一种是大黑豆哪一种是小黑豆.。其实对于小黑豆来说很容易识别的，小黑豆的粒型扁长，豆仁是黄色的。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7099, '百叶结', NULL, '米面豆乳', '豆制品的一种，色黄白，可凉拌，可清炒，可煮食。百叶的叫法多见于苏南地区；北方地区称豆腐皮；赣、苏（北）、皖地区称为千张。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7100, '茶干', NULL, '米面豆乳', '茶干，是一种高端豆制品。可以看做是豆腐干的一个细分品类，但无论做工、用料，都要考究很多，水质尤其关键。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7101, '嫩豆腐', NULL, '米面豆乳', '豆腐是我国炼丹家——淮南王刘安发明的绿色健康食品。时至今日，已有二千一百多年的历史，深受我国人民、周边各国、及世界人民的喜爱。发展至今，已品种齐全，花样繁多，俱有风味独特，制作工艺简单食用方便的特点。有高蛋白，低脂肪，降血压，降血脂，降胆固醇的功效。是生熟皆可，老幼皆宜，养生摄生、益寿延年的美食佳品。安徽省淮南市——刘安故里，每年9月15日，有一年一度的豆腐文化节。深究者，可详阅《淮南子》及淮南地方志。理学家——朱熹有《素食诗》传世。 \r\n豆腐是一种以黄豆为主要原料的食物，本身没有什么味道，但是含有高蛋白', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7102, '内酯豆腐', NULL, '米面豆乳', '内酯豆腐以葡萄糖酸内酯为凝固剂生产豆腐，可减少蛋白质流失，提高保水率。大大地增加了产量，且豆腐洁白细腻、有光泽、口感好、保存时间长。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7103, '米豆腐', NULL, '米面豆乳', '米豆腐是贵州著名的小吃，它是用大米淘洗浸泡后加水磨成米浆，然后大火熬制，做成“豆腐”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7104, '烤麸', NULL, '米面豆乳', '烤麸由生面筋经保温发酵后高温蒸制而成，色橙黄，松软而富弹性，有很多气孔，如海绵状。烤麸除作主料外，可与多种荤素原料组配，又称百搭菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7105, '日本豆腐', NULL, '米面豆乳', '日本豆腐又称内脂豆腐、鸡蛋豆腐、玉子豆腐、蛋玉晶，虽质感似豆腐，却不含任何豆类成份。它以鸡蛋为主要原料，辅之纯水、植物蛋白、天然调味料等，经科学配方精制而成，具有豆腐之爽滑鲜嫩，鸡蛋之美味清香，以其高品质、美味、营养、健康、方便和物有所值在消费者中享有盛誉。选择不同口味调料，还可生产麻、辣、酸、甜等多种风味。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7106, '豆渣', NULL, '米面豆乳', '豆渣是生产豆奶或豆腐过程中的副产品，每年全球豆渣的产量都很大。中国是豆腐生产的发源地，具有悠久的豆腐生产历史，豆腐的生产、销售量都较大，相应的豆渣产量也很大。大豆能够降低心血管病发病率，降血压，降血脂，抗癌等功能性得到越来越多的证实，全球范围内带来了消费大豆的热潮。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7107, '腐竹', NULL, '米面豆乳', '腐竹是中国人很喜爱的一种传统食品，具有浓郁的豆香味，同时还有着其他豆制品所不具备的独特口感。腐竹色泽黄白，油光透亮，含有丰富的蛋白质及多种营养成分，用清水浸泡（夏凉冬温）3～5小时即可发开。可荤、素、烧、炒、凉拌、汤食等，食之清香爽口，荤、素食别有风味。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7108, '熏干', NULL, '米面豆乳', '豆腐干，用松木屑燃烧的烟薰过，表面呈棕红色。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7109, '芸豆', NULL, '米面豆乳', '菜豆，又称芸豆(俗称二季豆或四季豆），豆科科菜豆属。芸豆原产美洲的墨西哥和阿根廷，我国在16世纪末才开始引种栽培。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7110, '豆干', NULL, '米面豆乳', '豆腐干是以大豆为原料，经浸泡、研磨、出浆、凝固、压榨等工序生产加工而成。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7111, '香干', NULL, '米面豆乳', '香干，是宁波人最常吃也很爱吃的一种豆制食品，早已脍炙人口。可制作多种菜肴，可冷拌，可热炒，可油炸，可烤制，做成后俱鲜香可口，价廉物美，营养丰富，受到城乡人民的喜爱。宁波楼茂记香干最为著名。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7112, '山药豆', NULL, '米面豆乳', '山药植物的叶腋间常生有肾形或卵圆形的珠芽，名“零余子”，俗称“山药豆”，有食补作用。山药豆味甘、性平，入脾、肺、肾三经，可养肺益阴，补肾固精。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7113, '油豆腐', NULL, '米面豆乳', '油豆腐是豆腐的炸制食品，其色泽金黄，内如丝肉，细致绵空，富有弹性。系经磨浆、压坯、油炸等多道工序制作而成。既可作蒸、炒、炖之主菜，又可为各种肉食的配料，是荤宴素席兼用的佳品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7114, '豆皮', NULL, '米面豆乳', '又名油皮、百片、腐衣、豆腐皮、油豆腐皮。\r\n豆腐皮是大豆磨浆烧煮后，凝结干制而成的豆制品。豆腐皮是从锅中挑皮、捋直，将皮从中间粘起，成双层半圆形，经过烘干而制成的；皮薄透明，半圆而不破，黄色有光泽，柔软不粘，表面光滑、色泽乳白微黄光亮，风味独特，是高蛋白低脂肪不含胆固醇的营养食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7115, '豆腐干', NULL, '米面豆乳', '又名豆干、白干、干豆腐。\r\n豆腐干是豆腐的再加工制品，咸香爽口，硬中带韧，久放不坏。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7116, '豆腐', NULL, '米面豆乳', '豆腐是我国炼丹家——淮南王刘安发明的绿色健康食品。时至今日，已有二千一百多年的历史，深受我国人民、周边各国、及世界人民的喜爱。发展至今，已品种齐全，花样繁多，俱有风味独特，制作工艺简单食用方便的特点。有高蛋白，低脂肪，降血压，降血脂，降胆固醇的功效。是生熟皆可，老幼皆宜，养生摄生、益寿延年的美食佳品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7117, '冻豆腐', NULL, '米面豆乳', '冻豆腐是由新鲜豆腐冷冻而成，孔隙多、弹性好、营养丰富，味道也很鲜美。用冻豆腐可以制作很多美食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7118, '素鸡', NULL, '米面豆乳', '素鸡是一种豆制食品。素鸡以素仿荤，口感与味道与原肉难以分辨，风味独特，也可做成鱼形、虾形等其他形状。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7119, '南豆腐', NULL, '米面豆乳', '南豆腐又称南方豆腐、嫩豆腐、软豆腐，指用石膏作凝固剂制成的豆腐。质地细嫩，有弹性，含水量大。因此南豆腐很容易碎裂，不适合炒菜，多用来做汤、凉菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7120, '北豆腐', NULL, '米面豆乳', '北豆腐，食品，豆浆煮开后加入盐卤，使凝结成块，压去一部分水分而成，比南豆腐水分少而硬。北豆腐又称卤水豆腐，顾名思义它的成型剂是卤水，相比南豆腐质地要坚实一些，切面也不如南豆腐细滑。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7121, '油豆皮', NULL, '米面豆乳', '油豆皮是大豆磨浆烧煮后，凝结干制而成的豆制品。是从锅中挑皮、捋直，将皮从中间粘起，成双层半圆形，经过烘干而制成的。皮薄透明，半圆而不破，黄色有光泽，柔软不粘，表面光滑、色泽乳白微黄光亮，风味独特，是高蛋白低脂肪不含胆固醇的营养食品。油豆皮干吃涮煮均可，干吃香脆可口，涮煮软嫩鲜香，回味无穷。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7122, '千张', NULL, '米面豆乳', '千张，即成百上千枚豆面张开后结合在一起，我国北方称为豆腐皮，在南方也叫百叶。它是一种特殊的豆制食品，是一种薄的豆腐干片，色白，可凉拌，可清炒，可煮食。湖北有名菜“千张肉丝”，即以千张为原料。千张的叫法见于赣、苏南、皖地区，苏北地区称为百叶，有异曲同工之妙。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7123, '豆浆', NULL, '米面豆乳', '豆浆，是将大豆用水泡后磨碎、过滤、煮沸而成。豆浆营养非常丰富，且易于消化吸收。豆浆是防治高血脂、高血压、动肪硬化、缺铁性贫血、气喘等疾病的理想食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7124, '豆泡', NULL, '米面豆乳', '豆泡通常也叫油豆泡，是将咱们平常吃的老豆腐切成小方丁，在热油里炸过制成的，因它内部组织呈蜂窝状，外筋内虚，用来涮食，蘸上调料后一咬一股热汤流出，很是好吃。选购时一定要选择那些看上去鼓溜溜、圆挺挺的，一定不要那些瘪的蔫的颜色发暗的。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7125, '豆腐脑', NULL, '米面豆乳', '豆腐脑即是豆腐花，又称老豆腐，豆花，是一种极嫩的豆腐，是利用大豆蛋白制成的高养分食品。主要分为甜、咸两种吃法。一般来说，甜食主要分布于中国南方、香港及台湾，咸食则为中国北方。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7126, '百页', NULL, '米面豆乳', '百页，我国北方称为豆皮。豆制食品，是一种薄的豆腐干片，色白，可凉拌，可清炒，可煮食。湖北有名菜“千张肉丝”，即以百页为原料。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7127, '板豆腐', NULL, '米面豆乳', '一般所称的营养豆腐其实就是板豆腐，因为板豆腐是由人工做的口感较为粗糙一点。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7128, '千页豆腐', NULL, '米面豆乳', '千页豆腐，是近些年最新流行的素食新产品，广泛流行于大陆的沿海城市及北方地区，极受消费者的欢迎。它采用台湾的最新豆腐制作工艺，以大豆粉及淀粉为主要材料精制而成，是一种富含蛋白质的新世纪美食，它不仅保持了豆腐原本的细嫩，更具备特有的Q劲和爽脆，还具有超强的汤汁吸收能力，配合现代厨艺，可以做出高品质的新时尚美味佳肴来。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7129, '豆粕', NULL, '米面豆乳', '豆粕是大豆提取豆油后得到的一种副产品。按照提取的方法不同，可以分为一浸豆粕和二浸豆粕二种。其中以浸提法提取豆油后的副产品为一浸豆粕，而先以压榨取油，再经过浸提取油后所得的副产品称为二浸豆粕。在整个加工过程中，对温度的控制极为重要，温度过高会影响到蛋白质含量，从而直接关系到豆粕的质量和使用；温度过低会增加豆粕的水份含量，而水份含量高则会影响储存期内豆粕的质量。一浸豆粕的生产工艺较为先进，蛋白质含量高，是中国国内目前现货市场上流通的主要品种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7130, '豆腐皮', NULL, '米面豆乳', '豆腐皮是汉族传统豆制品，在中国南方和北方地区有多种名菜。是在豆浆煮沸之后表面形成天然油膜“挑”起来晾干成的豆腐皮，也叫“油皮”、“腐竹”、“豆腐衣”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7131, '豆筋', NULL, '米面豆乳', '豆筋是一种汉族传统豆制品，具有浓郁的豆香味，同时还有着其他豆制品所不具备的独特口感。生产原料是黄豆，黄豆经磨成豆浆，加热，待豆浆表面起膜后，用一根竹棍卷起来。经烘干后去掉中间竹棍，其形状就像一根棒子，因此当地人就俗称：豆棒。 其生产工艺类似于腐竹。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7132, '绢豆腐', NULL, '米面豆乳', '绢豆腐一词来源日本，日本将豆腐种类分为木棉豆腐、绢豆腐等。所谓木棉豆腐就是我们的大豆腐。\r\n绢豆腐是指质地细腻的豆腐。生产方法分两种，第一种是：将一定浓度豆浆放入设定好的容器中，添加凝固剂并且升温凝固成为豆腐，将凝固好的豆腐分切装盒，最后杀菌处理。第二种是：将冷豆浆添加凝固剂后充填到包装盒，进行80度-90度加热凝固和杀菌处理。\r\n通常市场上内酯豆腐也是绢豆腐的一种，只是使用的凝固剂是葡萄糖内酯酸，由于葡萄糖内酯酸凝固成型好，豆腐产率高，加工容易，缺点是有酸味，口感差，一般厂家都可以生产。日本市场的绢豆腐', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7133, '白香干', NULL, '米面豆乳', '豆腐干，中国传统豆制品之一，是豆腐的再加工制品。咸香爽口，硬中带韧，久放不坏，是中国各大菜系中都有一道美食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7134, '干豆皮', NULL, '米面豆乳', '干豆皮是大豆磨浆煮沸后挑起面上的一层油皮晾干后的产物。它的水份含量小于8%，它的营养素得到浓缩，且易于保存。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7135, '花豇豆', NULL, '米面豆乳', '豇豆按颜色分为花色、白色、茶色，花豇豆是其中的一个品种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7136, '五香豆腐丝', NULL, '米面豆乳', '豆腐丝也叫云丝，豆腐丝、豆腐皮是半脱水制品，属于豆腐的派生食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7137, '熊猫豆', NULL, '米面豆乳', '熊猫豆（Vigna umbellata (Thunb.) Ohwi et Ohashi），俗称花豆，饭豆，是我国河西走廊的珍稀名贵彩色豆种。熊猫豆形状和口感独特，营养丰富，易熟。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7138, '淡奶油', NULL, '米面豆乳', '淡奶油也叫稀奶油，一般都指可以打发裱花用的动物奶油，脂肪含量一般在35%，打发成固体状后就是蛋糕上面装饰的奶油了。相对于植物奶油更健康，因为没有加糖，所以称之为淡奶油。打发的时候要加糖。用法跟植物性奶油基本一样，但是溶点比植物奶油要低一些，可用来制作奶油蛋糕、冰淇淋、慕斯蛋糕、提拉米苏等，如果做面包的时候加一些，也会让您的面包更加松软。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7139, '奶油', NULL, '米面豆乳', '奶油是从牛奶、羊奶中提取的黄色或白色脂肪性半固体食品。奶油的脂肪含量比牛奶增加了20～25倍，而其余的成分如非脂乳固体（蛋白质、乳糖）及水分都大大降低，是维生素A和维生素D含量很高的调料。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7140, '奶酪', NULL, '米面豆乳', '奶酪（其中的一类也叫干酪）是一种发酵的牛奶制品，其性质与常见的酸牛奶有相似之处，都是通过发酵过程来制作的，也都含有可以保健的乳酸菌，但是奶酪的浓度比酸奶更高，近似固体食物，营养价值也因此更加丰富。每公斤奶酪制品都是由10公斤的牛奶浓缩而成，含有丰富的蛋白质、钙、脂肪、磷和维生素等营养成分，是纯天然的食品。就工艺而言，奶酪是发酵的牛奶；就营养而言，奶酪是浓缩的牛奶。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7141, '巧克力', NULL, '米面豆乳', '又名朱古力。\r\n巧克力是以可可粉为主要原料制成的一种甜食。它不但口感细腻甜美，而且还具有一股浓郁的香气。巧克力可以直接食用，也可被用来制作蛋糕、冰激凌等。在浪漫的情人节，它更是表达爱情少不了的主角。\r\n巧克力体积小，发热多，味甜可口。研究发现，巧克力中含有红葡萄酒中所含有的抗氧化物。朱古力的成分与巧克力大同小异，其中蛋白质、膳食纤维、维生素E的含量稍高于巧克力，脂肪、碳水化合物、能量等其他成分与巧克力相近，都是以可可粉为主要原料制成的。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7142, '起司', NULL, '米面豆乳', '又名奶酪、乳酪、芝士、计司。\r\n奶酪是牛奶经浓缩、发酵而成的奶制品。它基本上排除了牛奶中大量的水分，保留了其中营养价值极高的精华部分，被誉为乳品中“黄金”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7143, '酸奶', NULL, '米面豆乳', '酸奶是用鲜牛奶经乳酸菌发酵制成的，其口味酸甜细滑，营养丰富，深受人们喜爱。专家称它是“21世纪的食品”，是一种“功能独特的营养品”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7144, '牛奶', NULL, '米面豆乳', '牛奶是人们日常生活中喜爱的饮食之一，每年5月的第三个星期二，是“国际牛奶日”；喝牛奶的好处如今已越来越被大众所认识，牛奶中含有丰富的钙、维生素D等，包括人体生长发育所需的全部氨基酸，消化率可高达98%,是其他食物无法比拟的。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7145, '黄油', NULL, '米面豆乳', '黄油是将牛奶中的稀奶油和脱脂乳分离后，稀奶油经搅拌而成的。\r\n黄油从制作工艺来分，可以分为生黄油(从生牛奶直接制作)，超细黄油(只能采用巴氏菌消毒过的未经冷藏牛奶或奶油)，细质黄油(采用部分冷冻过的牛奶)。在口味上，还可以分为原味，半盐和加盐的黄油。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7146, '鲜奶油', NULL, '米面豆乳', '鲜奶油、淡奶油，或者简称鲜奶、淡奶，就是cream，音译作忌廉。也是从牛奶中提取的脂肪，打发成浆状之后可以在蛋糕上裱花，也可以加在咖啡、冰淇淋、水果、点心上，甚至直接食用。但是现在市场上见到的几乎都是植脂鲜奶。就像麦淇淋是人造黄油一样，植脂奶油也是人造鲜奶', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7147, '芝士', NULL, '米面豆乳', '别名：奶酪、乳酪、起司、计司。芝士是牛奶经浓缩、发酵而成的奶制品。它基本上排除了牛奶中大量的水分，保留了其中营养价值极高的精华部分，被誉为乳品中“黄金”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7148, '植物奶油', NULL, '米面豆乳', '植物奶油是以大豆等植物油和水、盐、奶粉等加工而成的。 植脂奶油作为一种预搅打产品可用于生日蛋糕，面包夹心，慕思蛋糕等食品中，目前已经广泛用于烘焙领域。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7149, '动物奶油', NULL, '米面豆乳', '动物奶油是由牛奶中的脂肪分离获得的。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7150, '炼乳', NULL, '米面豆乳', '炼乳是一种牛奶制品，用鲜牛奶或羊奶经过消毒浓缩制成的饮料，炼乳是一种牛奶制品，是将鲜牛奶蒸发至原容量的2/5，再加入40%的蔗糖装罐制成的。炼乳和奶粉有很大区别，因此不能直接或者兑水食用。一般是用来做菜或者佐餐的调味料。主要的食用方法包括炼乳炖蛋，炸炼乳等，也可用来抹在吐司面包上吃，香甜可口，入口香浓，奶香四溢。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7151, '奶粉', NULL, '米面豆乳', '全脂奶粉是以新鲜牛奶为原料，用冷冻或加热的方法，除去牛奶中几乎全部的水分，干燥后添加适量白砂糖加工而成的。奶粉中保留了鲜奶中绝大部分的营养成分，而且冲调容易，携带方便，是一种深受消费者喜爱的乳制品。全脂奶粉含有牛奶中的优质蛋白质、脂肪、多种维生素以及钙、磷、铁等矿物质，是适合天天饮用的营养佳品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7152, '白巧克力', NULL, '米面豆乳', '白巧克力成分与牛奶巧克力基本相同，只是不含可可粉，乳制品和糖粉的含量相对较大，甜度高。 白巧克力是由可可脂，糖，牛奶和香料（香草香料）制成的。要注意的是，可可脂（可可油）是高度饱和脂肪，也就是说，白巧克力的脂肪含量非常高。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7153, '乳酪', NULL, '米面豆乳', '乳酪是西餐中必不可少的菜肴。目前，全世界约有数千种以上的天然乳酪，产地涵盖将近整个欧洲及美国、加州、澳洲、新西兰与日本等地；其中，每个国家都有其代表性的乳酪，如意大利的Gorgonzola、Mascarpone、Ricotta，荷兰的Gouda、Edam，英国的Stilton、Cheddar，瑞士的Emmenthal、Gruyere，德国的Bonifaz。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7154, '脱脂奶粉', NULL, '米面豆乳', '脱脂奶粉，所含脂肪在1%以下。除去了脂肪，保留了牛奶中对人体有益的营养成分，如蛋白质、维生素、矿物质、微量元素等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7155, '马乳', NULL, '米面豆乳', '为马科动物马的乳汁。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7156, '牛初乳', NULL, '米面豆乳', '牛初乳是指母牛产犊后3天内的乳汁。牛初乳蛋白质含量较高，而脂肪和糖含量较低。20世纪50年代以来，由于生理学、生物化学、医学以及分子生物学的发展，发现牛初乳中不仅含有丰富的营养物质，而且含有大量的免疫因子和生长因子，如免疫球蛋白、乳铁蛋白、溶菌酶、类胰岛素生长因子、表皮生长因子等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7157, '全脂牛奶', NULL, '米面豆乳', '全脂牛奶的脂肪含量是30%，半脱脂奶的脂肪含量大约是15%，全脱脂奶的脂肪含量低到0.5%。国外有一种“浓厚奶”，脂肪含量可高达40%以上，那些害怕脂肪的消费者总觉得自己应当选择脱脂奶。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7158, '羊奶', NULL, '米面豆乳', '羊奶为山羊或绵羊泌出的乳汁，味甘，性温，入肝、胃、心、肾经，有温润补虚养血的良好功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7159, '芝士粉', NULL, '米面豆乳', '起司粉又叫芝士粉，芝是由天然芝士经过粉碎工艺制造而成的。传统工艺采用磨碎法(grated)，颗粒较粗，一般用在餐饮食品业中。现代生产芝士粉多采用喷雾干燥法，颗粒细腻，外观类似奶粉呈乳白色至淡灰色。有些芝士粉产品为了在最终食品里体现芝士色泽，而人为添加了色素，因此呈黄色或桔黄色。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7160, '巧克力豆', NULL, '米面豆乳', '巧克力豆是以可可粉为主要原料制成的一种甜食。它不但口感细腻甜美，而且还具有一股浓郁的香气。可以直接食用，也可被用来制作蛋糕、冰激凌等。在浪漫的情人节，它更是表达爱情少不了的主角。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7161, '马苏里拉芝士', NULL, '米面豆乳', '马苏里拉（Mozzarella）奶酪，别名：马祖里拉、莫索里拉、莫扎雷拉、莫兹瑞拉……是意大利南部坎帕尼亚（Campania）和那布勒斯（Naples）地方产的一种淡味奶酪，真正的Mozzarella奶酪是用水牛奶制作的，不过现代比较常见的是普通牛奶的制品，普通牛奶的制品色泽淡黄，含乳脂约50%，正宗水牛奶的制品色泽很白，有一层很薄的光亮外壳，未成熟时质地很柔顺，很有弹性，容易切片，成熟期约1至3天，成熟后，就变得相当地软，风味增强了，不过之后迅速变质，保质期不超过1周。正宗水牛奶制品拥有普通牛奶制品无法', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7162, '全脂奶粉', NULL, '米面豆乳', '全脂奶粉用纯乳生产的，基本保持了乳中的原有营养成分，蛋白质不低于24%，脂肪不低于26%，乳糖不低于37%。生产1千克全脂奶粉约需8－9千克牛奶，食用时每份奶粉需8倍的温开水冲调。全脂的脂肪比低脂和脱脂高。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7163, '淡奶', NULL, '米面豆乳', '淡奶也叫奶水、乳水、蒸发奶、蒸发奶水等，是将牛奶蒸馏除去一些水分后的产品，有时也用奶粉和水以一定比例混合后代替。经过蒸馏过程，淡奶的水份比鲜牛奶少一半。淡奶常被用于制作甜品，以及冲调咖啡及奶茶等饮料。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7164, '挂面', NULL, '米面豆乳', '挂面因口感好、食用方便、价格低、易于贮存，一直是人们喜爱的主要面食之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7165, '宽粉', NULL, '米面豆乳', '宽粉以优质红薯为原料，经先进的封闭式流水线生产工艺和严格的品质管理精制而成，无任何添加剂，条型均匀、透明、久煮不烂、口感滑爽、营养丰富等特点，为绿色天然食品！', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7166, '粉皮', NULL, '米面豆乳', '皮是对用大米、红薯淀粉、绿豆淀粉、马铃薯淀粉、蚕豆淀粉等，制作成薄片食物的统称。有鲜干两种，鲜的即可食用，干的便于存放运销。粉皮是用淀粉制成的传统食品，适宜于农户家庭制作，工具也很简单。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7167, '粉丝', NULL, '米面豆乳', '粉丝品种繁多，如绿豆粉丝、蚕豆粉丝，更多的是淀粉制的粉丝。如红薯粉丝，土豆粉丝等。粉条与粉丝的原料和制作工艺相同，只是\r\n粉条更粗一些，比较耐煮，更适合炖食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7168, '米线', NULL, '米面豆乳', '米线，为一种食物，古烹饪书《食次》之中，记米线为“粲”。人们习惯叫米线“酸浆米线”、“酸粉”、“干米线”、“米粉”。其含有丰富的碳水化合物、维生素、矿物质及酵素等，具有熟透迅速、均匀，耐煮不烂，爽口滑嫩，煮后汤水不浊，易于消化的特点，特别适合火锅和休闲快餐食用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7169, '意面', NULL, '米面豆乳', '又名意粉。\r\n意大利面是西餐品种中国人最容易接受的。作为意大利面的法定原料，杜兰小麦是最硬质的小麦品种，具有高密度、高蛋白质、高筋度等特点，其制成的意大利面通体呈黄色，耐煮、口感好。所以，正宗的原料是意大利面具有上好口感的重要条件。除此之外，拌意大利面的酱也是比较重要的。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7170, '河粉', NULL, '米面豆乳', '河粉，又称沙河粉，在新加坡称为粿条（福建话用法，当地英文按发声写作“KUE TEO”，俗作贵刁、鬼刁），是中国广东、广西和东南亚一带常见的一种小吃主料，1860年左右源自广州沙河，因而得名。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7171, '粉条', NULL, '米面豆乳', '又称粉丝，是由红薯、马铃薯原料加工制成的丝状或条状干燥淀粉制品。在我国各地均有生产，呈灰白色，黄色或黄褐色，按形状可分成圆粉条、细粉条和宽粉条等。口感爽滑有韧性。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7172, '面包', NULL, '米面豆乳', '欧洲人把面包当主食，偏爱充满咬劲的“硬面包”，亚洲人则偏爱口感松软的面包。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7173, '油面筋', NULL, '米面豆乳', '面筋是一种植物性蛋白质，有麦胶蛋白质和麦谷蛋白质组成。将面粉加入适量水、少许食盐，搅匀上劲，形成面团，稍后用清水反复搓洗，把面团中的活粉和其它杂质全部洗掉，剩下的即是面筋。\r\n油面筋用手团成球形，投入热油锅内炸至金黄色捞出即成。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7174, '吐司', NULL, '米面豆乳', '吐司是英文toast的音译（粤语广东话叫多士），实际上就是用长方形带盖或不带盖的烤听制作的听型面包。用带盖烤听烤出的面包经切片后呈正方形，夹入火腿或蔬菜后即为三明治。用不带盖烤听烤出的面包为长方圆顶形，类似我国的长方形大面。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7175, '红薯粉', NULL, '米面豆乳', '一种食物。灰色细长条状，晶莹剔透，与粉丝相似。由红薯加工制成。主要含量是淀粉，是粗粮制品，经常食用有利于营养均衡，增进肠道蠕动，有利于通便。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7176, '蕨根粉', NULL, '米面豆乳', '“蕨根粉”是从野生蕨菜的根里提炼出来的淀粉类做成的粉丝食品。因为蕨菜的根是紫色的，所以做出的粉丝也就成了“黑粉丝”。蕨根粉是一种药食同源的天然野生植物，即可入药又可食用，富含铁，锌，硒等多种微量元素和维生素及多种必需氨基酸。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7177, '年糕', NULL, '米面豆乳', '逢年过节吃的年糕多是以糯米（江米）或糯米粉为原料，添加不同的辅料制成的节令食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7178, '玉米片', NULL, '米面豆乳', '玉米片是一种新型快餐食品，保存时间长、便于携带，既可直接食用，又可加工成其它食品。食用时用沸水调制成玉米片冲剂。若将玉米片放进调好的汤内，可做成玉米片汤。目前中国生产的玉米片，有淡玉米片、甜玉米片和咸玉米片。淡玉米片呈棕黄色，甜玉米片呈黄褐色，咸玉米片呈黄色。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7179, '燕麦片', NULL, '米面豆乳', '燕麦片是燕麦粒轧制而成，呈扁平状，直径约相当于黄豆粒，形状完整。燕麦去壳燕麦可以磨成粗细不同的燕麦片，或是弄软碾平做成燕麦卷。经过速食处理的速食燕麦片有些散碎感，但仍能看出其原有形状。燕麦煮出来高度粘稠，这是其中的beta葡聚糖健康成分所带来的，它的降血脂、降血糖、高饱腹的效果，与这种粘稠物质密切相关。总的来说，同量的燕麦煮出来越粘稠，则保健效果越好。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7180, '意大利面', NULL, '米面豆乳', '意大利面亦称通心粉，在国外已是极普通的面制品之一，我国上海、广州、天津等地也有少量生产。通心粉的种类很多，一般都是选用淀粉质丰富的粮食经粉碎、胶化、加味、挤压、烘干而制成各种各样口感良好、风味独特的面类食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7181, '油条', NULL, '米面豆乳', '油条是一种长条形中空的油炸面食，口感松脆有韧劲，是中国传统早点之一。是以面粉为主要原料，加适量的水、食盐、添加剂，经拌合、捣、揣、醒发、油炸制成的条形食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7182, '印度飞饼', NULL, '米面豆乳', '“印度飞饼”是享誉印度的一道名小吃，是用调和好的面粉在空中用“飞”的绝技做成，它具有美味可口、浓郁香酥的特点。有10多个品种。制作飞饼的厨师在餐厅现场表演制作，潇洒大方，技术精炼，会为您的用餐增添无限情趣。飞饼（又名印度薄饼），是印度的特色风味风味美食，其制法用料讲究，特别适合广东人的口味。色、香、味俱全。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7183, '蛋挞皮', NULL, '米面豆乳', '蛋挞（Egg Tart），台湾称为蛋塔，挞为英文“tart”之音译，意指馅料外露的馅饼（相对表面被饼皮覆盖馅料密封之批派馅饼pie）；蛋挞即以蛋浆为馅料的“tart”。蛋挞皮即是表面的饼皮。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7184, '饺子皮', NULL, '米面豆乳', '包饺子的皮。营养价值很高，所含的B族维生素和矿物质对人体健康很有益处。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7185, '馄饨皮', NULL, '米面豆乳', '馄饨皮较薄，煮熟后有透明感。亦因此薄厚之别，等量的馄饨与水饺入沸水中煮，煮熟馄饨费时较短。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7186, '米粉', NULL, '米面豆乳', '米粉，是指以大米为原料，经浸泡、蒸煮、压条等工序制成的条状、丝状米制品，而不是词义上理解的以大米为原料以研磨制成的粉状物料。米粉质地柔韧，富有弹性，水煮不糊汤，干炒不易断，配以各种菜码或汤料进行汤煮或干炒，爽滑入味，深受广大消费者（尤其南方消费者）的喜爱。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7187, '白豆沙', NULL, '米面豆乳', '大白豆(白芸豆)做的豆沙馅。辅料：糖、油。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7188, '贝壳面', NULL, '米面豆乳', '形似贝壳的黄色粉面类食品。贝壳面在国外已是极普通的面制品之一，我国上海、广州、天津等地也有少量生产。一般都是选用淀粉质丰富的粮食经粉碎、胶化、加味、挤压、烘干而制成各种各样口感良好、风味独特的面类食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7189, '通心粉', NULL, '米面豆乳', '通心粉亦称通心面，在国外已是极普通的面制品之一，我国上海、广州、天津等地也有少量生产。通心粉的种类很多，一般都是选用淀粉质丰富的粮食经粉碎、胶化、加味、挤压、烘干而制成各种各样口感良好、风味独特的面类食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7190, '乌龙面', NULL, '米面豆乳', '乌龙，英文为undonn，发音是由unn-donn转变而来的，乌龙面也是面类的一种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7191, '面线', NULL, '米面豆乳', '面线是采优质面粉加盐等辅助料精制而成，色泽洁白，线条细匀，质地柔润，落汤不糊，香爽可口。是台湾、福建、潮汕地区的特色食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7192, '米苔目', NULL, '米面豆乳', '米苔目是闽南语，又叫米筛目，漳州龙海特色小吃，是用米和番薯粉做成的。米苔目加入糖水、刨冰，可以做成冰凉可口的甜品，咸吃则可以用乌醋拌食或放入柴鱼熬煮成汤，再加入爆香的作料;像河粉一般热炒的米苔目很有嚼劲。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7193, '豆沙', NULL, '米面豆乳', '豆沙：一般而言是指红豆沙，做法是将红豆浸泡后煮熟压成泥，加入油、糖浆或者玫瑰酱之类的甜酱混匀。红豆沙常用来做点心的馅，例如豆沙月饼。除了红豆沙外，绿豆沙也广泛用于点心制作。豆沙可做成各式各样的可口食物。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7194, '绿豆沙', NULL, '米面豆乳', '绿豆沙做法是将绿豆浸泡后煮熟压成泥，加入油、糖浆或者玫瑰酱之类的甜酱混匀。绿豆沙也广泛用于点心制作。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7195, '乌冬面', NULL, '米面豆乳', '乌龙面（日文：うどん；英文：udon，在日文汉字中写为：饂饨），在中国大陆及港澳地区也被称为乌冬面,乌冬面是最具日本特色的面条之一，与日本的荞麦面、绿茶面并称日本三大面条，是日本料理店不可或缺的主角。乌冬面是用盐水来和的面，促使面团内快速形成面筋，然后擀成一张大饼，再把大饼迭起来用刀切成面条。其口感介于切面和米粉之间，口感偏软，再配上精心调制的汤料，就成了一道可口的面食。是将盐和水混入面粉中制作成的白色较粗（直径4毫米～6毫米）的面条。冬天加入热汤、夏天则放凉食用。凉乌冬面可以蘸被叫做“面佐料汁”的浓料汁', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7196, '凉粉', NULL, '米面豆乳', '凉粉是用绿豆淀粉加水调成糊状，通过漏盆落入沸水锅煮熟，再经冷却成型，凉粉色泽洁白，晶莹剔透，嫩滑爽口。有诗称赞：“冰镇刮条漏鱼穿，晶莹沁齿有余寒。味调浓淡随君意，只管凉来不管酸。”', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7197, '红薯粉条', NULL, '米面豆乳', '红薯粉条，又称红薯粉丝、粉皮，是一种传统名产，已有400多年的历史。红薯粉条久煮不烂，清香可口、食法多样，是利用红薯为原料，靠红薯内的淀粉来制作的一种食材。\r\n红薯粉条是一种很随和的食品，它能与许多食品搭配，能用多种方式烹调，做出凉热荤素炒烩炸蒸各式各样的菜肴。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7198, '撒子', NULL, '米面豆乳', '撒子（And the son）是一种极其酥脆的油炸食品。口味香脆可口，可作为休闲零食或者正餐。“撒子”古为寒食节的“寒具”，是著名时令美食。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7199, '水晶包', NULL, '米面豆乳', '水晶包是福建泉州传统风味小吃。水晶包的制作材料有小麦面粉1000克、酵母5克、猪油（炼制）500克、白砂糖750克等。水晶包色泽洁白，质地松软，味清甜油润，食时有冰糖屑感。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7200, '土豆粉丝', NULL, '米面豆乳', '土豆粉丝就是用纯正的土豆淀粉，经过加勾芡、搅拌、打浆、制粉机器的挤压而做出的一种细条状粉。口感劲道、爽滑，有减肥功效，营养丰富，故受到广大女性的追捧，一度风靡全国。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7201, '土豆宽粉', NULL, '米面豆乳', '土豆宽粉以优质土豆为原料，经先进的封闭式流水线生产工艺和严格的品质管理精制而成，无任何添加剂，条型均匀、透明、久煮不烂、口感滑爽、营养丰富等特点，为绿色天然食品！', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7202, '虾片', NULL, '米面豆乳', '片又称玉片，传统生产方法是用虾汁加淀粉制成的。如用马铃薯制作虾片，产品有其独特之处，也很受人们欢迎。\r\n马铃薯制作虾片的方法有两种，一种是用马铃薯全粉代替10-20%淀粉，制作过程与传统方法相同，虾片中添加全粉后，提高了虾片的营养价值和膨胀度。另一种方法是用鲜马铃薯经一系列加工过程制成相似于虾片的产品，称作薯片虾片。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7203, '咖啡粉', NULL, '调味品', '咖啡原产于埃塞俄比亚。在17世纪传入欧洲以前，它在北非和西亚被用作饮料已达几百年之久。全世界所有炎热、潮湿的地区都开辟了咖啡种植园，咖啡成为一种大众化的饮料。但要烧出一壶可口的咖啡是需要许多功夫日。咖啡豆必须磨成细粉。最好还要用某种过滤器把咖啡渣留在杯外，尽管许多地方的人喜欢喝没有经过过滤的咖啡。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7204, '苦丁', NULL, '调味品', '苦丁，别名小山萝卜、龙喳口、叉头草、蛾子草大叶蜈蚣草、杨梅蒜、羊奶草、野苦麻、高脚蒲公英、丁萝卜、双股金钗、乳浆草、九刀参、八楞麻。为双子叶植物药菊科植物台湾莴苣的全草。一年或二年生草本，高80-120cm。全株均有白色乳汁。主根数个，圆锥形。茎单一，直立，上部多分枝。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7205, '绿茶', NULL, '调味品', '绿茶，别名苦茗。绿茶是不发酵的茶叶，初制时，采用高温杀青，以保持鲜叶原有的绿色。绿茶的水色叶底也呈绿色，香气清香芬芳，滋味收敛性较大。绿茶在日本、韩国、印度等亚洲国家较普及。中国人饮茶历史已有上千年之久，深受各界人士喜爱。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7206, '红茶', NULL, '调味品', '红茶是全发酵的茶叶，在发酵的过程中，茶叶的茶鞣质经氧化而生成鞣质红，不仅使茶叶色泽乌黑，水色叶底红亮，并且使茶叶的香气和滋味也发生了变化，具有水果香气和醇厚滋味，与绿茶截然不同。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7207, '普洱', NULL, '调味品', '普洱，即普洱茶。普洱茶属于黑茶，因产地旧属云南普洱府（今普洱市），故得名。现在泛指普洱茶区生产的茶，是以公认普洱茶区的云南大叶种晒青毛茶为原料，经过后发酵加工成的散茶和紧压茶。外形色泽褐红，内质汤色红浓明亮，香气独特陈香，滋味醇厚回甘，叶底褐红。有生茶和熟茶之分，生茶自然发酵，熟茶人工催熟。“越陈越香”被公认为是普洱茶区别其他茶类的最大特点，“香陈九畹芳兰气，品尽千年普洱情。”普洱茶是“可入口的古董”，不同于别的茶贵在新，普洱茶贵在“陈”往往会随着时间逐渐升值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7208, '松针茶', NULL, '调味品', '松针茶产于山东莒南县。外形舒展挺直似矛，色泽翠绿。嫩香持久，汤色嫩绿明亮，滋味鲜双醇和，叶底嫩绿鲜活。松针茶芳香清纯，回味悠长。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7209, '铁观音', NULL, '调味品', '铁观音，属于乌龙茶类，是中国十大名茶之一乌龙茶类的代表。它介于绿茶和红茶之间，属于半发酵茶类，是我国绿茶、红茶、青茶(乌龙茶)、白茶、黄茶、黑茶、六大茶类之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7210, '龙井', NULL, '调味品', '龙井茶是中国著名绿茶。产于浙江杭州西湖一带，已有一千二百余年历史。龙井茶色泽翠绿，香气浓郁，甘醇爽口，形如雀舌，即有“色绿、香郁、味甘、形美”四绝的特点。龙井茶得名于龙井。龙井位于西湖之西翁家山的西北麓的龙井茶村。龙井茶因其产地不同，分为西湖龙井、钱塘龙井、越州龙井三种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7211, '乌龙茶', NULL, '调味品', '乌龙茶，亦称青茶、半发酵茶，是中国几大茶类中，独具鲜明特色的茶叶品类。乌龙茶是经过杀青、萎雕、摇青、半发酵、烘焙等工序后制出的品质优异的茶类。乌龙茶由宋代贡茶龙团、凤饼演变而来，创制于1725年(清雍正年间)前后。品尝后齿颊留香，回味甘鲜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7212, '砖茶', NULL, '调味品', '砖茶又称蒸压茶(俗称边销茶)，顾名思义，就是外形相砖一样的茶叶，它也是紧压茶中比较有代表性的一种，以茶叶、茶茎,有时还配以茶末压制成的块状茶。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7213, '茶叶', NULL, '调味品', '茶叶，是著名的世界三大饮料之一，被称为“东方饮料的皇帝”。茶叶中含有咖啡碱、单宁、茶多酚、蛋白质、碳水化合物、游离氨基酸、叶绿素、胡萝卜素、芳香油、酶、维生素A原、维生素B、维生素C、维生素E、维生素P以及无机盐、微量元素等400多种成分。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7214, '可乐', NULL, '调味品', '可乐(Cola)，是指甜味、含咖啡因的碳酸饮料，有咖啡因但不含酒精，非常流行。可乐主要口味包括有香草、肉桂、柠檬香味等。名称来自可乐早期的材料之一：可乐果提取物，最知名的可乐品牌有可口可乐和百事可乐。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7215, '薄荷茶', NULL, '调味品', '薄荷茶，绿茶汤中加糖，再添加新鲜的薄荷叶，就是名副其实的薄荷茶了，是北非地区的特色茶饮料。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7216, '陈皮茶', NULL, '调味品', '陈皮茶是将小块橘子皮开水杯子或者碗里，焖片刻后去渣。该茶能消暑、化痰。陈皮，别名：橘皮、贵老、红皮、黄橘皮、广橘皮、新会皮、柑皮、广陈皮。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7217, '玳玳花茶', NULL, '调味品', '玳玳花茶是中国花茶家族中的一枝新秀，由于其香味醇的品质和玳玳花开胃通气的药理作用，因而深受中国消费者的欢迎，被誉为“花茶小姐”。玳玳花茶具有疏肝和胃，理气解郁的功效，畅销华北、东北、江浙一带。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7218, '黑乌龙茶', NULL, '调味品', '黑乌龙茶是乌龙茶的一种分类。号称有抑制脂肪吸收的效果！现代人的饮食生活，往往有体脂肪比重过高的现象，而油脂吸收过多不但会造成肥胖，也是许多慢性病的主因。\r\n科学实证黑乌龙茶可以抑制百分之二十脂肪的吸收，效果非常神奇。而有喝过黑乌龙茶的人的排泄物中脂肪含量是没喝乌龙茶的人的两倍。所以说黑乌龙茶不仅能抑制脂肪的吸收，还能帮助油脂两倍地排出体外，有着神奇的两倍排毒功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7219, '玫瑰花茶', NULL, '调味品', '玫瑰花茶为中国再加工茶类中花茶的一种，是由茶叶和玫瑰鲜花窨制而成。玫瑰花茶所采用的茶坯有红茶、绿茶，鲜花除玫瑰外，蔷薇、桂花和现代月季也具有甜美、浓郁的花香，也可用来窨制花茶。\r\n其中半开放的玫瑰花，品质最佳。成品茶甜香扑鼻、香气浓郁、滋味甘美。玫瑰花茶制作工艺为茶坯与鲜花处理、窨花拼和、起花、复火、提花。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7220, '牡丹球茶', NULL, '调味品', '牡丹花茶，其原料是：被子植物芍药科芍药属牡丹组茶超目群的天然盛花期古天然牡丹花瓣。训诂学方法研究发现：茶超目牡丹兼有厥类植物、裸子植物、被子植物生命演化进化特征，起源于石炭纪、泥盆纪，演化于二叠纪，原始类群出现于三叠纪，繁盛于侏罗纪和白垩纪。堪称植物中最原始和古老生命的“活化石”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7221, '桑叶茶', NULL, '调味品', '桑叶茶一般选用生态环境优越、无污染的优质嫩桑叶为原料，经科学烘焙等工艺精制而成。工艺中除去桑叶中有机酸的苦味、涩味较为关键；口味甘醇、清香溢人等特性也重要。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7222, '雪利酒', NULL, '调味品', '“雪利酒”是由西班牙语Jerez的英译化而来，在西班牙，它的名字应该是“赫雷斯”酒。而和很多的欧洲名酒的得名规律一样，它也以产地得名。酿造雪莉酒主要以Palomino葡萄为主，另外两个品种是Moscatel Grodo Blanco，以及制造甜酒的Pedro Ximenez，它丰富的天然糖分，使酿出的酒又黑又稠。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7223, '咖啡甜酒', NULL, '调味品', '咖啡甜酒是咖啡里加入了蛋黄，或融入以咖啡豆所酿制成的香甜酒。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7224, '啤酒', NULL, '调味品', '啤酒的主要原料是大麦，经过原料处理、发酵、过滤等多种工序制作而成，啤酒也分几个种类，入浓色啤酒、黑啤酒等。世界各地中，属德国的啤酒最为著名。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7225, '白酒', NULL, '调味品', '白酒是世界蒸馏酒中独具一格的酒类，为麦黍、高粱、玉米、红薯、米糠等粮食或其他果品发酵、曲酿、蒸馏而成的一种饮料。其酒液无色透明，故称为白酒。白酒芳香浓郁，醇和软润，风味多样。因主要采用烧(蒸)工序，亦称烧酒。因含酒精量较高，所有有些地方直呼其为烈性酒或高度酒。我国的名白酒，历史悠久，在世界上独树一帜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7226, '红酒', NULL, '调味品', '红酒（Red wine）是葡萄酒的一种，并不一定特指红葡萄酒。红酒的成分相当简单，是经自然发酵酿造出来的果酒，含有最多的是葡萄汁。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7227, '鸡尾酒', NULL, '调味品', '鸡尾酒是一种量少而冰镇的酒。鸡尾酒是以朗姆酒(RUM)，琴酒(GIN)、龙舌兰（Tequila）伏特加（VODKA）威士忌（Whisky）等烈酒或是 葡萄酒作为基酒，再配以果汁、蛋清、苦精（Bitters）、牛奶，咖啡，可可，糖等其他辅助材料，加以搅拌或摇晃而成的一种饮料，最后还可用柠檬片，水 果或薄荷叶作为装饰物。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7228, '花雕酒', NULL, '调味品', '花雕酒，属于发酵酒当中的黄酒，又称为状元红、女儿红。花雕酒以米和小麦为原料酿制而成。其酒性柔和，酒色橙黄清亮，酒香馥郁芬芳，酒味甘香醇厚。在全国各地的花雕酒中，字号最老的当属于浙江绍兴的花雕酒。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7229, '葡萄酒', NULL, '调味品', '葡萄酒只能是破碎或未破碎的新鲜葡萄果实或葡萄汁经完全或者部分酒精发酵后获得酒精度数不低于8.5%的饮料。葡萄酒的品种很多，因葡萄的栽培、葡萄酒生产工艺条件的不同，产品风格各不相同。通常按颜色分类分红葡萄酒和桃红葡萄酒、白葡萄酒三种,前者是红葡萄带皮浸渍发酵而成；后者是葡萄汁发酵而成的;按状态分类分为静止酒和起泡酒。英文名Wine。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7230, '人参', NULL, '药食', '人参，多年生草本植物，喜阴凉、湿润的气候，多生长于昼夜温差小的海拔500～1100米山地缓坡或斜坡地的针阔混交林或杂木林中。由于根部肥大，形若纺锤，常有分叉，全貌颇似人的头、手、足和四肢，故而称为人参。古代人参的雅称为黄精、地精、神草。人参被人们称为“百草之王”，是闻名遐迩的“东北三宝”（人参、貂皮、鹿茸）之一，是驰名中外、老幼皆知的名贵药材。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7231, '燕窝', NULL, '药食', '又名燕菜、燕根、燕蔬菜。\r\n为雨燕科动物金丝燕及多种同属燕类用唾液与绒羽等混合凝结所筑成的巢窝，形似元宝，窝外壁由横条密集的丝状物堆垒成不规则棱状突起，窝内壁由丝状物织成不规则网状，窝碗根却坚实，两端有小坠角，一般直径6~7厘米，深3~4厘米。主要产于我国南海诸岛及东南亚各国。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7232, '阿胶', NULL, '药食', '阿胶的原产地是山东“东阿”，由于历史原因，东阿县治多有变迁，因此阿胶原产地应为“泛东阿区”，即包括：一、今属聊城市阳谷县的阿城镇，是最早的东阿县治所在地，阿胶似应诞生于此。二、今属济南市平阴县的东阿镇，福胶集团所在地。代表产品是“福”字牌和“东阿镇”牌阿胶，东阿镇是明代至中华民国（1947年）的东阿县城，阿胶制造业兴盛并成为贡品即始于此；东阿镇阿胶1915年巴拿马博览会获金牌;三、今属聊城市东阿县,1947年以后东阿县的铜城镇成为东阿县驻地，也是东胶集团所在地，东阿集团是目前中国最大的阿胶生产企业。其中东', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7233, '雪蛤', NULL, '药食', '雪蛤（又名林蛙）,属两栖纲，无尾目，蛙科动物。学名中国长白山亚种林蛙，又名蛤什蟆、哈什蚂、黄哈蟆、油哈蟆、红肚田鸡等,是中国东北长白山特有的珍稀的野生动物。能够提高人体免疫力；延缓衰老；美容养颜；可做营养补充剂；调节女性内分泌、改善更年期症状有很好的疗效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7234, '蚕蛹', NULL, '药食', '蚕蛹，为蚕蛾科昆虫家蚕的蚕茧缁丝后留下的蛹体。蚕蛹异名小蜂儿。蚕蛹含有丰富的蛋白质和多种氨基酸，有“七个蚕蛹一个蛋”的说法，是体弱、病后、老人及妇女产后的高级营养补品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7235, '茯苓', NULL, '药食', '茯苓，俗称云苓、松苓、茯灵，为寄生在松树根上的菌类植物，形状像甘薯，外皮黑褐色，里面白色或粉红色。其原生物为多孔菌科真菌茯苓的干燥菌核，多寄生于马尾松或赤松的根部。产于云南、安徽、湖北、河南、四川等地。古人称茯苓为“四时神药”', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7236, '党参', NULL, '药食', '党参为植物党参和中药材的统称。党参属植物。全世界约有40种，中国约有39种，药用有21种、4变种。中药党参为桔梗科多年生草本植物党参、素花党参、川党参及其同属多种植物的根。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7237, '当归', NULL, '药食', '当归，多年生草本植物，在中国分布于甘肃、云南、四川、青海、陕西、湖南、湖北、贵州等地，各地均有栽培。当归的根可入药，是最常用的中药之一。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7238, '蜂王浆', NULL, '药食', '蜂王浆又称王浆、蜂浆、蜂乳，是一种营养丰富且药用价值高的物品\r\n蜂乳为蜜蜂科昆虫中华蜜蜂等之工蜂咽腺分泌的乳白色胶状物和蜂蜜配制而成的液体，是工蜂分泌出来的用来饲喂幼虫和蜂王的食物，营养比蜂蜜高得多。蜂乳为淡黄色或淡橙黄色的黏稠状液体，味甜并有香气，其药用价值也是很高的，尤其是润燥通便功效显著。绝大多数患习惯性便秘的患者，只要坚持长期口服足量的蜂乳，基本上都能摆脱便秘的困扰。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7239, '百合干', NULL, '药食', '百合干有很高的药用价值。解毒、理脾健胃、利湿消积、宁心安神、促进血液循环等功效。主治劳嗽、咳血、虚烦惊悸等症，对医治肺络疾病和保健抗衰老有特别功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7240, '马鞭草', NULL, '药食', '马鞭草，别名铁马鞭、紫顶龙芽草、野荆芥、马鞭、龙芽草、凤颈草、狗牙草、马鞭稍、小铁马鞭、顺捋草、蜻蜓草、退血草、铁马莲、疟马鞭、土荆芥、燕尾草、白马鞭、蜻蜓饭、狗咬草、铁扫帚。是一种多年生草本植物，全草都可以入药，它有一个明显的特征就是长有穗状的花。通常高30～120cm。茎上部方形，老后下部近圆形。叶对生，卵形至短圆形，长2～8cm，宽1～4cm，两面有粗毛，边缘有粗锯齿或缺刻，茎生叶无柄，多数3深裂，有时羽裂，裂片边缘有不整齐锯齿。穗状花序顶生或生于上部叶腋，开花时通常似马鞭，每花有1苞片，苞片比萼略', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7241, '咖啡豆', NULL, '药食', '咖啡原产于埃塞俄比亚。在17世纪传入欧洲以前，它在北非和西亚被用作饮料已达几百年之久。全世界所有炎热、潮湿的地区都开辟了咖啡种植园，咖啡成为一种大众化的饮料。但要烧出一壶可口的咖啡是需要许多功夫日。咖啡豆必须磨成细粉。最好还要用某种过滤器把咖啡渣留在杯外，尽管许多地方的人喜欢喝没有经过过滤的咖啡。研磨咖啡最理想的时间，是在要烹煮之前才研磨。因为磨成粉的咖啡容易氧化散失香味，尤其在没有妥善适当的贮存之下，咖啡粉还容易变味，自然无法烹煮出香醇的咖啡。咖啡豆在研磨之后，细胞壁会完全崩解，这时与空气接触的面积会增', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7242, '甘草', NULL, '药食', '甘草，别名甜草根、红甘草、粉甘草。甘草为豆科植物甘草、光果甘草或胀果甘草的根及根茎。甘草为多年生草本，生于向阳干燥的钙质草原及河岸沙土地等。分布于东北、华北、西北等地；光果甘草生于荒漠或带盐碱草原、撂荒地，分布于新疆、青海、甘肃；胀果甘草生于盐渍化土壤处，分布于新疆、甘肃等地。秋季采挖，除去芦头、茎基、枝叉、须根，截成适当长短的段，晒至半干，打成一小捆，再晒全干。栽培品于种后3至4年秋季采挖。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7243, '川贝', NULL, '药食', '别名：川贝母、暗紫贝母、甘肃贝母、梭砂贝母。时令：5～8月。存储时间：一年。川贝通常是夏、秋二季或积雪融化时采挖，除去须根、粗皮及泥沙，晒干或低温干燥。川贝是常用中药，传统的功效是润肺、止咳、化痰，而且自古至今用药只取其地下鳞茎。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7244, '鸡骨草', NULL, '药食', '鸡骨草（Abrus cantoniensis ）是豆科相思子属的一种植物，常见于中国华南地区，具清热利湿、益胃健脾的功能。鸡骨草可在春夏潮湿季节用鸡骨草煲汤作食疗。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7245, '艾蒿', NULL, '药食', '艾蒿，别名：冰台、遏草、香艾、蕲艾、艾蒿、艾﹑灸草﹑医草﹑黄草﹑艾绒等。多年生草本或略成半灌木状，植株有浓烈香气。茎单生或少数，褐色或灰黄褐色，基部稍木质化，上部萆质，并有少数短的分枝，叶厚纸质，上面被灰白色短柔毛，基部通常无假托叶或极小的假托叶；上部叶与苞片叶羽状半裂、头状花序椭圆形，花冠管状或高脚杯状，外面有腺点，花药狭线形，花柱与花冠近等长或略长于花冠。瘦果长卵形或长圆形。花果期9-10月。全草入药，有温经、去湿、散寒、止血、消炎、平喘、止咳、安胎、抗过敏等作用。艾叶晒干捣碎得“艾绒”，制艾条供艾灸', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7246, '蕨麻', NULL, '药食', '蕨麻（学名：Potentilla anserina）是蔷薇科委陵菜属的植物。多年生草本。蕨麻亦称人参果。含有维生素及镁、锌、钾、钙元素。具有较高的医疗和营养价值，它有着健胃补脾、生津止渴、益气补血的功能，故藏医称其为卓老沙僧，常以其入药。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7247, '桔梗', NULL, '药食', '蕨麻（学名：Potentilla anserina）是蔷薇科委陵菜属的植物。多年生草本。蕨麻亦称人参果。含有维生素及镁、锌、钾、钙元素。具有较高的医疗和营养价值，它有着健胃补脾、生津止渴、益气补血的功能，故藏医称其为卓老沙僧，常以其入药。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7248, '芭蕉叶', NULL, '药食', '芭蕉叶为多年生草本植物。叶子很大，长椭圆形，花白色，果实跟香蕉很相似。常绿大型多年生草木。茎高达3-4米，不分枝，丛生。叶大，长可达3米，宽约40厘米，呈长椭圆形，有粗大的主脉，两侧具有平行脉，叶表面浅绿色，叶背粉白色。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7249, '积雪草', NULL, '药食', '匍匐草本。生于阴湿荒地、村旁、路边、水沟边。茎伏地，节上生根。叶互生，叶柄长；叶片圆形或肾形，直径2～4厘米。夏季开花；伞形花序头状，2～3个生于叶腋，每花序上有3～6朵无柄小花；花红紫色。果小，扁圆形。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7250, '败酱', NULL, '药食', '败酱，败酱科植物，分布广泛，常生于灌丛中以及草丛中。多年生草本，根状茎横卧或斜生，基生叶丛生，茎生叶对生，宽卵形至披针形，具粗锯齿，花序为聚伞花序组成的大型伞房花序，花冠钟形，黄色，子房椭圆状长圆形，瘦果长圆形，内含椭圆形、扁平种子。败酱草是常见中草药。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7251, '白花桔梗', NULL, '药食', '桔梗为桔梗科植物桔梗的根。桔梗为多年生草本，生于山地草坡、林缘，有栽培。分布于全国各地。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7252, '橘皮', NULL, '药食', '橘皮，又称为陈皮，为芸香科植物橘及其栽培变种的成熟果皮。橘常绿小乔木或灌木，栽培于丘陵、低山地带、江河湖泊沿岸或平原。分布于长江以南各地区。10至12月果实成熟时，摘下果实，剥取果皮，阴干或通风干燥。广橘皮(陈皮)剥取时多割成3至4瓣。橘皮(陈皮)药材分“陈皮”和“广陈皮”。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7253, '决明子', NULL, '药食', '决明子为豆科一年生草本植物决明或小决明的干燥成熟种子。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7254, '白芷', NULL, '药食', '白芷，多年生高大草本，高1-2.5米，根圆柱形，茎基部径2-5厘米，基生叶一回羽状分裂，复伞形花序顶生或侧生，果实长圆形至卵圆形。以根入药，有祛病除湿、排脓生肌、活血止痛等功能。主治风寒感冒、头痛、鼻炎、牙痛。赤白带下、痛疖肿毒等症，亦可作香料。北方的一些省区有栽培，多自产自销，少数调省外。一般生于林下、林缘、溪旁、灌丛和山谷草地。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7255, '白玉草', NULL, '药食', '白玉草多年生草本，高40-100厘米，全株无毛，呈灰绿色。分布在中国的新疆、西藏、内蒙古、黑龙江。蒙古、尼泊尔、印度、伊朗、土耳其，以及欧洲和非洲（北部）也有分布。模式标本采自欧洲', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7256, '苦参', NULL, '药食', '苦参(学名：Sophora flavescens)为豆科苦参属的植物。分布于俄罗斯、日本、印度、朝鲜以及中国大陆的南北各省区等地，生长于海拔1.500米的地区，多生在山坡、沙地、草坡、灌木林中及田野附近，目前尚未由人工引种栽培。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7257, '鼠尾草', NULL, '药食', '鼠尾草，多年生草本， 植株呈丛生状，叶对生长椭圆形，色灰绿，叶表有凹凸状织纹，香味刺鼻浓郁，夏季开淡紫色小花，生长强健，耐病虫害。有同名网名鼠尾草。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7258, '蔘须', NULL, '药食', '来源为五加科植物人参Panax ginseng C. A. Mey.的干燥根。多年生草本植物,喜阴凉、湿润的气候，多生长于海拔500～1100米山地缓坡或斜坡地的针阔混交林或杂木林中。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7259, '柏子仁', NULL, '药食', '柏子仁为柏科植物侧柏的种仁。含有脂肪泊约14 %，多为不饱和脂肪酸组成，还含有少量挥发油，皂甙、蛋白质、钙、磷、铁多种维生素等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7260, '南板蓝叶', NULL, '药食', '南板蓝叶历代本草未见收载。但陶弘景在《别录》中记载：\"（蓝实）其茎叶可以染青，生河内。\"又说\"此即今染（纟禁）碧所用者，以尖叶者为胜\"。这里的尖叶者即为本种。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7261, '巴戟天', NULL, '药食', '巴戟天，为双子叶植物茜草科（Rubiaceae），长3~13cm，宽1.5~5cm，前端短渐尖，基部钝形或圆形。巴戟天的干燥根，根呈扁圆柱形，略弯曲。主产于广东、广西等地。药用植物，主治阳痿遗精、宫冷不孕、月经不调、少腹冷痛、风湿痹痛、筋骨痿软。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7262, '白参', NULL, '药食', '白参（人参）通常指生晒白参。为五加科多年草本植物人参的根。主产于吉林，辽宁，黑龙江等。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7263, '白附子', NULL, '药食', '白附子为天南星科植物独角莲的块茎。独角莲多年生草本，生于潮湿的林下、山涧、水沟及土壤肥沃处。分布于北纬42°以南及包括西藏南部在内的广大地区。辽宁、吉林、湖北、江苏等省区栽培。带根块茎作种栽种的当年可收获，不带根的多种1年。冬季倒苗后，挖起块茎，小的作种，大的加工作药。将块茎堆积发酵，使外皮皱缩易脱，装在箩筐里，放在流水中踩去粗皮，晒干。也可不去粗皮，切成2至3毫米厚的薄片，晒干。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7264, '菖蒲', NULL, '药食', '菖蒲也叫做白菖蒲、藏菖蒲。多年生草木，根状茎粗壮。叶基生，剑形，中脉明显突出，基部叶鞘套折，有膜质边缘。生于沼泽地、溪流或水田边。菖蒲可以提取芳香油，有香气，是中国传统文化中可防疫驱邪的灵草，端午节有把菖蒲叶和艾捆一起插于檐下的习俗；根茎可制香味料。亦称为尧韭。为中国植物图谱数据库收录的有毒植物，其毒性为全株有毒，根茎毒性较大。口服多量时产生强烈的幻视。原产中国及日本，北温带均有分布。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7265, '漏芦', NULL, '药食', '漏芦为菊科植物祁州漏芦Rhaponticum uni-florum(L.) DC.或禹州漏芦Echinps latifolius Tausch.的根。春秋季采挖。晒干。切厚片，生。清热解毒，消痈肿，下乳汁。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7266, '通草', NULL, '药食', '通草为五加科植物通脱木的茎髓。通脱木常绿灌木或小乔木，生于海拔2800m以下向阳肥厚的封中，或栽培中于旋转中，分布于西南及陕西、江苏、安徽、浙江、江西、福建、台湾、湖北、湖南、广东、广西等到地。秋季选3年以上的杆株，割取合适的木茎，趁鲜切成段，用细木棍或圆竹筒捅出髓部，轻轻理直，晒干放置干燥处。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7267, '天麻', NULL, '药食', '天麻为多年生草本植物，分布于全国大部分地区。其干燥块茎亦称天麻，是一味常用而较名贵的中药。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7268, '莱菔子', NULL, '药食', '莱菔子又名萝卜子、萝白子、菜头子等，为十字花科植物萝卜的成熟种子。全国各地普遍栽培。入脾、胃、肺经，能消食除胀，功效显著，有“冲墙倒壁”之称。可用于用于治疗饮食停滞、脘腹胀痛、大便秘结、积滞泻痢、痰壅喘咳等。本品辛散耗气，故气虚无食积、痰滞者慎用。不宜与人参同用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7269, '轮叶党参', NULL, '药食', '多年生蔓生草本。根粗壮，倒卵状纺锤形。茎攀缘细长，无毛，带紫色，长可达1米。叶在茎上的互生，细小；在枝的通常2～4片簇生，或对生状或近于轮生状，长圆状披针形、披针形至椭圆形，长3～10厘米，宽1.5～4厘米，先端尖，基部楔形，全缘，或稍有疏生的微波状齿，两面无毛，下面呈灰白色；有短柄。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7270, '太子参', NULL, '药食', '太子参为石竹科植物异叶假繁缕，以块根火药。又名孩儿参、童参、双批七、四叶参、米参。有补气益血、生津、补脾胃的作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7271, '土三七', NULL, '药食', '土三七为景天科(菊科)、景天属多年生草本，高30～80cm。茎直立，不分枝，单生或数茎丛生。单叶互生，叶片质厚，倒披针形，长5～8cm，宽1～2cm，先端渐尖，基部楔形，边缘有锯齿，几无柄。聚伞花序呈伞房状，顶生；萼片5，绿色，线状披针形，不等长，长3～5mm，顶端钝；花瓣5，黄色，椭圆状披针形，长6～10mm。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7272, '木榧', NULL, '药食', '木榧分布长江以南及湖北、四川、陕西、甘肃等地。花期三月至四月。种子翌年十月成熟。味甘。性温。入脾、胃二经。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7273, '杜仲', NULL, '药食', '药用杜仲，即为杜仲科植物杜仲的干燥树皮，是中国名贵滋补药材。其味甘，性温。有补益肝肾、强筋壮骨、调理冲任、固经安胎的功效。 可治疗肾阳虚引起的腰腿痛或酸软无力，肝气虚引起的胞胎不固，阴囊湿痒等症。在《神农本草经》中被列为上品。现代研究杜仲具有清除体内垃圾，加强人体细胞物质代谢，防止肌肉骨骼老化，平衡人体血压，分解体内胆固醇，降低体内脂肪，恢复血管弹性，利尿清热，广谱抗菌，兴奋中枢神经，提高白血球药理作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7274, '木香', NULL, '药食', '木香是菊科植物云木香和川木香的通称。云木香(学名：Saussurea costus)，又名广木香或青木香，属菊科风毛菊属。川木香(学名：Dolomiaea souliei)是菊科川木香属的植物，均是中国的特有植物。分布在中国大陆的四川、云南、西藏等地，多生长在高山草地和灌丛中，为野生植物，尚未由人工引种栽培。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7275, '木莲', NULL, '药食', '木莲，中药材名。本品为木兰科木莲属植物木莲Manglietia fordiana （Hemsl.）Oliv.，以果、树皮、根皮入药。树皮、根皮全年可采，果实在八月成熟未裂之前摘取。功能主治为：止咳，通便。用于实火便闭，老年干咳。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7276, '木姜子', NULL, '药食', '木姜子主要分布于我国长江以南各省区直至西藏。根皮及叶可供药用。具有温肾健胃，行气散结的功效。用于治疗胃痛呕吐及无名肿毒等症。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7277, '女贞子', NULL, '药食', '女贞子是木犀科女贞属植物女贞(学名Ligustrum lucidum)的果实。 该品呈卵形、椭圆形或肾形，长6～8.5mm，直径3.5～5.5mm。表面黑紫色或灰黑色，皱缩不平，基部有果梗痕或具宿萼及短梗。体轻。外果皮薄，中果皮较松软，易剥离，内果皮木质，黄棕色，具纵棱，破开后种子通常为1粒，肾形，紫黑色，油性。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7278, '牛膝', NULL, '药食', '牛膝（学名：Achyranthes bidentata Blume），为苋科、牛膝属多年生草本植物，高70-120厘米。根圆柱形，直径5-10毫米，常生长在山坡林下。其根部含皂甙，并含脱皮甾酮和牛膝甾酮，入药有逐瘀通经、补肝肾、强筋骨、利尿通淋等效用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7279, '牛至', NULL, '药食', '牛至又名止痢草、土香薷、小叶薄荷，为唇形科牛至属多年生草本植物。主要分布于地中海地区至中亚、北非、北美及我国大部分地区，生于海拔500-3 600 m的山坡、路旁、灌丛、草地、林下。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7280, '南沙参', NULL, '药食', '南沙参、泡参、泡沙参，为桔梗科沙参属植物四叶沙参Adenophora tetraphylla (Thunb.) Fisch.A. berticillata (Pall.) Fisch.、杏叶沙参A. axilliflora Borb A. stricta Miq.或其同属植物，以根入药。秋季刨采，除去地上部分及须根，刮去粗皮，即时晒干。清热养阴，润肺止咳。主治气管炎，百日咳，肺热咳嗽。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7281, '南芎', NULL, '药食', '南沙参、泡参、泡沙参，为桔梗科沙参属植物四叶沙参Adenophora tetraphylla (Thunb.) Fisch.A. berticillata (Pall.) Fisch.、杏叶沙参A. axilliflora Borb A. stricta Miq.或其同属植物，以根入药。秋季刨采，除去地上部分及须根，刮去粗皮，即时晒干。清热养阴，润肺止咳。主治气管炎，百日咳，肺热咳嗽。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7282, '牛黄', NULL, '药食', '牛黄，是指牛科动物黄牛或水牛的胆囊结石。牛黄(Calculus bovis)，别名丑宝。本品为牛科动物牛(Bos taurus domesticus Gmelin)干燥的胆结石。牛黄完整者多呈卵形，质轻，表面金黄至黄褐色，细腻而有光泽。中医学认为牛黄气清香，味微苦而后甜，性凉。可用于解热、解毒、定惊。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7283, '破布子', NULL, '药食', '“破布子”原产于广东、福建、台湾、海南等沿海地区。“破布子”在煮得稀烂时会一个个爆开，发出“卜卜”的声音，因而得名。它是从前农民三餐的上好佐食，人们将其清洗后煮上两小时，再添加盐巴、香油、蒜泥等配料烹煮，待凝固成块后炒鸡蛋或炖排骨，味道鲜美独特，并有解毒、解热功效，是无污染的乡土绿色食品。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7284, '爬景天', NULL, '药食', '又叫垂盆草，属景天科多年生草本，茎匍匐，易生根，垂盆草一般生长在山坡岩石石隙、山沟边、河边湿润处，极易栽培，对环境要求不严，家前屋后均可种植，也可盆栽，通常采用分株繁殖， 垂盆草是一味民间流传极广的常用药草，全草入药，有清热解毒、消肿利尿、排脓生肌等的功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7285, '青葙子', NULL, '药食', '青葙子一年生草本，高达1m。茎直立，绿色或带红紫色，有纵条纹。叶互生，披针形或椭圆状披针形，长5～9cm，宽1～3cm。穗状花序顶生或腋生;苞片、小苞片和花被片干膜质，淡红色，后变白色，苞片3；花被片5；雄蕊5，花丝下部合生成杯状；子房上位，柱头2裂。胞果卵形，盖裂。种子扁圆形，黑色，有光泽。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7286, '雪莲花', NULL, '药食', '雪莲是菊科凤毛菊属雪莲亚属的草本植物。它生长在海拔4800—5800米的高山流石坡以及雪线附近的碎石间。该亚属的植物有20余种，绝大部分产于我国青藏高原及其毗邻地区。雪莲是一种高山稀有的名贵药用植物，因此保护雪莲种质资源，无论在科学上、医药学上还是从观赏上都有重要意义。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7287, '益母草', NULL, '药食', '益母草为唇形科植物益母草Leonurus heterophyllus Sweet. 的嫩茎叶。益母草嫩茎叶含有蛋白质、碳水化合物等多种营养成分。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7288, '青竹', NULL, '药食', '青竹，竹子，禾本科多年生木质化植物。竹枝杆挺拔，修长，亭亭玉立，婀娜多姿，四季青翠，凌霜傲雨，倍受我国人民喜爱，有“梅兰竹菊”四君子之一,“梅松竹”岁寒三友之一等美称。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7289, '掐不齐', NULL, '药食', '掐不齐为为双子叶植物药豆科植物细梗胡枝子的全草(鸡眼草的嫩茎叶)。分布我国南部、中部及华北等地。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7290, '郁金', NULL, '药食', '郁金是多年生宿根草本。根茎肉质，肥大，黄色;根末端膨大成长卵形块根。叶基生，叶片长圆形，长30～60cm，宽10～20cm，先端尾尖，基部渐狭，叶背被短柔毛;叶柄约与叶片等长。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7291, '淡竹叶', NULL, '药食', '淡竹叶为禾本科，淡竹叶属多年生草本植物，根状茎。须根中部可膨大为纺缍形肉质块根，黄白色。叶披针形，圆锥花序；颖果椭圆形。生于山坡林下阴湿处。分布于长江以南各省区。根药用，有清凉，解热、利尿及催产之效；主治：胸中疾热、咳逆上气、吐血、热毒风、止消渴、压丹石毒、消痰、治热狂烦闷、中风失音不语、痛头风、止惊悸、瘟疫迷闷、杀小虫、除热缓脾。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7292, '丹参', NULL, '药食', '丹参又名赤参，紫丹参，红根等。为双子叶植物唇形科鼠尾草属多年生直立草本植物，根肥厚，外朱红色，内白色，肉质，叶常为奇数羽状复叶，顶生或腋生总状花序；苞片披针形，花萼钟形，带紫色，花冠紫蓝色，花柱远外伸，小坚果黑色，椭圆形，花期4-8月，花后见果。其根是一种中药。性味苦，微寒。归心、肝经。有祛瘀止痛，活血通经，清心除烦之功效。用于月经不调，经闭痛经，症瘕积聚，胸腹刺痛，热痹疼痛，疮疡肿痛，心烦不眠；肝脾肿大，心绞痛。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7293, '鸭舌草', NULL, '药食', '雨久花科植物鸭舌草MonochoiavaginaliS ( Burm.f. )PreslexKunth. 的嫩茎叶，又名水锦葵。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7294, '鸭跖草', NULL, '药食', '鸭跖草为一年生草本，喜欢在潮湿的草地生长， 叶形为披针形至卵状披针形，叶序为互生，茎为匍匐茎， 花朵为聚花序，顶生或腋生，雌雄同株，花瓣上面两瓣为蓝色，下面一瓣为白色，花苞呈佛焰苞状，绿色，雄蕊有6枚。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7295, '亚麻仁', NULL, '药食', '亚麻仁呈卵圆形，扁平，长4-7mm，宽2-3mm。表面棕色或棕红色，平滑，有光泽，一端尖而略偏斜，种脐位于下方的凹陷处，另一端圆钝，种脊位于一侧边缘。种皮薄，胚乳棕色，菲薄，子叶2枚，黄白色，富油性。气微，嚼之有豆腥味。种子用水浸泡后，外有透明粘液膜包围。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7296, '紫苏子', NULL, '药食', '紫苏子为唇形科植物紫苏的干燥成熟果实。多系栽培。主产于湖北、江苏、湖南、浙江、安徽、河南等地。原植物生于湿地、路旁、村野、荒地，或栽培。喜温暖湿润气候，以疏松、肥沃、阳光充足的地方最宜生长。临床用名有紫苏子、炒紫苏子、蜜炙紫苏子、紫苏子霜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7297, '珍珠梅', NULL, '药食', '蔷薇科珍珠梅属植物东北珍珠梅Sorbaria sorbifolia (L.) A. Brown，以茎皮、枝条和果穗入药。春秋采取茎、枝外皮，晒干;秋冬采摘果穗，晒干，研粉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7298, '珍珠粉', NULL, '药食', '珍珠粉，中成药名。由珍珠组成。具有美容（祛黄褐斑），改善睡眠的功效。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7299, '淡豆豉', NULL, '药食', '淡豆豉，中药名。为豆科植物大豆的成熟种子发酵加工品。全国各地均产。晒干，生用。豉有淡咸二种，淡者入药，故名淡豆豉，又名香豉（《伤寒论》）。《名医别录》：“主伤寒头痛，寒热，瘴气恶毒，烦躁满闷，虚劳喘急，两脚疼冷。”现代研究，淡豆豉含脂肪、蛋白质和酶类等成分，有微弱的发汗作用，并有健胃、助消化作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7300, '丁香花', NULL, '药食', '木犀科丁香属落叶灌木或小乔木。因花筒细长如钉且香故名。药用丁香为双子叶植物药桃金娘科植物，主治呃逆、呕吐、反胃、痢疾、心腹冷痛、痃癖、疝气、癣症。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7301, '冬虫夏草', NULL, '药食', '冬虫夏草别名虫草、冬虫草、中华虫草，冬虫夏草功效众多，它是由肉座菌目蛇形虫草科蛇形虫草属的冬虫夏草菌寄生于高山草甸土中的蝠蛾幼虫，使幼虫身躯僵化，并在适宜条件下，夏季由僵虫头端抽生出长棒状的子座而形成，即冬虫夏草菌的子实体与僵虫菌核（幼虫尸体）构成的复合体。主要活性成分是虫草素，冬虫夏草功效主要有调节免疫系统功能、抗肿瘤、抗疲劳、补肺益肾，止血化痰，秘精益气、美白祛黑等多种功效。食用方法有打粉、泡酒、泡水等。冬虫夏草主要产于中国大陆青海、西藏、四川、云南、甘肃五省的高寒地带和雪山草原。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7302, '东风菜', NULL, '药食', '东风菜为多年生草本，有地下茎。茎直立，叶互生，边缘具锯齿或复锯齿。头状花序集成疏松的伞房状。总苞半球形。舌状花约10个，舌片白色。瘦果倒卵圆形或椭圆形。花期6-10月；果期8-10月。广泛分布于中国东北部、北部、中部、东部至南部各省，生于山谷坡地、草地和灌丛中，极常见。也分布于朝鲜、日本、苏联西伯利亚东部。东风菜在浙江民间广泛应用于治疗蛇毒，效果良好。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7303, '莪术', NULL, '药食', '莪术，别称蒁药、莪荗、青姜、黑心姜、姜黄，莪术为姜科、姜黄属多年生宿根草本，本品为姜科植物蓬莪术、广西莪术或温郁金的干燥根茎。后者习称“温莪术”。冬季茎叶枯萎后采挖，洗净，蒸或煮至透心，晒干或低温干燥后除去须根及杂质。株高约1米；根茎圆柱形，肉质，具樟脑般香味，淡黄色或白色；根细长或末端膨大成块根。栽培或野生于林荫下，分布于印度、马来西亚和中国各地。能治行气止痛、积散结、破血祛瘀作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7304, '蜂蛹', NULL, '药食', '蜂蛹一般为胡蜂、黄蜂、黑蜂、土蜂等野蜂的幼虫和蛹，这些蜂都属昆虫纲、膜翅目、胡蜂等科类的昆虫。在湘西山区1年可发展2代～5代，采摘期应掌握在高龄幼虫至变蛹期最宜。蜂蛹系鲜活产品，除鲜炒取食外，大部分采用干制法加工，以便于贮藏、包装。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7305, '谷芽', NULL, '药食', '谷芽，中药名。为禾本科植物稻或同科植物粟的成熟果实经发芽干燥而成。全国多数地方均可生产，主产南方各省区。将稻谷用水浸泡后，保持适宜的温、湿度，待须根长至约1cm时，干燥。生用或炒用。《本草纲目》：“消导米面诸果食积。”现代研究，谷芽可通过抑制肥大细胞组织胺释放而具有抗过敏活性。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7306, '龟板', NULL, '药食', '为龟科动物的腹甲及背甲。主产地浙江、湖北、湖南等。全年均可捕捉。杀死，或用沸水烫死，剥取壳甲，除去残肉，晒干，以沙砂炒后醋淬用。中医中属补阴药。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7307, '狗尾草', NULL, '药食', '狗尾巴草，别名狗尾草，属禾本科、狗尾草属一年生草本植物。根为须状，高大植株具支持根。秆直立或基部膝曲，高10-100厘米，基部径达3-7毫米。叶鞘松弛，无毛或疏具柔毛或疣毛，边缘具较长的密绵毛状纤毛；有祛风明目，清热利尿的作用。生于海拔4000米以下的荒野、道旁，为旱地作物常见的一种杂草。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7308, '黄芪', NULL, '药食', '黄芪，又名绵芪。多年生草本，高50-100厘米。主根肥厚，木质，常分枝，灰白色。茎直立，上部多分枝，有细棱，被白色柔毛。多年生草本，高50-100厘米。产于内蒙古、山西、甘肃、黑龙江等地。黄芪的药用迄今已有2000多年的历史，其有增强机体免疫功能、保肝、利尿、抗衰老、抗应激、降压和较广泛的抗菌作用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7309, '蛇莓', NULL, '药食', '蛇莓（学名：Duchesnea indica (Andr.) Focke），别名：蛇泡草、龙吐珠、三爪风、鼻血果果、珠爪、蛇果、鸡冠果、野草莓、蛇藨、地莓、蚕莓、三点红、狮子尾、疗疮药、蛇蛋果、地锦、三匹风、蛇泡草、三皮风、三爪龙、老蛇泡、蛇蓉草、三脚虎、蛇皮藤、蛇八瓣、龙衔珠、小草莓、地杨梅、蛇不见、金蝉草、三叶藨、老蛇刺占、老蛇蔂、龙球草、蛇葡萄、蛇果藤、蛇枕头、蛇含草、蛇盘草、哈哈果、麻蛇果、九龙草、三匹草、蛇婆、蛇龟草、落地杨梅、红顶果、血疔草、野草莓。[1] 蔷薇科 ，多年生草本，全株有柔毛；匍', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7310, '板蓝根', NULL, '药食', '板蓝根（常用别名：靛青根、蓝靛根、大青根）是一种中药材。为十字花科植物菘蓝的干燥根，通常在秋季进行采挖，炮制后可入药。在中国各地均产。板蓝根分为北板蓝根和南板蓝根，北板蓝根来源为十字花科植物菘蓝（Isatis tinctoria L.）的根；南板蓝根为爵床科植物马蓝（Baphicacanthus cusia (Nees) Brem.）的根茎及根。其性寒，味先微甜后苦涩，具有清热解毒、预防感冒、利咽之功效。主要用于治疗温毒发斑、舌绛紫暗、烂喉丹痧等疾病。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7311, '绿苏', NULL, '药食', '绿紫苏是一年生草本，高60～90cm，上部有白色柔毛。叶对生，叶片卵圆形或圆形，长3～9.5cm，宽2～8cm，先端渐尖或尾尖，基部近圆形，边缘有粗锯齿，两面呈紫红色，淡红色，有腺点。轮伞花序2花，组成偏向一侧的假总状花序；苞片卵形，顶端急尖或呈尾状；花萼钟状，外有柔毛及腺点。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7312, '三叶香', NULL, '药食', '学名苜蓿，蔬菜类烹饪原料。又称南苜蓿、连枝草、金花菜、草头、三叶菜等。属豆科植物。我省广有分布。营养丰富，维生素C含量高于柑橘。中医认为其味苦，性平，可清脾胃，利大小肠、下膀胱结石。嫩苗可拌、炒或做汤，也可用作荤菜垫底，又能腌制，或氽入面汤。陕西民间常用作麦饭菜。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7313, '番杏', NULL, '药食', '番杏（拉丁学名：Tetragonia tetragonioides （Pall.） Kuntze），番杏科一年生肉质草本植物，茎直立，卵状叶片，花呈黄绿色，陀螺型果实。别名：法国菠菜、新西兰菠菜。在东南沿海一带地区广泛分布。可作蔬菜，含丰富的铁、钙、维生素A和各种维生素B；也可药用清热解毒，祛风消肿，具有很高的药用价值。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7314, '桃胶', NULL, '药食', '桃胶，为蔷薇科植物桃或山桃等树皮中分泌出来的树脂，又名桃油，桃脂，桃花泪，桃树胶，桃凝，。是桃树或者在外力作用下产生伤口，分泌桃胶有利于伤口自愈，比较粘稠的液体通过太阳晒蒸发，产生固体。干的桃胶呈结晶石状很硬，看着有点像琥珀。桃胶有足够的水溶性和适当的粘度，用清水浸泡十多个小时候后泡发变软。它有清血降脂，缓解压力和抗皱嫩肤的功效。树胶的主要组成为半乳糖、鼠李糖、α-葡萄糖醛酸等。含有碳水化学物，脂肪，蛋白质和植物胶原蛋白。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7315, '黑枸杞', NULL, '药食', '黑果枸杞，别名：苏枸杞，俗称：黑枸杞。为中国西部特有的沙漠药用植物品种，主产于中国青海省东部、新疆北部、甘肃、西藏等地。黑果枸杞是迄今为止发现原花青素含量最高的野生植物，而青海的野生黑枸杞品质和花青素含量是最高的。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7316, '白茅根', NULL, '药食', '白茅根，又名茅根、茹根，取自草本植物白茅的根茎。属于止血药。春秋二季采挖，晒干，除去须根及膜质叶鞘，切段生用或炒炭用。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7317, '龟苓膏', NULL, '药食', '龟苓膏，是历史悠久的梧州传统药膳，说起广西梧州，很多人都知道那里的龟苓膏最有名。正统龟苓膏是以受保护动物金钱龟、土茯苓、甘草等中药材，分别配以炼乳、蜜糖、牛奶，就成了一碗碗冰凉可口的即食美味，配料不同功效也有所不同。如果时常感到消化不良﹑胃气胀，吃一碗龟苓膏就使人开胃，大便畅通。一般人如果能一星期吃一至两碗的话﹐可以减少身体染病的机会。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7318, '蚂蚱', NULL, '药食', '蚂蚱，植食性昆虫，具咀嚼式口器。触角呈短鞭状，拥有强而有力的后腿，可利用弹跳来避开天敌。体色有绿色和褐色，是生活环境的保护色', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7319, '麻黄', NULL, '药食', '麻黄，别名草麻黄，华麻黄，属草本植物。秋季采割绿色的草质茎，晒干。其性温，味辛、微苦，有发汗散寒、宣肺平喘、利水消肿的功效，可治疗风寒感冒、胸闷喘咳风水浮肿、支气管哮喘等病症。\r\n麻黄有三种，草麻黄、木贼麻黄、与中麻黄，为草本状灌木，采用部位为草质茎，也是重要的药用植物。生物碱含量丰富，是提取麻黄碱的主要资源。木质茎少，易加工提炼；由于常生于平原、山坡、河床、草原等处，故易于采收，因为麻黄的发汗力强，故外感风寒轻证、心悸、失眠、肺虚咳喘等均应忌用或慎用。老人、体虚及小儿宜用炙麻黄。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7320, '山奈', NULL, '药食', '山柰，别名沙姜、山辣。以根茎入药，温中化湿，行气止痛。主治急性胃肠炎，消化不良，胃寒疼痛，牙痛，风湿关节痛，跌打损伤。本品多为圆形或近圆形的横切片，直径1～2cm，厚0.3～0.5cm。外皮浅褐色或黄褐色，皱缩，有的有根痕或残存须根；切面类白色，粉性，常鼓凸。质脆，易折断。气香特异，味辛辣。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7321, '白莲须', NULL, '药食', '白莲须又称莲须、莲蓬须、荷花蕊、莲花蕊，为睡莲科植物莲的莲花雄蕊，多年生水生草本，根状茎横走，肥大而多节，白色，中有孔洞，黄色，如烟丝般模样，闻起来有股淡淡的莲花香味。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7322, '蝉蛹', NULL, '药食', '蝉蛹俗称肉骨龙、解拉猴、爬扎猴、节溜龟、雷震子。是东北、华北等北方地区常见的一种昆虫，是蝉的若虫。外表成黑色和暗黄色相间，锥形，长度4cm左右。用多种佐料腌制后炸制的蝉蛹就是著名的经典鲁菜——五香金蝉。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
INSERT INTO `t_material` VALUES (7323, '奇亚籽', NULL, '药食', '奇亚籽（Chia Seed）是薄荷类植物芡欧鼠尾草（Salvia Hispanica L.）的种子，原产地为墨西哥南部和危地马拉等北美洲地区。奇亚籽较小，一般为长1.87±0.1mm，宽1.21±0.08m，厚0.88±0.04mm，呈椭圆，表面光滑，颜色从米黄色到深咖啡色，表面带有大理石纹脉络线。浅色的种子在重量、宽度、以及厚度上略比黑色的种子饱满。', NULL, NULL, NULL, NULL, 0, '2023-04-03 14:29:00', '2023-04-03 14:29:00', NULL);
