INSERT INTO `t_material` VALUES (7333, '油条白菜粥', 8.00, '原味', '美味的营养早餐', '淀粉，蛋白质', NULL, NULL, NULL, 0, '2023-06-04 17:05:49', '2023-06-04 17:05:49', NULL);
INSERT INTO `t_material` VALUES (7334, '油条白菜粥', 8.00, '原味', '美味的营养早餐', '淀粉，蛋白质', NULL, NULL, NULL, 0, '2023-06-04 17:06:34', '2023-06-04 17:06:34', NULL);
INSERT INTO `t_meal` VALUES (1, '尖椒酿肉', '咸鲜', '热菜', '尖椒本身属于青椒中的一种。从中医学的角度来讲适量的吃一些尖椒可以健脾消食、缓中止痛，可以增加食欲、增加饱腹感，并且可以促进身体内废物的排除。而从营养学的角度来讲，这种尖椒之中的维生素c含量非常丰富，可以降低血压、降低血脂，对于心脑血管疾病有预防作用。而且其中的抗氧化物质比较多，对于颜面部位的色素沉着，有一定的改善作用，还可以延缓皮肤衰老。', '尖椒、猪肉馅、葱、姜、一品鲜酱油、蚝油、糖、料酒、盐、黑胡椒粉、味精、干淀粉', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/26/2023022616773793884881.jpg?x-oss-process=style/c320', 0, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:04', '2023-04-06 13:27:04', NULL);
INSERT INTO `t_meal` VALUES (2, '茭白茄子焖排骨肉', '咸鲜', '热菜', '排骨肉的营养价值有以下几点，第一，排骨富含蛋白质和脂肪，为人体提供优质蛋白质和必需的脂肪酸，可以补充人体所需的营养。第二，人到中年，微循环发生障碍，排骨中的胶原蛋白等成分可以疏通微循环，从而改善老化症状，起到抗衰老的作用。第三，排骨肉中含有丰富的钙元素，可以维护骨骼健康，防止骨骼疏松。第四，排骨肉炖汤喝可以滋阴润燥、益精补血，适合气血不足、体质偏寒的人。', '排骨肉、茭白、茄子、葱、姜、蒜、花椒、八角、油、一品鲜酱油、蚝油、糖、料酒、盐、鸡汁。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/26/2023022616773793341701.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:04', '2023-04-06 13:27:04', NULL);
INSERT INTO `t_meal` VALUES (3, '南瓜芋头香菇炖牛肉', '咸鲜', '热菜', '牛肉营养价值很高，中医认为：牛肉有补中益气、滋养脾胃、强健筋骨、止渴止涎的功能。牛肉所含有的锌铁都更易被吸收，从而帮助身体提高免疫力，增强免疫力系统。此外，牛肉氨基酸组成成分比猪肉更接近人体需要，所以，我们平常食用牛肉对健康有很大的帮助！', '牛肉、南瓜、芋头、香菇、葱、姜、蒜、油、一品鲜酱油、蚝油、料酒、糖、鸡汁。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/26/2023022616773792823961.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:04', '2023-04-06 13:27:04', NULL);
INSERT INTO `t_meal` VALUES (4, '广东肠粉', '清淡', '小吃', '广东人的早餐至爱—肠粉。', '粘米粉、澄面、粟粉、水、肉末、葱、虾仁、油、生抽、蚝油、水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/09/2023030916783520666151.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:04', '2023-04-06 13:27:04', NULL);
INSERT INTO `t_meal` VALUES (5, '奥尔良鸡胗', '微辣', '热菜', '鸡胗中含有大量的蛋白质和维生素A、C、E，这些营养成分能够促进人身体的新陈代谢，还能提高机体免疫力，对于延缓皮肤衰老也很有效果。', '鸡胗、葱、姜、白芝麻、油、一品鲜酱油、蚝油、料酒、糖、奥尔良烧烤料、黑胡椒粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/26/2023022616773792272901.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:04', '2023-04-06 13:27:04', NULL);
INSERT INTO `t_meal` VALUES (6, '肉末盖莴笋丝', '咸鲜', '凉菜', '莴笋营养价值很高，莴笋中含有多种维生素、胡萝卜素以及蛋白质、脂肪、微量元素成分，可以补充人体所需要营养。吃莴笋还具有润肠通便效果，可以促进消化，改善糖代谢，保护肝脏。适当吃莴笋还可以通乳，莴笋对于消化不良、贫血、高血压、心脏病等疾病都有辅助治疗效果，但是要注意脾胃虚寒或者是患有一些特殊疾病患者不能多吃。', '莴笋、猪肉、胡萝卜、蒜、油、花椒、料酒、一品鲜酱油、蚝油、盐、味精、黑胡椒粉、水淀粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/26/2023022616773791766831.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:04', '2023-04-06 13:27:04', NULL);
INSERT INTO `t_meal` VALUES (7, '五花肉芸豆土豆蚬子荞麦面', '咸鲜', '面条', '麦谷蛋白的含量较低，主要是含有蛋白质或球蛋白，因此适当食用麦谷蛋白对身体有好处，麦谷蛋白还含有人体所需的氨基酸中的赖氨酸，麦麦内含有b族维生素、维生素e、赖氨酸、氨基酸、脂肪酸、亚油酸、烟酸和烟碱酸等多种营养物质。', '荞麦面、五花肉、芸豆、土豆、葱、姜、蒜、香菜、油、一品鲜酱油、蚝油、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/26/2023022616773791251961.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:04', '2023-04-06 13:27:04', NULL);
INSERT INTO `t_meal` VALUES (8, '生腌活海虾', '微辣', '凉菜', '海虾当中含有大量的钙离子、铁离子、各种维生素以及蛋白质，对于身体有很好的补充营养的作用，能够有效的补充铁、补充维生素C，以及补血，尤其是对于体质比较差或者是气血亏虚的人群，都具有很好的改善作用，可以增强机体免疫能力，提高防病、抗病的功能。另外，海虾对于部分失眠的患者也能够起到有效促进睡眠的作用，同时还能够改善头疼、头晕等症状。', '活海虾、葱、蒜瓣、小米辣、香菜、姜、一品鲜酱油、蚝油、糖、酒、白醋、陈醋、辣根、辣鲜露、盐、味精、料酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/26/2023022616773790778621.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:03', '2023-04-06 13:27:03', NULL);
INSERT INTO `t_meal` VALUES (9, '芙蓉虾蒸蛋羹', '咸鲜', '羹类', '虾是很多人都喜欢的食品，营养丰富，含有大量的蛋白质、脂肪和钙、铁、锌等微量元素。经常食用虾，可以补充人体每天所需要的营养物质，还能补充钙剂，增强机体的免疫力，保护心血管，预防动脉硬化，促进生长发育等。但是要注意的是，在食用虾的同时不要吃含有大量维生素C的水果，以免产生胃肠道不适。有支气管哮喘者也要慎重进食。虾中含有大量蛋白质，蛋白质食用过多会引起腹胀、腹泻等消化不良症状，因此如果是脾胃功能较差，消化不良者，也要尽量少吃，以免加重胃肠道损伤，影响身体健康。', '鲜虾、鸡蛋、葱、姜、一品鲜酱油、料酒、盐、温凉白开水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/26/2023022616773790144621.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:03', '2023-04-06 13:27:03', NULL);
INSERT INTO `t_meal` VALUES (10, '莴笋胡萝卜爆螺片', '咸鲜', '热菜', '红里螺还有高钙高锌，高镁高，维生素B2，而且还有脂肪酸，含有丰富的蛋白质，维生素，氨基酸以及微量元素，是人体减肥非常推荐吃的食物，是绿灯食物。', '红里螺、莴笋、胡萝卜、蒜、花椒、油、料酒、糖、盐、味精、香油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/26/2023022616773789706001.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:03', '2023-04-06 13:27:03', NULL);
