INSERT INTO `t_meal` VALUES (48, '蒜蓉蒸鸡', '蒜香', '热菜', '', '鸡腿、葱花、蒜蓉酱、玉米淀粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/18/2023011816740100967881.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:01', '2023-04-06 13:27:01', NULL);
INSERT INTO `t_meal` VALUES (49, '红焖羊肉', '原味', '热菜', '', '羊肉、八角、桂皮、香叶、姜片、花生油、生抽、老抽、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/05/2023020516755658294921.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:01', '2023-04-06 13:27:01', NULL);
INSERT INTO `t_meal` VALUES (50, '萝卜丝水晶包', '咸鲜', '面食', '', '饺子皮、白萝卜、鸡蛋、葱、姜、生抽、食盐、食用油、香油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/17/2022121716712421765851.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:01', '2023-04-06 13:27:01', NULL);
INSERT INTO `t_meal` VALUES (51, '五谷小米芝麻糊', '原味', '饮品', '', '黄豆、红豆、眉豆、绿豆、莲子、百合、芝麻、花生、小米、桑葚、水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/14/2022121416710026169531.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:01', '2023-04-06 13:27:01', NULL);
INSERT INTO `t_meal` VALUES (52, '茶树菇炒牛肉', '原味', '热菜', '', '茶树菇、牛肉、蒜苗、花生油、玉米淀粉、生抽、蚝油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/04/2023020416754892474481.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:01', '2023-04-06 13:27:01', NULL);
INSERT INTO `t_meal` VALUES (53, '奥利奥旋风', '奶香', '甜品', '', '淡奶油、奥利奥饼干、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/06/2023020616756648054851.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:01', '2023-04-06 13:27:01', NULL);
INSERT INTO `t_meal` VALUES (54, '白萝卜焖牛排骨', '原味', '热菜', '', '牛排骨、白萝卜、八角、桂皮、香叶、生抽、蚝油、玉米淀粉、生姜。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/07/2023020716757521346351.jpg?x-oss-process=style/c320', 2, 1, NULL, NULL, NULL, 0, '2023-04-06 13:27:01', '2023-04-06 13:27:01', NULL);
INSERT INTO `t_meal` VALUES (55, '莲子薏仁百合红豆汤', '原味', '糖水', '', '莲子、薏仁、百合、红芸豆。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762769921241.jpg?x-oss-process=style/c320', 2, 1, NULL, NULL, NULL, 0, '2023-04-06 13:27:01', '2023-04-06 13:27:01', NULL);
INSERT INTO `t_meal` VALUES (56, '五香牛肉', '五香', '凉菜', '卤牛肉选用牛腱子是最好的选择，金钱腱（前腿腱）里面含有很多的筋膜，且口感特别Q弹！', '金钱腱、葱、姜、料酒、花椒、黄栀子、卤料包、盐、蚝油、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/28/2023032816799950692431.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:01', '2023-04-06 13:27:01', NULL);
INSERT INTO `t_meal` VALUES (57, '空气炸锅烤鸡翅', '微辣', '热菜', '', '翅中、葱、姜、生抽、老抽、料酒、烧烤料、胡椒粉、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/05/2023010516729007477381.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:01', '2023-04-06 13:27:01', NULL);
INSERT INTO `t_meal` VALUES (58, '红果烙', '酸甜', '家常菜', '纯天然无添加，健胃消食，酸酸甜甜好味道！', '红果、冰糖、清水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/15/2022121516710754727691.jpg?x-oss-process=style/c320', 2, 1, NULL, NULL, NULL, 0, '2023-04-06 13:27:01', '2023-04-06 13:27:01', NULL);
INSERT INTO `t_meal` VALUES (59, '凉拌猪心', '微辣', '凉菜', '', '猪心、香葱、香菜、蒜末、白芝麻、花生油、生抽、蚝油、辣椒粉、烧烤料。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/25/2023022516772940732321.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:01', '2023-04-06 13:27:01', NULL);
INSERT INTO `t_meal` VALUES (60, '排骨萝卜面皮汤', '咸鲜', '汤类', '', '排骨、白萝卜、毛芋、面粉、青菜、姜、盐、料酒、生抽、醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709185273661.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:00', '2023-04-06 13:27:00', NULL);
INSERT INTO `t_meal` VALUES (61, '烤蔬菜鸡翅', '咸香', '热菜', '', '鸡中翅、香菇、甜玉米、胡萝卜、红薯、南瓜、洋葱、奥尔良烤翅腌料、蒜、油、盐、胡椒粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/09/2023030916783427388411.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:00', '2023-04-06 13:27:00', NULL);
INSERT INTO `t_meal` VALUES (62, '姜红茶', '中辣', '饮品', '', '姜、红糖、水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709100195831.jpg?x-oss-process=style/c320', 2, 1, NULL, NULL, NULL, 0, '2023-04-06 13:27:00', '2023-04-06 13:27:00', NULL);
INSERT INTO `t_meal` VALUES (63, '松花菜胡萝卜炒肉丝', '咸鲜', '热菜', '', '夹心肉、松花菜、胡萝卜、淀粉、油、盐、料酒、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/12/2022121216708136479791.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:00', '2023-04-06 13:27:00', NULL);
INSERT INTO `t_meal` VALUES (64, '爆炒小虾', '咸鲜', '热菜', '', '小虾、韭菜、玉米油、盐、姜、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714126854571.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:00', '2023-04-06 13:27:00', NULL);
INSERT INTO `t_meal` VALUES (65, '砂锅焗排骨虾仁', '原味', '热菜', '', '排骨、虾、生姜、蒜头、花生油、玉米淀粉、生抽、蚝油、老抽、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/19/2023021916767728327401.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:00', '2023-04-06 13:27:00', NULL);
INSERT INTO `t_meal` VALUES (66, '玉米面菜团子', '咸鲜', '面食', '绝对营养丰富均衡又减脂的一道美食，更何况又是超级简单，娃娃不爱吃菜的更要试试这道美味。', '小白菜、玉米面、白面、鸡蛋、胡萝卜、盐、姜粉、五香粉、食用油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709099619811.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:00', '2023-04-06 13:27:00', NULL);
INSERT INTO `t_meal` VALUES (67, '香菇牛肉酱', '咸香', '热菜', '', '牛肉、洋葱、干香菇、香葱末、姜末、黄豆酱、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/09/2023010916732337172441.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:00', '2023-04-06 13:27:00', NULL);
INSERT INTO `t_meal` VALUES (68, '椒盐杂粮发面饼', '咸香', '面食', '', '普通面粉、荞麦面、玉米面、酵母粉、椒盐、清水、花生油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/15/2022121516710755237691.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:00', '2023-04-06 13:27:00', NULL);
INSERT INTO `t_meal` VALUES (69, '芝麻酱红糖杂粮饼', '甜香', '面食', '', '普通面粉、荞麦面粉、玉米面、发酵粉、红糖、芝麻酱。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/14/2022121416709964247071.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:00', '2023-04-06 13:27:00', NULL);
INSERT INTO `t_meal` VALUES (70, '炸香蕉', '甜香', '小吃', '简单的美味。', '香蕉、面包糠、鸡蛋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/20/2022122016715265836091.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:00', '2023-04-06 13:27:00', NULL);
INSERT INTO `t_meal` VALUES (71, '萝卜丸子', '原味', '热菜', '传统萝卜丸子，清香味美。', '萝卜、馒头、红薯淀粉、鸡蛋、盐、花椒粉、姜末、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/20/2022122016715304809511.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:00', '2023-04-06 13:27:00', NULL);
INSERT INTO `t_meal` VALUES (72, '地三鲜', '蒜香', '热菜', '传统地三鲜，美味下饭菜。', '茄子、土豆、青椒、小米椒、盐、葱花、蒜蓉、生抽、蚝油、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/21/2022122116716291893121.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:00', '2023-04-06 13:27:00', NULL);
INSERT INTO `t_meal` VALUES (73, '酸菜羊肉面', '酸辣', '面条', '西北特色。', '面条、酸莲花白、羊肉、青蒜、韭菜、盐、花椒粉、辣椒粉、生抽、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/20/2022122016715305165371.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:00', '2023-04-06 13:27:00', NULL);
INSERT INTO `t_meal` VALUES (74, '羊肉荞面鱼鱼', '咸鲜', '面食', '西北特色。', '荞面、普通面粉、羊肉、蒜苔、青红椒、洋葱、番茄酱、韭菜、盐、辣椒粉、五香粉、生抽、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/22/2022122216716862203761.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:00', '2023-04-06 13:27:00', NULL);
INSERT INTO `t_meal` VALUES (75, '干煎虾', '咸鲜', '热菜', '白灼，焗烤，番茄，芥末，咖喱……我最爱的虾，有好多好多做法，怎么做都非常好吃。最近学了一个干煎的做法，味道也非常哇噻，一次就成功了，做法分享给大家。', '虾、洋葱、姜、蒜、小葱、白胡椒粉、盐、料酒、黄油、蒸鱼豉油、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/12/2022121216708134636871.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:00', '2023-04-06 13:27:00', NULL);
INSERT INTO `t_meal` VALUES (76, '枸杞红枣鸡蛋汤', '甜香', '糖水', '简单美味，健康营养快手汤。适用于体质虚寒者及肝肾亏虚，便秘、失眠，近视眼等人群，枸杞清肝明目，红枣补气补血，健脾益胃。', '枸杞子、红枣、鸡蛋、纯净水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/12/2022121216708135544431.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:00', '2023-04-06 13:27:00', NULL);
INSERT INTO `t_meal` VALUES (77, '虾仁海参拌西生菜', '葱香', '凉菜', '', '西生菜、海参、虾仁、食用油、大葱、食盐、生抽或蒸鱼豉油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/12/2022121216708135134401.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:00', '2023-04-06 13:27:00', NULL);
INSERT INTO `t_meal` VALUES (78, '老虎菜拌羊肉', '中辣', '凉菜', '', '薄皮辣椒、香菜、大葱、羊腿肉、食盐、生抽、陈醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/12/2022121216708135986781.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:27:00', '2023-04-06 13:27:00', NULL);
INSERT INTO `t_meal` VALUES (79, '酒糟鱼', '香辣', '热菜', '酒糟鱼是很受欢迎的，特别是喜欢喝点小酒的人，一碟花生米，几块酒糟鱼就可以半杯下肚，生活的美好无处不在。', '草鱼、白芝麻、生抽、盐、油、耗油、酒糟、辣椒酱、生姜末。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/12/2022121216708137434901.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (80, '番茄豆腐鱼片汤', '原味', '汤类', '', '巴沙鱼片、番茄、嫩豆腐、葱花、花生油、生抽、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/26/2023022616773795032151.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (81, '西红柿炒鸡蛋', '酸甜', '热菜', '', '西红柿、鸡蛋、香葱、食用油、盐、白糖、黄酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/12/2022121216708319062281.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (82, '萝卜馅包子', '原味', '面食', '宣软美味，健康营养，时令菜。', '面粉、萝卜、酵母、纯净水、肉馅、蒜苗、香菜、盐、老抽、五香粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/12/2022121216708391407071.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (83, '黑芝麻全麦餐包', '甜味', '烘焙', '今天用市售的黑芝麻糊粉，来做全麦餐包，出来的成品芝麻香和麦香味浓郁，口感柔软有弹性，作早餐最合适不过了，配一杯热牛奶，营养又美味。', '高筋面粉、全麦粉、黑芝麻糊粉、盐、酵母、牛奶、蜂蜜、无盐黄油、高筋面粉、清水、酵母。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/12/2022121216708319754751.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (84, '鱼籽包大白菜荞麦面', '清淡', '面条', '', '大白菜、鱼籽包、荞麦面、生抽、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/12/2022121216708320223781.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (85, '虾仁炒儿菜', '微辣', '热菜', '', '儿菜、虾仁、红椒、薄皮椒、食用油、食盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/12/2022121216708320665581.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (86, '西红柿肉丁打卤面', '酱香', '面条', '论手擀面的神仙吃法。', '面粉、鸡蛋、西红柿、鸡胸肉、葱、油、盐、鸡精、蚝油、玉米淀粉、老抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/12/2022121216708321484301.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (87, '炝拌红萝卜丝', '酸辣', '热菜', '沙地的红萝卜心细脆甜，凉拌更好吃。', '红萝卜、香菜、蒜苗、干辣椒、盐、生抽、搅拌醋、花椒粉、鸡精、芝麻香油、花生油、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/03/2023010316727162538201.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (88, '香菇牛肉酱', '酱香', '家常菜', '山姆超市买的牛排（腌制好的）吃不完放冰箱里冷冻保存，今天准备换一种吃法，做了香菇牛肉酱，搭配馒头面条都很好吃哦！', '牛肉、干香菇、洋葱、姜末、盐、生抽、黄豆酱。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/14/2022121416709913221651.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (89, '五彩炒饭', '咸香', '主食', '简简单单一盘炒饭，因为有了各种蔬菜的搭配而食欲大增呀！蔬菜可以根据自己的口味随意搭配哈！', '米饭、鸡蛋、笋丁、洋葱、香菇、胡萝卜、盐、生抽、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/14/2022121416709964693151.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (90, '猴头菇猪肚汤', '咸鲜', '汤类', '猴头菌菌肉鲜嫩，香醇可口，有“素中荤”之称，具有降胆固醇、养护肠胃、抗衰老等功效。\n1、降低胆固醇\n猴头菇能降低血胆固醇和甘油三酯的含量，可调节血脂，有利于血液循环，是心血管患者的理想食品。\n2、养护肠胃\n猴头菇具保护、调理和修复消化系统的功效，可助消化、益肝脾、解饥解渴、除宿毒。食欲不振、恶心呕吐者食用后能迅速止呕，改善食欲。\n3、抗衰老\n猴头菇对神经衰弱、失眠有辅助食疗的功效，猴头菇可促进脑细胞生长和再生，对预防和治疗老年痴呆症有良好的效果，是益寿抗衰的食品。', '猪肚、新鲜猴头菇、纯净水、葱姜、白酒、食盐、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709013016461.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (91, '肉丝炒薄皮椒', '微辣', '热菜', '爱上了这个薄皮辣椒的味道。\n香且微辣，因为皮薄，做出来的菜品更入味。\n而且，巨便宜哦，9毛9一斤！', '薄皮辣椒、猪肉、食用油、红椒、大蒜、食盐、生抽、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709012463621.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (92, '大蒜炒鲍鱼', '清淡', '热菜', '', '鲍鱼、大蒜、姜片、料酒、生抽、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/12/2022121216708390943071.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (93, '反沙芋头', '甜香', '热菜', '芋头好像是南方的食材，反沙也好像是南方的做法，在东北，这玩意可能就是糖梨膏，拔丝山药，拔丝地瓜……早上买了个荔浦芋头，想做甜品，于是学着试了反沙芋头的做法，竟出奇的好吃。炒糖配上橙皮碎，橙皮碎清香的味道，非常惊艳，做法分享给大家。', '芋头、淀粉、白糖、橙皮、香葱。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/12/2022121216708494843641.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (94, '白菜粉皮拌鸡', '其他', '热菜', '用鸡腿肉味道更好。\n不过因为鸡胸肉都没人喜欢吃，所以就用鸡胸来拌菜。', '粉条、白菜芯、鸡胸肉、香菜、大蒜、食盐、鸡精、陈醋、生抽、芝麻酱、香油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709011982321.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (95, '家庭版烤鱼', '麻辣', '热菜', '麻辣鲜香，好吃！', '草鱼、豆芽、金针菇、豆腐、香菜、葱、姜、花椒、大料、麻椒、干辣椒、豆瓣酱、火锅底料。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/12/2022121216708496256701.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (96, '擂椒皮蛋', '香辣', '凉菜', '', '皮蛋、辣椒、蒜、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/12/2022121216708496685721.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (97, '韭菜炒毛蚶', '咸香', '热菜', '我哥特别喜欢吃毛蚶子，只有他回家的时候，在奶奶家吃饭，才会吃到大姑做的炒蚶肉。韭菜已经过季了，买的也不是特别嫩，摘菜的时候，得扔了一半。但是炒下来还好，非常鲜美，韭菜和毛蚶子，海边人经典的搭配，做法分享给大家。', '毛蚶、韭菜、蒜、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/12/2022121216708497166181.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (98, '干烧鲫鱼', '微辣</', '热菜', '鲫鱼肉嫩汤鲜，特别是哥哥钓回来的，都是土货，随便啷个做好后都巴适得板！奈何从小被鱼刺卡到过后，一直对吃鲫鱼有一种深深的恐惧感……不知道有没有同款的童鞋？\n内江有道名菜干烧鱼，原材料是用鲤鱼来做的，今天按照干烧鱼的方法做的红烧鲫鱼，稍微改良了一下，竟然真的吃不到细小鱼刺，你不想试试吗？', '鲫鱼、大葱、小葱、老姜、大蒜、泡姜、泡椒、鸡蛋、郫县豆瓣、自制红油豆瓣、黄酒、青花椒、红花椒、菜籽油、红薯淀粉、盐、猪油、生抽、食醋、白糖、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709102009801.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (99, '西葫芦鸡蛋早餐饼', '咸鲜', '面食', '', '西葫芦、胡萝卜、大葱、鸡蛋、面粉、盐、十三香、豆瓣酱、番茄酱。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709013499761.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (100, '排骨烧鸡蛋', '清淡', '热菜', '', '排骨、鸡蛋、冰糖、老干妈辣椒酱、玉米油、盐、生抽、老抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709013871861.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (101, '红烧五花肉', '甜味', '热菜', '', '五花肉、生姜，香叶、冰糖、盐、生抽、老抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709015148441.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:59', '2023-04-06 13:26:59', NULL);
INSERT INTO `t_meal` VALUES (102, '蛋饺鱼籽包荞麦面', '清淡', '面条', '', '荞麦面、蛋饺、鱼籽包、香葱、生抽、芝麻油、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709014628591.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:58', '2023-04-06 13:26:58', NULL);
INSERT INTO `t_meal` VALUES (103, '蛏子炒白菜梗', '清淡', '热菜', '', '白菜梗、蛏子肉、辣椒、玉米油、盐、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709096955001.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:58', '2023-04-06 13:26:58', NULL);
INSERT INTO `t_meal` VALUES (104, '红烧巴沙鱼', '清淡', '热菜', '', '巴沙鱼、葱花、生姜、玉米油、盐、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709097345831.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:58', '2023-04-06 13:26:58', NULL);
INSERT INTO `t_meal` VALUES (105, '蒜香西生菜', '蒜香', '热菜', '', '西生菜、食用油、大蒜、蒸鱼豉鱼或生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709097846621.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:58', '2023-04-06 13:26:58', NULL);
INSERT INTO `t_meal` VALUES (106, '萝卜素丸子汤', '咸鲜', '汤类', '', '萝卜、面粉、西红柿、鸡蛋、生菜、青椒、盐、十三香、生抽、老抽、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709098907121.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:58', '2023-04-06 13:26:58', NULL);
INSERT INTO `t_meal` VALUES (107, '椒肉丝炒黄豆芽', '清淡', '热菜', '', '肉丝、黄豆芽、青椒、料酒、酱油、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709098323281.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:58', '2023-04-06 13:26:58', NULL);
INSERT INTO `t_meal` VALUES (108, '荠菜肉馅饺子', '酸辣', '面食', '昨天菜市场看到有买荠菜的，鲜美肉肥。赶紧买了些回家。荠菜是“护眼冠军”，高钙高蛋白，冬天比白菜、韭菜更鲜。中午就吃荠菜肉馅饺子吧。', '荠菜、大肉、面粉、大葱、生姜、盐、生抽、老抽、蚝油、鸡精、花椒粉、五香粉、花生油、芝麻香油、葱姜水、大蒜、辣椒面、虾皮、香菜、醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/01/2023010116725672343681.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:58', '2023-04-06 13:26:58', NULL);
INSERT INTO `t_meal` VALUES (109, '番茄虾仁疙瘩汤', '咸香', '面食', '早上起来，来一碗热热乎乎的疙瘩汤，暖胃又暖身，食材简单，做法方便，分享给大家。', '西红柿、虾仁、山药、金针菇、生菜、鸡蛋、面粉、五香粉、酱油、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709183467701.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:58', '2023-04-06 13:26:58', NULL);
INSERT INTO `t_meal` VALUES (110, '五指毛桃炖肉汤', '咸鲜', '汤类', '', '瘦肉、五指毛桃、茯苓、盐、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709184646621.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:58', '2023-04-06 13:26:58', NULL);
INSERT INTO `t_meal` VALUES (111, '清炒儿菜', '清淡', '热菜', '', '儿菜、食用油、盐、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709224688121.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:58', '2023-04-06 13:26:58', NULL);
INSERT INTO `t_meal` VALUES (112, '大葱炒千张条', '清淡', '热菜', '', '千张条、大葱、酱油、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709357521371.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:58', '2023-04-06 13:26:58', NULL);
INSERT INTO `t_meal` VALUES (113, '薄皮椒炒肚丝', '微辣', '热菜', '', '薄皮辣椒、猪肚、红椒、食用油、葱姜、食盐、生抽、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709357069621.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:58', '2023-04-06 13:26:58', NULL);
INSERT INTO `t_meal` VALUES (114, '拔丝芋头', '甜香', '热菜', '据说东北菜馆招厨子的时候，会考两个菜，一个是烧茄子，一个是拔丝地瓜。烧茄子这个菜，我到现在也没有get成功过，拔丝倒是很早很早就会了。一道日常小甜品，拔丝一切之拔丝芋头，好好吃。', '芋头、糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709413928401.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:58', '2023-04-06 13:26:58', NULL);
INSERT INTO `t_meal` VALUES (115, '辣椒炒肥肠', '香辣', '热菜', '每次买肥肠的时候，都会买2-3根，一起收拾好，然后冻在冰箱里，吃的时候，简单化一下，很方便。今晚凑个菜，辣椒炒肥肠，做法分享给大家。', '肥肠、辣椒、蒜、姜、小米辣、洋葱、香菜、酱油、高度白酒、蚝油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709415112261.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:58', '2023-04-06 13:26:58', NULL);
INSERT INTO `t_meal` VALUES (116, '白菜豆腐汤', '咸鲜', '汤类', '冬天就是要吃白菜的季节，不要天天大鱼大肉，一碗热乎的白菜豆腐汤下肚，清淡可口，简直不要太满足了。', '白菜、豆腐、鸡蛋、粉丝、盐、鸡精、香油、十三香、生抽、老抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/13/2022121316709414511901.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:58', '2023-04-06 13:26:58', NULL);
INSERT INTO `t_meal` VALUES (117, '胡萝卜土豆烧鸡翅', '咸香', '热菜', '', '鸡翅、鸡爪、胡萝卜、土豆、青椒、盐、冰糖、葱姜、红辣椒、料酒、生抽、八角。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/15/2022121516710755847781.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:58', '2023-04-06 13:26:58', NULL);
INSERT INTO `t_meal` VALUES (118, '酸菜汆白肉', '酸咸', '热菜', '亲戚自己做的酸菜，看着干净吃着放心，五花肉一定要五花三层的那种，搭配一碗灵魂料汁，还可以放点粉丝，真是好吃极了！在这寒冷的冬天来上一锅太舒服太满足啦！', '五花肉、酸菜、八角、葱花、盐、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/14/2022121416709965185391.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:58', '2023-04-06 13:26:58', NULL);
INSERT INTO `t_meal` VALUES (119, '鸡蛋鱼籽包裙带菜汤', '清淡', '汤类', '', '裙带菜、鱼籽包、鸡蛋、白胡椒粉、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/14/2022121416709914711621.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:58', '2023-04-06 13:26:58', NULL);
INSERT INTO `t_meal` VALUES (120, '石榴热红茶', '酸甜', '饮品', '今天制作一杯石榴热红茶，清甜爽口的石榴汁水，配上醇厚的红茶，带着丝丝冰糖的甜意，红茶的温润，石榴的酸甜，暖心暖胃，元气满满，这味道，香香甜甜的。', '软籽石榴、纯净水、冰糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/14/2022121416710098075671.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:58', '2023-04-06 13:26:58', NULL);
INSERT INTO `t_meal` VALUES (121, '乌鸡蛋海参炒鹿茸菇', '微辣', '热菜', '', '海参、乌鸡蛋、鹿茸菇、食用油、薄皮辣椒、红椒、食盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/14/2022121416709963241291.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:57', '2023-04-06 13:26:57', NULL);
INSERT INTO `t_meal` VALUES (122, '土豆丝饼', '咸香', '小吃', '周末休息的早上，起来不慌不忙，想弄点什么吃的，不用太麻烦，也不枉费大好的时光。嗯，家里只有土豆，就做了一对，土豆丝饼。吃一口垫补一下，然后可以安心的晒太阳了。做法分享给大家。', '土豆、鸡蛋、小葱、黑胡椒、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/14/2022121416709965697521.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:57', '2023-04-06 13:26:57', NULL);
INSERT INTO `t_meal` VALUES (123, '橙子苹果茶', '原味', '饮品', '家里正好有橙子和苹果，让我们来做一款冬季的暖饮。', '橙子、苹果、冰糖、红茶。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/15/2022121516710925074331.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:57', '2023-04-06 13:26:57', NULL);
INSERT INTO `t_meal` VALUES (124, '番茄土豆炖牛腩', '酸甜', '热菜', '冬日里一碗酸甜的番茄浓汤，是一道超棒的下饭暖身神器，也是一道味美香甜好吃不腻的家常大菜，绝对的，值得拥有，反复拥有！做法分享给大家。', '牛腩、土豆、西红柿、姜、香菜、冰糖、香叶、八角、酱油、料酒、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/14/2022121416710028238431.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:57', '2023-04-06 13:26:57', NULL);
INSERT INTO `t_meal` VALUES (125, '咖喱土豆鸡块', '咖喱', '热菜', '', '鸡腿、土豆、姜丝、咖喱粉、食用油、盐、生抽、黄酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/14/2022121416710027643751.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:57', '2023-04-06 13:26:57', NULL);
INSERT INTO `t_meal` VALUES (126, '香干炒双色', '咸香', '热菜', '', '圆椒、香干、胡萝卜、食用油、盐、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/14/2022121416710067782311.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:57', '2023-04-06 13:26:57', NULL);
INSERT INTO `t_meal` VALUES (127, '香菜胡萝卜炒肚丝', '咸鲜', '热菜', '', '熟猪肚、大棵香菜、胡萝卜、食用油、食盐、生抽、鸡精、葱。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/15/2022121516710926677801.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:57', '2023-04-06 13:26:57', NULL);
INSERT INTO `t_meal` VALUES (128, '山楂莲藕红枣饮', '酸甜', '饮品', '天冷了很多人都難免會吃多了肉肉加上年底了節日慶祝家庭聚會全部都是吃，吃，吃！\n吃的太多腸胃容易積滯，尤其是小朋友消化系統未完全成熟更容易引起脾胃差，這時候最好給家人多煲點開胃消滯健脾的山楂蓮藕紅棗飲了', '山楂、蓮藕、紅棗、冰糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/15/2022121516710701344521.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:57', '2023-04-06 13:26:57', NULL);
INSERT INTO `t_meal` VALUES (129, '花开富贵蒜蓉虾', '蒜香', '热菜', '菜品简单易做，蒜香浓郁，鲜美可口，入味十足，超级下饭菜！', '虾、粉丝、豆腐、蒜、料酒、蚝油、生抽、蒸鱼酱油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/14/2022121416710183812401.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:57', '2023-04-06 13:26:57', NULL);
INSERT INTO `t_meal` VALUES (130, '清炒茼蒿', '清淡', '热菜', '', '茼蒿、食用油、盐、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/14/2022121416710184254731.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:57', '2023-04-06 13:26:57', NULL);
INSERT INTO `t_meal` VALUES (131, '薄皮椒炒土豆丝', '酸辣', '热菜', '', '薄皮辣椒、后旗红土豆、猪肉、食用油、食盐、生抽、鸡精、陈醋、葱。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/15/2022121516710926132111.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:57', '2023-04-06 13:26:57', NULL);
INSERT INTO `t_meal` VALUES (132, '葱烧黄鱼', '咸鲜', '热菜', '黄鱼是最家常的一种鱼了，好买，好存，好做，好吃。清蒸，啫啫，干煎，红烧，糖醋，做过太多次了，大多还是清蒸，简单，原味，鲜美。这次就想换个做法，学了一下葱烧，味道也非常不错，分享给大家。', '黄鱼、葱、姜、小米辣、香菜、蚝油、酱油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/14/2022121416710224188551.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:57', '2023-04-06 13:26:57', NULL);
INSERT INTO `t_meal` VALUES (133, '肉末烧萝卜豆腐', '酱香', '热菜', '', '肉末、豆腐、白萝卜、虾皮、姜、豆瓣酱、淀粉、油、盐、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/16/2022121616711799417051.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:57', '2023-04-06 13:26:57', NULL);
INSERT INTO `t_meal` VALUES (134, '凉拌菠菜', '清淡', '凉菜', '', '菠菜、枸杞、蒜蓉、橄榄油、香醋、凉拌酱油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/18/2022121816713648356301.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:56', '2023-04-06 13:26:56', NULL);
INSERT INTO `t_meal` VALUES (135, '红豆糯米团子', '奶香', '小吃', '一口软糯香甜，你的餐桌上可别少了这一口！', '红豆、糯米粉、白糖、牛奶。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/14/2022121416710282438751.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:56', '2023-04-06 13:26:56', NULL);
INSERT INTO `t_meal` VALUES (136, '酱香腊肉', '五香', '家常菜', '', '五花肉、八角、桂皮、花椒、香叶、辣椒、盐、生抽、老抽、白糖、高度白酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/22/2022122216716990852331.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:56', '2023-04-06 13:26:56', NULL);
INSERT INTO `t_meal` VALUES (137, '红糖糯米糕', '甜味', '糕点', '寒冷的冬天适合于吃糯糯软软的糕点。', '糯米、开水、牛奶、红糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/17/2022121716712564876931.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:56', '2023-04-06 13:26:56', NULL);
INSERT INTO `t_meal` VALUES (138, '菠菜鸡蛋饼', '咸鲜', '面食', '菠菜补钙，孩子偏不爱吃，做成蛋饼她勉强可以接受。', '鸡蛋、面粉、菠菜、盐、辣酱。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/15/2022121516710756047351.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:56', '2023-04-06 13:26:56', NULL);
INSERT INTO `t_meal` VALUES (139, '梅干菜肉末烤饼', '清淡', '面食', '', '自发面粉、梅干菜、肉末、温水、玉米油、白芝麻、料酒、生抽、盐、味精、零卡糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/15/2022121516710829991781.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:56', '2023-04-06 13:26:56', NULL);
INSERT INTO `t_meal` VALUES (140, '酸奶拌奶油富士', '酸甜', '小吃', '', '奶油富士、酸奶、阳光玫瑰、果干。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/15/2022121516710925561531.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:56', '2023-04-06 13:26:56', NULL);
INSERT INTO `t_meal` VALUES (141, '潘娜托尼', '甜味', '烘焙', '第一次吃在DV，有被惊艳到，所以就自己试试做做看，没想到非常好吃，大家可以自己做做，送朋友也很不错。', '桂花蜜、白砂糖、干酵母、温牛奶、高筋面粉、全蛋液、香草精、无盐黄油、蓝莓干、陈皮、朗姆酒、蛋清、糖粉、杏仁粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/15/2022121516711037685911.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:56', '2023-04-06 13:26:56', NULL);
INSERT INTO `t_meal` VALUES (142, '香菇培根糯米饭', '咸香', '主食', '', '糯米、培根、香菇、玉米粒、香葱、食用油、盐、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/15/2022121516710935616341.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:56', '2023-04-06 13:26:56', NULL);
INSERT INTO `t_meal` VALUES (143, '菠菜炒蛋', '咸鲜', '热菜', '', '鸡蛋、菠菜、蒜、油、盐、料酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/15/2022121516711038074561.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:56', '2023-04-06 13:26:56', NULL);
INSERT INTO `t_meal` VALUES (144, '红枣杂粮窝头', '甜香', '小吃', '这个窝头虽然看起来一般般，但是吃起来非常不错，一家人都抢着吃呢，自己打的杂粮面，营养丰富，吃着放心啊！', '大米、小米、黑米、红米、糯米、红枣、清水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/15/2022121516711130918731.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:56', '2023-04-06 13:26:56', NULL);
INSERT INTO `t_meal` VALUES (145, '姜葱炒鸡翅', '葱香', '热菜', '要想鸡翅容易入味和熟透，一般都在翅膀背面斜划一至两刀，也有的在翅膀的两条骨之间划开，还有一种用的办法是在鸡翅两骨之间剁开成一长条，也可以试试，入味与易熟的要求都能达到。', '鸡翅、翅尖、姜片、红葱头、生抽、胡椒粉、味啉、白酒、玉米淀粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/16/2022121616711546915561.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:56', '2023-04-06 13:26:56', NULL);
INSERT INTO `t_meal` VALUES (146, '十全大补汤', '咸香', '汤类', '', '甲鱼、海龙、公鸡蛋、人参、红参、红枣、鹿茸、玛卡、枸杞、当归、葱、姜、陈皮、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/16/2022121616711547817651.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:56', '2023-04-06 13:26:56', NULL);
INSERT INTO `t_meal` VALUES (147, '胡萝卜炒菜苔', '咸鲜', '热菜', '', '胡萝卜、红菜苔、蒜、油、盐、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/16/2022121616711603065181.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:56', '2023-04-06 13:26:56', NULL);
INSERT INTO `t_meal` VALUES (148, '魔法盐', '咸香', '私房菜', '用香菇、虾皮和盐自制的魔法盐很香，完美取代鸡精、味精~', '干香菇、干虾皮、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/16/2022121616711610345201.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:56', '2023-04-06 13:26:56', NULL);
INSERT INTO `t_meal` VALUES (149, '虾皮炒西生菜', '咸鲜', '热菜', '', '西生菜、虾皮、食用油、香菜叶、食盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/16/2022121616711685679421.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:56', '2023-04-06 13:26:56', NULL);
INSERT INTO `t_meal` VALUES (150, '凉拌莴笋花菜胡萝卜', '清淡', '凉菜', '', '莴笋、松花菜、胡萝卜、蒜泥、盐、凉拌酱油、陈醋、芝麻油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/23/2022122316717646373531.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:56', '2023-04-06 13:26:56', NULL);
INSERT INTO `t_meal` VALUES (151, '肉丝炒饼', '咸香', '小吃', '', '大饼、瘦肉丝、洋白菜、洋葱、胡萝卜、豆芽菜、鸡蛋、盐、酱油、料酒、淀粉、蒜末、玉米油、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714155783091.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (152, '海米呛拌土豆丝', '其他', '热菜', '这道菜是当年老公追我的时候经常请我吃的一道菜之一。\n当年我工作的那条街有家新疆烤全羊，我超喜欢吃烤全羊。因为羊肉很腻，每次都再点一些清爽的拌菜，这道炝拌土豆丝就是我每次必点的一道菜。', '后旗红土豆、海米、青椒、辣椒油、食用油、花椒、食盐、生抽、陈醋、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/16/2022121616711910406291.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (153, '饺子皮锅贴生煎包', '咸鲜', '小吃', '好吃不过饺子，但是也会吃腻是不，那就来试试这款锅贴和生煎包吧，一锅出两种，绝对颜值和美味共享。', '猪肉末、白面粉、玉米粒、胡萝卜、葱末、盐、生抽、五香粉、姜粉、鸡精、油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714513873541.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (154, '牛奶芝士火鸡面', '超辣', '面条', '', '火鸡面、鸡蛋、芝士、牛奶。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/18/2023021816767008587071.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (155, '红枣糯米团子', '奶香', '小吃', '相约软糯，女孩子不要错过这款哦！', '红枣、糯米、牛奶。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/17/2022121716712420506011.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (156, '奶油富士炖雪蛤', '甜味', '糖水', '', '奶油富士、雪蛤、纯净水、果干、冰糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/17/2022121716712422362501.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (157, '蒜泥海带丝', '咸鲜', '凉菜', '大蒜具有抗菌消炎的作用，海带能够减肥，促进钙吸收，增强体质，疫情期间他俩的结合有益于我们增强体魄，很适合家人食用，早餐配点粥和馒头也是不错的小菜。', '干海带丝、大蒜、香油、辣椒油、糖、醋、生抽、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/17/2022121716712473104471.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (158, '毛豆肉丝炒大白菜芯', '清淡', '热菜', '', '大白菜芯、毛豆、肉丝、料酒、酱油、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/17/2022121716712474345291.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (159, '白萝卜肉包', '咸鲜', '面食', '', '白萝卜、肉糜、发酵好的面团、干面粉、食盐、生抽、葱姜、食用油、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714285183341.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (160, '豉油白菜豆腐', '清淡', '热菜', '', '大白菜、豆腐、蒸鱼豉油、生抽、葱花、盐、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714156278211.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (161, '火腿手撕包菜', '咸鲜', '热菜', '室友是一个不会做饭的人，做的饭菜没几次能和我的口味，但惟独这道手撕包菜，让我难忘，最近孩子没什么胃口，做这样一道菜，看能不能尝出特别的味道来！', '包菜、火腿、大蒜、盐、鸡精、生抽、老抽、玉米淀粉、花椒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/17/2022121716712539991901.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (162, '酸汤小酥肉', '酸咸', '热菜', '寒冷的冬季，酸酸辣辣的汤，一锅煮，吃的可美味了。', '五花肉、西红柿、水发木耳、葱、姜、小酥肉粉、番茄浓汤。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/24/2022122416718468078921.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (163, '花豇豆红薯粥', '原味', '粥', '', '大米、小米、花豇豆、纯净水、无、红薯。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/17/2022121716712576391321.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (164, '橄榄油芝麻乳酪面包', '其他', '烘焙', '', '高筋面粉、牛奶、橄榄油、糖、盐、干酵母、耐高温乳酪丁、黑芝麻。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/17/2022121716712614862731.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (165, '牙签肉', '咸香', '热菜', '', '猪肉、孜然粉、生抽、辣椒粉、淀粉、白芝麻、盐、蒜末。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/18/2022121816713339991441.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (166, '巧克力脆皮盒子', '其他', '烘焙', '', '鸡蛋、玉米油、牛奶、低筋粉、巧克力、可可粉、淡奶油、奥利奥粉、巧克力、做巧克力酱的淡奶油、糖、巧克力脆珠、巧克力、椰子油、吉利丁片。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/18/2022121816713394315461.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (167, '糖醋鲳鱼', '酸甜', '热菜', '', '鲳鱼、香菜、玉米油、大料、葱、姜、蚝油、老抽、生抽、白糖、盐、米醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714126397801.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (168, '榨菜猪油渣烤饼', '清淡', '小吃', '', '面粉、猪油渣、榨菜、玉米油、温水、白芝麻、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/18/2022121816713414826721.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (169, '圣诞小吃翠玉瓜汉堡', '咸鲜', '小吃', '疫情嚴重聖誕還是宅家安全點\n在家過聖誕也要有儀式感\n分享一個好吃簡單又易做的聖誕小食\n在家也可以過一個開心難忘的聖誕節呢聖誕\n最重要家人朋友身體健康平安喜樂', '翠玉瓜、蝦滑、芝士、聖女果、小食用竹籤、麻油、胡椒粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/18/2022121816713519844121.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (170, '烤牙签肉', '微辣', '热菜', '', '小里脊肉、生抽、老抽、料酒、白胡椒粉、孜然粉、辣椒粉、盐、淀粉、食用油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/20/2022122016715414792951.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:55', '2023-04-06 13:26:55', NULL);
INSERT INTO `t_meal` VALUES (171, '南瓜全麦馒头', '原味', '主食', '', '南瓜泥、全麦粉、中筋面粉、酵母、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/05/2023010516728864812551.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (172, '自制黑豆腐', '原味', '凉菜', '', '黑豆、黑芝麻、鸡蛋、水、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/04/2023020416755166671471.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (173, '松花菜胡萝卜炒蛋', '咸鲜', '热菜', '', '鸭蛋、松花菜、胡萝卜、油、盐、料酒、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714302988241.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (174, '包菜炒粉条', '微辣', '热菜', '干锅包菜的拓展菜，微辣鲜香，很下饭～', '包菜、红薯粉条、猪肉、葱姜蒜、小米辣、生抽、蒸鱼豉油、冰糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/18/2022121816713473439241.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (175, '红枣黑木耳米糊', '甜味', '饮品', '', '黑木耳、红枣、无花果、黑米、纯净水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/18/2022121816713493224531.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (176, '桃胶银耳羹', '甜味', '糖水', '疫情在家，哪里不去，做做吃的，也挺好。', '桃胶、银耳、红枣、枸杞、黄冰糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/18/2022121816713515283941.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (177, '芥末龙利鱼', '香辣', '热菜', '芥末龙利鱼绝对的高大上，星级饭店的感觉。奶香芥辣鱼肉鲜，简单又好吃，口感层次丰富。老公说无论是家里来客还是过年节，这道菜绝对上得了台面。', '龙利鱼、沙拉酱、芥末、食用油、淀粉、胡椒粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/18/2022121816713602645641.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (178, '肉面结豆腐汤', '清淡', '汤类', '', '豆腐、肉面结、香葱、酱油、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/18/2022121816713603079161.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (179, '虾仁炒苤蓝', '咸鲜', '热菜', '', '虾仁、苤蓝、姜、蒜、香菜、油、盐、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/20/2022122016715262102331.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (180, '肉末绿豆芽', '咸鲜', '热菜', '', '绿豆芽、肉糜、韭菜、食用油、食盐、陈醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714284633181.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (181, '五红饮', '甜味', '饮品', '五红饮具有健脾补血的作用，饮用后可五红饮具有健脾补血的作用，饮用后可以加速体内血液循环，改善女性因气虚血亏引起的手脚冰凉等症状。另外，五红饮中含有铁元素，可以促进血液中血红蛋白生成，预防缺铁性贫血。五红饮中的红豆还有利水去湿的作用，可以缓解双下肢水肿，帮助去除体内湿气。以加速体内血液循环，改善女性因气虚血亏引起的手脚冰凉等症状。另外，五红饮中含有铁元素，可以促进血液中血红蛋白生成，预防缺铁性贫血。五红饮中的红豆还有利水去湿的作用，可以缓解双下肢水肿，帮助去除体内湿气。', '红豆、无核大枣、花生、枸杞、红糖、水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714154307971.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (182, '花椒蒸梨', '甜味', '私房菜', '花椒，有温中散寒、除湿止痛的功效，对一些细菌、病毒都有抑制的作用，还能调节免疫力，提升全身的阳气;梨具有润燥化痰的功效;冰糖能补中益气、和胃润肺，同时还能调和药性。所以三者合用，能起到疏风散寒、宣肺止咳的作用，特别适合身体虚弱、阳气亏虚、风寒咳嗽的朋友。', '梨、花椒、冰糖、清水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714154714071.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (183, '金橘冰糖雪梨汤', '甜味', '糖水', '', '雪梨、金橘、黄冰糖、清水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/22/2022122216716922925071.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (184, '猪肉大馅馄饨', '咸鲜', '小吃', '', '自制冷冻大馄饨、香菜碎、盐、生抽、香油、鸡精、紫菜、虾皮。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/22/2022122216716923352111.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (185, '核桃牛奶燕麦粥', '原味', '粥', '', '牛奶、即食燕麦、刺梨核桃仁、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714282539271.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (186, '笋片腊肠', '麻辣', '热菜', '家常下饭菜~', '笋片、腊肠、尖椒、葱姜蒜、干辣椒、味极鲜。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714293712471.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (187, '上海汁味红烧鱼', '咸甜', '热菜', '上海菜的特色是浓油赤酱，不用炒糖色也可以做出好吃的红烧菜。今天就分享一道红烧鱼。', '青鱼、青豆、生姜、小葱、品料酒、冰糖红烧汁、水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714588886191.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (188, '红参莲子炖乌鸡汤', '清淡', '汤类', '红参补，黄芪固，莲子润，很好的组合。', '乌鸡、红参、黄芪、莲子、桂圆肉、姜、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714420722241.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (189, '雪花牛肉炒胡萝卜丝', '咸鲜', '热菜', '', '雪花牛肉、水果胡萝卜、蒜末、油、盐、蚝油、胡椒粉、生粉、香油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714427084541.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (190, '鹿茸菇韭菜炒鸡蛋', '咸鲜', '热菜', '', '鹿茸菇、鸡蛋、韭菜、食用油、食盐、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714511064841.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (191, '羊肉汤', '咸鲜', '汤类', '', '熟羊肉、煮羊肉的汤、清水、胡萝卜、香菜、大葱、食盐、鸡精、陈醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714511433531.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (192, '瘦肉炒西芹黑木耳', '咸鲜', '热菜', '', '瘦肉、西芹、黑木耳、蒜末、油、盐、酱油、胡椒粉、木糖醇、生粉、香油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714513519101.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (193, '家常番茄炒蛋', '清淡', '热菜', '', '番茄、鸡蛋、蒜头、葱、油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714514859071.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:54', '2023-04-06 13:26:54', NULL);
INSERT INTO `t_meal` VALUES (194, '家常肉沫土豆', '咸鲜', '热菜', '满大街都是小阳人，也不赶出去买菜，就在家研究土豆吧，今天做了肉沫土豆，真是吃多的节奏。', '土豆、牛肉沫、生抽、老抽、黄豆酱、十三香、味精、葱蒜、蚝油、干辣椒、水淀粉', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714533388971.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:53', '2023-04-06 13:26:53', NULL);
INSERT INTO `t_meal` VALUES (195, '全麦吐司', '甜味', '烘焙', '今天用波兰种方法做全麦吐司，松软又有弹性，入口满满麦香，而且超级拉丝，一条条撕着吃，超有感觉。', '高筋面粉、全麦粉、白砂糖、盐、酵母、鸡蛋、清水、无盐黄油、高筋面粉、清水、酵母。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/19/2022121916714589494881.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:53', '2023-04-06 13:26:53', NULL);
INSERT INTO `t_meal` VALUES (196, '墨鱼丸炒鸡蛋', '清淡', '热菜', '', '鸡蛋、墨鱼丸、香葱、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/20/2022122016715157578351.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:53', '2023-04-06 13:26:53', NULL);
INSERT INTO `t_meal` VALUES (197, '麻辣肠炒藕条', '麻辣', '热菜', '', '莲藕、麻辣肠、胡萝卜、食用油、芹菜、食盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/20/2022122016715158013581.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:53', '2023-04-06 13:26:53', NULL);
INSERT INTO `t_meal` VALUES (198, '杂粮粥', '原味', '粥', '', '红芸豆、薏米、百合、莲子、花生、红枣、大米。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/20/2022122016715158554821.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:53', '2023-04-06 13:26:53', NULL);
INSERT INTO `t_meal` VALUES (199, '炒河粉', '咸香', '小吃', '', '绿豆芽、河粉、胡萝卜丝、青菜、蒜蓉、咸柠檬、蚝油、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/20/2022122016715159496441.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:53', '2023-04-06 13:26:53', NULL);
INSERT INTO `t_meal` VALUES (200, '猕猴桃葡萄奶昔', '酸甜', '饮品', '', '猕猴桃、酸奶、阳光玫瑰。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/20/2022122016715159941691.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:53', '2023-04-06 13:26:53', NULL);
INSERT INTO `t_meal` VALUES (201, '羊肉玉米热汤面', '咸鲜', '面条', '', '玉米面条、熟羊肉、羊肉汤、清水、食盐、鸡精、葱、香菜、陈醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/20/2022122016715160408731.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:53', '2023-04-06 13:26:53', NULL);
INSERT INTO `t_meal` VALUES (202, '红烧鳐鱼', '其他', '热菜', '', '鳐鱼、姜末、蒜末、葱花、色拉油、料酒、生抽、老抽、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/20/2022122016715231382271.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:53', '2023-04-06 13:26:53', NULL);
INSERT INTO `t_meal` VALUES (203, '花旗参桂圆乌鸡汤', '清淡', '汤类', '', '乌鸡、花旗参、桂圆肉、茨实、姜、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/20/2022122016715413616451.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:53', '2023-04-06 13:26:53', NULL);
INSERT INTO `t_meal` VALUES (204, '罗汉果菊花雪梨饮', '其他', '饮品', '现在羊羊很多，来一壶清润的热饮', '罗汉果、菊花、雪梨干、麦冬、纯净水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/23/2022122316717596346591.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:53', '2023-04-06 13:26:53', NULL);
INSERT INTO `t_meal` VALUES (205, '避风塘豆腐', '清淡', '热菜', '', '老豆腐、黄面包糠、蒜末、香葱、盐、零卡糖、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/20/2022122016715414086741.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:53', '2023-04-06 13:26:53', NULL);
INSERT INTO `t_meal` VALUES (206, '泡娃娃菜', '酸甜', '凉菜', '酸辣微甜的爽口小凉菜。', '娃娃菜、小米椒、姜丝、盐、白糖、白醋、花椒、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/21/2022122116716321359961.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:53', '2023-04-06 13:26:53', NULL);
INSERT INTO `t_meal` VALUES (207, '山寨版地三鲜', '咸鲜', '热菜', '这款地三鲜加入了适量的番茄酱，口感微酸，更受人欢迎。', '土豆、茄子、青椒、洋葱、番茄酱、盐、生抽、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/28/2022122816722383624171.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:52', '2023-04-06 13:26:52', NULL);
INSERT INTO `t_meal` VALUES (208, '蒜苔炒里脊', '咸鲜', '热菜', '色泽亮丽，口感嫩滑。', '蒜苔、猪里脊、盐、胡椒粉、料酒、蛋清、生粉、生抽、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/21/2022122116716323227721.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:52', '2023-04-06 13:26:52', NULL);
INSERT INTO `t_meal` VALUES (209, '全麦大列巴', '奶香', '烘焙', '缺乏信心，纠结了很久，终于下定决心动手了。\n动手就是成功的开始。', '全麦面粉、白糖、奶粉、牛奶、酵母、鸡蛋、盐、黄油、葡萄干、核桃仁、麦片、蛋黄。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/21/2022122116716322649391.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:52', '2023-04-06 13:26:52', NULL);
INSERT INTO `t_meal` VALUES (210, '红烧肉黄豆芽芹菜蒸挂面', '咸鲜', '面条', '家常做法，经济美味。', '挂面、芹菜、黄豆芽、红烧肉、盐、老抽、花椒、八角、葱姜蒜、干红辣椒、蚝油、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/22/2022122216717144169681.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:52', '2023-04-06 13:26:52', NULL);
INSERT INTO `t_meal` VALUES (211, '饼丝', '原味', '面食', '筋道有咬劲，可搭配汤羹食用。', '面粉、盐、水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/22/2022122216716862742081.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:52', '2023-04-06 13:26:52', NULL);
INSERT INTO `t_meal` VALUES (212, '豆腐汤', '香辣', '汤类', '驱寒保暖、香辣开胃、滑嫩爽口。', '嫩豆腐、红薯粉条、萝卜丸子、大骨汤、盐、胡椒粉、味精、油泼辣子、青蒜碎、姜泥汁。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/22/2022122216716865491511.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:52', '2023-04-06 13:26:52', NULL);
INSERT INTO `t_meal` VALUES (213, '红薯粉条丸子', '五香', '小吃', '中原传统小吃。', '红薯粉条、红薯淀粉、普通面粉、骨汤、盐、姜末、花椒粉、味精、葱油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/22/2022122216717040954851.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:52', '2023-04-06 13:26:52', NULL);
INSERT INTO `t_meal` VALUES (214, '牛角包', '奶香', '烘焙', '做法简单，奶香浓郁，松软可口。', '高筋粉、白糖、酵母、鸡蛋、牛奶、奶油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/30/2022123016724096248741.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:52', '2023-04-06 13:26:52', NULL);
INSERT INTO `t_meal` VALUES (215, '红烧肉酸菜炖粉条', '酸咸', '热菜', '家常小炒菜。', '酸菜、红烧肉、士豆粉条、盐、葱花、干辣椒、花椒、生抽、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/29/2022122916722841298481.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:52', '2023-04-06 13:26:52', NULL);
INSERT INTO `t_meal` VALUES (216, '海参炖蛋', '咸鲜', '羹类', '', '鸡蛋、海参、葱花、温水、香油、盐、黄酒、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/21/2022122116715929878311.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:52', '2023-04-06 13:26:52', NULL);
INSERT INTO `t_meal` VALUES (217, '五花肉木耳炒花菜', '咸香', '热菜', '', '花菜、五花肉、木耳、姜片、食用油、盐、鸡精、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/21/2022122116715942593581.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:52', '2023-04-06 13:26:52', NULL);
INSERT INTO `t_meal` VALUES (218, '双椒炒杏鲍菇', '微辣', '热菜', '', '杏鲍菇、红椒、青椒、肉糜、食用油、食盐、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/21/2022122116716017499821.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:52', '2023-04-06 13:26:52', NULL);
INSERT INTO `t_meal` VALUES (219, '面包机版全麦黑芝麻吐司', '甜味', '烘焙', '最近气温偏低，面包机又发挥作用了，今天做的是低糖少油的全麦黑芝麻吐司，很成功，吃着也很香。', '高筋面粉、全麦面包粉、酵母、鸡蛋、水、黑芝麻、白糖、橄榄油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/22/2022122216716724585871.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:52', '2023-04-06 13:26:52', NULL);
INSERT INTO `t_meal` VALUES (220, '苤蓝豆干炒肉丝', '咸鲜', '热菜', '', '里脊肉、豆干、苤蓝、莴笋、淀粉、油、盐、料酒、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/21/2022122116716119643951.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:51', '2023-04-06 13:26:51', NULL);
INSERT INTO `t_meal` VALUES (221, '鲜香黑豆腐', '咸鲜', '热菜', '', '黑豆腐、海鲜菇、胡萝卜、洋葱、水淀粉、葱、油、盐、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/07/2023020716757405047491.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:51', '2023-04-06 13:26:51', NULL);
INSERT INTO `t_meal` VALUES (222, '黄豆芽炒芹菜', '咸鲜', '热菜', '家常小炒。', '黄豆芽、芹菜、盐、葱花、生抽、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/30/2022123016724095794341.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:51', '2023-04-06 13:26:51', NULL);
INSERT INTO `t_meal` VALUES (223, '无糖鸡肉松烤饼', '清淡', '面食', '', '面粉、无糖鸡肉松、白芝麻、玉米油、温水、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/22/2022122216716866407101.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:51', '2023-04-06 13:26:51', NULL);
INSERT INTO `t_meal` VALUES (224, '芹菜炒鸡蛋', '咸鲜', '热菜', '家常小炒。', '芹菜、鸡蛋、小米椒、盐、葱花。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/29/2022122916722840867951.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:51', '2023-04-06 13:26:51', NULL);
INSERT INTO `t_meal` VALUES (225, '羊肉炖萝卜', '咸鲜', '热菜', '羊肉的最佳拍档。', '带骨羊肉、萝卜、土豆粉条、盐、葱段、姜片、花椒、胡椒粉、味精、葱花。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/31/2022123116724539221651.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:51', '2023-04-06 13:26:51', NULL);
INSERT INTO `t_meal` VALUES (226, '全麦吐司', '原味', '烘焙', '营养均衡的全麦吐司。', '全麦粉、白砂糖、鸡蛋、黄油、酵母、凉水、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/29/2022122916722939841621.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:51', '2023-04-06 13:26:51', NULL);
INSERT INTO `t_meal` VALUES (227, '传统红烧肉', '原味', '热菜', '传统红烧肉做法。', '五花肉、蜂蜜、盐、葱姜、花椒、八角、料酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/31/2022123116724539717511.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:51', '2023-04-06 13:26:51', NULL);
INSERT INTO `t_meal` VALUES (228, '虾扯蛋', '清淡', '小吃', '', '鸡蛋、鲜虾、青红椒、纸杯、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/22/2022122216717143757681.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:50', '2023-04-06 13:26:50', NULL);
INSERT INTO `t_meal` VALUES (229, '抗疫预防汤', '甜味', '饮品', '', '姜、大蒜、红糖、水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/23/2022122316717598175161.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:50', '2023-04-06 13:26:50', NULL);
INSERT INTO `t_meal` VALUES (230, '肉饼牛肉蛋皮年糕汤', '咸鲜', '小吃', '', '年糕、肉饼、鸡蛋、菠菜、油、生抽、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/23/2022122316717596799891.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:50', '2023-04-06 13:26:50', NULL);
INSERT INTO `t_meal` VALUES (231, '肉丝炒黄豆芽韭菜', '咸鲜', '热菜', '', '瘦肉、黄豆芽、韭菜、蒜末、油、盐、腌料:、酱油、胡椒粉、生粉水、花生油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/23/2022122316717597296851.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:50', '2023-04-06 13:26:50', NULL);
INSERT INTO `t_meal` VALUES (232, '猪红牛肉韭菜粥', '咸鲜', '粥', '', '白粥、猪红、牛肉、韭菜、油、胡椒粉、盐、香油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/23/2022122316717597775501.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:50', '2023-04-06 13:26:50', NULL);
INSERT INTO `t_meal` VALUES (233, '红烧牛肉', '其他', '热菜', '现在正值寒冬季节，我们就需要多吃一些能提升身体体质的食材。今天，和大家分享一道好吃的牛肉土豆，营养好吃，下酒下饭都特棒，一起试试~~', '牛肉、土豆、味达美冰糖红烧调味料、葱段、姜片、花生油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/23/2022122316717645162661.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:50', '2023-04-06 13:26:50', NULL);
INSERT INTO `t_meal` VALUES (234, '墨鱼丸炒土豆', '清淡', '热菜', '', '土豆、墨鱼丸、酱油、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/23/2022122316717961115511.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:50', '2023-04-06 13:26:50', NULL);
INSERT INTO `t_meal` VALUES (235, '青菜鱼籽包煮冬瓜', '清淡', '热菜', '', '青菜、冬瓜、鱼籽包、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/23/2022122316717966696251.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:50', '2023-04-06 13:26:50', NULL);
INSERT INTO `t_meal` VALUES (236, '西红柿鸡蛋面', '咸鲜', '面条', '西红柿鸡蛋面很简单很家常的一款面条，看似简单吃起来味道还是一点不逊色。下雪的早晨有点犯懒晚起了一会，迅速的煮碗面条解决一下早餐，吃起来暖和了很多。', '西红柿、鸡蛋、挂面条、生抽、盐、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/23/2022122316718015983881.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:50', '2023-04-06 13:26:50', NULL);
INSERT INTO `t_meal` VALUES (237, '赤豆扁豆红枣粥', '原味', '粥', '', '赤小豆、白扁豆、大米、红枣。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/24/2022122416718594263841.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:50', '2023-04-06 13:26:50', NULL);
INSERT INTO `t_meal` VALUES (238, '五彩蛋炒饭', '咸鲜', '主食', '', '鸡蛋、剩米饭、红黄菜椒、海参、杏鲍菇、葱叶、食用油、食盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/24/2022122416718594756131.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:50', '2023-04-06 13:26:50', NULL);
INSERT INTO `t_meal` VALUES (239, '圣诞巧克力树桩蛋糕', '奶香', '烘焙', '', '蛋糕粉、牛奶、鸡蛋、糖、可可粉、淡奶油、糖、香草精、淡奶油、巧克力、草莓。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/24/2022122416718661254031.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:49', '2023-04-06 13:26:49', NULL);
INSERT INTO `t_meal` VALUES (240, '润嗓黄冰糖雪梨热橙茶', '甜香', '饮品', '我最近不是热气上火喉咙痛嘛，所以就给自己赶快来了一个食疗，做了这款黄冰糖雪梨热橙茶喝！', '雪梨、本地橙子、红枣、黄冰糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/24/2022122416718898258231.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:49', '2023-04-06 13:26:49', NULL);
INSERT INTO `t_meal` VALUES (241, '干锅虾', '中辣', '热菜', '羊的时候味觉还好，没想到转阴后味口全无，吃啥都没有味。好欠158香辣虾，可现在不敢去吃。看到大家都在自己做，第一次尝试做个干锅虾。', '虾、黄瓜、土豆、藕、大蒜、香菜、小米椒、豆瓣酱、玉米淀粉、白芝麻、生抽、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/24/2022122416718900102611.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:49', '2023-04-06 13:26:49', NULL);
INSERT INTO `t_meal` VALUES (242, '铁锅炖鱼', '微辣', '热菜', '', '白鲢鱼、葱姜蒜、豆腐皮、青椒、八角、花椒、香叶、香菇、圆白菜、郫县豆瓣酱、生抽、料酒、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/25/2022122516719383609571.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:49', '2023-04-06 13:26:49', NULL);
INSERT INTO `t_meal` VALUES (243, '蚝油生菜', '咸鲜', '热菜', '', '生菜、蚝油、盐、糖、葱、蒜。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/25/2022122516719422389491.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:49', '2023-04-06 13:26:49', NULL);
INSERT INTO `t_meal` VALUES (244, '豆腐烧肉', '咸鲜', '热菜', '', '豆腐、瘦肉、蒜末、葱段、油、酱油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/25/2022122516719422826161.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:49', '2023-04-06 13:26:49', NULL);
INSERT INTO `t_meal` VALUES (245, '鸡蛋牛肉香菜粥', '清淡', '粥', '', '白粥、鸡蛋、牛肉、香菜、油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/26/2022122616720274804921.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:49', '2023-04-06 13:26:49', NULL);
INSERT INTO `t_meal` VALUES (246, '彩椒炒虾仁', '微辣', '热菜', '', '彩椒、薄皮椒、虾仁、木耳、食用油、食盐、生抽、葱姜。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/25/2022122516719465168371.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:48', '2023-04-06 13:26:48', NULL);
INSERT INTO `t_meal` VALUES (247, '家常酸汤水饺', '酸辣', '面食', '北方人爱吃水饺，煮着吃，煎着吃，蒸着吃，各种吃法，我却独钟情于酸汤水饺。一碗酸汤水饺，醋不过分，辣不蛰口，秀如珍珠的饺子或探出头，或亮出肚皮，一荡一荡地浮在亮酱色醋汤里，间隙飘着几凑香菜，几个虾米，汤里腾起的热气，蕴含了所有滋味，轻轻飘荡出来，溜进鼻子，香到骨髓。在饺子端头咬上一个小口，重新放回汤中，灌满汤汁，再送入口中，又别是一番美味。爱吃酸汤水饺，更怀念酸汤水饺里的故事。', '饺子、葱、姜、算、芝麻、干辣椒面、香菜、虾米、盐、十三香、鸡精、白糖、米醋、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/25/2022122516719481112981.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:48', '2023-04-06 13:26:48', NULL);
INSERT INTO `t_meal` VALUES (248, '琥珀桃仁', '甜味', '小吃', '少糖非油炸版', '核桃仁、生芝麻、白砂糖、油、蜂蜜。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/25/2022122516719559444191.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:48', '2023-04-06 13:26:48', NULL);
INSERT INTO `t_meal` VALUES (249, '卤牛肉', '咸鲜', '热菜', '冬天来块儿长力气的。', '牛肉、葱、姜、卤料包、料酒、生抽、老抽、甜面酱、糖、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/25/2022122516719560385691.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:48', '2023-04-06 13:26:48', NULL);
INSERT INTO `t_meal` VALUES (250, '黑芝麻花生豆浆', '原味', '饮品', '', '黄豆、花生、黑芝麻。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/25/2022122516719559844081.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:48', '2023-04-06 13:26:48', NULL);
INSERT INTO `t_meal` VALUES (251, '洋葱芹菜炒牛肉', '咸鲜', '热菜', '', '牛里脊、芹菜、洋葱、淀粉、油、盐、料酒、生抽、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/02/2023020216753437555651.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:48', '2023-04-06 13:26:48', NULL);
INSERT INTO `t_meal` VALUES (252, '香菇荠菜鲜肉饺', '咸鲜', '面食', '', '夹心肉、荠菜、干香菇、豆腐、蒜泥、油、盐、料酒、生抽、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/12/2023011216734912735221.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:48', '2023-04-06 13:26:48', NULL);
INSERT INTO `t_meal` VALUES (253, '荠菜饺子荞麦面', '咸鲜', '面条', '', '荠菜饺子、荞麦面、白菜、油、盐、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/11/2023011116734036567411.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:47', '2023-04-06 13:26:47', NULL);
INSERT INTO `t_meal` VALUES (254, '香葱炒蛋', '咸鲜', '热菜', '', '鸡蛋、香葱、油、盐、料酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/26/2022122616720187756991.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:47', '2023-04-06 13:26:47', NULL);
INSERT INTO `t_meal` VALUES (255, '鲜虾芥菜宽面汤', '咸鲜', '面条', '', '鲜虾、芥菜、宽面条、姜、油、盐、料酒、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/27/2022122716721034847991.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:47', '2023-04-06 13:26:47', NULL);
INSERT INTO `t_meal` VALUES (256, '西兰花双鸡', '清淡', '热菜', '', '西兰花、鸡胸肉、鸡蛋、料酒、生抽、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/25/2022122516719700803491.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:47', '2023-04-06 13:26:47', NULL);
INSERT INTO `t_meal` VALUES (257, '裙带菜鸡蛋汤', '咸鲜', '汤类', '裙带菜是近年来的网红食材，它的营养与功效早已被科普多次。\n今天跟大家分享裙带菜鸡蛋汤，简单几步，热气腾腾的一碗汤就端上桌，冬日里来一碗暖洋洋。', '裙带菜、鸡蛋、枸杞、盐、胡椒粉、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/25/2022122516719701824121.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:47', '2023-04-06 13:26:47', NULL);
INSERT INTO `t_meal` VALUES (258, '红糖葱白姜枣茶', '甜辣', '饮品', '这是我得羊后第二天低烧亲测有效的发热退烧食疗方子，很有效绝无虚言！', '去皮生姜片、葱白、大红枣、红糖、纯净水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/25/2022122516719778942021.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:47', '2023-04-06 13:26:47', NULL);
INSERT INTO `t_meal` VALUES (259, '土豆鸡肉饼', '咸鲜', '热菜', '香喷喷的香酥土豆鸡肉饼一定令人垂涎欲滴，做起来也不难。', '土豆、鸡胸肉、洋葱、姜、黑胡椒碎、生抽、盐、糖、淀粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/25/2022122516719778449781.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:46', '2023-04-06 13:26:46', NULL);
INSERT INTO `t_meal` VALUES (260, '小酥肉', '咸香', '热菜', '', '里脊肉、鸡蛋、淀粉、面粉、葱白、姜、生抽、料酒、白胡椒粉、花椒粉、食用油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/28/2022122816722383053661.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:45', '2023-04-06 13:26:45', NULL);
INSERT INTO `t_meal` VALUES (261, '素炒鲜香菇', '咸鲜', '热菜', '', '新鲜香菇、木耳、青椒、葱、姜、蒜、盐、白砂糖、味精、老抽、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/26/2022122616720188293751.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:45', '2023-04-06 13:26:45', NULL);
INSERT INTO `t_meal` VALUES (262, '酱香腊肉', '酱香', '家常菜', '秋风起食腊味这是南方的风俗，天气正好，自己动手腌制晒腊肉，美味又卫生也吃得安心。跟美友们分享一下我的做法，希望大家喜欢，也可以按各人喜欢的口味调配。', '梅头肉、沙姜、盐、酱油、白糖、浓香高度酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/26/2022122616720607184281.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:45', '2023-04-06 13:26:45', NULL);
INSERT INTO `t_meal` VALUES (263, '茭瓜炒海蛎肉', '咸鲜', '热菜', '海蛎子肉肥爽滑，味道鲜美，营养丰富，含有丰富的蛋白质、脂肪、钙、磷、铁等营养成分，素有“海底牛奶”之美称。\n在我国有“南方之牡蛎，北方之熊掌”之说。含碘量远远高出牛奶和蛋黄。\n含锌量之高，可为食物之冠。\n海蛎子中还含有海洋生物特有的多种活性物质及18种氨基酸、B族维生素、牛磺酸和钙、磷、铁、锌等营养成分。\n牡蛎所含牛磺酸降血脂、降血压。海蛎子所含的牛磺酸、DHA、EPA是智力发育所需的重要营养素。', '牡蛎肉、茭瓜、食用油、红彩椒、葱姜、食盐、海盐黑胡椒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/26/2022122616720276238471.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:45', '2023-04-06 13:26:45', NULL);
INSERT INTO `t_meal` VALUES (264, '红菇桂圆乌鸡汤', '清淡', '汤类', '', '乌鸡、红菇、桂圆、姜、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/30/2022123016723923937131.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:45', '2023-04-06 13:26:45', NULL);
INSERT INTO `t_meal` VALUES (265, '糖醋心里美', '酸甜', '凉菜', '', '心里美萝卜、食盐、陈醋、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/26/2022122616720418575131.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:45', '2023-04-06 13:26:45', NULL);
INSERT INTO `t_meal` VALUES (266, '腊肠蒸南昌鱼干', '咸香', '热菜', '咸香味美', '腊肠、南昌鱼干、姜丝、花生油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/26/2022122616720608044771.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:45', '2023-04-06 13:26:45', NULL);
INSERT INTO `t_meal` VALUES (267, '茶树菇炒鸡胸肉', '原味', '热菜', '营养美味，超级下饭，好吃到爆。', '干茶树菇、鸡胸肉、葱、姜、蒜、花生油、盐、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/27/2022122716721056453871.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:45', '2023-04-06 13:26:45', NULL);
INSERT INTO `t_meal` VALUES (268, '生滚牡蛎粥', '咸鲜', '粥', '', '牡蛎、剩米饭、纯净水、茼蒿、食盐、鸡精、海盐黑胡椒、淀粉、葱姜。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/27/2022122716721034425661.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:45', '2023-04-06 13:26:45', NULL);
INSERT INTO `t_meal` VALUES (269, '葱姜红糖红枣茶', '甜味', '饮品', '周边羊群不断壮大，网上流行各种的代茶饮，不知道这些汤能不能增加免疫力，但冬天里喝碗热汤，起码可以驱驱寒气。', '葱白、老姜、红枣、红糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/29/2022122916722840376261.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:44', '2023-04-06 13:26:44', NULL);
INSERT INTO `t_meal` VALUES (270, '腊肉炒饵块', '香辣', '小吃', '腊肉炒饵块，香辣软糯，老少皆宜。', '饵块、腊肉、糟辣子、豌豆尖、干辣椒段、菜籽油、白砂糖、生抽、胡椒粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/27/2022122716721297146351.jpeg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:44', '2023-04-06 13:26:44', NULL);
INSERT INTO `t_meal` VALUES (271, '偶芋红烧肉（芋圆烧红烧肉）', '咸甜', '热菜', '糯叽叽的芋圆和肉一起红烧炖煮，会擦出不一样的花火', '猪腿肉、芋圆、水、味达美臻品料酒、味达美冰糖红烧汁。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/28/2022122816721918531391.jpeg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:44', '2023-04-06 13:26:44', NULL);
INSERT INTO `t_meal` VALUES (272, '卤鸭舌', '清淡', '凉菜', '', '鸭舌、水、大葱、生姜、八角、草果、花椒、香叶、小米椒、料酒、海盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/27/2022122716721427359191.jpeg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:44', '2023-04-06 13:26:44', NULL);
INSERT INTO `t_meal` VALUES (273, '咸蛋黄毛蟹', '清淡', '热菜', '', '毛蟹、咸蛋黄、姜片。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/27/2022122716721428307611.jpeg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:44', '2023-04-06 13:26:44', NULL);
INSERT INTO `t_meal` VALUES (274, '可乐柠檬红枣茶', '原味', '饮品', '', '可乐、姜片、柠檬、橙子、红枣、枸杞。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/03/2023010316727348303331.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:44', '2023-04-06 13:26:44', NULL);
INSERT INTO `t_meal` VALUES (275, '冰糖金桔雪梨饮', '甜味', '糖水', '', '金桔、雪梨、冰糖、纯净水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/28/2022122816721976604921.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:44', '2023-04-06 13:26:44', NULL);
INSERT INTO `t_meal` VALUES (276, '海参鸡蛋炒茼蒿', '咸鲜', '热菜', '', '茼蒿、海参、鸡蛋、食用油、食盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/28/2022122816722024905721.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:44', '2023-04-06 13:26:44', NULL);
INSERT INTO `t_meal` VALUES (277, '酱大头菜', '清淡', '凉菜', '', '大头菜、盐、生抽、零卡糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/28/2022122816722043697781.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:44', '2023-04-06 13:26:44', NULL);
INSERT INTO `t_meal` VALUES (278, '栗子布丁三明治', '甜味', '小吃', '前阵子吃栗子，觉得吃多了有点闷，就想着怎么可以吃起来口感更顺滑，有些不同，就想着试试做成了双色口味的布丁搭配饼干，变成三明治的口感，味道很不错哟。', '苏打饼干、栗子泥、牛奶、白凉粉、白砂糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/28/2022122816722142843331.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:44', '2023-04-06 13:26:44', NULL);
INSERT INTO `t_meal` VALUES (279, '山药玉米炖龙骨', '咸鲜', '热菜', '', '龙骨、玉米、铁棍山药、纯净水、胡萝卜、香菇、香菜、食盐、葱姜、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/28/2022122816722243081131.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:44', '2023-04-06 13:26:44', NULL);
INSERT INTO `t_meal` VALUES (280, '莲藕胡萝卜煲扇骨汤', '清淡', '汤类', '', '扇骨、莲藕、胡萝卜、山药、姜、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/28/2022122816722249827251.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:43', '2023-04-06 13:26:43', NULL);
INSERT INTO `t_meal` VALUES (281, '彩椒炒猪肝', '咸鲜', '热菜', '', '猪肝、两色彩椒、食用油、葱姜、香菜、食盐、生抽、鸡精、海盐黑胡椒、淀粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/03/2023010316727346043921.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:43', '2023-04-06 13:26:43', NULL);
INSERT INTO `t_meal` VALUES (282, '凉拌茼蒿', '咸鲜', '凉菜', '凉拌茼蒿，做法简单，用来下酒解腻都很不错，清清爽爽。', '茼蒿、盐、生抽、香油、糖、味精、辣椒油、蒜末。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/28/2022122816722274271531.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:43', '2023-04-06 13:26:43', NULL);
INSERT INTO `t_meal` VALUES (283, '灯盏糕', '葱香', '糕点', '', '大米、葱、黄豆、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/28/2022122816722381098351.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:41', '2023-04-06 13:26:41', NULL);
INSERT INTO `t_meal` VALUES (284, '金针菇肥牛卷', '麻辣', '热菜', '', '金针菇、肥牛卷、火锅底料、生姜、蒜末、生抽、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/28/2022122816722381598291.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:41', '2023-04-06 13:26:41', NULL);
INSERT INTO `t_meal` VALUES (285, '小吊梨汤', '甜味', '饮品', '有清热、祛痰、止咳等功效，适合于咽喉肿痛、咳嗽咳痰、便秘等人群喝。小吊梨汤主要以冰糖和雪梨为主要调料制作而成。', '雪梨、冰糖、山楂、桂圆、红枣、甘蔗、枸杞。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/29/2022122916722866626561.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:41', '2023-04-06 13:26:41', NULL);
INSERT INTO `t_meal` VALUES (286, '冰糖红烧鱼块', '咸甜', '热菜', '简单快手的红烧鱼块，无油烹饪一包酱汁就搞定。', '青鱼、青豆、生姜、小葱、料酒、冰糖红烧汁、水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/29/2022122916723036215861.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:41', '2023-04-06 13:26:41', NULL);
INSERT INTO `t_meal` VALUES (287, '红烧鲫鱼', '咸鲜', '热菜', '酱香浓郁，味道鲜美，搭配米饭，实在是好吃！一定要挑选鲜活的鲫鱼哟！', '活鲫鱼、葱姜蒜、八角、花椒、尖辣椒、盐、白糖、料酒、香醋、酱油、老抽、甜面酱。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/09/2023010916732336689601.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:41', '2023-04-06 13:26:41', NULL);
INSERT INTO `t_meal` VALUES (288, '咸蛋黄豆腐', '清淡', '热菜', '', '老豆腐、咸蛋黄、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/29/2022122916723185042221.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:41', '2023-04-06 13:26:41', NULL);
INSERT INTO `t_meal` VALUES (289, '白菜豆腐炖鱼头', '原味', '热菜', '简单美味，健康营养。', '白菜、豆腐、鱼头、姜、葱、纯净水、花生油、盐、白酒、白胡椒粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/30/2022123016723639915851.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:41', '2023-04-06 13:26:41', NULL);
INSERT INTO `t_meal` VALUES (290, '银耳枸杞汤', '甜香', '糖水', '健康营养，甜糯可口，老少皆宜。', '银耳、莲子、枸杞子、雪梨、冰糖、纯净水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/30/2022123016723734177821.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:41', '2023-04-06 13:26:41', NULL);
INSERT INTO `t_meal` VALUES (291, '荸荠雪梨糖水', '甜味', '饮品', '润肺止咳又化痰，增强免疫力。', '雪梨、荸荠、枸杞、黄冰糖、纯净水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/30/2022123016724095415521.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:40', '2023-04-06 13:26:40', NULL);
INSERT INTO `t_meal` VALUES (292, '雪梨干海底椰甘蔗水', '原味', '饮品', '润肺、止咳、化痰，增强免疫力。', '雪梨干、海底椰、甘蔗、纯净水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/04/2023010416728398307881.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:40', '2023-04-06 13:26:40', NULL);
INSERT INTO `t_meal` VALUES (293, '豆角排骨焖面', '原味', '面条', '', '排骨、豆角、面条、生姜、花生油、生抽、蚝油、老抽、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/08/2023030816782443864391.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:40', '2023-04-06 13:26:40', NULL);
INSERT INTO `t_meal` VALUES (294, '青椒木耳炒平菇', '清淡', '热菜', '', '青椒、平菇、木耳、姜蒜、盐、生抽、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/10/2023011016733323497671.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:40', '2023-04-06 13:26:40', NULL);
INSERT INTO `t_meal` VALUES (295, '杂粮红枣窝头', '甜味', '小吃', '', '大米、黑米、小米、糯米粉、红枣、清水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/11/2023011116734037744441.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:40', '2023-04-06 13:26:40', NULL);
INSERT INTO `t_meal` VALUES (296, '腊肠', '咸香', '私房菜', '', '猪后腿肉、棉绳、盐、白胡椒粉、五香粉、花椒粉、白糖、酱油、浓香型高度白酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/31/2022123116724836103691.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:39', '2023-04-06 13:26:39', NULL);
INSERT INTO `t_meal` VALUES (297, '酱香鹅腿', '酱香', '凉菜', '', '鹅腿、姜、蒜头、红葱头、油、酱油、米酒、冰糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/31/2022123116724536753261.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:39', '2023-04-06 13:26:39', NULL);
INSERT INTO `t_meal` VALUES (298, '白菜豆腐炖粉条', '咸鲜', '热菜', '', '五花肉、白菜、豆腐、红薯粉条、葱、盐、料酒、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/02/2023010216726409421171.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:39', '2023-04-06 13:26:39', NULL);
INSERT INTO `t_meal` VALUES (299, '鸡蛋肉片豆皮汤', '咸鲜', '汤类', '低脂、高蛋白、营养丰富又美味！', '鸡胸肉、鸡蛋、白菜、油豆皮、淀粉、油、盐、料酒、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/06/2023010616729708805491.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:39', '2023-04-06 13:26:39', NULL);
INSERT INTO `t_meal` VALUES (300, '餐蛋治', '清淡', '小吃', '', '吐司、鸡蛋、午餐肉、生菜、番茄酱、沙拉酱、油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/31/2022123116724602715021.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:39', '2023-04-06 13:26:39', NULL);
