INSERT INTO `t_meal` VALUES (305, '台式卤排骨', '葱香', '热菜', '这道菜是按照台式卤肉饭的做法，做的排骨，香味醇厚。', '猪排骨、鸡蛋、红洋葱、大料、姜、料酒、蚝油、生抽、老抽、白糖、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/31/2022123116724691598071.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:39', '2023-04-06 13:26:39', NULL);
INSERT INTO `t_meal` VALUES (306, '酱油炒五花肉', '咸鲜', '热菜', '', '五花肉、生抽、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/09/2023030916783366976771.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:39', '2023-04-06 13:26:39', NULL);
