INSERT INTO `t_meal` VALUES (309, '卤排骨鸡蛋', '酱香', '热菜', '简单解馋的一道肉菜。', '猪排骨、鸡蛋、葱、姜、大料、料酒、酱油、盐、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/31/2022123116724692836531.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:38', '2023-04-06 13:26:38', NULL);
INSERT INTO `t_meal` VALUES (310, '熬金桔酱', '果味', '饮品', '喉咙不舒服，咳嗽，有痰的都给我熬这个金桔酱喝，会让你咳嗽有所改善，不能百分百止咳也能让你喉咙舒服许多。', '金桔、单晶冰糖、食用苏打、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2022/12/31/2022123116725022091161.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:38', '2023-04-06 13:26:38', NULL);
INSERT INTO `t_meal` VALUES (311, '打卤面', '咸鲜', '面条', '学做打卤面。', '五花肉、手擀面、黄花菜、木耳、香菇、蒜苔、蒜苗、盐、胡椒粉、鸡精、酱油、干红辣椒、花椒、八角粉、红薯淀粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/04/2023010416728254167091.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:38', '2023-04-06 13:26:38', NULL);
INSERT INTO `t_meal` VALUES (312, '鸡蛋荠菜饺子', '原味', '面食', '家的味道。', '荠菜、面粉、鸡蛋、盐、葱油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/06/2023010616729783275921.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:38', '2023-04-06 13:26:38', NULL);
INSERT INTO `t_meal` VALUES (313, '大肉芹菜饺子', '咸鲜', '面食', '', '大肉馅、面粉、芹菜、盐、葱姜末、白糖、胡椒粉、花椒粉、鸡精、生抽、凉开水、熟油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/04/2023010416728231888591.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:38', '2023-04-06 13:26:38', NULL);
INSERT INTO `t_meal` VALUES (314, '茶树菇炒鸡蛋', '原味', '热菜', '简单美味，健康营养，下饭菜。', '茶树菇、鸡蛋、花生油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/01/2023010116725392368821.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:38', '2023-04-06 13:26:38', NULL);
INSERT INTO `t_meal` VALUES (315, '白菜烩馍', '咸鲜', '小吃', '寻找小时候的味道。', '馒头、白菜、小香葱、盐、鸡精、生抽、老抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/01/2023010116725393084751.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:38', '2023-04-06 13:26:38', NULL);
INSERT INTO `t_meal` VALUES (316, '豉汁蒸马友鱼', '咸鲜', '热菜', '新年快乐！元旦快乐！年年有鱼(余)', '马友鱼段、豆豉、蒜末、葱末、姜丝、油、香油、生粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/01/2023010116725665976481.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:38', '2023-04-06 13:26:38', NULL);
INSERT INTO `t_meal` VALUES (317, '腊鸭腿煲白萝卜汤', '咸香', '汤类', '咸香鲜美', '腊鸭腿、白萝卜、姜、葱花、油、胡椒粉、米酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/01/2023010116725667105771.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:38', '2023-04-06 13:26:38', NULL);
INSERT INTO `t_meal` VALUES (318, '家常麻婆豆腐', '麻辣', '热菜', '麻婆豆腐不仅吃起来香，而且颜色各异。绿色的葱花洒落在盘中，就如同一片片绿叶，沾着辣酱的豆腐成了一朵朵盛开的红花，在绿叶中的映衬下显得格外引人注目。', '豆腐、肉沫、豆瓣酱、葱、姜、蒜、干辣椒、老抽、生抽、蚝油、白糖、花椒面。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/01/2023010116725671285021.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:37', '2023-04-06 13:26:37', NULL);
INSERT INTO `t_meal` VALUES (319, '苹果南瓜汤圆', '甜味', '小吃', '', '南瓜汤圆、苹果、黑方糖、枸杞。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/01/2023010116725710499321.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:37', '2023-04-06 13:26:37', NULL);
INSERT INTO `t_meal` VALUES (320, '羊肚菌萝卜排骨汤', '咸鲜', '汤类', '', '萝卜、排骨、羊肚菌、姜片、葱花、盐、黄酒、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/01/2023010116725711161011.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:37', '2023-04-06 13:26:37', NULL);
INSERT INTO `t_meal` VALUES (321, '黄豆豆浆', '原味', '饮品', '黄豆中的卵磷脂可以清除附着在血管壁上的胆固醇，皂苷能够降低血脂；可溶性膳食纤维可以促进胆固醇排出，降低血液中胆固醇的浓度，并防止其在血管壁上沉积。\n醇厚丝滑好喝的不得了!', '黄豆、纯净水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/02/2023010216726286252201.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:37', '2023-04-06 13:26:37', NULL);
INSERT INTO `t_meal` VALUES (322, '盐卤鸭翅', '咸香', '热菜', '', '鸭翅、清水、大葱、生姜、小米辣、料酒、八角、草果、香叶、花椒、盐、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/02/2023010216726286824521.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:37', '2023-04-06 13:26:37', NULL);
INSERT INTO `t_meal` VALUES (323, '羊排火锅', '咸鲜', '热菜', '最近家人都“阳”了一遍，现在好了，炖点羊肉补补。', '羊排、胡萝卜、大蒜、千张皮、八角、桂皮、姜片、桔皮、盐、啤酒、料酒、冰糖、老抽、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/02/2023010216726287236481.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:37', '2023-04-06 13:26:37', NULL);
INSERT INTO `t_meal` VALUES (324, '榨菜牛肉蒸饭', '原味', '主食', '', '乌江榨菜、牛肉、大米、葱花、花生油、玉米淀粉、生抽、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/03/2023010316727142214791.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:37', '2023-04-06 13:26:37', NULL);
INSERT INTO `t_meal` VALUES (325, '阿胶桂圆红枣茶', '原味', '饮品', '', '红枣、桂圆、阿胶。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762862626141.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:37', '2023-04-06 13:26:37', NULL);
INSERT INTO `t_meal` VALUES (326, '炸油饼', '原味', '面食', '简单美味，外酥内软，老少皆宜。', '普通面粉、酵母、白糖、纯净水、食用油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/02/2023010216726410616851.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:37', '2023-04-06 13:26:37', NULL);
INSERT INTO `t_meal` VALUES (327, '红烧豆腐', '咸香', '热菜', '', '豆腐、蒜苗、食用油、盐、生抽、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/02/2023010216726405398331.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:37', '2023-04-06 13:26:37', NULL);
INSERT INTO `t_meal` VALUES (328, '蒜蓉小青菜', '蒜香', '热菜', '', '小青菜、大蒜、食用油、盐、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/02/2023010216726406622871.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:37', '2023-04-06 13:26:37', NULL);
INSERT INTO `t_meal` VALUES (329, '风干肠', '原味', '私房菜', '', '猪肉、干肠料包、肠衣、曲酒、酱油、香油、盐、白糖、味精、辣椒面。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/11/2023011116734037278761.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:37', '2023-04-06 13:26:37', NULL);
INSERT INTO `t_meal` VALUES (330, '宁波醉蚶', '其他', '凉菜', '', '血蚶、姜粒、生抽、料酒、零卡糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/02/2023010216726409889131.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:36', '2023-04-06 13:26:36', NULL);
INSERT INTO `t_meal` VALUES (331, '菠菜炒平菇', '咸鲜', '热菜', '', '平菇、菠菜、姜、蒜、辣椒、油、盐、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/04/2023010416728277333151.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:36', '2023-04-06 13:26:36', NULL);
INSERT INTO `t_meal` VALUES (332, '萝卜丝肉丸汤', '咸鲜', '汤类', '', '夹心肉、白萝卜、香葱、淀粉、油、盐、料酒、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/04/2023010416727995632921.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:36', '2023-04-06 13:26:36', NULL);
INSERT INTO `t_meal` VALUES (333, '蜂蜜蒸梨', '甜味', '小吃', '蜂蜜中含有多种维生素、矿物质，如维生素B,、维生素C、烟酸、钾、锌等，能够扩张冠状动脉，促进血液循环。另外，蜂蜜能够提高血液中高密度脂蛋白的水平，降低胆固醇，有利于防止高脂血症。\n健康又暖胃，甘甜可口的味道，还能生津养胃，润肺止咳。', '梨、蜂蜜。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/02/2023010216726647612981.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:36', '2023-04-06 13:26:36', NULL);
INSERT INTO `t_meal` VALUES (334, '山药炖鸭肉', '原味', '热菜', '鸭肉中的不饱和脂肪酸能够降低血液中的胆固醇含量，鸭肉中的烟酸可以减少胆固醇的吸收，保护心血管。\n山药炖鸭肉， 汤鲜味美，经常喝对身体非常有益， 它具有理气利湿，健脾散结，还可以滋阴润肺、止咳化痰，而且能够预防上火的功效。', '鸭腿、山药、葱、姜、黄酒、八角、花椒、陈皮、纯净水、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/04/2023010416727995193991.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:35', '2023-04-06 13:26:35', NULL);
INSERT INTO `t_meal` VALUES (335, '炸虾', '清淡', '热菜', '', '虾、小酥肉专用粉、鸡蛋、姜片、料酒、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/03/2023010316727141212071.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:35', '2023-04-06 13:26:35', NULL);
INSERT INTO `t_meal` VALUES (336, '酱香鸡', '酱香', '凉菜', '', '鸡肉、姜、蒜头、红葱头、油、酱油、冰糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/03/2023010316727343855491.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:35', '2023-04-06 13:26:35', NULL);
INSERT INTO `t_meal` VALUES (337, '玛卡虫草花鸡汤', '清淡', '汤类', '', '鸡肉、玛卡、虫草花、姜、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/03/2023010316727344243211.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:35', '2023-04-06 13:26:35', NULL);
INSERT INTO `t_meal` VALUES (338, '花胶香菇焖鸡', '咸鲜', '热菜', '', '清远鸡、花胶、香菇、姜、红葱头、姜丝、油、蚝油、腌料:、酱油、胡椒粉、木糖醇、盐、生粉水、花生油、米酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/03/2023010316727345123451.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:35', '2023-04-06 13:26:35', NULL);
INSERT INTO `t_meal` VALUES (339, '香辣肉酱', '微辣', '家常菜', '', '猪肉末、洋葱、蒜头、红葱头、油、豆瓣酱、胡椒粉、五香粉、花椒粉、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/03/2023010316727346515691.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:35', '2023-04-06 13:26:35', NULL);
INSERT INTO `t_meal` VALUES (340, '胡萝卜炒猪肝', '咸鲜', '热菜', '', '猪肝、胡萝卜、猪油、花生油、葱姜、食盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/03/2023010316727347947841.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:35', '2023-04-06 13:26:35', NULL);
INSERT INTO `t_meal` VALUES (341, '绿豆芽炒猪肝', '咸鲜', '热菜', '买了一斤猪肝，做了5个菜。', '猪肝、豆芽、食用油、食盐、葱姜、陈醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/07/2023010716730598396991.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:35', '2023-04-06 13:26:35', NULL);
INSERT INTO `t_meal` VALUES (342, '胡萝卜烧肥肠', '中辣', '热菜', '', '胡萝卜、卤肥肠、芹菜、花生油、海底捞火锅底料、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/13/2023031316786898605951.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:35', '2023-04-06 13:26:35', NULL);
INSERT INTO `t_meal` VALUES (343, '西芹炒牛肉粒', '咸香', '热菜', '', '雪菲力牛排、西芹、胡萝卜、姜丝、食用油、盐、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/03/2023010316727348926391.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:35', '2023-04-06 13:26:35', NULL);
INSERT INTO `t_meal` VALUES (344, '红烧肘子', '酱香', '热菜', '', '肘子、葱姜蒜、八角、香叶、桂皮、草果、盐、冰糖、生抽、郫县豆瓣酱、料酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/10/2023011016733319456461.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:35', '2023-04-06 13:26:35', NULL);
INSERT INTO `t_meal` VALUES (345, '五彩炒米饭', '原味', '主食', '', '米饭、香肠、胡萝卜、洋葱、黄瓜、鸡蛋、盐、玉米油、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/12/2023011216734912265721.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:35', '2023-04-06 13:26:35', NULL);
INSERT INTO `t_meal` VALUES (346, '鸡蛋炒饼丝', '清淡', '小吃', '', '大饼、圆白菜、胡萝卜、洋葱、盐、生抽、蚝油、蒜末、玉米油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/10/2023011016733345068891.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:35', '2023-04-06 13:26:35', NULL);
INSERT INTO `t_meal` VALUES (347, '荸荠百合雪梨汤', '果味', '糖水', '荸荠能清热生津，凉血解毒，化痰消积；梨能清热生津，润燥化痰；百合润肺止咳。三者合用则起滋阴润燥，化痰止咳的作用。治疗痰热咳嗽、痰黄稠、咽喉不利。', '荸荠、雪梨、新鲜百合、枸杞、黄冰糖、清水、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/04/2023010416728126159851.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:34', '2023-04-06 13:26:34', NULL);
INSERT INTO `t_meal` VALUES (348, '三红乌鸡汤', '清淡', '汤类', '', '乌鸡、红参、红枣、枸杞子、桂圆肉、姜、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/04/2023010416728056293931.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:34', '2023-04-06 13:26:34', NULL);
INSERT INTO `t_meal` VALUES (349, '砂锅煲鸡', '咸鲜', '热菜', '', '三黄鸡、洋葱、沙姜、蒜头、红葱头、香菜、葱段、油、腌料:、生抽、蚝油、胡椒粉、木糖醇、生粉水、盐、米酒、花生油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/04/2023010416728056711251.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:34', '2023-04-06 13:26:34', NULL);
INSERT INTO `t_meal` VALUES (350, '蔓菁眉豆小米粥', '原味', '粥', '健康营养粥。', '蔓菁、眉豆、小米、纯净水、玉米粒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/04/2023010416728350137271.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:34', '2023-04-06 13:26:34', NULL);
INSERT INTO `t_meal` VALUES (351, '番薯红枣莲子糖水', '甜味', '糖水', '', '番薯、红枣、莲子、姜、纯净水、冰糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/04/2023010416728125241961.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:34', '2023-04-06 13:26:34', NULL);
INSERT INTO `t_meal` VALUES (352, '豆豉鲮鱼炒油麦菜', '咸香', '热菜', '', '油麦菜、豆豉鲮鱼罐头、蒜末、油、糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/04/2023010416728219168531.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:34', '2023-04-06 13:26:34', NULL);
INSERT INTO `t_meal` VALUES (353, '腊肠蒸银鱼仔', '咸香', '热菜', '', '腊肠、银鱼干、姜丝、花生油、胡椒粉、米酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/04/2023010416728218057911.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:34', '2023-04-06 13:26:34', NULL);
INSERT INTO `t_meal` VALUES (354, '炸圆子', '蒜香', '热菜', '', '嫩豆腐、猪肉、莲藕、蒜叶、蚝油、盐、五香粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/04/2023010416728219632421.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:33', '2023-04-06 13:26:33', NULL);
INSERT INTO `t_meal` VALUES (355, '清蒸芹菜叶', '清淡', '热菜', '', '芹菜叶、面粉、香油、大蒜。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/04/2023010416728294905471.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:33', '2023-04-06 13:26:33', NULL);
INSERT INTO `t_meal` VALUES (356, '油面筋炒蒜苗', '咸鲜', '热菜', '家常小炒。', '油面筋、蒜苗、盐、鸡精、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/04/2023010416728398707021.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:33', '2023-04-06 13:26:33', NULL);
INSERT INTO `t_meal` VALUES (357, '蒜香蒸银鲳鱼', '葱香', '热菜', '', '银鲳鱼、姜末、蒜末、花生油、胡椒粉、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/05/2023010516728909314671.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:33', '2023-04-06 13:26:33', NULL);
INSERT INTO `t_meal` VALUES (358, '肉末炒黄豆芽', '清淡', '热菜', '', '黄豆芽、肉末、蒜末、葱花、油、酱油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/05/2023010516728913642631.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:33', '2023-04-06 13:26:33', NULL);
INSERT INTO `t_meal` VALUES (359, '咸鸡粥', '咸香', '粥', '', '咸鸡、白粥、姜丝、葱花、香油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/05/2023010516728914102661.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:32', '2023-04-06 13:26:32', NULL);
INSERT INTO `t_meal` VALUES (360, '肉末榨菜蒸陈村粉', '咸鲜', '小吃', '', '肉末、陈村粉、榨菜、蒜末、葱花、油、酱油、糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/05/2023010516728914681201.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:32', '2023-04-06 13:26:32', NULL);
INSERT INTO `t_meal` VALUES (361, '家庭版麻婆豆腐', '麻辣', '热菜', '麻辣鲜香。', '嫩豆腐、蒜苗、豆瓣酱、辣椒面、葱花、胡椒粉、花椒粉、老抽、红薯淀粉、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/05/2023010516728915076911.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:32', '2023-04-06 13:26:32', NULL);
INSERT INTO `t_meal` VALUES (362, '咸蛋黄茶树菇', '清淡', '热菜', '', '茶树菇、咸蛋黄、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/05/2023010516728947614051.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:32', '2023-04-06 13:26:32', NULL);
INSERT INTO `t_meal` VALUES (363, '红糖红枣山药', '甜香', '小吃', '春节来道红糖红枣山药幸福甜蜜。', '红枣、红糖、山药、白芝麻、盐、面粉、开水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/05/2023010516729037115721.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:32', '2023-04-06 13:26:32', NULL);
INSERT INTO `t_meal` VALUES (364, '洋葱炒猪心', '清淡', '热菜', '', '猪心、洋葱、干淀粉、玉米油、料酒、盐、酱油、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/05/2023010516728948981881.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:32', '2023-04-06 13:26:32', NULL);
INSERT INTO `t_meal` VALUES (365, '凉拌鱼皮青瓜腐竹', '酸辣', '凉菜', '', '鱼皮、青瓜、腐竹、蒜末、香菜、香油、香醋、酱油、辣椒油、糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/05/2023010516728948586771.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:32', '2023-04-06 13:26:32', NULL);
INSERT INTO `t_meal` VALUES (366, '红烧肉炖雪菜', '咸鲜', '热菜', '家常炖菜。', '五花肉、雪菜、豆腐、盐、葱姜、干辣椒、料酒、老抽、白糖、味精、八角、花椒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/05/2023010516729008046101.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:32', '2023-04-06 13:26:32', NULL);
INSERT INTO `t_meal` VALUES (367, '川贝柠檬雪梨金桔汤', '果味', '饮品', '我这两天又挨咳嗽了，所以立马给自己安排了食疗，煮了这个川贝柠檬雪梨金桔汤喝。', '雪梨、黄柠檬、金桔、川贝、枸杞、冰糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/05/2023010516729234853261.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:31', '2023-04-06 13:26:31', NULL);
INSERT INTO `t_meal` VALUES (368, '姜爆乌骨鸡', '咸香', '热菜', '就快过年了，UU们家里餐桌上都会有些什么菜呀。今天给大家介绍一道姜爆乌骨鸡，干香咸酥，很好吃哟。乌骨鸡一般都是用来煲汤，没想到炒了吃也很好吃的。没有乌骨鸡，用普通鸡也行，但是要嫩一点的鸡，土鸡之类需要长时间炖煮的不太适合。', '乌骨鸡、姜、青蒜、红泡椒、盐、酒酿、酱油、油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/05/2023010516729292789361.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:31', '2023-04-06 13:26:31', NULL);
INSERT INTO `t_meal` VALUES (369, '米面调糊', '咸鲜', '面食', '米面调糊是西北最普通的农家风味，深受广大群众的喜爱。正宗做法大多是下入大米熬煮，现在多以剩米饭代替，再下入手擀面，有米有面，口感醇香浓郁，既解决了剩饭又享用了美食。', '手擀面、剩米饭、黄豆芽、木耳、海带丝、蒜苔、蒜苗、盐、葱花、辣椒面、生抽、五香粉、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/06/2023010616729907546681.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:31', '2023-04-06 13:26:31', NULL);
INSERT INTO `t_meal` VALUES (370, '麻辣烫', '麻辣', '热菜', '简单快捷，麻辣爽口。', '土豆粉条、海鲜菇、藕片、黄豆芽、火腿肠、海带丝、木耳、盐、豆瓣酱、辣椒面、生抽、蚝油、胡椒粉、花椒粉、花椒油、鸡精、蒜苗、陈醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/06/2023010616729907919661.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:31', '2023-04-06 13:26:31', NULL);
INSERT INTO `t_meal` VALUES (371, '酸辣红薯粉', '酸辣', '小吃', '酸辣鲜香，滑爽味美，做法简单。', '红薯粉条、黄豆芽、陈醋、盐、豆瓣酱、辣椒粉、胡椒粉、花椒粉、生抽、蚝油、鸡精、蒜苗。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/06/2023010616729719662411.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:31', '2023-04-06 13:26:31', NULL);
INSERT INTO `t_meal` VALUES (372, '番茄豆腐肥牛汤', '原味', '汤类', '', '肥牛卷、番茄、豆腐、葱花、花生油、生抽、蚝油、盐、胡椒粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/18/2023031816791198192921.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:31', '2023-04-06 13:26:31', NULL);
INSERT INTO `t_meal` VALUES (373, '超萌龙猫油画吐司', '原味', '小吃', '龙猫油画吐司，来年每天都有好事“花生”。', '吐司、花生酱、沙拉酱、粉色巧克力笔、棕色巧克力笔。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/06/2023010616729883499271.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:30', '2023-04-06 13:26:30', NULL);
INSERT INTO `t_meal` VALUES (374, '元宝馒头', '甜香', '面食', '春节元宝馒头，象征新的一年财源滚滚，幸福团圆。', '面粉、南瓜、发酵粉、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/06/2023010616729884497671.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:30', '2023-04-06 13:26:30', NULL);
INSERT INTO `t_meal` VALUES (375, '口蘑炒牛肉', '原味', '热菜', '', '牛肉、口蘑、香葱、花生油、玉米淀粉、生抽、蚝油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/19/2023031916791990286381.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:30', '2023-04-06 13:26:30', NULL);
INSERT INTO `t_meal` VALUES (376, '栗子泥花环咖啡', '甜味', '饮品', '冬天栗子是每周习惯的点心，除了独特的滋味和醇厚的口感，多变百搭的组合也适合各种饮品，关键颜值还高，大家不妨试试哟。', '栗子泥、糖渍栗子、牛奶、咖啡液。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/06/2023010616729883993861.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:30', '2023-04-06 13:26:30', NULL);
INSERT INTO `t_meal` VALUES (377, '香芹木耳炒鸡蛋', '清淡', '热菜', '', '香芹、木耳、鸡蛋、葱花、盐、玉米油、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/09/2023010916732300135261.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:30', '2023-04-06 13:26:30', NULL);
INSERT INTO `t_meal` VALUES (378, '牛肉面', '酱香', '面条', '午餐来一碗牛肉面，有肉有面太过瘾。', '牛肉、面、大葱、生姜、干辣椒、冰糖、八角、香叶、桂皮、花椒粒、生抽、老抽、蚝油、盐、鸡精、花生油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/07/2023010716730719334021.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:30', '2023-04-06 13:26:30', NULL);
INSERT INTO `t_meal` VALUES (379, '节日饺子', '咸鲜', '面食', '有一句民谚叫“大寒小寒，吃饺子过年。”你喜欢吃饺子吗？我家人都爱吃，小寒我们家吃了白萝卜鸡蛋木耳馅饺子，拌馅的时候我加了一袋葱油拌面汁，和我们在家自己做的不同，除了用到香葱，还加了红葱头，葱油味儿很浓，炸制中添加干贝，口味上更鲜，酿造酱油让低味酱汁吃着是浓香的口感，没有科技与狠活儿，解放自己，吃到放心健康的同时，也满足了味蕾。除了能吃到一碗咸鲜可口，滋香味浓的葱油拌面，用这个调料拌馅也相当不错，看看我是怎么做的。', '青萝卜、鸡蛋、黑木耳、蒜苗、姜、虾皮、饺子皮、味达美葱油拌面汁、味达美臻品料酒、盐、糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/06/2023010616729944753471.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:30', '2023-04-06 13:26:30', NULL);
INSERT INTO `t_meal` VALUES (380, '酸菜白肉无粉条', '酸咸', '热菜', '', '袋装酸菜、五花肉、葱白、姜、小米辣、香菜、香葱、八角、盐、糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/06/2023010616730052431841.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:30', '2023-04-06 13:26:30', NULL);
INSERT INTO `t_meal` VALUES (381, '梅渍圣女果', '酸甜', '小吃', '这个梅渍圣女果一直是我心心念念想吃的菜品，今天终于备齐食材有空做了！开心❤❤❤', '圣女果、黄柠檬、甘草话梅、雪碧、清水、蜂蜜。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/07/2023010716730597121761.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:29', '2023-04-06 13:26:29', NULL);
INSERT INTO `t_meal` VALUES (382, '家庭版冬阴功汤', '酸咸', '汤类', '今天来个简单版的冬阴功汤！', '大虾、白贝、白蘑菇、冬阴功调料。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/10/2023011016733316502201.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:29', '2023-04-06 13:26:29', NULL);
INSERT INTO `t_meal` VALUES (383, '杂粮黑豆捞面', '五香', '面条', '健康营养，简单美味。', '杂粮黑豆面粉、白面粉、玉米面粉、驴肉丸子、油炸豆腐、白菜、红萝卜、蒜、花生油、盐、老抽、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/07/2023010716730597952501.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:28', '2023-04-06 13:26:28', NULL);
INSERT INTO `t_meal` VALUES (384, '老坛酸菜炒猪大肠', '酸咸', '热菜', '', '老坛酸菜、猪大肠、辣椒切丝、葱、姜片、蒜头、小米辣、香菜、盐、白糖、蚝油、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/07/2023010716730597533671.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:28', '2023-04-06 13:26:28', NULL);
INSERT INTO `t_meal` VALUES (385, '鳄鱼肉煲海底椰', '咸甜', '热菜', '鳄鱼肉煲海底椰汤是一款味道清甜汤色清透养生汤滋阴补肾润肺养颜益气生津止咳化痰。', '鳄鱼肉、瘦肉、海底椰、南杏、北杏、无花果、玉竹、虎乳菌、陈皮、姜片、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/07/2023010716730809495351.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:28', '2023-04-06 13:26:28', NULL);
INSERT INTO `t_meal` VALUES (386, '豆沙甜饭', '甜香', '主食', '无猪油版的豆沙甜饭~', '糯米、豆沙、糖、红枣、核桃.', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/18/2023011816740099287991.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:28', '2023-04-06 13:26:28', NULL);
INSERT INTO `t_meal` VALUES (387, '白菜豆腐汤', '原味', '汤类', '', '白菜、豆腐、鸡蛋、花生油、盐、胡椒粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/08/2023010816731561436571.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:28', '2023-04-06 13:26:28', NULL);
INSERT INTO `t_meal` VALUES (388, '山药炖鸡汤', '原味', '汤类', '阳康后，感觉身体康复慢，没食欲首选这道健脾清肺养胃的山药煲鸡汤，能快速给身体补充营养和能量。', '老母鸡、山药、红枣、石斛、生姜、葱姜料酒、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/07/2023010716731046395231.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:28', '2023-04-06 13:26:28', NULL);
INSERT INTO `t_meal` VALUES (389, '糖醋鸭', '酸甜', '热菜', '说到糖醋，大家第一反应是不是糖醋排骨，糖醋里脊等。说到鸭的吃法，是不是更多的想到烤鸭啤酒鸭盐水鸭等等。今天我做了个糖醋鸭，味道不错，除了最后不小心烧干了点，咸酸开胃，好吃不腻。用的味达美的菠萝糖醋汁调味料，对于厨房小白以及我这样的懒人来说，超方便省事，不用炒糖色那么麻烦，味道也足。过年餐桌上可以考虑增加一些新菜式哟。', '鸭、姜、大蒜、青蒜、小米椒、菠萝糖醋汁调味料、盐、油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/07/2023010716730986602051.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:28', '2023-04-06 13:26:28', NULL);
INSERT INTO `t_meal` VALUES (390, '杏仁酪', '甜香', '饮品', '这个杏仁酪真的很好喝！丝滑细腻又绵密，养肺补水又滋润，拿来当下午甜品，养生又健康。', '杏仁、雪梨、百合、鲜银耳、黄冰糖、清水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/08/2023010816731605569051.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:28', '2023-04-06 13:26:28', NULL);
INSERT INTO `t_meal` VALUES (391, '时蔬蒸卤面', '咸鲜', '面条', '简单易做零失败，成品口感丰富，鲜美可口，入味十足，超级好吃！', '生面条、五花肉、西红柿、黄豆芽、包菜、芹菜、葱、姜、辣椒、八角、红烧酱油、料酒、蚝油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/08/2023010816731606038801.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:28', '2023-04-06 13:26:28', NULL);
INSERT INTO `t_meal` VALUES (392, '木耳红枣粥', '原味', '粥', '木耳富含胶质能把残留在人体肠道内的毒素吸附集中起来排出体外，搭配上能补血、养颜的红枣，排毒美容的功效更佳。', '大米、红枣、木耳、纯净水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/08/2023010816731853053781.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:27', '2023-04-06 13:26:27', NULL);
INSERT INTO `t_meal` VALUES (393, '胡萝卜炒猪肝', '咸鲜', '热菜', '', '猪肝、胡萝卜、淀粉、蒜苗、胡椒粉、油、盐、料酒、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/08/2023010816731853962761.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:27', '2023-04-06 13:26:27', NULL);
INSERT INTO `t_meal` VALUES (394, '排骨芋头汤', '咸鲜', '汤类', '', '仔排、芋头、姜、葱、盐、料酒、生抽、陈醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/09/2023010916732757645941.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:27', '2023-04-06 13:26:27', NULL);
INSERT INTO `t_meal` VALUES (395, '菠菜烘蛋', '咸鲜', '热菜', '', '菠菜、鸡蛋、油、盐、料酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/09/2023010916732592318731.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:27', '2023-04-06 13:26:27', NULL);
INSERT INTO `t_meal` VALUES (396, '白萝卜清炖羊肉', '原味', '热菜', '羊肉益气补虚，温中暖下，是寒冬暖身的好食物。\n原汁原味，锅里有汤有肉有萝卜，汤鲜肉香，还没有膻味，清爽鲜香。', '羊后腿、白萝卜、纯净水、葱、姜、蒜苗、枸杞、盐、白酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/09/2023010916732282953941.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:27', '2023-04-06 13:26:27', NULL);
INSERT INTO `t_meal` VALUES (397, '芋头肉末油豆腐煲', '咸香', '热菜', '', '芋头、肉末、油豆腐、蒜末、香菜、葱段、油、黄豆酱。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/09/2023010916732338066861.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:27', '2023-04-06 13:26:27', NULL);
INSERT INTO `t_meal` VALUES (398, '豆腐胡萝卜白菜煲', '咸鲜', '热菜', '', '嫩豆腐、胡萝卜、白菜、蒜末、香菜、葱段、油、酱汁。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/09/2023010916732338489361.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:27', '2023-04-06 13:26:27', NULL);
INSERT INTO `t_meal` VALUES (399, '竹芋胡萝卜猪骨汤', '清淡', '汤类', '很清甜滋润的汤品。', '猪骨、竹芋、胡萝卜、姜、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/09/2023010916732338942791.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:27', '2023-04-06 13:26:27', NULL);
INSERT INTO `t_meal` VALUES (400, '五指毛桃牛大力炖鸡汤', '清淡', '汤类', '元气满满的汤品。', '鸡腿肉、五指毛桃、牛大力、茨实、姜、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/09/2023010916732339496041.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:26', '2023-04-06 13:26:26', NULL);
INSERT INTO `t_meal` VALUES (401, '黑灵芝花旗参炖鸡汤', '清淡', '汤类', '', '鸡肉、黑灵芝、花旗参、石斛、无花果、姜、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/09/2023010916732596041901.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:26', '2023-04-06 13:26:26', NULL);
INSERT INTO `t_meal` VALUES (402, '凉拌菠菜', '清淡', '凉菜', '清爽的凉拌菜，在家宴上是比较受欢迎的，解油腻，清肠胃。', '菠菜、花生仁、洋葱、红尖椒、香油、盐、酱油、米醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/09/2023010916732596653391.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:26', '2023-04-06 13:26:26', NULL);
INSERT INTO `t_meal` VALUES (403, '茼蒿鸡蛋汤', '原味', '汤类', '', '茼蒿、鸡蛋、花生油、盐、胡椒粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/04/2023020416754892893221.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:26', '2023-04-06 13:26:26', NULL);
INSERT INTO `t_meal` VALUES (404, '红烧杏鲍菇', '咸甜', '热菜', '杏鲍菇这样烧，比肉都好吃\n就要过年了，大家的年夜饭都会有些什么呢，别都是肉呀，也要一些蔬菜菌类等，营养均衡才好。杏鲍菇这样烧，不比肉差，咸中带甜又弹牙，用的味达美的冰糖红烧汁调味料，不用自己炒糖色那么麻烦，做起来简单省事，简直就是厨房小白和我这种懒人的做饭神器。加一个青红泡椒，颜色好看适合过年过节，一点也不辣。', '杏鲍菇、青泡椒、红泡椒、大蒜、姜、冰糖红烧汁调味料、盐、油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/10/2023011016733179352731.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:26', '2023-04-06 13:26:26', NULL);
INSERT INTO `t_meal` VALUES (405, '眉豆小米粥', '原味', '粥', '健康营养粥。', '小米、眉豆、纯净水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/10/2023011016733179723271.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:26', '2023-04-06 13:26:26', NULL);
INSERT INTO `t_meal` VALUES (406, '黄金白菜炒笔管鱼', '咸鲜', '热菜', '', '笔管鱼、白菜叶、食用油、葱姜、食盐、陈醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/10/2023011016733180652881.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:26', '2023-04-06 13:26:26', NULL);
INSERT INTO `t_meal` VALUES (407, '大白菜番茄荞麦面', '清淡', '面条', '', '荞麦面、番茄、大白菜、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/10/2023011016733317702611.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:26', '2023-04-06 13:26:26', NULL);
INSERT INTO `t_meal` VALUES (408, '萝卜干鸡刨豆腐', '清淡', '热菜', '', '萝卜干、老豆腐、鸡蛋、生抽、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/10/2023011016733318081691.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:26', '2023-04-06 13:26:26', NULL);
INSERT INTO `t_meal` VALUES (409, '毛蟹炒圆蛤', '清淡', '热菜', '', '毛蟹、圆蛤、姜片、料酒、盐、酱油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/10/2023011016733318907871.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:26', '2023-04-06 13:26:26', NULL);
INSERT INTO `t_meal` VALUES (410, '百合金桔雪梨汤', '甜味', '糖水', '梨有清热滋阴润肺的功效，金桔有理气化痰的作用，百合性微寒，归心、肺经，具有润肺止咳、清心安神的作用，这三个食材相辅相成，一起熬水代茶饮，能够起到清热去燥，养阴润肺，止咳化痰的功效。', '金桔、雪梨、百合、枸杞、冰糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/11/2023011116734036153091.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:25', '2023-04-06 13:26:25', NULL);
INSERT INTO `t_meal` VALUES (411, '肉丝鸭蛋苤蓝炒年糕', '咸鲜', '小吃', '', '夹心肉、鸭蛋、苤蓝、豆干、胡萝卜、芥菜梗、淀粉、油、盐、料酒、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/13/2023011316735912505151.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:25', '2023-04-06 13:26:25', NULL);
INSERT INTO `t_meal` VALUES (412, '虾仁彩蔬炒饭', '咸鲜', '主食', '虾仁特别有嚼头，蔬菜维生素含量高。', '虾仁、鸡蛋、冷饭、胡萝卜、儿菜、盐、菜籽油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/14/2023031416787663874851.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:25', '2023-04-06 13:26:25', NULL);
INSERT INTO `t_meal` VALUES (413, '鹌鹑蛋烧油豆腐', '清淡', '热菜', '', '油豆腐、鹌鹑蛋、桂皮、八角、酱油、盐、零卡糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/10/2023011016733468509871.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:24', '2023-04-06 13:26:24', NULL);
INSERT INTO `t_meal` VALUES (414, '黄金维纳斯奶昔', '酸甜', '饮品', '维纳斯只是一种苹果的名称。\n跟富士苹果比，也是脆甜的，但没有富士苹果水分多，甜度更甜。', '黄金维纳斯、酸奶。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/11/2023011116734148489501.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:24', '2023-04-06 13:26:24', NULL);
INSERT INTO `t_meal` VALUES (415, '溜汁臭豆腐', '其他', '热菜', '臭豆腐是中国传统特色小吃之一，具有“闻起来臭、吃起来香”的特点。\n在各地的制作方式、食用方法均有相当大的差异，有北方和南方的不同类型。\n臭豆腐其名虽俗气，却外陋内秀、平中见奇、源远流长，是一种极具特色的中华传统小吃，古老而传统，令人欲罢不能。', '臭豆腐、水淀粉、小葱、蒜末、食用油、葱姜蒜、盐、蚝油、生抽、辣椒油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/11/2023011116734149274051.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:24', '2023-04-06 13:26:24', NULL);
INSERT INTO `t_meal` VALUES (416, '凉拌葱油萝卜丝', '咸鲜', '凉菜', '这是一道非常简单的凉拌菜，咸鲜爽口，除夕夜的餐桌上大鱼大肉吃多了，来上一份这样的凉拌菜，可以解油腻，现在用葱油拌面汁更简单，不用自己调料汁，直接倒入腌制好的萝卜丝，拌一拌就可以了。', '白萝卜、食盐、葱油拌面汁。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/11/2023011116734407517381.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:24', '2023-04-06 13:26:24', NULL);
INSERT INTO `t_meal` VALUES (417, '小竹笋炒五花肉', '原味', '热菜', '', '小竹笋、五花肉、花生油、蚝油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/27/2023032716798954423801.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:24', '2023-04-06 13:26:24', NULL);
INSERT INTO `t_meal` VALUES (418, '虾皮萝卜汤', '咸鲜', '汤类', '', '白萝卜、淡虾皮、植物油、蒜、小葱、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/11/2023011116734298466161.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:24', '2023-04-06 13:26:24', NULL);
INSERT INTO `t_meal` VALUES (419, '香菇青笋炒鸡丁', '咸鲜', '热菜', '', '青笋、香菇、鸡晒、淀粉、蒜、姜、葱、干辣椒、生抽、蚝油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/11/2023011116734408038401.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:24', '2023-04-06 13:26:24', NULL);
INSERT INTO `t_meal` VALUES (420, '欧包', '咸香', '烘焙', '', '高筋面粉、水、酵母、蔓越莓干、坚果仁、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/11/2023011116734408531061.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:24', '2023-04-06 13:26:24', NULL);
INSERT INTO `t_meal` VALUES (421, '葱枣汤', '原味', '饮品', '葱枣搭配，有去风散热、健脾养心之功，对感冒【特别是春季】有辅助疗效。\n红枣中的维生素C可以使胆固醇转变为胆汁，搭配有降脂作用的葱煮汤喝，适合高脂血症患者常食。', '红枣、葱白、纯净水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/12/2023011216734910923501.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:24', '2023-04-06 13:26:24', NULL);
INSERT INTO `t_meal` VALUES (422, '花生菠菜', '原味', '热菜', '菠菜能够清理肠胃热毒，养血止血，润燥，防治便秘，降低脂肪，花生中的胆碱、卵磷脂等物质成分，可以提高高密度脂蛋白水平，从而降低血脂，两者搭配适量食用降脂作用更好。', '菠菜、熟花生仁、蒜、盐、香油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/12/2023011216734911391601.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:24', '2023-04-06 13:26:24', NULL);
INSERT INTO `t_meal` VALUES (423, '事事如意卷', '麻辣', '凉菜', '新年的餐桌上都会有一些凉拌菜，有时候我们会在挑菜的时候把菜的外皮扔掉，觉得比较老，其实这些也可以用来做一道爽脆的凉拌菜，每年妈妈都会做一盘这样的凉拌卷心菜卷，寓意事事如意，以前会自己调汁进行腌制，今年用了这款海鲜冷泡汁，也别有一番风味，关键一包酱汁就搞定，非常方便。', '卷心菜、海鲜冷泡汁、纯净水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/12/2023011216735186592651.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:24', '2023-04-06 13:26:24', NULL);
INSERT INTO `t_meal` VALUES (424, '泡菜煎饼', '酸咸', '面食', '', '韩式泡菜、煎饼粉、鸡蛋、葱花、芝麻油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/05/2023020516755791817971.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:24', '2023-04-06 13:26:24', NULL);
INSERT INTO `t_meal` VALUES (425, '自制盐卤豆腐', '原味', '凉菜', '第一次试做豆腐，头天晚上睡前浸泡黄豆，早上起来开始磨豆浆，打卤水，放到豆腐盒中压制就上班去了，下班回来时就做好了。自己做的豆腐口感细腻，豆香醇正，唯一不足的是，压制时间太长，豆腐有点老了，下次再改进。', '黄豆、盐卤。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/12/2023011216735085181161.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:23', '2023-04-06 13:26:23', NULL);
INSERT INTO `t_meal` VALUES (426, '咖喱虾', '咸鲜', '热菜', '这道菜是小朋友们爱吃的美味。', '大虾、土豆、洋葱、咖喱酱。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/12/2023011216735269729651.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:23', '2023-04-06 13:26:23', NULL);
INSERT INTO `t_meal` VALUES (427, '酸萝卜肉丝面', '酸辣', '面条', '', '酸萝卜、猪肉、挂面、酸姜、泡椒、小葱、蒜、青菜、植物油、油辣子、酱油、陈醋、生抽、花椒粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/12/2023011216735145486131.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:23', '2023-04-06 13:26:23', NULL);
INSERT INTO `t_meal` VALUES (428, '土豆烧牛肉', '咸鲜', '热菜', '土豆软糯，牛肉鲜香。', '牛肉、土豆、干辣椒、姜块、红枣、蒜、十三香、盐、牛油、豆瓣酱。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/08/2023030816782650243271.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:23', '2023-04-06 13:26:23', NULL);
INSERT INTO `t_meal` VALUES (429, '油面筋塞鸡胸肉', '清淡', '热菜', '', '鸡胸肉、油面筋、鸡蛋、香葱、料酒、生抽、盐、酱油、零卡糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/12/2023011216735269182691.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:23', '2023-04-06 13:26:23', NULL);
INSERT INTO `t_meal` VALUES (430, '什锦麻辣烫', '酸辣', '热菜', '变化的只是食材，汤料的配伍大同小异，可根据季节、食材的变化而不断变化。', '藕片、豆腐、黄豆芽、木耳、红薯粉条、午餐肉、蒜苗、火锅底料、盐、生抽、胡椒粉、花椒粒、蚝油、花椒油、鸡精、陈醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/12/2023011216735324809271.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:23', '2023-04-06 13:26:23', NULL);
INSERT INTO `t_meal` VALUES (431, '肥肠血旺', '微辣', '热菜', '', '卤肥肠、鸭血、葱花、花生油、海底捞牛油火锅底料、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/28/2023032816799719459091.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:23', '2023-04-06 13:26:23', NULL);
INSERT INTO `t_meal` VALUES (432, '冲浪海参', '咸鲜', '热菜', '用的活海参切的片，类似吃海参刺身，不过放了料汁和开水来泡着。\n不喜欢料汁的可以烫过以后蘸辣根来吃。', '活海参片、开水、调味料。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/13/2023011316735868983661.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:23', '2023-04-06 13:26:23', NULL);
INSERT INTO `t_meal` VALUES (433, '杂菜鸡肉泥大馄饨', '清淡', '面食', '', '大馄饨皮、鸡肉泥、杂菜、料酒、生抽、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/13/2023011316735869398431.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:22', '2023-04-06 13:26:22', NULL);
INSERT INTO `t_meal` VALUES (434, '青椒肉丝炒豆芽', '清淡', '热菜', '', '瘦肉丝、绿豆芽、青椒、胡萝卜、盐、胡椒粉、料酒、生抽、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/13/2023011316735884092381.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:22', '2023-04-06 13:26:22', NULL);
INSERT INTO `t_meal` VALUES (435, '白菜豆腐烩粉条', '咸香', '热菜', '', '大白菜、豆腐、粉丝、炖肉、盐、老抽、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/13/2023011316735884541881.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:22', '2023-04-06 13:26:22', NULL);
INSERT INTO `t_meal` VALUES (436, '挂霜花生', '甜香', '小吃', '春节年夜饭，教你一道吉祥菜，挂霜花生～花生被人们称作“长生果”，寓意新年健康长寿。做法简单有好吃。', '花生、白芝麻、清水、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/13/2023011316735913076081.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:22', '2023-04-06 13:26:22', NULL);
INSERT INTO `t_meal` VALUES (437, '菠菜拌豆腐', '清淡', '凉菜', '', '菠菜、豆腐、蒜泥、香油、香醋、凉拌酱油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/13/2023011316735934095501.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:22', '2023-04-06 13:26:22', NULL);
INSERT INTO `t_meal` VALUES (438, '椒麻油', '麻辣', '家常菜', '', '干辣椒、花椒、植物油、熟白芝麻、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/13/2023011316736046405071.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:22', '2023-04-06 13:26:22', NULL);
INSERT INTO `t_meal` VALUES (439, '蒜苗苤蓝炒肉丝', '咸鲜', '热菜', '', '瘦肉、苤蓝、胡萝卜、蒜苗、淀粉、油、盐、料酒、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/18/2023011816740296836091.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:22', '2023-04-06 13:26:22', NULL);
INSERT INTO `t_meal` VALUES (440, '赤豆薏仁糯米粥', '原味', '粥', '赤小豆和薏米都有利水、消肿和健脾胃的功效，是祛湿和补心血兼得的好东西，两者搭配加上糯米煮粥喝，能够温补脾胃，促进体内营养的循环，加强肠胃的吸收能力。', '赤小豆、炒薏仁、红枣、糯米。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/18/2023011816740297918181.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:22', '2023-04-06 13:26:22', NULL);
INSERT INTO `t_meal` VALUES (441, '薏米山药粥', '原味', '粥', '健脾益气，薏米和山药同食能够补气健脾，缓解身体疲倦无力、脾胃虚弱等症。', '大米、薏米、山药、纯净水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/14/2023011416736547779441.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:22', '2023-04-06 13:26:22', NULL);
INSERT INTO `t_meal` VALUES (442, '黑木耳爆葱白', '咸鲜', '热菜', '', '黑木耳、葱白、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/18/2023011816740296467661.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:22', '2023-04-06 13:26:22', NULL);
INSERT INTO `t_meal` VALUES (443, '大蒜炒牛肚', '清淡', '热菜', '', '熟牛肚、大蒜、生抽、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/14/2023011416736650382601.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:22', '2023-04-06 13:26:22', NULL);
INSERT INTO `t_meal` VALUES (444, '香葱肉馅饺子', '葱香', '面食', '', '饺子皮、肉末、香葱、料酒、生抽、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/14/2023011416736705601531.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:22', '2023-04-06 13:26:22', NULL);
INSERT INTO `t_meal` VALUES (445, '翡翠饺子', '咸鲜', '面食', '春节团圆饺子～翡翠饺子。\n饺子寓意着来年幸福、平安、吉祥、希望、添财，是新一年丰硕与收获，象征着中国人对于家文化的一种尊重和热爱。', '猪后腿肉、香菇、莲藕、面粉、小葱、生姜、菠菜、生抽、老抽、蚝油、料酒、盐、鸡精、五香粉、花椒粉、胡椒粉、花生油、芝麻香油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/14/2023011416736777069191.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 1, '2023-04-06 13:26:22', '2023-04-06 13:26:22', NULL);
INSERT INTO `t_meal` VALUES (446, '鹿茸菇山药鸡汤', '原味', '汤类', '', '鸡骨架、胡萝卜、山药、鹿茸菇、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772184129381.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:22', '2023-04-06 13:26:22', NULL);
INSERT INTO `t_meal` VALUES (447, '三酱牛肉', '酱香', '凉菜', '过年了，学会小高姐这个魔法调料做三酱牛肉，酱香浓郁，口感紧实超好吃。', '牛腱子、生姜、洋葱、酱油、甜面酱、豆腐乳、香叶、八角、桂皮、草果、干小米辣、陈皮、干山楂片、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/17/2023011716739375898071.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:22', '2023-04-06 13:26:22', NULL);
INSERT INTO `t_meal` VALUES (448, '原汁皮冻', '原味', '凉菜', '原汁原味，QQ弹弹，不用料汁，直接食用。', '猪肉皮、水、盐、姜、八角、花椒、葱段、料酒、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/17/2023011716739244117361.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:22', '2023-04-06 13:26:22', NULL);
INSERT INTO `t_meal` VALUES (449, '菠菜粉丝汤', '清淡', '汤类', '一把菠菜，一把粉丝，两勺鸡汁，几粒枸杞，汤鲜味美，清香开胃。', '菠菜、粉丝、枸杞、小香葱、香菜、鲜鸡汁、胡椒粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/17/2023011716739243733511.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:21', '2023-04-06 13:26:21', NULL);
INSERT INTO `t_meal` VALUES (450, '油面筋炒小白菜', '咸鲜', '热菜', '简单快捷的家常菜。', '油面筋、小白菜、盐、蒜蓉、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/17/2023011716739338648511.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:21', '2023-04-06 13:26:21', NULL);
INSERT INTO `t_meal` VALUES (451, '红烧肉土豆炖粉条', '咸鲜', '热菜', '最家常的炖菜。\n不知道友友们有没有发现。表面粗糙的和红皮的土豆，口感粉糯，适合做炖菜；表面光滑细腻的土豆质地脆嫩，适合清炒。', '红烧肉、红皮土豆、海带、红薯粉条、蒜苔、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/17/2023011716739372588681.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:21', '2023-04-06 13:26:21', NULL);
INSERT INTO `t_meal` VALUES (452, '传统韭菜盒子', '五香', '面食', '一直不喜欢吃外面的菜盒，太油了，还是喜欢自己做的传统韭菜盒子，喧软劲道，家常味十足。', '韭菜、面粉、鸡蛋、粉丝、生姜、盐、蚝油、五香粉、胡椒粉、芝麻香油、花生油、发酵粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/17/2023011716739373331331.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:21', '2023-04-06 13:26:21', NULL);
INSERT INTO `t_meal` VALUES (453, '尖椒皮蛋', '咸鲜', '凉菜', '过年饭桌上经常能见到，百吃不腻，做法简单，下酒下饭。', '松花鸭皮蛋、青椒、红椒、水饺蘸汁、芝麻香油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/17/2023011716739375316071.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:21', '2023-04-06 13:26:21', NULL);
INSERT INTO `t_meal` VALUES (454, '清香柠檬司康', '甜味', '烘焙', '最近天气暖和，很适合晒太阳和朋友一起下午茶，做了个柠檬司康，味道还不错，非常清香，记得最后撒糖粉，拍的时候忘了。', '低筋面粉、糖粉、泡打粉、黄油、盐、柠檬、冰牛奶。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/17/2023011716739397643311.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:21', '2023-04-06 13:26:21', NULL);
INSERT INTO `t_meal` VALUES (455, '红烧划水', '咸鲜', '热菜', '红烧划水是用鱼尾做的一道菜，鱼的尾巴一直在游动，所以这部分的肉质特别有弹性，所以又称之为划水，新年的餐桌上会用酱油进行红烧，寓意新的一年如鱼得水。', '青鱼、小葱、生姜、料酒、原酿生抽、醇酿老抽、水、葡萄籽油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/17/2023011716739446232531.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:21', '2023-04-06 13:26:21', NULL);
INSERT INTO `t_meal` VALUES (456, '油豆腐烧鸡爪', '清淡', '热菜', '', '油豆腐、鸡爪、桂皮、八角、料酒、酱油、盐、零卡糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/17/2023011716739669264581.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:21', '2023-04-06 13:26:21', NULL);
INSERT INTO `t_meal` VALUES (457, '梅菜扣肉', '酱香', '热菜', '年夜饭桌上必备美食～梅菜扣肉。做好的扣肉扣吃起来咸中略带甜味，色泽红亮、肉香软烂，肥而不腻。', '五花肉、梅菜、生姜、大葱白、干辣椒、腐乳汁、生抽、白糖、蚝油、老抽、蜂蜜、料酒、白酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/18/2023011816740297501511.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:21', '2023-04-06 13:26:21', NULL);
INSERT INTO `t_meal` VALUES (458, '彩椒炒驴肉', '咸鲜', '热菜', '', '熟驴肉、彩椒、食用油、香菜、葱、食盐、生抽、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/17/2023011716739670158421.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:21', '2023-04-06 13:26:21', NULL);
INSERT INTO `t_meal` VALUES (459, '小鸡枞香覃拌佛手瓜', '蒜香', '凉菜', '', '佛手瓜、熟肉丝、胡萝卜、小鸡枞菌香覃、大蒜、食盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/17/2023011716739670661941.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:21', '2023-04-06 13:26:21', NULL);
INSERT INTO `t_meal` VALUES (460, '杂菜炒虾仁', '清淡', '热菜', '', '虾仁、杂菜、料酒、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/17/2023011716739671072241.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:21', '2023-04-06 13:26:21', NULL);
INSERT INTO `t_meal` VALUES (461, '糖醋排条', '酸甜', '热菜', '新年的餐桌上少不了排骨，排骨寓意节节高，这款糖醋排条，将大排去骨切成排条吃起来更方便不用吐骨头，春节的餐桌上免不了在不知不觉中摄入过多的油脂，这道糖醋排条没有用油事先将排条进行油炸，相对更加健康，酸酸甜甜的口味很开胃不知不觉也就吃多了。', '猪大排、青豆、料酒、菠萝糖醋汁、水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/18/2023011816740348026671.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:21', '2023-04-06 13:26:21', NULL);
INSERT INTO `t_meal` VALUES (462, '牛排炖莲藕', '咸鲜', '汤类', '汤香肉烂，莲藕粉糯。', '牛排、牛肉汤、莲藕、胡萝卜、盐、胡椒粉、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/18/2023011816740039406241.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:20', '2023-04-06 13:26:20', NULL);
INSERT INTO `t_meal` VALUES (463, '芹菜炒鸡蛋', '咸鲜', '热菜', '简单美味的快手菜。', '芹菜、鸡蛋、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/18/2023011816740039758541.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:20', '2023-04-06 13:26:20', NULL);
INSERT INTO `t_meal` VALUES (464, '猴头菇鸡汤', '原味', '汤类', '猴头菇为食用菌中名贵品，其营养价值高，肉嫩，味鲜美，不仅为宴席之珍馐，亦为上好之补品，具有养胃助消化、安神、补五脏、抗癌之功效，与鸡肉同用则补益作用更强。\n猴头菇自古以来它就有，山珍猴头海味燕窝的美称。营养美味，味道特别的鲜美。', '猴头菇、鸡腿、姜、葱、枸杞、纯净水、盐、料酒、鸡精', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/18/2023011816740040126681.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:20', '2023-04-06 13:26:20', NULL);
INSERT INTO `t_meal` VALUES (465, '蒜薹炒鱿鱼', '微辣', '热菜', '咸鲜微辣，鱿鱼须入口筋软，好吃又营养，下酒又下饭。', '鱿鱼须、蒜薹、葱、姜、蒜、干辣椒、料酒、生抽、豆瓣酱、白胡椒粉、孜然粉、盐、糖、香油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/18/2023011816740192027871.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:20', '2023-04-06 13:26:20', NULL);
INSERT INTO `t_meal` VALUES (466, '蔓菁山药小米粥', '原味', '粥', '健康营养粥。', '小米、蔓菁、山药、纯净求。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/18/2023011816740100565671.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:20', '2023-04-06 13:26:20', NULL);
INSERT INTO `t_meal` VALUES (467, '虾干大白菜荞麦面', '清淡', '面条', '', '大白菜、虾干、荞麦面、生抽、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/18/2023011816740101346771.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:20', '2023-04-06 13:26:20', NULL);
INSERT INTO `t_meal` VALUES (468, '捞汁鹌鹑蛋', '咸鲜', '凉菜', '年夜饭必推下酒菜～捞汁鹌鹑蛋超过瘾。', '鹌鹑蛋、香菜、洋葱、大蒜、小米辣、线椒、生抽、老抽、白糖、凉白开、柠檬。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/18/2023011816740348427221.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:20', '2023-04-06 13:26:20', NULL);
INSERT INTO `t_meal` VALUES (469, '蒜苗爆炒腊鹌鹑', '咸香', '热菜', '', '腊鹌鹑、蒜苗、葱、油、生抽、米酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/18/2023011816740295536921.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:20', '2023-04-06 13:26:20', NULL);
INSERT INTO `t_meal` VALUES (470, '蒜蓉炒芥兰', '蒜香', '热菜', '', '芥兰、蒜蓉、油、盐、糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/18/2023011816740295171521.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:20', '2023-04-06 13:26:20', NULL);
INSERT INTO `t_meal` VALUES (471, '口水脆皮干', '微辣', '凉菜', '', '脆皮干、香菜、熟花生碎、花椒粉、辣油、花椒油、芝麻酱、生抽、陈醋、糖、葱花。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/18/2023011816740293746131.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:20', '2023-04-06 13:26:20', NULL);
INSERT INTO `t_meal` VALUES (472, '老母鸡筒骨冬笋汤', '清淡', '汤类', '很清甜的汤品。', '冬笋、老母鸡、筒骨、姜、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/01/18/2023011816740294399911.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:20', '2023-04-06 13:26:20', NULL);
INSERT INTO `t_meal` VALUES (473, '酱牛肉', '酱香', '凉菜', '', '牛腱子、姜、料酒、冰糖、黄豆酱、老抽、生抽、葱、花椒、尖辣椒、蒜、八角、香叶、茴香、桂皮、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/02/2023020216753436208841.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:20', '2023-04-06 13:26:20', NULL);
INSERT INTO `t_meal` VALUES (474, '洋葱炒羊肉', '微辣', '热菜', '', '羊肉、洋葱、姜、生抽、生粉、糖、胡椒粉、干辣椒、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/17/2023021716766402848551.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:20', '2023-04-06 13:26:20', NULL);
INSERT INTO `t_meal` VALUES (475, '番茄肉酱意面', '酸甜', '面条', '', '番茄、肉末、意面、葱、蒜、番茄酱、油、盐、酱油、料酒、胡椒粉、水、糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/03/2023020316754078369151.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:19', '2023-04-06 13:26:19', NULL);
INSERT INTO `t_meal` VALUES (476, '清炖萝卜羊肉汤', '咸鲜', '汤类', '', '羊后腿、水萝卜、葱、姜、水、盐、花椒、红枣。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/23/2023022316771357739771.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:19', '2023-04-06 13:26:19', NULL);
INSERT INTO `t_meal` VALUES (477, '杂菜炒腊肠', '咸鲜', '热菜', '', '花菜、儿菜、腊肠、生抽、蒜、马蹄。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/12/2023021216762026518611.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:19', '2023-04-06 13:26:19', NULL);
INSERT INTO `t_meal` VALUES (478, '虾仁豆腐', '咸鲜', '热菜', '清淡美味，高蛋白质。', '虾仁、内酯豆腐、白菜、盐、橄榄油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/04/2023020416754889649951.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:19', '2023-04-06 13:26:19', NULL);
INSERT INTO `t_meal` VALUES (479, '网红煎汤圆', '甜香', '小吃', '簡單美味外脆內軟的煎湯圓\n大家一定要試試哦太過癮了', '湯圓、花生碎、巧克力醬、水、油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/03/2023020316753886822511.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:19', '2023-04-06 13:26:19', NULL);
INSERT INTO `t_meal` VALUES (480, '金华火腿炒西芹', '咸鲜', '热菜', '继续吃西芹。', '金华火腿、西芹、食用油、红椒、葱姜、食盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/02/2023020216753436661781.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:19', '2023-04-06 13:26:19', NULL);
INSERT INTO `t_meal` VALUES (481, '油豆腐魔芋结排骨煲', '清淡', '热菜', '', '排骨、油豆腐、魔芋结、料酒、酱油、盐、零卡糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/02/2023020216753437959491.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:19', '2023-04-06 13:26:19', NULL);
INSERT INTO `t_meal` VALUES (482, '凉拌酸辣大白菜', '酸辣', '凉菜', '简单快捷又美味的一道菜', '大白菜、油泼辣子、陈醋、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/02/2023020216753438401791.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:19', '2023-04-06 13:26:19', NULL);
INSERT INTO `t_meal` VALUES (483, '牛肉炒鸡蛋', '清淡', '热菜', '', '鸡蛋、熟牛肉、香葱、料酒、盐、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/02/2023020216753438735761.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:19', '2023-04-06 13:26:19', NULL);
INSERT INTO `t_meal` VALUES (484, '煲仔饭', '咸香', '主食', '', '腊肠、腊肉、鸡蛋、香菇、青菜、大米、油、盐、酱油、老抽、蚝油、糖、香油、清水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/02/2023020216753439187691.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:19', '2023-04-06 13:26:19', NULL);
INSERT INTO `t_meal` VALUES (485, '燕麦蔓越莓曲奇饼干', '甜香', '烘焙', '只是因为在瑞幸咖啡点了一款提子燕麦曲奇饼干然后回家就有了这款伦敦下午茶甜点燕麦蔓越莓曲奇饼干的诞生！！！真是太有才了！', '燕麦、黄油、蔓越莓干、红糖、蜂蜜、低筋面粉、鸡蛋、泡打粉、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/03/2023020316753885728191.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:19', '2023-04-06 13:26:19', NULL);
INSERT INTO `t_meal` VALUES (486, '虾仁鸡蛋羹', '咸香', '羹类', '补充蛋白，快手早餐，减脂晚餐，酒后平胃，都行！', '鸡蛋、虾仁、白胡椒粉、蒸鱼豉油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/03/2023020316753886256331.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:18', '2023-04-06 13:26:18', NULL);
INSERT INTO `t_meal` VALUES (487, '莲子芡实银耳汤', '原味', '小吃', '', '莲子、芡实、银耳、红枣、水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/03/2023020316754059628961.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:18', '2023-04-06 13:26:18', NULL);
INSERT INTO `t_meal` VALUES (488, '豌豆猪骨粥', '咸鲜', '粥', '', '猪骨、豌豆、大米、香菇、蒜、虾仁、花生油、盐、胡椒粉、鸡精、清水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/03/2023020316754058912011.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:18', '2023-04-06 13:26:18', NULL);
INSERT INTO `t_meal` VALUES (489, '香菜拌青瓜', '清淡', '凉菜', '非常清爽脆口的小菜。', '青瓜、香菜、蒜头、小青柠、香油、白糖、生抽、醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/03/2023020316754106128491.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:18', '2023-04-06 13:26:18', NULL);
INSERT INTO `t_meal` VALUES (490, '虾仁烧豆腐', '咸香', '热菜', '', '豆腐、虾仁、蒜姜葱、尖椒、料酒、胡椒粉、生抽、老抽、豆瓣酱、水、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/03/2023020316754152441161.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:18', '2023-04-06 13:26:18', NULL);
INSERT INTO `t_meal` VALUES (491, '莴笋叶小豆沫', '咸鲜', '汤类', '', '黄豆、莴笋叶、清水、食盐、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/03/2023020316754175651051.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:18', '2023-04-06 13:26:18', NULL);
INSERT INTO `t_meal` VALUES (492, '莴笋炒海参', '微辣', '热菜', '', '海参、莴笋、食用油、红椒、食盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/03/2023020316754320985771.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:18', '2023-04-06 13:26:18', NULL);
INSERT INTO `t_meal` VALUES (493, '牛肉魔芋丝煲', '咖喱', '热菜', '', '魔芋丝、烧牛肉、酱油、咖喱粉、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/03/2023020316754321426751.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:18', '2023-04-06 13:26:18', NULL);
INSERT INTO `t_meal` VALUES (494, '猴头菇炒鸡蛋', '鱼香', '热菜', '猴头菇健胃养胃、补虚、抗癌，是食用蘑菇中健康名贵的品种。\n猴头菇炒鸡蛋，简单美味，健康营养。', '猴头菇、鸡蛋、香菜、花生油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/04/2023020416754752095101.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:18', '2023-04-06 13:26:18', NULL);
INSERT INTO `t_meal` VALUES (495, '土豆菠菜汤', '清淡', '汤类', '菠菜中大量的膳食纤维可以延缓血糖上升速率，刺激肠胃蠕动，帮助排便和排毒，加快胆固醇的排出，土豆所含的膳食纤维分可以促进肠胃蠕动，对于胆固醇的代谢可起到加速作用，搭配食用效果更好。\n润肠通便，清淡可口。', '土豆、菠菜、葱、纯净水、盐、醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/04/2023020416754891877971.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:18', '2023-04-06 13:26:18', NULL);
INSERT INTO `t_meal` VALUES (496, '菠菜炒鸡蛋', '咸香', '热菜', '', '菠菜、鸡蛋、韭菜、红萝卜、盐、花椒粉、油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/04/2023020416754987372371.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:18', '2023-04-06 13:26:18', NULL);
INSERT INTO `t_meal` VALUES (497, '蚝汁腐皮卷', '咸香', '热菜', '廣東人喜歡去茶樓飲茶的一定有見過或吃過這點心自己在家做方便又解饞，一次吃個夠', '腐皮、肉沫、紅蘿蔔丁、芹菜丁、甜醬油、老抽、素雞粉、胡椒粉、香油、糖、澱粉、糖、水、澱粉、蠔油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762551719631.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:18', '2023-04-06 13:26:18', NULL);
INSERT INTO `t_meal` VALUES (498, '自制春饼', '原味', '小吃', '“立春”意味春回大地，万物复苏。吃春饼是我国的传统习俗之一，俗称嚼春、咬春、或者尝春。吃春饼有喜迎春季，祈盼丰收之意。自制春饼其形如薄如蝉翼、口感柔软且韧弹(不易撕破)、既使凉了吃也不硬。', '面粉、蛋清、温水、菜籽油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/04/2023020416755094862961.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:18', '2023-04-06 13:26:18', NULL);
INSERT INTO `t_meal` VALUES (499, '清蒸萝卜丸', '咸香', '热菜', '', '白萝卜、猪肉、虾仁、姜、油、盐、酱油、蚝油、胡椒粉、鸡精、木薯淀粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/04/2023020416755136124151.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:18', '2023-04-06 13:26:18', NULL);
INSERT INTO `t_meal` VALUES (500, '长腿蛸炒莴笋', '咸鲜', '热菜', '', '长腿蛸、莴笋、食用油、胡萝卜、姜、食盐、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/04/2023020416755093442071.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:17', '2023-04-06 13:26:17', NULL);
INSERT INTO `t_meal` VALUES (501, '非正宗版腌笃鲜', '咸鲜', '热菜', '下单买的鲜冬笋，给我发的是腌笋，因为我早早把火腿和龙骨泡上了，没法，就用这个做吧，不正宗，味道稍差点，也很好吃。', '带骨金华火腿、龙骨、纯净水、腌笋、莴笋、葱芽、白酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/04/2023020416755094042021.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:17', '2023-04-06 13:26:17', NULL);
INSERT INTO `t_meal` VALUES (502, '萝卜煎饼', '葱香', '面食', '万万没有想到，便宜的白萝卜居然能做成那么好吃健康低脂的萝卜煎饼。', '白萝卜、香菇丁、广式腊肠、葱花、虾皮、盐、鸡精、胡椒粉、五香粉、面粉、清水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/04/2023020416755095823931.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:17', '2023-04-06 13:26:17', NULL);
INSERT INTO `t_meal` VALUES (503, '炒合菜', '咸香', '热菜', '今天立春，大家都吃炒合菜了没，这可是春天的味道哟！', '绿豆芽、韭菜、胡萝卜、粉条、鸡蛋、葱花、姜、大蒜、香油、老抽、生抽、食用油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/04/2023020416755159104201.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:17', '2023-04-06 13:26:17', NULL);
INSERT INTO `t_meal` VALUES (504, '春饼', '咸香', '面食', '春饼，春天的饼，今日立春，春饼卷合菜，带来春天的祝福！', '面粉、水、盐、熟油、面粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/04/2023020416755176025081.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:17', '2023-04-06 13:26:17', NULL);
INSERT INTO `t_meal` VALUES (505, '凉拌猪肝', '麻辣', '凉菜', '猪肝，味甘、苦，归肝经，可以补肝明目，能改善肝血不足导致的视物模糊不清、夜盲、眼干燥等症状，也可以治疗内外翳障等眼病。猪肝中含有丰富的铁元素，其可促进外周血液中血红蛋白生成，可用于防治缺铁性贫血。猪肝还有健脾的作用，可以改善脾胃虚弱所致的食欲不振、消化不良等病症。', '猪肝、淀粉、盐、葱姜蒜、生抽、醋、耗油、鸡精、辣椒油、麻油、香菜、蛋清。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/05/2023020516755749958951.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:17', '2023-04-06 13:26:17', NULL);
INSERT INTO `t_meal` VALUES (506, '钱兔无量小桔灯', '其他', '私房菜', '元宵节还没买兔子灯，没关系，过完年家里桔子肯定还有很多，今天我们就用橘子皮来做小桔灯吧。简单又可爱，家里还香香的哟！记得我们小学语文课文里有一篇冰心老师的《小桔灯》，点亮的瞬间，真的暖意浓浓。', '耙耙柑、针线、灯芯。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/05/2023020516755791411941.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:17', '2023-04-06 13:26:17', NULL);
INSERT INTO `t_meal` VALUES (507, '炸蘑菇', '酸甜', '热菜', '这个蘑菇本来准备下火锅的，但因为备料太多，就没用到。最近我又正好得了个脆炸糊的配方，心痒痒地，就顺手炸了一下，成品外酥里嫩，蘸番茄沙司还挺好吃的。\n脆炸糊的关键是红薯淀粉，加了它，挂糊炸出来的外壳会保持坚挺，不会软塌塌的。这个糊做小酥肉也很nice哦。\n我以前出过一个酥炸金针菇的菜谱，和今天这个做法不同，但也很不错，感兴趣的小伙伴可以到我主页或微信公众号眉记去翻看一下。', '平菇、红薯淀粉、普通面粉、清水、食用油、遵循自然本味番茄沙司、盐糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/06/2023020616756872841731.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:17', '2023-04-06 13:26:17', NULL);
INSERT INTO `t_meal` VALUES (508, '山西甑糕', '甜味', '主食', '我每一次到外面尝过了山西的正高，感觉不是很难！回家找来视频资料和材料自己做就成功了！香，软，糯非常好吃！', '红枣、糯米、葡萄干、芸豆、白糖、红糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/05/2023020516755808493851.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:17', '2023-04-06 13:26:17', NULL);
INSERT INTO `t_meal` VALUES (509, '口蘑鲑鱼', '鱼香', '热菜', '', '鲑鱼、口蘑、黄油、盐、黑胡椒碎、料酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/05/2023020516755792166661.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:17', '2023-04-06 13:26:17', NULL);
INSERT INTO `t_meal` VALUES (510, '黄鱼鲞烧鸡翅中', '清淡', '热菜', '', '黄鱼鲞、鸡翅中、姜片、料酒、酱油、盐、零卡糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/05/2023020516755992344501.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:17', '2023-04-06 13:26:17', NULL);
INSERT INTO `t_meal` VALUES (511, '蛋挞', '甜味', '烘焙', '生活很苦，蛋挞很甜。\n甜食治愈一切烦恼。', '蛋挞皮、鸡蛋、牛奶、炼乳、打蛋器、过虑网。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/05/2023020516756013406251.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:17', '2023-04-06 13:26:17', NULL);
INSERT INTO `t_meal` VALUES (512, '玫瑰花元宵', '奶香', '小吃', '正月十五元宵节，吃一个不一样的元宵，玫瑰花元宵Q弹爽滑！一口一个，满口留香！\n再搭配水润的银耳！润泽养肤！\n喝完全身暖乎乎的！小脸也红润润的。', '木薯粉、玫瑰花、牛奶、银耳、冰糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/05/2023020516756013862411.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:17', '2023-04-06 13:26:17', NULL);
INSERT INTO `t_meal` VALUES (513, '蘑菇炒西兰花', '清淡', '热菜', '', '蘑菇、西兰花、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/05/2023020516756015465501.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:17', '2023-04-06 13:26:17', NULL);
INSERT INTO `t_meal` VALUES (514, '圆蛤菠菜汤', '清淡', '汤类', '', '圆蛤、菠菜、料酒、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/05/2023020516756015938941.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:17', '2023-04-06 13:26:17', NULL);
INSERT INTO `t_meal` VALUES (515, '虾仁豆腐羹', '咸鲜', '羹类', '', '虾仁、酱肉、豆腐、豌豆、蒜苗、葛根粉、油、盐、料酒、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/05/2023020516756044094111.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:16', '2023-04-06 13:26:16', NULL);
INSERT INTO `t_meal` VALUES (516, '发笋干', '原味', '素菜', '网购虐我千百遍，我待网购如初恋！\n买的笋干，估计哈，大部分是陈货。看颜色就知道了。', '笋干、清水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/06/2023020616756555235311.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:16', '2023-04-06 13:26:16', NULL);
INSERT INTO `t_meal` VALUES (517, '香菇油菜炒素毛肚', '咸鲜', '热菜', '', '香菇、油菜、素毛肚、食用油、红椒、葱姜、花椒、食盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/06/2023020616756646755151.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:16', '2023-04-06 13:26:16', NULL);
INSERT INTO `t_meal` VALUES (518, '热拌琵琶腿肉菠菜荞麦面', '清淡', '面条', '', '菠菜、鸡琵琶腿、荞麦面、姜片、料酒、盐、味精、生抽、芝麻油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/06/2023020616756647158751.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:16', '2023-04-06 13:26:16', NULL);
INSERT INTO `t_meal` VALUES (519, '牛肉焗米粉', '咸香', '热菜', '', '牛肉、金针菇、米粉、姜丝、蒜未、葱花、蒜蓉辣酱、小米椒、油、酱油、蚝油、胡椒粉、淀粉、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/06/2023020616756647519841.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:16', '2023-04-06 13:26:16', NULL);
INSERT INTO `t_meal` VALUES (520, '菠菜油炸素鸡', '清淡', '热菜', '', '油炸素鸡、菠菜、酱油、盐、零卡糖、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/06/2023020616756873885461.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:16', '2023-04-06 13:26:16', NULL);
INSERT INTO `t_meal` VALUES (521, '蒜香空心菜', '蒜香', '热菜', '', '空心菜、蒜、小米椒、油、盐、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/06/2023020616756878292831.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:16', '2023-04-06 13:26:16', NULL);
INSERT INTO `t_meal` VALUES (522, '橄榄猪肚汤', '原味', '汤类', '', '猪肚、猪骨、橄榄、红枣、姜、盐、鸡精、清水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/06/2023020616756878786851.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:16', '2023-04-06 13:26:16', NULL);
INSERT INTO `t_meal` VALUES (523, '腌笃鲜煲', '清淡', '汤类', '', '鸡翅根、雷笋、百叶结、火腿片。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/06/2023020616756879212361.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:16', '2023-04-06 13:26:16', NULL);
INSERT INTO `t_meal` VALUES (524, '油炸素鸡菠菜荞麦面', '清淡', '面条', '', '油炸素鸡、菠菜、荞麦面、生抽、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/07/2023020716757467038061.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:16', '2023-04-06 13:26:16', NULL);
INSERT INTO `t_meal` VALUES (525, '萝卜素包子', '清淡', '面食', '', '青萝卜、胡萝卜、鸡蛋、虾皮、盐、鸡精、耗油、五香粉、油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/07/2023020716757690446931.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:16', '2023-04-06 13:26:16', NULL);
INSERT INTO `t_meal` VALUES (526, '黑芝麻馅彩色汤圆', '甜香', '小吃', '软糯香甜的黑芝麻馅，可可爱爱的彩色汤圆。', '黑芝麻、坚果、白糖、黄油、水、糯米粉、玉米淀粉、果蔬泥。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/07/2023020716757551955761.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:16', '2023-04-06 13:26:16', NULL);
INSERT INTO `t_meal` VALUES (527, '百财白菜', '甜香', '面食', '会长元宝的白菜。', '白色发面面团、菠菜发面面团、元宝造型馒头、食用油、蜜豆。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/07/2023020716757602048661.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:15', '2023-04-06 13:26:15', NULL);
INSERT INTO `t_meal` VALUES (528, '卤鸡腿拌饭', '甜香', '主食', '卤鸡腿拌饭孩子们都喜欢吃，今天给大家分享一下我们家的做法。', '鸡腿、葱、姜、啤酒、老抽、蚝油、八角、干辣椒、冰糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/07/2023020716757602583221.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:15', '2023-04-06 13:26:15', NULL);
INSERT INTO `t_meal` VALUES (529, '花生米烧排骨', '清淡', '热菜', '', '排骨、花生米、酱油、盐、零卡糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/07/2023020716757689629461.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:15', '2023-04-06 13:26:15', NULL);
INSERT INTO `t_meal` VALUES (530, '五花肉炒大葱', '咸鲜', '热菜', '', '大葱、五花肉、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/07/2023020716757690007941.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:15', '2023-04-06 13:26:15', NULL);
INSERT INTO `t_meal` VALUES (531, '香菇牛肉酱', '酱香', '自制酱料', '自己做的香菇牛肉酱，真材实料，满满的牛肉和香菇，不管是夹在馒头里面吃，还是拌面条吃，都超好吃，百搭酱，做法也简单，不用出去买啦～', '牛肉馅、姜片、大葱段、生抽、芝麻油、香菇、蒜蓉辣酱、甜面酱、豆瓣酱、辣椒粉、白糖、炒香白芝麻、大葱、老抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762553289071.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:15', '2023-04-06 13:26:15', NULL);
INSERT INTO `t_meal` VALUES (532, '酱肉炒豆干莴笋', '咸香', '热菜', '', '酱肉、豆干、莴笋、蒜苗、油、盐、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762549957431.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:15', '2023-04-06 13:26:15', NULL);
INSERT INTO `t_meal` VALUES (533, '冬瓜肉片汤', '咸鲜', '汤类', '', '冬瓜、肉片、清水、食用油、食盐、黑胡椒粉、清水、淀粉、香菜。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762552831661.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:15', '2023-04-06 13:26:15', NULL);
INSERT INTO `t_meal` VALUES (534, '低脂版柠檬手撕鸡', '酸辣', '凉菜', '', '鸡琵琶腿、柠檬、剁辣椒、姜片、香葱、料酒、盐、零卡糖、生抽、白醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/12/2023021216761951641371.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:15', '2023-04-06 13:26:15', NULL);
INSERT INTO `t_meal` VALUES (535, '坚果蛋糕', '奶香', '烘焙', '', '蛋糕预拌粉、鸡蛋、坚果、牛奶、玉米油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/12/2023021216761953321331.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:15', '2023-04-06 13:26:15', NULL);
INSERT INTO `t_meal` VALUES (536, '青椒炒酸菜', '咸香', '热菜', '', '酸菜、青椒、五花肉、姜丝、蒜、油、酱油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/12/2023021216761953638761.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:15', '2023-04-06 13:26:15', NULL);
INSERT INTO `t_meal` VALUES (537, '瘦肉丝白玉菇炒雷笋', '清淡', '热菜', '', '瘦肉丝、白玉菇、雷笋、料酒、酱油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/12/2023021216761954404061.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:14', '2023-04-06 13:26:14', NULL);
INSERT INTO `t_meal` VALUES (538, '原味提拉米苏', '甜香', '烘焙', '原味提拉米苏-一款象征爱情的甜点！而且，吃来吃去，还是觉得原味的最好吃！\n模具:8寸方形模具。', '蛋黄、马斯卡彭奶酪、淡奶油、细砂糖、黑朗姆酒、手指饼、可可粉、咖啡酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/12/2023021216761978928121.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:14', '2023-04-06 13:26:14', NULL);
INSERT INTO `t_meal` VALUES (539, '肉丁萝卜小豆沫', '咸鲜', '汤类', '这是鲁西南的吃法和菜名。\n曾经那边的主食几乎都是煎饼，所以这个菜算是汤菜吧。牙口不好的人，可以用来把煎饼泡软了再食用。\n也就说，在鲁西南，这道菜就跟豆浆是油条的最佳拍档一样，是煎饼的最佳拍档。\n\n别人给的生吃的潍坊萝卜，十几天我吃了一个，再不吃掉就糠了，少爷他爹说用萝卜做小豆沫最好吃了，你给做了吃吧。', '青萝卜、黄豆、精肉丁、食用油、清水、食盐、葱姜、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/12/2023021216762026082241.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:14', '2023-04-06 13:26:14', NULL);
INSERT INTO `t_meal` VALUES (540, '桂圆红枣银耳莲子羹', '甜香', '甜品', '桂圆红枣银耳莲子羹是一道传统的养生羹，味道香甜可口，经常食用可清\n热健胃，美容养颜，营养价值丰富。', '丑耳、红枣、桂圆、莲子、枸杞、纯净水、冰糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762548989391.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:14', '2023-04-06 13:26:14', NULL);
INSERT INTO `t_meal` VALUES (541, '肉片香菜炒口蘑', '咸鲜', '热菜', '', '大香菜、口蘑、精肉、食用油、食盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762552272441.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:13', '2023-04-06 13:26:13', NULL);
INSERT INTO `t_meal` VALUES (542, '糊茄子拌面', '咸鲜', '面条', '甘肃的吃法，茄子软软糯糯，豆角里浸着五花肉的香味，一半菜一半手擀面，自己放点醋和油辣椒，太美味啦。', '茄子、豆角、五花肉、葱白、蒜、姜、老抽、生抽、花椒粉、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762654243161.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:13', '2023-04-06 13:26:13', NULL);
INSERT INTO `t_meal` VALUES (543, '西兰花炒木耳', '清淡', '热菜', '', '西兰花、黑木耳、胡萝卜、蒜末、油、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762652948461.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:13', '2023-04-06 13:26:13', NULL);
INSERT INTO `t_meal` VALUES (544, '花旗参瘦肉汤', '清淡', '汤类', '', '花旗参、瘦肉、姜、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762653322251.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:13', '2023-04-06 13:26:13', NULL);
INSERT INTO `t_meal` VALUES (545, '红烧鸡腿', '咸鲜', '热菜', '鸡腿是生活中常用的食材之一，做法多种多样，做一款红烧鸡腿颜色红亮润泽，色香味浓且不油膩，口感肉嫩鲜香。', '鸡腿、料酒、生抽、红烧酱油、姜片、葱片、红曲米、盐、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762653686201.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:13', '2023-04-06 13:26:13', NULL);
INSERT INTO `t_meal` VALUES (546, '青椒白玉菇炒千张条', '清淡', '热菜', '', '青椒、白玉菇、千张条、酱油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762654607951.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:13', '2023-04-06 13:26:13', NULL);
INSERT INTO `t_meal` VALUES (547, '春笋焖鸡翅', '甜香', '热菜', '春笋是这个季节最鲜美的食材，选用了天目上的雷笋，鲜嫩鲜美。这道春笋焖鸡翅，用葱伴侣黄焖鸡调味，制作非常方便，一包调料轻松驾驭，口感能和酒店媲美，色泽鲜艳，好吃又下饭。\n\n​', '春笋、鸡翅、生姜、香葱、食用油、葱姜料酒、甜面酱、黄焖鸡调味料。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762655049561.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:13', '2023-04-06 13:26:13', NULL);
INSERT INTO `t_meal` VALUES (548, '鸡蛋炒鸭血', '清淡', '热菜', '', '鸡蛋、鸭血、香葱、盐、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762655457241.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:13', '2023-04-06 13:26:13', NULL);
INSERT INTO `t_meal` VALUES (549, '红烧带鱼', '咸鲜', '热菜', '', '带鱼、姜、干辣椒、香菜、葱、糖、生粉、生抽、醋、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/17/2023021716766402385301.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:13', '2023-04-06 13:26:13', NULL);
INSERT INTO `t_meal` VALUES (550, '抹茶奶酥吐司', '甜味', '烘焙', '今天做一款抹茶奶酥吐司，使用的还是波兰种和一次发酵法，越做越顺手了，几乎不会失败。整体有淡淡的抹茶清香，浓郁麦香，口感蓬松拉丝，超好吃。这方子适用于常规的450克吐司模具。', '高筋面粉、白砂糖、盐、酵母、牛奶、鸡蛋、无盐黄油、清水、糖粉、蛋液、奶粉、抹茶粉、椰蓉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762770905651.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:13', '2023-04-06 13:26:13', NULL);
INSERT INTO `t_meal` VALUES (551, '家常炒蘑菇', '咸鲜', '热菜', '#下饭菜#超级下饭，简单易学', '蘑菇、香葱、葱花、蒜末、干辣椒、生抽、蚝油、食盐、鸡精、白糖、食用油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762862229701.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:13', '2023-04-06 13:26:13', NULL);
INSERT INTO `t_meal` VALUES (552, '蓝莓蛋糕卷', '奶香', '烘焙', '', '鸡蛋、蛋糕预拌粉、牛奶、玉米油、柠檬汁。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762771327951.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:13', '2023-04-06 13:26:13', NULL);
INSERT INTO `t_meal` VALUES (553, '家庭版烤鱼', '微辣', '热菜', '', '鲈鱼、花菜、莲藕、四季豆、包菜、香菜、蒜苗、青椒、红椒、姜丝、葱头、柠檬片、油、盐、豆瓣酱、蚝油、酱油、老抽、辣椒油、料酒、糖、胡椒粉、鸡精、开水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762914228501.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:13', '2023-04-06 13:26:13', NULL);
INSERT INTO `t_meal` VALUES (554, '雪菜腐乳肉', '咸鲜', '热菜', '家常美味。', '红烧肉、雪菜、生抽、老抽、豆腐乳、白糖、味精、葱花、蒜蓉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762912746321.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:13', '2023-04-06 13:26:13', NULL);
INSERT INTO `t_meal` VALUES (555, '家庭版奶油爆米花', '甜味', '小吃', '家庭版爆米花，奶香四溢，酥酥脆脆，超级好吃，快做给孩子吃吧。', '爆米花专用玉米粒、黄油、白糖、蜂蜜、芝麻。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762955041431.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:13', '2023-04-06 13:26:13', NULL);
INSERT INTO `t_meal` VALUES (556, '豉香剁椒鱼头', '咸鲜', '热菜', '家常做法，没有炒料，简单快捷。', '鲢鱼头、剁辣椒、黄灯笼椒、盐、葱姜、料酒、味极鲜、蚝油、豆豉、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762955555811.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:13', '2023-04-06 13:26:13', NULL);
INSERT INTO `t_meal` VALUES (557, '海虹韭菜饺子', '咸鲜', '面食', '春天海虹和韭菜包饺子是最佳搭档，味道绝绝子～', '面粉、海虹、韭菜、味达美初榨原酿生抽、盐、花生油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/13/2023021316762979872571.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:13', '2023-04-06 13:26:13', NULL);
INSERT INTO `t_meal` VALUES (558, '韭菜绿豆芽卷饼', '清淡', '小吃', '', '卷饼皮、韭菜、绿豆芽、红椒、熟香肠、蒜末、油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/14/2023021416763414668381.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:12', '2023-04-06 13:26:12', NULL);
INSERT INTO `t_meal` VALUES (559, '双色蛋饼三文治', '咸鲜', '小吃', '', '鸡蛋、面包片、西红柿。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772178926381.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:12', '2023-04-06 13:26:12', NULL);
INSERT INTO `t_meal` VALUES (560, '脆皮芝士紫薯批', '甜香', '烘焙', '三樣食材就能完美滿足到孩子的營養和解饞。\n省時快捷又方便新手媽媽的救星', '手抓餅、紫薯、芝士、蛋黃液、芝麻、煉乳。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/17/2023021716766268139411.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:12', '2023-04-06 13:26:12', NULL);
INSERT INTO `t_meal` VALUES (561, '酱焖笔管鱿鱼', '酱香', '热菜', '带籽鱿鱼，鱿鱼味道鲜美，鱼籽咬起来咯吱咯吱。', '笔管鱼、洋葱、姜、蒜、黄豆酱、酱油、淀粉、啤酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/18/2023021816767241401561.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:12', '2023-04-06 13:26:12', NULL);
INSERT INTO `t_meal` VALUES (562, '包菜木耳炒肉片', '咸鲜', '热菜', '', '夹心肉、包菜、黑木耳、葱、油、盐、料酒、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/17/2023021716766267474791.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:12', '2023-04-06 13:26:12', NULL);
INSERT INTO `t_meal` VALUES (563, '番茄炒牛肉', '咸香', '热菜', '', '牛肉、番茄、香菜、油、盐、酱油、蚝油、淀粉、胡椒粉、鸡精', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/17/2023021716766403635001.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:12', '2023-04-06 13:26:12', NULL);
INSERT INTO `t_meal` VALUES (564, '蒜香红薯叶', '蒜香', '热菜', '', '红薯叶、蒜瓣、猪油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/17/2023021716766409665061.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:12', '2023-04-06 13:26:12', NULL);
INSERT INTO `t_meal` VALUES (565, '梅菜蒸肉饼', '咸香', '热菜', '', '肉沫、梅菜、蒜末、油、盐、蚝油、胡椒粉、淀粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/17/2023021716766410386551.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:12', '2023-04-06 13:26:12', NULL);
INSERT INTO `t_meal` VALUES (566, '凉拌土豆片', '咸鲜', '凉菜', '', '土豆、蒜、小葱、泡小米辣、白芝麻、植物油、辣椒粉、酱油、陈醋、蚝油、盐、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/17/2023021716766410063271.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:12', '2023-04-06 13:26:12', NULL);
INSERT INTO `t_meal` VALUES (567, '水碌菜猪肉煲', '咸香', '热菜', '', '水碌菜、猪肉、姜丝、油、盐、酱油、胡椒粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/17/2023021716766410743981.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:12', '2023-04-06 13:26:12', NULL);
INSERT INTO `t_meal` VALUES (568, '全麦馒头', '甜香', '主食', '', '全麦面粉、干酵母粉、糖、猪油、温开水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/18/2023021816766834616461.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:12', '2023-04-06 13:26:12', NULL);
INSERT INTO `t_meal` VALUES (569, '酸菜排骨汤', '咸鲜', '热菜', '', '排骨、酸菜、大葱、姜、八角、桂皮、植物油、蒜、干辣椒、朝天椒、盐、黑胡椒碎。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/18/2023021816766835036571.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:12', '2023-04-06 13:26:12', NULL);
INSERT INTO `t_meal` VALUES (570, '椰汁焖牛腩土豆', '咖喱', '热菜', '', '牛腩、土豆、洋葱、蒜头、姜、香叶、桂皮、八角、油、酱油、蚝油、盐、椰香咖喱葡汁。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/18/2023021816766836083281.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:12', '2023-04-06 13:26:12', NULL);
INSERT INTO `t_meal` VALUES (571, '辣白菜虾仁炒饭', '微辣', '主食', '辣白菜炒饭是朝鲜族家常便饭，简单快捷，最基础的可以是只用辣白菜和米饭炒，也可以升级为用各种肉类和海鲜炒，丰俭由人。', '剩米饭、辣白菜、虾仁、葱花、牛肉粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/18/2023021816766968653571.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:12', '2023-04-06 13:26:12', NULL);
INSERT INTO `t_meal` VALUES (572, '葱油银针鲍鱼', '咸鲜', '热菜', '鲍鱼的营养价值比较丰富，含有大量的维生素A、维生素D以及其他的微量元素。鲍鱼是比较名贵的一种海珍品，味道比较鲜美，而且营养比较丰富，含有丰富的蛋白质、脂肪、DHA、牛黄素等营养物质，可以补充身体内所需的营养物质，而且还可以补充身体基础代谢时所需的能量。鲍鱼中还含有丰富的维生素A，能够起到保护视力的效果，鲍鱼中含有的维生素D，还可以促进钙元素的吸收，所以适当的吃一些鲍鱼对于提高人体免疫力有一定的辅助作用。', '鲍鱼、豆芽、香葱、小米辣、油、葱油汁、盐、花椒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/18/2023021816767004551881.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:12', '2023-04-06 13:26:12', NULL);
INSERT INTO `t_meal` VALUES (573, '白灼海参', '其他', '热菜', '', '活海参、黄瓜、辣根、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/18/2023021816767007008991.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:12', '2023-04-06 13:26:12', NULL);
INSERT INTO `t_meal` VALUES (574, '自制发糕', '原味', '小吃', '发糕是我国传统面食小吃之一，发糕的做法与品种众多。今天用普通面粉做一款发面发糕，成品竟有十厘米厚度，蜂窝孔隙均匀、柔软且韧弹、口感暄软。', '面粉、奶粉、酵母、泡打粉、温水约、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/18/2023021816767009033951.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:12', '2023-04-06 13:26:12', NULL);
INSERT INTO `t_meal` VALUES (575, '橘子糯米糍', '甜香', '小吃', '林清玄曾说：“以清净心看世界，以欢喜心过生活，以平常心生情味，以柔软心除挂碍。”\n\n\n​', '牛奶、糯米粉、玉米淀粉、糖、玉米油、椰蓉、砂糖橘。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/18/2023021816767066511181.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:12', '2023-04-06 13:26:12', NULL);
INSERT INTO `t_meal` VALUES (576, '蔓越莓芝士曲奇饼干', '原味', '烘焙', '在曲奇饼干的做法中大致分成两种，一种是利用打蛋器打发黄油的做法，这种方法做出的曲奇饼干口感非常酥脆，一碰掉渣，另一种做法相对简单，只要将食材搅拌均匀以后再整形烘烤，这种方法做出的曲奇饼干口感相对而言就要相对扎实一些，但是入口也酥，味道一样不差，只是针对不同喜好的人感觉不同而已。今天分享的蔓越莓芝士曲奇饼干就属于后者，做法非常简单，只要将食材混合均匀，冷冻切片烘烤，就能得到一大盘岁脆香甜的小点心，每一口都能吃到足足的芝士碎和蔓越莓干，口感醇厚酸酸甜甜特别好吃，每一口都是满满的钙，所以很适合给小朋友做小零食！', '黄油、低筋面粉、马苏里拉芝士碎、蔓越莓干、糖粉、鸡蛋黄、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/18/2023021816767238994641.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:11', '2023-04-06 13:26:11', NULL);
INSERT INTO `t_meal` VALUES (577, '蒜香芥兰', '蒜香', '热菜', '', '芥兰、蒜末、油、酱油、糖、生粉水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/18/2023021816767240393481.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:11', '2023-04-06 13:26:11', NULL);
INSERT INTO `t_meal` VALUES (578, '抹茶蒸蛋糕', '原味', '烘焙', '今天做一款超好看的抹茶蒸蛋糕，制作简单，免烤箱。完全保持了抹茶靓丽的颜色，颜值超高，带有淡淡的清新抹茶风味，口感绵软，蛋糕组织松软绵密，不输烤箱版本。', '鸡蛋、白砂糖、植物油、牛奶、低筋面粉、抹茶粉、泡打粉、柠檬汁。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/18/2023021816767240919591.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:11', '2023-04-06 13:26:11', NULL);
INSERT INTO `t_meal` VALUES (579, '白菜炖豆腐', '咸香', '热菜', '超级好吃的家常菜。', '白菜、豆腐、鸡蛋、小米辣、蒜、红薯粉、肉馅、酱油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/18/2023021816767258219481.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:11', '2023-04-06 13:26:11', NULL);
INSERT INTO `t_meal` VALUES (580, '葱油鲍鱼片', '咸香', '热菜', '冰箱里的鲍鱼是年货，冻品，做个小凉菜。', '鲍鱼、葱、酱油、醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/18/2023021816767258695951.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:11', '2023-04-06 13:26:11', NULL);
INSERT INTO `t_meal` VALUES (581, '照烧青花鱼', '咸鲜', '热菜', '青花鱼富含OMEGA-3和不饱和脂肪酸，含有丰富的油脂，无油烹饪也芳香四溢、味道鲜美。对健康非常有益！\n煎过后的鱼肉肉质肥嫩有弹性，肉质鲜美。煎、烤、炖、煮怎么做都好吃。', '青花鱼、葱、姜、生抽、料酒、蚝油、老抽、白糖、黑胡椒碎。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/18/2023021816767346092771.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:11', '2023-04-06 13:26:11', NULL);
INSERT INTO `t_meal` VALUES (582, '陈肾白果粥', '咸香', '粥', '', '陈肾、白果、珍珠米、姜丝、香油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/19/2023021916767856534401.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:11', '2023-04-06 13:26:11', NULL);
INSERT INTO `t_meal` VALUES (583, '清蒸银鲳鱼', '咸鲜', '热菜', '', '银鲳鱼、姜、葱、香菜、油、蒸鱼豉油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/19/2023021916767856997941.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:11', '2023-04-06 13:26:11', NULL);
INSERT INTO `t_meal` VALUES (584, '肉片鸡蛋炒米粉', '咸鲜', '小吃', '', '米粉、肉片、鸡蛋、绿豆芽、葱、油、酱油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/19/2023021916767857422741.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:11', '2023-04-06 13:26:11', NULL);
INSERT INTO `t_meal` VALUES (585, '菠萝苹果汤', '果味', '糖水', '菠萝加苹果，酸酸甜甜，软糯清脆！', '菠萝、苹果、橙子、冰糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/19/2023021916767857804641.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:11', '2023-04-06 13:26:11', NULL);
INSERT INTO `t_meal` VALUES (586, '扣肉焖梅菜', '咸香', '热菜', '', '扣肉、梅菜、蒜头、姜、酱油、糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/19/2023021916767858424081.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:11', '2023-04-06 13:26:11', NULL);
INSERT INTO `t_meal` VALUES (587, '巧克力乳酪面包', '甜香', '烘焙', '10个量', '高筋面粉、可可粉、干酵母、盐、细砂糖、水、奶粉、黄油、奶油奶酪、糖粉、车达奶酪、杏仁碎。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/19/2023021916767859778401.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:10', '2023-04-06 13:26:10', NULL);
INSERT INTO `t_meal` VALUES (588, '咖喱鸡块炖土豆', '咖喱', '热菜', '', '三黄鸡、土豆、洋葱、姜、花椒、盐、油、咖喱块、酱油、料酒、开水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/23/2023022316771356617511.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:10', '2023-04-06 13:26:10', NULL);
INSERT INTO `t_meal` VALUES (589, '腊肉炒青椒蒜苔', '咸香', '热菜', '', '熟腊肉、青椒、蒜苔、葱、蒜、红辣椒、油、酱油、五香粉、老干妈。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/23/2023022316771356992801.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:10', '2023-04-06 13:26:10', NULL);
INSERT INTO `t_meal` VALUES (590, '黑腐竹炒西葫芦', '咸鲜', '热菜', '', '西葫芦、黑腐竹、葱、蒜、红辣椒、油、盐、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772234729701.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:10', '2023-04-06 13:26:10', NULL);
INSERT INTO `t_meal` VALUES (591, '西芹炒羊肚菌', '咸鲜', '热菜', '', '西芹、羊肚菌、辣椒、葱、蒜、盐、油、酱油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/23/2023022316771309799651.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:10', '2023-04-06 13:26:10', NULL);
INSERT INTO `t_meal` VALUES (592, '自发绿豆芽', '原味', '私房菜', '绿豆芽，也称豆芽菜，为豆科植物绿豆的种子，经浸罨后发出的嫩芽。\n绿豆芽适用于主暑热烦渴，酒毒，小便不利，目翳。\n为了吃的更绿色健康，我开始自己发绿豆芽啦。\n为此专门买了发芽菜的器具，好用，就是觉得器具的原料不是适合食品级的，准备继续去搜索食品级器具。', '绿豆、温水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/25/2023022516772938533211.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:10', '2023-04-06 13:26:10', NULL);
INSERT INTO `t_meal` VALUES (593, '三色面馒头', '原味', '主食', '', '面粉、全麦粉、玉米粉、发酵粉、碱粉、温水、糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/23/2023022316771309408591.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:10', '2023-04-06 13:26:10', NULL);
INSERT INTO `t_meal` VALUES (594, '红火龙果麻薯', '甜香', '烘焙', '麻薯是众多人喜欢吃的美食之一，家人也很喜欢麻薯，这是我第二次自制麻薯，虽然因为粘手，每个不是很均匀，但口感是不错的呦。', '麻薯粉、鸡蛋、水、红火龙果粉、食用油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/23/2023022316771355873711.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:10', '2023-04-06 13:26:10', NULL);
INSERT INTO `t_meal` VALUES (595, '迷迭香三文鱼', '鱼香', '热菜', '这是我感觉三文鱼最好吃的做法。', '三文鱼、西红柿、迷迭香、味达美葱姜料酒、橄榄油、海盐、黑胡椒粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/23/2023022316771429957241.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:10', '2023-04-06 13:26:10', NULL);
INSERT INTO `t_meal` VALUES (596, '韭黄炒莴笋', '清淡', '热菜', '', '韭黄、莴笋、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/23/2023022316771553226231.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:10', '2023-04-06 13:26:10', NULL);
INSERT INTO `t_meal` VALUES (597, '春饼', '咸香', '面食', '春饼好吃简单好做，春饼卷蔬菜，一家老小全都爱。薄如蝉翼，柔软劲道，营养又美味。', '面粉、盐、开水、凉水、菠菜汁、紫薯粉、土豆、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/23/2023022316771554271591.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:10', '2023-04-06 13:26:10', NULL);
INSERT INTO `t_meal` VALUES (598, '清蒸淡水鲳鱼', '咸鲜', '热菜', '简单快捷。', '鲳鱼、料酒、红椒丝、盐、葱姜、蒸鱼豉油、热油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/23/2023022316771555146151.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:10', '2023-04-06 13:26:10', NULL);
INSERT INTO `t_meal` VALUES (599, '山药玉米排骨汤', '咸鲜', '汤类', '汤色清爽，口感甜润，营养丰富。', '排骨、山药、玉米、盐、葱姜、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772180246421.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:10', '2023-04-06 13:26:10', NULL);
INSERT INTO `t_meal` VALUES (600, '芥菜鸡蛋炒饭', '咸鲜', '主食', '春天的芥菜鲜嫩鲜嫩的，加鸡蛋做一份美味的炒饭', '鸡蛋、芥菜、米饭、油、盐、料酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772041809781.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:10', '2023-04-06 13:26:10', NULL);
INSERT INTO `t_meal` VALUES (601, '空气炸锅版蒜香排骨', '蒜香', '热菜', '排骨除含蛋白、脂肪、维生素外，还含有大量磷酸钙、骨胶原、骨粘蛋白等，可为幼儿和老人提供钙质。', '排骨、蒜、料酒、酱油、蚝油、黑胡椒粉、糖、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772257729681.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:10', '2023-04-06 13:26:10', NULL);
INSERT INTO `t_meal` VALUES (602, '肉片平菇炒油菜', '咸鲜', '热菜', '', '油菜、平菇、梅花肉、食用油、花椒、葱姜、食盐、生抽、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772043348881.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:10', '2023-04-06 13:26:10', NULL);
INSERT INTO `t_meal` VALUES (603, '肉丝炒双色萝卜', '咸鲜', '热菜', '', '白萝卜、胡萝卜、梅花肉、猪油、姜、食盐、葱芽、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772042818281.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:10', '2023-04-06 13:26:10', NULL);
INSERT INTO `t_meal` VALUES (604, '葱爆活海参', '葱香', '热菜', '', '活海参、大葱、食用油、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772043927401.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:09', '2023-04-06 13:26:09', NULL);
INSERT INTO `t_meal` VALUES (605, '花香荸荠甜梨水', '甜味', '糖水', '', '荸荠、甜梨、纯净水、冰糖、干玫瑰花瓣。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772044498591.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:09', '2023-04-06 13:26:09', NULL);
INSERT INTO `t_meal` VALUES (606, '炒蚕蛹', '蒜香', '热菜', '高蛋白低脂肪，营养丰富。', '蚕蛹、料酒、盐、葱姜、蒜蓉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772179849151.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:09', '2023-04-06 13:26:09', NULL);
INSERT INTO `t_meal` VALUES (607, '咸蛋黄肉馅饺子', '清淡', '面食', '', '饺子皮、肉末、咸蛋黄、香葱、料酒、生抽、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772180724831.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:09', '2023-04-06 13:26:09', NULL);
INSERT INTO `t_meal` VALUES (608, '辣拌小根蒜', '超辣', '凉菜', '', '小根蒜、盐、味精、糖、辣椒油、韩式辣酱。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772182054081.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:09', '2023-04-06 13:26:09', NULL);
INSERT INTO `t_meal` VALUES (609, '迷你版手抓饼', '咸香', '面食', '首先声明的是，这是我那未满十二周岁的女儿做的，我很喜欢。', '饺子皮、玉米油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772182875251.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:09', '2023-04-06 13:26:09', NULL);
INSERT INTO `t_meal` VALUES (610, '奶油苹果刺梨奶昔', '酸甜', '饮品', '', '刺梨汁、酸奶、奶油富士、雪蜜。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772183608301.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:09', '2023-04-06 13:26:09', NULL);
INSERT INTO `t_meal` VALUES (611, '上汤菠菜', '咸鲜', '热菜', '', '菠菜、鲜蘑菇、姜、蒜、枸杞、火腿、皮蛋、盐、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772258126221.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:09', '2023-04-06 13:26:09', NULL);
INSERT INTO `t_meal` VALUES (612, '酸菜馅包子', '咸香', '面食', '包子是我国大众小吃之一，其馅料不同、形状不同，做法各异。做一款酸菜馅发面包子，馅料鲜香，面皮洁白且柔软。', '面粉、温水、酵母、酸菜、白糖、料酒、生抽、食用油、五香粉、姜末、元葱碎、鸡精、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772290473941.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:09', '2023-04-06 13:26:09', NULL);
INSERT INTO `t_meal` VALUES (613, '什锦虾仁', '咸鲜', '热菜', '', '鲜虾、黄瓜、羊肚菌、木耳、鸡蛋、油、盐、辣酱。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772289672911.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:09', '2023-04-06 13:26:09', NULL);
INSERT INTO `t_meal` VALUES (614, '双色水饺', '咸香', '面食', '用刚刚包包子余下的馅料，又和了两种面，包了双色饺子，其馅料鲜香、颜色美观。', '面粉、红火龙果粉、水、饺子馅。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772402268491.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:09', '2023-04-06 13:26:09', NULL);
INSERT INTO `t_meal` VALUES (615, '南瓜面条捞面', '原味', '面食', '南瓜面手擀面条，简单营养又美味。', '普通面粉、南瓜面、青菜、鸡蛋、蒜苗、纯净水、花生油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772403752161.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:09', '2023-04-06 13:26:09', NULL);
INSERT INTO `t_meal` VALUES (616, '蘑菇炒芦笋', '清淡', '热菜', '', '蘑菇、芦笋、生抽、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/24/2023022416772403384471.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:08', '2023-04-06 13:26:08', NULL);
INSERT INTO `t_meal` VALUES (617, '雪梨燕窝', '原味', '糖水', '', '燕窝、雪梨、鲜奶。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/25/2023022516772935228301.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:08', '2023-04-06 13:26:08', NULL);
INSERT INTO `t_meal` VALUES (618, '凉拌婆婆丁', '苦味', '凉菜', '', '婆婆丁、木耳、花生米、洋葱、小米辣、大蒜、盐、生抽、糖、醋、香油、味精、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/25/2023022516772937553161.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:08', '2023-04-06 13:26:08', NULL);
INSERT INTO `t_meal` VALUES (619, '皮蛋豆腐', '咸鲜', '凉菜', '超简单快手菜，五分钟轻松搞定', '内酯豆腐、皮蛋、大蒜、小葱、香菜、红辣椒、白芝麻、生抽、陈醋、蚝油、白糖、盐、食用油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/25/2023022516772936915701.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:08', '2023-04-06 13:26:08', NULL);
INSERT INTO `t_meal` VALUES (620, '番茄白菜胡萝卜香菇牛肉筋汤', '咸鲜', '汤类', '牛筋的营养价值是比较高的，主要包含人体所需要的蛋白质和胶原蛋白、矿物质等，能够满足营养和能量的需求。', '牛肉筋、白菜、胡萝卜、番茄、香菇、葱、姜、蒜、花椒、八角、油、一品鲜酱油、蚝油、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/25/2023022516772940286641.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:08', '2023-04-06 13:26:08', NULL);
INSERT INTO `t_meal` VALUES (621, '蜂蜜刺梨汁浸草莓', '酸甜', '开胃菜', '买的特大个的草莓，熟透了，感觉好漂亮，嗯，自然价格也漂亮，4个就一小碗。\n咬一口，有点爆浆的感觉，吃起来太爽了。', '草莓、刺梨原汁、蜂蜜。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/25/2023022516772938058201.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:08', '2023-04-06 13:26:08', NULL);
INSERT INTO `t_meal` VALUES (622, '绿豆芽炒海参', '咸鲜', '热菜', '自己可以发绿豆芽，可以想象的到，未来的岁月，我要开始各种芽菜的发制路程，开启各种芽菜的美食制作啦。', '绿豆芽、发好的海参、食用油、胡萝卜、食盐、葱。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/25/2023022516772939848241.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:08', '2023-04-06 13:26:08', NULL);
INSERT INTO `t_meal` VALUES (623, '蘑菇炒韭黄', '清淡', '热菜', '', '蘑菇、韭黄、生抽、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/25/2023022516773082692561.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:08', '2023-04-06 13:26:08', NULL);
INSERT INTO `t_meal` VALUES (624, '韭菜炒黄蛤肉', '咸鲜', '热菜', '', '黄蛤蜊肉、韭菜、食用油、食盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/25/2023022516773083183561.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:08', '2023-04-06 13:26:08', NULL);
INSERT INTO `t_meal` VALUES (625, '刺梨草莓奶昔', '酸甜', '饮品', '我主要是为了喝刺梨汁才做了这道饮品。\n刺梨汁太酸，直接喝不亚于喝中药。\n就尽量搭配别的口感好的饮品一起喝，所以就打了奶昔。', '刺梨汁、酸奶、特大草莓、蜂蜜。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/25/2023022516773083747411.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:08', '2023-04-06 13:26:08', NULL);
INSERT INTO `t_meal` VALUES (626, '蛤蜊肉炒圆白菜', '咸鲜', '热菜', '给我自己做的瘦身食物，少油少盐的。', '圆白菜、蛤蜊肉、食用油、葱姜、食盐、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/25/2023022516773084248411.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:08', '2023-04-06 13:26:08', NULL);
INSERT INTO `t_meal` VALUES (627, '香酥炸茄子', '五香', '热菜', '简单易学，香酥可口。', '茄子、面粉、纯净水、盐、五香粉、小苏打。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/25/2023022516773109523631.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:08', '2023-04-06 13:26:08', NULL);
INSERT INTO `t_meal` VALUES (628, '酸菜牛蛙', '酸辣', '热菜', '最近超市牛蛙特价，正好家里还有酸菜，安排！', '牛蛙、酸菜、料酒、白胡椒粉、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/25/2023022516773085743621.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:08', '2023-04-06 13:26:08', NULL);
INSERT INTO `t_meal` VALUES (629, '茄子肉沫捞面', '原味', '面条', '河南特色捞面条，浇上茄子肉丁卤，酱香浓郁真好吃，家乡的味道。\n巨好吃的茄子肉沫捞面，吃一次疯狂爱上。', '茄子、挂面、肉沫、蒜、辣椒、粉芡水、花生油、盐、老抽、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/25/2023022516773273709051.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:08', '2023-04-06 13:26:08', NULL);
INSERT INTO `t_meal` VALUES (630, '风吹手撕牛肉干', '五香', '家常菜', '出门买菜，碰到一个卖牦牛肉的小伙子，买了一个包胎，以前一直都是做的麻辣牛肉干，收油煎的那种，过两三个月想去跑一趟318，就想换个口味，做一次风吹手撕牛肉干，方便路上携带，这个方子找了好久，试着做一次。\n风吹的牛肉干一定要风吹干，不要进烤箱，不然口感真的不一样哦。', '牦牛肉、大葱、老姜、洋葱、香菜、二荆条、桔子皮、大蒜、盐、白胡椒、鸡精、糖、十三香、花椒粉、碱、黄酒、生抽、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/18/2023031816791196121471.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:07', '2023-04-06 13:26:07', NULL);
INSERT INTO `t_meal` VALUES (631, '黑乌鱼火锅米线', '麻辣', '热菜', '曾经在成都一个小巷子吃过一家很好吃的火锅米线，一直想复制，基本像了。', '黑乌鱼、米线三人份、大葱、小葱、老姜、大蒜、香菜、小米辣、老坛酸菜、火锅底料、蔬菜、盐、黄酒、白胡椒粉、蛋清、水淀粉、花椒、猪油、白糖、生抽、鸡精、葵花籽油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/25/2023022516773274299841.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:07', '2023-04-06 13:26:07', NULL);
INSERT INTO `t_meal` VALUES (632, '虾仁炒乌贼', '清淡', '热菜', '', '鲜虾、乌贼、姜片、香葱、料酒、酱油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/25/2023022516773274687621.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:07', '2023-04-06 13:26:07', NULL);
INSERT INTO `t_meal` VALUES (633, '猪肘肉夹馍', '咸鲜', '小吃', '猪肘有强体增肥的功效，主要是因为猪肘是营养价值很丰富的一种食物，我们吃猪肘可以帮助补充非常多的蛋白质，在猪肘中还含有大量的胶原蛋白质的存在，这种物质实际上是和肉皮比较相似的，吃了之后就可以让我们皮肤更加的润泽，同时也是强体增肥的好选择。', '猪肘、面粉、姜、圆葱、香菜、花椒、八角、一品鲜酱油、蚝油、料酒、糖、盐、味精、酵母粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/26/2023022616773789195881.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:07', '2023-04-06 13:26:07', NULL);
INSERT INTO `t_meal` VALUES (634, '烤奶茶', '奶香', '饮品', '市面上的奶茶小料多，高糖味重，喝到嘴里品尝不到茶香的味道，被果味粉遮盖了……\n只要咱们家里有一口锅，一个壶，都可以自己做奶茶，简单方便，低糖健康，口感细腻特别好喝。', '牛奶、红茶、红枣、白砂糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/26/2023022616773788689991.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:07', '2023-04-06 13:26:07', NULL);
INSERT INTO `t_meal` VALUES (635, '香辣萝卜干', '香辣', '热菜', '秋末冬初种的大萝卜可收获了，那就做些萝卜干便于储存吧。', '萝卜、小米椒、葱、香菜、盐、鸡精、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/26/2023022616773795505621.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:07', '2023-04-06 13:26:07', NULL);
INSERT INTO `t_meal` VALUES (636, '海参香覃拌绿豆芽', '微辣', '热菜', '', '海参、绿豆芽、胡萝卜、食盐、鸡精、陈醋、小鸡枞菌香覃。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/26/2023022616773795981401.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:07', '2023-04-06 13:26:07', NULL);
INSERT INTO `t_meal` VALUES (637, '水果裸蛋糕', '甜香', '烘焙', '趁着春天草莓大量上市的季节，来做一款甜点吧！', '奶油、草莓、蓝莓、食用油、可可粉、牛奶、低筋面粉、鸡蛋、薄脆、奥利奥碎、醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/02/26/2023022616773796509451.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:07', '2023-04-06 13:26:07', NULL);
INSERT INTO `t_meal` VALUES (638, '胡萝卜马蹄焖羊腿肉', '咸鲜', '热菜', '', '羊腿、胡萝卜、马蹄、生抽、老抽、干辣椒、姜、糖、黄豆酱、调料包、大葱、香菜、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/18/2023031816791434435211.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:07', '2023-04-06 13:26:07', NULL);
INSERT INTO `t_meal` VALUES (639, '云吞皮煎甜粿', '甜味', '小吃', '', '甜粿、鸡蛋、云吞皮。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/14/2023031416787670545891.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:07', '2023-04-06 13:26:07', NULL);
INSERT INTO `t_meal` VALUES (640, '紫菜包饭', '咸香', '小吃', '春季养生，不可缺少紫菜，紫菜又被称为“神仙菜”、“长寿菜”、“维他命宝库”。紫菜的营养价值具有化痰软坚、清热利水、补肾养心等功效。', '紫菜、胡萝卜、黄瓜、香肠、米饭、柠檬汁、芝麻、盐、香油、白醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/08/2023030816782443363781.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:07', '2023-04-06 13:26:07', NULL);
INSERT INTO `t_meal` VALUES (641, '鸡丝拌莴笋', '清淡', '凉菜', '', '鸡胸肉、莴笋、胡萝卜、蒜泥、香油、凉拌酱油、陈醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/08/2023030816782461749391.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:07', '2023-04-06 13:26:07', NULL);
INSERT INTO `t_meal` VALUES (642, '香菜炒牛肉', '咸鲜', '热菜', '', '牛排、香菜、蒜、姜、油、酱油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/08/2023030816782619486351.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:07', '2023-04-06 13:26:07', NULL);
INSERT INTO `t_meal` VALUES (643, '甜椒培根煎孢子甘蓝', '其他', '热菜', '总有人说孢子甘蓝不好吃，孢子甘蓝表示不背这个锅~~', '孢子甘蓝、培根、甜椒、盐、黑椒碎。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/08/2023030816782631638091.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:07', '2023-04-06 13:26:07', NULL);
INSERT INTO `t_meal` VALUES (644, '老干妈木耳', '微辣', '凉菜', '', '木耳、洋葱、香菜、黄瓜、盐、香油、淡盐酱油、糖、老干妈酱、陈醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/08/2023030816782652671861.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:07', '2023-04-06 13:26:07', NULL);
INSERT INTO `t_meal` VALUES (645, '玫瑰花馒头', '甜香', '面食', '三八妇女节，送你一份特殊的礼物，面食玫瑰花，祝愿大家女神节快乐！一年一度的妇女节到了，在这个只属于女人的日子里，祝你青春永驻，万事顺利，事业有成，爱情甜蜜，永远健康，快乐无比。时光知味，怎奈怀揣一颗烟火之心，以烟火为底色，做面食玫瑰花送给你，愿你人比花娇，健康快乐，在此之际祝愿女神们三八妇女节快乐，祝你快乐无限！教你做好吃又好看的玫瑰花馒头，蓬松暄软，这样的面食谁不爱。', '面粉、酵母、无铝泡打粉、温水、菠菜汁、甜菜汁、天然紫薯粉、蝶豆花水、南瓜泥、糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/08/2023030816782788827221.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:07', '2023-04-06 13:26:07', NULL);
INSERT INTO `t_meal` VALUES (646, '红梅绿豆酥', '甜香', '糕点', '2023.3.8节快乐！', '玉米油、低筋面粉、普通面粉、水、绿豆沙馅、食用色素粉红、低筋面粉、玉米油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/08/2023030816782789353731.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:07', '2023-04-06 13:26:07', NULL);
INSERT INTO `t_meal` VALUES (647, '卤猪心', '五香', '热菜', '猪心是猪的心脏，是一种补益食品。适宜卤制的食材不仅可以是肉类、也可是豆制品及根茎蔬菜类。家庭卤制品颜色红润，肉香味美、诱人食欲。', '猪心、葱段、姜片、料酒、生抽、红烧酱油、红曲米、盐、八角、桂皮、花椒、料汁。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/08/2023030816782789704211.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:07', '2023-04-06 13:26:07', NULL);
INSERT INTO `t_meal` VALUES (648, '滑肉生菜汤', '咸鲜', '汤类', '滑肉滑嫩鲜美，生菜脆嫩。', '瘦肉、生菜、姜碎、葱花、盐、豆瓣酱、红薯粉、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/08/2023030816782791553201.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:07', '2023-04-06 13:26:07', NULL);
INSERT INTO `t_meal` VALUES (649, '肉丁炒饭', '咸香', '主食', '剩米饭这样吃，加入肉丁蔬菜，懒人一锅出，营养又美味。', '米饭、肉、胡萝卜、黄瓜、香肠、鸡蛋、油、盐、鸡精、葱。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/08/2023030816782792334981.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:06', '2023-04-06 13:26:06', NULL);
INSERT INTO `t_meal` VALUES (650, '蚝油西蓝花', '清淡', '凉菜', '健康营养，清淡可口。', '西蓝花、盐、蚝油、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/08/2023030816782877277661.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:06', '2023-04-06 13:26:06', NULL);
INSERT INTO `t_meal` VALUES (651, '菠菜炒白萝卜丝', '原味', '热菜', '日子过得就是人间烟火气，一道家常小菜，健康营养，美味可口。', '菠菜、白萝卜、葱、花生油、盐、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/08/2023030816782877622421.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:06', '2023-04-06 13:26:06', NULL);
INSERT INTO `t_meal` VALUES (652, '福袋包', '甜香', '面食', '逢年过节必做美食福袋包，寓意一年蒸蒸日上，福气满满。钱袋又称福袋“袋”谐音“代”寓意着代代有福代代有才吉祥富足钱袋是聚财之吉祥象征也有化煞避邪的作用。寓意能万事如意、代代有福。又俗称袋子，寓意新的一年里财源滚滚，好运连连。\n\n花样面点，一碗面粉做出多种美食，造型独特，可以赏心悦目，又可以吃的面食，真是幸福的味道。简单易学，你学会了吗？', '面粉、酵母、无铝泡打粉、温水、蔬菜汁、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/09/2023030916783320989771.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:06', '2023-04-06 13:26:06', NULL);
INSERT INTO `t_meal` VALUES (653, '苹果山药米糊', '甜香', '饮品', '解腻暖心，丝滑香醇，健康营养，一口就会爱上它，喝完还想续杯！巨好喝！', '小米、苹果、山药、红枣、纯净水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/09/2023030916783327497531.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:06', '2023-04-06 13:26:06', NULL);
INSERT INTO `t_meal` VALUES (654, '什锦鸡蛋卷', '清淡', '小吃', '', '大馄饨皮、蟹味菇、鸡蛋、胡萝卜、西葫芦、虾皮、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/09/2023030916783367404781.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:06', '2023-04-06 13:26:06', NULL);
INSERT INTO `t_meal` VALUES (655, '盘阳饼', '奶香', '面食', '盘阳饼流传于河南，是北方的特色面食。其双面颜色金黄，表皮酥脆、口感暄软香甜、一圈圈的独特造型、可以撕着吃，凉了也不硬。', '普通面粉、大豆油、酵母、泡打粉、奶粉、温水、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/09/2023030916783428298851.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:06', '2023-04-06 13:26:06', NULL);
INSERT INTO `t_meal` VALUES (656, '双菇炒番茄', '清淡', '热菜', '', '蟹味菇、海鲜菇、番茄、盐、零卡糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/09/2023030916783427799811.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:06', '2023-04-06 13:26:06', NULL);
INSERT INTO `t_meal` VALUES (657, '胡萝卜荸荠炒肉片', '咸鲜', '热菜', '', '瘦肉、荸荠、胡萝卜、甜豆角、淀粉、油、盐、料酒、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/09/2023030916783518522451.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:06', '2023-04-06 13:26:06', NULL);
INSERT INTO `t_meal` VALUES (658, '贵州凯里酸汤鱼', '酸辣', '热菜', '暮春三月，来一口贵州凯里的酸汤鱼，打破春的含蓄与欣然。', '贵州凯里红酸汤、免浆黑鱼片、木姜籽油、蒜蓉、生姜、小葱。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/09/2023030916783519971771.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:06', '2023-04-06 13:26:06', NULL);
INSERT INTO `t_meal` VALUES (659, '芹菜蘑菇炒黄豆芽', '清淡', '热菜', '', '蘑菇、黄豆芽、芹菜、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/09/2023030916783518928331.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:06', '2023-04-06 13:26:06', NULL);
INSERT INTO `t_meal` VALUES (660, '桂花核桃枣泥馅', '甜味', '小吃', '', '红枣、核桃、桂花。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/10/2023031016784137515301.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (661, '金桔雪梨苹果茶', '甜味', '饮品', '', '金桔、雪梨、苹果、红枣。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/09/2023030916783658649421.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (662, '紫薯枣泥汤圆', '甜味', '小吃', '', '紫薯、糯米粉、桂花核桃枣泥馅。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/13/2023031316786982466061.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (663, '香辣疙瘩丝', '酸辣', '凉菜', '这是一道配粥的小咸菜，酸、辣、香，早餐配粥和面食，超级下饭，做法也很简单。', '腌疙瘩、蒜、味精、生抽、醋、糖、香油、辣椒油、芝麻。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/09/2023030916783568437711.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (664, '蒜苗炒肉沫', '蒜香', '热菜', '简单美味，下饭菜。', '肉沫、蒜苗、花生油、盐、老抽、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/10/2023031016784136481011.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (665, '香葱鸡蛋炒紫茄', '原味', '热菜', '简单美味，健康营养，家常菜。', '紫茄、鸡蛋、香葱、花生油、盐、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/12/2023031216786001819311.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (666, '家常炖红头鱼', '咸鲜', '热菜', '', '红头鱼、韭菜、食用油、清水、食盐、葱姜、料酒、陈醋、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/12/2023031216786000984451.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (667, '青菜炒豆腐皮', '清淡', '热菜', '简单美味，健康营养，清淡可口，家常菜。', '豆腐皮、青菜、花生油、盐、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/12/2023031216786002216551.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (668, '素炒青菜', '清淡', '热菜', '简简单单又美美味味的素炒青菜，清香可口。', '青菜、花生油、盐、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/12/2023031216786095471221.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (669, '鸡蛋炒河粉', '咸鲜', '小吃', '鲜香微辣。', '河粉、鸡蛋、辣椒酱、娃娃菜、盐、橄榄油、醋、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/14/2023031416787663377741.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (670, '番茄炒豆腐', '清淡', '热菜', '', '老豆腐、番茄、零卡糖、盐、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/12/2023031216786097033151.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (671, '创意玉米水晶猪皮冻', '原味', '凉菜', '猪皮是一种蛋白质很高的肉制品原料，以猪皮加工制作的水晶皮冻不但韧性好，而且成品晶莹剔透似水晶。猪皮味甘性凉，可滋阴补虚、养血益气。是一道色香味型及口感俱佳的美味佳肴。', '猪皮、水、姜片、葱段、玉米粒、豌豆粒、盐、料酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/12/2023031216786097967271.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (672, '创意樱花猪皮冻', '原味', '凉菜', '樱花历史悠久，且品种繁多、颜色各异、多以粉红色、白色居多。樱花具有很高的观赏价值，春季是樱花盛开的季节，其气味为淡淡的花香，以樱花为题材创意一款樱花（型）猪皮冻，颜色鲜艳（零色素），晶莹剔透、口感韧弹、且颜值高。', '猪皮、水、姜、葱段、红火龙果粉、模具、料酒、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/12/2023031216786277181981.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (673, '蛋皮拌菠菜', '蒜香', '凉菜', '春天里，大地里的菠菜又嫩又绿，来一盘蛋皮拌菠菜吧!食材简单、做法简便、营养丰富。很快就光盘了哦。', '菠菜、鸡蛋、胡萝卜、蒜、昆布酱油、凉拌香醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/12/2023031216786334088811.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (674, '干豆腐蔬菜卷', '咸香', '凉菜', '春季养生低脂刮油，干豆腐蔬菜卷，口感清爽，吃上一大盘，减脂没负担，首选菜肴。干豆腐包裹着蔬菜，滋味浓厚，别有风味，清香适口。干豆腐是一种传统的美食，其主要用大豆制作而成，营养价值非常丰富，其中含有大量的铁离子、镁离子、盐酸钙等营养物质。干豆腐一般具有补中益气，清热解毒等功效。干豆腐搭配蔬菜，蘸料汁真是爽口又美味。简单易学，减脂必备神器。', '干豆腐、包菜、胡萝卜、黄瓜、酱油、生抽、香油、蒜、泰椒、辣椒油、陈醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/13/2023031316786767569051.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (675, '素炒杏鲍菇', '咸香', '热菜', '撩人心脾的一道美食，平菇之王鲜香下饭。在菌菇之中，杏鲍菇有着“平菇之王”的美称，是集食用、药用、食疗于一体的珍稀食用菌新品种。杏鲍菇营养非常丰富，含有18种氨基酸和高达25%的植物蛋白含量，能够提高人体免疫力，同时促进消化吸收的能力。杏鲍菇这样做，好吃又下饭，简单的食材也可以做出一道精美的佳肴。', '杏鲍菇、青椒、胡萝卜、葱、姜、蒜、干椒、油、酱油、蚝油、盐、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/13/2023031316786768205681.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (676, '鸡蛋虾酱炒鱼杂', '咸鲜', '热菜', '', '鱼杂、鸡蛋、食用油、清水、姜、料酒、虾酱、葱。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/13/2023031316786766704691.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (677, '烧红头鱼', '咸鲜', '热菜', '我们这边做大鱼，都是只去掉内脏和鱼鳞，保留鱼鳍等，全须全尾寓意是平安健康。听美友的建议，去掉了鱼鳍，因为习惯问题，看着光秃秃的鱼，感觉有点别扭。', '红头鱼、食用油、葱姜、花椒八角、食盐、白糖、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/13/2023031316786767149891.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (678, '鸡蛋牛心菜炒荞麦粑粑', '清淡', '热菜', '', '荞麦粑粑、牛心菜、鸡蛋、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/13/2023031316786769008191.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (679, '鱼头焖豆腐', '咸鲜', '热菜', '', '草鱼头、豆腐、蒜苗、姜丝、油、盐、酱油、蚝油、老抽、胡椒粉、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/13/2023031316786774709971.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:05', '2023-04-06 13:26:05', NULL);
INSERT INTO `t_meal` VALUES (680, '黄瓜炒鸡蛋', '清淡', '热菜', '', '黄瓜、鸡蛋、红椒、油、盐、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/13/2023031316786777689971.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:04', '2023-04-06 13:26:04', NULL);
INSERT INTO `t_meal` VALUES (681, '藠头炒青豆', '咸香', '热菜', '', '藠头、青豆、猪肉、油、盐、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/13/2023031316786780176071.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:04', '2023-04-06 13:26:04', NULL);
INSERT INTO `t_meal` VALUES (682, '杂菜炒木耳', '清淡', '热菜', '家里有几样素菜量都很少，就想着不要浪费，炒在一起，结果意想不到的好味。', '黑木耳、空心菜、西芹、胡萝卜、香菜、葱、蒜末、葱白、油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/13/2023031316786780758011.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:04', '2023-04-06 13:26:04', NULL);
INSERT INTO `t_meal` VALUES (683, '黑全麦艾草红豆卷', '原味', '面食', '', '黑全麦粉、普通面粉、艾草汁、蜜红豆、酵母粉、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/13/2023031316786896656711.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:04', '2023-04-06 13:26:04', NULL);
INSERT INTO `t_meal` VALUES (684, '虾仁海参炒儿菜', '咸鲜', '热菜', '', '儿菜、海参、虾仁、食用油、清水、食盐、葱姜。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/13/2023031316786897664381.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:04', '2023-04-06 13:26:04', NULL);
INSERT INTO `t_meal` VALUES (685, '炒粉皮', '咸香', '热菜', '', '粉皮、肉末、水、生抽、葱蒜末、盐、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/13/2023031316786898121001.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:04', '2023-04-06 13:26:04', NULL);
INSERT INTO `t_meal` VALUES (686, '韭黄炒西葫芦', '清淡', '热菜', '', '韭黄、西葫芦、生抽、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/13/2023031316786981651421.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:04', '2023-04-06 13:26:04', NULL);
INSERT INTO `t_meal` VALUES (687, '清蒸三黄鸡', '清淡', '热菜', '', '三黄鸡、姜片、盐、料酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/13/2023031316787194299281.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:04', '2023-04-06 13:26:04', NULL);
INSERT INTO `t_meal` VALUES (688, '生煎锅贴', '咸香', '小吃', '生煎锅贴，外皮酥脆，香而不腻，味美咸香，吃着真过瘾。锅贴是中国传统小吃，中国著名传统小吃，属于煎烙煮馅类食品。制作精巧，味道可口。根据季节配以不同鲜蔬菜。锅贴的形状各地不同，一般是细长饺子形状，但天津锅贴类似褡裢火烧。锅贴底面呈深黄色，酥脆，面皮软韧，馅味香美。稻香居锅贴以其选料严谨、制作精细、品质优美而闻名古城。成品灌汤流油，色泽黄焦，鲜美溢口。东北也称水煎包。锅贴跟煎饺不能混淆，两者并不一样。今天教你在家怎么做生煎锅贴好吃外皮酥脆可口，好吃又美味。', '面粉、温水、馅料、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/14/2023031416787645097581.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:04', '2023-04-06 13:26:04', NULL);
INSERT INTO `t_meal` VALUES (689, '蒜蓉粉丝开背虾', '蒜香', '热菜', '最具烟火气的撩人美食，蒜蓉粉丝开背虾蒜香味浓郁，鲜美绝了！过年必备年夜饭菜肴。日子有了烟火气，人生才有温度。谁的人生都离不开柴米油盐的慰籍。唯有这一缕人间烟火，可以治愈你的灵魂。蒜蓉粉丝开背虾，蒜香味浓郁，真得好吃放不下筷子，虾肉鲜美，味道绝了。今天教你怎么做这一道美食，好吃又美味，简单易学。', '大虾、粉丝、蒜、盐、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/14/2023031416787642767251.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:04', '2023-04-06 13:26:04', NULL);
INSERT INTO `t_meal` VALUES (690, '巧克力冰糕', '奶香', '甜品', '天气越来越暖和了，想吃冷饮还有点早，做个无需冷冻的巧克力冰糕，提前感受夏日甜品吧', '鸡蛋黄、牛奶、巧克力、玉米淀粉、可可粉、白砂糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/14/2023031416787641351771.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:04', '2023-04-06 13:26:04', NULL);
INSERT INTO `t_meal` VALUES (691, '韭菜鸡蛋饼', '蒜香', '面食', '', '韭菜、鸡蛋、面粉、食用油、盐和鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/13/2023031316787195941061.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:04', '2023-04-06 13:26:04', NULL);
INSERT INTO `t_meal` VALUES (692, '马蹄鲜肉小笼包', '咸鲜', '面食', '', '眉毛肉、高筋小麦粉、水、大葱、马蹄、姜、生抽、老抽、料酒、蚝油、香油、色拉油、鸡精、花椒粉、胡椒粉、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/27/2023032716799204679521.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:04', '2023-04-06 13:26:04', NULL);
INSERT INTO `t_meal` VALUES (693, '鲈鱼籽炒鸡蛋', '清淡', '热菜', '', '鲈鱼籽、鸡蛋、芹菜、胡萝卜、油、盐、胡椒粉、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/14/2023031416787737387411.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:04', '2023-04-06 13:26:04', NULL);
INSERT INTO `t_meal` VALUES (694, '荠菜冬笋炒蛋', '咸鲜', '热菜', '', '柴鸡蛋、荠菜、冬笋、蒜、油、盐、料酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/17/2023031716790548714871.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:04', '2023-04-06 13:26:04', NULL);
INSERT INTO `t_meal` VALUES (695, '燕麦三米粥', '原味', '粥', '', '燕麦、红米、小米、粳米、纯净水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/17/2023031716790547818331.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:04', '2023-04-06 13:26:04', NULL);
INSERT INTO `t_meal` VALUES (696, '双色如意蛋糕卷', '甜香', '烘焙', '本人很少做蛋糕卷，今天用天然红火龙果粉制作一款双色如意蛋糕卷，形似如意、颜值颇高、口感柔软、香甜可口、老少皆宜。', '低筋面粉、色拉油、牛奶、鸡蛋、红火龙果粉、玉米淀粉、白糖、白醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/18/2023031816791065949911.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:04', '2023-04-06 13:26:04', NULL);
INSERT INTO `t_meal` VALUES (697, '金华火腿炒雷笋', '微辣', '热菜', '', '雷笋、金华火腿、食用油、干辣椒、葱姜、食盐、生抽、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/17/2023031716790548274091.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:04', '2023-04-06 13:26:04', NULL);
INSERT INTO `t_meal` VALUES (698, '5分钟快手菜～炒油蛤', '香辣', '热菜', '', '油蛤、生姜、小米椒、香葱、食用油、辣椒酱、葱姜料酒、淀粉、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/17/2023031716790643087351.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:04', '2023-04-06 13:26:04', NULL);
INSERT INTO `t_meal` VALUES (699, '煎蛋午餐肉拌菠菜', '蒜香', '凉菜', '', '煎蛋、午餐肉、菠菜、食用油、大蒜、食盐、鸡精、陈醋。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/18/2023031816791066544591.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:03', '2023-04-06 13:26:03', NULL);
INSERT INTO `t_meal` VALUES (700, '西葫芦海鲜菇炒荞麦面', '清淡', '面条', '', '荞麦面、西葫芦、海鲜菇、酱油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/18/2023031816791197277801.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:03', '2023-04-06 13:26:03', NULL);
INSERT INTO `t_meal` VALUES (701, '韭菜炒雷笋', '咸鲜', '热菜', '', '雷笋、韭菜、食用油、猪肉、食盐、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/18/2023031816791197736201.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:03', '2023-04-06 13:26:03', NULL);
INSERT INTO `t_meal` VALUES (702, '香煎红娘鱼', '咸香', '热菜', '', '红娘鱼、姜丝、葱段、油、盐、胡椒粉、花椒粉、酥炸粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/18/2023031816791198599021.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:03', '2023-04-06 13:26:03', NULL);
INSERT INTO `t_meal` VALUES (703, '蛋黄果奶昔', '酸甜', '饮品', '', '蛋黄果、酸奶、纯净水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/18/2023031816791430541251.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:03', '2023-04-06 13:26:03', NULL);
INSERT INTO `t_meal` VALUES (704, '凉拌麻辣花蚬', '麻辣', '凉菜', '我和老公有回在外面吃饭，商家赠送了凉拌麻辣花蚬，哎呀！太好吃了，回家赶紧操练起来！这也太简单了，好好吃，停不下来。', '花蚬、洋葱、香菜、泰椒、葱、姜、盐、海鲜酱油、蒸鱼豉油、香油、蚝油、藤椒油、糖、料酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/18/2023031816791431156091.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:03', '2023-04-06 13:26:03', NULL);
INSERT INTO `t_meal` VALUES (705, '清蒸鳕鱼', '咸鲜', '热菜', '', '鳕鱼、葱、姜、辣椒、盐、黑椒碎、蒸鱼豉油、料酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/18/2023031816791431594761.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:03', '2023-04-06 13:26:03', NULL);
INSERT INTO `t_meal` VALUES (706, '炖肉卤蛋', '酱香', '热菜', '', '五花肉、鸡蛋、葱姜蒜、面酱、草果、白芷、八角、花椒、桂皮、小茴香、生抽、料酒、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/18/2023031816791432732761.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:03', '2023-04-06 13:26:03', NULL);
INSERT INTO `t_meal` VALUES (707, '韭菜炒洋芋艿', '清淡', '热菜', '', '洋芋艿、韭菜、酱油、盐、零卡糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/18/2023031816791431982211.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:03', '2023-04-06 13:26:03', NULL);
INSERT INTO `t_meal` VALUES (708, '瘦肉丝茭白炒菠菜', '清淡', '热菜', '', '瘦肉丝、茭白、菠菜、料酒、生抽、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/18/2023031816791432371311.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:03', '2023-04-06 13:26:03', NULL);
INSERT INTO `t_meal` VALUES (709, '火腿腐乳春笋酿', '咸鲜', '热菜', '暮春三月，春笋当季，除了快炒、腌笃鲜，配上腐乳这种独特的食材，用猪肉酿笋，会碰撞出不一样的滋味！赶紧来啖春吧。', '春笋、猪肉糜、荸荠、绍酒、姜末、老抽、鸡蛋、生粉、盐、飞鱼籽、小虾皮、装饰叶、火腿腐乳、鸡汤、白凉粉、糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/18/2023031816791433438971.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:03', '2023-04-06 13:26:03', NULL);
INSERT INTO `t_meal` VALUES (710, '薄荷青团乌龙茶', '甜味', '饮品', '青团也有春天，加入薄荷粉的迷你青团，Q弹清凉，吃起来也没了负担，赶紧做起来吧！', '糯米粉、薄荷粉、青汁粉、澄粉、糖粉、热水、蜜桃乌龙茶包、白糖、糯米粉、澄粉、清水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/18/2023031816791434027381.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:03', '2023-04-06 13:26:03', NULL);
INSERT INTO `t_meal` VALUES (711, '蒜蓉烤生蚝', '蒜香', '热菜', '', '生蚝、蒜、柠檬、小米椒、香葱、食用油、料酒、蚝油、生抽、白糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/18/2023031816791506792091.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:03', '2023-04-06 13:26:03', NULL);
INSERT INTO `t_meal` VALUES (712, '果蔬烤鸡肉', '糟香', '热菜', '', '鸡胸肉、芦笋、小番茄、香菇、迷迭香、京酱肉丝调味料、料酒、胡椒粉、海盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/18/2023031816791509998621.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:03', '2023-04-06 13:26:03', NULL);
INSERT INTO `t_meal` VALUES (713, '金华火腿梅花肉炖雷笋', '咸鲜', '热菜', '腌笃鲜的另一个版本。', '金华火腿、梅花肉、雷笋、纯净水、葱姜、虫草海马酒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/19/2023031916791951467141.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:03', '2023-04-06 13:26:03', NULL);
INSERT INTO `t_meal` VALUES (714, '香辣干丝', '香辣', '凉菜', '', '干豆腐丝、毛葱、香菜、盐、味精、海鲜酱油、醋、辣椒油、香油、糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/19/2023031916791951995251.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:03', '2023-04-06 13:26:03', NULL);
INSERT INTO `t_meal` VALUES (715, '简易三文治', '原味', '小吃', '', '三文治、生菜、鸡蛋、小西红柿、桑葚。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/19/2023031916791952438621.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:02', '2023-04-06 13:26:02', NULL);
INSERT INTO `t_meal` VALUES (716, '苦瓜黄豆排骨煲', '咸香', '热菜', '', '苦瓜、黄豆、猪翅排、蒜、油、盐、酱油、蚝油、胡椒粉、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/19/2023031916792090693001.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:02', '2023-04-06 13:26:02', NULL);
INSERT INTO `t_meal` VALUES (717, '七窨茉莉卡曼橘果汁', '果味', '饮品', '仿的某客的，非原版配方。完全自己瞎折腾的，七八分像吧！', '卡曼橘浓缩原液、七窨茉莉花茶、麦芽糖、蜂蜜、小青柑、薄荷。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/19/2023031916792137907421.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:02', '2023-04-06 13:26:02', NULL);
INSERT INTO `t_meal` VALUES (718, '番茄珍珠汤', '清淡', '汤类', '最近诺如肆虐，我们全家也都不幸中招。这期间难受、没食欲，而且不能吃正常饭菜，小米粥都吃够了！今天做了简单快手清淡的珍珠汤，总算告别小米粥了！', '面粉、鸡蛋、番茄、黄瓜、十三香、盐、香油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/19/2023031916792091859211.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:02', '2023-04-06 13:26:02', NULL);
INSERT INTO `t_meal` VALUES (719, '绿茶粉烙饼', '咸鲜', '面食', '用绿茶粉和面烙饼，外酥里软、层层叠叠、且层次分明、颜色美观、香酥可口。', '面粉、食用油、室温水、开水、绿茶粉、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/19/2023031916792137449921.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:02', '2023-04-06 13:26:02', NULL);
INSERT INTO `t_meal` VALUES (720, '红火龙果粉蒸饺', '咸鲜', '面食', '用天然红火龙果粉和面，用青萝卜、胡萝卜调制了素馅的饺子馅，包好的蒸饺颜色美观(而且零素色)、可放心食用。', '面粉、青萝卜、胡萝卜、生抽、料酒、食用油、五香粉、蚝油、姜末、葱末、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/19/2023031916792138448501.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:02', '2023-04-06 13:26:02', NULL);
INSERT INTO `t_meal` VALUES (721, '黑木耳茭白烧圆素鸡', '清淡', '热菜', '', '圆素鸡、茭白、黑木耳、酱油、盐、零卡糖、味精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/19/2023031916792326702051.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:02', '2023-04-06 13:26:02', NULL);
INSERT INTO `t_meal` VALUES (722, '酱香把子肉', '酱香', '热菜', '酱香浓郁，大块朵颐。', '五花肉、黄豆酱、啤酒、盐、白糖、生抽、葱姜、干辣椒、八角、香叶、桂皮、花椒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/27/2023032716799064776141.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:02', '2023-04-06 13:26:02', NULL);
INSERT INTO `t_meal` VALUES (723, '家常炖羊排', '咸鲜', '热菜', '原汁原味，香味扑鼻。', '羊排、葱姜、盐、花椒、干辣椒。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/27/2023032716799206432101.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:02', '2023-04-06 13:26:02', NULL);
INSERT INTO `t_meal` VALUES (724, '酱香蒸排骨', '酱香', '热菜', '软烂脱骨，酱香味浓。', '小排骨、黄豆酱、盐、葱姜、料酒、玉米淀粉、生抽、白糖、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/27/2023032716799151809111.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:02', '2023-04-06 13:26:02', NULL);
INSERT INTO `t_meal` VALUES (725, '豉香蒸鸭肉', '咸鲜', '热菜', '豉香味浓郁，软烂脱骨。', '鸭腿、红薯淀粉、鸡蛋、盐、葱姜、生抽、豆豉、鸡精。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/27/2023032716799229403861.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:02', '2023-04-06 13:26:02', NULL);
INSERT INTO `t_meal` VALUES (726, '排骨汤粉', '咸鲜', '小吃', '10分钟可搞定的美味汤粉。', '米粉、红烧排骨、生菜、盐、鸡精、香葱。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/27/2023032716799238108681.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:02', '2023-04-06 13:26:02', NULL);
INSERT INTO `t_meal` VALUES (727, '黑木耳鲜肉云吞', '咸鲜', '小吃', '', '猪肉末、黑木耳、香菜、葱花、酱油、香油、胡椒粉。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/27/2023032716798876276891.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:02', '2023-04-06 13:26:02', NULL);
INSERT INTO `t_meal` VALUES (728, '牛柳炒酸萝卜条', '酸辣', '热菜', '非常下饭的小炒。', '牛排、酸萝卜、蒜末、小米辣、姜末、油、蚝油、胡椒粉、糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/27/2023032716798876823141.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:02', '2023-04-06 13:26:02', NULL);
INSERT INTO `t_meal` VALUES (729, '外婆菜炒饭', '咸鲜', '主食', '', '剩米饭、外婆菜、鸡蛋、葱、胡萝卜、十三香、生抽。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/27/2023032716798954006901.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:01', '2023-04-06 13:26:01', NULL);
INSERT INTO `t_meal` VALUES (730, '菠菜炒蒸红萝卜丝', '原味', '热菜', '简单美味，健康营养。', '菠菜、蒸红萝卜丝、蒜苗、花生油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/27/2023032716798954759631.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:01', '2023-04-06 13:26:01', NULL);
INSERT INTO `t_meal` VALUES (731, '核桃麻沙青团', '甜味', '小吃', '麻花郎青团是上海奉贤当地拥有600年历史的非遗食物，麻花郎学名“泥胡菜”，是奉贤庄行镇当地的一种野菜，有些微微独特的青草药香。前阵子跟着当地的非遗传人胖阿姨学习了制作的技法，忍不住手痒。', '糯米粉、澄粉、糖粉、青汁粉、热水、红豆沙、黑芝麻核桃粉、糯米粉、澄粉、清水。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/27/2023032716799057726881.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:01', '2023-04-06 13:26:01', NULL);
