INSERT INTO `t_meal` VALUES (739, '香葱炒蒸枸蒲穗', '葱香', '热菜', '春天的味道，蒸菜枸蒲穗，养肾明目，润肠通便，清热解毒，软筋q弹，真是一道好菜。', '蒸枸蒲穗、香葱、花生油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/28/2023032816799718474141.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:00', '2023-04-06 13:26:00', NULL);
