INSERT INTO `t_meal` VALUES (744, '茴香鸡蛋酱', '酱香', '家常菜', '茴香是一种药食同源的食材，气味芳香，有散寒的功效。喜欢茴香的人一般都超级喜欢，也有很多接受不了的。我喜欢用来炸酱拌面拌饭吃，也喜欢用来包饺子。', '茴香、大酱、葱、鸡蛋、十三香、蚝油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/28/2023032816799865121461.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:00', '2023-04-06 13:26:00', NULL);
