INSERT INTO `t_meal` VALUES (746, '酱香豆腐', '酱香', '热菜', '', '老豆腐、香葱、豆瓣酱、生抽、零卡糖。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/28/2023032816800014266561.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:00', '2023-04-06 13:26:00', NULL);
INSERT INTO `t_meal` VALUES (747, '低脂版馒头鸡肉披萨', '咸鲜', '烘焙', '冰箱里的馒头太多？单吃馒头又索然无味？不妨试试这款色彩丰富的馒头披萨吧，采用的是减脂50%的芝士片和低热量的奥尔良鸡肉，在享受美味的同时又不用担心长胖哦', '馒头、鸡蛋、红椒、佛手瓜、杏鲍菇、减脂50%芝士、奥尔良鸡肉、番茄酱、盐、食用油。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/28/2023032816800015206001.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:00', '2023-04-06 13:26:00', NULL);
INSERT INTO `t_meal` VALUES (748, '鸡蛋炒蒸枸蒲穗', '原味', '热菜', '可遇不可求的枸蒲穗，野生食材最健康，加一碗面粉，蒸熟即美味又好吃。', '枸蒲穗、鸡蛋、花生油、盐。', NULL, 'https://i3.meishichina.com/attachment/recipe/2023/03/28/2023032816800082638271.jpg?x-oss-process=style/c320', 2, 0, NULL, NULL, NULL, 0, '2023-04-06 13:26:00', '2023-04-06 13:26:00', NULL);
