INSERT INTO `t_meal` VALUES (648283, '宇宙无敌好吃的糟糠', '平淡', '汤', '九食堂雅俗共赏', '稻米壳', '', 'http://43.139.60.130:9000/diet-recommend/v2-555c4c15e21115daa61cc8d9ccc77feb_1440w.jpg', 2, 1, NULL, NULL, '', 0, '2023-06-14 10:54:36', '2023-06-14 10:54:36', NULL);
INSERT INTO `t_menu` VALUES (419, '养气血就是养命！春天多吃这5样，补气养血强免疫', '养气血就是养命，气血不足“百病生”！春天多吃这5样，补气养血，强免疫。\r\n推荐五种食材：桂圆、红枣、山药、鸭血、鸡肉。', '养生', 15.00, 'https://i3.meishichina.com/attachment/collect/2023/04/04/2023040416806108473961.jpg?x-oss-process=style/c320', NULL, 2, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (420, '多吃这4样天然强心剂，养心护心，越吃越年轻', '食物中有一种微量元素，被医学专家称为“心脏的守护神”，它就是硒。硒是人体必需的微量元素，是多种酶的活性中心，缺硒会使酶的活性下降，从而导致心血管病的高发。补硒即能清垃圾、调血脂、抗老化、调免疫来减少多种心脑血管疾病的发生，又能提高免疫力和对抗疾病的能力。所以，建议中老年人，别舍不得花钱，多吃这4样富硒食物，养心护心，越吃越年轻。\r\n推荐食材：花生米、松茸、芦笋、三文鱼。', '养生', 12.00, 'https://i3.meishichina.com/attachment/collect/2023/04/02/2023040216804286698691.jpg?x-oss-process=style/c320', NULL, 2, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (421, '补脑第1名竟是它，比核桃补脑，比鸡蛋营养，孩子常吃记性好！', '鹌鹑蛋营养丰富，素有“卵中佳品”“动物中的人参”称号，健脾补肾、滋养五脏、补益气血、强筋骨等功效。\r\n新鲜的鹌鹑蛋外壳呈灰白色，带有红褐色或紫褐色的斑纹，其色泽鲜艳，外壳坚硬，富有光泽；用手轻轻摇动，没有声音的是鲜蛋，有水声的是陈蛋；打开蛋黄呈深黄色，蛋清透明且粘稠。', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/03/30/2023033016801676537911.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (422, '护眼王叶黄素，不仅守护眼睛，女生吃了更有巨大好处！', '叶黄素对眼健康十分重要，作为人体非常重要的一种营养素，功效不仅局限于护眼。它对皮肤也有不少好处，可改善皮肤干燥、多屑、角质化、表皮细胞硬鳞状等皮肤疾病。此外，对人体的心脏、血清、消化道、内分泌都有良好的作用。如何补充叶黄素？人体必须依靠外来摄入。叶黄素的主要食物来源是绿色叶菜和颜色鲜艳的蔬果。常见蔬果有：韭菜、苋菜、南瓜、芹菜叶、香菜、菠菜、小白菜、空心菜等。合理搭配让身体吸收“叶黄素”最大化？', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/03/29/2023032916800799729721.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (423, '春天不养肝，脸上爱长斑，多吃这5种食物，养肝护肝显年轻～', '​俗话说女人不养肝，脸上易长斑。肝脏在我们身体中就像一把保护伞，它参与代谢，促进排泄，帮助身体排除毒素。如果肝脏的排毒功能下降，皮肤会变差、变黄、长斑。所以，女人日常要重视肝脏养护。建议日常多吃以下5种食物，气色红润显年轻：\r\n韭菜、枸杞、乌梅、玫瑰花以及糙米、玉米、燕麦、小米、豆类等粗杂粮。', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/03/28/2023032816800024242761.jpg?x-oss-process=style/c320', NULL, 2, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (424, '它是花青素之王！每周吃两次，排除毒素，想不健康都难！', '​紫甘蓝也有人称它为紫包菜，和包菜都属于十字花科芸薹属甘蓝种。含有丰富的花青素，号称花青素之王，这是1种强有力的抗氧化剂！平时多摄入这种花青素含量高的菜，不仅有助于有抗衰老，还能增强血管弹性，也是1种抗癌的好食材；紫甘蓝的纤维和钾的含量也很优秀，膳食纤维含量是包菜的 2.6 倍、钾含量是包菜的 2.1 倍，对高血压人群来说很友好~\r\n每周吃两次，排除毒素，皮肤好了，血管干净了，想不健康都难！', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/03/27/2023032716799072045031.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (425, '春天，藏在身边的天然补铁补钙剂，营养高吸收好', '​榆钱是榆树的翅果，因其外形圆薄，如成串的钱币，故而得名。除了好吃，寓意好，有清热利湿，健脾养胃，清热安神的价值。\r\n它称得上是身边的天然补铁、补钙剂。所含的铁离子含量是菠菜的11倍，西红柿的50倍；钙离子含量是菠菜的3倍，人体易吸收，最重要的是，它还不含草酸。\r\n另外，它还含有丰富的膳食纤维，可以控糖、控胆固醇，非常适合“三高”人群食用。', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/03/25/2023032516797363661201.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (426, '它是“天然解毒王”，春天吃最好，养肝排毒，农村遍地是…', '春季肝火旺往往由于素体肝火旺，或者容易生气、肝郁气滞、气郁化火而引起，特别是人们发脾气的频率更高，一旦动怒，肝毒飙升，长期积压会损伤肝脏。所以春天不仅要多吃养肝护肝的食物，还需要多吃“排肝毒”的食物，它是“天然解毒王”蒲公英，给肝脏”洗个澡”，疏肝理气，养肝排毒，清热解毒、消肿散结的功效，特别下火。\r\n一到春天，农村家遍地都是，春天的蒲公英最鲜美，抓紧吃～', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/03/24/2023032416796427373211.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (427, '比红薯通便，比芋头养人！减脂抗癌，通便排毒，春天一定要多吃～', '春天的蔬菜非常多，但有一种食材非常美味，被冠以“蔬菜之王”的美称，说的就是芦笋。芦笋中含有丰富的矿物质，维生素，膳食纤维，以及其他微量元素，具有通肠润便，排毒养颜，抗老还有降压，清肠胃等好处。特别是芦笋中的天冬酰胺和微量元素硒、钼、铬、锰等，具有调节机体代谢、提高身体免疫力的功效，而硒元素被誉为天然的重金属解毒剂；芦笋还富含芦丁、芦笋皂苷，这些营养元素是防治心脑血管疾病、预防和治疗癌症的有效物质。所以，春天一定要多吃芦笋～', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/03/23/2023032316795592144531.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (428, '它是天然玻尿酸，每天一小碗，皮肤细滑，素颜也很美！', '春天天气干燥，皮肤多有敏感，不仅皮肤非常干燥，甚至还有红血丝，护肤就成了头等大事。无论用什么药物，用什么化妆品都不起作用，其实皮肤问题最好的方法就是食补，每天来一小碗天然“玻尿酸”桃胶，皮肤滑滑嫩嫩的，不敷面膜，素颜也很美！', '美容', 0.00, 'https://i3.meishichina.com/attachment/collect/2023/03/22/2023032216794941135081.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (429, '春天，懂行的都吃它，一养肝，二排毒，三助眠，四强免疫…', '茼蒿，又叫“皇帝菜”，有“天然保健品，植物营养素”之称。营养极其丰富、富含蛋白质、维生素、胡萝卜、膳食纤维、矿物质等营养， 常吃补脾虚、平肝火、助睡眠，现在吃正当季，千万别错过。 也是“天然安眠药”，三天两头吃安神睡得香精神好。\r\n茼蒿一养肝，二排毒，三助眠，四强免疫，春天要多常吃，随手一做，就鲜香美味。', NULL, 0.00, 'https://i3.meishichina.com/attachment/collect/2023/03/19/2023031916792179033321.jpg?x-oss-process=style/c320', NULL, 2, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (430, '不起眼的小食材，却是腹部脂肪的收割机，让你轻松吃出小蛮腰～', '腹部赘肉是很多人的烦恼，不起眼的小食材，却是腹部脂肪的“收割机”，让你轻轻松松的吃出小蛮腰。', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/03/18/2023031816791409339541.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (431, '6种高维C蔬菜，简单一炒，全家一起提免疫、强抵抗！', '一人甲流，全家遭殃，尤其体质差的人易感冒。所以要及时提升自身的免疫力，除积极锻炼身体外，多吃一些含维C丰富的蔬菜，维生素C有抗氧化、解毒、提高免疫力等作用。\r\n推荐食材：彩椒、芥蓝、菜苔、小白菜、青椒、花菜。', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/03/17/2023031716790466993571.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (432, '五脏最爱这5种养生豆，健脑养心还长寿，好处多多身体棒！', '俗话说，“宁可一日无肉，不可一日无豆”，豆类是日常饮食不可少的食物，富含高蛋白、氨基酸、钙、镁、钾及维生素能满足人体的需求，易于被消化吸收。这5种“养生豆”，常吃补肾益气，健脑养心，好处多多，身体棒！\r\n推荐日常多吃黑豆、红豆、黄豆、绿豆、蚕豆哦！', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/03/16/2023031616789597069511.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (433, '我家最爱的春日早餐，简单又快手，满屋飘香！', '我家最爱的春日早餐，简单又快手，1把韭菜3个鸡蛋，一搅一摊，满屋飘香，吃不腻～', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/03/14/2023031416787925459741.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (434, '3月，遇到这菜别手软！清热解毒营养高，一焯一拌清脆爽口！', '3月，马兰头正鲜嫩，马兰头又叫红梗菜，是江、浙一带比较常见的野菜，营养价值高，还可入药。\r\n嫩苗可食用，作为野菜，它可以和荠菜有一拼，尤其是在江、浙、沪等地，人们也非常喜欢吃，还可以炒食、凉拌或做汤。马兰头拌香干可是一道名菜，一焯一拌，清脆爽口，鲜到山珍海味都不换！', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/03/09/2023030916783554421121.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (435, '甲流来势汹汹，强烈建议三餐这样吃，助力身体恢复，好得快～', '甲流来势汹汹，患者饮食上要注意以清淡为主，减少辛辣、刺激的食物摄入，可以多吃些富含营养、易消化吸收的食物或者粥，如大米粥、豆腐汤及山药粥等等。同时还要多吃些富含维生素的水果和蔬菜，如西兰花、菠菜、白菜以及猕猴桃等，不仅补充身体的营养，还可以预防出现便秘。', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/03/08/2023030816782644068021.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (436, '春燥上火，咽痛干痒干咳……常见5宝随手一煮，让你润透肺腑～', '春天到来，天气转暖，阳气上升。肝脏积蓄的内热散发出来后，人体就会出现春燥，表现为“上火”，嗓子不适，咽喉肿痛。“上火”多与肝胃和肺有关，肺主皮毛，与大肠相表里，也就是说，我们的皮肤、毛发、排毒等问题，都与肺息息相关。\r\n记得饮食常内调，记得这常见5宝：银耳、梨、百合、荸荠、莲藕，随手一煮，让你润透肺腑～', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/03/08/2023030816782628843781.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (437, '春季是祛湿的最佳时期，多吃5样常见食材，化湿健脾，一身轻松', '所谓「千寒易去，一湿难除」。大家日常养生时，常用的食物里有一些能够起到健脾化湿的作用，例如：山药、红豆、玉竹、薏米、麦芽等。\r\n做菜的时候，可适当放入一点香料，比如花椒、白豆蔻、砂仁等，这些食材多能芳香醒脾化湿、振奋阳气，但是要注意不可多用，以免辛辣伤阴。', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/03/04/2023030416779125571411.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (438, '3月，抓紧吃这菜，全身是宝，不懂吃真可惜！', '平常吃莴笋，大家都会犯一个误区：把叶子直接摘下来扔掉，那可是宝藏食材啊！不懂吃真可惜！\r\n莴笋叶里胡萝卜素的含量是茎的5.9倍，维生素C是茎的3.3倍。此外，叶子里的不溶性膳食纤维含量也更高。莴笋叶的营养价值更高，它含有大量的维生素和矿物质，常吃可以消除疲劳、刺激肠胃消化、增进食欲，还有美容养颜的作用。', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/03/02/2023030216777575652021.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (439, '它是春天里的宝，也是女性保护草，女生吃了有巨大好处～', '春天这草是个“宝”，2月下旬，气温开始渐渐升高了，艾草也悄悄地长出来的新芽，这个时候吃最是鲜嫩了。艾草自带清香，非常开胃好吃又营养，对女人特别好，艾草也被称为“女性的保护草”，艾草苦辛而温，有暖气血而温经脉，逐寒湿而止冷痛的作用，对于体寒痛经的女性特别好。开春寒气还特别重，不妨适当的吃一些艾草。', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/02/27/2023022716774976515171.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (440, '它才是隐藏的钙王，更是春天补钙的一把好手！', '​豆腐干才是隐藏的补钙王，豆干可以说是浓缩的精华、更是春天补钙的一把好手！有些地区也叫它豆干，这种豆制品是豆浆凝固后，用挤压、烘干等方式，脱去大量水分做成豆类食物。\r\n虽然含水量减少了，但它的蛋白质和钙含量却大大提升：每100克豆腐干的钙含量高达1019毫克，约是豆腐钙含量的10倍！是隐藏在豆腐中的“补钙王”。蛋白质是豆腐的2.2倍，胆固醇含量是0。一小块豆腐干就能满足咱一天的蛋白和钙需求量~', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/02/24/2023022416772297044121.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (441, '它被称为早春菜王，又鲜又嫩又脆，还能减肥瘦身～', '“食过春笋，才知春之味”。春笋又鲜又嫩又脆，，被称为春天的“菜王”。立春之后，一棵棵竹笋拱出泥土，采挖出来，剥开金黄的笋壳，笋肉洁白光润，吃起来细嫩清脆，口感清新可口。', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/02/23/2023022316771456046571.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (442, '春季阳气不足，精神不振代谢慢，多吃这6种升阳食物！', '春季草木万物萌发，阳气也开始升发，养生方面也应该顺应季节特点，通过饮食、运动等方式，帮助自身体养阳补阳。从中医的角度来说，每个人体内都存在阳气，如果阳气不足，就可能出现新陈代谢缓慢，进而出现精神不振、营养不良等情况。所以，春季可以多吃韭菜、香椿、香菜、艾叶、芡实、茴香菜6种升阳食物，将“阳气”补回来。', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/02/22/2023022216770595276501.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (443, '春天第一鲜正当季，高钙高蛋白，不懂吃真可惜！', '俗语说：“春食荠菜赛仙丹”，营养价值特别高！高钙高蛋白，蛋白质含量在蔬菜中名列前茅，维生素C含量超过柑橘，钙含量超过豆腐，胡萝卜素含量与胡萝卜相当。虽然，一年四季都有，但只有春天才是最佳食用季节，千万别错过。', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/02/19/2023021916768003474311.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
INSERT INTO `t_menu` VALUES (444, '北方人爱疯了这一口，做一锅，嘎嘎香～简单又省事', '北方的传统特色小吃，一般是先将调揉好的面，切成短条，待锅里的蔬菜、肉等煮好后，两手将短条面压开，拉长，一手拿面条，一手揪为方块形下到锅里煮熟即可。也可以直接买现成饿面片，简单又省事，做一锅，嘎嘎香～吃一碗，那叫一个舒坦～', NULL, NULL, 'https://i3.meishichina.com/attachment/collect/2023/02/17/2023021716766318742661.jpg?x-oss-process=style/c320', NULL, NULL, NULL, NULL, NULL, 0, '2023-04-07 04:15:09', '2023-04-07 04:15:09', NULL);
